import{_ as g,o as t,c as n,a as i,t as u,C as _,M as h,U as k,f as p,F as w,p as b,e as D,q as f}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(v,[["render",x],["__scopeId","data-v-69792f02"]]),M=JSON.parse(`[{"page_url":"https://ru.wikipedia.org/wiki/%D0%AE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D1%8F_%D0%B8_%D0%AE%D0%B6%D0%BD%D1%8B%D0%B5_%D0%A1%D0%B0%D0%BD%D0%B4%D0%B2%D0%B8%D1%87%D0%B5%D0%B2%D1%8B_%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Islas_Sandwich_del_Sur.png","page_title":"Южная Георгия и Южные Сандвичевы Острова","context_page_description":"Ю́жная Гео́ргия и Ю́жные Са́ндвичевы Острова́ — островные территории в Южной Атлантике. Принадлежат Великобритании с 1775 года и 1908 года и имеют статус заморской территории. Территориальная принадлежность островов оспаривается Аргентиной соответственно с 1927 и 1938 г. Территории принадлежит домен .gs."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%B8%D0%BD%D0%B0%D1%80%D1%81%D0%BA%D0%B0_%D0%B2%D0%B8%D0%B7%D0%B1%D0%B0_%E2%80%9E%D0%9A%D0%B0%D1%80%D1%82%D0%B0%D0%BB%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%92%D0%B8%D0%BD%D0%B0%D1%80%D0%B8%D1%98%D0%B0_%D0%9A%D0%B0%D1%80%D1%82%D0%B0%D0%BB_05.jpg","page_title":"Винарска визба „Картал“","context_page_description":"Картал — винарска визба од Скопје, Македонија."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9F%E0%A6%BE%E0%A6%9A%E0%A6%B8%E0%A7%8D%E0%A6%95%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/PCT_Globe.jpg","page_title":"টাচস্ক্রিন","context_page_description":"একটি টাচস্ক্রিন, বা স্পর্শ পর্দা, একটি ইনপুট ডিভাইস এবং সাধারণত একটি তথ্য প্রক্রিয়াকরণের সিস্টেমের বৈদ্যুতিক দৃশ্যনীয় ডিসপ্লের উপরে স্তর। একজন ব্যবহারকারী একটি বিশেষ লেখনী বা এক বা একাধিক আঙ্গুল দিয়ে স্ক্রীন স্পর্শ করে সহজ বা বহু-স্পর্শ অঙ্গভঙ্গিগুলির মাধ্যমে ইনপুট সরবরাহ করতে পারে বা তথ্য প্রক্রিয়াকরণ পদ্ধতি নিয়ন্ত্রণ করতে পারে । কিছু সেন্সর সাধারণ বা বিশেষভাবে লেপা গ্লাভসকে কাজ করার জন্য ব্যবহার করে এবং অন্যরা শুধুমাত্র বিশেষ লেখনী বা কলম ব্যবহার করে কাজ করতে পারে। ব্যবহারকারী কী প্রদর্শিত হয় তার প্রতি প্রতিক্রিয়া জানাতে টাচস্ক্রীন ব্যবহার করতে পারে এবং সফ্টওয়্যার যদি এটি কীভাবে প্রদর্শিত হয় তা নিয়ন্ত্রণ করতে দেয়; উদাহরণস্বরূপ, জুম করে কোনো লেখার আকার বৃদ্ধি।\\nটাচস্ক্রীনটি মাউস, টাচপ্যাড, বা অন্যান্য ডিভাইসগুলির ব্যবহার করার পরিবর্তে প্রদর্শিত হয় তার সাথে সরাসরি যোগাযোগ করতে সক্ষম করে ।\\nটাচস্ক্রিন গেম কনসোল, ব্যক্তিগত কম্পিউটার, ইলেকট্রনিক ভোটিং মেশিন এবং পয়েন্ট অফ সেল সিস্টেম প্রভৃতি ডিভাইস গুলিতে দেখা যায়। তারা কম্পিউটারগুলিতে বা নেটওয়ার্কগুলিতে টার্মিনাল হিসাবে সংযুক্ত থাকতে পারে। তারা ডিজিটাল যন্ত্রপাতি যেমন পার্সোনাল ডিজিটাল অ্যাসিসটেন্ট এবং কিছু ই-রিডারদের ডিজাইনে একটি বিশিষ্ট ভূমিকা পালন করে ।"},{"page_url":"https://nl.wikipedia.org/wiki/Tempel_van_Esjmoen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Echnoum_Libanon_026.jpg","page_title":"Tempel van Esjmoen","context_page_description":"De tempel van Esjmoen is een archeologische site in het zuidwesten van Libanon, gelegen een vijftigtal km ten zuiden van Beiroet en drie km ten noordoosten van Sidon op de linker oever van de rivier Nahr el Awali. De site is lokaal bekend als Bustan esh-Sheikh.\\nDe eertijds monumentale tempel was bestemd voor de cultus van Esjmoen, de Fenicische god van de geneeskunde, die in Saïda vereerd werd. Esjmoen werd vooral aanroepen als genezer van zieke kinderen. Daarvan getuigen de talrijke kinderbeelden, uitgevoerd in marmer op meer dan normale grootte, die in de site werden teruggevonden en waarvan aangenomen wordt dat het ex votobeelden zijn. Een aantal van deze beelden worden thans bewaard in het Nationaal Museum van Beiroet.\\nHet tempelcomplex is de best bewaarde Fenicische site van Libanon en de enige waarvan meer dan de grondvesten zijn overgebleven.\\nDe bouw van de tempel begon op het einde van de zevende eeuw vóór onze tijdrekening. Gedurende verschillende eeuwen werden verbouwingen uitgevoerd en werden gebouwen toegevoegd tot lang na de Fenicische periode. Zo werd ooit een Romeinse colonnade en een nymphaeum opgetrokken."},{"page_url":"https://fi.wikipedia.org/wiki/Kristuksen_yhteis%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/IndependenceTemple3.jpg","page_title":"Kristuksen yhteisö","context_page_description":"Kristuksen yhteisö on Myöhempien aikojen pyhien Jeesuksen Kristuksen kirkon jälkeen toiseksi suurin myöhempien aikojen pyhien liikkeeseen kuuluva yhteisö. Siihen kuuluu yli 250 000 jäsentä noin 50 maassa. Vuoteen 2001 kirkko tunnettiin nimellä Reorganisoitu myöhempien aikojen pyhien Jeesuksen Kristuksen kirkko; nimi vaihdettiin, koska Kristuksen yhteisö halusi tehdä selkeämmin pesäeron MAP-kirkkoon. Kirkon keskuspaikka on Independencessä, Missourissa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Trutzhain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Eingangstor_Friedhof_Trutzhain_bzw._Stalag_IX_A_Ziegenhain_2.jpg","page_title":"Liste der Kulturdenkmäler in Trutzhain","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet des Ortsteils Trutzhain der Stadt Schwalmstadt, Schwalm-Eder-Kreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der Hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://el.wikipedia.org/wiki/Boeing_737_MAX","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Boeing_737_MAX_10_model_ILA_2018.png","page_title":"Boeing 737 MAX","context_page_description":"Το Boeing 737 MAX είναι μια σειρά αεροσκαφών στενής ατράκτου, σχεδιασμένη και κατασκευασμένη από την Boeing Commercial Airplanes, ως η τέταρτη γενιά του Boeing 737 η οποία διαδέχτηκε το Boeing 737 Next Generation.\\nΗ νέα σειρά 737 παρουσιάστηκε στις 30 Αυγούστου 2011. Η πρώτη πτήση πραγματοποιήθηκε στις 29 Ιανουαρίου 2016. Η νέα σειρά κέρδισε την πιστοποίηση της FAA στις 8 Μαρτίου 2017. Η πρώτη παράδοση ήταν ένα αεροσκάφος MAX 8 στις 6 Μαΐου 2017 στην Malindo Air, η οποία έθεσε το αεροσκάφος σε λειτουργία στις 22 Μαΐου 2017. Το 737 MAX βασίζεται σε προηγούμενα σχέδια 737. Ανανεώθηκε με πιο αποδοτικούς κινητήρες CFM International LEAP -1B, αεροδυναμικές βελτιώσεις και τροποποιήσεις του σκελετού.\\nΗ σειρά 737 MAX προσφέρεται σε τέσσερις παραλλαγές με χωρητικότητα από 138 έως 230 θέσεις και εμβέλεια 5.954-7.084 χλμ. Τα 737 MAX 7, MAX 8 και MAX 9, προορίζονται να αντικαταστήσουν τα 737-700, 800 και 900, αντίστοιχα. Πρόσθετο μήκος προσφέρεται με το μακρύτερο 737 MAX 10. Έως τον Ιανουάριο του 2019, η Boeing 737 MAX είχε λάβει 5.011 σταθερές παραγγελίες και είχαν παραδοθεί 350."},{"page_url":"https://tr.wikipedia.org/wiki/Hayvansal_psi%C5%9Fizm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Delfinekko.gif","page_title":"Hayvansal psişizm","context_page_description":"Hayvansal psişizm hayvanlardaki psişik fenomenler bütününü ifade etmek üzere kullanılan bir terimdir.\\nParapsikologlar, hayvanlar üzerinde sürdürdükleri deney ve gözlemler sonucunda, kimi hayvanların ESP denilen paranormal yeteneklere insanlardan daha fazla sahip olduklarını ve ayrıca, bu yeteneklerini bazı hayvanların beş duyu gibi doğal ve normal bir yetenek olarak kullandıklarını ileri sürmektedirler.\\nParapsikoloji denildiğinde akla ilk gelen isim olan ve kurduğu Parapsikoloji Kurumu’nun Amerikan Bilim Geliştirme Kurulu'na kabulüyle Parapsikoloji’ye ilk saygınlığını kazandırmış bulunan J.B. Rhine, yaptığı deney ve gözlemler sonucunda bazı hayvanlarda şu beş psişik yeteneğin bulunduğunu açıklamıştır:\\nSevdikleri kişiler veya kendileri hakkında tehlike içeren gelecekteki olayları ve doğal afetleri önceden hissetme yeteneği.\\nSevdikleri canlının ölmesini ya da zarar görmesini, ondan çok uzakta da olsa hissetme yeteneği.\\nSahiplerinin eve dönmek üzere olduğunu, onlar eve dönmeden önce hissetme yeteneği.\\nYuvalarından yüzlerce kilometre uzağa götürülseler de, yuvalarının yerini bir şekilde hissederek dönebilme yeteneği."},{"page_url":"https://de.wikipedia.org/wiki/Meridiankreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Meridiankreis-Instrument.JPG","page_title":"Meridiankreis","context_page_description":"Der Meridiankreis ist das klassische Instrument zur Messung von Sternörtern im Meridian. Er entspricht einem sehr großen Theodolit ohne Stehachse, der nur in der Meridianebene schwenkbar ist, und zählt damit zu den Durchgangs- oder Passageninstrumenten."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Hemiksem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Hemiksem_Steenbakkerijstraat_5.jpg","page_title":"Lijst van onroerend erfgoed in Hemiksem","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Hemiksem. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://fr.wikipedia.org/wiki/Goupille","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Cotter_Pin_%28PSF%29.png","page_title":"Goupille","context_page_description":"Une goupille est un cylindre métallique destiné à être sollicité en cisaillement pour des efforts relativement faibles.\\nLa permanence de la liaison est due à l’adhérence entre la goupille et les pièces assemblées.\\nLorsque l’assemblage d’un arbre sur un moyeu est soumis à des efforts importants, on utilise la clavette.\\nUne goupille peut avoir plusieurs fonctions :\\nimmobiliser une pièce par rapport à une autre ;\\npositionner une pièce par rapport à une autre ;\\nservir d'axe ;\\nservir de pièce de sécurité : cisaillement en cas de surcharge."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%B3%E3%83%9E%E3%83%BC%E3%82%AF%E9%BB%84%E9%87%91%E6%99%82%E4%BB%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/DanimarcaCopenhagenCattedraleRedentore.jpg","page_title":"デンマーク黄金時代","context_page_description":"デンマーク黄金時代とは、特に19世紀前半のデンマークにおいて創作活動が盛んだった時期を指す。当時のコペンハーゲンは戦火や財政破綻に苦しんでいたものの、芸術の分野では隣国たるドイツロマン主義に触発され新たな時代を迎えることとなる。1800年から1850年頃にかけて、ベルテル・トルバルセンの彫刻の他、クリストファー・エカスベアやその門下生のウィルヘルム・ベンズ、コンスタンティン・ハンセン及びヴィルヘルム・マーストランらの絵画が一世を風靡。新古典主義建築も発展を遂げ、とりわけコペンハーゲンの街はクリスチャン・フレゼリク・ハンセンやミカエル・ゴットリープ・ビンデスベル設計の建築物で様変わりした。\\n音楽に関しては、ヨハン・ペーター・エミリウス・ハートマン、ハンス・クリスチャン・ロンビ、ニルス・ゲーゼ及びバレエマスターのオーギュスト・ブルノンヴィルを含め、ナショナル・ロマンティシズムの洗礼を受けた数多くの人物を輩出した。ロマン主義を中心とする文学は、1802年にノルウェー系ドイツ人哲学者ヘンリク・ステフェンスが紹介。アダム・エーレンシュレーガーやベルンハルト・セヴェリン・インゲマン、ニコライ・フレゼリク・セヴェリン・グルントヴィが中心を担ったが、何と言っても現代童話の父ハンス・クリスチャン・アンデルセンを忘れてはならないであろう。また、ハンス・クリスチャン・エルステッドが科学の方法論を打ち立てた一方で、セーレン・キェルケゴールは哲学の深化に貢献した。従って、黄金時代はデンマークに留まらず、やがては国際的にも大きな影響を与えることとなった。"},{"page_url":"https://en.wikipedia.org/wiki/1990%E2%80%9391_Australian_region_cyclone_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Errol_mar_26_1991_0719Z.jpg","page_title":"1990–91 Australian region cyclone season","context_page_description":"The 1990–91 Australian region cyclone season was a slightly below average cyclone season, with ten tropical cyclones occurring within the region between 90°E and 160°E. The season officially ran from November 1, 1990, to April 30, 1991, with the first disturbance of the season forming on 10 December and the last disturbance moving out of the region during 11 May. Six people were killed by Cyclone Joy when it made landfall on Australia. During the season, tropical cyclones were monitored by the Australian Bureau of Meteorology, who ran Tropical Cyclone Warning Centers in Perth, Darwin, and Brisbane. The United States Joint Typhoon Warning Center and Papua New Guinea National Weather Service also monitored systems within the basin during the season. The JTWC designated systems with a number and either a S or a P suffix depending on which side of 135E. The Bureau of Meteorology and Papua New Guinea national Weather Service both used the Australian Tropical Cyclone Intensity Scale, and estimated windspeeds over a ten-minute period, while the JTWC estimated sustained winds over a one-minute period and are comparable to the Saffir–Simpson Hurricane Scale."},{"page_url":"https://no.wikipedia.org/wiki/Epona","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Epona.jpg","page_title":"Epona","context_page_description":"Epona er en hestegudinne i keltisk mytologi. Hun symboliserer skaperevnen.\\nEpona framstilles som en ung kvinne til hest eller som en hvit hoppe. I noen tilfeller kan hun ha et føll ved siden. Framstillinger kan vise henne mens hun deler ut korn, brød, frukt eller andre avlinger.\\nHun ble dyrket av keltiske stammer i Europa og fra kelterne gikk Epona inn i romersk mytologi. Det er funnet inskripsjoner, statuer og minnesmerker om henne fra Bulgaria i øst til Storbritannia i vest, og fra Tyskland i nord til Italia og Spania i sør. Også i dagens Algerie i Nord-Afrika er det funnet gjenstander med Eopna."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Scuol","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Ardez_Sur_En_4.JPG","page_title":"Liste der Kulturgüter in Scuol","context_page_description":"Die Liste der Kulturgüter in Scuol enthält alle Objekte in der Gemeinde Scuol im Kanton Graubünden, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%A8%E3%81%95%E3%81%A7%E3%82%93%E4%BA%A4%E9%80%9A3000%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/%E3%83%8F%E3%83%BC%E3%83%88%E3%83%A9%E3%83%A0%E2%85%A1.jpg","page_title":"とさでん交通3000形電車","context_page_description":"とさでん交通3000形電車は、とさでん交通で2018年に登場した路面電車車両である。「ハートラムII」の愛称がある。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Santpoort-Zuid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/School_en_Woning%2C_Wustelaan_79.JPG","page_title":"Lijst van rijksmonumenten in Santpoort-Zuid","context_page_description":"De plaats Santpoort-Zuid telt 21 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B0%E7%81%A3%E5%85%A9%E6%A3%B2%E5%8B%95%E7%89%A9%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/%E6%96%AF%E6%96%87%E8%B1%AA%E6%B0%8F%E8%B5%A4%E8%9B%99.JPG","page_title":"台灣兩棲動物列表","context_page_description":"台灣是位於亞洲東部、太平洋西北側的一個島嶼。目前已知棲息於此並建立族群的兩棲動物計有2目7科41種，其中17種為台灣特有種，還有亞洲錦蛙、斑腿樹蛙、海蛙，以及美洲牛蛙等4種確認在台灣建立族群的外來種。台灣境內的有尾目僅1科5種，其餘全屬無尾目物種。目前最新發表的種類為2017年的太田樹蛙。\\n1861到1866年間，英國首任駐台領事郇和利用職務之便，最早對於台灣的兩棲類動物進行研究，並發表了4種兩棲類。本列表收錄的範圍包含台灣及附屬島嶼，不包含金門及馬祖；外來種僅列入已在野外建立族群的物種，私人養殖及引入則不列入。粗體為台灣特有種。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BC%D0%B5%D1%80%D0%B0%D0%BD%D1%86%D0%B5%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%D0%AE%D1%80%D0%B8%D0%B9_%D0%9F%D0%BE%D0%BC%D0%B5%D1%80%D0%B0%D0%BD%D1%86%D0%B5%D0%B2.jpg","page_title":"Померанцев, Юрий Борисович","context_page_description":"Юрий Борисович Померанцев — советский и казахстанский актёр театра и кино, режиссёр, общественный деятель, депутат Верховного Совета Казахской ССР. Герой Труда Казахстана, Народный артист Казахской ССР."},{"page_url":"https://cs.wikipedia.org/wiki/Poly(A)_konec","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/MRNA_structure.svg","page_title":"Poly(A) konec","context_page_description":"Poly(A) konec je sekvence asi 40–250 adeninových (A) nukleotidů, které jsou pomocí poly(A) polymerázy přidány na 3' konec RNA v procesu tzv. polyadenylace. Konkrétní místo vzniku poly(A) konce se na surové RNA molekule může měnit a je někdy předmětem tzv. alternativní polyadenylace.\\nJedná se o jednu z posttranskripčních modifikací „surové“ eukaryotické pre-mRNA. Mezi jednotlivými nukleotidy vznikají běžné 5'-3' vazby, jako tomu je u transkripce, ale na rozdíl od ní není potřeba žádný templát. Konkrétní délku poly(A) konce určují různé přídatné poly(A) vázající proteiny. RNA pro bílkoviny histonů však z neznámých důvodů žádný poly(A) ocas nemá."},{"page_url":"https://pt.wikipedia.org/wiki/Geografia_de_Porto_Alegre","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Resize_of_Ipanema-Pano.jpg","page_title":"Geografia de Porto Alegre","context_page_description":"A geografia de Porto Alegre é, como na maioria das grandes cidades, heterogênea. A maior parte da cidade de Porto Alegre é cercada por prédios. A área do município de Porto Alegre é de 470,25 km². Destes, 44,45 km² estão distribuídos nas 16 ilhas do Delta do Jacuí sob jurisdição do município. Atualmente a cidade conta com 94 bairros. Possui um relevo montanhoso na região mais ao sul, apresentando morros, sendo o mais alto deles o Morro Santana, com 311 metros de elevação acima do nível do mar. A cidade ainda possui 70 km de margens banhadas pelo Lago Guaíba."},{"page_url":"https://fr.wikipedia.org/wiki/Pakhra","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Pakhra_River_in_Podolsk.jpg","page_title":"Pakhra","context_page_description":"La Pakhra est une rivière de l'oblast de Moscou, en Russie et un affluent droit de la Moskova, dans le bassin hydrographique de la Volga."},{"page_url":"https://pt.wikipedia.org/wiki/Ford_Vedette","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/An%C3%BAncios_de_%C3%89poca.jpg","page_title":"Ford Vedette","context_page_description":"Ford Vedette foi o primeiro grande lançamento de carro do período pós-Segunda Guerra Mundial, produzido pela filial francesa da Ford. Seu primeiro lançamento foi no Salão de Paris, em outubro de 1948. \\"Vedette\\", na grafia francesa significa sentinela de cavalaria, mas também está associado à figura de belas mulheres popularmente conhecidas como dançarinas e coristas nas casas de espetáculos, shows e cabarés daquela época. Vedette virou sinônimo popular de sensualidade, ousadia e diversão, o que também foi apropriado pelos modelos de carros lançados pela Ford, mostrando curvas e design que remetiam ao corpo feminino."},{"page_url":"https://fr.wikipedia.org/wiki/Alicia_Terzian","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Alicia_Terzian.jpg","page_title":"Alicia Terzian","context_page_description":"Alicia Terzian, née le 1ᵉʳ juillet 1934 à Córdoba, est une compositrice et cheffe d'orchestre argentine, d'origine arménienne."},{"page_url":"https://pl.wikipedia.org/wiki/European_MALE_RPAS","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/EuroMALE_ILA_2018_%2801%29_%28cropped%29.jpg","page_title":"European MALE RPAS","context_page_description":"European MALE RPAS – projekt europejskiego bezzałogowego samolotu klasy Medium-altitude long-endurance."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%B4%D5%BA%D5%AB%D5%B6%D5%A1%D5%BD_%D5%A4%D5%B8%D6%82_%D5%8D%D5%B8%D6%82%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bras%C3%A3o_Campinas_do_Sul.jpg","page_title":"Կամպինաս դու Սուլ","context_page_description":"Կամպինաս դու Սուլ, համայնք Բրազիլիայում, մտնում է Ռիու Գրանդի դու Սուլ նահանգի մեջ։ Մի մաս է կազմում Ռիու Գրանդի դու Սուլ նահանգի հյուսիսարևելյան մարզը։ Մտնում է տնտեսական կարգավիճակ ունեցող Էրեշինի մեջ։ Բնակչությունը կազմում է 5 557 մարդ, ըստ 2006 թվականի տվյալների։ Տարածքը կազմում է 261,321 կմ²։ Բնակչության խտությունը՝ 21,3 մարդ/կմ²։"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9B%D1%83%D0%B6%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/%C5%81u%C5%BEki%2C_Ka%C5%9Bcielnaja%2C_Pijarski._%D0%9B%D1%83%D0%B6%D0%BA%D1%96%2C_%D0%9A%D0%B0%D1%81%D1%8C%D1%86%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F%2C_%D0%9F%D1%96%D1%8F%D1%80%D1%81%D0%BA%D1%96_%281900%29.jpg","page_title":"Лужкі","context_page_description":"Лужкі́ — вёска ў Беларусі, на рацэ Мнюце. Цэнтар сельсавету Шаркоўшчынскага раёну Віцебскай вобласьці. Насельніцтва на 2010 год — 765 чалавек. Знаходзяцца за 32 км на ўсход ад Шаркоўшчыны, за 29 км ад чыгуначнай станцыі Падсьвільле.\\nЛужкі — даўняе мястэчка гістарычнай Полаччыны. Да нашага часу тут захаваліся касьцёл Сьвятога Міхала Арханёла ў стылі віленскага барока і сядзіба Плятэраў у колішнім маёнтку Гарадзец, помнікі архітэктуры XVIII ст. Сярод мясцовых славутасьцяў вылучаўся кляштар піяраў, помнік архітэктуры XVIII ст., зруйнаваны расейскімі ўладамі."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%95%D7%9C_%D7%9E%D7%95%D7%A0%D7%99_(%D7%A9%D7%97%D7%A7%D7%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Paul_Muni_-_Zola_-_1936.jpg","page_title":"פול מוני (שחקן)","context_page_description":"פול מוני היה שחקן במה וקולנוע אמריקני ממוצא יהודי. נמנה בשנות ה-30 על הכוכבים הבולטים והמצליחים ביותר של אולפני וורנר.\\nנולד בשם משולם מאיר וייזנפרוינד בלבוב שבמערב גליציה, וב-1902 היגרה משפחתו עמו לארצות הברית. בעודו ילד החל להופיע בתיאטרון הומוריסטי יחד עם הוריו, אחר כך עם להקות נודדות בארצות הברית ובתיאטרון האומנותי היידי בניו יורק.\\nבשנת 1921 נישא לבלה לבית פינקל, שהייתה גם היא שחקנית בתיאטרון היידי.\\nב-1926 הופיע לראשונה באנגלית בהצגה בברודוויי.\\nבשנת 1929 חתם על חוזה באולפני פוקס והחל קריירה מצליחה בקולנוע.\\nעל משחקו בסרטו הראשון בשנת 1929 היה מועמד לפרס האוסקר.\\nמסרטיו החשובים:\\n1932 - פני צלקת.\\n1936 - חיי לואי פסטר.\\n1937 - חייו של אמיל זולא בתור אמיל זולא.\\n1937 - האדמה הטובה.\\n1945 - שיר שייזכר, על חייו של פרדריק שופן.\\nבשנת 1946 הופיע במחזהו הפרו-ציוני \\"דגל נולד\\" של בן הכט.\\nמוני היה מועמד לאוסקר 6 פעמים וזכה בפרס אוסקר לשחקן הטוב ביותר בשנת 1936.\\nלאחר פרישתו ממשחק עבר עם רעייתו לקליפורניה.\\nשמו מונצח בשדרת הכוכבים של הוליווד."},{"page_url":"https://vi.wikipedia.org/wiki/Moltke_(l%E1%BB%9Bp_t%C3%A0u_chi%E1%BA%BFn-tu%E1%BA%A7n_d%C6%B0%C6%A1ng)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Bundesarchiv_Bild_134-D0004%2C_Gro%C3%9Fer_Kreuzer_Goeben.jpg","page_title":"Moltke (lớp tàu chiến-tuần dương)","context_page_description":"Lớp tàu chiến-tuần dương Moltke là một lớp gồm hai tàu chiến-tuần dương \\"toàn-súng lớn\\" được Hải quân Đế quốc Đức chế tạo trong những năm 1909–1911. Gồm hai chiếc SMS Moltke và SMS Goeben, lớp này có thiết kế tương tự như chiếc Von der Tann dẫn trước, nhưng bao gồm nhiều cải tiến lớn hơn. Những chiếc Moltke hơi lớn hơn, nhanh hơn và có vỏ giáp tốt hơn, chúng cũng được bổ sung thêm một cặp pháo 28 cm.\\nCả hai chiếc trong lớp đều đã tham gia Chiến tranh Thế giới thứ nhất. Moltke tham gia nhiều trận chiến lớn cùng với phần còn lại của Hạm đội Biển khơi Đức, bao gồm các trận Dogger Bank và Jutland tại Bắc Hải cùng trận Riga và Chiến dịch Albion tại biển Baltic. Vào cuối chiến tranh, Moltke cùng với phần lớn tàu chiến của Hạm đội Biển khơi bị lưu giữ tại Scapa Flow trong khi các cuộc đàm phán hòa bình diễn ra nhằm quyết định số phận của chúng. Moltke đã bị đánh đắm cùng với hầu hết hạm đội vào ngày 21 tháng 6 năm 1919 nhằm ngăn chúng không bị rơi vào tay người Anh.\\nGoeben được bố trí tại Địa Trung Hải vào lúc chiến tranh nổ ra, nó thoát khỏi sự săn đuổi của hạm đội Anh để đi đến Constantinopolis."},{"page_url":"https://eu.wikipedia.org/wiki/Ulmi_(Giurgiu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Biserica_din_Poenari.jpg","page_title":"Ulmi (Giurgiu)","context_page_description":"Ulmi Errumaniako udalerri bat da, Giurgiu konderrian. 7.818 biztanle ditu, 43,54 kilometro koadroko azaleran banatuta."},{"page_url":"https://fr.wikipedia.org/wiki/Egmond_(Hollande-Septentrionale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/2015_Egmond_aan_Zee.jpg","page_title":"Egmond (Hollande-Septentrionale)","context_page_description":"Egmond est une ancienne commune dans la province de la Hollande-Septentrionale. Créée en 1978 par la fusion d'Egmond aan Zee et Egmond-Binnen, elle a été avec la commune de Schoorl intégré en 2001 à la commune de Bergen.\\nLes trois villes qui constituaient cette commune sont Egmond aan den Hoef, Egmond aan Zee and Egmond-Binnen."},{"page_url":"https://it.wikipedia.org/wiki/Guk_(gastronomia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Jaha-Manduguk.jpg","page_title":"Guk (gastronomia)","context_page_description":"Con il termine guk o tang s'identifica un gruppo di zuppe nella cucina coreana. Guk è una parola nativa coreana, mentre tang è un vocabolo sino-coreano originariamente indicante il bollore. Le due parole sono spesso accoppiate e usate come sinonimi, sebbene la tang sia a volte più densa della guk. Per zuppe più leggere con verdure si usa il suffisso guk, mentre per quelle più dense preparate con ingredienti solidi e usate nei riti ancestrali si usa spesso tang.\\nSi tratta di una delle componenti più basilari di un pasto coreano insieme al bap e ai banchan. Nell'apparecchiare, la guk è servita con il bap a destra e le bacchette e il cucchiaio a sinistra.\\nDalla guk si è sviluppata la gukbap, cioè la zuppa di riso, come la kongnamul gukbap con germogli di soia."},{"page_url":"https://en.wikipedia.org/wiki/Wigwam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Ute_wickiup.jpg","page_title":"Wigwam","context_page_description":"A wigwam, wickiup, wetu, or wiigiiwaam in the Ojibwe language, is a semi-permanent domed dwelling formerly used by certain Native American tribes and First Nations people. They are still used for ceremonial events. The term wickiup is generally used to label these kinds of dwellings in the Southwestern United States and Western United States, while wigwam is usually applied to these structures in the Northeastern United States as well as eastern Canada. Wetu is the Wampanoag term for a wigwam dwelling. These terms can refer to many distinct types of Native American structures regardless of location or cultural group. The wigwam is not to be confused with the Native Plains teepee, which has a very different construction, structure, and use."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E9%99%B8%E8%BB%8D%E7%A5%9E%E9%BE%8D%E5%B0%8F%E7%B5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/October_10_2011Taiwancelebrationpic4.jpg","page_title":"中華民國陸軍神龍小組","context_page_description":"中華民國陸軍神龍小組為中華民國陸軍航空特戰部隊中的任務編組，隸屬中華民國陸軍航空特戰指揮部。成員來自中華民國陸軍航空特戰指揮部空降訓練中心的傘訓教官組傘訓教官，平時負責教導每梯次新進傘訓學員的基本傘訓任務，戰時率領傘兵進行敵後作戰任務。該小組雖不是正式部隊編制，但因經常公開跳傘表演，其行動常受台灣各方矚目。"},{"page_url":"https://sv.wikipedia.org/wiki/U8_(Berlins_tunnelbana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Karte_berlin_u_u8.jpg","page_title":"U8 (Berlins tunnelbana)","context_page_description":"Linje U8 i Berlins tunnelbana har 24 stationer och är 18 km lång. Den går från Wittenau via Gesundbrunnen till Hermannstrasse i Neukölln. Det är den andra tunnelbanelinjen i Berlin som går nord-syd och hette till en början Gesundbrunnen-Neukölln-Bahn."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%83%AD%E8%84%82%E8%99%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Dactylopius_coccus_%28Barlovento%29_04_ies.jpg","page_title":"胭脂虫","context_page_description":"胭脂虫原产于美洲。雌虫体内含胭脂红酸，可以用来制造绯红色染料。胭脂虫是哥伦布交换之一。在地理大发现时代，在哥伦布发现美洲之初，胭脂虫被引入了欧洲。当运送胭脂虫的西班牙商船被英国或德国的海盗劫掠时，对胭脂虫的价值和用处一无所知的海盗们往往会把货物扔进大海。\\n目前，胭脂虫被使用于布料染色、食用色素和化妆品。但作为食用色素时，多会加注警语，以防素食者误食及避免过量服用胭脂虫食用色素。\\n其身长可达5毫米。"},{"page_url":"https://pt.wikipedia.org/wiki/Maria_Leszczy%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Marie_Leszczy%C5%84ska%2C_reine_de_France%2C_lisant_la_Bible_by_Jean-Marc_Nattier.jpg","page_title":"Maria Leszczyńska","context_page_description":"Maria Carolina Sofia Felícia Leszczyńska foi a esposa do rei Luís XV e Rainha Consorte da França e Navarra de 1725 até à sua morte.\\nNascida uma aristocrata polaca, filha do rei Estanislau I da Polônia e sua esposa Catarina Opalińska, casou-se em 1725 com o rei Luís XV de França, sete anos mais novo que ela. Na altura seu pai já havia sido deposto do trono polaco há dezasseis anos, o que fez com que o casamento não fosse bem recebido na corte de Versalhes. No início o casamento foi feliz, contudo após uma década de continuas gravidezes, que deixaram-na saturada, a relação entre os dois se desgastou. Luís teve uma série de amantes, entre elas, a famosa Madame de Pompadour, ignorando totalmente Maria, que passou a viver exclusivamente dedicada a religião.\\nMaria Leszczyńska foi uma rainha popular, foi a consorte de maior reinado na história da França, ocupando o posto rainha consorte por 42 anos, 9 meses e 19 dias, sendo muito querida entre o povo por causa de sua piedade e generosidade."},{"page_url":"https://ceb.wikipedia.org/wiki/Roystonea_oleracea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Imperial_palm_trees.JPG","page_title":"Roystonea oleracea","context_page_description":"Espesye sa tanom nga bulí nga una nga gihulagway ni Nikolaus Joseph von Jacquin, ug nga gihatagan sa eksakto nga ngalan ni Orator Fuller Cook ang Roystonea oleracea. Ang Roystonea oleracea sakop sa kahenera nga Roystonea sa kabanay nga Arecaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%83%D0%BC%D0%BE%D0%BD%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/%28Claudius_Ziehr%29_Fumone_01.jpg","page_title":"Фумоне","context_page_description":"Фумоне — коммуна в Италии, располагается в регионе Лацио, подчиняется административному центру Фрозиноне.\\nНаселение составляет 2153 человека, плотность населения составляет 154 чел./км². Занимает площадь 14 км². Почтовый индекс — 03010. Телефонный код — 0775.\\nПокровителем коммуны почитается святой Себастьян."},{"page_url":"https://pt.wikipedia.org/wiki/Dinheiro_queimado","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Burning-money-and-yuanbao-at-the-cemetery-3249.JPG","page_title":"Dinheiro queimado","context_page_description":"Dinheiro queimado é uma expressão metafórica que designa o ato intencional de destruir dinheiro. Em um exemplo hipotético, uma cédula de dinheiro pode ser destruída literalmente pondo fogo sobre ela. O dinheiro queimado decrementa a riqueza do proprietário sem diretamente enriquecer qualquer outra parte em particular. Entretanto, no momento em que se reduz o suprimento de papel-moeda em circulação, incrementa-se a valorização do papel-moeda remanescente, incrementando a riqueza coletiva de qualquer um que retém o dinheiro.\\nDinheiro pode ser usualmente queimado para comunicar uma mensagem, seja para expressar um efeito artístico, como uma forma de protesto, ou como um sinal. Em alguns jogos, o jogador pode algumas vezes se beneficiar da habilidade de queimar dinheiro. Queimar dinheiro é ilegal em alguns países."},{"page_url":"https://ceb.wikipedia.org/wiki/Carey_Point","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Location_map_South_Georgia.png","page_title":"Carey Point","context_page_description":"Ang Carey Point ngalan niining mga mosunod:"},{"page_url":"https://it.wikipedia.org/wiki/Marco_Zoppo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/RetabloMarcoZoppoColegioEspa%C3%B1aBoloniaFirma.jpg","page_title":"Marco Zoppo","context_page_description":"Marco Zoppo è stato un pittore italiano."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8E%89%E5%85%94_(%E8%97%9D%E4%BA%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bella_yutu_%E7%8E%89%E5%85%94%E5%80%8B%E4%BA%BA%E7%85%A7.jpg","page_title":"玉兔 (藝人)","context_page_description":"鄭如吟，藝名玉兔，台灣女藝人，畢業於臺北縣馬偕護專。綜藝節目《我愛黑澀會》之「洪詩幫」成員。雖非黑Girl成員之一，但憑著亮麗的外型與精湛的舞藝，以及花式調酒技術，擁有不錯的人氣，接下廣告與活動的代言工作。\\n2009年5月16日她與洪詩、允菲、斯亞在西門町紅樓的河岸留言參加由Channel V為他們舉辦的「黑澀音樂同樂會」。"},{"page_url":"https://af.wikipedia.org/wiki/Luang_Prabang","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Luang_Prabang-Wat_Mahathat-06-Trommelhaus-gje.jpg","page_title":"Luang Prabang","context_page_description":"Luang Prabang is 'n stad in die noorde van Laos, sowat 425 km noord van Vientiane, die land se hoofstad. Luang Prabang het tans 'n bevolking van 103 000 mense.\\nLuang Prabang staan bekend as die ou koningsstad en was tot 1975 die residensie van die konings van die Koninkryk Laos. Die historiese stadskern van Luang Prabang is in 1995 deur UNESCO as 'n wêrelderfenisgebied gelys."},{"page_url":"https://it.wikipedia.org/wiki/Riccardo_Scimeca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Riccy_scimeca.jpg","page_title":"Riccardo Scimeca","context_page_description":"Riccardo Scimeca è un ex calciatore inglese di origine italiana, di ruolo centrocampista."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D8%AF%D8%B3%D8%AA%D8%A7%D9%86_%DA%A9%D9%84_%D8%A7%DB%8C%D8%A7%D9%84%D8%A7%D8%AA_%D9%85%D8%AA%D8%AD%D8%AF%D9%87_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/JYMason.jpg","page_title":"دادستان کل ایالات متحده آمریکا","context_page_description":"دادستان کل ایالات متحده، رئیس وزارت دادگستری ایالات متحده است و وظیفه او امور قضایی بوده و مأمور ارشد اجرای قانون دولت ایالات متحده است. دادستان کل وکیل ارشد دولت ایالات متحده قلمداد می‌شود. دادستان کل به عنوان عضو کابینهٔ رئیس‌جمهور فعالیت می‌کند و تنها رئیس یک وزارتخانه دولتیست که عنوان وزیر بدو اطلاق نمی‌شود.\\nدادستان کل را رئیس‌جمهور ایالات متحده نامزد می‌کند و او این سمت را پس از تأیید سنای ایالات متحده بر عهده می‌گیرد. او به خواست رئیس‌جمهور فعالیت کرده و رئیس‌جمهور می‌تواند در هر زمان وی را بر کنار کند. دادستان کل می‌تواند مورد استیضاح مجلس نمایندگان و محاکمه در سنا به دلایل «خیانت، ارتشا و دیگر جرایم و سوء رفتارهای شدید» قرار بگیرد."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BF%D1%82%D0%BE%D0%B2%D0%BE%D0%BB%D0%BE%D0%BA%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Strings_of_lights.jpg","page_title":"Оптоволокно","context_page_description":"Оптоволокно́ або оптичне волокно — це технічний виріб, що складається з оптичного світловоду і захисних покриттів та маркуючої кольорової оболонки.\\nОптичний світловод — є фізичним середовищем транспортування оптичного сигналу і складається із серцевини та оболонки, що мають різні величини показників заломлення. Завдяки явищу повного внутрішнього відбиття, надається змога транспортувати оптичні сигнали, що генеруються обладнанням, до якого підключене оптичне волокно.\\nПовний опис процесу розповсюдження світла по оптичному волоконному світловоду дає хвильова електромагнітна теорія. Вона показує, що розповсюджуватись по волоконному світловоду можуть лише ті типи хвиль, що формують у поперечному перетині ВС резонансну хвилю. Такі типи хвиль утворюють моди хвилеводу. Режим роботи ВС визначається величиною нормованої частоти V.\\nЗгідно режиму роботи оптичні волокна поділяються на два основні типи:\\nОдномодові\\nБагатомодові\\nСерцевина ОВ має змінну залежність величини показника заломлення по радіальній віссі світловоду, котра називається профілем показника заломлення.\\nНаприклад:\\nСвітловоди з градієнтним показником заломлення\\nСвітловоди із сходинковим профілем показника заломлення."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D1%83%D0%B4%D0%B8%D1%8F_%D0%A2_(%D1%82%D0%B5%D0%B0%D1%82%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Logo_Teatr-t.png","page_title":"Студия Т (театр)","context_page_description":"«Студия Т» — российский московский театр кукол, созданный в 2007 году."},{"page_url":"https://de.wikipedia.org/wiki/Hausbau_(Bauwerk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Under_construction_Thai_modern_houses.jpg","page_title":"Hausbau (Bauwerk)","context_page_description":"Hausbau bezeichnet umgangssprachlich das Bauen bzw. Errichten eines Wohnhaus/Hauses oder sonstigen Gebäudes. Teilweise wird auch der Ausbau eines Hauses als Hausbau bezeichnet.\\nDas Bauwesen ist dabei das Fachgebiet, das sich mit dem Bauen, mit der Gesamtheit der Vorgänge und Einrichtungen bei der Errichtung von Bauten auseinandersetzt, und nicht auf das Bauen von Häusern begrenzt ist."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_najvy%C5%A1%C5%A1%C3%ADch_budov_v_Severnej_Amerike","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Wells_Fargo_Plaza.jpg","page_title":"Zoznam najvyšších budov v Severnej Amerike","context_page_description":"Toto je zoznam najvyšších budov v Severnej Amerike."},{"page_url":"https://it.wikipedia.org/wiki/Shinchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Flag_of_Shinchi_Fukushima_chapter.JPG","page_title":"Shinchi","context_page_description":"Shinchi è una cittadina giapponese della prefettura di Fukushima."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Major_National_Historical_and_Cultural_Sites_in_Hunan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%E5%AF%8C%E5%8E%9A%E5%A0%82_%E5%8D%97%E4%BE%A7%E8%97%8F%E4%B9%A6%E6%A5%BC_%28Fuhou_tang%2C_Hunan%29.jpg","page_title":"List of Major National Historical and Cultural Sites in Hunan","context_page_description":"This list is of Major Sites Protected for their Historical and Cultural Value at the National Level in the Province of Hunan, People's Republic of China."},{"page_url":"https://fi.wikipedia.org/wiki/Solvita_%C4%80bolti%C5%86a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Solvita_%C4%80bolti%C5%86a_2011.jpg","page_title":"Solvita Āboltiņa","context_page_description":"Solvita Āboltiņa on latvialainen juristi ja poliitikko, joka toimi muun muassa maansa parlamentin eli Saeiman puhemiehenä ja tätä aiemmin esimerkiksi oikeusministerinä.\\nHän valmistui juristiksi Latvian yliopistosta vuonna 1986."},{"page_url":"https://la.wikipedia.org/wiki/Bibliotheca_Civica_Russiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Pashkov_house.jpg","page_title":"Bibliotheca Civica Russiae","context_page_description":"Bibliotheca Civica Russica est bibliotheca nationalis Russiae, Moscuae sita. Quae est maxima in civitate et ob eius collectionem librorum quinta a maximá in mundo. Rite appellabatur Bibliotheca Civica URSS nomine Vladimiri Lenin ab anno 1925 usque ad annum 1992, cum iterum legitime nominata est.\\nCui bibliothecae sunt plus quam 275 chiliometra suggestuum, quibus sunt plus quam 43 milliones rerum,\\ninter quas plus quam 17 milliones librorum voluminibusque serialibus, 13 milliones periodicorum, 350 000 partiturarum musicarum et phonodiscorum, et 150 000 tabularum geographicarum. Sunt res in 247 linguis compositae, quarum pars aliena 29 centesimae omnis collectionis est.\\nAb anno 1922 ad annum 1991 saltem unum omnis libri in Unione Sovietica editi exemplar in bibliothecá depositum est—qui mos similiter usque ad praesens persistit, quia bibliotheca secundum leges est bibliotheca depositi legitimi.\\nDirector est Alexander I. Visly; director exsecutivus, Vladimir I. Gnezdilov; praeses, Viktor V. Fiodorov. Anno 2012 erant 1830 conducti."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%99%D7%A1_%D7%A8%D7%96%27%D7%99%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Elis_Regina_Assinatura.png","page_title":"אליס רז'ינה","context_page_description":"אליס רז'ינה קרבליו קוסטה הייתה זמרת ברזילאית, אחת מן החשובות בהיסטוריה של ברזיל והבולטת ביותר מאמצע שנות ה-60 ולאורך שנות ה-70 של המאה העשרים. ביצועיה משלבים טכניקה, פרפקציוניזם, רגש ואנרגיה. גם כיום היא בין הזמרות הפופולריות והאהובות בברזיל."},{"page_url":"https://ro.wikipedia.org/wiki/Blanzac-Porcheresse","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Blanzac_16_%C3%89glise_ext%C3%A9rieur_2013.jpg","page_title":"Blanzac-Porcheresse","context_page_description":"Blanzac-Porcheresse este o comună în departamentul Charente, Franța. În 2009 avea o populație de 842 de locuitori."},{"page_url":"https://ca.wikipedia.org/wiki/Clima_de_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Cecladepinyana.JPG","page_title":"Clima de Catalunya","context_page_description":"El clima de Catalunya és d'hiverns amb temperatures suaus i estius calorosos i secs, característiques del clima mediterrani, amb l'excepció de la Vall d'Aran, d'hiverns freds i plujosos i estius frescos i relativament humits, i per tant de clima atlàntic.\\nA l'hivern, hi ha una diferència notable de temperatures entre el litoral costaner, amb temperatures mitjanes al voltant dels 10 °C i l'interior amb temperatures mitjanes hivernals entre 3 i 7 °C. Les temperatures d'estiu són més homogènies al voltant dels 25 °C a la costa i entre 21 i 25 a l'interior. El clima de muntanya es caracteritza per una disminució de la temperatura i un increment de les precipitacions tot això d'acord amb l'augment de l'altitud. A partir dels 1.500 metres es considera que comença el clima d'alta muntanya. La temperatura mitjana anual oscil·la entre els 17 °C del Delta de l'Ebre fins als 0 °C, o inferior, a partir dels 3.000 m d'altitud. Les temperatures extremes han estat de 43 °C Lleida i Igualada juliol de 1982, Montblanc el 4 de juliol de 1994 fins -32 °C de l'Estany Gento el febrer de 1956."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BE%8E%E6%B9%96%E7%B8%A3%E7%A4%BE%E5%8D%80%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%E6%BE%8E%E6%B9%96%E7%A4%BE%E5%8D%80%E5%A4%A7%E5%AD%B8%EF%BC%88%E7%A9%BA%E4%B8%AD%E5%A4%A7%E5%AD%B8%EF%BC%89%E5%A4%9C_%283%29%E6%AD%A3%E9%96%80.jpg","page_title":"澎湖縣社區大學","context_page_description":"澎湖縣社區大學，簡稱澎湖社大，是位於台灣澎湖縣馬公市的社區大學，創立於2008年12月21日，校本部設於國立空中大學澎湖學習指導中心。"},{"page_url":"https://hsb.wikipedia.org/wiki/Orichiw","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Orihiv_Shevchenka_11_Sadyba_Genriha_Yantsena_01_%28YDS_0409%29.jpg","page_title":"Orichiw","context_page_description":"Orichiw je město w Zaporižskej oblasći na Ukrainje. Leži při rěce Kinka něhdźe 60 kilometrow juhowuchodnje wot města Zaporižžja.\\nMa něhdźe 15 tysac wobydlerjow.\\nSydlišćo je so w lěće 1783 załožiło a ma wot lěta 1801 měšćanske prawa."},{"page_url":"https://io.wikipedia.org/wiki/Karnavalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Venezia_carnevale_6.jpg","page_title":"Karnavalo","context_page_description":"Karnavalo esas festo qua eventas en kelka landi e regioni ordinare ante la karesmo. La dato dil festo varias omnayare.\\nOrdinare, dum la festi karnavala, la droli weras maskili e fantaziaji, ed eventas paradi e dansi en stradi. Famoza exempli pri karnavalo mondale konocata esas la festi karnavala en Venezia, Rio de Janeiro, Recife e Salvador, New Orleans, Santa Cruz de Tenerife e Cádiz, Haiti e Trinidad e Tobago."},{"page_url":"https://es.wikipedia.org/wiki/Gendarmer%C3%ADa_Nacional_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Franchi_SPAS_15.png","page_title":"Gendarmería Nacional Argentina","context_page_description":"La Gendarmería Nacional Argentina es una institución militar y fuerza de seguridad argentina. Contribuye a la seguridad interior, la defensa nacional y la política exterior y responde al Ministerio de Seguridad.​\\nEs una fuerza intermedia entre la policía y las Fuerzas Armadas facultada para cumplir funciones de policía en tiempos de paz y para incorporarse al Ejército Argentino en tiempos de guerra.\\nSe creó el 28 de julio de 1938 por el Congreso de la Nación Argentina con la misión de consolidar los límites internacionales y garantizar la seguridad de los colonos y habitantes de las regiones alejadas."},{"page_url":"https://en.wikipedia.org/wiki/Nagra_Jhansi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/1385726011390-Workshop_main_gate-_photo.jpg","page_title":"Nagra Jhansi","context_page_description":"Nagra is a town located in Jhansi Nagar Nigam in the state of Uttar Pradesh in India. It is part of Bundelkhand geographic region and the preferred dialect here is Bundelkhandi. Main population of Nagra consists of railway employees and daily wage earning community."},{"page_url":"https://es.wikipedia.org/wiki/Ottendorf-Okrilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Ottendorf-Okrilla_in_BZ.svg","page_title":"Ottendorf-Okrilla","context_page_description":"Ottendorf-Okrilla es un municipio situado en el distrito de Bautzen, en el estado federado de Sajonia, a una altitud de 180 metros. Su población a finales de 2016 era de unos 10 000 habs. y su densidad poblacional, 400 hab/km².​​"},{"page_url":"https://pt.wikipedia.org/wiki/Marco_Rubio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Meeting_in_February_2013_with_Israeli_President_Shimon_Peres_during_trip_to_Jordan_and_Israel.jpg","page_title":"Marco Rubio","context_page_description":"Marco Antonio Rubio é um político e advogado estadunidense, e é atualmente o senador júnior pela Flórida pelo Partido Republicano desde 3 de janeiro de 2011. Ele também foi o presidente da Câmara de Representantes da Flórida entre 2007 a 2008. Ele foi eleito para a Câmara da Flórida em 25 de janeiro de 2000, pelo 111º distrito congressional.\\nDe ascendência cubana, Rubio é natural de Miami. Ele graduou-se na Faculdade de Direito da Universidade da Florida. No final dos anos 90, ele serviu como membro da Comissão de Governo Municipal de West Miami e foi eleito para a Câmara de Representantes da Flórida em 2000, representando o 111º distrito.\\nMais tarde, em 2002, Rubio foi designado líder da Maioria da Câmara pelo então presidente Johnnie Byrd. Ele foi eleito Presidente da Câmara de Representantes da Flórida em 2005, cargo que ocupou por dois anos. Ao deixar o legislativo da Flórida em 2008, Rubio abriu um escritório de advocacia, e começou a dar aulas na Universidade Internacional da Flórida, onde é professor-adjunto.\\nRubio concorreu ao Senado dos Estados Unidos em 2010, e venceu a eleição."},{"page_url":"https://pt.wikipedia.org/wiki/Daya_Vieja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Daya_Vieja_5_-_Ayuntamiento_y_mirador.jpg","page_title":"Daya Vieja","context_page_description":"Daya Vieja ou Daia Vella é um município da Espanha na província de Alicante, Comunidade Valenciana. Tem 2,98 km² de área e em 2016 tinha 672 habitantes."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D9%86%DB%8C%D8%8C_%D9%86%DB%8C%D9%88%D8%AC%D8%B1%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Kearny_nj.png","page_title":"کارنی، نیوجرسی","context_page_description":"کارنی شهری در ایالت نیوجرسی کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۴۰٬۶۸۴ نفر بوده‌است."},{"page_url":"https://sv.wikipedia.org/wiki/Rhododendron_smirnowii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Rhododendron_smirnowii_%C3%96BG_2012-05-28_01.jpg","page_title":"Rhododendron smirnowii","context_page_description":"Vresrododendron, Rhododendron smirnowii är en ljungväxtart som beskrevs av Ernst Rudolf von Trautvetter. Rhododendron smirnowii ingår i släktet rododendron, och familjen ljungväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Richard_Virenque","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Virenque_by_Mikani.png","page_title":"Richard Virenque","context_page_description":"Richard Virenque è un ex ciclista su strada francese.\\nProfessionista dal 1991 al 2004, conta sette vittorie di tappa al Tour de France, una vittoria di tappa al Giro d'Italia e un bronzo mondiale nella prova in linea del 1994, oltre ad essere il ciclista che ha vinto per il maggior numero di volte la classifica scalatori al Tour de France."},{"page_url":"https://lt.wikipedia.org/wiki/Netikrosios_raguot%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Psfus_u0.gif","page_title":"Netikrosios raguotės","context_page_description":"Netikrosios raguotės - raguotinių šeimos žuvų gentis."},{"page_url":"https://ja.wikipedia.org/wiki/F/A-18_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/US_Navy_030625-N-9319H-016_A_plane_director_prepares_to_assist_an_F-A-18_Hornet_to_one_of_four_steam_driven_catapults_during_flight_operations_on_the_flight_deck_aboard_USS_Nimitz_%28CVN_68%29.jpg","page_title":"F/A-18 (航空機)","context_page_description":"F/A-18は、アメリカ合衆国のマクドネル・ダグラス社が開発した戦闘攻撃機。また、採用国によっては防空任務が主な目的であることからF-18などと呼ばれることもある。\\nスズメバチを意味するホーネットが愛称で、現在は発展型であるF/A-18E/F スーパーホーネットと区別する意味でレガシーホーネットと記載・呼称されることがある。ボーイングでは『F/A-18 Hornet Fighter』と記載している。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80_%D0%9A%D0%BE%D1%80%D1%8E%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Korukivskiy_rayon_prapor.png","page_title":"Прапор Корюківського району","context_page_description":"Пра́пор Корю́ківського райо́ну — символ самоврядування Корюківського району Чернігівської області, що затверджений восьмою сесією сесією Корюківської районної ради шостого скликання від серпня 2011 року."},{"page_url":"https://en.wikipedia.org/wiki/Tatarstan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/%D0%A1%D0%B5%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_1604_%D0%B3._%D0%98%D0%BE%D0%B0%D0%BD%D0%BD%D0%BE-%D0%9F%D1%80%D0%B5%D0%B4%D1%82%D0%B5%D1%87%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C._%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2-%D0%B3%D1%80%D0%B0%D0%B4_%D0%A1%D0%B2%D0%B8%D1%8F%D0%B6%D1%81%D0%BA._%D0%A0%D0%A2._%D0%98%D1%8E%D0%BD%D1%8C_2013_-_panoramio.jpg","page_title":"Tatarstan","context_page_description":"The Republic of Tatarstan, or simply Tatarstan, is a federal subject of the Russian Federation, located in the Volga Federal District. Its capital is the city of Kazan.\\nThe republic borders Kirov, Ulyanovsk, Samara, and Orenburg Oblasts, the Mari El, Udmurt, and Chuvash Republics, and the Republic of Bashkortostan. The area of the republic is 68,000 square kilometres. The unofficial Tatarstan motto is Bez Buldırabız!. As of the 2010 Census, the population of Tatarstan was 3,786,488.\\nThe state has strong cultural ties with its eastern neighbor, the Republic of Bashkortostan.\\nThe state languages of the Republic of Tatarstan are Tatar and Russian."},{"page_url":"https://sq.wikipedia.org/wiki/Kisha_e_Sh%C3%ABn_Spasit_(Prizren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kisha_e_Shen_Spasit_Shelbuesit_-_Prizren_04.jpg","page_title":"Kisha e Shën Spasit (Prizren)","context_page_description":"Kisha e Shën Spasit është një monument i trashëgimisë kulturore në Prizren, Kosovë. Ky monument është i kategorisë \\"Arkeologjik\\", i miratuar me numër 1598/48."},{"page_url":"https://en.wikipedia.org/wiki/Monument_to_the_Fighters_of_the_Revolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/RUS-2016-Aerial-SPB-Field_of_Mars.jpg","page_title":"Monument to the Fighters of the Revolution","context_page_description":"The Monument to the Fighters of the Revolution is a memorial on the Field of Mars in Saint Petersburg. It marks the burial places of some of those who died during the February and October Revolutions in 1917, and casualties who died between 1917 and 1933 in the Russian Civil War or otherwise in the establishment of Soviet power. It contains the first eternal flame in Russia.\\nThe Field of Mars was selected by the Petrograd Soviet as the site for the ceremonial burials of those who had died during the February Revolution, which had toppled the tsarist autocracy. 184 bodies were interred in communal graves at the centre of the field, and a competition was announced for the design of a monument to those buried there. The competition was won by architect Lev Rudnev and consisted of granite walls forming the corners of a square enclosing a central space. Other prominent figures in the early Soviet government, and those who had died fighting to establish Soviet power, were buried on the site, as were those who died during the October Revolution. The monument, and the Field of Mars in general, became a pantheon to those who had died in the service of the state."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D0%BC%D0%B8%D0%B7%D0%B0%D0%B2%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Elmisaurus_frontal_bone.jpg","page_title":"Элмизавр","context_page_description":"Элмиза́вр — род гигантских тероподовых динозавров из семейства овирапторозавров из верхнемеловых отложений Монголии. Виды известны только по фрагментарным остаткам."},{"page_url":"https://no.wikipedia.org/wiki/Bekkekarse","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Cardamine_amara_a1.jpg","page_title":"Bekkekarse","context_page_description":"Bekkekarse er en plante av slekten Cardamine i korsblomstfamilien. Planten er 30–35 cm høy og vokser ved bekker, eng, og i fuktig løvskog. Vokser over hele landet, men sjelden i nord ovenfor Trøndelag. Den er blitt påtruffet helt opp til 1.200 moh.\\nSom de fleste planter i korsblomstfamilien har den hvite blomsten fire kronblad, og bladene er sagtakkede, og relativt smale. kronbladene kan ha et rødskjær ytterst, og pollenbærerne har fiolette knapper. Bladene på stengelen er lengre og smale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B3%D0%BB%D0%B0%D0%B7%D0%BA%D0%B0-%D0%B7%D0%B5%D0%BB%D0%B5%D0%BD%D1%83%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kleines_Granatauge_%28Erythromma_viridulum%29_male.jpg","page_title":"Красноглазка-зеленушка","context_page_description":"Красноглазка-зеленушка, или эритромма малая, — вид равнокрылых стрекоз из семейства стрелок."},{"page_url":"https://nl.wikipedia.org/wiki/Zwarte_wilg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Salix_myrsinifolia_%28Schwarz-Weide%29_IMG_8080.JPG","page_title":"Zwarte wilg","context_page_description":"De zwarte wilg is een struik uit de wilgenfamilie. Het is een tweehuizige struik die van nature voorkomt in Europa en tot in het westen van Siberië. In het noorden van het verspreidingsgebied kan de zwarte wilg uitgroeien tot een 8 meter hoge boom.Het aantal chromosomen is 2n=114."},{"page_url":"https://pt.wikipedia.org/wiki/Jhon_C%C3%B3rdoba","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/2018-08-19_BFC_Dynamo_vs._1._FC_K%C3%B6ln_%28DFB-Pokal%29_by_Sandro_Halank%E2%80%93224.jpg","page_title":"Jhon Córdoba","context_page_description":"Jhon Córdoba é um futebolista colombiano que atua como atacante."},{"page_url":"https://en.wikipedia.org/wiki/Heures_de_Charles_d%27Angoul%C3%AAme","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/LHCA5.jpg","page_title":"Heures de Charles d'Angoulême","context_page_description":"The Heures de Charles d'Angoulême is a book of hours commissioned in the late 15th century by Charles, Count of Angoulême, father of king Francis I of France. It is now in the Bibliothèque nationale de France in Paris, under the number Latin 1173.\\nThe book contains full-page miniatures mostly painted by Robinet Testard, many of which have been adapted from, and inspired by, engravings, including sixteen prints by Israhel van Meckenem which have been glued onto the vellum and overpainted. The book is notable for both the quality of its art, and its various methods of incorporating prints, which testifies to the \\"complex history of interchanges between printed materials and manuscript illumination during the later fifteenth century\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Rya_socken","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Rya_kyrka_upp.jpg","page_title":"Rya socken","context_page_description":"Rya socken i Skåne ingick i Norra Åsbo härad, ingår sedan 1971 i Örkelljunga kommun och motsvarar från 2016 Rya distrikt.\\nSocknens areal är 60,98 kvadratkilometer varav 60,64 land. År 2000 fanns här 1 038 invånare. En del av tätorten Örkelljunga samt tätorten Eket med sockenkyrkan Rya kyrka ligger i socknen."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Baptist_Bernlochner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Neustadt_453_Landshut-1.jpg","page_title":"Johann Baptist Bernlochner","context_page_description":"Johann Baptist Bernlochner war ein deutscher Baumeister und Theaterunternehmer. Er baute Häuser in und um Landshut, vor allem den Bernlochner-Komplex mit einem Theater."},{"page_url":"https://nl.wikipedia.org/wiki/Tilapia_cabrae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Tilapia_cabrae.jpg","page_title":"Tilapia cabrae","context_page_description":"Tilapia cabrae is een straalvinnige vissensoort uit de familie van de cichliden. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1899 door Boulenger."},{"page_url":"https://ast.wikipedia.org/wiki/Alain_Prost","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Festival_automobile_international_2015_-_Photocall_-_065.jpg","page_title":"Alain Prost","context_page_description":"Alain Marie Pascal Prost, OBE, ye un pilotu d'automovilismu francés, unu de los pilotos de Fórmula 1 más esitosos de tolos tiempos. Compitió nel periodu de 1980 a 1993, llogrando 51 victories, 106 podios, cuatro campeonatos mundiales y cuatro subcampeonatos. Dalgunes d'eses marques tuvieron imbatíes mientres dellos años hasta que Michael Schumacher bater na década de 2000. Ye reconocíu polos sos llamatos el Maestru o el Profesor, por cuenta de la so metódica manera de correr.\\nLa rivalidá ente Alain Prost y Ayrton Senna foi posiblemente la mayor de la historia del automovilismu, ente dos pilotos que taben bien per delantre de cuasi cualesquier otru na so dómina. Tal yera dicha rivalidá que la definición del títulu de pilotos de 1989 y la de 1990 producir por un choque ente dambos. Años dempués de la muerte de Senna, el mesmu Prost reconoció qu'ensin Senna nada fuera igual, retroalimentar ente los dos gracies a la so rivalidá. La dómina de los 80' foi posiblemente la década d'oru de la Fórmula 1."},{"page_url":"https://es.wikipedia.org/wiki/Campo_Gallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Campo_Gallo_2.jpg","page_title":"Campo Gallo","context_page_description":"Campo Gallo es una ciudad, cabecera del departamento Alberdi, provincia de Santiago del Estero, Argentina.\\nSe encuentra en el noreste de la provincia de Santiago del Estero, en plena región del Chaco Austral y a 242 km de la ciudad capital provincial, a la cual se llega por la ruta provincial 5. Campo Gallo es una encrucijada de rutas. la ya citada provincial 5 se encuentra aquí con las también provinciales 17 y 177.\\nLos 5455 habitantes de campo Gallo son el 34 % del total poblacional del departamento Alberdi."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D8%A8%D9%88%D9%83%D9%86%D8%BA%D9%87%D8%A7%D9%85_(%D9%81%D9%8A%D8%B1%D8%AC%D9%8A%D9%86%D9%8A%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Buckingham_VA_-_county_courthouse.jpg","page_title":"مقاطعة بوكنغهام (فيرجينيا)","context_page_description":"مقاطعة بوكنغهام هي إحدى المقاطعات في ولاية فيرجينيا في الولايات المتحدة الأمريكية."},{"page_url":"https://ceb.wikipedia.org/wiki/Uraspis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Uraspis_secunda.jpg","page_title":"Uraspis","context_page_description":"Henero sa mga isda ang Uraspis. Ang Uraspis sakop sa kabanay nga Carangidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Grevillea_paradoxa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Grevillea_paradoxa_-_Flickr_-_Kevin_Thiele.jpg","page_title":"Grevillea paradoxa","context_page_description":"Grevillea paradoxa, commonly known as the bottlebrush grevillea, is a shrub of the genus Grevillea native to an area in the Mid West, Wheatbelt and Goldfields-Esperance regions of Western Australia.\\nThe erect, spreading, prickly and non lignotuberous shrub typically grows to a height of 0.5 to 2 metres and has non-glaucous branchlets. It has simple dissected leaves with a blade that is 15 to 50 millimetres long. It blooms from June to October and produces an axillary raceme regular inflorescence with red or pink flowers and red-pink styles. Later it forms ovoid glandular and hairy fruit that is 8 to 13 mm long.\\nThe popular garden plant, Grevillea' 'Dorothy Gordon', is a hybrid between G. sessilis and G. paradoxa."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B6%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Sajas1.jpg","page_title":"Сажас","context_page_description":"Сажас — Францин гӀала-коммуна, лаьтта Къилба-Пиренейш регионехь. Коммунан департамент — Лакха Гаронна. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://it.wikipedia.org/wiki/Encefalopatia_epatica","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Rifaximin.svg","page_title":"Encefalopatia epatica","context_page_description":"Per encefalopatia epatica in medicina si intende la presenza di confusione mentale, un alterato livello di coscienza e coma dovuti a insufficienza epatica. Negli stadi avanzati prende il nome di coma epatico o coma hepaticum e può portare alla morte.\\nTale condizione si riscontra nei casi di insufficienza epatica, quando il fegato non è più in grado di rimuovere efficacemente le sostanze tossiche che si accumulano nel sangue. Episodi di encefalopatia epatica spesso si verificano a seguito di una patologia intercorrente, come infezioni, costipazione, emorragia gastrointestinale, squilibrio elettrolitico. Spesso si riscontra in pazienti sottoposti ad una procedura di shunt portosistemico intraepatico transgiugulare. Solitamente la diagnosi della condizione viene formulata a seguito dell'osservazione dei sintomi, con l'esclusione di una spiegazione alternativa; gli esami del sangue o l'imaging biomedico dell'encefalo possono aiutare nella sua formulazione.\\nL'encefalopatia epatica è una situazione reversibile se opportunamente trattata."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AF%E3%82%A4%E3%83%BB%E3%83%AC%E3%83%8A%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/1_kawhi_leonard_2019_%28cropped%29.jpg","page_title":"カワイ・レナード","context_page_description":"カワイ・レナードは、アメリカ合衆国、カリフォルニア州リバーサイド出身のバスケットボール選手。NBAのロサンゼルス・クリッパーズに所属。ポジションはスモールフォワード。身長201cm、体重104kg。紙面などで、クワイ・レナードと表記される場合もある。手が大きいことから、クロウの愛称を持つ。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80,_%D0%90%D0%B2%D0%B8%D0%BD%D0%BE%D0%B0%D0%BC_%D0%9D%D0%BE%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Noma_Bar_%28cropped%29.jpg","page_title":"Бар, Авиноам Нома","context_page_description":"Авиноам Нома Бар — родившийся в Израиле графический дизайнер, иллюстратор и художник. Его работы публикуются в газетах, журналах, на обложках книг, в рекламных кампаниях и его собственных книгах.\\nБар опубликовал более 550 иллюстраций, которые были использованы в Гардиан, Нью-Йорк Таймс, Time Out, The Observer, The Economist и Wallpaper; для обложек книг Дона Делилло и Харуки Мураками; рекламных кампаний Google, Sony и Nike; на более шестидесяти обложках журналов. Он выпустил три книги о своей работе: Угадай, кто?: Многоликий Нома Бар, Негативное пространство, и Горько-сладкий.\\nБар выиграл престижную профессиональную премию D&AD в 2012 за серию обложек для книги Дона Делилло, созданного с Лондонской дизайн-студией «It’s Nice That». В 2014 году он проиллюстрировал Новый путь читать по-китайски на Shaolan Сюэ, книга о визуальном методе изучения китайского языка."},{"page_url":"https://pl.wikipedia.org/wiki/Zgon%C4%8De","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Zgonce1.jpg","page_title":"Zgonče","context_page_description":"Zgonče – wieś w Słowenii, w gminie Velike Lašče. W 2018 roku liczyła 7 mieszkańców."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%A4%E0%A4%BF%E0%A4%B8%E0%A5%8D%E0%A4%B2%E0%A4%BE%E0%A4%B5%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Laurinc_Gate-Bratislava_Slovakia.JPG","page_title":"ब्रातिस्लावा","context_page_description":"ब्रातिस्लावा, स्लोवाकिया की राजधानी और सबसे बडा शहर है। लगभग 430,000 की आबादी के साथ, यह यूरोप की छोटी राजधानियों में से एक है, लेकिन फिर भी यह देश का सबसे बड़ा शहर है। महानगरीय क्षेत्र 650,000 से अधिक लोगों का घर है। ब्रातिस्लावा दक्षिण पश्चिमी स्लोवाकिया में डैन्यूब नदी के दोनों किनारों और मोरवा नदी के बाएं किनारे पर स्थित है। यह एकमात्र राष्ट्रीय राजधानी है जो दो संप्रभु देशों ऑस्ट्रिया और हंगरी की सीमा बनाती है। ब्रातिस्लावा स्लोवाकिया का राजनीतिक, सांस्कृतिक और आर्थिक केंद्र है। यह स्लोवाक राष्ट्रपति, संसद और स्लोवाक कार्यकारी की सीट है। ब्रातिस्लावा में भी हर साल लगभग 1 मिलियन पर्यटक आते हैं।"},{"page_url":"https://id.wikipedia.org/wiki/John_Rabe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/John_Rabe.jpeg","page_title":"John Rabe","context_page_description":"John Heinrich Detlef Rabe adalah seorang pengusaha Jerman dan anggota Partai Nazi yang dikenal karena upayanya untuk menghentikan kejahatan tentara Jepang pada pendudukan Nanking dan jasanya untuk melindungi dan membantu warga Tiongkok pada peristiwa tersebut. Ia mendirikan Zona Keamanan Nanking menampung sekitar 200.000 orang Tiongkok dari penjagalan pada pembantaian tersebut."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%BE%D1%81%D1%83%D0%B4%D0%B8%D1%81%D1%82%D1%8B%D1%85_%D1%80%D0%B0%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D0%B9,_%D0%B7%D0%B0%D0%BD%D0%B5%D1%81%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%B2_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%83%D1%8E_%D0%BA%D0%BD%D0%B8%D0%B3%D1%83_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Trapa_natans_Kiev1.JPG","page_title":"Список сосудистых растений, занесённых в Красную книгу Украины","context_page_description":"В данный список включены 611 видов сосудистых растений, вошедших в последнее издание Красной книги Украины. По сравнению с предыдущим изданием Красной книги Украины, в новый список были включены новые 201 вид растений, а 21 вид был исключён."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%9F%B3%E7%A1%A4%E5%B0%BE%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Shek_Kip_Mei_Station_2017_10_part3.jpg","page_title":"石硤尾站","context_page_description":"石硖尾站是港铁观塘线的一个车站，位于深水埗区石硖尾伟智街及大坑西邨民泰楼的地底，为地面楼宇提供支承，由前田建设工业株式会社负责兴建，随修正早期系统石硖尾至观塘段于1979年10月1日启用。"},{"page_url":"https://de.wikipedia.org/wiki/K%C3%A4figpanzerung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Stryker_M1134_ATGM.jpg","page_title":"Käfigpanzerung","context_page_description":"Als Käfigpanzerung wird ein zusätzlicher Schutz für die Panzerung von zumeist militärischen Fahrzeugen bezeichnet."},{"page_url":"https://fi.wikipedia.org/wiki/Dals-Edin_kunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/N%C3%B6ssemarks_kyrka.jpg","page_title":"Dals-Edin kunta","context_page_description":"Dals-Edin kunta on Länsi-Götanmaan läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Dalslandiin. Kunnan keskustaajama on Ed.\\nKunnan maapinta-ala on 724,31 neliökilometriä ja asukasluku 4 799 henkeä.\\nKunnan alueella sijaitsee Tresticklanin kansallispuisto.\\nVuonna 2007 kunnassa oli 41,33 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 5,7 prosenttia kunnan maapinta-alasta."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B9%D8%A7%D8%B4%D9%82_%D8%A7%D9%84%D9%85%D8%AA%D8%AD%D8%B1%D8%B1_(%D8%B1%D9%88%D8%A7%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Solunto_flickr01.jpg","page_title":"العاشق المتحرر (رواية)","context_page_description":"العاشق المتحرر ‏ هي إحدى الروايات القصيرة التي تنتمي إلى روايات النموذجية لميغيل دي ثربانتس. في تلك الرواية وحد بين عناصر الرواية الموريسكية والرواية البيزنطينية، ومع ذلك قام بنقد بعض ملامح الرواية البيزنطينية. بجانب موضوع الحب السخى للأسير، تناولت الرواية إيحاءات للسيرة الذاتية لميغيل دي ثيربانتس ولكن مع وجود اختلافات."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Soekarno.jpg","page_title":"History of Indonesia","context_page_description":"The history of Indonesia has been shaped by its geographic position, its natural resources, a series of human migrations and contacts, wars and conquests, as well as by trade, economics and politics. Indonesia is an archipelagic country of 17,000 to 18,000 islands stretching along the equator in South East Asia. The country's strategic sea-lane position fostered inter-island and international trade; trade has since fundamentally shaped Indonesian history. The area of Indonesia is populated by peoples of various migrations, creating a diversity of cultures, ethnicities, and languages. The archipelago's landforms and climate significantly influenced agriculture and trade, and the formation of states. The boundaries of the state of Indonesia represent the 20th century borders of the Dutch East Indies.\\nFossilised remains of Homo erectus and his tools, popularly known as the \\"Java Man\\", suggest the Indonesian archipelago was inhabited by at least 1.5 million years ago. Austronesian people, who form the majority of the modern population, are thought to have originally been from Taiwan and arrived in Indonesia around 2000 BCE."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%BB%9B%E8%A5%BF_(%E5%96%AC%E6%B2%BB%E4%BA%9E%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Daisy%2C_Georgia_Caboose.JPG","page_title":"黛西 (喬治亞州)","context_page_description":"黛西是一個位於美國喬治亞州埃文斯郡的城市。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Oud-Heverlee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Haasrode-Milsestraat51-Parochiekerk-Onze-Lieve-Vrouw.JPG","page_title":"Lijst van onroerend erfgoed in Oud-Heverlee","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Oud-Heverlee. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ceb.wikipedia.org/wiki/Coleodactylus_amazonicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Chatogekko_amazonicus.jpg","page_title":"Coleodactylus amazonicus","context_page_description":"Espesye sa reptil ang Coleodactylus amazonicus. Una ning gihulagway ni Andersson 1918. Ang Coleodactylus amazonicus sakop sa kahenera nga Coleodactylus sa kabanay nga Gekkonidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Chevrolet_Chevelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Chevrolet_Chevelle_SS_Wagon_%28Toronto_Spring_%2712_Classic_Car_Auction%29.JPG","page_title":"Chevrolet Chevelle","context_page_description":"The Chevrolet Chevelle is a mid-sized automobile which was produced by Chevrolet in three generations for the 1964 through 1978 model years. Part of the General Motors A-body platform, the Chevelle was one of Chevrolet's most successful nameplates. Body styles include coupes, sedans, convertibles and station wagons. Super Sport versions were produced through the 1973 model year, and Lagunas from 1973 through 1976. After a four-year absence, the El Camino was reintroduced as part of the new Chevelle lineup in 1964. The G-body Monte Carlo, introduced in 1970, also used a platform that was based heavily on the Chevelle platform, although it was lengthened ahead of the firewall. The Malibu, the top of the line model through 1972, completely replaced the Chevelle nameplate for the redesigned, downsized 1978 model year."},{"page_url":"https://de.wikipedia.org/wiki/Deutsche_Waffenstillstandskommission_1918","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Einmarsch_der_Truppen_Anfang_Dezember_in_Berlin.jpg","page_title":"Deutsche Waffenstillstandskommission 1918","context_page_description":"Die Deutsche Waffenstillstandskommission von 1918 wurde Ende des Ersten Weltkrieges zusammengestellt und sollte die deutschen Interessen in den Waffenstillstandsverhandlungen mit der Entente vertreten. Die WaKo erhielt die Vollmacht für die Unterzeichnung des Vertrages, die am 11. November 1918 in einem Eisenbahnwaggon auf der Lichtung von Rethondes unweit von Compiègne stattfand."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BA%D0%B2%D0%B0%D0%BC%D0%B5%D1%82%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Dean-Stark_apparatus.svg","page_title":"Акваметрия","context_page_description":"Акваметрия — ряд методов количественного определения содержания воды в различных веществах."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86_%D8%A8%D9%8A%D9%84%D8%B3%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Dan_Bylsma.jpg","page_title":"دان بيلسما","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nدان بيلسما لاعب هوكى الجليد من امريكا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Coat_of_Arms_of_Volgodonsk_%28Rostov_oblast%29.png","page_title":"Герб Волгодонска","context_page_description":"Герб города Волгодонска — является официальным знаком города, знаком власти, полномочий, публичного авторитета городской администрации, городской Думы, утверждённый 29 сентября 1995 года."},{"page_url":"https://es.wikipedia.org/wiki/Triodia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Triodia_hummock_grassland.jpg","page_title":"Triodia","context_page_description":"Triodia es un género de plantas herbáceas de la familia de las gramíneas o poáceas.​ Es endémico de Australia y tiene 112 especies descritas y de estas, solo 68 aceptadas.​"},{"page_url":"https://zh.wikipedia.org/zh-cn/1985%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B1%E9%A2%A8%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Irma_1985_track.png","page_title":"1985年太平洋颱風季","context_page_description":"1985年太平洋台风季泛指在1985年全年内的任何时间，于赤道以北及国际换日线以西的太平洋水域，以及南中国海所产生的热带气旋。虽然有关方面并没有设下本台风季的指定期限，但大部分于西北太平洋的热带气旋通常都会于五月至十二月期间形成。。\\n本条目的范围仅局限于赤道以北及国际换日线以西的太平洋及南海的水域。于赤道以北及国际换日线以东的太平洋水域产生的风暴则被称为飓风，并被列入1985年\\n以下各热带气旋资讯以热带气旋存在期间的最强形态为准。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_du_bassin_minier_du_Nord-Pas-de-Calais_inscrits_sur_la_liste_du_patrimoine_mondial","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Valenciennes_-_Fosse_Dutemple_des_mines_d%27Anzin%2C_puits_n%C2%B0_2_%2839%29.JPG","page_title":"Liste des biens du bassin minier du Nord-Pas-de-Calais inscrits sur la liste du patrimoine mondial","context_page_description":"Trois-cent-cinquante-trois biens du bassin minier du Nord-Pas-de-Calais ont été inscrits sur la liste du patrimoine mondial de l'humanité le 30 juin 2012, lors de la trente-sixième session du comité du patrimoine mondial, organisé par l'Unesco du 24 juin au 6 juillet 2012 à Saint-Pétersbourg.\\nCes 353 éléments sont répartis en 109 sites, de superficies très variables."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%B2%E0%AF%8D%E0%AE%83%E2%80%8C%E0%AE%AA%E0%AF%8B%E0%AE%A9%E0%AF%8D%E0%AE%9A%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Saint_Alphonsa_Tomb.jpg","page_title":"அல்ஃ‌போன்சா","context_page_description":"புனித அல்போன்சா என்பவர் இந்தியாவின் முதல் பெண் புனிதர் ஆவார்."},{"page_url":"https://ceb.wikipedia.org/wiki/Zumsteinspitze","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/SignalkuppeZumsteinspitzeFromNordend.jpg","page_title":"Zumsteinspitze","context_page_description":"Tumoy sa bukid ang Zumsteinspitze sa Italya. Nahimutang ni sa rehiyon sa Piemonte, sa amihanan-kasadpang bahin sa nasod, 600 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. 4,563 metros ibabaw sa dagat kahaboga ang nahimutangan sa Zumsteinspitze, o 123 ka metros sa ibabaw sa naglibot nga tereyn. Mga 0.95 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Zumsteinspitze kay kasagaran daghan kaayong kabukiran. Kinahabogang dapit sa palibot ang Punta Nordend, 4,609 ka metros ni kahaboga ibabaw sa dagat, 1.1 km sa amihanan sa Zumsteinspitze. Dunay mga 6 ka tawo kada kilometro kwadrado sa palibot sa Zumsteinspitze may kaayo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Ayas, 19.2 km sa habagatan-kasadpan sa Zumsteinspitze. Hapit nalukop sa kasagbotan ang palibot sa Zumsteinspitze. Sa rehiyon palibot sa Zumsteinspitze, kabukiran talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 2 °C. Ang kinainitan nga bulan Hulyo, sa 12 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 1,358 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 198 milimetro nga ulan, ug ang kinaugahan Septiyembre, sa 66 milimetro."},{"page_url":"https://ht.wikipedia.org/wiki/Retin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Fundus_photograph-normal_retina_EDA06.JPG","page_title":"Retin","context_page_description":"Retin se yon kouch tisi mens padèyè zye a ki fòme avèk reseptè limyè ak newon sansoryèl."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_XIV_Johan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Karl_XIV_Johan_-_Bengt_Erland_Fogelberg.jpg","page_title":"Karl XIV Johan","context_page_description":"Karl XIV Johan, född Jean Bernadotte 26 januari 1763 i Pau, Béarn, Frankrike, död 8 mars 1844 på Stockholms slott, var kung av Sverige och Norge från 1818, i Norge även känd under regentnamnet Karl III Johan. Han gifte sig den 16 augusti 1798 i Paris med Désirée Clary, sedermera svensk-norsk drottning under namnet Desideria, svägerska till Napoleons bror Joseph Bonaparte. Vid ankomsten till Sverige 1810 som furste av Ponte Corvo hade hans fullständiga namn utvecklats till Jean Baptiste Jules. Namnet Karl fick han efter adoptivfadern Karl XIII."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bodendenkm%C3%A4ler_in_Hohenwart","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Hohenwart_Marktkirche_2011-08.jpg","page_title":"Liste der Bodendenkmäler in Hohenwart","context_page_description":"Auf dieser Seite sind die Bodendenkmäler des oberbayerischen Marktes Hohenwart zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Bodendenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D1%80%D0%BA%D1%96%D0%BD_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE_%D0%9C%D0%B0%D1%80%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Svyatoshyn_metro_station_Kiev_2010_02.jpg","page_title":"Сиркін Михайло Маркович","context_page_description":"Си́ркін Миха́йло Ма́ркович — український радянський архітектор, член Спілки архітекторів України з 1954 року."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_du_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ctwestclaims.png","page_title":"Histoire du Connecticut","context_page_description":"Le territoire qui forme aujourd'hui l'État du Connecticut fut colonisé par les Hollandais au début du XVIIᵉ siècle puis par les Anglais sur trois points entre les années 1630 et 1640."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%AE%CF%83%CE%BF%CF%82_%CE%9C%CE%B1%CE%BA%CE%BF%CF%85%CE%AC%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Macquarie_-_Landsat_OLI_79.png","page_title":"Νήσος Μακουάρι","context_page_description":"Η νήσος Μακουάρι είναι νησί στο νοτιοδυτικό Ειρηνικό Ωκεανό, περίπου στο μέσο της απόστασης ανάμεσα στη Νέα Ζηλανδία και την Ανταρκτική. Το νησί ανήκει στη Τασμανία, από το 1900 και αποτελεί από το 1997 αποτελεί μνημείο παγκόσμιας κληρονομιάς της UNESCO. Το νησί αποτελεί το τμήμα της ράχης Μακουάρι που βρίσκεται πάνω από την επιφάνεια της θάλασσας, η οποία ανυψώθηκε από τη σύγκλιση της ινδοαυστραλιανής τεκτονικής πλάκας με αυτή του Ειρηνικού. Αποτελεί το μόνο σημείο στη Γη που ο μανδύας της γης είναι εκτεθειμένος στην επιφάνεια. Το νησί είναι μακρόστενο με μήκος 34 χιλιόμετρα και πλάτος 5. Ανακαλύφθηκε το 1810 από τον Φρέντερικ Χασσελμπόροου. Στο νησί κατά την εποχή της αναπαραγωγής βρίσκεται όλος ο πληθυσμός βασιλικών πιγκουίνων. Η Αυστραλία διατηρεί ερευνητικό σταθμό στο νησί από το 1948."},{"page_url":"https://en.wikipedia.org/wiki/Jean_Casimir_F%C3%A9lix_Guyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Ancien-h%C3%B4pital-F%C3%A9lix-Guyon.JPG","page_title":"Jean Casimir Félix Guyon","context_page_description":"Jean Casimir Félix Guyon was a French surgeon and urologist born in Saint-Denis, Ile-Bourbon.\\nHe studied medicine in Paris, receiving his doctorate in 1858. He was appointed médecin des hôpitaux in 1864, and was later a professor of surgical pathology and genitourinary surgery at the University of Paris. In 1878 he became a member of the Académie de Médecine. At Hôpital Necker he held clinics that were attended by students worldwide\\nIn 1907, he along with urologists from Europe, the United States and South America established the Association Internationale d'Urologie. In 1979 he was commemorated on a postage stamp, issued by France on the occasion of the 18th Congress of the Association Internationale d'Urologie, held in Paris. The Hôpital Félix Guyon, located in Saint-Denis, Réunion, is named in his honour.\\nAlthough he was primarily known for work with genitourinary anatomy, Guyon is credited with the discovery of the ulnar canal at the wrist. This canal channels blood vessels and the ulnar nerve from the forearm to the hand, and is now known as Guyon's canal. Ulnar nerve compression at this location is sometimes referred to as \\"Guyon's tunnel syndrome\\"."},{"page_url":"https://pt.wikipedia.org/wiki/Llan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Llan2.jpg","page_title":"Llan","context_page_description":"Llan é um vila situada em Powys, Gales. Está às margens da estrada B4518 para Llanidloes, 1,5 milhas de Llanbrynmair. Esta área era originalmente o centro de Llanbrynmair até a primeira metade do século 19. No entanto, a comunidade mudou-se para sua localização atual na junção das estradas A470 e B4518, como resultado da abertura da nova estrada de pedágio e com a chegada da estrada de ferro em 1861."},{"page_url":"https://en.wikipedia.org/wiki/Yeezus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Kanye_West_Yeezus_Tour_Staples_Center_1.jpg","page_title":"Yeezus","context_page_description":"Yeezus is the sixth studio album by American rapper and producer Kanye West. It was released on June 18, 2013, through Def Jam Recordings and Roc-A-Fella Records. West gathered a number of artists and close collaborators for the production, including Mike Dean, Daft Punk, Noah Goldstein, Arca, Hudson Mohawke, and Travis Scott. The album also features guest vocals from Justin Vernon, Chief Keef, Kid Cudi, Assassin, King L, Charlie Wilson, and Frank Ocean.\\nFifteen days before its release date, West enlisted the help of producer Rick Rubin to strip down the sound of Yeezus in favor of a more minimalist approach. The album has been characterized as West's most experimental and sonically abrasive work. It draws from an array of genres, including industrial, acid house, electro, punk, and Chicago drill. West's unconventional use of samples is also contained, as on \\"Blood on the Leaves\\", which contains a sample from Nina Simone's 1965 rendition of \\"Strange Fruit\\".\\nNo album artwork is featured on the release of the former, and the physical CD edition was released in a clear jewel box with only a strip of red tape and sample credits."},{"page_url":"https://de.wikipedia.org/wiki/Reinsdorf_(Schaumburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bauernhof_Reinsdorf_Schaumburg.jpg","page_title":"Reinsdorf (Schaumburg)","context_page_description":"Reinsdorf ist ein Ortsteil der Gemeinde Apelern in der Samtgemeinde Rodenberg im Landkreis Schaumburg im Bundesland Niedersachsen."},{"page_url":"https://nl.wikipedia.org/wiki/Meher_Baba","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pointingalphabet.jpg","page_title":"Meher Baba","context_page_description":"Merwan Sheriar Irani, beter bekend als Meher Baba, was een Indiase goeroe van Iraanse afkomst, die zijn volgelingen liet weten dat hij de avatara was."},{"page_url":"https://nl.wikipedia.org/wiki/Stripwinkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Comic_book_shop_Blunder_Utrecht.JPG","page_title":"Stripwinkel","context_page_description":"Een stripwinkel of stripspeciaalzaak is een boekhandel die gespecialiseerd is in de verkoop van stripboeken en aanverwante koopwaar. Dit kunnen nieuwe boeken zijn, maar ook tweedehands boeken of oude stripboeken met een kostbare waarde, zogenoemde collector's items.\\nIn Nederland zijn ongeveer 35 stripwinkels, in Vlaanderen 25.\\nStripwinkels hebben een aantal eigen alternatieve distributiekanalen die de strips leveren.\\nDe meeste stripboeken zijn in Nederland niet bij de reguliere boekhandel te bestellen en hiervoor moet speciaal de stripboekenwinkel bezocht worden. In België zijn strips vaak te vinden in supermarkten, dagbladhandelaars en boekhandels."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%B1%D0%B5%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%BE%D1%88%D0%B0%D0%B4%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Zafira_Al_Saida_0001.jpg","page_title":"Берберийская лошадь","context_page_description":"Берберийская — порода лошади. Это одна из самых старых пород восточного типа. В течение многих столетий она сильно повлияла на другие породы, помогая основать большое количество самых успешных современных пород в мире. Вместе с арабской, берберийская заслуживает достойное место в истории коневодства. Тем не менее она не достигла такой всемирной популярности, как арабская, и даже не имеет статуса малоизвестных восточных типов, как ахалтекинская и туркменская."},{"page_url":"https://en.wikipedia.org/wiki/List_of_windmills_in_Lincolnshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Barrow_Haven_Mill.jpg","page_title":"List of windmills in Lincolnshire","context_page_description":"A list of windmills in the traditional county of Lincolnshire."},{"page_url":"https://eu.wikipedia.org/wiki/Hiiumaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Talo_Tammelan_kyl%C3%A4ss%C3%A4.JPG","page_title":"Hiiumaa","context_page_description":"Hiiumaa Estoniako bigarren uharterik handiena da, 989 kilometro karratuko hedadurarekin. Itsaso Baltikoan dago, Saaremaa uhartetik iparraldera, eta mendebaldeko estoniar uhartediaren zati da. Hiiumaa uharteko hiri nagusia Kärdla da. Azken herri honetatik zazpi kilometro ingurura dago Kärdlako aireportua\\nHiiumaa, Hiiu Konderriko uharte nagusia da, estonieraz, konderri hau Hiiumaakond edo Hiiumaa deitzen delarik. Uhartearen aleman eta suedierazko izena Dagö da, eta, danieraz Dagø da. Finlandieraz Hiidenmaa deitzen da, hitzez hitz, \\"deabruaren uhartea\\" esan nahi duena."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D0%B5%D1%80%D1%96%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Collectio_plantarum_tam_exoticarum%2C_quam_indigenarum%2C_cum_delineatione%2C_descriptione_culturaque_earum_-_%2820341797672%29.jpg","page_title":"Список видів роду еріка","context_page_description":"Список видів роду еріка:\\nСписок, який містить 868 визнаних види роду Еріка з родини вересових, складений на основі даних сайту «The Plant List»."},{"page_url":"https://da.wikipedia.org/wiki/Andernach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Runder_Turm_Andernach.jpg","page_title":"Andernach","context_page_description":"Andernach er en by i Tyskland i delstaten Rheinland-Pfalz med cirka 30.000 indbyggere.\\nAndernach blev etableret som en militærpost af Augustus ca. 12 f.Kr., og byen fejrede sit 2000 års jubilæum i 1988. Andernach ligger ved floden Rhinen, 19 km nordvest for Koblenz, på jernbanelinjen fra Mainz til Köln."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BC%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%90%D0%BB%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Castello_Ducale_di_Agli%C3%A8_parco_2.jpg","page_title":"Херцогски замък на Алие","context_page_description":"Херцогският замък на Алие е Савойски дворец, намиращ се в градчето Алие, регион Пиемонт, Северна Италия. От 1997 г. е включен в Списъка на ЮНЕСКО за Световното културно и природно наследство като част от Савойските кралски резиденции на Пиемонт.\\nВ него са заснети двата сезона на популярния италиански телевизионен сериал „Елиза от Ривомброза“, излъчен и по българската телевизия, и минисериалите на Rai „Красавицата и звярът“ и „Мария Жозе – последната кралица“."},{"page_url":"https://fr.wikipedia.org/wiki/La_Musica_Notturna_delle_strade_di_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/El_cantor_ciego.jpg","page_title":"La Musica Notturna delle strade di Madrid","context_page_description":"La Musica Notturna delle strade di Madrid est une composition pour quintette à cordes à deux violoncelles de Luigi Boccherini faisant partie intégrante du recueil de six quintettini opus 30.\\nComposé en 1780 à Arenas de San Pedro alors que le compositeur est au service de don Luis, prince de la maison de Bourbon, ce quintettino évoque l'atmosphère des rues de Madrid à la nuit tombée. Il s'agit de son second essai de musique descriptive après celui du quintette en ré majeur opus 11 nᵒ 6 L'Uccelleria de 1771."},{"page_url":"https://en.wikipedia.org/wiki/Zemunski_Kej","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Dunav_Zemun_2006.jpg","page_title":"Zemunski Kej","context_page_description":"Zemunski Kej is an urban neighborhood of Belgrade, the capital of Serbia. It is located in Belgrade's municipality of Zemun."},{"page_url":"https://ru.wikipedia.org/wiki/Filmfare_Awards_(1969)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/SimiGarewal.jpg","page_title":"Filmfare Awards (1969)","context_page_description":"16-я церемония награждения Filmfare Awards прошла в 1969 году, в городе Бомбей. На ней были отмечены лучшие киноработы на хинди, вышедшие в прокат до конца 1968 года.\\nНа этой церемонии впервые состоялось вручение премий в номинации «Лучший сценарий».\\nНаграды в категории «Лучший документальный фильм» была удостоена кинолента Explorer режиссёра Промода Пати."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D0%98%D0%BE%D1%81%D0%B8%D1%8F_%D0%A1%D0%B0%D0%BA%D1%81%D0%B5%D0%BD-%D0%9A%D0%BE%D0%B1%D1%83%D1%80%D0%B3-%D0%97%D0%B0%D0%B0%D0%BB%D1%8C%D1%84%D0%B5%D0%BB%D1%8C%D0%B4%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%D0%9F%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82_%D0%BA_%D1%81%D1%82%D0%B0%D1%82%D1%8C%D0%B5_%C2%AB%D0%9A%D0%BE%D0%B1%D1%83%D1%80%D0%B3-%D0%97%D0%B0%D0%B0%D0%BB%D1%8C%D1%84%D0%B5%D0%BB%D1%8C%D0%B4%2C_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85-%D0%98%D0%BE%D1%81%D0%B8%D1%8F%2C_%D0%BF%D1%80%D0%B8%D0%BD%D1%86%2C_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9%C2%BB._%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%8D%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F_%D0%A1%D1%8B%D1%82%D0%B8%D0%BD%D0%B0_%28%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%2C_1911-19.jpg","page_title":"Фридрих Иосия Саксен-Кобург-Заальфельдский","context_page_description":"Фри́дрих Ио́сия Са́ксен-Ко́бург-Заальфельдский — эрнестинский принц, командующий войсками Габсбургов в конце 1780-х и начале 1790-х годов."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Aachen-Mitte_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Arndtstra%C3%9Fe_26-30.JPG","page_title":"Liste der Baudenkmäler in Aachen-Mitte (A–H)","context_page_description":"Die Liste der Baudenkmäler in Aachen-Mitte (A–H) enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Aachen-Mitte in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Aachen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://de.wikipedia.org/wiki/Telefomin-Kuskus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Telefomin_Cuscus_area.png","page_title":"Telefomin-Kuskus","context_page_description":"Der Telefomin-Kuskus ist ein extrem seltener oder bereits ausgestorbener Kletterbeutler aus der Gattung der Kuskus, der im Tal des Nong Rivers in den Bezirken von Telefomin und Tifalmin im äußersten Westen Papua-Neuguineas endemisch ist. Er kommt in Eichenwäldern in Höhenlagen von 1400 bis 2600 m über dem Meeresspiegel vor. Diese Art war beim Volk der Telefol schon sehr lange bekannt, bevor Tim Flannery 1985 und 1986 die sechs Typusexemplare sammelte. 1987 erfolgte durch Flannery die wissenschaftliche Erstbeschreibung. Der Artname matanim ist vom Telefol-Name für diese Art abgeleitet."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%92%D0%BE%D1%8F%D0%B4%D0%B6%D1%8D%D1%80_(%D0%BA%D0%B0%D1%81%D1%8C%D0%BC%D1%96%D1%87%D0%BD%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B3%D1%80%D0%B0%D0%BC%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Titan_3E_Centaur_launches_Voyager_2.jpg","page_title":"Вояджэр (касьмічная праграма)","context_page_description":"Во́яджэр — назва сэрыі амэрыканскіх касьмічных апаратаў, а таксама назва праекту па дасьледаваньні далёкіх плянэт Сонечнай сыстэмы з удзелам апаратаў дадзенай сэрыі. «Вояджэры» сталі трэцім і чацьвёртым касьмічным апаратам, якія пакінулі межы сонечнай сыстэмы, першымі двума былі «Піянэр-10» і «Піянэр-11».\\n«Вояджэр» — даволі буйны будынак. Гэта высокааўтаномны робат, абсталяваны ўласнымі энэргетычнымі ўсталёўкамі, ракетнымі рухавікамі, кампутарамі, сыстэмай радыёсувязі, кіраваньні й навуковымі прыборамі для дасьледаваньня плянэт, масай каля 815 кг.\\nУсяго было створана й адпраўлена ў космас два такія апараты:\\nВояджэр-1\\nВояджэр-2\\n«Вояджэр-1» і «Вояджэр-2» былі створаныя ў лябараторыі рэактыўнага руху НАСА."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B5%D0%BD,_%D0%96%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Charade_1963_Jacques_Marin.jpg","page_title":"Марен, Жак","context_page_description":"Жак Раймон Марен — французский актёр театра и кино."},{"page_url":"https://pl.wikipedia.org/wiki/Port_lotniczy_Sein%C3%A4joki","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Sein%C3%A4joen_lentoasema.JPG","page_title":"Port lotniczy Seinäjoki","context_page_description":"Seinäjoki – regionalny port lotniczy położony 11 km na południe od Seinäjoki, w Finlandii."},{"page_url":"https://fr.wikipedia.org/wiki/Blackpink","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/20190106_%28NEWSEN%29_%EB%B8%94%EB%9E%99%ED%95%91%ED%81%AC%28BLACKPINK%29%2C_%EC%88%98%EC%A4%8D%EC%9D%80_%EB%A7%8E%EC%9D%80_%EC%86%8C%EB%85%80%EC%A7%80%EB%A7%8C_%EB%8F%8B%EB%B3%B4%EC%9D%B4%EB%8A%94_%EC%95%84%EB%A6%84%EB%8B%A4%EC%9A%B4_%EB%AF%B8%EB%AA%A8_%28Golden_Disc_Awards_2019%29_%283%29.jpg","page_title":"Blackpink","context_page_description":"Blackpink, est un girl group sud-coréen formé en 2016 par YG Entertainment. C'est le deuxième groupe féminin à débuter, après 2NE1, au sein de la YG Entertainment. Le groupe est composé de quatre membres se prénommant Jennie, Lisa, Jisoo et Rosé. Elles forment un groupe multinational, venant de Corée du Sud, de Thaïlande, d'Australie et de Nouvelle-Zélande. Le groupe a fait ses débuts le 8 août 2016, avec leur premier album single, Square One, qui a donné naissance à Whistle, leur première chanson numéro un en Corée du Sud, ainsi que Boombayah, leur premier tube numéro un sur le classement du Billboard World Digital Songs. Avec le succès commercial précoce du groupe, elles ont été reconnue comme le nouvel artiste de l'année aux 31ᵉ Golden Disk Awards et aux 26ᵉ Seoul Music Awards.\\nBlackpink est le groupe de K-pop féminin le plus haut-classé sur le Billboard Hot 100 et le Billboard 200, culminant à la trente-troisième place avec Sour Candy sortie en 2020, et culminant à la vingt-quatrième place avec Kill This Love sortie en 2019, respectivement."},{"page_url":"https://sv.wikipedia.org/wiki/Lassy,_Ille-et-Vilaine","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Map_commune_FR_insee_code_35149.png","page_title":"Lassy, Ille-et-Vilaine","context_page_description":"Lassy är en kommun i departementet Ille-et-Vilaine i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Guichen som tillhör arrondissementet Redon. År 2009 hade Lassy 1 381 invånare."},{"page_url":"https://gl.wikipedia.org/wiki/Ivica_Oli%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Ivica_Oli%C4%87_during_game_v_England.jpg","page_title":"Ivica Olić","context_page_description":"Ivica Olić, nado en Davor o 14 de setembro de 1979, é un futbolista croata. Xoga de dianteiro e o seu club desde xuño de 2012 é o equipo alemán VfL Wolfsburg. É internacional por Croacia."},{"page_url":"https://eo.wikipedia.org/wiki/Abbesses_(pariza_metrostacio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Paris.metro.abbesses.station.jpg","page_title":"Abbesses (pariza metrostacio)","context_page_description":"Abbesses ​[abɛs] estas stacio de la Metroo de Parizo sur linio 12, en la 18-a arondismento de Parizo."},{"page_url":"https://sh.wikipedia.org/wiki/Giza","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Giza_Square_-_%D9%85%D9%8A%D8%AF%D8%A7%D9%86_%D8%A7%D9%84%D8%AC%D9%8A%D8%B2%D9%87_-_panoramio.jpg","page_title":"Giza","context_page_description":"Giza je treći po veličini grad u Egiptu sa svojih 4,212,750 stanovnika. Ona je i administrativni centar Muhafaze Giza u Gornjem Egiptu u kojoj živi 8,831,714 stanovnika.\\nGiza je zapravo dio konurbacije Metropolitanski Kairo u kojoj živi 20,440,000 stanovnika. i de facto samo predgrađe egipatske prijestolnice"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%87%E0%B4%B0%E0%B4%B3%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B4%BF%E0%B4%B2%E0%B5%86_%E0%B4%A4%E0%B5%81%E0%B4%AE%E0%B5%8D%E0%B4%AA%E0%B4%BF%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Davidraju_IMG_5088.jpg","page_title":"കേരളത്തിലെ തുമ്പികളുടെ പട്ടിക","context_page_description":"രണ്ട് ജോടി സുതാര്യമായ ചിറകുകളും സങ്കീർണ്ണമായ കണ്ണുകളോടും നീണ്ട ശരീരത്തോടും കൂടിയ പറക്കാൻ കഴിയുന്ന ഒരു ജലജന്യ ഷഡ്പദമാണ് തുമ്പി. തുമ്പിവർഗ്ഗത്തെ വീണ്ടും സൂചിത്തുമ്പികൾ, കല്ലൻ തുമ്പികൾ, അനിസോസൈഗോപ്‌റ്ററ എന്നിങ്ങനെ മൂന്നായി തരം തിരിച്ചിട്ടുണ്ട്.\\nഇതും കാണുക: കേരളത്തിലെ തുമ്പികളുടെ ശാസ്ത്രീയ വർഗ്ഗീകരണം ആധാരമാക്കിയുള്ള പട്ടിക"},{"page_url":"https://nl.wikipedia.org/wiki/Port_Royal_(Canada)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Port_Royal%2C_Nova_Scotia_-_circa_1612_-_Project_Gutenberg_etext_20110.jpg","page_title":"Port Royal (Canada)","context_page_description":"Port Royal is een plaatsje in Annapolis County in de Canadese provincie Nova Scotia. Het ligt aan het Annapolis Bassin, een kleine baai waar de rivier de Annapolis de Fundybaai in stroomt.\\nPort Royal was een belangrijke Franse nederzetting tijdens de kolonisatie van Noord-Amerika en speelde een belangrijke rol in de Frans-Engelse strijd in Noord-Amerika tijdens de Oorlog van koning Willem en de Oorlog van koningin Anne. Het werd 1605 gesticht en was daarmee de tweede permanente vestiging van kolonisten boven Florida. In 1613 werd de nederzetting weer afgebrand door de Engelsen. In 1690 vond een veldslag tussen de Fransen en Engelsen plaats bij Port Royal. In de jaren 1930 werd de oorspronkelijke nederzetting herontdekt en vonden archeologische opgravingen plaats.\\nVandaag de dag is Port Royal een populaire toeristenbestemming. Het heeft een openluchtmuseum, Habitation at Port-Royal, een replica van de oorspronkelijke nederzetting. Ook staat hier nog een fort, Scotch Fort, dat in 1629 werd gebouwd door Schotse kolonisten, maar drie jaar later weer werd verlaten toen het gebied teruggegeven werd aan de Fransen."},{"page_url":"https://sq.wikipedia.org/wiki/Venecia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/VenetieLocatie.png","page_title":"Venecia","context_page_description":"Venecia është një qytet në pjesën verilindore të Italisë në breg të Detit Adriatik, është kryeqyteti i rajonit Veneto dhe i Provincës së Veneciës. E mban emrin La Serenissima, çfarë do të thotë E Qeta.\\nQyteti ka rreth 270,000 banorë dhe është bashkë me lagunën e mbrojtur nga UNESCO që nga viti 1987.\\nGjatë një mijëvjeçari Venecia ishte si Republika e Veneciës një nga fuqitë më të rëndësishme politike dhe ekonomike si dhe një nga qytetet më të mëdhenj të Evropës, deri në vitin 1797 kur përfundoi pavarësia. Fisnikëria e saj, që dominonte politikisht, kontrollonte gjatë një periudhe të gjatë tregun ndërmjet Evropën perëndimore dhe Detin Mesdhe lindor. Venecia përfitoi nga tregu me mallra luksoze, erëza, kripë dhe grurë, dhe u zhvillua në qendrën më të madhe financiare."},{"page_url":"https://ast.wikipedia.org/wiki/OpenCola","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Opencola.jpg","page_title":"OpenCola","context_page_description":"OpenCola ye una bebida de cola única na que les instrucciones pa realizala tán disponibles llibremente y pueden modificar. Cualesquier puede faer la bébora, modificar y ameyorar la receta siempres que, amás, rexistren les sos propies recetes so la GNU General Public License.\\nAnque orixinalmente llanzóse como una ferramienta promocional pa esplicar el software de códigu abiertu, la bébora siguió creciendo. La compañía OpenCola, con sede en Toronto, diose a conocer más pola bébora que pol software que pretendía promover. Laird Brown, el directivu d'estratexa de la compañía, atribúi'l so ésitu a la rocea que s'estendió ante les grandes empreses y \\"patentadores de casi tou\\". La estratexa de mercadotecnia dio un xiru y yá nun promocionen el refrescu na so páxina web."},{"page_url":"https://it.wikipedia.org/wiki/Cilgerran","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/St_Llawddogs%2C_Cilgerran_%28geograph_2153547%29.jpg","page_title":"Cilgerran","context_page_description":"Cilgerran è un centro abitato del Galles, situato nella contea del Pembrokeshire."},{"page_url":"https://en.wikipedia.org/wiki/Studer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Remote_controller_of_Studer_A800_MKIII.jpg","page_title":"Studer","context_page_description":"Studer is a formerly Swiss designer and manufacturer of audio equipment for recording studios and broadcasters. The company was founded in Zürich, Switzerland, in 1948 by Willi Studer. It initially became known in the 1950s for its professional tape recorders. In the 1990s the company moved into the manufacture of mixing consoles.\\nManagement, sales, engineering, R&D and customer service were based in Regensdorf, Switzerland, until owners Harman International Industries closed down the Swiss entity in March 2018 transferring the now decentralised operation to China, Hungary, and the US. Manufacturing, marketing, and customer support were part of the Soundcraft facility in Potters Bar, England until Harman closed the Potters Bar facility in June 2016 and moved manufacturing and customer support to Hungary. Studer is currently a subsidiary of Harman International Industries which is owned by Samsung Electronics."},{"page_url":"https://en.wikipedia.org/wiki/Vyacheslav_Malyshev","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Malyshev_VA.jpg","page_title":"Vyacheslav Malyshev","context_page_description":"Viacheslav Aleksandrovich Malyshev was one of the leading figures of Soviet industry during the 1940s and 1950s. During the war, he served as People's Commissar of Heavy Machine Building since 1939 and Vice-Chairman of Council of People's Commissars since 1940. From 1941 he supervised Soviet tank industry, later he was responsible for shipbuilding and transport industry. He was elected Vice-Chairman of Council of Ministers of the Soviet Union twice, from 1947 to 1953 and again from 1954 to 1956. He was also appointed the first head of Ministry of Medium Machine Building, supervising the whole Soviet nuclear industry.\\nMalyshev led a special commission to investigate the causes of the explosion that sank the Novorossiysk battleship at anchor at Sevastopol, used as an excuse to remove Nikolai Kuznetsov, an opponent of Nikita Khrushchev's idea of a submarine-based navy, from commanding the Red Fleet and replace him with Sergey Gorshkov, who was much more obedient to the premier's wishes.\\nMalyshev was heavily favored by Joseph Stalin. In 1953 he prematurely inspected the site of a nuclear test and was poisoned by radiation; he died as a result in 1957."},{"page_url":"https://en.wikipedia.org/wiki/Opel_Astra","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Opel_Astra_J_Modellpflege_Front.jpg","page_title":"Opel Astra","context_page_description":"The Opel Astra is a compact car/small family car engineered and manufactured by the German automaker Opel since 1991, currently at its fifth generation.\\nIt is branded as the Vauxhall Astra in the United Kingdom and the Buick Excelle XT in China. The Holden Astra was discontinued in Australia and New Zealand in 2009, because exchange rates made importing Opel cars uncompetitive, and was replaced by the locally-assembled Holden Cruze. It briefly returned to the Australian market in 2012, for the first time badged as an Opel, but was discontinued after Opel withdrew from the country a year later. On 1 May 2014, Opel announced that the Astra GTC and Astra VXR would return to Australia and New Zealand in 2015, again bearing the Holden badge."},{"page_url":"https://eo.wikipedia.org/wiki/Baziliko_Sankta_Petro","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/InocencioXIb.jpg","page_title":"Baziliko Sankta Petro","context_page_description":"La baziliko de Sankta Petro kaj oficiale Papa baziliko de Sankta Petro, estas katolika baziliko en Vatikano. Ĝi estas en la ĉefpozicio de la tiea Placo de Sankta Petro kaj ties kupolo hegemonias la horizonton de Romo. Same ĝi estas konsiderata unu el la plej gravaj el la sanktaj lokoj de katolikismo.\\nLa konstruaĵo estas unu el la plej gravaj sanktejoj de kristanismo kaj ofte estas nomata \\"la plej granda kirko\\". Fakte la katolika estraro en la historio klopodis certigi, ke neniu konstruu pli grandan kirkon; ekzemple ĝi sukcese postulis malgrandigon de la ĉefkirko de Bolonjo. Sed de 1989 ekzistas pli granda katolika preĝejo pri kiu estas polemiko: nome en Jamusukro en Ebur-Bordo oni konstruis kaj konsekris la bazilikon \\"Nia Sinjorino de la Paco\\", kiu, laŭ ties propra informo, estas pli alta, larĝa kaj longa ol \\"Sankta Petro\\", sed tiuj mezuroj inkludas apudajn konstruaĵojn kaj la kupolalto krucon."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D1%98%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Wappen_Breuna.png","page_title":"Бројна","context_page_description":"Бројна општина је у њемачкој савезној држави Хесен. Једно је од 29 општинских средишта округа Касел. Према процјени из 2010. у општини је живјело 3.708 становника. Посједује регионалну шифру 6633004."},{"page_url":"https://es.wikipedia.org/wiki/Torre_de_la_Victoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Victory_tower.jpg","page_title":"Torre de la Victoria","context_page_description":"La Torre de la Victoria, conocida en hindi como Vijay Stambha es una gran torre localizada en el fuerte de Chittorgarh en el estado de Rajastán. Fue construida por el rey Rana Kumbha entre 1442 y 1449 para conmemorar su victoria sobre los ejércitos de Malwa y Gujarat comandados por Mahmud Khilji. Constituye el monumento más sobresaliente de dicho fuerte, estando clasificada como monumento protegido estatal.\\nDedicada a Visnú, la monumental torre de 37,19 metros se alza como una de las más destacadas en la India. Se edificó usando arenisca roja y mármol blanco, ornamentada con ricas galerías de esculturas representando divinidades hindúes con inscripciones en la base de cada una. Se cree que tardó diez años en ser erigida. Esta excepcional pieza arquitectónica se encuentra sobre un basamento de tres metros. Cada una de las nueve historias representadas escultóricamente está diferenciada de las demás mediande aberturas y balcones en cada cara de cada pasaje. La escalera interior gira desde la cámara central a las galerías adyacentes.\\nLa placa con la inscripción del último pasaje representado incluye la genealogía de los gobernadores de Chittaur desde Hamir a Rana Kumbha."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%87%E0%B4%B0%E0%B4%B3_%E0%B4%B8%E0%B5%8D%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%87%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%8D_%E0%B4%B1%E0%B5%8B%E0%B4%A1%E0%B5%8D_%E0%B4%9F%E0%B5%8D%E0%B4%B0%E0%B4%BE%E0%B5%BB%E0%B4%B8%E0%B5%8D%E0%B4%AA%E0%B5%8B%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%8D_%E0%B4%95%E0%B5%8B%E0%B5%BC%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B4%B1%E0%B5%87%E0%B4%B7%E0%B5%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/%E0%B4%95%E0%B5%87%E0%B4%B0%E0%B4%B3_%E0%B4%B8%E0%B5%8D%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%87%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%8D_%E0%B4%B1%E0%B5%8B%E0%B4%A1%E0%B5%8D_%E0%B4%9F%E0%B5%8D%E0%B4%B0%E0%B4%BE%E0%B5%BB%E0%B4%B8%E0%B5%8D%E0%B4%AA%E0%B5%8B%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%8D_%E0%B4%95%E0%B5%8B%E0%B5%BC%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B4%B1%E0%B5%87%E0%B4%B7%E0%B5%BB_11z_.jpg","page_title":"കേരള സ്റ്റേറ്റ് റോഡ് ട്രാൻസ്പോർട്ട് കോർപ്പറേഷൻ","context_page_description":"കേരള സർക്കാർ നടത്തുന്ന ബസ് കമ്പനി ആണ് കേരള സ്റ്റേറ്റ് റോഡ് ട്രാൻസ്പോർട്ട് കോർപ്പറേഷൻ. ആനവണ്ടി എന്ന ഇരട്ടപേരിൽ അറിയപെടുന്ന സംസ്ഥാന ഉടമസ്ഥതയിലുള്ള ഏറ്റവും പഴയ ബസ് കമ്പനികളിൽ ഒന്നാണ് പൊതു മേഖലാ സ്ഥാപനമായ കെ.എസ്.ആർ.ടി.സി."},{"page_url":"https://fr.wikipedia.org/wiki/Th%C3%A9odore_Schneider","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Th%C3%A9odore_Schneider.jpg","page_title":"Théodore Schneider","context_page_description":"Théodore Schneider, né en 1862, est un industriel français, à l'origine de la création de la firme Rochet-Schneider à Lyon avec Édouard Rochet puis de la firme Th. Schneider avec Louis Ravel et Antoine Jaubert à Besançon."},{"page_url":"https://es.wikipedia.org/wiki/Sumemos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Sentido_Futuro.png","page_title":"Sumemos","context_page_description":"Sumemos fue una coalición política chilena que agrupaba a tres partidos y un movimiento político de centro liberal. Fue presentada oficialmente el 13 de enero de 2016 en un acto realizado en el edificio del ex Congreso Nacional de Chile.​"},{"page_url":"https://en.wikipedia.org/wiki/Zhmerynka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%2805%29_WIKIMEDIA_NIGHT_VIEW_ON_RAILWAY_STATION_DISTRICT_IN_CITY_OF_ZHMERYNKA_STATE_OF_UKRAINE_PHOTOGRAPH_BY_VIKTOR_O_LEDENYOV_20160830.jpg","page_title":"Zhmerynka","context_page_description":"Zhmerynka is a city in Vinnytsia Oblast of central Ukraine. Serving as the administrative center of the Zhmerynka Raion, the town itself is not a part of the district and is separately incorporated as a city of oblast significance. Population: 35,284."},{"page_url":"https://id.wikipedia.org/wiki/Mars_2","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Mars3_lander2_vsm.jpg","page_title":"Mars 2","context_page_description":"Mars 2 adalah satelit yang diluncurkan oleh Uni Soviet ke Mars yang identik dengan Mars 3. Mars 2 merupakan benda buatan manusia pertama yang mendarat di Mars.\\nTanggal peluncuran:\\nMars 2: 19 Mei 1971\\nMassa peluncuran:\\nGabungan: 4650 kg\\nPengorbit: 3440 kg\\nPendarat: 1210 kg\\nDimensi: tinggi 4,1 m, lebar 2 m"},{"page_url":"https://es.wikipedia.org/wiki/Di%C3%A1cono","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/DeaconsingingExsultet2007.jpg","page_title":"Diácono","context_page_description":"Un diácono es considerado un servidor, un clérigo o un ministro eclesiástico, ​ cuyas calificaciones y funciones muestran variaciones según las distintas ramas del cristianismo. En las Iglesias católica apostólica romana, copta y ortodoxa se refiere así a aquel que ha recibido el grado inferior del sacramento del Orden Sagrado por la imposición de las manos del obispo, ​ y por lo tanto se le considera la imagen sacramental de Cristo servidor, en virtud de la Sagrada Escritura que especifica: «Porque el Hijo del Hombre no vino para ser servido, sino para servir, y para dar su vida en rescate por muchos»."},{"page_url":"https://en.wikipedia.org/wiki/Roads_(album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Christina_Aguilera_Sanremo.jpg","page_title":"Roads (album)","context_page_description":"Roads is the debut studio album by American recording artist Chris Mann, released on October 30, 2012, by Universal Republic. Mann participated in the season two of the singing reality show The Voice, ultimately placing fourth, but being the first of the second season to release an album. The album was produced by Keith Thomas, Marco Marinangeli, Marius de Vries, Walter Afanasieff and others.\\n\\"Roads\\" is a vocal pop, classical crossover and traditional pop album, with covers from Lady Antebellum, Damien Rice, Coldplay and Frank Sinatra, as well as new songs. It also features classic covers, such as \\"Always on My Mind\\" and \\"Ave Maria\\". The album also features vocals from his coach on The Voice, the American recording artist Christina Aguilera."},{"page_url":"https://ca.wikipedia.org/wiki/Impressi%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Metal_movable_type.jpg","page_title":"Impressió","context_page_description":"La impressió és l'acció i efecte de deixar una marca o empremta sobre alguna cosa. El suport de la impressió és habitualment el paper però també poden ser impresos altres materials com plàstics, teixits, etc. La impressió és l'art de reproduir sobre paper, pergamí, etc., la marca en tinta d'un escrit, un dibuix, etc., gravat sobre una planxa metàl·lica o compost ajuntant peces de metall o fusta cadascuna de les quals té gravada una lletra, una figura, etc.\\nAl llarg de la història hi ha hagut diferents sistemes d'impressió, alguns com la serigrafia o la litografia s'han anat adaptant a l'evolució de la tècnica i encara perduren, d'altres com la xilografia que havien estat àmpliament utilitzats han perdut vigència i avui només s'utilitza per a la reproducció d'obres d'art. Fins a l'aparició de la impressió digital tots els mètodes han tingut com a característica comuna la utilització d'una matriu que un cop entintada permetia transferir-la sobre el paper. Les tècniques d'impressió van evolucionar amb rapidesa, i aparegueren nous procediments que satisfeien noves necessitats o responien a noves possibilitats tècniques."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_de_Roggenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Roggenburg_Klosterkirche_Chorgest%C3%BChl_Nordseite_3._Sitz_2010_10_31.jpg","page_title":"Abbaye de Roggenburg","context_page_description":"L'abbaye de Roggenburg est une collégiale des Prémontrés, située à Roggenburg, dans l'arrondissement de Neu-Ulm en Bavière. Elle est gérée comme prieuré dépendant de l'abbaye de Windberg, dans le sud de la Bavière.\\nLe monastère dispose d'un centre de formation et d'un musée. Il est connu pour ses bâtiments baroques conservés pratiquement sans modification, et par les concerts d'orgue qui ont lieu dans son église."},{"page_url":"https://en.wikipedia.org/wiki/Seapoint","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Seapoint_Monkstown_Panorama1.jpg","page_title":"Seapoint","context_page_description":"Seapoint is a small seafront area between Blackrock and Monkstown in Dublin in the Dún Laoghaire–Rathdown area. It is best known for its beach and bathing areas, beside a Martello Tower on the Dublin Bay seashore. The beach currently has an International Blue flag award and a national Green flag award.\\nThe Martello Tower is now the headquarters of the Genealogical Society of Ireland.\\nThe route linking Dún Laoghaire harbour to the N11 National primary route has itself been designated a National primary route, the N31. Part of the route includes Seapoint Avenue, and the Seapoint area is located on the strip of land, which includes the railway line, between the road and the sea."},{"page_url":"https://ca.wikipedia.org/wiki/Castell_de_Cervell%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Castell_de_Cervell%C3%B3_-_4.jpg","page_title":"Castell de Cervelló","context_page_description":"El Castell de Cervelló és una obra del municipi de Cervelló declarada bé cultural d'interès nacional. Aquest castell es troba una mica apartat del nucli antic del poble de Cervelló, al sud. Actualment està en ruïna i els seus murs amagats entre la vegetació que l'envolta. Situat en una posició elevada, defensada naturalment, sobre l'església de Santa Maria de Cervelló."},{"page_url":"https://en.wikipedia.org/wiki/Milne-Edwards%27_sportive_lemur","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Lepilemur_edwardsi.jpg","page_title":"Milne-Edwards' sportive lemur","context_page_description":"Milne-Edwards' sportive lemur, or Milne-Edwards' weasel lemur, is a species of lemur in the family Lepilemuridae. It is endemic to Madagascar. Its natural habitat is subtropical or tropical dry forests. It is threatened by habitat loss.\\nAn enormous problem for these animals is the limited resource of safe sleeping sites. These are essential for their survival since they provide shelter from predators and weather conditions."},{"page_url":"https://es.wikipedia.org/wiki/W%C3%B6lmersen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/DEU_W%C3%B6lmersen_COA.svg","page_title":"Wölmersen","context_page_description":"Wölmersen es un municipio situado en el distrito de Altenkirchen, en el estado federado de Renania Palatinado. Su población estimada a finales de 2016 era de 390 habitantes.​\\nSe encuentra ubicado al noreste del estado, cerca de la frontera con el estado de Renania del Norte-Westfalia y de la orilla del río Sieg, un afluente por la derecha del Rin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D0%B5%D1%86-%D0%9F%D0%BE%D0%B4%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_%28%D0%9A%D0%B0%D0%BC%27%D1%8F%D0%BD%D0%B5%D1%86%D1%8C-%D0%9F%D0%BE%D0%B4%D1%96%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B8%D0%B9%29.jpg","page_title":"Каменец-Подольский","context_page_description":"Кáменец-Подо́льский — город в Хмельницкой области Украины, административный центр Каменец-Подольского района, один из главных центров исторического региона Подолье.\\nИсторически главная административно-территориальная единица Западного Подолья, с 22 марта 1919 по ноябрь 1920 — столица УНР, бывший областной центр. Значительный экономический, образовательный, культурный и туристический центр, один из древнейших городов современной Украины."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%9A%E0%AE%A9%E0%AF%8D_%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AF%87%E0%AE%95%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Prison_Break_Cast.jpg","page_title":"பிரிசன் பிரேக்","context_page_description":"பிரிசன் பிரேக் என்பது, பால் ஸ்கெரிங் உருவாக்கி 2005, ஆகஸ்டு 29 அன்று ஃபாக்ஸ் ஒளிபரப்பு நிறுவனத்தில் முதலில் ஒளிபரப்பப்பட்ட நாடக தொலைக்காட்சித் தொடராகும். இந்தத் தொடர் இரண்டு சகோதரர்களை மையமாகக் கொண்டு அமைந்தது. அதில் ஒருவர் தான் செய்யாத குற்றத்திற்காக மரண தண்டனை விதிக்கப்பட்டவர், மற்றொருவர் தனது சகோதரன் சிறையிலிருந்து தப்பிக்க உதவியாக பெரிய திட்டத்தை வகுப்பவர். இந்தத் தொடர், ஒரிஜினல் டெலிவிஷன் மற்றும் 20த் சென்ச்சுரி ஃபாக்ஸ் டெலிவிஷன் ஆகியவற்றுடன் இணைந்து அடெல்ஸ்டெயின்-பெரோஸ் தயாரிப்பு நிறுவனத்தால் உருவாக்கப்பட்டது. தலைமை எழுத்தாளர் ஸ்கெரிங், இணை தலைமை எழுத்தாளர் மேட் ஆம்ஸ்டெட், கெவின் ஹூக்ஸ், மார்ட்டி அடெல்ஸ்டெயின், டான் பெரோஸ், நீல் எச். மோரிட்ஸ் மற்றும் ப்ரெட் ரேட்னெர் ஆகியோர் அதன் தற்போதைய செயல் தயாரிப்பாளர்களாவர். தொடரின் தீம் மியூஸிக்கை ரமீன் டஜ்வாடி உருவாக்கினார், அது 2006 ஆம் ஆண்டு பிரைம்டைம் எம்மி விருதுக்குப் பரிந்துரைக்கப்பட்டது.\\n2003 ஆம் ஆண்டு ஃபாக்ஸ் நிறுவனம் இது போன்ற தொடர்களின் நீண்டகால தொலைநோக்கைக் கருத்தில் கொண்டு அந்தத் தொடரை முதலில் நிராகரித்தது. தொடர்ந்து ஒளிபரப்பப்பட்ட அதிக பார்வையாளர் நேர தொடர்களான லாஸ்ட் மற்றும் 24 போன்ற தொடர்கள் பிரபலடைந்ததன் பின்னர், ஃபாக்ஸ் நிறுவனம் 2004 ஆம் ஆண்டில் மீண்டும் அதனைத் தயாரிக்க ஒப்புக்கொண்டது."},{"page_url":"https://sk.wikipedia.org/wiki/6._m%C3%A1j","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Dominika_Cibulkova_%2813048439214%29.jpg","page_title":"6. máj","context_page_description":"6. máj je 126. deň roka v gregoriánskom kalendári. Do konca roka zostáva 239 dní. Meniny má Hermína.\\nSvetový deň smiechu"},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Pierre_de_Beauvais","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/2018-02-20_14-56-28_Cath%C3%A9drale-Saint-Pierre-Beauvais.jpg","page_title":"Cathédrale Saint-Pierre de Beauvais","context_page_description":"La cathédrale Saint-Pierre de Beauvais est une église catholique située à Beauvais, dans le département français de l'Oise en région Hauts-de-France. Elle est la cathédrale du diocèse de Beauvais.\\nSa construction est contemporaine de celle des cathédrales de Chartres, de Reims, de Bourges et d'Amiens...\\nElle possède le plus haut chœur gothique au monde sous voûte. De 1569 à 1573 la cathédrale de Beauvais fut avec sa tour de 153 mètres la plus haute construction humaine du monde. Ses concepteurs avaient l'ambition d'en faire la plus grande cathédrale gothique de France devant celle d'Amiens. Victime de deux écroulements, l'un au XIIIᵉ siècle, l'autre au XVIᵉ siècle, elle reste aujourd'hui inachevée, seuls le chœur et le transept ont été construits.\\nElle est affiliée à la paroisse Saint-Pierre-Saint-Paul en Beauvaisis de Beauvais-Centre."},{"page_url":"https://pt.wikipedia.org/wiki/Kadov_(Vyso%C4%8Dina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kadov_%C4%8Dp._25.jpg","page_title":"Kadov (Vysočina)","context_page_description":"Kadov é uma comuna checa localizada na região de Vysočina, distrito de Žďár nad Sázavou."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%A9%DB%8C%D9%86%DB%8C%DA%88%D8%A7_%DA%A9%DB%92_%D9%BE%D8%B3%D8%AA%D8%A7%D9%86%DB%8C%DB%92_%D8%AC%D8%A7%D9%86%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Castor_canadensis.jpg","page_title":"کینیڈا کے پستانیے جانور","context_page_description":"کینیڈا کے پستانیہ جانوروں کی فہرست ذیل میں کینیڈا کے ممالیہ جانوروں کی فہرست دی گئی ہے۔ کینیڈا میں کل 200 کے لگ بھگ ممالیہ جانور موجود ہیں۔ اپنے وسیع و عریض رقبے اور بے شمار ایکو سسٹموں جن میں پہاڑوں سے لے کر شہری آبادیاں بھی شامل ہیں، کی وجہ سے کینیڈا میں بے شمار جانور ایسے موجود ہیں جو کہیں ایک جگہ اور نہیں ملتے۔ ان میں معلوم بڑی سمندری حیات کی تقریباًً نصف تعداد شامل ہے۔ ان میں سب سے زیادہ تعداد میں کترنے والے جانور اور کم تعداد میں اپوسم موجود ہیں۔ کینیڈا میں ممالیہ جانوروں کے مشاہدے کا آغاز 1795 میں ہوا جب سموئل ہارن نے اس کام کا بیڑا اٹھایا۔ سموئل ہارن شمالی مہموں کا ذمہ دار تھا۔ اس کے مشاہدے کو تقریباًً درست مانا جاتا ہے۔ پہلا باقاعدہ کام جو کینیڈا کے ممالیہ جانوروں پر ہوا، جان رچرڈسن نے 1829 میں شروع کیا۔ جوزف بر ٹیرل نے 1888 میں پہلی بار کینیڈا کے ممالیہ جانوروں کی باقاعدہ گروہ بندی کی۔ ارنسٹ تھامپسن سٹن اور چارلس یوزبے ڈیون کا کام بھی کافی اہمیت رکھتا ہے۔\\nممالیہ کی کئی نسلیں اپنی الگ اہمیت رکھتی ہیں۔ کینیڈا کا گھوڑا اور اود بلاؤ کینیڈا کے سرکاری نشانات ہیں۔ دیگر صوبوں کے اپنے نشانات ہیں۔"},{"page_url":"https://en.wikipedia.org/wiki/Left-libertarianism","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Emma_Goldman_seated.jpg","page_title":"Left-libertarianism","context_page_description":"Left-libertarianism, also known as egalitarian libertarianism, left-wing libertarianism or social libertarianism, is a political philosophy and type of libertarianism that stresses both individual freedom and social equality. Left-libertarianism represents several related yet distinct approaches to political and social theory. In its classical usage, it refers to anti-authoritarian varieties of left-wing politics such as anarchism, especially social anarchism, whose adherents simply call it libertarianism. In the United States, it represents the left-wing of the libertarian movement and the political positions associated with academic philosophers Hillel Steiner, Philippe Van Parijs and Peter Vallentyne that combine self-ownership with an egalitarian approach to natural resources. This is done to distinguish libertarian views on the nature of property and capital, usually along left–right or socialist–capitalist lines.\\nWhile maintaining full respect for personal property, left-libertarians are opposed to capitalism and the private ownership of the means of production."},{"page_url":"https://fi.wikipedia.org/wiki/Amnisos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/%CE%88%CF%80%CE%B1%CF%85%CE%BB%CE%B7_%CF%84%CF%89%CE%BD_%CE%9A%CF%81%CE%AF%CE%BD%CF%89%CE%BD_-_%CE%91%CE%BC%CE%BD%CE%B9%CF%83%CF%8C%CF%82_3273.jpg","page_title":"Amnisos","context_page_description":"Amnisos oli minolaisaikainen ja antiikin aikainen kaupunki Kreetan saarella Kreikassa. Sen arkeologinen kohde sijaitsee Iraklionin kunnassa Karteróksen kylässä lähellä saaren pohjoisrannikkoa, noin seitsemän kilometriä Iraklionin kaupungista itään.\\nAmnisos oli yksi Knossoksen satamakaupungeista. Nimi ”Amnisos” palautuu ilmeisesti paikan alkuperäiseen nimeen ja esiintyy mykeneläisaikaisissa lineaari-B-kirjoituksissa muodossa a-mi-ni-so. Nykyisin paikka tunnetaan myös nimellä Palaióchora.\\nAmnisoksen alueelta on löydetty minolaisaikainen ”huvila”, joka tunnetaan nimellä ”Liljojen talo” sieltä löytyneiden lilja-aiheisten seinämaalausten mukaan. Huvila rakennettiin mahdollisesti uuden palatsikauden alkupuolella, joskin myös uuden palatsikauden loppupuolta on ehdotettu. Huvila tuhoutui maanjäristyksessä ja rakennettiin uudelleen vaatimattomampana. Lopullisesti se tuhoutui tulipalossa 1400-luvulla eaa., jälleen mahdollisesti maanjäristyksen seurauksena.\\nRakennuksen koko oli 20 x 20 metriä. Se oli kaksikerroksinen ja siinä oli lukuisia erikokoisia huoneita, joissa osassa oli polythyron-seinät, ja mahdollisesti valokuilu."},{"page_url":"https://es.wikipedia.org/wiki/Pancho_Fierro","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Los_acheros.jpg","page_title":"Pancho Fierro","context_page_description":"Francisco \\"Pancho\\" Fierro Palas, fue un pintor peruano, que mediante sus afamadas acuarelas, reflejó la vida y costumbres de Lima en el siglo XIX."},{"page_url":"https://ceb.wikipedia.org/wiki/Eutropiichthys_murius","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Pseudotropius_murius_Mintern_108.jpg","page_title":"Eutropiichthys murius","context_page_description":"Espesye sa isda nga una nga gihulagway ni Hamilton ni adtong 1822 ang Eutropiichthys murius. Ang Eutropiichthys murius sakop sa kahenera nga Eutropiichthys sa kabanay nga Schilbeidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://pl.wikipedia.org/wiki/Mount_Waddington_(dystrykt_regionalny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Regional_District_of_Mount_Waddington%2C_British_Columbia_Location.png","page_title":"Mount Waddington (dystrykt regionalny)","context_page_description":"Mount Waddington – dystrykt regionalny w kanadyjskiej prowincji Kolumbia Brytyjska. Siedziba władz znajduje się w Port McNeill.\\nMount Waddington ma 11 506 mieszkańców. Język angielski jest językiem ojczystym dla 90,8%, francuski dla 1,3% mieszkańców."},{"page_url":"https://la.wikipedia.org/wiki/B%C3%A9h%C3%A9ricourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Ch%C3%A2teau_de_B%C3%A9h%C3%A9ricourt.jpg","page_title":"Béhéricourt","context_page_description":"Béhéricourt est commune Francicum 215 incolarum praefecturae Esiae in regione Picardia."},{"page_url":"https://it.wikipedia.org/wiki/Kathrin_W%C3%B6rle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Kathrin_W%C3%B6rle-Scheller_11.jpg","page_title":"Kathrin Wörle","context_page_description":"Kathrin Wörle-Scheller è un'ex tennista tedesca."},{"page_url":"https://it.wikipedia.org/wiki/Nathalis_iole","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Dainty_Sulphur%2C_Megan_McCarty59.jpg","page_title":"Nathalis iole","context_page_description":"Nathalis iole, è un lepidottero appartenente alla famiglia Pieridae, diffuso in America settentrionale e centrale."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Karstquellen_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Erdbachquelle.JPG","page_title":"Liste von Karstquellen in Deutschland","context_page_description":"Dies ist eine Liste von Karstquellen in Deutschland. Sie enthält eine Auswahl von Karstquellen in Deutschland."},{"page_url":"https://it.wikipedia.org/wiki/Austin_Community_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/AustinCommunityCollegeHeadquarters.JPG","page_title":"Austin Community College","context_page_description":"Austin Community College è un college regionale con sette campus localizzati in diverse aree intorno alla città di Austin, in Texas."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_der_Stadt_Lwiw","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Ludwig_Czech_detail_of_plaque_in_Terezin_674.jpg","page_title":"Liste von Persönlichkeiten der Stadt Lwiw","context_page_description":"Die folgende Liste enthält in Lwiw geborene sowie zeitweise hier lebende Persönlichkeiten, chronologisch aufgelistet nach dem Geburtsjahr. Die Liste erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://fr.wikipedia.org/wiki/William_George_Armstrong","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sir_William_George_Armstrong.jpg","page_title":"William George Armstrong","context_page_description":"William George Armstrong, industriel britannique du bassin de la Tyne, est le fondateur du trust industriel Armstrong-Whitworth, l’une des plus puissantes compagnies industrielles du XIXᵉ siècle. Il fut anobli « 1ᵉʳ baron Armstrong » par la reine Victoria en 1859 en hommage à son patriotisme au cours de la Guerre de Crimée."},{"page_url":"https://ro.wikipedia.org/wiki/Raionul_Cetatea_Alb%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/BilgorodDnistrovskyi-Raion.png","page_title":"Raionul Cetatea Albă","context_page_description":"Cetatea Albă este un raion în regiunea Odesa, Ucraina. Reședința sa este orașul Bilhorod-Dnistrovskîi. Celelalte 2 orașe din raion sunt Bugaz și Serghiești.\\nMinoritatea românească constituie 6% din populația raionului, locuind în centrul raional și în următoarele sate: Moldova, Tăriceanca-Nouă, Gura-Roșie și Han-Câșla.\\nPrimele două localități sunt singurele din raion cu majoritate românească."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%82%AC%ED%95%98%EC%9A%B0%EB%81%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Red%2C_Green_and_Smoked_Skhug.jpg","page_title":"사하우끄","context_page_description":"사하우끄는 예멘의 고추 페이스트이다. 예멘 유대인을 통해 이스라엘에 전해져 이스라엘에서도 즐겨 먹으며, 스후크라 불린다. 아라비아만 지역에서는 닥꾸스라 불린다."},{"page_url":"https://fr.wikipedia.org/wiki/Politique_dans_le_canton_de_Fribourg","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/H%C3%B4tel_de_ville.JPG","page_title":"Politique dans le canton de Fribourg","context_page_description":"Le canton de Fribourg est l'un des vingt-six cantons de la Confédération suisse. Selon l'article 3 de la Constitution fédérale, il exerce souverainement « tous les droits qui ne sont pas délégués à la Confédération ». Il dispose de sa propre constitution et est libre de sa propre organisation tant qu'il ne contrevient pas aux règles de la démocratie. Il envoie également ses représentants au niveau fédéral."},{"page_url":"https://cs.wikipedia.org/wiki/Curculionoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Weevil_bangalore.jpg","page_title":"Curculionoidea","context_page_description":"Curculionoidea jsou nadčeleď brouků označovaných všeobecně jako nosatci. Obvykle to jsou brouci menší než 6 mm a obecné jméno si vysloužili vzhledem ke tvaru jejich hlavy, protažené do dlouhého nosce.\\nJe známo přes 60 000 druhů v několika čeledích, jednou z nich jsou Curculionidae.\\nMnoho nosatců škodí na různých plodinách. Brouk pilous černý poškozuje obilniny, škůdce na bavlníku nosatec Anthonomus grandis poškozuje bavlníkové tobolky tím, že klade vajíčka do nevyzrálých tobolek a larvy brouka pak tobolku zničí.\\nNosatci jsou často nalézáni v suchých plodech jako jsou ořechy a semena, cereálie a obilné produkty. V domácích podmínkách mohou být zpozorováni v mouce, kterou často úspěšně zamořují. Napadají též ovesné vločky, kroupy, krupici a mnohé další obilné produkty, do kterých mohou zanést bakterie, např. E. coli, které mohou způsobovat různé nemoci."},{"page_url":"https://de.wikipedia.org/wiki/Stadtbefestigung_Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Beginenturm_vor_r%C3%BCck.jpg","page_title":"Stadtbefestigung Hannover","context_page_description":"Die Stadtbefestigung Hannover war ein System von Verteidigungsanlagen der Stadt Hannover in der Zeit von etwa 1200 bis 1800. Die im Mittelalter entstandene Stadtbefestigung umschloss die damalige Stadt, die heutige Altstadt. Zu ihr gehörte eine um 1300 entstandene Stadtmauer mit Mauer- und Tortürmen sowie Stadttoren, wovon kaum noch Reste vorhanden sind. Von der im Vorfeld der Stadt gelegenen Hannoverschen Landwehr zeugen noch Gräben, Wälle und Warttürme. Die nahezu höchste Ausbaustufe der Stadtbefestigung war Anfang des 17. Jahrhunderts als Bastionärsbefestigung nach niederländischem Vorbild erreicht. 1646 wurde die Calenberger Neustadt als vorgelagerter, neuer Stadtteil in die sternschanzenförmige Anlage einbezogen. Im Siebenjährigen Krieg bis 1763 nochmals reaktiviert, begann unmittelbar danach die Schleifung der Befestigungsanlagen in Ermangelung eines militärischen Wertes und zur Raumgewinnung für neue stadtplanerische Vorhaben."},{"page_url":"https://eu.wikipedia.org/wiki/Ahatsa-Altzieta-Bazkazane","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Bascassan.jpg","page_title":"Ahatsa-Altzieta-Bazkazane","context_page_description":"Ahatsa-Altzieta-Bazkazane Nafarroa Behereko udalerria da. 2006an, 298 biztanle zituen eta Donibane Garaziko Kantonamenduan dago kokaturik. Ahatsa da udalerriko auzoburua."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%AA%DB%86%D9%85_%DA%A9%D8%B1%D9%88%D9%88%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Jack_Reacher-_Never_Go_Back_Japan_Premiere_Red_Carpet-_Tom_Cruise_%2835338493152%29_%28cropped%29.jpg","page_title":"تۆم کرووز","context_page_description":"تۆماس کروز ماپۆتەر ناسراو بە تۆم کروز بەرھەمھێنەری فیلم و ئەکتەرە و ھەڵگری خەڵاتی ئۆسکارە وە سێجاریش خەڵاتی گۆڵدن گلۆبی بەدەست ھێناوە. بەپێی ڕاپۆرتەکانی ٢٠٢٠، سەرمایەی تۆم ٥٧٠ میلیۆن دۆلارە، ھەروەھا ئەو یەکێکە لە گرانترین ئەکتەرانی جیھان. کۆی فیلمەکانی تا ئێستا توانیویانە زیاتر لە ٤ میلیارد دۆلار لە باکووری ئەمریکا کۆبکەنەوە، ھەروەھا زیاتر لە ١٠٫١ میلیارد دۆلاریش لە جیھان، ئەمەش وایکردووە کە ناوبراو ببێتە یەکێک لە ئەستێرە ھەرە سەرکەوتووەکانی بۆکس ئۆفیس لە مێژوودا.\\nتۆم کروز لەتەمەنی ١٩ ساڵییەوە دەستی بەکاری نواندن کردووە واتە لە ساڵی ١٩٨١، فیلمی یەکەم فیلم بووە کە تۆم کروز ڕۆڵی سەرەکی بینیوە. لە ساڵی ١٩٨٣، بەفیلمی ھەروەھا بە فیلمی لە ساڵی ١٩٨٦ ناوبانگی دەرکرد. دوای ئەو فیلمانەش ئەوا تۆم لە چەند فیلمێک دەرکەوت کە توانی ستایشی ڕەخنەگران بەدەستبھێنێت ئەویش لە فیلمەکانی لە ١٩٨٦، لە ١٩٨٨ ھەروەھا بە فیلمی لە ١٩٨٩. بە ڕۆڵگێرانی کەسایەتی ڕۆن کۆڤیچ لە فیلمی، خەڵاتی باشترین ئەکتەری گۆڵدن گلۆب بباتەوە ھەروەھا بووە پاڵێوراوی خەڵاتی ئۆسکار بۆ باشترین ئەکتەر."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%98%D1%80%D0%B8%D1%81_%D0%AE%D1%85%D0%B0%D0%BD%D1%81%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Iris_Johansson.jpg","page_title":"Ирис Юханссон","context_page_description":"Ирис Юханссон — швед яҙыусыһы, психолог, аутизм проблемаларын өйрәнеүсе, аралашыу проблемалары буйынса белгес. Үҙе лә аутист булған, бала саҡтағы кисерештәрен һәм хәтирәләрен «Үҙенә бер төрлө бала саҡ» китабында бәйән иткән."},{"page_url":"https://eo.wikipedia.org/wiki/Aerbazo_McChord","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Mcchord_Air_Force_Base.jpg","page_title":"Aerbazo McChord","context_page_description":"La aerbazo McChord estas aerbazo de la United States Air Force. Ĝi troviĝas sur la teritorio de la kantono Pierce, en la ŝtato Vaŝingtonio, iom sude de Seattle.\\nĜi estas la sidejo de la Western Air Defense Sector kaj cetere gastigas la eskadronojn: 62nd Airlift Wing kaj 446th Airlift Wing.\\nEkde la 1-a de februaro, 2010, aerbazo McChord kunfandiĝis kun la armea Fuorto Lewis por konsistigi Komunan Bazon Lewis-McChord."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%DB%8C%DA%98%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Eglise_Place_Saint_Michel_Dijon.JPG","page_title":"دیژون","context_page_description":"دیژون مرکز دپارتمان کوت دور واقع در ایالت بورگوین فرانسه است. این شهر به خطوط راه آهن فرانسه متصل شده است و جز شهرهای بزرگ فرانسه است. این شهر در شرق کشور فرانسه قرار دارد."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_Saint-Louis_de_La_Nouvelle-Orl%C3%A9ans","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/StLouis2FloodDukWinHenderson.jpg","page_title":"Cimetière Saint-Louis de La Nouvelle-Orléans","context_page_description":"Le cimetière Saint-Louis de La Nouvelle-Orléans est le plus ancien cimetière de la ville de La Nouvelle-Orléans. Il fut ouvert en 1789 à l'époque de la Louisiane française. Il se compose de trois parties distinctes situées au nord du Vieux carré, le quartier français historique de La Nouvelle-Orléans. Ces trois emplacements sont proches les uns des autres et correspondant au développement de la ville et à l'extension devenue nécessaire du cimetière Saint-Louis."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%BE%D8%A7%D8%AF%D8%B4%D8%A7%D9%87%D8%A7%D9%86_%D8%A7%D8%B3%DA%A9%D8%A7%D8%AA%D9%84%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Macbeth_of_Scotland_%28Holyrood%29.jpg","page_title":"فهرست پادشاهان اسکاتلند","context_page_description":"پادشاهی در اسکاتلند برای اولین توسط کنت مک‌آلپین در سال ۸۴۳ میلادی پایه‌گذاری شد و تا سال ۱۷۰۷ میلادی که مصوبه‌های ۱۷۰۷ اتحاد انگلستان و اسکاتلند امضا شد ادامه یافت."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%88%D8%B1%D8%A7%D9%83%D8%A7%D9%86_(%D8%A2%D8%B1%D8%A7%D8%BA%D8%A7%D8%AA%D8%B3%D9%88%D8%AA%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Artavazik_Church_Front2.JPG","page_title":"بيوراكان (آراغاتسوتن)","context_page_description":"مدينة بيوراكان هي إحدى المدن التابعة لمقاطعة آراغاتسوتن في أرمينيا. يقدر عدد سكانها بـ 4996 نسمة حسب الإحصاء الذي جرى عام 2011."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%9A%E4%BD%99%E6%97%A0%E7%BA%BF%E7%94%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/ICOM_IC-P7_dscn2510a.jpg","page_title":"业余无线电","context_page_description":"業餘無線電，也被稱作火腿電台是一種供業餘無線電愛好者進行相互通訊、無線通訊技術實驗、自我訓練、個人娛樂、無線電運動、競賽以及應急通訊的一項使用無線電頻率頻譜的無線電業務。其中「業餘無線電愛好者」指「經正式批准的、對無線電技術有興趣的人，其興趣純系個人愛好而不涉及謀取利潤」。業餘無線電與商業廣播、安全業務無線電或者其他專業雙向無線電業務存在區別，業餘無線電並非這些專業無線電業務的業餘形式，也不是有關這些業務的業餘愛好，而是一項獨立的無線電業務。\\n業餘無線電業務由國際電信聯盟通過《無線電規則》設立。在國家層面上，政府對業餘無線電業務進行管理，並為每一個獨立的業餘電台指配呼號 。「准」業餘無線電愛好者將接受考試，以檢測其對無線電技術和所在國無線電法規的掌握。\\n業餘無線電愛好者使用語音、文字、圖像和數據等形式，藉助無線電波，跨越城市、國家和大洲的距離相互通訊，甚至與太空站和衛星建立通訊鏈路。\\n在國際上，業餘無線電業務由國際業餘無線電聯盟代表和協調，國際業餘無線電聯盟由全國性業餘無線電協會組成。\\n根據2011年美國無線電中繼聯盟的統計，全球共有約200萬人參與業餘無線電活動。其中約有83萬業餘業務電台位於IARU區域2，約75萬位於IARU區域3，約40萬位於IARU區域1。"},{"page_url":"https://fr.wikipedia.org/wiki/Vall%C3%A9e_de_Ba%C3%AFgorry","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/SphagnumFallax.jpg","page_title":"Vallée de Baïgorry","context_page_description":"La vallée de Baïgorry est une vallée des Pyrénées où coule la Nive des Aldudes, un affluent de la Nive.\\nIsolée des grandes voies de communication, la vallée de Baïgorry a gardé un caractère vierge et elle est renommée pour la beauté de ses paysages et la qualité de ses productions gastronomiques. Elle bénéficie d'un micro-climat agréable qui favorise des éco-systèmes remarquables."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B2%AD%EA%B5%90%EB%8F%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Clevelandart_1959.38.jpg","page_title":"청교도","context_page_description":"청교도는 서방교회의 '교황중심주의'의 핵심인 '제도중심주의'로부터 영국국교회의 순결과 '복음중심주의'를 추구하며 16세기에서 17세기에 활동한 개신교도들이다. 당시 영국국교회는 왕권 하에서 형성되며 개신교의 정신을 강조한 '복음중심주의자'들이 거부하던 서방교회의 '제도중심주의'를 받아들여, 부분적인 종교개혁 사상과 교회제도를 주장하였다. 또한 원형적이고 전통적인 복음주의, 종교개혁의 '복음중심주의'를 지향했던 기독교인들을 통칭한다. 이들은 개신교 교인들로서 전통적 복음주의 안에서 루터주의 계열과 칼뱅주의 계열과 잉글랜드 성공회에 소속된 이들과 전통 복음주의를 추구했지만, 계열을 추구하지 않던 이들을 포함한 다양한 전통 복음주의자들을 통칭해 일컫는 말이며, 이런 신앙에 있던 사람들을 청교도라고 한다. 청교도란 말은 그들이 부르는 이름이 아니라, 지나치게 극단적인 교리적 완벽함을 추구한다는 비아냥에서 비롯되었다. 청교도들은 영국 종교 개혁이 제도주의가 남은 불완전한 개혁이었다고 평가하여, 영국 성공회의 정부 중심의 성향과 서방교회의 제도중심주의 잔재를 철폐하고자 하였다. 이들은 도덕적인 순수성을 추구하여 낭비와 사치를 배격하고, 근면을 강조하였으므로 영국의 중산층을 형성하였다. 또한 신학적으로는 인위적 권위와 전통을 인정하지 않고, 성경에 철저하고자 한 전통 복음주의인 성서주의적인 입장을 갖고 있었다. 영국교회가 핍박을 하자 미국으로 건너와서 청교도의 부흥을 이루었다. 부흥이후 마녀사냥이라는 불명예를 얻어 주홍글씨에 나오는 이미지는 그다지 좋지 않았다."},{"page_url":"https://de.wikipedia.org/wiki/Wickrath","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/M%C3%B6nchengladbach-Wickrath_Denkmal-Nr._H_007%2C_Hochstadenstra%C3%9Fe_134_%285786%29.jpg","page_title":"Wickrath","context_page_description":"Wickrath ist Teil des Stadtbezirks West von Mönchengladbach und war bis zur Gebietsreform eine eigenständige Gemeinde im Kreis Grevenbroich. Am 1. Januar 1975 wurde sie im Zuge der Verschmelzung von Mönchengladbach mit Rheydt eingemeindet."},{"page_url":"https://en.wikipedia.org/wiki/Macchia_(Montecorvino_Rovella)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Macchia_%28Montecorvino%29_-_Via_Fratelli_Rosselli.jpg","page_title":"Macchia (Montecorvino Rovella)","context_page_description":"Macchia is an Italian village and hamlet of the municipality of Montecorvino Rovella in the Province of Salerno, Campania. With a population of 1,933, is the largest frazione of Montecorvino."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D0%B5%D0%B2%D0%B5%D1%86%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Konevets_Horse_stone_Chapel.JPG","page_title":"Коневець","context_page_description":"Коневе́ць — невеликий острів на Ладозькому озері. Входить до Приозерського району Ленінградської області Росії. Завдяки відносній віддаленості цього місця, відокремленості монастирського життя та закритості острова як військового об'єкта тут збереглась багатогранна та цілісна природа. Тому він є одним із улюблених місць відпочинку туристів та місцем паломників."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A6%AC%EC%B9%B4%EB%A5%B4%EB%8F%84_%EC%B9%B4%EC%B4%90%EB%9D%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/RiccardoCazzola.JPG","page_title":"리카르도 카촐라","context_page_description":"리카르도 카촐라는 이탈리아의 축구 선수이다. 현재는 세리에 A의 클럽 아탈란타 BC에서 뛰고 있다."},{"page_url":"https://cy.wikipedia.org/wiki/Aiken_County,_De_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Seal_of_Aiken_County%2C_South_Carolina.png","page_title":"Aiken County, De Carolina","context_page_description":"Sir yn nhalaith De Carolina, Unol Daleithiau America yw Aiken County. Cafodd ei henwi ar ôl William Aiken. Sefydlwyd Aiken County, De Carolina ym 1871 a sedd weinyddol y sir yw Aiken, De Carolina.\\nMae ganddi arwynebedd o 2,798 cilometr sgwâr. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 0.9%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 164,176. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Saluda County, Barnwell County, Lexington County, Orangeburg County, Burke County, Richmond County, Edgefield County. Cedwir rhestr swyddogol o henebion ac adeiladau cofrestredig y sir yn: National Register of Historic Places listings in Aiken County, South Carolina."},{"page_url":"https://nl.wikipedia.org/wiki/Museumkever_(Anthrenus_verbasci)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Anthrenus_verbasci_-_larva_side_%28aka%29.jpg","page_title":"Museumkever (Anthrenus verbasci)","context_page_description":"De museumkever of tapijtkever (Anthrenus verbasci) is een kleine tot zeer kleine kever. De dekschilden zijn met grijze, gele en bruine vlekken bedekt. De kever wordt zo'n vijf millimeter lang. De larven zijn wat groter en kunnen twaalf millimeter lang worden.\\nDe museumkever moet worden onderscheiden van de pelskever Attagenus pellio."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_m%C3%A9moriaux_et_cimeti%C3%A8res_militaires_de_la_Somme","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Pont-Noyelles%2C_colonne_Faidherbe_2.jpg","page_title":"Liste des mémoriaux et cimetières militaires de la Somme","context_page_description":"La liste des mémoriaux et cimetières militaires du département de la Somme répertorie les cimetières militaires, les mémoriaux ainsi que les stèles, plaques commémoratives et autres monuments qui honorent la mémoire des morts aux combats, des victimes de bombardements ou d’exactions de l'ennemi ainsi que celle de personnels de santé, de chefs militaires ou politiques pendant :\\nLa Guerre de Cent Ans ;\\nLes guerres napoléoniennes ;\\nla Guerre franco-allemande de 1870 ;\\nla Première Guerre mondiale ;\\nla Seconde Guerre mondiale ;\\nles guerres coloniales.\\nLes lieux sont classés par conflit, par nationalité, par arrondissement et par commune."},{"page_url":"https://fr.wikipedia.org/wiki/Beau_(ruisseau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Chillac1.7.JPG","page_title":"Beau (ruisseau)","context_page_description":"Le Beau est un ruisseau du sud-ouest de la France et un affluent du Né, c'est-à-dire un sous-affluent de la Charente. Il arrose le département de la Charente."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%8A%D9%83%D8%B3%D8%A7%D9%86%D8%AF%D8%B1%D9%88_%D9%83%D9%8A%D8%B1%D8%AA%D9%8A%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/AUT_vs._MDA_2015-09-05_%28136%29.jpg","page_title":"اليكساندرو كيرتيان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاليكساندرو كيرتيان لاعب كورة قدم من مولدوڤا."},{"page_url":"https://de.wikipedia.org/wiki/Liane_Berkowitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Berlin_GTafel_Berkowitz.jpg","page_title":"Liane Berkowitz","context_page_description":"Liane Berkowitz war eine deutsche Widerstandskämpferin."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Neustadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Stolperstein_Pasmannstra%C3%9Fe_8_%28Ruth_Prause%29_in_Hamburg-Neustadt.JPG","page_title":"Liste der Stolpersteine in Hamburg-Neustadt","context_page_description":"Die Liste der Stolpersteine in Hamburg-Neustadt enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Neustadt verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Neustadt lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://hu.wikipedia.org/wiki/Juan_Pablo_Montoya","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/J_p_montoya.jpg","page_title":"Juan Pablo Montoya","context_page_description":"Juan Pablo Montoya Roldán kolumbiai autóversenyző. A CART FedEx Világsorozat 1999-es bajnoka, kétszeres Indy 500 győztes, volt Formula–1-es versenyző. 2007-től az amerikai NASCAR-sorozatban szerepel az Earnhardt Ganassi Racing pilótájaként."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B2%D0%B5%D0%B9%D1%82%D1%81%D0%BA%D0%BE-%D1%8D%D0%BC%D0%B8%D1%80%D0%B0%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Kuwait_United_Arab_Emirates_Locator.png","page_title":"Кувейтско-эмиратские отношения","context_page_description":"Кувейтско-эмиратские отношения — двусторонние дипломатические отношения между Кувейтом и Объединёнными Арабскими Эмиратами."},{"page_url":"https://es.wikipedia.org/wiki/Panal_(geometr%C3%ADa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Parallelohedron_edges_cube.png","page_title":"Panal (geometría)","context_page_description":"En geometría, un panal es un empaquetado de poliedros o celdas que llena el espacio de modo que no quedan huecos. Es una generalización de la teselación a espacios de mayores dimensiones. Así la clasificación de panales para distintas dimensiones viene indicado por la notación panal-n.\\nLos panales se construyen normalmente en espacios euclidianos pero también pueden ser construidos en espacios no euclidianos, como los panales hiperbólicos."},{"page_url":"https://sv.wikipedia.org/wiki/Ortnamn_i_H%C3%A4lsingland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/PlaceNameSuffix_%C3%A5nger.svg","page_title":"Ortnamn i Hälsingland","context_page_description":"Ortnamn i Hälsingland kan, liksom resten av de svenska ortnamnen, delas upp i naturnamn och kulturnamn. Kulturnamnen är ofta bebyggelsenamn med efterled där bebyggelsen beskrivs, såsom -by i Hällby och Sörby, och -byn som i Edsbyn. Som beteckning för fäbodar används ofta efterledet -bodarna, till exempel i Bölebodarna.\\nOrtnamnen i Hälsingland är, som i alla andra landskap i Sverige, dels osammansatta ortnamn och dels sammansatta. Ett fåtal av de osammansatta ortnamnen är enstaviga som Los och Skog. De allra flesta är tvåstaviga som till exempel Alfta, Hårga och Stocka. Ändelsen -a betecknar ofta pluralis.\\nAv de sammansatta ortnamnen har de allra flesta två ordled, förled och efterled, som till exempel Bollnäs och Rengsjö, men det finns också namn med tre ordled, som Viksjöfors."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D9%84%D9%8A%D9%86%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Vue_du_village_de_Moulinet_depuis_la_piste_de_Saint-Michel.JPG","page_title":"مولينيت","context_page_description":"مولينيت ‏ هي بلدية تقع في إقليم الألب البحرية من منطقة بروفنس ألب كوت دازور في جنوب شرق فرنسا. تبلغ مساحة هذه المدينة 41.07، وترتفع عن سطح البحر م، يبلغ عدد سكانها 216 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Guy Bonvallet البلدية خلال فترة."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_folklorique_Nanzhao","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Jinsuo_dao-panorama.jpg","page_title":"Île folklorique Nanzhao","context_page_description":"L'Île folklorique Nanzhao est une île du lac Erhai, sur la municipalité de Dali, dans la province du Yunnan, en Chine. Elle conserve des monuments de la dynastie du royaume des Zhao du Sud."},{"page_url":"https://de.wikipedia.org/wiki/L%C3%A1zn%C4%9B_Kyn%C5%BEvart","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Z%C3%A1mek_Kyn%C5%BEvart_08-07-11.JPG","page_title":"Lázně Kynžvart","context_page_description":"Lázně Kynžvart ist eine Stadt mit Kurviertel nur für Kinder zu Füßen des Kaiserwaldes im Okres Cheb, Tschechien."},{"page_url":"https://eu.wikipedia.org/wiki/Leptosiaphos_pauliani","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Leptosiaphos_pauliani_distribution.png","page_title":"Leptosiaphos pauliani","context_page_description":"Leptosiaphos pauliani Leptosiaphos generoko animalia da. Narrastien barruko Scincidae familian sailkatuta dago."},{"page_url":"https://it.wikipedia.org/wiki/Corpo_forestale_della_Regione_siciliana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Commissario_ruolo_direttivo_speciale_del_cfs.png","page_title":"Corpo forestale della Regione siciliana","context_page_description":"Il Corpo forestale della Regione Siciliana è un corpo tecnico di polizia a ordinamento civile, dipendente dall'Assessorato del territorio e dell'ambiente della Regione Siciliana. Svolge nell'isola funzioni e competenze proprie nel resto d'Italia dei Carabinieri Forestale."},{"page_url":"https://de.wikipedia.org/wiki/Eichen-Lattich","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Lactuca_quercina_sl21.jpg","page_title":"Eichen-Lattich","context_page_description":"Der Eichen-Lattich ist ein in Mitteleuropa selten vorkommende Pflanzenart aus der Gattung Lattich innerhalb der Familie der Korbblütler und der Unterfamilie der Cichorioideae."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A0%D7%A7%D7%95_(%D7%A8%D7%95%D7%91%D7%A2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Coat_of_arms_de-be_pankow_1987.png","page_title":"פנקו (רובע)","context_page_description":"פנקו הוא אחד מ-12 רובעי ברלין, בירת גרמניה.\\nרובע פנקו נוצר כתוצאה מאיחוד של שלושה רבעים לשעבר — פנקו, פרנצלאואר ברג ו-וייסנזה — במסגרת רפורמת השכונות של ברלין ב-1 בינואר 2001. כל השכונות המרכיבות את פנקו שכנו לפני נפילת חומת ברלין ב-1989 במזרח ברלין. רובע פנקו שוכן בצפון ברלין וגובל ברבעים מיטה ופרידריכסהיין-קרויצברג מדרום, ליכטנברג ממזרח, רייניקנדורף ממערב ובמדינת ברנדנבורג מצפון. זהו הרובע המאוכלס ביותר בברלין והשני בגודלו מבחינת השטח.\\nרובע פנקו מורכב מ-13 שכונות, מספר השכונות הרב ביותר מבין רובעי ברלין אחרי טרפטו-קפניק. השכונות הן:\\nפרנצלאואר ברג\\nוייסנזה\\nבלנקנבורג\\nהיינרסדורף\\nקארו\\nשטאדטראנדזידלונג מאלכו\\nפנקו\\nבלנקנפלדה\\nבוך\\nפרצזיש בוכהולץ\\nנידרשנהאוזן\\nרוזנטאל\\nוילהלמסרו\\nפנקו הוא אחד הרבעים המגוונים ביותר בברלין. פרנצלאואר ברג, השכונה היחידה הגובלת ברובע מיטה, בנויה ברובה בתים צפופים בגובה בינוני, ומתגוררים בה צעירים ומשפחות רבות. 12.4% מתושבי השכונה אינם אזרחים גרמניים, השיעור הגבוה ביותר ברובע. בשאר השכונות ברובע פנקו ניתן לראות בתים פרטיים רבים לצד בנייני מגורים רבי-קומות אשר נבנו לאחר מלחמת העולם השנייה. שיעור הזרים בשכונות אלו נמוך, והאוכלוסייה מבוגרת יותר. חלק מהשכונות החיצוניות של פנקו, אשר גובלות במדינת ברנדנבורג, הן כפריות ולעיתים חקלאיות באופיין."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%B3%D1%96%D1%81%D1%82%D0%BE%D1%80%D1%8B%D0%BA%D0%B0-%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%BD%D1%8B%D1%85_%D0%BA%D0%B0%D1%88%D1%82%D0%BE%D1%9E%D0%BD%D0%B0%D1%81%D1%8C%D1%86%D1%8F%D1%9E_%D0%91%D1%80%D0%B0%D1%81%D0%BB%D0%B0%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%D1%80%D0%B0%D1%91%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Opsa_kas%D1%81iol.JPG","page_title":"Сьпіс гісторыка-культурных каштоўнасьцяў Браслаўскага раёну","context_page_description":"У Браслаўскім раёне знаходзяцца 50 аб’ектаў, якія ўключаныя ў Дзяржаўны сьпіс гісторыка-культурных каштоўнасьцяў Рэспублікі Беларусь, зь іх: 24 — помнікі археалёгіі, 19 — помнікі архітэктуры, 7 — помнікі гісторыі."},{"page_url":"https://hu.wikipedia.org/wiki/Southern_Combination_Football_League","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Westconf3.png","page_title":"Southern Combination Football League","context_page_description":"A Southern Combination Football League Délkelet-Anglia fél-profi és amatőr labdarúgó együtteseinek részére létrehozott ligája. Az angol labdarúgás kilencedik, tizedik, illetve tizenegyedik szintjén szerepel.\\nLegfelsőbb osztálya a Premier Division, amely alatt a tizedik osztályt képviselő, Division One, valamint a tizenegyedik osztályt képviselő, Division Two helyezkedik el."},{"page_url":"https://en.wikipedia.org/wiki/Saturday_Club_(Boston,_Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Parkers_Ballous1855.JPG","page_title":"Saturday Club (Boston, Massachusetts)","context_page_description":"The Saturday Club, established in 1855, was an informal monthly gathering in Boston, Massachusetts, of writers, scientists, philosophers, historians, and other notable thinkers of the mid-Nineteenth Century."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27artistes_de_jungle_et_drum_and_bass","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/2017_Woodstock_396_The_Qemists.jpg","page_title":"Liste d'artistes de jungle et drum and bass","context_page_description":"Voici une liste d'artistes de jungle et drum and bass triée alphabétiquement par nom d'artiste."},{"page_url":"https://simple.wikipedia.org/wiki/Le_Gl%C3%A8be","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/2013-05-07_Friburgo_%28Foto_Dietrich_Michael_Weidmann%29_169.JPG","page_title":"Le Glèbe","context_page_description":"Le Glèbe is a former municipality of the district Saane in the canton of Fribourg in Switzerland. It was created on 1 January 2003 when the municipalities of Estavayer-le-Gibloux, Rueyres-Saint-Laurent, Villarlod, and Villarsel-le-Gibloux. joined together to become Le Glèbe. On 1 January 2016 the former municipalities of Corpataux-Magnedens, Farvagny, Le Glèbe, Rossens and Vuisternens-en-Ogoz merged to form the new municipality of Gibloux."},{"page_url":"https://en.wikipedia.org/wiki/Carris_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Museucarris007.png","page_title":"Carris Museum","context_page_description":"The CARRIS Museum is a museum that is open to the public and showcases the history of public transport in Lisbon. It is situated in the civil parish of Alcântara, municipality of Lisbon."},{"page_url":"https://id.wikipedia.org/wiki/Pirot","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Emblem_of_Pirot.png","page_title":"Pirot","context_page_description":"Pirot ialah sebuah kota dan kotamadya di Distrik Pirot, Serbia tenggara. Menurut sensus tahun 2002, kotamadya Pirot berpenduduk 63.791 jiwa, di mana 93,8% berasal dari etnis Serbia dan 3% berasal dari etnis Rom. Perusahaan terbesar di sini adalah Tigar, produsen ban mobil."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%95%D7%95%D7%90%D7%9F_%D7%A4%D7%93%D7%99%D7%95%D7%A0%D7%99%D7%A0%D7%A1%D7%A7%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Ivan_Fedyuninsky.jpg","page_title":"איוואן פדיונינסקי","context_page_description":"איוואן איוואנוביץ' פדיונינסקי היה גנרל ארמייה בצבא האדום אשר פיקד על כוחות במהלך מלחמת העולם השנייה."},{"page_url":"https://it.wikipedia.org/wiki/Cunit","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/PlayasCalas.PNG","page_title":"Cunit","context_page_description":"Cunit è un comune spagnolo di 10.033 abitanti situato nella comunità autonoma della Catalogna."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%BCdesheim_am_Rhein","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Drinking_am_Rhein.jpg","page_title":"Rüdesheim am Rhein","context_page_description":"Rüdesheim am Rhein ist eine Weinstadt im hessischen Rheingau-Taunus-Kreis und liegt mit dem gegenüberliegenden Bingen am südlichen Tor zum Mittelrheintal. Rüdesheim gehört mit zum UNESCO-Welterbe Oberes Mittelrheintal. Es liegt am Fuß des Niederwaldes. Die Stadt gehört zum Rhein-Main-Gebiet und ist eine bekannte Touristen-Attraktion.\\nRüdesheim hat knapp 10.000 Einwohner."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%B3%D8%B1_%D8%AF%D9%88%D8%A8%D8%B1%D9%81%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Dauberville_Bridge%2C_Spanning_Schuykill_River_on_Belleman%27s_Church_Road%2C_Dauberville_vicinity_%28Berks_County%2C_Pennsylvania%29.jpg","page_title":"جسر دوبرفيل","context_page_description":"جسر دوبرفيل عبارة عن جسر قوسي خرساني تاريخي، يقع في مقاطعة بركس، بنسلفانيا. يبلغ طوله 408 قدم، شيد عام 1908.\\nهدم الجسر واستبدال عام 1991. أدرج في السجل الوطني للأماكن التاريخية في عام 1988."},{"page_url":"https://nl.wikipedia.org/wiki/Montjay_(Sa%C3%B4ne-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Montjay_Dorf.jpg","page_title":"Montjay (Saône-et-Loire)","context_page_description":"Montjay is een gemeente in het Franse departement Saône-et-Loire en telt 192 inwoners. De plaats maakt deel uit van het arrondissement Louhans."},{"page_url":"https://fr.wikipedia.org/wiki/Alexander_Slidell_Mackenzie","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Alexander_Slidell_Mackenzie_%281803-1848%29.jpg","page_title":"Alexander Slidell Mackenzie","context_page_description":"Alexander Slidell Mackenzie est un officier de l’U.S. Navy qui a servi pendant la première moitié du XIXᵉ siècle. Il est surtout connu pour son rôle dans l’affaire Somers."},{"page_url":"https://it.wikipedia.org/wiki/Montblanc_(Spagna)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Localitzaci%C3%B3_de_Montblanc.png","page_title":"Montblanc (Spagna)","context_page_description":"Montblanc è un comune spagnolo di 7.354 abitanti situato nella comunità autonoma della Catalogna.\\nÈ il capoluogo della comarca della Conca de Barberà.\\nIl territorio comunale comprende le località di:\\nLa Guàrdia dels Prats\\nLilla\\nPrenafeta\\nRojals\\nEl Pinetell"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Gothic_brick_buildings_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Grudzi%C4%85dz%2C_Brama_Wodna.jpg","page_title":"List of Gothic brick buildings in Poland","context_page_description":"This list is a part of the international List of Gothic brick buildings.\\nFor the parts of this list on the various countries see:\\n– In long tables, vertical arrows link to the navigation boards above and below. –"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%AB%D5%B4_%D5%AF%D5%B2%D5%A6%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Lim_Monastery3.JPG","page_title":"Լիմ կղզի","context_page_description":"Լիմ, կղզի Վանա լճում։ Հայոց Մեծ եղեռնի ժամանակ շուրջ 12 000 կանայք և երեխաներ 3 օրվա ընթացքում անցել են կղզի, իսկ նրանց անցումը հսկել են մի քանի հայկական ֆիդայական ջոկատներ։\\nԼիմը ափից հեռու է մոտ 1 կմ։ Վանա լճի կղզիներից ամենամեծն է. երկարություն՝ 2 կմ է, լայնություն՝ 0.5 կմ։ Վաղ ժամանակներում միացած է եղել ցամաքին, որից անջատվել է ջրի մակարդակի բարձրացման հետևանքով։ Մակերևույթը հարթ է, լանդշաֆտը՝ չոր տափաստանային։\\nԸստ ավանդության՝ 4-րդ դարի սկզբին Գրիգոր Լուսավորիչը Լիմում հիմնադրել է Լիմի անապատը, որտեղ 14-րդ դարի սկզբին գործել են երեք եկեղեցի՝ սուրբ Աստվածածին, սուրբ Կարապետ և սուրբ Գևորգ եկեղեցիները։ Լիմի անապատը ծաղկում է ապրել 17-րդ դարում, երբ 1622 թվականին Սյունյաց Մեծ անապատից այստեղ է տեղափոխվել Ներսես Մոկացի վարդապետն իր աշակերտներով և հիմնադրել բարձրագույն դպրոց, որը գոյատևել է մինչև 19-րդ դարը։\\nԿղզու վրա մինչ այժմ պահպանվում են Սուրբ Գևորգ հայկական եկեղեցու ավերակները։ Այն կառուցվել էր 1305 թվականին, իսկ հավելյալ շինությունները կառուցվել են 1621 և 1766 թվականներին։ Պահպանվում են նաև գերեզմաններ ու խաչքարեր։"},{"page_url":"https://no.wikipedia.org/wiki/KV60","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Hatshepsut-CollosalGraniteSphinx02_MetropolitanMuseum.png","page_title":"KV60","context_page_description":"Gravstedet KV60 som befinner seg i Kongenes dal nær dagens Luxor i Egypt, er en av mer forvirrende graver i Tebens nekropolis, på grunn av usikkerheten om identiteten til en kvinnelig mumie funnet der, selv om den blant enkelte som den kjente egyptologen Elizabeth Thomas, ble ansett å være faraoen Hatshepsut fra det 18. dynasti. Egyptologen Zahi Hawass har nylig gjort seg til talsmann for den samme teorien.\\nDa graven ble oppdaget av Howard Carter i 1903, ble det fastslått at var blitt plyndret og skjendet i oldtiden, men inneholdt fortsatt to mumier, sammen med noe sterkt skadet gravgods; Carter gjorde tilsynelatende lite arbeid i graven.\\nI 1906 gjenåpnet Edward R. Ayrton den, og fjernet en mumie, KV60B, sammen med kisten den var i og flyttet den til Det egyptiske museet. På kisten stod navn og tittel: kongelig sykepleier, In. Denne figuren er alminnelig identifisert som Sit-Ra, kalt In, den kongelige sykepleieren til Hatshepsut. Siden verken Carter eller Ayrton tegnet plantegner eller kart som viste hvor graven befant seg ble beliggenheten glemt."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D8%A7%D9%84%D9%88%D8%A7%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Osny_Eglise.jpg","page_title":"نهر الواز","context_page_description":"الواز ‏ هو نهر يمتمد من بلجيكا إلى ناحية باريس، حيث يصب في نهر السين. يتقاطع معه في مدينة كونفلون سانت هونورين. طول هذا النهر يبلغ 341 كلم.\\nيعطي هذ النهر اسمه إلى إقليمين فرنسيين هما الواز وفال دواز."},{"page_url":"https://en.wikipedia.org/wiki/Themes_in_Italian_Renaissance_painting","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Madonna_Rucellai.jpg","page_title":"Themes in Italian Renaissance painting","context_page_description":"The works encompassed are from Giotto in the early 14th century to Michelangelo's Last Judgement of the 1530s.\\nThe themes that preoccupied painters of the Italian Renaissance were those of both subject matter and execution – what was painted and the style in which it was painted. The artist had far more freedom of both subject and style than did a Medieval painter. Certain characteristic elements of Renaissance painting evolved a great deal during the period. These include perspective, both in terms of how it was achieved and the effect to which it was applied, and realism, particularly in the depiction of humanity, either as symbolic, portrait or narrative element."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Mutual_(Oklahoma)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/OKMap-doton-Mutual.PNG","page_title":"Mutual (Oklahoma)","context_page_description":"Mutual sī Bí-kok Oklahoma chiu Woodward kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Oklahoma Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Celistnatka_r%C3%A1kosn%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Tetragnatha.extensa.female.jpg","page_title":"Čelistnatka rákosní","context_page_description":"Čelistnatka rákosní je pavouk patřící do čeledi čelistnatkovití"},{"page_url":"https://fr.wikipedia.org/wiki/Mageia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Mageia_logo.svg","page_title":"Mageia","context_page_description":"Mageia /maʒeja/ est le nom d'une distribution Linux éditée par une association française à but non lucratif : Mageia.Org."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%80%D1%82%D0%B0%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Chiatra63.JPG","page_title":"Ортале","context_page_description":"Ортале́ — муніципалітет у Франції, у регіоні Корсика, департамент Верхня Корсика. Населення — 25 осіб.\\nМуніципалітет розташований на відстані близько 920 км на південний схід від Парижа, 75 км на північний схід від Аяччо, 45 км на південь від Бастії."},{"page_url":"https://lt.wikipedia.org/wiki/Eugeniusz_Bodo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Uroda_%C5%BCycia.jpg","page_title":"Eugeniusz Bodo","context_page_description":"Eugeniušas Bodo – kino režisierius, vienas populiariausių Lenkijos tarpukario aktorių ir komikų, prodiuseris ir dainininkas. Vaidino populiariausiuose ketvirtojo dešimtmečio lenkų filmuose, tapo viena iš didžiausių lenkų muzikinių komedijų ikona ir „Lenkijos komercinio kino simboliu“. Šio dešimtmečio pabaigoje jis taip pat tapo sėkmingu verslininku – turėjo savo kino studiją. Sovietams užėmus Lenkiją buvo areštuotas ir žuvo Gulage.\\nSceninis slapyvardis „Bodo“ yra sudarytas iš pirmųjų jo tėvų, Bohdano ir Jadvygos Anos Dorotos, vardų skiemenų."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%88%EB%93%9C%EB%A0%88%EC%95%84%EC%8A%A4_%EB%B8%8C%EB%A0%88%EB%A9%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Andreas_Brehme.jpg","page_title":"안드레아스 브레메","context_page_description":"안드레아스 \\"앤디\\" 브레메는 독일의 축구 코치이자 전 축구 수비수였다. FC 인테르나치오날레 밀라노에서 뛰던 당시 지역 라이벌의 AC 밀란의 프랑크 레이카르트, 뤼트 휠릿, 마르코 판 바스턴을 '오렌지 삼총사'라고 불린 것에 빗대어 로타어 마테우스, 위르겐 클린스만와 묶여 '게르만 삼총사'라고 불리며 인테르나치오날레의 스쿠데토에 기여하였다. 또한 위의 두 선수들과 함께 독일의 1990년 FIFA 월드컵 우승을 이끌었다."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D8%A7%D9%86%D8%B3%D9%81%D9%8A%D9%84%D8%AF_%D8%AA%D9%88%D8%B1%D9%86%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Admiral_Stansfield_Turner%2C_official_Navy_photo%2C_1983.JPEG","page_title":"ستانسفيلد تورنر","context_page_description":"ستانسفيلد تورنر ‏ هو ضابط أمريكي، ولد في 1 ديسمبر 1923 في هايلاند بارك في الولايات المتحدة، وتوفي في 18 يناير 2018 في سياتل في الولايات المتحدة."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Rodynske_new_gerb.png","page_title":"Родинське","context_page_description":"Ро́динське — місто районного значення у Донецькій області, підпорядковане Покровській міській раді: 10114 мешканців. Маленьке шахтарське містечко, розташоване неподалік від залізничного вузла Покровськ. Залізнична станція Родинська, з 2009 року здійснює лише вантажні операції. Кам'яновугільні шахти."},{"page_url":"https://br.wikipedia.org/wiki/17_Genver","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Anne_Bronte.jpg","page_title":"17 Genver","context_page_description":"1471: dizoloet eo Ilha de Santo Antão gant moraerien bortugalat.\\n1819: gant Simón Bolívar eo embannet ar Republik e Kolombia.\\n1944: deroù Emgann Monte Cassino, en Italia.\\n1969: embannadur Yellow Submarine e Breizh-Veur, dekvet albom gant ar strollad The Beatles.\\n1991 dont a ra Harald V da vezañ roue Norvegia.\\n1995: kren-douar e Kobe e Japan: ouzhpenn 6000 den lazhet."},{"page_url":"https://ca.wikipedia.org/wiki/Giovanni_Ferrari","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/FBC_Juventus_-_1930s_-_Giovanni_Ferrari.jpg","page_title":"Giovanni Ferrari","context_page_description":"Giovanni Ferrari fou un futbolista italià dels anys 30 i posterior entrenador.\\nPel que fa a clubs, guanyà cinc campionats amb la Juventus, dos amb l'Inter i un amb el Bolonya. És, juntament amb Giuseppe Furino, l'únic futbolista que guanyà vuit lligues de la Sèrie A italiana. Virginio Rosetta també guanyà vuit lligues, però tres foren abans de la creació de la Sèrie A professional.\\nAmb la selecció italiana guanyà dos Mundials, els de 1934 a Itàlia i 1938 a França. Un cop retirat fou entrenador. Dirigí la selecció italiana del 1960 al 1961, i formà part de la comissió tècnica que dirigí la selecció al Mundial de 1962."},{"page_url":"https://de.wikipedia.org/wiki/Sebastian_Lohse","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sebastian_Lohse_Foto_by_Michel_Hinrichsen.jpg","page_title":"Sebastian Lohse","context_page_description":"Sebastian Lohse, Künstlername Robin Sohn ist ein deutscher Musiker, Sänger und Komponist."},{"page_url":"https://es.wikipedia.org/wiki/Janusz_Radziwi%C5%82%C5%82_(1612-1655)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Portret_Janusza_Radziwi%C5%82%C5%82a.jpg","page_title":"Janusz Radziwiłł (1612-1655)","context_page_description":"El príncipe Janusz Radziwiłł fue un ilustre noble polaco. Durante su vida desempeñó una series de puestos en la Administración Pública, entre ellos el de chambelán de la corte lituana y el de hetman de campo de Lituania. Fue asimismo voivoda de la provincia de Vilna y starosta de Samogitia, Kamieniec, Kazimierz y Sejwy. Protegió la religión protestante en Lituania y patrocinó muchas iglesias y escuelas protestantes.\\nDurante las décadas anteriores, los intereses de la familia Radziwłł y los del Estado habían comenzado a divergir, como consecuencia del aumento en poder y riqueza de la primera. Los intentos de los miembros de la familia de acrecentar su poder político en el Gran Ducado de Lituania culminaron con la actividad de Janusz Radziwiłł, al que la historiografía polaca considera uno de los aristócratas responsables del fin de la época de esplendor de la Mancomunidad.\\nFue uno de los hombres más poderosos del país, al que se tenía a menudo por señor efectivo del Gran Ducado. Durante el «Diluvio» —la invasión sueca de Polonia-Lituania durante la Segunda Guerra del Norte— se pasó a las filas del rey sueco, con el que firmó el Tratado de Kėdainiai y la Unión de Kėdainiai."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D8%B1%D8%AA_%D8%AC%D9%86%D8%AA%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/PORTGENTIL2.JPG","page_title":"بورت جنتيل","context_page_description":"بورت جنتيل ‏ ثاني أكبر مدن الغابون ومن أهم الموانيء في أفريقيا حيث يتم تصدير البترول والخشب. يبلغ عدد سكان المدينة 80 ألف نسمة حسب إحصاء سنة 1993."},{"page_url":"https://en.wikipedia.org/wiki/Sankt_Ulrich_bei_Steyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Sankt_Ulrich_bei_Steyr.jpg","page_title":"Sankt Ulrich bei Steyr","context_page_description":"Sankt Ulrich bei Steyr is a municipality in the district of Steyr-Land in the Austrian state of Upper Austria."},{"page_url":"https://es.wikipedia.org/wiki/Ladispoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Fosso_vaccina_%282%29.JPG","page_title":"Ladispoli","context_page_description":"Ladispoli es una localidad italiana de la provincia de Roma, región de Lazio, con 39.376 habitantes.​"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%A4%EC%8A%A4%EB%A7%8C_%EC%A0%9C%EA%B5%AD%EC%9D%98_%EA%B5%B0%EC%A3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Sultan_Gazi_%CA%BBUthm%C4%81n_Han_I_-_%D8%A7%D9%84%D8%B3%D9%8F%D9%84%D8%B7%D8%A7%D9%86_%D8%A7%D9%84%D8%BA%D8%A7%D8%B2%D9%8A_%D8%B9%D9%8F%D8%AB%D9%85%D8%A7%D9%86_%D8%AE%D8%A7%D9%86_%D8%A7%D9%84%D8%A3%D9%88%D9%8E%D9%91%D9%84.png","page_title":"오스만 제국의 군주","context_page_description":"오스만 제국 군주은 오스만 제국의 군주로 오스만 가문 출신이다. 1299년을 공식적인 제국 성립일로 보고 1922년 터키 공화국의 성립까지가 오스만 제국의 군주가 다스린 기간으로 본다.\\n오스만의 군주는 무라트 1세 이후 술탄의 직위를 얻어 술탄으로 표기하기도 하며 나중에는 칼리파와 파디샤도 겸직했다. 18세기~19세기 제국주의 시대에는 황제로 불렀다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Neustadt_(Nord)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Peterstra%C3%9Fe_39%2C_Beyling-Stift.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Neustadt (Nord)","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Neustadt (Nord) enthält die in der Denkmalliste ausgewiesenen Denkmäler in den Ortsteilen 106 und 108 des Stadtteils Neustadt der Freien und Hansestadt Hamburg.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Denkmallistennummer, Art, Typ, Datierung, Entwurf oder Beschreibung sortierbar.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Open Data Portal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung.\\nAlle Denkmäler in den Ortsteilen 106 und 108, die schon vor der Novelle des Denkmalschutzgesetzes unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Hamburg-Mitte zu finden.\\nIn der Spalte Lfd. Nr. ist die eindeutige Identifikationsnummer des Denkmals zu finden. In der Spalte Art ist angegeben, ob es sich um ein Objekt oder ein Ensemble handelt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B4%D0%B5%D0%BB%D1%96%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D1%96%D0%B0%D0%BB_%D0%B2_%D0%9A%D0%BE%D1%80%D0%B4%D0%B5%D0%BB%D1%96%D0%B2%D1%86%D1%96_P1160213.JPG","page_title":"Корделівка","context_page_description":"Корде́лівка — село в Україні, у Вінницькій області, Калинівському районі. Населення становить 2902 осіб."},{"page_url":"https://fr.wikipedia.org/wiki/Palladium_(Prague)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/V%C3%A1noce_Praha_2014_11.jpg","page_title":"Palladium (Prague)","context_page_description":"Palladium est un centre commercial de Prague, en République tchèque. Ouvert en 2007, ce centre sur cinq niveaux, qui abrite 180 commerces et 20 restaurants, est situé dans le quartier de Nové Město."},{"page_url":"https://de.wikipedia.org/wiki/Helios-Relief_(Schloss_Rosenstein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Helios-Metope%2C_Troja%2C_Athena-Tempel.jpg","page_title":"Helios-Relief (Schloss Rosenstein)","context_page_description":"Das Helios-Relief ist ein Hochrelief des Stuttgarter Bildhauers Ludwig Mack am Schloss Rosenstein in Stuttgart, das den Sonnenaufgang mit dem Sonnengott Helios zeigt."},{"page_url":"https://fi.wikipedia.org/wiki/Garry_Monk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Garry_Monk.jpg","page_title":"Garry Monk","context_page_description":"Garry Monk on englantilainen uransa jo päättänyt jalkapalloilija ja nykyinen jalkapallovalmentaja. Syyskuusta 2019 lähtien hän on toiminut Sheffield Wednesdayn päävalmentajana."},{"page_url":"https://gl.wikipedia.org/wiki/Racismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Antisemitisme_Duitsland_1933.jpg","page_title":"Racismo","context_page_description":"O racismo é un modo de pensar, unha filosofía social biolóxico-cultural, unha actitude e/ou un sistema social que propugna e afirma que a xente de diferentes grupos humanos son diferentes en valor, en base ás súas características físicas hereditarias, e determinados trazos de carácter e intelixencia ou manifestacións culturais; que esas diferenzas poden ser medidas ou catalogadas xerarquicamente e que teñen consecuencias en vantaxes económicas, políticas e sociais dun grupo en relación aos demais.\\nEsta crenza da existencia de razas humanas, superiores e inferiores, utilizouse moitas veces para xustificar a escravitude, o dominio de determinados pobos por outros, e os xenocidios que ocorreron ó longo da historia da humanidade."},{"page_url":"https://pl.wikipedia.org/wiki/Daubenhorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Daubenhorn.jpg","page_title":"Daubenhorn","context_page_description":"Daubenhorn – szczyt w Alpach Berneńskich, części Alp Zachodnich. Leży w Szwajcarii, w kantonie Valais, blisko granicy z kantonem Berno. Przełęcz Gemmi oddziela go od Rinderhorn. Poniżej szczytu blisko przełęczy Gemmi leży jezioro Daubensee.\\nNa szczyt prowadzi najdłuższa droga wspinaczkowa via ferrata w całej Szwajcarii. Szlak prowadzi z Leukerbad i ten oznakowany jest jako ED czyli ekstremalnie trudny. Na szczyt można także wejść z przełęczy Gemmi, na której znajduje się schronisko Lämmerenhütte.\\nPierwszego odnotowanego wejścia dokonali Fox i inni w 1879 r."},{"page_url":"https://es.wikipedia.org/wiki/Samoa_Joe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Samoa_Joe_Bloomington_IL_062008.jpg","page_title":"Samoa Joe","context_page_description":"Nuufolau Joel Seanoa​ es un luchador profesional estadounidense de ascendencia samoana, más conocido por su nombre en el ring, Samoa Joe​, trabaja actualmente para la WWE en su marca Raw.​\\nSin embargo, es conocido por haber trabajado para la promoción de lucha libre profesional Total Nonstop Action Wrestling, además de ser conocido por sus actuaciones en Ring of Honor.\\nSeanoa es dos veces Campeón Mundial al haber sido una vez Campeón Mundial Peso Pesado de la TNA y una vez Campeón Mundial de ROH. También ha sido una vez Campeón Puro de ROH, dos veces Campeón de NXT, dos veces Campeón de Estados Unidos de la WWE, cinco veces Campeón de la División X de la TNA, una vez Campeón de la Televisión de la TNA, dos veces Campeón Mundial en Parejas de la TNA y una vez Campeón en Parejas de la GHC todo esto lo convierte en Campeón de la Triple Corona y Gran Campeón. Fue Ganador del King of the Mountain de 2008, del Feast or Fired de 2009, de la Super X Cup 2005, del Gauntlet for the Gold 2007 y Primer ganador Dusty Rhodes Tag Team Classic con Finn Bálor. Y feudo del año"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%BC%D1%8F%D1%87_(%D0%B1%D0%B0%D1%81%D0%BA%D0%B5%D1%82%D0%B1%D0%BE%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Joakim_Noah_and_JaVale_McGee.jpg","page_title":"Спорный мяч (баскетбол)","context_page_description":"Спорный мяч — вбрасывание баскетбольного мяча в начале игры или после спорной ситуации после остановки игры свистком судьи. Отсчёт чистого времени матча начинается именно с момента вбрасывания мяча в центральном круге площадки судьёй.\\nСпорный мяч разыгрывается между двумя игроками противоположных команд. Каждый из спорящих становится в той половине круга, которая ближе к его корзине, при этом одна нога игрока должна находиться в непосредственной близости от центральной линии. Судья подбрасывает мяч вертикально вверх так, чтобы спорящие не могли в прыжке достать его в высшей точке, и так, чтобы он падал между ними. Мяча должны коснуться один или оба спорящих лишь после достижения им высшей точки. Если мяч достигнет пола без касания по крайней мере одного из спорящих, судья должен повторить бросок. Никто из спорящих не может оставить своего места прежде, чем коснется мяча кто-либо из них двоих или оба. Любой из спорящих может коснуться мяча только дважды. В третий раз это возможно лишь тогда, когда мяч коснется одного из восьми остальных игроков, пола, корзины или щита.\\nКоманда, которая проиграла стартовое вбрасывание, имеет право на следующее владение."},{"page_url":"https://af.wikipedia.org/wiki/Christa_Campbell","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Christa_Campbell_2_2009.jpg","page_title":"Christa Campbell","context_page_description":"Christa Campbell is 'n Amerikaanse aktrise en vervaardiger. Sy is bekend vir haar rolle in die rolprente Winter on Fire: Ukraine's Fight for Freedom, The Hitman's Bodyguard, Hellboy, en Red Sonja."},{"page_url":"https://en.wikipedia.org/wiki/Douglas_Ellington","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/First_Baptist_Church_Asheville.jpg","page_title":"Douglas Ellington","context_page_description":"Douglas Dobell Ellington was an American architect who is noted for his work in the Art Deco style."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%BF%CF%8D%CF%81%CE%BD%CE%BF%CE%B9_%CE%9A%CE%BF%CF%81%CF%83%CE%B5%CF%8E%CE%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Fourni_el.png","page_title":"Φούρνοι Κορσεών","context_page_description":"Οι Φούρνοι Κορσεών είναι συστάδα νήσων, νησίδων και βραχονησίδων του ανατολικού Αιγαίου. Η Θέση τους είναι δυτικά-νοτιοδυτικά της Σάμου και ανατολικά της Ικαρίας. Συγκεκριμένα ανάμεσα στο τρίγωνο των ακρωτηρίων Δομένικος της Σάμου, Φανάρι της Ικαρίας και Τζουλούφι της Πάτμου.\\nΚυριότερες αυτών είναι, δυτικά: η Θύμαινα, το Θυμαινάκι, το Αλατονήσι, κεντρικά: οι Φούρνοι, Κισηριά, νότια: το Στρογγυλό, το Πλατύ, Μακρονήσι ή Μακρύ και ανατολικά: Ανθρωποφάς, ο μικρός Ανθρωποφάς, η Κεδρό, η Αγριδιό, ο Άγιος Μηνάς, ο μικρός Άγιος Μηνάς και το Πλακάκι."},{"page_url":"https://hu.wikipedia.org/wiki/Ver%C3%A9bgalambocska","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ground_Dove.jpg","page_title":"Verébgalambocska","context_page_description":"A verébgalambocska a madarak osztályának galambalakúak rendjébe és a galambfélék családjába tartozó faj."},{"page_url":"https://en.wikipedia.org/wiki/Piet_de_Jong","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Aankomst_Bondskanselier_Willy_Brandt_van_Duitsland_op_Ypenburg._Aankomst_Brandt%2C_Bestanddeelnr_923-0345.jpg","page_title":"Piet de Jong","context_page_description":"Petrus Jozef Sietse \\"Piet\\" de Jong was a Dutch politician of the defunct Catholic People's Party now the Christian Democratic Appeal party and naval officer who served as Prime Minister of the Netherlands from 5 April 1967 to 6 July 1971.\\nDe Jong applied at the Royal Naval College in Den Helder and graduated as an Ensign in the Navy and joined the Submarine Service. During World War II he served on the submarine HNLMS O 24 as First Officer and later as Commanding officer and saw action in both the Battle of the Atlantic and the Pacific War. After the War De Jong served as a staff officer and commanded a frigate and destroyer. After the election of 1959 De Jong was unexpectedly appointed as State Secretary for Defence tasked with Naval Affairs taking office on 25 June 1959. After the election of 1963 De Jong was appointed as Minister of Defence in the Cabinet Marijnen taking office on 24 July 1963. The Cabinet Marijnen fell 19 months into its term and was replaced by the Cabinet Cals with De Jong continuing his office. The Cabinet Cals fell just one year later and was replaced by the caretaker Cabinet Zijlstra and De Jong retained his position."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B3%D1%80%D0%B0_%C2%AB%D0%A5%D0%B0%D0%B9%D0%B4%D0%B8%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Heidi_Game_program.jpg","page_title":"Игра «Хайди»","context_page_description":"Игра «Хайди» или «Хайди» Боул — матч по американскому футболу, прошедший 17 ноября 1968 года, в котором хозяева поля «Окленд Рэйдерс» обыграли «Нью-Йорк Джетс» со счётом 43:32. Игра запомнилась своей захватывающей концовкой — «Рэйдерс», проигрывая «Джетс» со счётом 32:29, сделали два тачдауна на последней минуте матча. Своё имя игра получила в связи с тем, что телеканал National Broadcasting Company в 7 часов вечера по североамериканскому восточному времени прервал трансляцию матча в то время, как «Джетс» ещё вели в счёте и стал транслировать телефильм «Хайди».\\nВ конце 1960-х годов лишь немногие футбольные матчи проходили дольше двух с половиной часов, поэтому трёхчасовой телевизионный слот, выделенный на игру «Джетс»-«Рэйдерс», считался вполне адекватным. Однако результативная игра, большое количество травм и пенальти в матче двух заядлых соперников Американской футбольной лиги сильно затянули игру. Ещё до начала матча руководство NBC распорядилось, что показ «Хайди» должен начаться точно по расписанию, но из-за захватывающей концовки игры оно решило отложить начало показа фильма и продолжить трансляцию футбольного матча."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BB%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D1%81%D0%B8%D0%BB%D0%BA%D0%B8%D0%BD.jpg","page_title":"Силкин, Алексей Владимирович","context_page_description":"Алексей Владимирович Силкин — каскадёр, постановщик трюков режиссер массовых мероприятий. Член Гильдии каскадеров России, каскадер, профессиональный постановщик трюков, член Совета Гильдии каскадёров при Союзе кинематографистов России. Лауреат премии Гильдии каскадёров России «Альтер Эго» в номинации «Лучшая батальная сцена»."},{"page_url":"https://sh.wikipedia.org/wiki/Roki%C5%A1kis","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Rokiskis_main_square_with_church.JPG","page_title":"Rokiškis","context_page_description":"Rokiškis je grad u Litvaniji, na krajnjem severoistoku zemlje, blizu granice sa Letonijom. Rokiškis čini samostalnu opštinu u okviru okruga Panevėžys.\\nRokiškis je po popisu iz 2001. godine imao 16.746 stanovnika."},{"page_url":"https://lv.wikipedia.org/wiki/C%C4%93su_komturi_un_fogti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Cesis_Burg.jpg","page_title":"Cēsu komturi un fogti","context_page_description":"Cēsu komturi un Cēsu fogti bija ordeņa Cēsu pils un tai pakļauto teritoriju pārvaldnieki un karavadoņi no 1207. līdz 1562. gadam.\\nCēsu pils periodiski bija arī Livonijas ordeņa mestru rezidence, bet 1481. gadā uz Cēsu pili no Rīgas ordeņa pils tika pārvests Livonijas arhīvs, zelta, sudraba, dārglietu un citu bagātību krājumi un Cēsis kļuva par pastāvīgo Livonijas ordeņa galvaspilsētu līdz pat ordeņa sekularizācijai 1561. gadā. Šajā laikā Cēsu pils pārvaldnieki jeb \\"mājas komturi\\" atbildēja vienīgi par pils uzturēšanu.\\nCēsu komturejā ietilpa Āraišu, Burtnieku, Cēsu, Lugažu, Trikātas un Valmieras draudzes novadi."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AD%E0%B1%82%E0%B0%9F%E0%B0%BE%E0%B0%A8%E0%B1%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/GangkharPuensum3.jpg","page_title":"భూటాన్","context_page_description":"భూటాన్ రాజ్యం దక్షిణాసియాలోని భూపర్యవేష్టిత దేశం. ఇది హిమాలయాల తూర్పు వైపు ఆఖరు భాగంలో హిమాలయ పర్వత శ్రేణుల మధ్య ఉంది. భూటాన్‌కు దక్షిణ, తూర్పు, పడమట సరిహద్దులలో భారత భూభాగము, ఉత్తర సరిహద్దులలో చైనా దేశంలో భాగమైన టిబెట్ ఉన్నాయి. భూటాన్‌ను నేపాల్ నుండి భారతదేశంలోని రాష్ట్రమైన సిక్కిం వేరుచేస్తుంది. భూటానీయులు తమ దేశాన్ని డ్రక్ యూ అని పిలుస్తారు.\\nభూటాన్ ఒకప్పుడు ప్రంచానికంతటికీ దూరంగా ఏకాంతంగా ఉండే దేశాలలో ఒకటి. కానీ ప్రస్తుతం దేశంలో సాంకేతిక, ఇతర అభివృద్ధి కారణంగా ప్రపంచానికి భూటాన్ ద్వారాలు తెరవబడ్డాయి. ఇంటర్‌నెట్, మొబైల్ ఫోన్లు, కేబుల్ టీవి కార్యక్రమాలు, అంతర్జాతీయ విమానసేవలు భూటాన్‌ను ప్రపంచంతో అనుసంధానం చేయడంలో ప్రధాన పాత్ర వహిస్తున్నాయి. సనాతన ధర్మాలు సంస్కృతిని కాపాడుతూ అధునికతకు మారుతూ సమతూకాన్ని కాపాడుతూ భూటాన్ అభివృద్ధి పధంలోకి నడుస్తూ ఉంది. భూటాన్ పరిసరాలకు కీడు కలిగించే కార్యాలకు అనుమతి లభించదు. భూటాన్ ప్రభుత్వం సంస్కృతి రక్షణ, పరిసరాల రక్షణ, తమ ప్రత్యేకత కాపాడటానికి ప్రాముఖ్యత నిస్తుంది. 2000లో భూటాన్ వ్యాపార వారోత్సవాల తరువాత భూటాన్ అత్యంత ఆనందకరమైన దేశంగా వరల్డ్ మ్యాప్ ఆఫ్ హ్యాపీనెస్ 2000 సంవత్సరపు పరిశీలన ద్వారా గుర్తించబడింది.\\nభూటాన్ భూభాగం దక్షిణంలో సమశీతోష్ణ మండల మైదానాలు, ఉత్తరాన ఉన్న హిమాలయ శిఖరాలు వీటి ఎత్తు సముద్ర మట్టానికి 7,000 మీటర్లు ఉంటుంది."},{"page_url":"https://en.wikipedia.org/wiki/Eadweard_Muybridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Muybridge_horse_jumping_animated.gif","page_title":"Eadweard Muybridge","context_page_description":"Eadweard Muybridge was an English-American photographer important for his pioneering work in photographic studies of motion, and early work in motion-picture projection. He adopted the first name Eadweard as the original Anglo-Saxon form of Edward, and the surname Muybridge, believing it to be similarly archaic.\\nBorn in Kingston upon Thames in the United Kingdom, at age 20 he emigrated to America as a bookseller, first to New York, and then to San Francisco. Planning a return trip to Europe in 1860, he suffered serious head injuries in a stagecoach crash in Texas. He spent the next few years recuperating in Kingston upon Thames, where he took up professional photography, learning the wet-plate collodion process, and secured at least two British patents for his inventions. He went back to San Francisco in 1867. In 1868 he exhibited large photographs of Yosemite Valley, which made him world-famous.\\nIn 1874 Muybridge shot and killed Major Harry Larkyns, his wife's lover, but was acquitted in a jury trial on the grounds of justifiable homicide. In 1875 he travelled for more than a year in Central America on a photographic expedition."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Serraz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ch%C3%A2teau_Serraz_Seillonnaz_8.jpg","page_title":"Château de la Serraz","context_page_description":"Le château de la Serraz est un ancien château fort, du XIVᵉ siècle, centre de la seigneurie de la Serra, qui se dresse sur la commune de Seillonnaz dans le département de l'Ain en région Auvergne-Rhône-Alpes.\\nLe château fait l’objet d’une inscription partielle au titre des monuments historiques par arrêté du 30 mai 1978. Seuls les façades et toitures sont inscrits."},{"page_url":"https://en.wikipedia.org/wiki/Mangham,_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Richland_Parish_Louisiana_Incorporated_and_Unincorporated_areas_Mangham_Highlighted.svg","page_title":"Mangham, Louisiana","context_page_description":"Mangham is a village in Richland Parish in northeastern Louisiana, United States. The population was 672 at the 2010 census. Mangham was established in 1890. It is named for Wiley P. Mangham, the publisher of the Richland Beacon-News, a weekly newspaper in Rayville, the seat of Richland Parish."},{"page_url":"https://it.wikipedia.org/wiki/Lasiocampidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Cosmotriche_lobulina.jpg","page_title":"Lasiocampidae","context_page_description":"I Lasiocampidi sono una famiglia di lepidotteri di dimensioni medio-grandi, diffusa in tutti i continenti con 224 generi, divisi in 1952 specie. Rappresentano l'unica famiglia della superfamiglia Lasiocampoidea Harris, 1841."},{"page_url":"https://de.wikipedia.org/wiki/Flensburger_F%C3%B6rde","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Leuchtturm_Gammel_Pol_1.jpg","page_title":"Flensburger Förde","context_page_description":"Die Flensburger Förde ist eine Förde im Bereich der westlichen Ostsee auf der Ostseite der Kimbrischen Halbinsel. Durch die Flensburger Förde verläuft die deutsch-dänische Grenze. An ihrem Ende liegt die Fördestadt Flensburg. Das Westende der Förde markiert zugleich den westlichsten Punkt der Ostsee."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_pi%C3%A8ces_de_collection_allemandes_en_euro","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Germany_Goldeuro_2006_Weimar_Motivseite_IMG_2164.jpg","page_title":"Liste des pièces de collection allemandes en euro","context_page_description":"Une pièce de collection allemande en euro est une pièce de monnaie libellée en euro et émise par l'Allemagne mais qui n'est pas destinée à circuler. Elle est principalement destinée aux collectionneurs.\\nCinq instituts monétaires sont chargés de la frappe des pièces de monnaie allemandes. Il s'agit de la Bayerisches Hauptmünzamt, la Hamburgische Münze, la Staatliche Münze Berlin, la Staatliche Münzen Baden-Württemberg."},{"page_url":"https://it.wikipedia.org/wiki/Mary-sur-Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mary-sur-Marne_mairie.jpg","page_title":"Mary-sur-Marne","context_page_description":"Mary-sur-Marne è un comune francese di 1.212 abitanti situato nel dipartimento di Senna e Marna nella regione dell'Île-de-France."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%DA%88%D9%86%DB%8C_%D8%B4%D9%88%DA%AF%D8%B1%D8%A7%D8%A4%D9%86%DA%88_%D8%A7%D8%B3%D9%B9%DB%8C%DA%88%DB%8C%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Sydney_Showground_Stadium_2015-8-9.jpg","page_title":"سڈنی شوگراؤنڈ اسٹیڈیم","context_page_description":"سڈنی شوگراؤنڈ اسٹیڈیم تجارتی نام سپاٹلیس اسٹیڈیم سابقہ سکوڈا اسٹیڈیم سڈنی اولمپک پارک میں ایک کھیلوں کا میدان ہے۔"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BE%D0%BF%D1%86%D0%BE%D0%B2_%D0%9A%D0%BE%D1%81%D1%82%D1%8F%D0%BD%D1%82%D0%B8%D0%BD_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/A_Master_who_had_conquered_a_Lion_within_himself_became_a_Fire_Lion.jpg","page_title":"Скопцов Костянтин Михайлович","context_page_description":"Костянти́н Миха́йлович Скопцо́в — український художник, графік, живописець, ілюстратор."},{"page_url":"https://cs.wikipedia.org/wiki/Vodop%C3%A1d_Hosta%C4%8Dovky","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mal%C3%BD_vodop%C3%A1d_1.JPG","page_title":"Vodopád Hostačovky","context_page_description":"Vodopád Hostačovky nebo také Malý vodopád se nachází na říčce Hostačovce těsně nad jejím ústím do řeky Doubravy. Geomorfologicky náleží do Čáslavské kotliny a katastrálně k obci Žleby.\\nPůvod vodopádu není zcela jasný. Nachází se v anglickém parku u zámku Žleby. Nad hranou vodopádu jsou patrné umělé lidské zásahy, žádné písemné záznamy o změně toku Hostačovky a umělém vybudování vodopádu však neexistují. V případě, že se jedná o přirozeně vzniklý vodopád, tak představuje klasickou ukázku vodopádu vertikálních vrstev. Obě ramena vodopádu jsou vějířovitá a u paty vodopádu se téměř sbíhají."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%91%D0%B3%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B5%D0%B9%D1%81%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/HMS_Kenya_under_attack.jpg","page_title":"Лёгкий крейсер","context_page_description":"Лёгкий крейсер — боевой надводный корабль, подкласс крейсеров, появившийся в начале XX века, продукт эволюции бронепалубных крейсеров под влиянием опыта русско-японской войны. Лёгкие крейсера являлись относительно крупными специализированными артиллерийскими кораблями с развитой броневой защитой, вооружались преимущественно артиллерией среднего калибра. Принимали активное участие в морских сражениях Первой и Второй мировых войн. Военно-морской теоретик Альфред Мэхэн отводил лёгким крейсерам роль разведчиков и истребителей неприятельской торговли.\\nРазвитие подкласса происходило в рамках доктрин национальных ВМС и приводило к большим отличиям в предназначении и характеристиках кораблей. Лондонские морские договоры 1930 и 1936 годов привели к выработке определённого международного стандарта, но некоторые различия всё равно сохранялись. В годы Второй мировой войны лёгкие крейсера применялись для решения самых разнообразных задач и достигли высокой степени совершенства.\\nСтроительство лёгких крейсеров прекратилось к концу 1950-х годов. Прекращение развития лёгких крейсеров было связано с изменениями в средствах и методах вооружённой борьбы на море."},{"page_url":"https://en.wikipedia.org/wiki/Pennsylvania_House_of_Representatives,_District_66","image_url":"https://upload.wikimedia.org/wikipedia/en/d/d7/Pennsylvania_House_District_66.png","page_title":"Pennsylvania House of Representatives, District 66","context_page_description":"The 66th Pennsylvania House of Representatives District is in Central Pennsylvania and has been represented by Cris Dush since 2015."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lasalle_(Gard)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Map_commune_FR_insee_code_30140.png","page_title":"Lasalle (Gard)","context_page_description":"Lasalle sī ūi-tī Hoat-kok Languedoc-Roussillon tōa-khu Gard séng ê chi̍t ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Gefl%C3%BCgelte_Worte","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Georg_B%C3%BCchmann%2C_Gefl%C3%BCgelte_Worte%2C_19._Auflage%2C_1898.jpg","page_title":"Geflügelte Worte","context_page_description":"Geflügelte Worte ist eine Zitatensammlung des Berliner Oberlehrers Georg Büchmann, deren erste Auflage im Jahr 1864 erschien und die weite Verbreitung in Deutschland fand. Sie stellte im 19. Jahrhundert und darüber hinaus ein Standardwerk der Sammlung sogenannter Geflügelter Worte dar."},{"page_url":"https://ca.wikipedia.org/wiki/MG_34","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/German-infantry-marching-MG34-poland-1939.png","page_title":"MG 34","context_page_description":"La MG 34, de l'alemany Maschinengewehr 34, va ser la primera metralladora de propòsit general dissenyada durant la dècada dels 30 i fabricada a partir de 1934 a Alemanya. Les primeres 300 unitats es van distribuir el 1935. Era una metralladora refrigerada per aire, disparava cartutxos d'alta potència 7,92 x 57 mm Màuser i tenia un sistema per canviar ràpidament de canó.\\nVa ser dissenyada tant com a arma lleugera d'escamots com per a tasques més grans, estant un exemple prematur de metralladora de propòsit general. Com a arma lleugera, es va pensar equipar-la amb un bípede i un carregador de tambor de 75 projectils. Com a metralladora pesada estava muntada en un trípode i feia servir cintes de munició. A la pràctica, la infanteria només usava la versió de bípede, donant com a resultat una arma mitjana de suport."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B8%D0%BA%D1%81,_%D0%AD%D0%B4%D0%B2%D0%B8%D0%BD_%D0%9B%D0%BE%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Weeks_Edwin_Lord_Royal_Elephant.jpg","page_title":"Уикс, Эдвин Лорд","context_page_description":"Эдвин Лорд Уикс — американский художник—ориенталист."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Porz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/3208_Glasstr_38.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Porz","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Porz, Stadtbezirk Köln-Porz, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://sv.wikipedia.org/wiki/Petroselinum_segetum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Petroselinum_segetum_1.jpg","page_title":"Petroselinum segetum","context_page_description":"Petroselinum segetum är en flockblommig växtart som först beskrevs av Carl von Linné, och fick sitt nu gällande namn av Wilhelm Daniel Joseph Koch. Petroselinum segetum ingår i släktet persiljor, och familjen flockblommiga växter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://no.wikipedia.org/wiki/Kalasiris","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/AncientEgypt-LadyApplyingCosmetics-ROM.png","page_title":"Kalasiris","context_page_description":"Kalasiris var en sid, ettersittende kjole av nesten gjennomsiktig lintøy som ble båret av kvinner i det gamle Egypt, både i hoffet og overklassen, blant bønder og håndverkere. Kjolen utviklet seg til en enkel kjortel eller tunika som også ble brukt av menn, da gjerne utenpå schenti, egypternes hvite lendeklede, og under en tynn skulderkappe."},{"page_url":"https://sh.wikipedia.org/wiki/San_Zaccaria_(Venecija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Chiesa_di_San_Zaccaria_Venezia.jpg","page_title":"San Zaccaria (Venecija)","context_page_description":"Chiesa di San Zaccaria je gotičko-renesansna venecijanska crkva u sestieru Castello, na istoimenom trgu. Crkva San Zaccaria se nalazi u centru Venecije blizu Trga svetog Marka i Duždeve palače."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pl%C3%A4tzen_und_Alleen_in_der_Altstadt_von_Regensburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Haus_der_Bayerischen_Geschichte_Regensburg.jpg","page_title":"Liste von Plätzen und Alleen in der Altstadt von Regensburg","context_page_description":"In der Liste sind Plätze, besondere Orte, Alleen und Parks in Regensburg aufgelistet, die im Bereich der zum UNESCO-Welterbe gehörenden Altstadt von Regensburg liegen oder diesem Bereich nah benachbart sind."},{"page_url":"https://lt.wikipedia.org/wiki/JAV_generalinis_atorn%C4%97jus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/AssoJstcJMcK.jpg","page_title":"JAV generalinis atornėjus","context_page_description":"JAV generalinis atornėjus – Jungtinių Valstijų Kabineto narys, generalinis atornėjus, vadovaujantis JAV teisingumo ministerijai. Neturi ministro titulo. Paskirtis – konsultuoti Vyriausybę, prižiūrėti baudžiamojo persekiojimo įstaigas, atstovauti Valstijoms teisme. Skiria JAV Prezidentas, pritarus Senatui."},{"page_url":"https://et.wikipedia.org/wiki/Lordi_v%C3%A4ljak","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Lordi_square.jpg","page_title":"Lordi väljak","context_page_description":"Lordi väljak on väljak Soomes Rovaniemi kesklinnas. Väljakul asub ka kaubanduskeskus Sampokeskus ja jalakäijate tänav. Väljakul toimuvad aastaringi mitmed üritused.\\nVarem kandis väljak nime Sampo väljak, ent see muudeti Lordi järgi ümber 2006. aastal pärast bändi Eurovisiooni lauluvõistluse võitmist samal aastal. 9. juunil 2006 toimus väljakul suur pidu, kus esines ka Lordi.\\nVäljakule on püstitatud tsementkivi, kus peal Lordi liikmete käejäljed ja autogrammid."},{"page_url":"https://es.wikipedia.org/wiki/Estadio_Poljud","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Poljud_-_east_stand.JPG","page_title":"Estadio Poljud","context_page_description":"El Estadio Poljud es un estadio multiusos situado en la ciudad de Split, Croacia. El estadio debe su nombre al barrio de Poljud, ​ donde se encuentra, cerca de la bahía del puerto de Split y tiene una capacidad para 35 000 espectadores.​ En él juega sus partidos como local el Hajduk Split.\\nEl recinto fue construido para albergar los Juegos del Mediterráneo de 1979​ y fue inaugurado por el entonces presidente yugoslavo, Josip Broz Tito. Tenía una capacidad original de 55 000 espectadores que, incluso, se incrementó a 62 000 en 1980.​ El estadio Poljud fue también sede de los Campeonatos de Europa de Atletismo 1990​ y la Copa del Mundo de Atletismo 2010."},{"page_url":"https://en.wikipedia.org/wiki/Office_on_Violence_Against_Women","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Cindy_Dyer.jpg","page_title":"Office on Violence Against Women","context_page_description":"The United States Office on Violence Against Women was created following the Violence Against Women Act of 1994. The Act was renewed in 2005 and again in 2013. The Violence Against Women Act legislation requires the Office on Violence Against Women to work to respond to and reduce violence against women in many different areas, including on college campuses and in people's homes. VAWA requires Office on Violence Against Women to administer justice and strengthen services for victims of domestic violence, dating violence, sexual assault, and stalking.\\nThe Office on Violence Against Women is headed by a director, who is appointed by the President and confirmed by the Senate. The Principal Deputy Director serves directly under the Director as do the Deputy Directors. Until January 2017, Bea Hanson, Ph.D., was the Acting Director and Principal Deputy Director. When Hanson resigned in January 2017, Deputy Director Nadine M. Neufville became Acting Director.\\nAs an office in the United States Department of Justice, the Office on Violence Against Women receives federal funding for federal grants that are awarded to communities across America."},{"page_url":"https://de.wikipedia.org/wiki/Protapion_fulvipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Protapion_fulvipes_%28BG%29_%2833446482610%29.jpg","page_title":"Protapion fulvipes","context_page_description":"Protapion fulvipes ist ein Käfer aus der Familie der Brentidae, Unterfamilie Apioninae, die in die Verwandtschaft der Rüsselkäfer gehört."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Karlshorst","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Stolperstein_Hentigstr_24a_%28Karlh%29_Gertrud_Behrendt.jpg","page_title":"Liste der Stolpersteine in Berlin-Karlshorst","context_page_description":"Die Liste der Stolpersteine in Berlin-Karlshorst enthält die Stolpersteine im Berliner Ortsteil Karlshorst im Bezirk Lichtenberg, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 66 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://en.wikipedia.org/wiki/Colonial_architecture_of_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/BKS_PPS.jpg","page_title":"Colonial architecture of Indonesia","context_page_description":"Dutch colonial architecture in Indonesia were built across the archipelago that once was known as Dutch East Indies. Most of the better and permanent colonial era structures are located in Java and Sumatra, which were economically considered more important during the Dutch imperial period. As a result, there are large number of colonial buildings concentrated in its cities. Plenty of old VOC era forts and warehouses are also scattered throughout the archipelago, particularly around Maluku Islands and Sulawesi. There are three Dutch colonial architectural styles:\\nOld Indies Style\\nIndies Empire style\\nNew Indies Style"},{"page_url":"https://es.wikipedia.org/wiki/Aliobrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Stone_Mountain_town_01.jpg","page_title":"Aliobrix","context_page_description":"Aliobrix fue una fortaleza romana, que estaba situada cerca del actual pueblo de Orlivka, en el raión de Reni de la óblast de Odesa, Ucrania."},{"page_url":"https://pt.wikipedia.org/wiki/Visbur","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Visbur_-_Iohannes_Magnus_1554%27s_edition.png","page_title":"Visbur","context_page_description":"Visbur foi um rei lendário dos Suíones no século II da Casa dos Inglingos."},{"page_url":"https://it.wikipedia.org/wiki/Cratere_Jacobi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Jacobi_lunar_crater_map.jpg","page_title":"Cratere Jacobi","context_page_description":"Jacobi è un cratere lunare intitolato al matematico tedesco Carl Jacobi; è situato negli altopiani meridionali della faccia visibile del satellite. Giace a sudest del cratere Lilius, con il cratere Cuvier a nord-nordovest e il cratere Bacone a nordest. Jacobi ha un diametro di 68 km e una profondità di 3,3 km; è del periodo Pre-Nettariano, un'era che va da 4550 a 3920 milioni di anni fa circa.\\nIl cratere ha un bordo consumato ricoperto da numerosi altri crateri lungo il lato meridionale, incluso 'Jacobi J', e un paio nella parte settentrionale. Il risultato è un margine esterno che appare appiattito lungo il perimetro a nord e a sud. Il più grande dei crateri sul bordo settentrionale, 'Jacobi O', fa parte di una catena di crateri costituenti grossomodo una linea che attraversa la superficie interna da nordest a sudovest. In particolare, la parte centrale di questa catena forma una fusione di numerosi piccoli crateri nel mezzo della superficie. L'area rimanente è livellata, forse come risultato dell'erosione o di materiali depositati.\\nLa tripletta di crateri sovrapposti 'Jacobi F', 'Jacobi E' e 'Jacobi G', costituisce una linea a sud del cratere principale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BD%D0%B5%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD,_%D0%AE%D1%85%D0%B0%D0%BD_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/JV-Snellman-1956.jpg","page_title":"Снельман, Юхан Вильгельм","context_page_description":"Ю́хан Ви́льгельм Сне́льман — российский и финский философ, писатель, журналист, общественный и государственный деятель, идеолог финского национального движения, один из известнейших фенноманов XIX века. Сыграл ключевую роль в становлении финского языка в качестве государственного языка Финляндии и финской марки в качестве финской национальной валюты."},{"page_url":"https://de.wikipedia.org/wiki/Ostror%C3%B3g_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mikolaj_Ostrorog_%281593-1651%29.jpg","page_title":"Ostroróg (Adelsgeschlecht)","context_page_description":"Ostroróg ist ein polnisches Adelsgeschlecht der Wappengemeinschaft Nałęcz. Es gehörte zu den einflussreichsten Familien in Großpolen. Sie stellten Wojwoden, Kastellane und besetzten sogar das Amt des großpolnischen Generalstarosten und übernahmen, bei Abwesenheit des Königs, teilweise die Regentschaft des Königreichs Polen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%8C%A6%E8%B1%90%E8%8B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kam_Fung_Court_Landscape_Garden_View1_2014.jpg","page_title":"錦豐苑","context_page_description":"錦豐苑，是香港房屋委員會的居屋屋苑之一，位於新界沙田區的馬鞍山西沙路638號，頌安邨隔鄰的填海地上，由王董建築師事務有限公司設計，由7座和諧式1型及2座和諧式2型設計的樓宇組成，共有5,540個住宅單位。錦豐苑共分3期發展，分別於1996年、1997年及2002年建成，居屋第17期甲及第17期乙於1997年分期入伙，而錦莉閣、錦荷閣及錦蘭閣則屬出售剩餘居屋第3期及第4期。\\n2007年6月29日時任中共中央總書記、國家主席胡錦濤到訪錦豐苑的市民趙錫明家。\\n在2003年之前，錦豐苑屬於沙田區議會錦豐選區，當時區議員是民建聯香港立法會議員陳克勤。2003年區議會選舉與雅濤居、迎濤灣等私人屋苑組成一個區議會選區錦濤選區，區議員是何淑萍。2008年至2015年該區區議員為民建聯楊文銳。2016年至2019年該區區議員為獨立民主派人士陳國強。2020年起該區區議員為馬鞍山守護線許立燊。"},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Notre-Dame-du-Rosaire_(Girardota)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Catedral_de_Girardota-Fachada_Frontal.JPG","page_title":"Cathédrale Notre-Dame-du-Rosaire (Girardota)","context_page_description":"La Cathédrale Notre-Dame-du-Rosaire est la cathédrale de culte catholique romain située à Girardota, dans le département d'Antioquia, en Colombie."},{"page_url":"https://es.wikipedia.org/wiki/Obras_de_arte_perdidas","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Meyer-de-haans-autoportrait-circa-1889--91.jpg","page_title":"Obras de arte perdidas","context_page_description":"Las obras de arte perdidas son aquellas piezas de arte originales que alguna vez existieron, según fuentes creíbles, pero que actualmente no pueden ser localizadas en museos o colecciones privadas o de las que consta su destrucción, bien sea deliberadamente, accidentalmente o por negligencia.\\nEl FBI de los Estados Unidos mantiene una lista pública con los 10 casos más importantes de obras de arte robadas y para cuya resolución se solicita información y colaboración ciudadana. Esta lista, junto a un libro de 2006 de Simon Houpt ​ y varias otras listas de medios de comunicación han perfilado las pérdidas pendientes más significativas.​"},{"page_url":"https://fi.wikipedia.org/wiki/Vuoriherttu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Hunter%27s_Cisticola_-_Kenya_S4E7660_%2817113274127%29.jpg","page_title":"Vuoriherttu","context_page_description":"Vuoriherttu on herttujen heimoon kuuluva varpuslintu."},{"page_url":"https://fr.wikipedia.org/wiki/Pile_de_Cinq-Mars","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Pile_CM_mur_nord-sud.svg","page_title":"Pile de Cinq-Mars","context_page_description":"La pile de Cinq-Mars est une tour pleine antique qui domine la vallée de la Loire sur le territoire de la commune de Cinq-Mars-la-Pile en Indre-et-Loire, à une vingtaine de kilomètres à l'ouest de Tours.\\nLa tour, haute de près de 30 mètres et exceptionnellement bien conservée, se dresse au flanc d'un coteau le long duquel les preuves d'occupation humaine à l'époque antique sont nombreuses.\\nCe très probable monument funéraire est à rapprocher du groupe hétérogène des édifices analogues rencontrés dans le Sud-Ouest de la France, notamment en Charente-Maritime et dans le Gers. Il en diffère toutefois par son architecture — un parement en briques recouvre un noyau de maçonnerie — et son décor composé de douze panneaux décorés de motifs géométriques dont la signification est inconnue mais qui en font un monument unique en France. Son implantation, en dehors d'un enclos funéraire, semble également inhabituelle.\\nCe monument est célèbre depuis longtemps : Rabelais y fait par exemple allusion dans Gargantua."},{"page_url":"https://de.wikipedia.org/wiki/Viersen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Einwohnerentwicklung_von_Viersen.svg","page_title":"Viersen","context_page_description":"Die Stadt Viersen liegt am linken Niederrhein im Westen des Landes Nordrhein-Westfalen und ist eine Große kreisangehörige Stadt des Kreises Viersen im Regierungsbezirk Düsseldorf. Die Stadt ist Sitz des Kreises Viersen. Entgegen der weit verbreiteten Meinung leitet sich der Stadtname nicht von „vier Seen“ ab, sondern von dem alten Namen „Viers“ des heute so genannten „Dorfer Bachs“ in der Nähe der „Kaisermühle“."},{"page_url":"https://fr.wikipedia.org/wiki/Janina_Konarska","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Janina_Konarska-Slonimska_Polish_painter.jpg","page_title":"Janina Konarska","context_page_description":"Janina Konarska, née le 30 avril 1900 à Łódź, est une artiste peintre et une sculptrice polonaise. Lors des compétitions artistiques aux Jeux olympiques de 1932, elle emporte la médaille d'argent, dans la catégorie peinture, option gravure, pour son œuvre Stadium.\\nIssue d'une famille d'origine juive appelée Seideman, elle se convertit au catholicisme et prend pour nom professionnel Konarska, en 1924, tout comme sa famille. Elle épouse, en 1934, le poète, journaliste et dramaturge Antoni Słonimski. Elle meurt le 9 juin 1975 à Varsovie en Pologne.\\nElle apparaît dans un film de 1926 : Szczesliwy wisielec, czyli Kalifornia w Polsce."},{"page_url":"https://ro.wikipedia.org/wiki/%C8%98tefan_Octavian_Iosif","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Stefan_Octavian_Iosif_si_Dimitrie_Anghel.jpg","page_title":"Ștefan Octavian Iosif","context_page_description":"Ștefan Octavian Iosif a fost un poet și traducător român, membru fondator al Societății Scriitorilor Români."},{"page_url":"https://vi.wikipedia.org/wiki/Dryopteris_intermedia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Evergreen-Wood-Fern-cluster_%282997699370%29.jpg","page_title":"Dryopteris intermedia","context_page_description":"Dryopteris intermedia là một loài thực vật có mạch trong họ Dryopteridaceae. Loài này được A. Gray miêu tả khoa học đầu tiên năm 1848."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%BE%D0%B2%D0%BD%D1%8B%D0%B5_%D0%BC%D0%B0%D0%BD%D0%B5%D0%B2%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/ru/b/be/Manewry_mi%C5%82osne.jpg","page_title":"Любовные маневры","context_page_description":"«Любовные маневры» другое назвавание «Любовные маневры или дочь полка» — польский чёрно-белый фильм, романтическая комедия 1935 года, снятая режиссёрами Яном Новина-Пшибыльским и Конрадом Тома на киностудии «Kinofilm Lwów».\\nПремьера фильма состоялась 23 декабря 1935 года."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B4%B9%E5%9F%8E%E7%AE%A1%E5%BC%A6%E4%B9%90%E5%9B%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Charles_Dutoit_and_the_Philadelphia_Orchestra_concert_in_Tianjin.jpg","page_title":"费城管弦乐团","context_page_description":"费城管弦乐团是美国宾夕法尼亚州的一支管弦乐团，它也是美国五大管弦乐团之一。\\n乐团1900年由Fritz Scheel创办并指挥。1907年Karl Pohlig上任。列奥波德·斯托科夫斯基在1912年上任，乐团自此开始成名。\\n1938年尤金·奥曼迪担任首席指挥。他与乐团合作超过40年，录下很多经典名盘。\\n接替他的是里卡多·穆蒂 和沃尔夫冈·萨瓦利希，后者有多年在慕尼黑巴伐利亚国家歌剧院担任音乐总监的经验。\\n目前乐团的首席指挥是克里斯托弗·埃申巴赫。\\n而在唱片方面，乐团因为合同冲突，也会以罗宾汉·戴尔乐团Robin Hood Dell Orchestra演出。\\n2011年4月16日，乐团董事会决议申请破产保护。"},{"page_url":"https://en.wikipedia.org/wiki/Svetlana_Goryacheva","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%93%D0%BE%D1%80%D1%8F%D1%87%D0%B5%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%BB%D0%B0%D0%BD%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0.jpg","page_title":"Svetlana Goryacheva","context_page_description":"Svetlana Petrovna Goryacheva is a Russian stateswoman and political figure. She is a deputy of the State Duma from the party A Just Russia, in which she serves as Deputy Chairman of the Committee on Rules and Organization and the deputy parliamentary leader of A Just Russia. Goryacheva was born in Risovy, a village in Anuchinsky District, Primorsky Krai.\\nShe has been a deputy of the State Duma since 1995. She is also a member of the Parliamentary Assembly of the Council of Europe.\\nSince September 2014, she has represented the Administration of Primorsky Territory in the Federation Council. First Deputy Chairman of the Federation Council Committee on Rules and Organization of parliamentary activity."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B3%D9%BE%D9%86%D8%B3%D8%B1_%D8%A8%D9%84%D9%88%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Spencer_Bloch.jpg","page_title":"اسپنسر بلوچ","context_page_description":"اسپنسر بلوچ بیلیم اینسان. ۲۲ مئی ۱۹۴۴ تاریخینده دۆنیایا گؤز آچیب. اسپنسر بلوچ کولمبیا بیلیم‌یوردودا درس اوْخویوب. چالیشدیغی یئرلریندن بیری شیکاقو بیلیم‌یوردو‌دیر. اوْ ریاضیات ساحه‌سینده چالیشیب."},{"page_url":"https://en.wikipedia.org/wiki/List_of_courthouses_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bourbon_county%2C_kentucky_courthouse.jpg","page_title":"List of courthouses in the United States","context_page_description":"This is a list of courthouses in the United States. American courthouses are very often significant, as they are public buildings usually built to convey solidity and to command respect. Many have hosted important trials, or are significant for their architecture, and thus many have been designated as historic sites.\\nThis list includes state, county, city, town and other municipalities' courthouses, as well as subsuming U.S. Federal courthouses. There are no known courthouses of international scope located in the U.S."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Eilenburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Eilenburg_Mietshaus_R%C3%B6berstra%C3%9Fe_1a.jpg","page_title":"Liste der Kulturdenkmale in Eilenburg","context_page_description":"In der Liste der Kulturdenkmale in Eilenburg sind die Kulturdenkmale der sächsischen Stadt Eilenburg verzeichnet, die bis Mai 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Nordsachsen."},{"page_url":"https://fr.wikipedia.org/wiki/Der_Judenstaat","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/DE_Herzl_Judenstaat_01.jpg","page_title":"Der Judenstaat","context_page_description":"Der Judenstaat est le titre du livre publié en 1896 par Theodor Herzl, considéré comme le fondateur du sionisme, dans lequel ce dernier analyse la question des Juifs et tient pour acquis les faits que :\\nles peuples du monde ne pourront supporter, à longue échéance, ni le Peuple d'Israël en leur sein, ni son particularisme religieux, ni ses leaders, ni sa mentalité ;\\nl'antisémitisme grandissant, à la base du réveil national du Peuple d'Israël, obligera, tôt ou tard, les peuples du monde à trouver une solution adéquate à ce problème. Il faut 6 semaines à Herzl pour écrire son livre Der Judenstaat, en 1895, et ce dans un contexte d'inspiration intense.\\nDans son livre, Herzl propose un programme détaillé de la création d'un État pour les Juifs, avec son organisation interne et ses institutions. Theodor Herzl y défend l'idée de restaurer sous une forme moderne l'entité nationale juive qui avait existé en Palestine à l'époque antique. Seul cet État national juif offrirait une solution au problème de l'antisémitisme."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D0%BE%D0%B2%D0%B0_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA%D0%B0_%D0%A1%D1%96%D0%B2%D0%B5%D1%80%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%94%D1%96%D0%BD%D1%86%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Borova_river-1.jpg","page_title":"Борова (притока Сіверського Дінця)","context_page_description":"Борова — річка в Україні, ліва притока річки Сіверський Донець. Довжина 84 км. Площа водозбірного басейну 1 960 км². Похил 1 м/км. Долина асиметрична, завширшки до 3 км в пониззі 2 км. Річище звивисте, шириною 2—6,5 м. Є стариці. Використовується на зрошення, господарсько-побутове водопостачання, рекреація.\\nБере початок біля с. Кругле. Тече по території Сватівського, Старобільського, Кремінського та та міста Сєверодонецьк Луганської області. Споруджено невеликі водосховища, багато ставків. На берегах річки численні бази відпочинку.\\nПритоки: Баглай, Гнила Плотва, Плотва, Філева Плотва, Конопляний Яр, Сухий Яр, Єрик; Боровик."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9C%8D%E4%BA%A8%E7%B4%A2%E4%BC%A6%E5%9F%8E%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Corona_Prusia-mj2.jpg","page_title":"霍亨索伦城堡","context_page_description":"霍亨索倫城堡是德國南部最著名的兩大城堡之一，與巴伐利亞州的新天鵝堡齊名於世。"},{"page_url":"https://de.wikipedia.org/wiki/Mid-American_Conference","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/AlumniArena2.jpg","page_title":"Mid-American Conference","context_page_description":"Die Mid-American Conference ist eine aus zwölf Universitäten bestehende Liga für diverse Sportarten, die in der NCAA Division I spielen. Im College Football spielen die Teams in der Football Bowl Subdivision."},{"page_url":"https://en.wikipedia.org/wiki/Thila_(crater)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Wikithila.jpg","page_title":"Thila (crater)","context_page_description":"Thila is an impact crater on Mars, located in the Elysium quadrangle at 18.09° N and 204.58° W. It measures approximately 5.3 kilometers in diameter and was named after the village of Thila in Yemen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%94%D0%BE%D0%BC%D1%96%D0%BD%D1%96%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Northern_Parula_by_Dan_Pancamo.jpg","page_title":"Список птахів Домініки","context_page_description":"Цей список є списком видів птахів, спостережених на території Домініки. Він включає 195 видів, з них 2 види є ендеміками, 6 завезених людьми, 121 вид є рідкісними або випадковими залітними та 1 вимерлий на острові."},{"page_url":"https://es.wikipedia.org/wiki/Virgen_del_Carmen_de_Cuyo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Escapulario_06.jpg","page_title":"Virgen del Carmen de Cuyo","context_page_description":"Nuestra Señora del Carmen de Cuyo es una advocación mariana de la provincia de Mendoza, Argentina. Es patrona y generala del Ejército de los Andes, patrona de la Educación de Mendoza, y patrona de la VIII Brigada de Montaña."},{"page_url":"https://en.wikipedia.org/wiki/List_of_legendary_creatures_in_Hindu_mythology","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Srikrishn_fights_with_Banasura.jpg","page_title":"List of legendary creatures in Hindu mythology","context_page_description":"This is a list of legendary creatures from Hindu and Greek folklore and fairy tales, sorted by their classification or affiliation."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%A9%DB%8C%D9%BE_%DA%AF%D8%B1%DB%8C%D8%B3%D8%A8%D9%88%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Southafrica-capegrysbok.jpg","page_title":"کیپ گریسبوک","context_page_description":"کیپ گریسبوک گانواں ٹبر دے اک نکے ٹبر غزالاں دا اک جانور اے۔"},{"page_url":"https://cs.wikipedia.org/wiki/Nebamun","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Nebamun_tomb_fresco_dancers_and_musicians.png","page_title":"Nebamun","context_page_description":"Nebamun byl egyptský úředník za Nové říše. Předpokládá se, že žil zhruba 1350 př. n. l. a pracoval v chrámovém komplexu poblíž Théb. Jeho jméno znamená v překladu „Můj pán je Amun“.\\nNebamun je dnes známý hlavně díky objevu jeho bohatě zdobené hrobky v Thébách. Ačkoliv je lokace hrobky dnes ztracena, v Britském muzeu jsou některé malby vystaveny. Jsou považovány za nejcennější sbírky tohoto muzea."},{"page_url":"https://en.wikipedia.org/wiki/Triangle_of_auscultation","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/VHM_Triangle_of_Auscultation_CS.png","page_title":"Triangle of auscultation","context_page_description":"The triangle of auscultation of the lungs is a relative thinning of the musculature of the back, situated along the medial border of the scapula."},{"page_url":"https://hu.wikipedia.org/wiki/Gal%C3%A9ria_(Haute-Corse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Population_-_Municipality_code_2B121.svg","page_title":"Galéria (Haute-Corse)","context_page_description":"Galéria település Franciaországban, Haute-Corse megyében. Galéria Calenzana községekkel határos."},{"page_url":"https://pl.wikipedia.org/wiki/Micha%C5%82_Blaicher","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Micha%C5%82_Blaicher_1920.jpg","page_title":"Michał Blaicher","context_page_description":"Michał Joachim Blaicher – major pilot obserwator Wojska Polskiego, inżynier, konstruktor szybowcowy, pilot doświadczalny."},{"page_url":"https://nl.wikipedia.org/wiki/Frans_Hermsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Frans_Hermsen_%281981%29.jpg","page_title":"Frans Hermsen","context_page_description":"Franciscus Johannes Hermsen was een Nederlands politicus van de KVP en later het CDA.\\nHij is burgemeester geweest van de gemeenten Eibergen, Nieuwegein en Nijmegen.\\nHermsen haalde zijn diploma aan het Isendoorn College destijds nog gevestigd in Zutphen.\\nHij trouwde 4 september 1952 in Hazerswoude en werd vader van drie kinderen.\\nVan 16 mei 1964 tot 1 juli 1971 was Hermsen burgemeester van de gemeente Eibergen. Daarvoor was hij gemeentesecretaris van Zoetermeer. In Eibergen stond hij als een bijzonder actieve burgemeester bekend. Hij realiseerde onder ander het nieuwe openluchtzwembad 't Vinkennest in Eibergen.\\nHermsen was de eerste burgemeester van Nieuwegein. Ruim zeven jaar bekleedde hij dit ambt. Hij stond bekend als een markant persoon en een 'aanpakker'. Zo stak hij veel energie in en speelde hij een belangrijke rol bij de groei van Nieuwegein. Hij is voorts een belangrijke stuwende kracht geweest bij de aankoop van het landgoed Oudegein en bij de komst van de sneltramlijn. Ook heeft hij eraan bijgedragen dat de toenmalige rijksweg 24 ten oosten van Nieuwegein kwam te liggen en niet dwars door de stad.\\nIn 1978 vertrok Hermsen naar Nijmegen."},{"page_url":"https://de.wikipedia.org/wiki/Rudolf_Gehring_(Politiker,_1948)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Heinz-Christian_Strache%2C_Hannelore_Schuster%2C_Rudolf_Gehring_2009.jpg","page_title":"Rudolf Gehring (Politiker, 1948)","context_page_description":"Rudolf Gehring ist ein österreichischer Politiker und war Kandidat für die österreichische Bundespräsidentenwahl 2010."},{"page_url":"https://mg.wikipedia.org/wiki/Halle_(Saale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Coat_of_arms_of_Halle_%28Saale%29.svg","page_title":"Halle (Saale)","context_page_description":"Halle (Saale) dia tanàna ao Alemaina. Ny tanàna no misy ao amin'ny Sachsen-Anhalt. Misy, 236.991 ny olona velona."},{"page_url":"https://es.wikipedia.org/wiki/Kiajta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Kyahta.s_gory.JPG","page_title":"Kiajta","context_page_description":"Kiajta es una ciudad de Rusia perteneciente a la república de Buriatia. Está situada a orillas del río Kiajta y muy próxima a la frontera con Mongolia. Además de la ciudad de Kiajta, la ciudad también incluye Troitskosavsk, situada tres kilómetros al norte, y Ust-Kiajta, a 16 kilómetros."},{"page_url":"https://fr.wikipedia.org/wiki/Teodor_Llorente_Olivares","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Retrat_de_Teodor_Llorente_i_Olivares%2C_1872.jpg","page_title":"Teodor Llorente Olivares","context_page_description":"Teodor Llorente Olivares, né à Valence le 7 janvier 1836 et mort le 2 juin 1911, est un écrivain, avocat et homme politique valencianiste. Il est considéré comme le principal poète de la Renaixença au Pays valencien."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%95%E3%82%A8%E3%83%A0%E3%81%B2%E3%82%89%E3%81%8B%E3%81%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/FMhirakata_Ekinaka_studio.jpg","page_title":"エフエムひらかた","context_page_description":"エフエムひらかたは大阪府枚方市にあるコミュニティFMである。"},{"page_url":"https://fr.wikipedia.org/wiki/Vityaz-SN","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/%D0%9F%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D0%B5%D1%82-%D0%BF%D1%83%D0%BB%D0%B5%D0%BC%D0%B5%D1%82_%D0%9F%D0%9F-19-01_%D0%92%D0%B8%D1%82%D1%8F%D0%B7%D1%8C-%D0%A1%D0%9D_-_%D0%9E%D0%A1%D0%9D_%D0%A1%D0%B0%D1%82%D1%80%D1%83%D0%BD_13.jpg","page_title":"Vityaz-SN","context_page_description":"La Vityaz-SN est un Pistolet-mitrailleur d'origine russe utilisant la munitions 9 × 19 mm Parabellum développée par la firme izhmash dès 2004 et produite depuis 2008. Cette arme issue directement de la PP-19 Bizon et inspirée de l'iconique AK-47 est appréciée pour sa robustesse et figure comme le Pistolet-mitrailleur de base des Forces armées de la fédération de Russie et de la Police russe."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%B0%D0%B7%D0%BE%D0%B2_%D0%B3%D0%B8%D0%B3%D0%B0%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Gas_giants_in_the_solar_system.jpg","page_title":"Газов гигант","context_page_description":"Газовият гигант представлява голяма на размери и маса планета, по-голямата част от обема на която бива заеман от газове като водород и хелий в течно или газообразно състояние. За газовите гиганти се счита, че имат ядро, състоящо се от силикатни скали и метали. То трябва да е достатъчно голямо, за да може силната му гравитация да позволи първоначалното концентриране на материал. За разлика от земеподобните планети, газовите гиганти нямат ясно изразена повърхност. Обикновено при изчисления на диаметъра, обема и повърхностната им температура бива използвано ниво в атмосферата им, имащо налягане съответстващо на земното „морско равнище“.\\nВ Слънчевата система са известни четири газови гиганта: Юпитер, Сатурн, Уран и Нептун.\\nУран и Нептун формират свой собствен клас – ураноподобни планети или ледени гиганти – поради факта, че по-голямата част от масата на планетите е под формата на различни видове ледове и скални материали, за разлика от преобладаващите по маса газове в Юпитер и Сатурн. Уран и Нептун имат много по-малко водород и хелий най-вече поради голямата си отдалеченост от Слънцето."},{"page_url":"https://da.wikipedia.org/wiki/Bombycilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Bohemian_Wax_Wing.jpg","page_title":"Bombycilla","context_page_description":"Bombycilla er en lille slægt af spurvefugle med karakteristisk silkebløde fjer og en fjertop på hovedet. De yngler i de subarktiske dele af Europa, Asien og Nordamerika. Danmark gæstes i vinterhalvåret af silkehalen, Bombycilla garrulus.\\nVingerne er lange og spidse, halen er lige afskåret og næbbet er kort med bred basis. Fodens tarse er kort."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B4%E5%AE%89%E5%B2%AD%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Khingan_Range_Railway_Station.jpg","page_title":"兴安岭站","context_page_description":"兴安岭站是位于内蒙古自治区呼伦贝尔市牙克石市兴安岭村、兴安岭隧道北口的一个铁路车站，邮政编码022179。车站建于1901年，有滨洲铁路经过该站，现办理客运货运业务，车站及其上下行区间均已电气化。车站距离哈尔滨站564公里，隶属哈尔滨铁路局海拉尔车务段，是四等站。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Yverdon-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Yverdon_Rue_du_Lac_6.JPG","page_title":"Liste der Kulturgüter in Yverdon-les-Bains","context_page_description":"Die Liste der Kulturgüter in Yverdon-les-Bains enthält alle Objekte in der Gemeinde Yverdon-les-Bains im Kanton Waadt, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://sv.wikipedia.org/wiki/Vindkraftverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Wind_turbine-1_hg.jpg","page_title":"Vindkraftverk","context_page_description":"Vindkraftverk är en maskinkonstruktion som omvandlar kinetisk energi ur vinden till elektricitet. Vindkraftverk består av ett stationärt torn med en rotor som snurrar genom påverkan av vindens kraft. Rotorn driver en generator som producerar el som överförs till elnätet. Ett vindkraftverk är beroende av vindens energitillförsel och ger därför en varierande effekt."},{"page_url":"https://mg.wikipedia.org/wiki/Saint-Maurice-de-Gourdans","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Blason_de_la_ville_de_Saint-Maurice-de-Gourdans_%28Ain%29.svg","page_title":"Saint-Maurice-de-Gourdans","context_page_description":"I Saint-Maurice-de-Gourdans dia kaominina ao amin'ny fivondronan'i Bourg-en-Bresse, ao amin'ny departemantan'i Ain, ao amin'ny faritr'i Auvergne-Rhône-Alpes, ao Frantsa.\\nNy INSEE dia mampiasa ny kaodim-paositra 01378.\\nI Fabrice Venet no ben'ny tanàna mandritry ny taona 2008–2014. Ilay kaominina dia kaominina mpikambana amin'ny fivondronan-kaominin'i Plaine de l'Ain"},{"page_url":"https://pt.wikipedia.org/wiki/Fraxern","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/FraxernVlbg1.JPG","page_title":"Fraxern","context_page_description":"Fraxern é um município da Áustria, situado no distrito de Feldkirch, no estado de Vorarlberg. Tem 8 86 km² de área e sua população em 2019 foi estimada em 715 habitantes."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B9%D1%81%D0%BA%D0%B0_%D0%BF%D1%82%D0%B8%D1%86%D0%B0_(%D1%80%D0%B0%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Starr_030612-0018_Caesalpinia_pulcherrima.jpg","page_title":"Райска птица (растение)","context_page_description":"Райска птица, известна и като пауново цвете, червена райска птица, мексиканска райска птица и гордостта на Барбадос, е вид цъфтящо растение от семейството на грахови, Fabaceae, родом от тропиците и субтропиците на Америка. Може да е по произход и от Западната Индия, но това е недоизяснено поради широкото му отглеждане."},{"page_url":"https://de.wikipedia.org/wiki/Dorand_AR.2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Dorand_AR_2_dwg.jpg","page_title":"Dorand AR.2","context_page_description":"Die Dorand AR.2 war ein französisches Militärflugzeug, das im Ersten Weltkrieg zum Einsatz kam."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%83%E5%9F%94%E7%AB%99_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Entrance_and_exit_C1_of_Whampoa_Station_before_opening.jpg","page_title":"黃埔站 (香港)","context_page_description":"黃埔站是港鐵觀塘綫的一個鐵路站，位於香港九龍城區紅磡黃埔，主要服務黃埔新邨及黃埔花園一帶，較位於紅磡灣的紅磡站更接近紅磡，為觀塘綫的下行終點站。車站所在的位置，鄰近紅磡昔日的一座大型船塢「黃埔船塢」，該船塢先後於1970及80年代經城都地產及和記黃埔改建為大型住宅屋苑黃埔新邨及黃埔花園，車站故被命名為黃埔站。"},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A9rification_des_faits","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Walter_Annenberg_1981.jpg","page_title":"Vérification des faits","context_page_description":"La vérification des faits est une technique consistant d'une part à vérifier en temps instantané la véracité des faits et l'exactitude des chiffres présentés dans les médias par des personnalités politiques et des experts, d'autre part à évaluer le niveau d'objectivité des médias eux-mêmes dans leur traitement de l'information. Cette notion est apparue aux États-Unis dans les années 1990 sous l'appellation de fact checking ou fact-checking.\\nMise en pratique par des journalistes d'investigation dans le cadre de leur profession, la méthode s'est démocratisée grâce à des logiciels aidant les particuliers à vérifier les faits. Elle s'est même automatisée avec l'apparition en 2013 de robots conçus pour la pratiquer sans intervention humaine. Et dans la mesure où la majorité des bidonnages, des trollages et des canulars sont diffusés sur les réseaux sociaux, Facebook et Twitter eux-mêmes y recourent depuis 2016."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%DB%8C_%D9%85%D9%86%D8%B7%D9%82%D9%87%E2%80%8C%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hasfield_Parish_Church.jpg","page_title":"کلیسای منطقه‌ای","context_page_description":"در نظام کلیسای انگلیکن، کلیسای منطقه‌ای بنایی است که کوچکترین واحد مذهبی و کلیسای اهالی یک کشیش‌نشین محسوب می‌شود و کشیشی مسئول ادارهٔ آن است."},{"page_url":"https://en.wikipedia.org/wiki/Industry_of_Bulgaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Kremikovtsi.JPG","page_title":"Industry of Bulgaria","context_page_description":"Bulgaria is an industrialized nation with a developed heavy and light manufacturing industry. In 2007 industry accounted for 31.7% of the country's GDP. This makes industry the second largest sector of the economy after services. In 2007 the sector employed 33.6% of the labour force."},{"page_url":"https://fy.wikipedia.org/wiki/Oberwesel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/DEU_Oberwesel_COA.svg","page_title":"Oberwesel","context_page_description":"Oberwesel is in stêd oan de Middelryn yn de Dútske dielsteat Rynlân-Palts yn it Rhein-Hunsrück-Kreis. De stêd heart by de Verbandsgemeinde Sankt Goar-Oberwesel, wêrfan't it bestjoer hjir sit hat."},{"page_url":"https://en.wikipedia.org/wiki/Centre_for_Eastern_Studies","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Koszykowa_6a.jpg","page_title":"Centre for Eastern Studies","context_page_description":"Centre for Eastern Studies is a Warsaw-based think tank that undertakes independent research on the political, economic and social situation in Central and Eastern Europe, Balkans, Caucasus and Central Asia.\\nThe Centre was founded in 1990 and is fully financed from the Polish state budget. In 2006 the Centre was named in honour of its founder Marek Karp.\\nThe OSW is the largest of the European Union’s think tanks to focus its research on the part of Europe which until 1989 had been separated from the West by the Iron Curtain.\\nThe Centre is particularly active in debates concerning the European Union's policy towards its Eastern neighbours, challenges to energy security in Europe, as well as the political, social and economic transformation of countries neighbouring Poland."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%AA%D8%AC%D8%A7%D9%87%D8%A7%D8%AA_%D8%A7%D9%84%D8%A8%D9%88%D8%B5%D9%84%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/32-point_compass_%28traditional_winds%29.svg","page_title":"اتجاهات البوصلة","context_page_description":"اتجاهات البوصلة هي عملية تسمية جميع النقاط الاثنين والثلاثين في اتجاه عقارب الساعة الموجودة في البوصلة بالترتيب. وتتشكل هذه الأسماء من خلال أوائل الاتجاهات السماوية والاتجاهات الترتيبية المتوسطة، التي تعد وسيلة مفيدة جدًا للإشارة إلى اتجاه بطريقة عامة أو عامية، دون الحاجة إلى اللجوء إلى الحوسبة أو درجات التذكير. وفي معظم التطبيقات، حلت الدرجات التي تقيس اتجاه عقارب الساعة من الشمال محل النقاط البسيطة."},{"page_url":"https://en.wikipedia.org/wiki/Indian_vernacular_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/WOODEN_HAVELI.jpg","page_title":"Indian vernacular architecture","context_page_description":"Indian vernacular architecture the informal, functional architecture of structures, often in rural areas of India, built of local materials and designed to meet the needs of the local people. The builders of these structures are unschooled in formal architectural design and their work reflects the rich diversity of India's climate, locally available building materials, and the intricate variations in local social customs and craftsmanship. It has been estimated that worldwide close to 90% of all building is vernacular, meaning that it is for daily use for ordinary, local people and built by local craftsmen.\\nThe term vernacular architecture in general refers to the informal building of structures through traditional building methods by local builders without using the services of a professional architect. It is the most widespread form of building.\\nIn India there are numerous traditional regional styles, although there is much in common in the styles of the Hindi belt in the north."},{"page_url":"https://it.wikipedia.org/wiki/Cinque_giornate_di_Milano","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Cattaneo_cernuschi_20_marzo_1848.jpg","page_title":"Cinque giornate di Milano","context_page_description":"Con Cinque giornate di Milano si fa riferimento all'insurrezione armata avvenuta tra il 18 e il 22 marzo 1848 nell'allora capitale del Regno Lombardo-Veneto che portò alla temporanea liberazione della città dal dominio austriaco.\\nFu uno dei moti liberal-nazionali europei del 1848-1849, nonché uno degli episodi della storia risorgimentale italiana del XIX secolo, preludio all'inizio della prima guerra d'indipendenza italiana: la rivolta, infatti, influenzò le decisioni del re di Sardegna Carlo Alberto che, dopo aver a lungo esitato, approfittando della debolezza degli Austriaci in ritirata, dichiarò guerra all'Impero austriaco dando inizio alla prima guerra d'indipendenza italiana."},{"page_url":"https://de.wikipedia.org/wiki/Rh%C3%A4den_bei_Obersuhl_und_Bosserode","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/%E2%80%9ERh%C3%A4den_bei_Obersuhl_und_Bosserode%E2%80%9C_im_Kreis_Hersfeld-Rotenburg_%285%29.jpg","page_title":"Rhäden bei Obersuhl und Bosserode","context_page_description":"Der Rhäden bei Obersuhl und Bosserode liegt in einer Senke im Tal der Werra im hessisch-thüringischem Grenzland. Auslaugungen von Kalisalzen aus dem, aus marinen Sedimenten entstandenem Zechstein und tektonische Vorgänge haben hier zu einem schrittweisen Nachsacken des Untergrunds geführt. Die einstige Sumpflandschaft wurde ab der Mitte des 19. Jahrhunderts trockengelegt und bis in die Nachkriegszeit bearbeitet. Mit dem Ausbau der DDR-Grenzanlagen verfiel das Entwässerungssystem, was zur Aufgabe der landwirtschaftlichen Nutzung führte. In den 1970er Jahren begannen Naturschützer mit den Arbeiten zur Rückführung des Rhädens zu einem Feuchtbiotop, um den in ihrem Bestand bedrohten Pflanzen- und Tierarten einen angemessenen Lebensraum zu sichern. Nach abgeschlossener Rekultivierung war eine Auenlandschaft entstanden, in der stark geschützte Arten wie Kammmolch, Bitterling und Dunkler Wiesenknopf-Ameisenbläuling ein Refugium finden. Vor allem jedoch für Vogelarten ist der Rhäden als Brut-, Nahrungs- und Rastgebiet von überregionaler Bedeutung."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Rzhev_COA_%28Tver_Governorate%29_%281780%29.png","page_title":"Тверская губерния","context_page_description":"Тверская губерния — административно-территориальная единица в 1796—1917 в составе Российской империи, в 1917—1929 — в составе РСФСР.\\nБыла расположена в центральной России, граничила с Московской и Смоленской губерниями — на юге, Новгородской и Вологодской губерниями — на севере, Псковской губернией — на западе, Ярославской — на востоке и Владимирской на юго-востоке.\\nПлощадь 56 837 вёрст².\\nТверская губерния была образована в 1796 году на месте Тверского наместничества, учреждённого 25 ноября 1775 года.\\nЦентром губернии был город Тверь."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%92%D1%8F%D0%BB%D0%B5%D0%B9%D1%81%D0%BA%D0%B0-%D0%9C%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D1%81%D1%8B%D1%81%D1%82%D1%8D%D0%BC%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Kana%C5%82_Vialejska-Mienskaj_vodnaj_systemy_-_2.jpg","page_title":"Вялейска-Менская водная сыстэма","context_page_description":"Вялейска-Менская водная сыстэма — сыстэма водазабесьпячэньня Менску пасродкам перакіду вады зь Вяльлі у Сьвіслач. Пачатак будаўніцтва ў 1968 годзе, сыстэма здадзеная ў эксплюатацыю 15 студзеня 1976 году.\\nУ Вялейска-Менскую водную сыстэму ўваходзіць Вялейскае вадасховішча, галоўнае ў сыстэме і самае буйное ў рэспубліцы. Вялейскае вадасховішча створана на рацэ Вяльлі, знаходзіцца ў вадазборным басэйне Нёмана і ляжыць на 75 м ніжэй Менску. Канал зь Вялейскага вадасховішча, па якім паступае вада ў Заслаўскае вадасховішча, мае працягласьць 62,5 км. На трасе канала маецца 5 помпавых станцыяў магутнасьцю 22 м³/с кожная, якія па 4 трубаправодах падымаюць ваду на 75 м да водападзелу ў раёне Радашкавічаў і перапампоўваюць яе ў Заслаўскае вадасховішча. Па трасе канала можа перакідацца да 480 млн м³ вады за год.\\nЗаслаўскае вадасховішча прымае з канала вялейскую ваду.\\nВадасховішчы Крыніца і Дразды разьмешчаныя ніжэй Заслаўскага вадасховішча на рацэ Сьвіслач. За вадасховішчам Дразды разьмешчана Камсамольскае возера.\\nПа каскадзе вадасховішчаў на Сьвіслачы вялейская вада паступае ў Менск, далей ідзе ў Бярэзіну. У межах гораду Менску пабудаваныя водна-дэкаратыўныя сыстэмы — Сьляпянская і Лошыцкая."},{"page_url":"https://pt.wikipedia.org/wiki/Dodecaedro_r%C3%B4mbico","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Parallelohedron_edges_rhombic_dodecahedron.png","page_title":"Dodecaedro rômbico","context_page_description":"Na geometria, o dodecaedro rômbico é um poliedro convexo com 12 faces congruentes. Tem 24 arestas, e 14 vértices de dois tipos. É um sólido catalão, além de ser o poliedro dual do cuboctaedro."},{"page_url":"https://ja.wikipedia.org/wiki/FSF%E3%83%95%E3%83%AA%E3%83%BC%E3%82%BD%E3%83%95%E3%83%88%E3%82%A6%E3%82%A7%E3%82%A2%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Werner_Koch_Portrait_01.2015-2.jpg","page_title":"FSFフリーソフトウェア賞","context_page_description":"FSFフリーソフトウェア賞は、フリーソフトウェア財団がフリーソフトウェアの進歩と発展に貢献した個人又は団体に授与する賞である。1998年から開始されたフリーソフトウェアの進歩に対する賞と、2005年から開始された社会福祉プロジェクト賞がある。"},{"page_url":"https://da.wikipedia.org/wiki/Museum_of_Modern_Art","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/MoMa_NY_USA_1.jpg","page_title":"Museum of Modern Art","context_page_description":"Museum of Modern Art, MoMA, er et kunstmuseum med samtidig kunst beliggende på Manhattan i New York City. Det er indviet i 1929.\\nSamlingen omfatter også værker af legender af verdensdesign som Livio Castiglioni, Achille Castiglioni, Pier Giacomo Castiglioni."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A6%8F%E7%85%A6%E5%85%83%E5%B8%85%E5%B9%BF%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Nantes_-_colonne_Louis_XVI.jpg","page_title":"福煦元帅广场","context_page_description":"福煦元帅广场是法国南特的一个著名广场，18世纪开辟，在圣伯多禄大道和圣安德肋大道之间。它在第一帝国时期名为阅兵广场，在复辟时期命名为路易十六广场，1918年第一次世界大战结束时以费迪南·福煦元帅命名。\\n位于广场中心的路易十六柱，立于1790年，原为“自由柱”，高28米，复辟时期的1823年，安放了在法国颇为罕见的路易十六雕像。\\n广场周围可以看到Hôtel Montaudouin；Hôtel d'Aux；Hôtel de Bruc，建于1824年，1942年成为南特盖世太保总部。南特圣伯多禄圣保禄主教座堂附近的圣伯多禄门，为中世纪城市的残迹。\\n福煦元帅广场1号和5号被列为法国历史古迹。"},{"page_url":"https://da.wikipedia.org/wiki/Havnebyen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Havnebyen_Ortsdurchfahrt.JPG","page_title":"Havnebyen","context_page_description":"Havnebyen er en lille havneby på Nordvestsjælland med 622 indbyggere. Havnebyen er beliggende i Odden Sogn på Sjællands Odde fem kilometer øst for Odden Færgehavn og 21 kilometer vest for Nykøbing Sjælland. Byen tilhører Odsherred Kommune og er beliggende i Region Sjælland.\\nI perioden fra 1920-1960 var der fra havnen et fiskeeventyr på Thunnus thynnus, den blåfinnede tun. Omkring 1960 sluttede eventyret, i dag er den blåfinnede tun en alvorligt truet fiskeart i hele det atlantiske område. Der er op havnen en udstilling om dette eventyr."},{"page_url":"https://fi.wikipedia.org/wiki/Kaliumftaali-imidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Potassium_phthalimide.png","page_title":"Kaliumftaali-imidi","context_page_description":"Kaliumftaali-imidi on ftaali-imidin kaliumsuola. Yhdistettä käytetään orgaanisessa synteesissä valmistettaessa amiineja."},{"page_url":"https://en.wikipedia.org/wiki/Yeywa_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Four_Penstock_of_Yeywa_Dam.jpg","page_title":"Yeywa Dam","context_page_description":"The Yeywa Hydropower Station, located on the Myitnge River, 52 kilometres southeast of Mandalay city, at Yeywa village in Kyaukse Township, Mandalay Region in central Myanmar, is the country's first roller-compacted concrete dam, and the site of a 790-megawatt hydroelectric power plant, the largest in the country."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/TricycleAntique.jpg","page_title":"Спица","context_page_description":"Спицата е радиално разположен механичен елемент в колело, което свързва главината му с кръглата конструкция на колелото. В английски език тази механична част се обозначава с термина spoke, а във френски език с – rayon."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Butzbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kleine_Kirchgasse_4_%28Griedel%29_11.JPG","page_title":"Liste der Kulturdenkmäler in Butzbach","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Butzbach, Wetteraukreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\n2009 wurden in Butzbach zur eindeutigen Orientierung mehrfach vorkommende Straßennamen umbenannt. Die früheren Straßennamen und Hausnummern sind in der Liste in Klammern angegeben."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B5%D8%B1_%D8%A7%D9%84%D8%A8%D8%A7%D9%87%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/MoroccoMarrakech_RoyalCastle4.jpg","page_title":"قصر الباهية","context_page_description":"قصر الباهية أحد المعالم التاريخية لمدينة مراكش المغربية..\\nينتمي قصر الباهية الواقع في مراكش والذي يعود بناؤه إلى عهد الدولة العلوية للوزير أحمد بن موسى على عهد السلطان عبد العزيز، مسير شؤون الدولة انذاك، والملقب بـ «با حماد»،حيث جلب هذا الأخير امهر الصناع والحرفيين للاشتغال بالقصر لمدة ست سنوات متتالية، إلا أن القدر المحتوم حال دون رؤيته للقصر حيت وافته المنية سنة 1890 والأشغال لم تنته بعد. وهي من أشهر المعالم التاريخية في مراكش."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%B8%D5%B6_%D5%8D%D5%A5%D5%B6_%D5%84%D5%A1%D6%80%D5%BF%D5%A5%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Pont-Saint-Martin-abitato-DSCF8383.JPG","page_title":"Պոն Սեն Մարտեն","context_page_description":"Պոն Սեն Մարտեն, կոմունա Իտալիայի Վալե դ'Աոստա մարզում։\\nԲնակչությունը կազմում է 3945 մարդ ։ Բնակչության խտությունը՝ 573 մարդ/կմ²։ Տարածքը՝ 7 կմ²։ Փոստային ինդեքս՝ 11026։ Հեռախոսային կոդ՝ 0125։\\nԲնակավայրի հովանավոր է համարվում սուրբ Լավրենտին:"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Marigny-le-Cahou%C3%ABt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Marigny-le-Cahou%C3%ABt5.JPG","page_title":"Château de Marigny-le-Cahouët","context_page_description":"Le château de Marigny-le-Cahouët est un château-fort médiéval situé sur la commune de Marigny-le-Cahouët, dans le département de la Côte-d'Or, région Bourgogne-Franche-Comté, en France."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_mondial_en_Papouasie-Nouvelle-Guin%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/OwenStanleyRangeOwersCornerView.jpg","page_title":"Liste du patrimoine mondial en Papouasie-Nouvelle-Guinée","context_page_description":"Cet article recense les sites inscrits au patrimoine mondial en Papouasie-Nouvelle-Guinée."},{"page_url":"https://da.wikipedia.org/wiki/Wasserkuppe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Rhoen-Wasserkuppe-04-Fliegerdenkmal-2019-gje.jpg","page_title":"Wasserkuppe","context_page_description":"Wasserkuppe er et 950 meter højt bjerg i naturbeskyttelsesområdet Hessische Rhön mellem de tyske byer Gersfeld og Poppenhausen og cirka 30 kilometer fra Fulda.\\nWasserkuppe er det højeste bjerg i delstaten Hessen, og floden Fulda har sit udspring der.\\nSiden 1910 har bjerget været af betydning for forskellige former for flyvesport. Der blev foretaget tidlige eksperimenter med svæveflyvning på stedet, som i kraft af opvinde og gode udelandingsforhold i det åbne landskab var ideelt til formålet. De tyske forberedelser til svæveflyvningskonkurrencen ved sommer-OL 1940 fandt sted her. I dag foretages der stadig intensiv svæveflyvning fra Wasserkuppe, ligesom paragliding, modelflyvning og drageflyvning dyrkes i området. Bjerget er desuden et populært udflugtsmål og er udgangspunkt for en betydelig vandreturisme."},{"page_url":"https://fr.wikipedia.org/wiki/Gomme_(adh%C3%A9sif)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Briefmarken_Spargummi.jpg","page_title":"Gomme (adhésif)","context_page_description":"En philatélie, la gomme est une substance appliquée à l'arrière d'un timbre pour lui permettre d'adhérer à une lettre ou à autre support postal. Ce terme générique s'applique à la fois pour les gommes traditionnelles telle que la gomme arabique et aux gommes synthétiques modernes. L'état de conservation de la gomme est un paramètre important lors de l'estimation d'un timbre."},{"page_url":"https://eo.wikipedia.org/wiki/Anizila_izocianato","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/P-chloro-anisole3D.png","page_title":"Anizila izocianato","context_page_description":"Anizila izocianato aŭ C₉H₉NO₂ estas organika aromata komponaĵo, apartenanta al al familia grupo de la izocianatoj, senkolora aŭ flava, toksa, brulema likvaĵo uzata en kemiaj sintezoj, kaj en fabrikado de insekticidoj, fungicidoj, pesticidoj kaj baktericidoj. Izocianatoj estas substancoj kie la nitrogeno ligiĝas al karbonatomo kiu siavice ligiĝas al oksigenatomo. Tioizocianatoj estiĝas per agado de sulfida acido sur izocianatoj formante akvon. Cianatoj estas izomeroj de la izocianatoj sed en la unuaj la oksigenatomo estas ligita al karbonatomo kiu siavice ligiĝas al nitrogenatomo."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_(Wasenbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/J%C3%BCdischer_Friedhof_Wasenbach_Detail.jpg","page_title":"Jüdischer Friedhof (Wasenbach)","context_page_description":"Der Jüdische Friedhof in Wasenbach, einer Ortsgemeinde im Rhein-Lahn-Kreis in Rheinland-Pfalz, wurde vermutlich im 19. Jahrhundert angelegt. Der jüdische Friedhof mit einer Fläche von 975 m² befindet sich an der Straße nach Schönborn, rechts der Rosenstraße. Er ist ein geschütztes Kulturdenkmal.\\nHeute sind noch sechs Grabsteine erhalten."},{"page_url":"https://ceb.wikipedia.org/wiki/Lobophytum_pauciflorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Lobophytum_pauciflorum.jpeg","page_title":"Lobophytum pauciflorum","context_page_description":"Espesye sa kagaangan nga una nga gihulagway ni Ehrenberg ni adtong 1834 ang Lobophytum pauciflorum. Ang Lobophytum pauciflorum sakop sa kahenera nga Lobophytum sa kabanay nga Alcyoniidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://fr.wikipedia.org/wiki/1842_en_musique_classique","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Giuseppe_Nicolini_by_Luigi_Rados.jpg","page_title":"1842 en musique classique","context_page_description":"7 janvier : Stabat Mater de Gioachino Rossini exécuté à Paris, salle Ventadour.\\n3 mars : Symphonie nᵒ 3 en la mineur « Écossaise », de Mendelssohn, créée à Leipzig sous la direction du compositeur.\\n9 mars : Nabucco, opéra de Verdi, créé à la Scala de Milan.\\n19 mai : Linda di Chamounix, opéra de Gaetano Donizetti, créé à Vienne au Kärntnertortheater.\\n20 octobre : Rienzi, der letzte der Tribunen, opéra de Wagner, créé à Dresde, sous la direction de Reissiger.\\n17 novembre : présentation de Linda di Chamounix au Théâtre-Italien à Paris, avec de légères modifications.\\n7 décembre : Concert inaugural de l'Orchestre philharmonique de New York avec la 5ᵉ symphonie de Beethoven.\\n9 décembre : Rouslan et Ludmila, opéra de Mikhaïl Glinka, d'après le poème narratif de Pouchkine du même nom, créé au Théâtre Mariinsky à Saint-Pétersbourg.\\n31 décembre : Der Wildschütz, opéra d'Albert Lortzing, créé à Leipzig.\\nDate indéterminée\\nComposition de la Polonaise héroïque de Frédéric Chopin.\\nComposition des Trois quatuors à corde op. 41 de Robert Schumann.\\nComposition du Quintette avec piano op. 44, de Robert Schumann.\\nComposition du Quatuor avec piano, op. 47. de Robert Schumann."},{"page_url":"https://en.wikipedia.org/wiki/Hertfordshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Cheshunt%2C_Theobalds_-_geograph.org.uk_-_552741.jpg","page_title":"Hertfordshire","context_page_description":"Hertfordshire is one of the home counties in southern England. It is bordered by Bedfordshire and Cambridgeshire to the north, Essex to the east, Greater London to the south, and Buckinghamshire to the west. For government statistical purposes, it is placed in the East of England region.\\nIn 2013, the county had a population of 1,140,700 in an area of 634 square miles. Hemel Hempstead, Stevenage, Watford, and the only city in the county, St Albans have between 50,000 and 100,000 residents. Hertford, once the main market town for the medieval agricultural county, derives its name from a hart and a ford, used as the components of the county's coat of arms and flag. Elevations are high for the region in the north and west. These reach over 800 feet in the western projection around Tring which is in the Chilterns. The county's borders are approximately the watersheds of the Colne and Lea; both flowing to the south; each accompanied by a canal. Hertfordshire's undeveloped land is mainly agricultural and much is protected by green belt."},{"page_url":"https://ms.wikipedia.org/wiki/Anjing_gembala_Bohemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/OREADY_KROSANDRA_%2814%29.JPG","page_title":"Anjing gembala Bohemia","context_page_description":"Anjing gembala Bohemia, anjing Chod, atau anjing gembala Czech ialah satu baka anjing. Anjing gembala Bohemia diiktiraf pada peringkat kebangsaan di Republik Czech tetapi tidak diiktiraf oleh FCI atau mana-mana kelab kenel lain."},{"page_url":"https://en.wikipedia.org/wiki/Jubbulpore_Division","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/The_Thug_School_of_Industry%2C_Jubbulpore.jpg","page_title":"Jubbulpore Division","context_page_description":"The Jubbulpore Division, named after its capital Jabalpur, was one of the four former administrative divisions of the Central Provinces of British India. It was located in the Mahakoshal region of present-day Madhya Pradesh state of India. The Jubbulpore Division had an area of 48,401 km² with a population of 2,201,633 in 1881.\\nThe Central Provinces became the Central Provinces and Berar in 1936 until the Independence of India."},{"page_url":"https://ca.wikipedia.org/wiki/Teatre_Castelar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Teatro_Castelar_Elda.jpg","page_title":"Teatre Castelar","context_page_description":"El teatre Castelar és un teatre amb capacitat per a 751 espectadors situat en la localitat valenciana d'Elda. Rep el nom de l'il·lustre polític Emilio Castelar, que va residir a Elda part de la seua infància i joventut."},{"page_url":"https://ca.wikipedia.org/wiki/Cases_aparellades_de_la_Col%C3%B2nia_Santa_Maria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/CASES_APARELLADES_DE_LA_COL%C3%93NIA_DE_SANTA_MARIA_-_S%C3%9ARIA_-_IB-984.jpg","page_title":"Cases aparellades de la Colònia Santa Maria","context_page_description":"Les Cases aparellades de la Colònia Santa Maria és una obra del municipi de Súria protegida com a bé cultural d'interès local."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A4%D0%B5%D0%BB%D0%BB%D0%B5%D1%80%D0%B8%D0%BD%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Fellering_044.JPG","page_title":"Феллеринг","context_page_description":"Феллеринг — Франциянең Югары Рейн департаментына караган коммуна, Серне кантонына карый."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ottoman_battles_in_which_the_sultan_participated","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Orhan_I.jpg","page_title":"List of Ottoman battles in which the sultan participated","context_page_description":"The List of Ottoman Battles In Which The Sultans Participated In is shown below. Note that the sieges are not included in the list."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AE%BF%E0%AE%B1%E0%AF%81%E0%AE%AE%E0%AE%B2%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Sirumalai.JPG","page_title":"சிறுமலை","context_page_description":"சிறுமலை, திண்டுக்கல்லுக்கு 25 கிலோமீட்டர்கள் அருகிலும், மதுரைக்கு 40 கிலோமீட்டர்கள் அருகிலும் அமைந்துள்ளது. இப்பகுதியில் நிறைய மலைக்குன்றுகள் உள்ளன. இல்லாக் பன்னாட்டுப் பள்ளியும் இங்கே அமைந்துள்ளது.\\nஆண்டுமுழுவதும் நடுத்தரமான சூழலில் இருக்கக் கூடிய காட்டுப் பகுதி. விதவிதமான செடிகளும் விலங்குகளும் வாழ்கின்றன. சிறுமலையில் விளையும் மலைவாழைப் பழங்கள் இனிப்பு மிகுந்தவை. மற்றும் புராணங்களில் கூறப்படும் அனுமன் இமயமலையை கையில் கொண்டு செல்லும் போது சிந்திய சிறு மண்ணே பிறகு சிறுமலை என உருவாகியது என அங்குள்ள மக்களால் கூறப்படுகிறது\\nதிண்டுக்கல்லில் இருந்து நத்தம் செல்லும் சாலையில் 7 கி.மீ. சென்று வலதுபுறம் செல்லவேண்டும். மொத்தம் 18 கொண்டை ஊசி வளைவுகள் உள்ளன. செல்லும் வழியில் மலைமாதா கோவில் உள்ளது. இங்கு அரிய வகை மூலிகைகள் உள்ளன. எலுமிச்சம்பழம், வாழைப்பழம், பலாப்பழம் அதிகமாக விளைகின்றன. இங்கு எப்போதும் இதமான சூழ்நிலை நிலவுகிறது. சிறுமலை வாழைப்பழம் பழனி முருகன் கோவிலுக்கு பஞ்சாமிர்தம் செய்ய பயன்படுத்துகிறார்கள். இங்கு அரிய விலங்குகள் மற்றும் பறவைகள் உள்ளன."},{"page_url":"https://nl.wikipedia.org/wiki/Vaux-Lavalette","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Vauxlav_mairie.JPG","page_title":"Vaux-Lavalette","context_page_description":"Vaux-Lavalette is een gemeente in het Franse departement Charente en telt 99 inwoners. De plaats maakt deel uit van het arrondissement Angoulême."},{"page_url":"https://nl.wikipedia.org/wiki/Bok_%26_Bibliotek","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Liza_Marklund.jpg","page_title":"Bok & Bibliotek","context_page_description":"De Bok & Bibliotek is een jaarlijks evenement, dat sinds 1985 gehouden wordt in de Zweedse stad Göteborg.\\nOorspronkelijk diende het evenement als ruilbeurs, met name voor bibliothecarissen en leraren, maar het is in de jaren daarna uitgegroeid tot het grootste literaire evenement van Scandinavië en het op een na grootste evenement van Europa, na de Frankfurter Buchmesse.\\nMeestal wordt het evenement in de laatste week van september gehouden. Ongeveer 100.000 mensen bezoeken het evenement jaarlijks."},{"page_url":"https://en.wikipedia.org/wiki/Allondrelle-la-Malmaison","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Eglise_Allondrelle.JPG","page_title":"Allondrelle-la-Malmaison","context_page_description":"Allondrelle-la-Malmaison is a commune in the Meurthe-et-Moselle department in northeastern France."},{"page_url":"https://it.wikipedia.org/wiki/Polittico_Peruzzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Giotto._Peruzzi_Altarpiece_1310-15.North_Carolina_Museum_of_Art%2C_Raleigh.jpg","page_title":"Polittico Peruzzi","context_page_description":"Il Polittico Peruzzi è un dipinto a tempera e oro su tavola di Giotto e aiuti, databile al 1318-1322 circa e conservato a Museo d'arte della Carolina del Nord di Raleigh, proveniente dalla Cappella Peruzzi in Santa Croce a Firenze."},{"page_url":"https://pl.wikipedia.org/wiki/Dyskografia_the_GazettE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Gazettetokyo.jpg","page_title":"Dyskografia the GazettE","context_page_description":"Dyskografia the GazettE – japońskiego rockowego zespołu nurtu visual kei. Grupa wydała dotychczas dziewięć albumów studyjnych, sześć minialbumów, trzy kompilacje i sześćdziesiąt singli. Zespół do tej pory uzyskał spośród wszystkich swoich wydawnictw trzy certyfikaty złotych płyt w Japonii za sprzedaż łączną 300 tysięcy egzemplarzy singli „Cassis”, „Guren ” oraz „SHIVER”."},{"page_url":"https://en.wikipedia.org/wiki/Red_Hot_Chili_Peppers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/JohnFruscianteAugust2006.jpg","page_title":"Red Hot Chili Peppers","context_page_description":"Red Hot Chili Peppers are an American rock band formed in Los Angeles in 1983. Their music incorporates elements of alternative rock, funk, punk rock and psychedelic rock. The band consists of vocalist Anthony Kiedis, guitarist John Frusciante, bassist Flea, and drummer Chad Smith. With over 80 million records sold worldwide, Red Hot Chili Peppers are one of the best-selling bands of all time. They are the most successful band in the history of alternative rock, with the records for most number-one singles, most cumulative weeks at number one and most top-ten songs on the Billboard Alternative Songs chart. They have won six Grammy Awards, and in 2012 were inducted into the Rock and Roll Hall of Fame.\\nRed Hot Chili Peppers were formed in Los Angeles by Kiedis, Flea, guitarist Hillel Slovak, and drummer Jack Irons. Because of commitments to other bands, Slovak and Irons did not play on the band's 1984 self-titled debut album; instead, the album featured Jack Sherman on guitar and Cliff Martinez on drums."},{"page_url":"https://fr.wikipedia.org/wiki/Colis%C3%A9e_Pepsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Le_Patinage_artistique_-_Sulpture_pr%C3%A9sente_au_Colis%C3%A9e_Pepsi.JPG","page_title":"Colisée Pepsi","context_page_description":"Le Colisée Pepsi ou Colisée de Québec était une salle omnisports de 15 176 places située sur les terrains d'ExpoCité dans l'arrondissement La Cité-Limoilou de Québec. Ouvert en 1949, le Colisée ferma définitivement ses portes le 14 septembre 2015. Les Remparts de Québec de la Ligue de hockey junior majeur du Québec furent les derniers occupants de l'édifice. Le Centre Vidéotron lui succéda. L'édifice est désormais destiné à être démoli en 2020."},{"page_url":"https://fr.wikipedia.org/wiki/Anne_Jean_Marie_Ren%C3%A9_Savary","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Marie_El%C3%A9onore_Godefroid_-_Portrait_of_Mme_de_Sta%C3%ABl.jpg","page_title":"Anne Jean Marie René Savary","context_page_description":"Anne Jean Marie René Savary, duc de Rovigo, né le 26 avril 1774 à Marcq et mort le 2 juin 1833 à Paris, est un général français, particulièrement connu comme homme de confiance de Napoléon Bonaparte et comme ministre de la Police de 1810 à 1814.\\nSavary, entré jeune dans l'armée, combat durant les guerres de la Révolution française. Remarqué par le général Bonaparte, il devient son aide de camp, puis le Premier Consul lui confie plusieurs missions spéciales. En 1803 il dénoue le complot de Cadoudal avant de tenir le premier rôle dans l'exécution du duc d'Enghien en mars 1804. Proche du Premier Consul et de sa famille, il épouse une parente de Joséphine de Beauharnais.\\nGénéral de division en 1805 il participe à la campagne de Prusse, puis est nommé ambassadeur auprès du tsar. Fait duc de Rovigo en 1808, il part pour l'Espagne, où il commande les forces françaises jusqu'à l'arrivée de Joseph Bonaparte.\\nEn juin 1810 l'Empereur lui confie le Ministère de la Police en remplacement de Fouché ; l'épisode le plus connu de son mandat est la tentative de coup d'État du général Malet en octobre 1812."},{"page_url":"https://no.wikipedia.org/wiki/Marita_Moltu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/MaritaMoltu.jpg","page_title":"Marita Moltu","context_page_description":"Marita Moltu er en norsk politiker for Partiet De Kristne, tidligere fra Kristelig Folkeparti. Fra 2. oktober 2015 er hun varaordfører i Bergen kommune og nestleder i komité for helse og sosial. I perioden 2011-2015 var hun kommunalråd i Bergen kommune, nestleder for oppvekstkomiteen i bystyret og gruppeleder for Kristelig Folkepartis bystyregruppe.\\nHun var 1. vara for KrF til Bergen bystyre fra 29. oktober 2007 til 1. oktober 2009. Fra 1. oktober 2009 til 31. oktober 2011 møtte hun fast i bystyret. Sin yrkesbakgrunn har Marita Moltu fra StatoilHydro. I mars 2018 meldte hun seg ut av KrF og i august inn i Partiet De Kristne.\\nMarita Moltu er gift med Tomas Moltu, tidligere byråd for barnehage og skole i Bergen, også han fra Partiet De Kristne og tidligere fra KrF."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_Achille_Poirot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Plain_d%27Olympie._Partie_des_ruines_%28d%C3%A9tail%29.jpg","page_title":"Pierre Achille Poirot","context_page_description":"Pierre Achille Poirot est un peintre français né à Alençon en 1797 et mort en 1852."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%85%E0%A6%A4%E0%A6%BF%E0%A6%B0%E0%A6%BF%E0%A6%95%E0%A7%8D%E0%A6%A4_%E0%A6%9C%E0%A6%A8%E0%A6%B8%E0%A6%82%E0%A6%96%E0%A7%8D%E0%A6%AF%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/World_population_v3.svg","page_title":"অতিরিক্ত জনসংখ্যা","context_page_description":"অত্যধিক জনসংখ্যা হলো যখন অনেক জনসংখ্যার জন্য পরিবেশের ভারসাম্য ব্যাহত হয়ে থাকে । আরও বৈজ্ঞানিক ভাবে, যখন জনসংখ্যা কোনো ভৌগলিক সীমারধারন ক্ষমতার তুলনায় বেশি হয়ে যায় এবং প্রাকৃতিক ভাবে পরিবেশের ক্ষতিপূরণের চেয়ে দ্রুত পরিবেশের ক্ষতি সাধন করে, ধীরে ধীরে পরিবেশগত ও সামাজিক পতনের দিকে পরিচালিত করে। অতিরিক্ত জনসংখ্যা একটি নির্দিষ্ট জাতি বা পুরো বিশ্বের জন্য প্রযোজ্য হতে পারে ।\\nজনসংখ্যার বৃদ্ধি, মৃত্যুহার হ্রাস, অভিবাসন বৃদ্ধি বা অস্থিতিশীল বায়োম এবং সম্পদ হ্রাসের ফলে জনসংখ্যা বৃদ্ধি হতে পারে। একটি জনবিরল এলাকা জনবহুল হবে না, যদি এটা অনুর্বর ও মানুষের বসবাসের অনুপযোগী হয়।\\nপৃথিবীর ধারন ক্ষমতা, বিশ্বব্যাপী উষ্ণায়ন, সম্ভাব্য বা আসন্ন পরিবেশগত বিপর্যয়, জীবনযাপনের উপর প্রভাব এবং জনসংখ্যা হ্রাসের পক্ষে তর্ক করার ভিত্তিতে জনসাধারণের ক্ষুধা বা এমনকি বিলুপ্তির ঝুঁকি অতিক্রমকারী জনসংখ্যার সংশোধনীর\\nপক্ষে মতামতগুলি উদ্ধৃত করে।\\nপল এরলিক দ্বারা সমর্থিত, অত্যধিক জনসংখ্যার আরেকটি সংজ্ঞা, জনসংখ্যা এমন একটি পরিস্থিতি যা নবায়নযোগ্য সম্পদের হ্রাস প্রক্রিয়া শুরু করে।এই সংজ্ঞা অনুসারে, জীবনধারা পরিবর্তনের মাধ্যমে জনসংখ্যার যে কোনও হ্রাস ছাড়াই, জনসংখ্যা নিয়ন্ত্রণে আনা যাবে।"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A8%D7%A7%D7%9C%D7%99%D7%98_%D7%94%D7%9E%D7%93%D7%99%D7%A0%D7%94_%D7%A9%D7%9C_%D7%90%D7%A8%D7%A6%D7%95%D7%AA_%D7%94%D7%91%D7%A8%D7%99%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Edwin_Kneedler.jpg","page_title":"פרקליט המדינה של ארצות הברית","context_page_description":"פרקליט המדינה של ארצות הברית הוא בעל התפקיד השלישי בחשיבותו במחלקת המשפטים של ארצות הברית. פרקליט המדינה קובע את העמדה המשפטית שארצות הברית תנקוט בבית המשפט העליון. בנוסף לפיקוח ולניהול תיקים שבהם הממשלה צד, משרד הפרקליטות גם מגיש תזכירי \\"אמיקוס קוריא\\" במקרים בהם יש לממשל הפדרלי עניין משמעותי בסוגיה המשפטית. פרקליטות המדינה מייצגת את הממשלה כמעט בכל מקרה שבו ארצות הברית היא צד, וגם ברוב המקרים שבהם הממשלה הגישה תזכיר אמיקוס קוריא. משרד פרקליט המדינה בוחן תיקים בהם בתי המשפט הפדרליים לערעורים פסקו נגד ארצות הברית וקובע האם הממשלה תערער לבית המשפט העליון."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%A7%D9%85%D8%A7%DA%AF%D9%88%D8%B3%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Agios_Nikolaos%2C_Famagusta_%281%29.jpg","page_title":"فاماگوستا","context_page_description":"فاماگوستا در ناحیه غازی ماغوسا در کشور قبرس شمالی واقع شده‌است. جمعیت این شهر ۶۹،۷۴۱ نفر است."},{"page_url":"https://ca.wikipedia.org/wiki/Mangosta_nana_africana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Common_Dwarf_Mongoose_area.png","page_title":"Mangosta nana africana","context_page_description":"La mangosta nana africana, de vegades anomenada simplement mangosta nana, és un petit carnívor africà que pertany a la família de les mangostes."},{"page_url":"https://hu.wikipedia.org/wiki/La_Pr%C3%A9nessaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Vierge_%C3%A0_l%27enfant_-_Querrien_-_La_Pr%C3%A9nessaye_-_C%C3%B4tes_d%27Armor.jpg","page_title":"La Prénessaye","context_page_description":"La Prénessaye település Franciaországban, Côtes-d’Armor megyében. La Prénessaye La Ferrière, Loudéac, La Motte, Les Moulins és Saint-Barnabé községekkel határos."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A7%CE%B5%CE%B9%CF%81%CE%BF%CE%BC%CE%B1%CE%BD%CF%84%CE%B5%CE%AF%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Les_lignes_de_la_main_Artlibre.png","page_title":"Χειρομαντεία","context_page_description":"Η χειρομαντεία είναι η μαντική τέχνη της ερμηνείας των γραμμών του χεριού και της αποκάλυψης του πεπρωμένου του κατόχου του."},{"page_url":"https://fi.wikipedia.org/wiki/Standard_Pennant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/1959_Standard_Pennant.jpg","page_title":"Standard Pennant","context_page_description":"Standard Pennant on vuosina 1957–1960 valmistettu pieni neliovinen henkilöauto. Pennantia valmistettiin Englannissa kaikkiaan 42 910 kappaletta. Pennant on tavallisen Standard Ten -pikkuauton loistomalli. Moottori on sama, mutta varustelu on Pennantissa parempi. Kummankin mallin erikoisuus on alaslaskettava takaistuimen selkänoja - 1950-luvulla tämä oli uutuus.\\nStandard Pennantissa on nelisylinterinen nelitahtinen 948 cm³ bensiinimoottori. Teho 24 kilowattia /4500 r/min. Suurin vääntömomentti 62,8 Nm /2400 r/min.\\nPennantille tyypillistä on kaksivärimaalaus, saatavana oli useita väriyhdistelmiä.\\nPennantissa on neljä vaihdetta. Lisävarusteena oli saatavissa Laycock de Normanvillen valmistama ylivaihde sekä Standrive–automaattikytkin.\\nStandard Pennant oli niin kapea, että se rekisteröitiin Suomessa neljälle hengelle.\\nStandard Pennant Saloon maksoi Suomessa vuonna 1959 755 000 markkaa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_preserved_by_the_Churches_Conservation_Trust_in_the_East_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/St.Botolph%27s_church%2C_Skidbrooke_-_geograph.org.uk_-_155818.jpg","page_title":"List of churches preserved by the Churches Conservation Trust in the East of England","context_page_description":"The Churches Conservation Trust, which was initially known as the Redundant Churches Fund, is a charity whose purpose is to protect historic churches at risk, those that have been made redundant by the Church of England. The Trust was established by the Pastoral Measure of 1968. The legally defined object of the Trust is \\"the preservation, in the interests of the nation and the Church of England, of churches and parts of churches of historic and archaeological interest or architectural quality vested in the Fund ... together with their contents so vested\\". The charity cares for over 350 churches. The Trust is financed partly by the Department for Culture, Media and Sport and the Church Commissioners, but grants from those bodies were frozen in 2001, since when additional funding has come from other sources, including the general public. In the 12 months ending 31 March 2010 the charity's income was £6,161,653, and its spending was £6,035,871. During that year it had 44 employees, and used the services of 2,000 volunteers. The charity is run by a board of trustees, who delegate the day-to-day management to a chief executive and his senior management team."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B6%85%E8%B6%8A%E7%9E%91%E6%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Maharishi_Mahesh_Yogi_during_a_1979_visit_to_MUM.jpg","page_title":"超越瞑想","context_page_description":"超越瞑想 は、インド人のマハリシ・マヘーシュ・ヨーギーによって1950年代に知られるようになった、ヒンドゥー教に由来するマントラ瞑想法 である。その思想や1958年に始まった普及活動、普及組織も含めて指す場合もある。この瞑想法では、毎日2回、マントラを15～20分間心の中で唱えて、心を静め、徐々に神経活動を抑え、意識を深みに導くことで、開放された気づきの状態、最高の境地、純粋意識 に達することを目的とする。マハリシ財団関連組織で教育を受けたTM教師による直接の伝授を原則とするため、内容の詳細は公開されていない。超越瞑想には非宗教的な側面と宗教的な側面がある。リラクセーション法としての実践・研究も広く行われてきた。信奉者たちは、超越瞑想の成果として地上天国が実現すると考えている。"},{"page_url":"https://es.wikipedia.org/wiki/Camino_Real_de_la_Valdavia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/MonasterioPremostatenseSanPelayo_ArenillasSanPelayo_001_Portada.JPG","page_title":"Camino Real de la Valdavia","context_page_description":"El Camino Real de la Valdavia es una ruta histórica, de eminente carácter Jacobeo que une el camino francés a su paso por Carrión de los Condes, con el puerto de Piedrasluengas a través del valle de la Valdavia, y que se conocía y representaba como tal en los mapas hasta épocas recientes.​\\nAdemás de la vía Vadiniense y de la ruta del Besaya, los antiguos cántabros y el resto de gente que llegaba al litoral norte por barco, conocían otro camino de comunicación con la fértil meseta castellana. Se trata del Camino Real de la Valdavia. Esta ruta permite al viajero devoto la oportunidad de visitar dos de los centros de peregrinación de mayor trascendencia cristiana en España. Estos renombrados templos son la Catedral de Santiago de Compostela y el Monasterio de Santo Toribio de Liébana.\\nEsta ruta parte del puerto marítimo de San Vicente de la Barquera y cruza el puerto de Piedrasluengas, internándose por el valle de la Valdavia paralelo a su río hasta entroncar con la ruta del Besaya a la altura del alto de la Esperina próximos ya a Carrión de los Condes.\\nEste antiguo camino cuenta con varias referencias que evidencian su antigüedad y uso."},{"page_url":"https://de.wikipedia.org/wiki/Landkreis_Cottbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Brandenburg_Kr_Cottbus.png","page_title":"Landkreis Cottbus","context_page_description":"Der Landkreis Cottbus, bis 1886 Kreis Cottbus, war ein Landkreis in Brandenburg. Er bestand in Preußen, in der SBZ und in der DDR bis 1952."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%87%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Historical_bazaar_complex2.jpg","page_title":"اهر","context_page_description":"اهر شهر ملی ورنی ایران یکی از شهرهای مهم استان آذربایجان شرقی و مرکز شهرستان اهر و منطقه ارسباران و در شمال شرق این استان واقع شده‌است و به‌عنوان بزرگ‌ترین شهر شناخته می‌شود این شهر در ۹۰ کیلومتری شمال شرق تبریز بر سر مسیر ارتباطی تبریز به استان اردبیل قرار گرفته‌است.و با دارا بودن مناطق بکر و زیبا، کوه‌ها، دشت‌ها و جنگل‌ها یکی از خوش آب و هواترین مناطق استان آذربایجان شرقی محسوب می‌شود.\\nاهر با دارا بودن ۱۰۵٬۲۹۹ نفر جمعیت و ۱۲٫۷۶ کیلومتر مربع مساحت، چهارمین شهر پرجمعیت استان پس از تبریز، مراغه و مرند محسوب می‌شود."},{"page_url":"https://it.wikipedia.org/wiki/Teodorico_Pedrini","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/The_Kangxi_Emperor.jpg","page_title":"Teodorico Pedrini","context_page_description":"Teodorico Pedrini è stato musicista, sacerdote e missionario: visse a Pechino, ove aprì al culto la Chiesa cattolica di Xitang. Il suo nome in cinese è 德理格 Dé Lĭgé."},{"page_url":"https://ceb.wikipedia.org/wiki/Eudyptes_schlegeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/MacquarieIslandRoyals.jpg","page_title":"Eudyptes schlegeli","context_page_description":"Espesye sa langgam ang Eudyptes schlegeli. Una ning gihulagway ni Otto Finsch ni adtong 1876. Ang Eudyptes schlegeli sakop sa kahenera nga Eudyptes sa kabanay nga Spheniscidae. Giklaseklase sa IUCN ang espesye sa madutlan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Padma_Bhushan_award_recipients_(2000%E2%80%932009)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Sam_Headshot.jpg","page_title":"List of Padma Bhushan award recipients (2000–2009)","context_page_description":"The Padma Bhushan is the third-highest civilian award of the Republic of India. Instituted on 2 January 1954, the award is given for \\"distinguished service of a high order\\", without distinction of race, occupation, position, or sex. The recipients receive a Sanad, a certificate signed by the President of India and a circular-shaped medallion with no monetary association. The recipients are announced every year on Republic Day and registered in The Gazette of India—a publication used for official government notices and released weekly by the Department of Publication, under the Ministry of Urban Development. The conferral of the award is not considered official without its publication in the Gazette. The names of recipients whose awards have been revoked or restored, both of which processes require the authority of the president, are archived and they are required to surrender their medal when their name is struck from the register; none of the conferments of Padma Bhushan during 2000–2009 have been revoked or restored."},{"page_url":"https://nl.wikipedia.org/wiki/Racing_M%C3%A9tro_92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Picamoles_%26_Chabal_-_Rugby_Racing_vs_Stade_Toulousain_311009.jpg","page_title":"Racing Métro 92","context_page_description":"Racing 92 is een Franse rugbyclub uit Parijs. De club is primair voortgekomen uit de omnisportvereniging Racing club de France welke in 1882 werd opgericht. In 1890 werd de rugbytak opgericht waarmee in 1892 de eerste editie van het Franse landskampioenschap rugby werd behaald. De club heeft in totaal vijf landstitels weten te behalen waarvan de laatste in 1990."},{"page_url":"https://pt.wikipedia.org/wiki/VVER","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/VVER-1000-Stereometric.svg","page_title":"VVER","context_page_description":"VVER ou WWER é um tipo de reator nuclear que começou a ser produzido na extinta União Soviética. VVER é um reator nuclear moderado a água, sendo também em termos de princípio de funcionamento, basicamente uma cópia do reator PWR usado no Brasil pelas usinas Angra I e Angra II. Ele usa urânio enriquecido como combustível e água leve como moderador e refrigerante. Sua vantagem sobre os PWR é seu baixo custo de instalação. Sua desvantagem é o menor número de itens de segurança, em relação ao PWR. Por exemplo, os reatores de Angra I e Angra II são projetados para resistirem a um choque de avião-suicida e ainda assim, não vazarem radiação. Num VVER, tal choque vazaria radiação para o ambiente em escala mortal para os vizinhos deste reator. Em Cuba haviam dois destes reatores em construção entre as décadas de 1980 e 1990, mas nunca foram concluídos. Há mais de vinte reatores tipo VVER, em funcionamento na Rússia, China, Hungria e alguns outros países. Ao contrário do reator RBMK, este reator segue em instalação e tem razoáveis condições de segurança. Ainda assim, tais itens de segurança são inferiores aos usados nos reatores PWR."},{"page_url":"https://it.wikipedia.org/wiki/Padiglioni_nazionali_dell%27Expo_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Expo_Milano_2015_-_Pavilion_of_Uruguay.jpg","page_title":"Padiglioni nazionali dell'Expo 2015","context_page_description":"I padiglioni nazionali dell'Expo 2015 sono stati i padiglioni costruiti in autonomia dai Paesi. Furono collocati lungo e affacciavano sul decumano ed erano offerti dall'organizzazione ai partecipanti che hanno dovuto progettare, costruire e smantellare il proprio lotto espositivo. L'edizione 2015 segnò il record di Paesi partecipanti che hanno deciso di costruire un proprio padiglione, ben 53."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_de_l%27Art_(Skopje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Van%C4%8Do_Nikoleski_na_Mostot_na_umetnosta_%281%29.JPG","page_title":"Pont de l'Art (Skopje)","context_page_description":"Le Pont de l'Art est un pont piétonnier situé sur le fleuve Vardar, dans le centre de Skopje, la capitale de la Macédoine du Nord. Le pont comporte de nombreuses statues de nombreux artistes et musiciens macédoniens. Il a été construit dans le cadre du grand projet Skopje 2014, avec un coût de construction estimé à 2,5 millions d'euros. Le pont comprend 29 sculptures, 14 de chaque côté et une au centre. Il mesure 83 mètres de longueur et 9 mètres de largeur, tandis que la partie centrale du pont fait 12 mètres de large."},{"page_url":"https://es.wikipedia.org/wiki/Proterorhinus_semilunaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/M%C3%A1rton_Zsoldos%2C_Drawing_of_the_tarka_g%C3%A9b_%28Proterorhinus_semilunaris%2C_2007%29.jpg","page_title":"Proterorhinus semilunaris","context_page_description":"Proterorhinus semilunaris es una especie de peces de la familia de los Gobiidae en el orden de los Perciformes."},{"page_url":"https://fi.wikipedia.org/wiki/USS_Saratoga_(CV-3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/USS_Saratoga_%28CV-3%29_underway%2C_circa_in_1942_%2880-G-K-459%29.jpg","page_title":"USS Saratoga (CV-3)","context_page_description":"USS Saratoga oli Yhdysvaltain laivaston Lexington-luokan lentotukialus. Se tilattiin alun perin taisteluristeilijänä, mutta se muutettiin ennen valmistumistaan lentotukialukseksi. Alus palveli toisessa maailmansodassa"},{"page_url":"https://sv.wikipedia.org/wiki/Hugo_Gehlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Stoby_fonster.jpg","page_title":"Hugo Gehlin","context_page_description":"John Erik Hugo Gehlin, född 8 september 1889 i Norrköping, död 23 december 1953 i Helsingborg, var en svensk målare, grafiker och skulptör. Han var gift med konstnären Esther Henriques och far till författaren Jan Gehlin, konstnären Nils Gehlin samt konstnären Eva Gehlin-Berg.\\nHugo Gehlin studerade i Stockholm och utomlands, och utbildade sig inom flera områden, bland andra som träsnittsgrafiker och senare också som träskulptör. Han målade altarbilder och andra dekorativa kyrkliga arbeten, bland annat glasmålningar och målade skulpturer i ett flertal skånska kyrkor, särskilt märks Södra Sallerups kyrka och Sankta Maria kyrka, Helsingborg, där han utförde orgelbröstning och altarskrank 1928-31. Bland hans senare verk märks glasmålningar i Sankt Petri kyrka, Malmö 1937 samt målningar i Helsingborgs simhall 1941 och i Trelleborgs simhall 1944.\\nSom målare finns Gehlin representerad i ett flertal svenska museer bland annat vid Nationalmuseum, Göteborgs konstmuseum, Malmö museum, Norrköpings konstmuseum, Helsingborgs museum och i finländska museer, som grafiker är han även representerad i flera utländska samlingar."},{"page_url":"https://id.wikipedia.org/wiki/Rem_parkir","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/B02_Parking_brake_indication.svg","page_title":"Rem parkir","context_page_description":"Rem parkir adalah sebuah sistem pengereman pada Kendaraan bermotor, khususnya kendaraan roda empat maupun lebih. Rem Parkir umumnya berfungsi untuk menahan mobil bergerak dalam posisi kemiringan jalan yang miring, terutama dalam keadaan menanjak maupun menurun. Fungsi rem parkir ini dapat digunakan sebagai pengganti rem utama jika mobil dalam kondisi berhenti yang cukup lama, semisal dalam kondisi kemacetan atau saat parkir. Setiap mobil, truk, maupun bus, dilengkapi dengan rem parkir dengan tuas dan cara kerja yang bervariasi, bergantung pada model mobil dan juga bobot kendaraan"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EC%8A%A4%EC%BD%94%EA%B8%B0%EC%A1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/De_Soto_burns_Mabila_HRoe_2008.jpg","page_title":"마스코기족","context_page_description":"마스코기족 또는 크리크족은 미국 남동부에 살고 있었던 인디언 부족이다. '마스코기'는 그들 스스로 부르는 지칭이다. 그들의 전통적인 맞춤법에서는 \\"Mvskoke\\"이다.\\n현재 마스코기 사람들은 오클라호마, 앨라배마, 조지아, 그리고 플로리다에 살고 있다. 그들의 언어인 마스코기어는 마스코기어족에서 갈라진 말이다. 세미놀은 마스코기와 가까운 친족이다. 마스코기족은 문명화된 다섯 부족 중 하나이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%AA%E3%82%AA%E3%83%BB%E3%83%B4%E3%82%A3%E3%83%89%E3%82%B7%E3%83%83%E3%83%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Lausanne_Sport_vs_FC_Sion_-_Avril_2014_-_Dario_Vidosic.jpg","page_title":"ダリオ・ヴィドシッチ","context_page_description":"ダリオ・ヴィドシッチは、ユーゴスラビア出身のオーストラリア代表のプロサッカー選手。インディアン・スーパーリーグ・ATK所属。ポジションはミッドフィールダー。"},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%A9on_Labb%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Labbe%2C_Leon.jpg","page_title":"Léon Labbé","context_page_description":"Léon Labbé, est un chirurgien et homme politique français. Il est l'oncle d'un autre chirurgien, Charles Labbé, qui le premier a décrit la veine anastomotique inférieure.\\nInterne des hôpitaux de Paris de 1856 à 1860, Léon Labbé a obtenu son doctorat en médecine en 1861. Il a été chirurgien à l'hôpital de la Salpêtrière, à l'hôpital du Midi, à Saint-Antoine, à la Pitié, à Lariboisière, puis définitivement en 1889 à l'hôpital Beaujon, dont il était le chef-chirurgien pendant de nombreuses années. En 1879, il devient membre de l'Académie de Médecine.\\nSénateur de l'Orne de 1892 à 1916, il a été promu au grade de commandeur de la Légion d'honneur le 31 mars 1891. Il présente au Sénat différentes lois d'intérêt général pour la communauté médicale, y compris la Loi Labbé en 1914, qui a rendu la vaccination anti-typhoide obligatoire pour les soldats français.\\nÉponymes associés :\\ntriangle Labbé : endroit où l'estomac est normalement en contact avec la paroi abdominale.\\nIl est inhumé au cimetière Montmartre, 21e division, côté avenue Cordier."},{"page_url":"https://de.wikipedia.org/wiki/Everus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Everus_S1_02_China_2012-05-12.JPG","page_title":"Everus","context_page_description":"Everus, auch Li Nian genannt, ist eine Automarke aus der Volksrepublik China."},{"page_url":"https://en.wikipedia.org/wiki/Boruca","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Brunka.png","page_title":"Boruca","context_page_description":"The Boruca are an indigenous people living in Costa Rica. The tribe has about 2,660 members, most of whom live on a reservation in the Puntarenas Province in southwestern Costa Rica, a few miles away from the Pan-American Highway where it follows the Rio Terraba. The ancestors of the modern Boruca made up a group of chiefdoms that ruled most of Costa Rica's Pacific coast, from Quepos to what is now the Panamanian border, including the Osa Peninsula. Boruca traditionally spoke the Boruca language, which is now nearly extinct.\\nLike their ancestors the Boruca are known for their art and craftwork, especially weaving and their distinctive painted balsa wood masks, which have become popular decorative items among Costa Ricans and tourists. These masks are important elements in the Borucas' annual Danza de los Diablitos ceremony, celebrated every winter since at least early colonial times. The Danza depicts the resistance of the \\"Diablito\\", representing the Boruca people, against the Spanish conquistadors."},{"page_url":"https://fr.wikipedia.org/wiki/Vice-Premier_ministre_d%27Australie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/John_McEwen_1930s.jpg","page_title":"Vice-Premier ministre d'Australie","context_page_description":"Le Vice-Premier ministre d'Australie est le membre le plus important du gouvernement australien après le Premier ministre. La fonction de vice-premier ministre a été créée officiellement en 1968.\\nAu sein du gouvernement Turnbull, l'actuel titulaire du poste est Michael McCormack, le chef du parti national d'Australie."},{"page_url":"https://pl.wikipedia.org/wiki/Baar_(Zug)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Rathaus-Baar.jpg","page_title":"Baar (Zug)","context_page_description":"Baar – miasto w środkowej Szwajcarii, w niemieckojęzycznej części kraju, w kantonie Zug. W 2012 roku liczyło 22 355 mieszkańców.\\nZ Baar pochodziła Annemarie Huber-Hotz, szwajcarska polityk, która w latach 2000–2007 obejmowała stanowisko kanclerza federalnego."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9lit%C3%A9e_du_m%C3%A9lampyre","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ribwort_600.jpg","page_title":"Mélitée du mélampyre","context_page_description":"La Mélitée du mélampyre ou Damier Athalie est une espèce de lépidoptères appartenant à la famille des Nymphalidae, à la sous-famille des Nymphalinae, à la tribu des Melitaeini, et au genre Melitaea."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%83%A9%E3%83%BC%E3%83%9F%E3%83%81%E5%AE%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Coat_of_arms_of_the_House_of_Alerami.svg","page_title":"アレラーミチ家","context_page_description":"アレラーミチ家は、11世紀以降、モンフェッラート侯国およびサルッツォ侯国を支配したイタリア貴族の家系。"},{"page_url":"https://az.wikipedia.org/wiki/Buduq","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Budug_Azerbaijan07.jpg","page_title":"Buduq","context_page_description":"Buduq — Azərbaycan Respublikasının Quba rayonunun eyni adlı inzibati ərazi vahidində kənd və həmin ərazi vahidinin mərkəzi. Şahdağ xalqlarının nümayəndələrindən biri olan buduqluların tarixi, mərkəzi iqamətgahı. Quba xanlığı dövründə Buduq mahalının, Çar Rusiyası dövründə Buduq sahəsinin, SSRİ dövründə Buduq kənd sovetliyinin, hazırda Buduq bələdiyyəsinin mərkəzi.\\nŞimaldan-Karlac, Suxtəkələ, Tülər, Əlik və Xəngah\\nŞərqdən-Söhüb\\nCənubdan-Rük\\nQərbdən Zeyid və Yergüc kəndləri ilə həmsərhəddir"},{"page_url":"https://uz.wikipedia.org/wiki/Hasparren","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Map_commune_FR_insee_code_64256.png","page_title":"Hasparren","context_page_description":"Hasparren Fransiyaning Akvitaniya mintaqasida joylashgan kommunadir. Pyrénées-Atlantiques departamenti Bayonne tumani tarkibiga kiradi."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Moravsk%C3%A9_T%C5%99ebov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Su%C5%A1ice%2C_sm%C3%ADr%C4%8D%C3%AD_k%C5%99%C3%AD%C5%BE_v_zahrad%C4%9B_domu_%C4%8Dp._118.jpg","page_title":"Seznam kulturních památek v Moravské Třebové","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Moravská Třebová v okrese Svitavy vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://es.wikipedia.org/wiki/Racionalismo_(arquitectura)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Breuer-FREISCHWINGER.JPG","page_title":"Racionalismo (arquitectura)","context_page_description":"El racionalismo, también llamado Estilo internacional o Movimiento moderno, fue un estilo arquitectónico que se desarrolló en todo el mundo entre 1925 y 1965, aproximadamente. Suele ser considerado como la principal tendencia arquitectónica de la primera mitad del siglo XX. Fue un movimiento de amplio alcance internacional, que se desarrolló por toda Europa, Estados Unidos y numerosos países del resto del mundo. Entre sus figuras sobresalen: Walter Gropius, Ludwig Mies van der Rohe, Le Corbusier, Jacobus Johannes Pieter Oud, Richard Neutra, Rudolf Schindler, Philip Johnson, Alvar Aalto, Eliel y Eero Saarinen, Erik Gunnar Asplund, Josep Lluís Sert, Louis Kahn, Pier Luigi Nervi, Gio Ponti, Kenzō Tange, Lúcio Costa y Oscar Niemeyer.\\nEste movimiento no tiene una designación homogénea en todos los países. En español se suele emplear más el término «racionalismo», aunque en otros países —especialmente en el mundo anglosajón— dicho término se suele circunscribir al ámbito italiano, al racionalismo practicado por el Gruppo 7 y el M.I.A.R."},{"page_url":"https://es.wikipedia.org/wiki/National_Trust_of_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/20051210ChilternLakeViewHouseHomeHenryHandelRichardson_003.jpg","page_title":"National Trust of Australia","context_page_description":"The Australian Council of National Trusts es una organización no gubernamental de Australia, creada para la promoción y la conservación del patrimonio indígena, natural e histórico del país ayudando al trabajo de los State Trusts.\\nSe creó en 1965. A nivel de los Estados y Territorios, existen ocho organismos correspondientes a los Estados siguientes: Territorio de la capital australiana, Nueva Gales del Sur, Territorio del Norte, Queensland, Australia Meridional, Tasmania, Victoria y Australia Occidental.\\nLa organización posee o administra más de 300 sitios históricos, y emplea a 7000 voluntarios benévolos así como 350 permanentes pagados por el Estado. Cada año, los lugares y monumentos administrados por la \\"National Trust\\" reciben a más de un millón de visitantes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Orsi%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Sust_Orsieres.JPG","page_title":"Liste der Kulturgüter in Orsières","context_page_description":"Die Liste der Kulturgüter in Orsières enthält alle Objekte in der Gemeinde Orsières im Kanton Wallis, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B0%D1%81%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Kirche_Laasdorf.JPG","page_title":"Ласдорф","context_page_description":"Ласдорф општина је у њемачкој савезној држави Тирингија. Једно је од 93 општинска средишта округа Зале-Холцланд. Према процјени из 2010. у општини је живјело 528 становника. Посједује регионалну шифру 16074049."},{"page_url":"https://en.wikipedia.org/wiki/Pest_control","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Rat_pest_control_underground.png","page_title":"Pest control","context_page_description":"Pest control is the regulation or management of a species defined as a pest, a member of the animal kingdom that impacts adversely on human activities. The human response depends on the importance of the damage done, and will range from tolerance, through deterrence and management, to attempts to completely eradicate the pest. Pest control measures may be performed as part of an integrated pest management strategy.\\nIn agriculture, pests are kept at bay by cultural, chemical and biological means. Ploughing and cultivation of the soil before sowing mitigate the pest burden and there is a modern trend to limit the use of pesticides as far as possible. This can be achieved by monitoring the crop, only applying insecticides when mandatory, and by growing varieties and crops which are resistant to pests. Where possible, biological means are used, encouraging the natural enemies of the pests and introducing suitable predators or parasites.\\nIn homes and urban environments, the pests are the rodents, birds, insects and other organisms that share the habitat with humans, and that feed on and spoil possessions."},{"page_url":"https://en.wikipedia.org/wiki/Manfred_von_Richthofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Fokker_Dr1_on_the_ground.jpg","page_title":"Manfred von Richthofen","context_page_description":"Manfred Albrecht Freiherr von Richthofen, known in English as Baron von Richthofen, and most famously as the \\"Red Baron\\", was a fighter pilot with the German Air Force during World War I. He is considered the ace-of-aces of the war, being officially credited with 80 air combat victories.\\nOriginally a cavalryman, Richthofen transferred to the Air Service in 1915, becoming one of the first members of fighter squadron Jagdstaffel 2 in 1916. He quickly distinguished himself as a fighter pilot, and during 1917 became leader of Jasta 11 and then the larger fighter wing unit Jagdgeschwader 1, better known as \\"The Flying Circus\\" or \\"Richthofen's Circus\\" because of the bright colours of its aircraft, and perhaps also because of the way the unit was transferred from one area of allied air activity to another – moving like a travelling circus, and frequently setting up in tents on improvised airfields. By 1918, Richthofen was regarded as a national hero in Germany, and respected by his enemies.\\nRichthofen was shot down and killed near Vaux-sur-Somme on 21 April 1918. There has been considerable discussion and debate regarding aspects of his career, especially the circumstances of his death."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B4%D0%B0%D0%BD_(%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B5%D0%BD%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Short_Sunderland_Mk_V.jpg","page_title":"Редан (корабостроене)","context_page_description":"Реда́н – „стъпало“ на дъното на глисиращите катери. Биват напречни и надлъжни редани. Служат за намаляване на мократа повърхност и, съответно, за намаляване на уменьшения съпротивлението.\\nВ межвоенното време СССР е единствената водеща морска държава, която строи торпедни катери реданен тип. Англия, Германия, САЩ и другите страни преминават към строителството на мореходни килови торпедни катери. Такива катери отстъпват на реданните по скорост в спокойно море, но съществено ги превъзхождат при вълнение 3 – 4 бала, а също носят по-мощно артилерийско и торпедно въоръжение.\\nПревъзходството на киловите катери над реданните става очевидно в хода на войната на правительството на САЩ с контрабандистите при източното крайбрежие на страната през 1921 – 1933 г., по време на сухия закон."},{"page_url":"https://tr.wikipedia.org/wiki/Ponte_da_Barca","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Ponte_da_barca.jpg","page_title":"Ponte da Barca","context_page_description":"Ponte da Barca belediyesi, Portekiz'in Norte bölgesine bağlı Minho-Lima altbölgesinin belediyelerinden biridir."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D9%87%D8%A7%D9%86%D8%B3_%D9%83%D9%88%D8%B3%D9%83%D9%8A%D9%86%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Johannes_Koskinen_2.2020_%28cropped%29.jpg","page_title":"جوهانس كوسكينين","context_page_description":"جوهانس كوسكينين ‏ هو سياسي فنلندي، ولد في 10 ديسمبر 1954 في فنلندا. حزبياً، نشط في الحزب الاشتراكي الديمقراطي الفنلندي."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%A7%82%E7%9C%8B%E6%AC%A1%E6%95%B0%E6%9C%80%E5%A4%9A%E7%9A%84YouTube%E9%9F%A9%E5%9B%BD%E9%9F%B3%E4%B9%90%E8%A7%86%E9%A2%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Psy_performing_Gangnam_Style_at_the_Future_Music_Festival_2013.jpg","page_title":"观看次数最多的YouTube韩国音乐视频列表","context_page_description":"此列表列出在YouTube上观看次数最多的100部韩国流行音乐视频。部分视频也同属“10亿俱乐部”观看次数已经突破10亿。目前PSY的GANGNAM STYLE、GENTLEMAN，BLACKPINK的DDU-DU DDU-DU，防弹少年团的DNA是在YouTube上达到这个里程碑的4部K-Pop音乐视频。\\n截至今日，7部视频超过9亿的播放次数，8部视频超过8亿的播放次数、12部视频超过7亿的播放次数、14部视频超过6亿的播放次数、21部视频超过5亿的播放次数、30部视频超过4亿的播放次数、39部视频超过3亿的播放次数、62部视频超过2亿的播放次数。"},{"page_url":"https://sk.wikipedia.org/wiki/Zeln%C3%BD_trh_(Brno)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Zeln%C3%BD_trh_6683.JPG","page_title":"Zelný trh (Brno)","context_page_description":"Zelný trh je námestie v brnianskej štvrti Brno-město. Leží na svahu tesne pod Petrovom, asi 400 metrov južne od centrálneho Náměstí Svobody, a má približne obdĺžnikový tvar. Väčšina plochy sa v časti roka využíva ako trhovisko, na ktorom sa predáva ovocie, zelenina, kvetiny a i., inak námestie slúži predovšetkým ako parkovisko.\\nV roku 2010 bol verejnosti predstavený, neskôr zamietnutý, zámer súkromného investora vybudovať v dolnej časti námestia podzemné garáže so 60 parkovacími miestami."},{"page_url":"https://pl.wikipedia.org/wiki/Edmund_Prys","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Translator%27s_Memorial%2C_St_Asaph_-_geograph.org.uk_-_609059.jpg","page_title":"Edmund Prys","context_page_description":"Edmund Prys – walijski duchowny anglikański, poeta tworzący w języku walijskim i tłumacz Psalmów."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9A%E1%83%A3%E1%83%98_II_(%E1%83%99%E1%83%9D%E1%83%9C%E1%83%93%E1%83%94%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%98%E1%83%9C%E1%83%AA%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/R%C3%A9ception_du_Grand_Cond%C3%A9_%C3%A0_Versailles_%28Jean-L%C3%A9on_G%C3%A9r%C3%B4me%2C_1878%29.png","page_title":"ლუი II (კონდეს პრინცი)","context_page_description":"ლუი II დე ბურბონ-კონდე, მეტსახელად დიდი კონდე — ბურბონთა დინასტიის კონდეს შტოს წარმომადგენელი. კონდეს პრინც ანრი II-ისა და შარლოტ მარგარიტა დე მონმორანსის უფროსი ვაჟი და კონდეს პრინცი 1646-86 წლებში."},{"page_url":"https://de.wikipedia.org/wiki/Albert_Francis_Birch","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Albert_Francis_Birch00.jpg","page_title":"Albert Francis Birch","context_page_description":"Albert Francis Birch, genannt Francis Birch, war ein US-amerikanischer Geophysiker. Birch war der Sturgis Hooper Professor für Geologie an der Harvard University von 1949 bis 1974."},{"page_url":"https://sv.wikipedia.org/wiki/Soten,_Dalarna","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Soten_och_K%C3%A4mpeladan.jpg","page_title":"Soten, Dalarna","context_page_description":"Soten är en sjö i Hedemora kommun i Dalarna och ingår i Norrströms huvudavrinningsområde. Sjön är 8 meter djup, har en yta på 0,165 kvadratkilometer och befinner sig 176,2 meter över havet."},{"page_url":"https://oc.wikipedia.org/wiki/Buset","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/31_-_Buzet-sur-Tarn_-_la_halle.jpg","page_title":"Buset","context_page_description":"Buset o Buset de Tarn es una comuna lengadociana situada dins le departament de la Nauta Garona e la region d'Occitània, ancianament de Miègjorn-Pirenèus."},{"page_url":"https://cs.wikipedia.org/wiki/Adolf_Wiesner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Adolf_Wiesner_-_Autoportr%C3%A9t.jpg","page_title":"Adolf Wiesner","context_page_description":"Adolf Wiesner byl český akademický malíř a ilustrátor."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%8C%97%E4%BA%AC%E5%85%AC%E4%BA%A4%E7%89%B913%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%E9%87%91%E5%88%9A%E5%8F%8C%E5%B1%82.jpg","page_title":"北京公交特13路","context_page_description":"北京公交特13路，是中國北京市的一條公交線路。"},{"page_url":"https://hu.wikipedia.org/wiki/Florence_and_the_Machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Florence_and_the_Machine_at_Coachella.jpg","page_title":"Florence and the Machine","context_page_description":"A Florence and the Machine angliai Indie rock zenekar, aminek Florence Welch énekesnő, Isabella \\"Machine\\" Summers, és egy csapat zenész a tagja, akik a háttérzenéért felelősek. Az együttes zenéje sok dicséretet kapott a médiától, főleg a BBC-től, mielőtt nagyobb sikereket értek volna el. A BBC nagy szerepet játszott a zenekar befutásában; az együttest a BBC Introducing című műsorban népszerűsítették.\\nAz együttes debütáló albuma, a Lungs, 2009. július 6-án jelent meg, és ezután öt hétig második volt a UK Albums Chart listáján. 2010. január 17-én az album az első helyre került, miután 28 egymást követő héten is szerepelt a listán. Az album 2010 októberében már 25. hete szerepelt folyamatosan az Egyesült Királyságban a legjobb 40 album listáján, ezzel ez a lemez vált az egyik legjobban fogyó albummá 2009-ben és 2010-ben. A zenekar második stúdióalbuma, a Ceremonials, 2011 októberében jelent meg, és az Egyesült Királyságban első helyen, míg az Egyesült Államokban a 6. helyen debütált.\\nA Florence and the Machine hangzását többfajta stílus alkotja, például a Rock és a Soul. A Lungs elnyerte a MasterCard British Album díjat a 2010-es Brit Awardson."},{"page_url":"https://en.wikipedia.org/wiki/Evgeny_Buryakov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Evgeny_Buryakov.png","page_title":"Evgeny Buryakov","context_page_description":"Evgeny Evgenievich Buryakov is a convicted Russian spy. He was arrested on January 26, 2015, charged with, and pleading guilty to, spying on the United States for the Russian Foreign Intelligence Service. Buryakov was a New York-based Deputy Representative of Vnesheconombank, Russia's state-owned national development bank. Buryakov operated with non-official cover, and was thus not entitled to diplomatic immunity. Buryakov conducted his espionage with the assistance of Igor Sporyshev, Trade Representative of the Russian Federation to New York, and Victor Podobnyy, an Attaché to the Permanent Mission of the Russian Federation to the United Nations. In exchange for pleading guilty, Buryakov received a reduced sentence of 30 months in federal prison and fined $100,000. He was released early from prison on 31 March 2017 and deported from the United States six days later."},{"page_url":"https://pt.wikipedia.org/wiki/In_Orange","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Orange_roman_theatre.jpg","page_title":"In Orange","context_page_description":"The Cure In Orange é um vídeo do concerto ao vivo da banda Britânica, The Cure, em 9 de Agosto de 1986, no antigo teatro romano da província de \\"Orange\\", no sul da França.\\nEste concerto decorre envolvido num ambiente algo misterioso e sombrio, ao fim do dia e pela noite dentro, com um sublime antigo teatro Romano servindo de cenário. Os membros da banda, Robert Smith, Simon Gallup, Porl Thompson, Boris Williams e Laurence Tolhurst, apresentam-nos os The Cure no seu melhor ao longo de 23 músicas que percorrem toda a sua carreira até então. Versões míticas, tais como a \\"A Play For Today\\" a \\"A Strange Day\\" a \\"Charlotte Sometimes\\" e a extremamente emotiva \\"Faith\\" são algumas das preciosidades que podemos encontrar neste vídeo gravado de forma pouco ortodoxa por Tim Pope.\\nEm 1986 a banda tinha editado uma compilação de singles que estava a ter um enorme sucesso, sendo até à data o álbum mais vendido dos Cure. Tal como o álbum, a tour estava a ser um sucesso até aí nunca alcançado e era o momento ideal para fazerem um filme para a posteridade."},{"page_url":"https://en.wikipedia.org/wiki/Emperor_(dragonfly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Female_blue_emperor_%28Anax_imperator%29_depositing_eggs.jpg","page_title":"Emperor (dragonfly)","context_page_description":"The emperor dragonfly or blue emperor is a large species of hawker dragonfly of the family Aeshnidae, averaging 78 millimetres in length."},{"page_url":"https://en.wikipedia.org/wiki/L%C3%A1szl%C3%B3_G%C3%B6r%C3%B6g_(actor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/G%C3%B6r%C3%B6g_L%C3%A1szl%C3%B3.jpg","page_title":"László Görög (actor)","context_page_description":"László Görög is a Hungarian actor as well as voice actor mostly known for his roles in Samba, Argo and Jumurdzsák gyürüje. He was born in Debrecen."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%8D%E6%96%AF%C2%B7%E7%83%8F%E6%8B%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Enes_nal-1478467303.jpg","page_title":"納斯·烏拿","context_page_description":"纳斯·乌拿是土耳其的职业足球运动员，司职前锋，现由西甲俱乐部比利亚雷阿尔外借至巴利亚多利德。"},{"page_url":"https://ro.wikipedia.org/wiki/Loc_de_joac%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/PlayEquipComboPlastic_wb.jpg","page_title":"Loc de joacă","context_page_description":"Un loc de joacă este un spațiu special amenanjat pentru copii. Multe dintre acestea sunt echipate cu gropi cu nisip, roată, balansoare, scrâncioburi, tobogane, arcade de cățărat și altele.\\nTotodată in toate locurile de joacă din România și restul Europei in locurile de joacă suprafața de jos trebuie sa fie protectoare la cădere. Acest lucru se poate realiza in România cu nisip, iarbă sau dale din cauciuc."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%A8%D7%99_A15","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Baghdad%2C_2013_%288559351173%29.jpg","page_title":"שרי A15","context_page_description":"שרי A15 היא מכונית משפחתית המוגדרת כמכונית קומפקטית, מתוצרת יצרנית הרכב הסינית Chery אשר יוצרה בסין בין השנים 2003–2010.\\nבנוסף דגם ה-\\"שרי A15\\" יוצר באוקראינה על ידי \\"ZAZ\\" וברוסיה על ידי יצרן הרכב הרוסי \\"Avtotor\\" ויצרן הרכב \\"TagAZ\\"."},{"page_url":"https://de.wikipedia.org/wiki/Kapuzen-Ameisenw%C3%BCrger","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Black-hooded_Antshrike_%28Drake_Bay%29.jpg","page_title":"Kapuzen-Ameisenwürger","context_page_description":"Der Kapuzen-Ameisenwürger zählt innerhalb der Familie der Ameisenvögel zur Gattung Thamnophilus. Der lateinische Artzusatz bezieht sich auf den US-amerikanischen Botaniker und Zoologen Thomas Charles Bridges.\\nDie Art kommt in Costa Rica und in Panama vor. Das Verbreitungsgebiet umfasst tropischen oder subtropischen feuchten Tieflandwald, Mangrovenwälder, Galeriewald und ehemals baumbestandene Flächen gelegentlich bis 1100 m Höhe."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%89%EB%A9%B4%EC%9D%98_%EA%B2%B0%EC%A0%95%EA%B5%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Wallpaper_group-pg-1.jpg","page_title":"평면의 결정군","context_page_description":"평면의 결정군 또는 평면의 대칭군, 벽지군은 2차원 평면을 채우는 반복적인 패턴에 대해, 이 패턴들을 각 패턴이 가지고 있는 대칭성을 기준으로 하는 군으로 분류하는 방법이다. 이 패턴들은 총 17개의 군으로 분류할 수 있다. 평면의 결정군은 2차원 공간군에 속한다.\\n평면을 덮을 수 있는 무늬에는 여러 가지가 존재하지만, 특정한 정사각형 모양의 패턴을 반복해서 만들 수 있는 무늬에는 대칭성이 제한적으로 존재한다. 다른 무늬를 가지고 있는 패턴이라도 같은 대칭성을 가질 수 있으며, 이러한 같은 대칭성을 가지는 패턴들을 하나로 묶어서 분류할 수 있다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%93%D0%94%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Barlach_1988_obv.jpg","page_title":"Памятные монеты ГДР","context_page_description":"Памятные монеты Германской Демократической Республики выпускали с 1966 по 1990 год. За это время отчеканили 122 монетных типа номиналом в 5, 10 и 20 марок. К созданию монет привлекали лучших художников, скульпторов и медальеров ГДР. Особенность их создания и циркуляции заключалась в том, что большинство типов предназначались для продажи немцам из ФРГ в магазинах сети Intershop. Памятные монеты для оборота чеканили исключительно из неблагородных металлов большими тиражами. Они посвящены эпизодам из истории ГДР, видным деятелям коммунистической партии и идеологам марксизма."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Little_Rock,_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/AR_LR_Central_High.jpg","page_title":"National Register of Historic Places listings in Little Rock, Arkansas","context_page_description":"This is a list of the National Register of Historic Places listings in Little Rock, Arkansas.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Little Rock, Arkansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 338 properties and districts listed on the National Register in Pulaski County, including 5 National Historic Landmarks, and 20 properties that were once listed but have been removed. The city of Little Rock includes 257 of these properties and districts, including four of the National Historic Landmarks and 16 of the delisted properties; they are listed here, while the remainder are listed separately.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D1%80%D0%B0%D0%B2%D1%8C%D0%B8%D0%BD%D1%8B%D0%B5_%D0%BB%D1%8C%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/20170902Euroleon_nostras3.jpg","page_title":"Муравьиные львы","context_page_description":"Муравьи́ные львы́ — семейство насекомых из отряда сетчатокрылых. Четырёхкрылые, напоминающие стрекоз, насекомые с размахом крыльев до 15 см. Усики к концу булавообразно утолщены. Крылья длинные, с густой сетью жилок, полностью прозрачные или с тёмным рисунком, в покое складываются крышеобразно, полностью или частично прикрывая длинное и тонкое брюшко. Летают медленно. Взрослые муравьиные львы являются хищниками, охотящимися на летающих насекомых.\\nРазвитие с полным превращением: имеются стадии яйца, личинки, куколки и имаго. Личинки отличаются большими, зазубренными на внутреннем краю, снабжёнными каналом челюстями и коротким широким брюшком. Являются активными хищниками, у большинства видов подстерегают добычу, зарывшись у поверхности почвы, или сооружают характерные воронкообразные ямки-ловушки в песчаных почвах, в которые ловят мелких насекомых, закопавшись в песок. Окукливаются в шелковистом коконе; куколка свободная.\\nРаспространены преимущественно в субтропиках и тропиках. В мировой фауне описано по различным оценкам от 1,8 до 2 тысяч видов, на территории России обитает 34 вида."},{"page_url":"https://en.wikipedia.org/wiki/Heinz_Stuy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ajax_keeper_Heinz_Stuy%2C_Bestanddeelnr_928-0503.jpg","page_title":"Heinz Stuy","context_page_description":"Heinz Stuy is a former Dutch football goalkeeper who played for AFC Ajax and was part of their European Cup victories in 1971, 1972 and 1973.\\nHeinz Stuy - nicknamed Heinz Kroket, because he would sometimes drop a ball as if it were a hot croquette - won with Ajax in the golden era of the club the Intercontinental Cup, three European Cups, two European Super Cups, four league titles and three Dutch cups. Thus, together with Bayern Munich player of the 1970s and 1980s Bernd Dürnberger, he holds the record for being the player having won the most major club titles without having ever played for the national team of his country.\\nStuy holds, behind Bayern Munich's Sepp Maier the record for most minutes played by a goalkeeper without conceding in the European Cup final. Maier accumulated 276 consecutive unbeaten minutes between 1974 and 1976."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%A4%D5%AC%D5%B8%D5%AF_%D5%A4%D5%A1%D5%B7%D5%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Hadlock_Field1-2%2C_Dudesleeper.jpg","page_title":"Հադլոկ դաշտ","context_page_description":"Հադլոկ դաշտ, Պորտլանդում Փոքր Լիգայի բեյսբոլի մարզադաշտ է: Այն հիմնականում տեղավորվում է Արևելյան լիգայի Պորտլանդական ծովային շների համար և Պորտլենդի ավագ դպրոցի բուլ շների և Դիերինգ ավագ դպրոցի բեյսբոլի թիմերին: Մարզադաշտը կոչվում է Էդսոն Ջ. Հադլոկի անունով, որը երկար ժամանակ եղել է Պորտլանդի ավագ դպրոցի բեյսբոլի մարզիչ և ֆիզիկայի ուսուցիչ:"},{"page_url":"https://nl.wikipedia.org/wiki/Chindrieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Chindrieux_Ch%C3%A2tillon_1.JPG","page_title":"Chindrieux","context_page_description":"Chindrieux is een gemeente in het Franse departement Savoie en telt 1092 inwoners. De plaats maakt deel uit van het arrondissement Chambéry. In de gemeente ligt spoorwegstation Chindrieux."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%DB%8C%D8%A8%D8%A7%D9%84_%D9%82%D9%87%D8%B1%D9%85%D8%A7%D9%86%DB%8C_%D9%85%D8%B1%D8%AF%D8%A7%D9%86_%D8%AC%D9%87%D8%A7%D9%86_%DB%B2%DB%B0%DB%B1%DB%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Milano_skyline.jpg","page_title":"والیبال قهرمانی مردان جهان ۲۰۱۸","context_page_description":"اف آی وی بی والیبال قهرمانی مردان جهان ۲۰۱۸ نوزدهمین دوره قهرمانی جهان، که در سال ۲۰۱۸ به صورت مشترک به میزبانی دو کشور ایتالیا و بلغارستان برگزار شد. این دو کشور در سال ۲۰۱۵ میزبان مسابقات قهرمانی اروپا ۲۰۱۵ بودند. لهستان و برزیل به فینال این دوره قهرمانی مردان جهان رسیدند. فینال در پالا آلپیتور برگزار شد و در نهایت لهستان با پیروزی ۳ بر ۰ مقابل برزیل برای دو بار پیاپی قهرمان شد."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%84%D9%8A%D8%A9_%D9%81%D8%A7%D8%AA%D9%83%D8%A9_%D8%B7%D8%A8%D9%8A%D8%B9%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Human_Natural_Killer_Cell_%2829228845335%29.jpg","page_title":"خلية فاتكة طبيعية","context_page_description":"الخلايا الفاتكة الطبيعية أو الخلايا القاتلة الطبيعية ‏ هي نوع من اللمفاويات السامة للخلايا التي تشكل مكون أساسي في الجهاز المناعي الفطري.\\nدور الخلايا القاتلة الطبيعية هو مشابه لدور الخلايا التائية السامة للخلايا في الاستجابة المناعية التكيفية عند الفقاريات. تلعب الخلايا القاتلة الطبيعية دوراً مهماً في رفض ولفظ الأورام والخلايا المخموجة بالفيروسات. تطلق هذه الخلايا حبيبات هيولية صغيرة من البروتينات تدعى برفورين perforin وغرانزيم granzyme تسبب موت الخلية الهدف بعملية الموت الخلوي.\\nتُعرّف الخلايا القاتلة الطبيعية بأنها خلايا لمفاوية حبيبية كبيرة لا تملك مستقبلات مستضدات الخلايا التائية أو واصمات الخلايا التائية الشاملة أو مستقبلات الخلايا البائية السطحية للغلوبولينات المناعية، إنّما تُعبّر الخلايا القاتلة السطحية عن: الواصمات السطحية كتلة التمايز 16 أي وجزيئات التصاق الخلايا العصبية في الإنسان، و NK1.1/NK1.2 في سلالات معينة من الفئران.\\nسُمّيت الخلايا \\"القاتلة الطبيعية\\" بهذا الاسم بسبب الانطباع الأولي بأنّ هذه الخلايا لا تحتاج إلى تفعيل كي تقتل الخلايا التي تفتقد واصمات الذات لمعقد التوافق النسيجي الكبير من النمط الأول I. على أية حال، تُعرف هذه الخلايا اليوم على أنها خلايا يتم تفعيلها."},{"page_url":"https://pl.wikipedia.org/wiki/Falowiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Gda%C5%84sk_Nowy_Port_-_balkony_falowca.JPG","page_title":"Falowiec","context_page_description":"Falowiec – typ budynku mieszkalnego, którego bryła i układ balkonów przypominają falę, a wejścia do mieszkań usytuowane są na galeriach, połączonych ze sobą klatkami schodowymi. Ten typ występuje w Polsce i we Włoszech."},{"page_url":"https://cy.wikipedia.org/wiki/Byron,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Byron%2C_IL_Post_Office_03.JPG","page_title":"Byron, Illinois","context_page_description":"Dinas yn Byron Township[*], yn nhalaith Illinois, Unol Daleithiau America yw Byron, Illinois. ac fe'i sefydlwyd ym 1835."},{"page_url":"https://is.wikipedia.org/wiki/Aleppofura","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Pinus_halepensis_range.png","page_title":"Aleppofura","context_page_description":"Aleppofura er furutegund sem er ættuð frá Miðjarðarhafssvæðinu. Útbreiðslusvæðið er frá Marokkó, Alsír og Spáni norður til suður Frakklands, Ítalíu, Króatíu, Svartfjallalands, Albaníu og austur til Grikklands, í Möltu og norður Túnis, með stofna í Sýrlandi, Líbanon, suður Tyrklandi, Jórdaníu, Ísrael og Palestínu."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A6%E0%A7%8D%E0%A6%AC%E0%A6%BF%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%B8%E0%A7%8D%E0%A6%A4%E0%A7%8D%E0%A6%B0%E0%A6%BE%E0%A6%A4%E0%A7%8B%E0%A6%A8_%E0%A6%B8%E0%A7%8B%E0%A6%A4%E0%A7%87%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Coin_of_Strato_II.jpg","page_title":"দ্বিতীয় স্ত্রাতোন সোতের","context_page_description":"দ্বিতীয় স্ত্রাতোন সোতের একজন ইন্দো-গ্রিক রাজা ছিলেন, যিনি আনুমানিক ২৫ খ্রিস্টপূর্বাব্দ হতে ১০ খ্রিস্টপূর্বাব্দ পর্য্যন্ত পূর্ব পাঞ্জাব অঞ্চল শাসন করেন।"},{"page_url":"https://de.wikipedia.org/wiki/Communaut%C3%A9_de_communes_de_la_Porte_des_Vosges_M%C3%A9ridionales","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Gemeindeverband_Porte_des_Vosges_M%C3%A9ridionales_2019.png","page_title":"Communauté de communes de la Porte des Vosges Méridionales","context_page_description":"Die Communauté de communes de la Porte des Vosges Méridionales ist ein französischer Gemeindeverband mit der Rechtsform einer Communauté de communes im Département Vosges in der Region Grand Est. Sie wurde am 1. Januar 2017 gegründet und umfasst 10 Gemeinden. Der Verwaltungssitz befindet sich im Ort Saint-Étienne-lès-Remiremont."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Brusturi,_Bihor","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Biserica_de_lemn_din_Brusturi.jpg","page_title":"Biserica de lemn din Brusturi, Bihor","context_page_description":"Biserica de lemn din Brusturi se află în stațiunea Băile Felix din județul Bihor și a fost ridicată în anul 1785, înlocuind o mai veche biserică de lemn. În urma construirii unei noi biserici de zid, comunitatea din Brusturi renunță la biserica de lemn care este mutată în anul 1961 la Oradea. Reasamblată și restaurată în curtea Muzeului Țării Crișurilor, biserica de lemn din Brusturi a fost mutată pentru a doua oară, în actuala locație din centrul stațiunii Băile Felix ca urmare a retrocedării clădirii ce adăpostea muzeul, fostului proprietar Episcopia romano-catolică din Oradea. Hramul bisericii este Sfinții Arhangheli Mihail și Gavriil. Se află pe noua listă a monumentelor istorice sub codul LMI: cod LMI BH-II-m-B-01104."},{"page_url":"https://id.wikipedia.org/wiki/Kaisar_Gaozong_dari_Tang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Gaozong_of_Tang.jpg","page_title":"Kaisar Gaozong dari Tang","context_page_description":"Kaisar Gaozong, terlahir Li Zhi, adalah Kaisar Dinasti Tang ketiga, berkuasa dari tahun 649 hingga 683. Kaisar Gaozong adalah putra dari Taizong.\\nPada masa menjelang akhir kekuasaannya, Kaisar Gaozong banyak dibantu oleh Wu Zetian akibat serangan stroke yang menimpanya. Ia menyerahkan semua urusan negara kepada istrinya dan setelah Gaozong meninggal pada tahun 683, kekuasaan penuh jatuh ke tangan Wu Zetian.\\nSejarawan memandang Kaisar Gaozong sebagai penguasa yang lemah dan menyerahkan urusan negara kepada istrinya. Selama awal kekuasaannya, perluasan kekuasaan Tang yang dimulai Kaisar Taizong berlanjut, meliputi penaklukan Baekje, Goguryeo, dan Tujue Barat. Namun pada tahun 670-an, wilayah yang telah direbut jatuh ke tangan Tufan, Silla, Khitan dan Balhae. Lebih buruk lagi, wilayah Tujue Barat dan Timur terus mengalami pemberontakan."},{"page_url":"https://de.wikipedia.org/wiki/Spiegel","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Neuwaldteich_schoeneck_vogtland.jpg","page_title":"Spiegel","context_page_description":"Ein Spiegel ist eine reflektierende Fläche – glatt genug, dass reflektiertes Licht nach dem Reflexionsgesetz seine Parallelität behält und somit ein Abbild entstehen kann. Die Rauheit der Spiegelfläche muss dafür kleiner sein als etwa die halbe Wellenlänge des Lichts. Eine rauere weiße Fläche remittiert ebenfalls alles Licht, jedoch wird dieses hierbei ungeordnet in alle Richtungen gestreut.\\nAuch nicht sichtbare elektromagnetische Wellen und Schallwellen können an geeigneten Flächen gespiegelt werden.\\nDie Transparenz und Absorption des Spiegels hat Einfluss auf Helligkeit und Farbe des Spiegelbildes. Ferner wird niemals die gesamte Energie gespiegelt, es gibt immer einen Verlust – der Reflexionsgrad ist immer kleiner als 100 %."},{"page_url":"https://fr.wikipedia.org/wiki/Manuel_Mil%C3%A0_i_Fontanals","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Mil%C3%A0_i_Fontanals_-_Bust_al_Parc_de_la_Ciutadella.JPG","page_title":"Manuel Milà i Fontanals","context_page_description":"Manuel Milà i Fontanals, né le 4 mai 1818 à Vilafranca del Penedès et mort le 16 juillet 1884 dans la même ville, est un philologue, érudit et écrivain en langue castillane et en catalan. Il est considéré comme l'un des impulseurs de la renaissance de la langue catalane au XIXᵉ siècle, la Renaixença, pour ses efforts entrepris dans la restauration des Jeux floraux et dans le champ de l'orthographe."},{"page_url":"https://en.wikipedia.org/wiki/Traveler_(mascot)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Usctravelerandband.jpg","page_title":"Traveler (mascot)","context_page_description":"Traveler is a horse who is the mascot of the University of Southern California. Traveler appears at all USC home football games in the Los Angeles Memorial Coliseum as well as many other outdoor events, including numerous Rose Parades. The current horse is Traveler IX. Although the Traveler web site describes Traveler as \\"pure white,\\" most of the horses who have served as Traveler are actually gray horses whose hair coats have become completely white. The rider, dressed as an idealized Trojan warrior, is often mistaken for Tommy Trojan, the Trojan portrayed in USC's famous Trojan Shrine statue; however, the rider is unnamed and simply designated as a Trojan warrior with the horse as the official mascot. On November 6, 2013, the costumed version of Tommy and Traveler were introduced for men's and women's basketball games."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E7%BE%8E%E6%B4%B2%E5%8E%86%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Historisch_Nordamerika.jpg","page_title":"北美洲历史","context_page_description":"北美洲历史是北美洲地区人类既往的活动。普遍认为，人类跨越白令海来到北美洲的时间，是大约17,000年至40,000年前。但近年来的发现表明，北美洲最早的人类活动，可能还要向前追溯90,000年。从最早的人类抵达北美开始，人类的活动范围逐渐蔓延到整个北美大陆，从因纽特到阿兹特克和玛雅，都分布有简易的人类定居点，甚至是早期的城镇。这些孤立社群发展出了他们自己独特的生活方式和文化，而文明之间的交流则相对有限。而后来同大洋彼岸的亚欧之间的的贸易活动和武装冲突，改变了北美族群间孤立的局面。\\n进入大航海时代后，欧洲人陆续到达美洲，并开始殖民。虽然有证据显示中国人在至少5世纪就已经到达北美，但哥伦布仍是欧洲公认的最早发现新大陆的人。此后，欧洲人涌入美洲，使得当地人不堪重负，北美成为欧洲的政治竞争舞台，几乎被英国、法国和西班牙瓜分。在今天的北美文化中，殖民的烙印清晰可见。\\n欧洲各方势力在北美洲抢夺资源，而资源分配的不均导致了随之而来的战争。但与此同时，这些欧洲的殖民地也逐渐萌发了独立思想。美国革命和墨西哥独立战争等革命运动产生了新兴的独立国家，这些国家成为了北美洲新的政治主导力量。1867年加拿大的联邦成立，展现了北美洲全新的现代政治面貌。\\n从19到21世纪，北美洲国家与其他地区的联系越来越紧密。虽然冲突时有发生，但是北美大陆大体保持了安定和平，国际开放商业贸易合作频繁。但现今自由贸易区、拉丁美洲移民和毒品贩运等问题，一直困扰着北美地区的进一步发展。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_basilieken","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/St_Petrus_Boxtel_7810.jpeg","page_title":"Lijst van basilieken","context_page_description":"Een basiliek is een eretitel voor een katholiek kerkgebouw met een bijzondere betekenis. Dit kan zijn omdat de kerk van groot historische belang is, omdat er een bijzonder reliek ligt, of omdat de kerk het centrum is van een bepaalde devotie of bedevaart. De eretitel wordt door de paus toegekend.\\nEr wordt een onderscheid gemaakt tussen verschillende basilieken. Zo zijn er basilieken met de titel basilica maior en die met de titel basilica minor. Onder die laatste groep vallen ook de zogenaamde Patriarchale basilicae minores. Verreweg de meeste basilieken vallen onder de groep basilica minor, zo'n 1500 wereldwijd."},{"page_url":"https://pt.wikipedia.org/wiki/Pr%C3%AAmio_Kavli","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Marcus_Raichle_2014.jpg","page_title":"Prêmio Kavli","context_page_description":"O Prêmio Kavli foi estabelecido em 2005 mediante uma joint venture entre a Academia de Ciências e Letras da Noruega, o Ministério da Educação e Pesquisa e a Fundação Kavli. O principal objetivo do prêmio é honrar, suportar e reconhecer pesquisadores por trabalho científico de destaque nos campos da astrofísica, nanotecnologia e neurociência, concedendo três prêmios a cada dois anos. O Prêmio Kavli foi entregue a primeira vez em Oslo, em 9 de setembro de 2008. Os prêmios foram apresentados por Sua Alteza Real Haquino Magno da Noruega. Cada um dos três prêmios consiste em uma medalha de ouro, um pergaminho e um valor monetário de 1 milhão de dólares."},{"page_url":"https://it.wikipedia.org/wiki/Citt%C3%A0_globale","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/ChristSaviourCathedral_Views_May_2012_18.jpg","page_title":"Città globale","context_page_description":"Una città globale o mondiale corrisponde a un concetto di città con una serie di caratteristiche nate grazie all'effetto della globalizzazione e alla costante crescita dell'urbanizzazione."},{"page_url":"https://no.wikipedia.org/wiki/Rakiura_Track","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Rakiura_Track_Stewart_Island_NZ_01.jpg","page_title":"Rakiura Track","context_page_description":"Rakiura Track er en 29 km lang turrute på Stewart Island i New Zealand.\\nTurruten ligger inne i nasjonalparken Rakiura nasjonalpark. Turen kan gjennomføres på ca tre dager. Store deler av ruten følger kystlinja, den midtre delen følger bratte åser med kratt og tett skog. Det er to hytter man kan overnatte på langs ruten, en ved Port William og en ved North Arm. Langs ruten kan man også være heldig og se de utrydningstruede kiviene på nært hold i sitt naturlige miljø."},{"page_url":"https://en.wikipedia.org/wiki/1960s_in_music","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/The_Beatles_i_H%C3%B6torgscity_1963.jpg","page_title":"1960s in music","context_page_description":"In North America and Europe the decade was particularly revolutionary in terms of popular music, as it saw the evolution of rock. At the beginning of the 1960s, pop and rock and roll trends of the 1950s continued; nevertheless, the rock and roll of the decade before started to merge into a more international, eclectic variant. In the early-1960s, rock and roll in its purest form was gradually overtaken by pop rock, beat, psychedelic rock, blues rock, and folk rock, which had grown in popularity. The country- and folk-influenced style associated with the latter half of 1960s rock music spawned a generation of popular singersongwriters who wrote and performed their own work. Towards the decade's end, genres such as Baroque pop, sunshine pop, bubblegum pop, and progressive rock started to grow popular, with the latter two finding greater success in the following decade. Furthermore, the 1960s saw funk and soul music rising in popularity; rhythm and blues in general remained popular. The fusion of R&B, Gospel -and original rock and roll was a success until the mid-part of the decade."},{"page_url":"https://en.wikipedia.org/wiki/Ludwik%C3%B3w,_Radom_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Ludwik%C3%B3w_-_fotopolska.eu_%28316203%29.jpg","page_title":"Ludwików, Radom County","context_page_description":"Ludwików is a village in the administrative district of Gmina Jedlińsk, within Radom County, Masovian Voivodeship, in east-central Poland."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D0%B7%D0%B0,_%D0%9F%D0%B5%D1%82%D1%80%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Petru_Groza_Anefo.jpg","page_title":"Гроза, Петру","context_page_description":"Пе́тру Гро́за — румынский государственный и политический деятель. Активный антифашист, глава первого демократического правительства после Второй мировой войны, симпатизировал коммунистическому движению."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Township,_Logan_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Map_of_Logan_County_Ohio_Highlighting_Lake_Township.png","page_title":"Lake Township, Logan County, Ohio","context_page_description":"Lake Township is one of the seventeen townships of Logan County, Ohio, United States. As of the 2010 census, the population was 12,534, making it the largest in population in Logan County."},{"page_url":"https://no.wikipedia.org/wiki/Mo_(Modalen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Mo_kirke1.jpg","page_title":"Mo (Modalen)","context_page_description":"Mo er administrasjonssenteret i Modalen kommune i Hordaland, og ligger innerst i Mofjorden.\\nBygden har ikke mer en rundt 100 innbyggere. Her ligger Mo kirke og en liten butikk. Dette er et av de få stedene i Modalen som har butikk. Adkomsten til Mo går via Fv 346 ved Nye Otterstad bro. 569Fylkesvei 569 går også litt utenfor Mo sentrum. I Modalen ligger også et hotell som blir drevet av noen islendinger som tok over driften i 2009."},{"page_url":"https://vo.wikipedia.org/wiki/Patagonia_(Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Santa_Cruz_County_Incorporated_and_Unincorporated_areas_Patagonia_highlighted.svg","page_title":"Patagonia (Arizona)","context_page_description":"Patagonia binon zif in komot: Santa Cruz, in tat: Arizona, in Lamerikän."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_ve_Star%C4%8Di","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Jan_Sarkander_Sta%C5%99e%C4%8D.JPG","page_title":"Seznam kulturních památek ve Starči","context_page_description":"Tento seznam nemovitých kulturních památek v městysi Stařeč v okrese Třebíč vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://nl.wikipedia.org/wiki/Wereldkampioenschappen_noords_ski%C3%ABn_2011","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/2011-02-26_-_WCH_2011_Skijumping_NH_-_Podium.jpg","page_title":"Wereldkampioenschappen noords skiën 2011","context_page_description":"De wereldkampioenschappen noords skiën 2011 werden van 24 februari tot en met 6 maart 2011 gehouden in Oslo."},{"page_url":"https://en.wikipedia.org/wiki/Auschwitz_concentration_camp","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Auschwitz_I_visitor_reception_centre%2C_July_2014_%28panoramio%29_cropped.jpg","page_title":"Auschwitz concentration camp","context_page_description":"The Auschwitz concentration camp was a complex of over 40 concentration and extermination camps operated by Nazi Germany in occupied Poland during World War II and the Holocaust. It consisted of Auschwitz I, the main camp in Oświęcim; Auschwitz II-Birkenau, a concentration and extermination camp built with several gas chambers; Auschwitz III-Monowitz, a labor camp created to staff a factory for the chemical conglomerate IG Farben; and dozens of subcamps. The camps became a major site of the Nazis' Final Solution to the Jewish Question.\\nAfter Germany sparked World War II by invading Poland in September 1939, the Schutzstaffel converted Auschwitz I, an army barracks, into a prisoner-of-war camp for Polish political prisoners. The first inmates, German criminals brought to the camp in May 1940 as functionaries, established the camp's reputation for sadism; prisoners were beaten, tortured, and executed for the most trivial reasons. The first gassings—of Soviet and Polish prisoners—took place in block 11 of Auschwitz I around August 1941."},{"page_url":"https://pl.wikipedia.org/wiki/Mi%C4%99dzylesie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/2018_Poczta_w_Mi%C4%99dzylesiu_2.jpg","page_title":"Międzylesie","context_page_description":"Międzylesie – miasto w Polsce, w województwie dolnośląskim, w powiecie kłodzkim, siedziba gminy miejsko-wiejskiej Międzylesie. Leży nad Nysą Kłodzką, na obszarze historycznej ziemi kłodzkiej. W latach 1975–1998 miasto administracyjnie należało do województwa wałbrzyskiego.\\nWedług danych GUS z 31 grudnia 2019 roku miasto miało 2561 mieszkańców.\\nOśrodek obsługujący ruch tranzytowy między Polską a Czechami, przy międzynarodowej linii kolejowej Wrocław – Praga. Miasto jest ośrodkiem turystyczno-krajoznawczym. Zlokalizowany tu jest drobny przemysł."},{"page_url":"https://nl.wikipedia.org/wiki/Schildhoofd","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Capo_impero_1.png","page_title":"Schildhoofd","context_page_description":"Een schildhoofd is in de heraldiek een veld dat boven aan het wapenschild is geplaatst. Het wapen is niet gedeeld, dan zou het in twee gelijke delen zijn verdeeld.\\nEen schildhoofd leent zich in het bijzonder voor langgerekte horizontale stukken die in kwartieren niet tot hun recht zouden komen omdat iedere figuur volgens de heraldische regel het veld helemaal moet vullen.\\nHet schildhoofd is de aangewezen wijze om een schild dat al een hartschild heeft te vermeerderen. Dat vermeerderen gebeurt wanneer aan een bestaand schild een extra veld wordt toegevoegd."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%BD%D0%B0%D0%B9-%D0%B2%D0%B8%D1%81%D0%BE%D0%BA%D0%B8%D1%82%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%B8_%D1%85%D1%80%D0%B0%D0%BC%D0%BE%D0%B2%D0%B5_%D0%B8_%D0%BA%D0%B0%D0%BC%D0%B1%D0%B0%D0%BD%D0%B0%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Annunciation_Cathedral_in_Voronezh1.jpg","page_title":"Списък на най-високите православни храмове и камбанарии","context_page_description":"Списък на най-високите православни храмове и камбанарии в света."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E7%81%A3%E5%B8%82%E5%88%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Taitung_City.jpg","page_title":"臺灣市制","context_page_description":"臺灣市制是指臺灣的建制市制度，始於日治時期。1903年出現、1916年確立的臺南市，為最早以「市」命名的行政區劃、也是當時唯一的一個，但此時的市僅為地區名，並不具有法人地位與「市」的管理機構，因此尚非為現今定義下正式的市制；1920年施行的《臺灣市制》才為正式建制市制度在台灣的濫觴，也某種程度影響到戰後中華民國政府下的市制規劃、並延續至今。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%83%D1%92%D0%B5%D1%9A%D0%B5_%D0%BF%D1%80%D0%B8%D0%BF%D0%B0%D0%B4%D0%BD%D0%B8%D1%86%D0%B8%D0%BC%D0%B0_%D0%90%D1%98%D0%BD%D0%B7%D0%B0%D1%86%D0%B3%D1%80%D1%83%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Six-franz-nuremberg.jpg","page_title":"Суђење припадницима Ајнзацгрупа","context_page_description":"Суђење припадницима Ајнзацгрупа, званично САД против Ота Олендорфа и др., било је суђење против 24 официра Ајнзацгрупа јединица СС-а, одреда смрти који су вршили масовне злочине иза линије фронта у источној Европи. Оптужница их је теретила за бројне ратне злочине и злочине против човечности а у склопу геноцидног плана, као и за чланство у СС-у, СД-у и Гестапо-у.\\nСуђење је водио Војни трибунал II-A - судије Мајкл Мусмано, Џон Спејт и Томас Диксон.\\nЈедан оптужени је извршио самоубиство, један је пуштен из медицинских разлога. Остали су оглашени кривим за сва дела, сем двојице који су оглашени кривим само за чланство у криминалној организацији. Изречено је 14 смртних казни, а остали су осуђени на затворске казне различите дужине, од 10 година до доживотне."},{"page_url":"https://en.wikipedia.org/wiki/Tolbooth","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/The_Old_Tolbooth.jpg","page_title":"Tolbooth","context_page_description":"A tolbooth or town house was the main municipal building of a Scottish burgh, from medieval times until the 19th century. The tolbooth usually provided a council meeting chamber, a court house and a jail. The tolbooth was one of three essential features in a Scottish burgh, along with the mercat cross and the kirk."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E8%8A%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Rhanterium_epapposum_%E2%80%94_Guru_Hegde_001.jpg","page_title":"国花","context_page_description":"国花とは、その国民に最も愛好され、その国の象徴とされる花である。"},{"page_url":"https://no.wikipedia.org/wiki/Sibirvalmue","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Papaver_croceum_01.JPG","page_title":"Sibirvalmue","context_page_description":"Sibirvalmue er en meget hardfør blomst i valmuefamilien.\\nPlanten er ett- eller flerårig og blomstrer hele sommeren med enten røde, rosa, gule, oransje eller hvite blomster. Av og til kan også varianter med fylte blomster oppstå. Sibirvalmue blir opptil 50 cm høy og klarer seg i nesten all slags jord, men foretrekker godt drenert jord og full sol.\\nSibirvalmue kommer opprinnelig fra Sør-Sibir, Sentral-Asia og Nord-Kina. Den har i over 200 år vært en populær og dekorativ hageplante og er mest kjent under det ugyldige vitenskapelige navnet P. nudicaule. Den sprer seg lett med frø om høsten, og mange steder har den forvillet seg fra hager. Man kan finne den igjen langs veikanter, på kulturmark og på tuftene ved fraflyttede hus og gårder.\\nFrøstandene er fine til tørking og de kan brukes som evighetsblomster.\\nSibirvalmue er som regel diploid med 2n = 14 kromosomer, men tetraploide eksemplarer med 2n = 48 kromosomer er også kjent."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%AC%E0%A7%81%E0%A6%9C%E0%A6%B2%E0%A7%87%E0%A6%9C%E0%A6%BE_%E0%A6%AE%E0%A7%8C%E0%A6%9F%E0%A7%81%E0%A6%B8%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Aethopyga_nipalensis_male_-_Doi_Inthanon.jpg","page_title":"সবুজলেজা মৌটুসি","context_page_description":"সবুজলেজা মৌটুসি Nectariniidae গোত্র বা পরিবারের অন্তর্গত Aethopyga গণের অন্তর্ভুক্ত এক প্রজাতির মৌপায়ী পাখি। পাখিটি বাংলাদেশ, ভারত ছাড়াও দক্ষিণ ও দক্ষিণ-পূর্ব এশিয়ার বিভিন্ন দেশে দেখা যায়।\\nসবুজলেজা মৌটুসি বৈজ্ঞানিক নামের অর্থ নেপালি লালকোমর । সারা পৃথিবীতে এক বিশাল এলাকা জুড়ে এরা বিস্তৃত, প্রায় লক্ষ হাজার বর্গ কিলোমিটার এলাকা জুড়ে এদের আবাস।\\nবিগত কয়েক দশক ধরে এদের সংখ্যা অপরিবর্তিত রয়েছে, আশঙ্কাজনক পর্যায়ে যেয়ে পৌঁছেনি। সেকারণে আই. ইউ. সি. এন. এই প্রজাতিটিকে ন্যূনতম বিপদগ্রস্ত বলে ঘোষণা করেছে। বাংলাদেশের বন্যপ্রাণী আইনে এ প্রজাতিটিকে সংরক্ষিত ঘোষণা করা হয় নি।"},{"page_url":"https://ca.wikipedia.org/wiki/Ciutat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Caracas_desde_El_Avila.jpg","page_title":"Ciutat","context_page_description":"Una ciutat és una població gran amb alta densitat de població, normalment amb predomini del sector terciari i menys del 25% de la població que treballa a l'agricultura. Per a la definició de ciutat es tenen en compte els criteris de població, densitat de població o estatus legal, tot i que aquests criteris poden variar entre països.\\nL'urbanisme és la disciplina que s'ocupa del seu estudi, dins la geografia. La sociologia la considera un organisme viu o una xarxa de relacions humanes i serveis. La tendència demogràfica actual és el creixement progressiu de les ciutats i la reducció dels petits pobles."},{"page_url":"https://fr.wikipedia.org/wiki/Th%C3%A9ier","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Csinensis.jpg","page_title":"Théier","context_page_description":"Le théier, appelé parfois simplement thé, est une espèce d’arbustes de la famille des Théacées. Il est originaire d'Extrême-Orient. Il est largement cultivé pour ses feuilles qui une fois séchées et plus ou moins oxydées, servent à la préparation d’une infusion : le thé. C'est une espèce voisine des camélias horticoles. Son nom binomial Camellia sinensis signifie mot pour mot « camélia chinois »."},{"page_url":"https://en.wikipedia.org/wiki/556","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Meister_von_San_Vitale_in_Ravenna_005.jpg","page_title":"556","context_page_description":"Year 556 was a leap year starting on Saturday of the Julian calendar. The denomination 556 for this year has been used since the early medieval period, when the Anno Domini calendar era became the prevalent method in Europe for naming years."},{"page_url":"https://hu.wikipedia.org/wiki/SI-alapegys%C3%A9g","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Unit_relations_in_the_new_SI.svg","page_title":"SI-alapegység","context_page_description":"Az SI-alapegységeken alapszik a Mértékegységek Nemzetközi Rendszere. A hét SI-alapegységgel lehet a többi származtatott egységet létrehozni. Az SI-mértékegységeken kívül több nem SI-mértékegység is használatos az SI-vel összhangban.\\nA hét alapmennyiséghez tartozó alapmértékegység a másodperc, a méter, a kilogramm, az amper, a kelvin, a mól, és a kandela.\\nAz alapegységek definíciója a 2018. november 13-16. között Versailles-ban megtartott 26. Általános Súly- és Mértékügyi Konferencia határozata szerint 2019. május 20. óta hét természeti állandóhoz kötődik, melyek értéke mai tudásunk szerint helytől és időtől függetlenül állandó, így értéküket rögzítették. Ezek a cézium-133 atom sugárzásának frekvenciája, a vákuumbeli fénysebesség, a Planck-állandó, az elemi töltés, a Boltzmann-állandó, az Avogadro-állandó és az 540 THz frekvenciájú monokromatikus sugárzás maximális spektrális fényhasznosítása.\\nBár az új SI-ben több alapmértékegység definíciója jelentősen új elvi alapokon nyugszik mint korábban, a hét alapmennyiség és a hozzájuk tartozó alapmértékegységek is ugyanazok."},{"page_url":"https://en.wikipedia.org/wiki/Fort_of_Santo_Ant%C3%B3nio_de_Belixe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/FortalezaBeliche1.jpg","page_title":"Fort of Santo António de Belixe","context_page_description":"The Fort of Santo António de Belixe, which is also referred to as the Fortress of Beliche, is located on Cape St. Vincent in the parish of Sagres, municipality of Vila do Bispo, Faro District, in Portugal. The original date of construction is unknown but the fort was already in existence in the 16th Century."},{"page_url":"https://en.wikipedia.org/wiki/Pakistan","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Nani_ki_Mandir2.jpg","page_title":"Pakistan","context_page_description":"Pakistan, officially the Islamic Republic of Pakistan, is a country in South Asia. It is the world's fifth-most populous country with a population exceeding 212.2 million. It has the world's second-largest Muslim population. It is the 33rd-largest country by area, spanning 881,913 square kilometres. Pakistan has a 1,046-kilometre coastline along the Arabian Sea and Gulf of Oman in the south and is bordered by India to the east, Afghanistan to the west, Iran to the southwest, and China to the northeast. It is separated narrowly from Tajikistan by Afghanistan's Wakhan Corridor in the northwest, and also shares a maritime border with Oman.\\nThe territory that now constitutes Pakistan was the site of several ancient cultures and intertwined with the history of the broader Indian subcontinent. The ancient history involves the Neolithic site of Mehrgarh and the Bronze Age Indus Valley Civilisation, and was later home to kingdoms ruled by people of different faiths and cultures, including Hindus, Indo-Greeks, Muslims, Turco-Mongols, Afghans and Sikhs."},{"page_url":"https://sk.wikipedia.org/wiki/%C5%A0af%C3%A1%C5%99ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/%C5%A0af%C3%A1%C5%99ka_%28003%29.jpg","page_title":"Šafářka","context_page_description":"Šafářka je prírodná pamiatka ev. č. 2024 neďaleko obce Mašovice v okrese Znojmo v nadmorskej výške 371 - 377 metrov. Oblasť spravuje AOPK ČR."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%9D%E9%AE%AE%E6%B0%91%E4%B8%BB%E4%B8%BB%E7%BE%A9%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E3%82%A6%E3%82%A9%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/1992-50won-1.jpg","page_title":"朝鮮民主主義人民共和国ウォン","context_page_description":"朝鮮民主主義人民共和国ウォンは、朝鮮民主主義人民共和国の通貨単位である。通称：北朝鮮ウォン。\\n北朝鮮では漢字表記が建国時に廃止されたため、公式な漢字表記は存在しないが、中国語圏においては繁体字で「朝鮮圓」または「朝鮮元」、簡体字で「朝鲜圆」または「朝鲜元」と書く。\\n大韓民国ウォンと共通の事柄についてはウォンも参照。"},{"page_url":"https://de.wikipedia.org/wiki/Karl%C5%A1tejn","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Zamek_w_Karlstejn.JPG","page_title":"Karlštejn","context_page_description":"Karlštejn ist eine Minderstadt im Okres Beroun in Tschechien. Auf 1209 Hektar leben etwa 740 Einwohner."},{"page_url":"https://sv.wikipedia.org/wiki/Odostomia_eucosmia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Iolaea_eucosmia_001.jpg","page_title":"Odostomia eucosmia","context_page_description":"Odostomia eucosmia är en snäckart som beskrevs av Dall och Bartsch 1909. Odostomia eucosmia ingår i släktet Odostomia och familjen Pyramidellidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%9A%E0%A4%BE%E0%A4%AE_%E0%A4%A8%E0%A5%83%E0%A4%A4%E0%A5%8D%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Jakar_tshechu%2C_Ging_Tsholing_Cham%2C_Ging_%2815657676898%29.jpg","page_title":"चाम नृत्य","context_page_description":"चाम नृत्य हे आशियाई देश भूतानमधील प्रसिद्ध नृत्य आहे.."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Nationalparks_in_Tunesien","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Parc_national_de_Boukornine_21.JPG","page_title":"Liste der Nationalparks in Tunesien","context_page_description":"In Tunesien gibt es aktuell 17 Nationalparks."},{"page_url":"https://de.wikipedia.org/wiki/1240","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Predklasteri-klaster_Porta_coeli-tympanon_portalu-Konstancie_Uherska.jpeg","page_title":"1240","context_page_description":"15. Juli: Alexander Newski, Fürst von Nowgorod, besiegt die Schweden unter Birger Jarl in der Schlacht an der Newa.\\n28. November: Mongolische Truppen unter der Führung Batu Khans beginnen die Belagerung von Kiew, einer der wichtigsten Städte des Fürstentums Halytsch-Wolodymyr. Die Stadtmauern werden mit Katapulten beschossen. Fürst Daniel Romanowitsch von Galizien flüchtet nach Westen, als sich die Eroberung der Stadt abzeichnet.\\n6. Dezember: Die Mongolen erobern und zerstören Kiew. Rund 30.000 Menschen werden massakriert, nur rund 2.000 am Leben gelassen. Im Anschluss setzt Batu Khan seinen Eroberungszug nach Westen fort.\\nDer Deutsche Orden erobert Pskow."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E6%96%87%E7%94%9F%E5%A0%82_(%E7%BB%B4%E7%90%B4%E5%AF%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Marinali-1.jpg","page_title":"圣文生堂 (维琴察)","context_page_description":"聖文生堂是一座羅馬天主教教堂，位於義大利維琴察領主廣場，帕拉迪奧巴西利卡對面，插入公典宮中間。立面為巴洛克式，內部為哥德式。\\n該堂建於1385-1707年。星期天開放一次，舉行拉丁文彌撒。"},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Saguntum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Castillo04_Sagunto.JPG","page_title":"Battle of Saguntum","context_page_description":"The Battle of Saguntum saw the Imperial French Army of Aragon under Marshal Louis Gabriel Suchet fighting a Spanish army led by Captain General Joaquín Blake. The Spanish attempt to raise the siege of the Sagunto Castle failed when the French, Italians, and Poles drove their troops off the battlefield in rout. The action took place during the Peninsular War, part of the Napoleonic Wars. Sagunto lies a short distance from the east coast of Spain, about 30 kilometres north of Valencia.\\nSuchet invaded the province of Valencia in September 1811. He tried to quickly seize Sagunto Castle, but its garrison under Colonel Luis Andriani repulsed two attacks and the French-Allied army was forced to lay siege to the ancient fortress. When Blake's army advanced from Valencia to raise the siege, Suchet posted his somewhat smaller army to resist the Spanish. Blake's attack on Suchet's right flank went awry and soon the poorly-trained Spanish troops were fleeing. The Spanish troops attacking Suchet's left flank were made of sterner stuff, however, and the contest there was more severe. Finally, the Imperial troops gained the upper hand and put almost the entire Spanish army to flight."},{"page_url":"https://jv.wikipedia.org/wiki/San_Francisco","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Lightmatter_sanfrancisco.jpg","page_title":"San Francisco","context_page_description":"San Francisco iku kutha gedhé dhéwé kapapat ing praja California, Amérikah Sarékat saka cacahing kang ndunungi. Kutha iki dumunung ing pucuk lor Ujung San Francisco kang mbentuk Lempongan San Francisco. Berkeley lan Oakland ana ing sebrang lempongan iku.\\nSan Francisco kang ndunungi watara 799.263 jiwa. Kapadhetan kang ndunungi gedhé dhéwé kaloro ing Amérikah Sarékat sawisé New York City. Pemukim Éropah pisanan ing kutha iki ya iku bangsa Spanyol kang teka ing taun 1776. Kutha iki tuwuh ngrembaka wiwit taun 1848 amarga prastawa gold rush. San Francisco naté ajur wektu kadadéan lindhu San Francisco ing taun 1906, nanging diyasa manèh kanthi rikat. Kreteg Golden Gate kang misuwur ngubungaké kutha iki karo Marine County."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2019/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Anne_vanderlove_.jpg","page_title":"Lijst van personen overleden in 2019/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2019.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Vorontsov_Palace_(Alupka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/%D0%91%D0%B8%D0%BB%D1%8C%D1%8F%D1%80%D0%B4_%D0%B2_%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%B8%D0%B7_%D0%BA%D0%BE%D0%BC%D0%BD%D0%B0%D1%82.jpg","page_title":"Vorontsov Palace (Alupka)","context_page_description":"The Vorontsov Palace or the Alupka Palace is a historic palace situated at the foot of the Crimean Mountains near the town of Alupka in Crimea. The Vorontsov Palace is one of the oldest and largest palaces in Crimea, and is one of the most popular tourist attractions on Crimea's southern coast.\\nThe palace was built between 1828 and 1848 for Russian Prince Mikhail Semyonovich Vorontsov for use as his personal summer residence at a cost of 9 million silver rubles. It was designed in a loose interpretation of the English Renaissance revival style by English architect Edward Blore and his assistant William Hunt. The building is a hybrid of several architectural styles, but faithful to none. Among those styles are elements of Scottish Baronial, Indo-Saracenic Revival Architecture, and Gothic Revival architecture. Blore had designed many buildings in the United Kingdom, and was later particularly well known there for completing the design of Buckingham Palace in London."},{"page_url":"https://fi.wikipedia.org/wiki/St_Paulin_katedraali","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Dome_of_st_pauls.jpg","page_title":"St Paulin katedraali","context_page_description":"St Paulin katedraali on Lontoon Cityssä sijaitseva katedraali, joka toimii Lontoon piispanistuimena. Nykyisen katedraalin suunnitteli Sir Christopher Wren, ja se rakennettiin vuosina 1675–1710. Nykyistä katedraalia sanotaan yleisesti neljänneksi St Paulin katedraaliksi, vaikka kaikki keskiaikaiset uudelleenrakentamiset laskien luku olisi suurempi."},{"page_url":"https://ca.wikipedia.org/wiki/Antonio_Azarola_Gresill%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Antonio_Azarola_y_Gresill%C3%B3n.jpg","page_title":"Antonio Azarola Gresillón","context_page_description":"Antonio Azarola Gresillón va ser un mariner i militar navarrès, contralmirall de l'Armada i ministre de Marina al govern de Manuel Portela Valladares, durant la Segona República Espanyola.\\nAl començament de la Guerra Civil, sent Comandant General de l'Arsenal i segon cap de la base naval de Ferrol, es va mantenir lleial al govern de la República. Els militars revoltats el van acusar d'ordenar obrir en secret l'arsenal a les masses marxistes per apoderar-se de les armes i dels bucs allí fondejats, motiu pel qual li van formar un Consell de Guerra i el van assassinar."},{"page_url":"https://it.wikipedia.org/wiki/Mura_dell%27Aquila","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/L%27Aquila-PortaTione.JPG","page_title":"Mura dell'Aquila","context_page_description":"Le mura dell'Aquila costituiscono l'antica cerchia della città e rappresentano il confine del suo centro storico.\\nEdificate a partire dal XIII secolo, ed in buona parte conservate ancora oggi, mantengono pressappoco la forma originale nonostante le numerose modifiche dovute a crolli e sventramenti di carattere urbanistico. Si estendono per oltre 5,5 km inglobando un'area di circa 157 ettari destinata a contenere decine di migliaia di abitanti."},{"page_url":"https://en.wikipedia.org/wiki/2011_Tirreno%E2%80%93Adriatico","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Mark_Cavendish_-_seconde_%C3%A9tape_du_Tour_de_Romandie_2010C.jpg","page_title":"2011 Tirreno–Adriatico","context_page_description":"The 2011 Tirreno–Adriatico was the 46th running of the Tirreno–Adriatico cycling stage race, often known as the Race of two seas. It started on 9 March in Marina di Carrara and ended on 15 March in San Benedetto del Tronto and consisted of seven stages, including a team time trial to begin the race and an individual time trial to conclude it. It was the third race of the 2011 UCI World Tour season.\\nThe race was won by BMC Racing Team rider Cadel Evans, who claimed the leader's blue jersey on stage five before a stage win on stage six. Evans' winning margin over runner-up Robert Gesink was 11 seconds, as Gesink overhauled both Ivan Basso of Liquigas–Cannondale and Lampre–ISD's Michele Scarponi on the final time trial stage. Scarponi – winner of the fourth stage – completed the podium, 15 seconds down on Evans.\\nIn the race's other classifications, Gesink's second place overall won him the white jersey for the highest placed rider aged 25 or under, and Scarponi took home the red jersey for amassing the highest number of points during stages at intermediate sprints and stage finishes."},{"page_url":"https://vi.wikipedia.org/wiki/Cosmetalepas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Cosmetalepas_africana_002.jpg","page_title":"Cosmetalepas","context_page_description":"Cosmetalepas là một chi minute deepwater keyhole limpets, là động vật thân mềm chân bụng sống ở biển trong họ Fissurellidae and slit limpets."},{"page_url":"https://nl.wikipedia.org/wiki/Heterosiet","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Heterosite-399819.jpg","page_title":"Heterosiet","context_page_description":"Het zeldzame mineraal heterosiet is een fosfaat met als hoofdingrediënt ijzer(III)fosfaat.\\nAls erts komt deze stof altijd voor in een vaste mengreeks samen met andere stoffen, met name purpuriet; daarom wordt de formule meestal weergegeven als [PO₄]³⁻.\\nHeterosiet ontstaat meestal secundair door oxydatie uit triphyliet en/of lithiofiliet.\\nHet mineraal heeft meestal een zijdeglanzende paarse kleur; soms groen/bruin of donkerbruin."},{"page_url":"https://ca.wikipedia.org/wiki/Falla_de_la_Pla%C3%A7a_del_Pilar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Falla_Pilar_2005.jpg","page_title":"Falla de la Plaça del Pilar","context_page_description":"La comissió Plaça del Pilar és una entitat fallera de la Ciutat de València censada en Junta Central Fallera amb el n. 34, situada a la Plaça del Pilar, al barri de Velluters. La seua seu social està situada al nº30 del carrer de Maldonado.\\nL'origen de la falla data de l'any 1865, any en què ja es té testimoni que es plantara una falla a la plaça.\\nL'actual comissió fallera data de 1953. En 1958 van plantar en primera categoria, plantant des d'aleshores en la màxima categoria. És la falla amb més primers premis en secció especial, amb setze. Amb el premi de 2014 va posar fi a una sequera de quinze anys sense guardó.\\nGrans artistes de la història de les Falles han plantat a l'emblemàtica demarcació. Entre ells Julià Puche, Alfredo Ruiz, Pepe Martínez Mollà, Josep Pascual Ibáñez, Salvador Debón, Juan Huerta, Vicente Agulleiro, Julio Monterrubio o Pere Baenas.\\nÉs la comissió que més màxims guardons en Secció Especial ha aconseguit fins al 2019 amb 16 primers premis."},{"page_url":"https://nl.wikipedia.org/wiki/Chris_Tomlin","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Chirs.jpg","page_title":"Chris Tomlin","context_page_description":"Christopher Dwayne Tomlin is een Amerikaanse christelijke muzikant en aanbiddingsleider. Hij is betrokken geweest bij veel Passion-evenementen in de Verenigde Staten. Hij is schrijver van nummers als \\"How Great Is Our God\\", \\"Forever\\", \\"Indescribable\\", \\"Famous One\\", \\"Your Grace is Enough\\", \\"Holy Is The Lord\\" en \\"Let God arise\\". Zijn liederen worden over de hele wereld in kerkdiensten gebruikt.\\nOok in het Nederlands zijn zijn liederen terug te vinden in de muziek van 'Opwekking': \\"How great is our God\\" is \\"De Koning in Zijn pracht\\". Diverse van zijn hits zijn verschenen in de compilatie-cd WOW Hits.\\nIn 2007 trad Chris Tomlin voor het eerst op in Nederland op de EO-Jongerendag in het voetbalstadion GelreDome, Arnhem. Op 17 augustus 2007 gaf Chris Tomlin een concert op het Flevo Festival."},{"page_url":"https://it.wikipedia.org/wiki/Soues_(Alti_Pirenei)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Soues65-France-eglise-2150b.jpg","page_title":"Soues (Alti Pirenei)","context_page_description":"Soues è un comune francese di 3.087 abitanti situato nel dipartimento degli Alti Pirenei nella regione dell'Occitania."},{"page_url":"https://sv.wikipedia.org/wiki/Nowshera","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Nowshera_City.JPG","page_title":"Nowshera","context_page_description":"Nowshera är en stad i den pakistanska provinsen Khyber Pakhtunkhwa. Den är huvudort för ett distrikt med samma namn, och folkmängden uppgick till cirka 120 000 invånare vid folkräkningen 2017."},{"page_url":"https://sv.wikipedia.org/wiki/Semarey","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Map_commune_FR_insee_code_21600.png","page_title":"Semarey","context_page_description":"Semarey är en kommun i departementet Côte-d'Or i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Pouilly-en-Auxois som tillhör arrondissementet Beaune. År 2009 hade Semarey 114 invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Stuwmeer_van_Bratsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Wasserkraftwerk-Bratsk.jpg","page_title":"Stuwmeer van Bratsk","context_page_description":"Het Stuwmeer van Bratsk bevindt zich op de Angara in Rusland. Het was een groot symbool van de Sovjet-Unie en een belangrijk onderdeel van de ontsluiting van het gebied Angara-Jenisej."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%A2%E0%B6%B1%E0%B7%8F%E0%B6%B0%E0%B7%92%E0%B6%B4%E0%B6%AD%E0%B7%92_%E0%B7%80%E0%B7%92%E0%B6%AF%E0%B7%8A%E2%80%8D%E0%B6%BA%E0%B7%8F%E0%B6%BD%E0%B6%BA,_%E0%B6%B8%E0%B7%84%E0%B6%BB%E0%B6%9C%E0%B6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/President%27s_College_Flag.jpg","page_title":"ජනාධිපති විද්‍යාලය, මහරගම","context_page_description":"1978 දී සිසුන් 600 ක පමණ සංඛ්‍යාවකින් ඇරඹි මිශ්‍ර පාසලක්‌ වූ මෙය අද සිසුන් 4000 කට ආසන්න සංඛ්‍යාවක්‌ අධ්‍යාපනය ලබන ප්‍රදේශයේ ප්‍රමුඛතම පිරිමි පාසල බවට පත්වී ඇත. එදා ආචාර්ය මණ්‌ඩලය වූයේ 15 දෙනෙකි. අද 140 කට ආසන්න ප්‍රමාණයක්‌ සිටිති. ප්‍රමාණාත්මකව ලැබූ දියුණුව මෙන්ම ගුණාත්මක අංශයෙන් ද විශිෂ්ට දියුණුවක්‌ ලබා ඇති බව විභාග ප්‍රතිඵල හා බාහිර ක්‍රියාකාරකම්වලින් ලබා ඇති ජයග්‍රහණවලින් පෙන්නුම් කරයි."},{"page_url":"https://cs.wikipedia.org/wiki/John_Trumbull","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Hamilton_Trumbull_1792.jpg","page_title":"John Trumbull","context_page_description":"John Trumbull byl americký umělec z období americké války za nezávislost, pozoruhodný svými historickými obrazy. Byl nazýván Malíř revoluce. Trumbullův obraz Deklarace nezávislosti z roku 1817 je jedním z jeho čtyř obrazů, které visí v Kapitolu Spojených států amerických a byl použit na zadní straně pamětní dvoudolarové bankovky."},{"page_url":"https://de.wikipedia.org/wiki/Kropst%C3%A4dt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Dorfkirche_Kropst%C3%A4dt_-Nordostansicht_mit_Apsis-_im_August_2020.jpg","page_title":"Kropstädt","context_page_description":"Kropstädt ist eine Ortschaft der Lutherstadt Wittenberg in Sachsen-Anhalt. Sie umfasst die Ortsteile Kropstädt, Jahmo, Köpnick und Wüstemark."},{"page_url":"https://en.wikipedia.org/wiki/Chukchansi_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Chukchansi.jpg","page_title":"Chukchansi Park","context_page_description":"Chukchansi Park, formerly Grizzlies Stadium, is a city-owned baseball stadium located in Fresno, California, United States, completed in 2002 as the home for the Pacific Coast League, Fresno Grizzlies. In September 2006, Chukchansi Gold Resort & Casino, affiliated with the Chukchansi tribe, announced it would be the premier corporate sponsor for Grizzlies Stadium, in a 15-year, US$16 million deal. The first game was May 1, 2002. Located in downtown Fresno, it is to be an anchor in the rehabilitation of the area, as other commercial development is planned in the Central Business District Loop. The ballpark is also used for music concerts, motocross events, and high school football."},{"page_url":"https://sr.wikipedia.org/wiki/Amonijum_heksafluorofosfat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ammonium_hexafluorophosphate.png","page_title":"Amonijum heksafluorofosfat","context_page_description":"Amonijum heksafluorofosfat je hemijsko jedinjenje, koje ima molekulsku masu od 163,003 Da."},{"page_url":"https://id.wikipedia.org/wiki/Metro_Ankara","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/AnkaraMetroLogo.png","page_title":"Metro Ankara","context_page_description":"Metro Ankara adalah sistem angkutan cepat yang berada di kota Ankara, ibu kota Turki. Saat ini, sistem angkutan cepat Ankara terdiri dari empat jalur metro – Batıkent Metrosu, Koru Metrosu, Törekent Metrosu dan jalur baru Keçiören Metrosu yang dibuka pada tahun 2017. Selain itum ada juga jalur kereta ringan Ankaray. Metro Ankara mengangkut 104.1 juta penumpang pada tahun 2014. Itu sama dengan 289.155 perjalanan per hari.\\nJalur M4 antara Kızılay sampai Pusat Kebudayaan Atatürk belum dibuka dan masih dalam pembangunan. Juga, tambahan jalur sepanjang 30 km antara Kızılay dan Bandara Esenboga sedang dalam tahap perencanaan dan akan menjadi ekspansi metro ini tahap berikutnya."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%80%8F%E8%A7%86%E6%A0%A1%E6%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Cathedral_Notre-Dame_de_Reims%2C_France-PerCorr.jpg","page_title":"透视校正","context_page_description":"透视校正或者称为透视控制是对照片进行合成或者编辑，以得到符合大众对于透视失真理解的结果的过程。这个校正过程包括：\\n使所有现实中的竖直线在图像中都显示为竖直方向。这些竖直线包括立柱、墙面的竖直边、灯柱等。需要注意的是这就是人们普遍接受的对于透视结果的理解；这样的透视结果的依据就是越远的物体在图像中就越小。由于竖直方向距离的存在，建筑物顶端要比基座离地面观察者的距离要远，但是，通常建立透视过程只考虑水平方向的距离，而不考虑竖直方向的距离，即认为建筑物顶端与基座的距离是一样远的。\\n如方形房间中，四条水平边这样的所有平行线交于一点。\\n如果期望平行的物体直线与胶片平面不平行的话就会在照片中出现透视投影失真。一种常见的情形就是当我们从地面上拍摄一个较高的建筑物的时候，通常将照相机向后倾斜，这样建筑物看起来就会较远。\\n由于业余摄影的流行，用低档照相机拍摄的带有透视失真的照片已经很普遍，许多人可能不会马上就意识到存在透视失真现象。需要记住的是“失真”只是一个与constructed 透视结果相对的概念，即在constructed 图像中竖直线并不会交叉；而 constructed 透视实际上却并不是真实的投影表现形式，实际上竖直线在观察者的水平线以上或者以下随着相对于观察者越来越远就会逐渐汇聚到一点。"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%9E%88%EB%A1%9C%EC%8B%9C%EB%A7%88_%EA%B4%91%EC%97%AD%EA%B3%B5%EC%9B%90_%EC%9C%A1%EC%83%81%EA%B2%BD%EA%B8%B0%EC%9E%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bigarch050423.jpg","page_title":"히로시마 광역공원 육상경기장","context_page_description":"히로시마 광역 공원 육상 경기장은 일본 히로시마현 히로시마시에 있는 경기장으로, 흔히 에디온 스타디움 히로시마라고 부르기도 한다. J리그 클럽인 산프레체 히로시마의 홈구장으로 사용되고 있으며 50,000명을 수용할 수 있다. 1992년 AFC 아시안컵 경기장과 1994년 아시안 게임의 주경기장으로 선정되었다.\\n시설은 히로시마 시가 소유하고 공익 재단법인 히로시마시 스포츠 협회가 지정 관리자 서 운영 관리를 실시하고 있다. 원래 경기장의 애칭은 히로시마 빅아치였으나, 히로시마 연고의 대형 가전 양판점 에디온이 명명권 을 취득하여 2013년 3월부터 '에디온 스타디움 히로시마' 로 명칭을 사용하고 있다. J리그의 경기기록 등의 미디어에서는 통상 'E스타'로 줄여 표기한다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Lahn-Dill-Kreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Albshausen_Ev._Kirche_%2812%29.jpg","page_title":"Liste der Kirchen im Lahn-Dill-Kreis","context_page_description":"Die Liste der Kirchen im Lahn-Dill-Kreis umfasst die erhaltenen Kirchengebäude im Lahn-Dill-Kreis."},{"page_url":"https://la.wikipedia.org/wiki/Bouillante","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Bouillante-mairie.jpg","page_title":"Bouillante","context_page_description":"Bouillante est commune Francicum 7'481 incolarum in praefectura et regione transmarina Guadalupa in Mare Caribaeo sita."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_d%27Italie_de_rugby_%C3%A0_XV_%C3%A0_la_Coupe_du_monde_2007","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/ScoIta_29092007.svg","page_title":"Équipe d'Italie de rugby à XV à la Coupe du monde 2007","context_page_description":"L'équipe d'Italie a terminé troisième de poule et n'a pas participé à la phase finale de la Coupe du monde de rugby 2007.\\nLa sélection italienne dispute la Coupe du monde 2007, organisée par la France, en étant dans la Poule C pour la première phase; elle affronte la Nouvelle-Zélande, l'Écosse, la Roumanie et le Portugal."},{"page_url":"https://sv.wikipedia.org/wiki/Quercus_turbinella","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Quercus_turbinella_Sonoran_Scrub_Oak_002.jpg","page_title":"Quercus turbinella","context_page_description":"Quercus turbinella är en bokväxtart som beskrevs av Edward Lee Greene. Quercus turbinella ingår i släktet ekar, och familjen bokväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Hegge_(Waltenhofen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Beamtenwohnhaus_Papierfabrik_Hegge.jpg","page_title":"Hegge (Waltenhofen)","context_page_description":"Hegge ist ein Ortsteil und Industrieort der Gemeinde Waltenhofen im Landkreis Oberallgäu.\\n1346 wurde eine Mühlstätte „zem Håggen uf der Iler“ erwähnt, 1419 folgt eine weitere Erwähnung. 1543/45 war eine Papiermühle stiftkemptisches Lehen in Hegge. 1593 wurde erstmals der Name Hegge genannt. Es folgten weitere Erwähnungen, vor allem mit Bezug auf Papiermühlen. Im 19. Jahrhundert entstand im Rahmen der Industrialisierung im 19. Jahrhundert eine umfangreiche Papierfabrik, die in den 1920er Jahren von Haindl Papier übernommen und 1972 geschlossen wurde.\\nAufgrund der komplizierten Lage des Alten Hauptbahnhofs Kempten fuhren von 1906 bis 1965/69 alle Fern- und Schnellzüge an den Haltepunkt Kempten-Hegge. Von dort aus fuhren Pendelzüge in den Kemptener Kopfbahnhof ein, spätestens 1969 wurde dieser Betrieb eingestellt, da zu diesem Zeitpunkt der neue Durchgangsbahnhof eröffnet wurde.\\nIn den 1940er Jahren wurde in Hegge die römisch-katholische Kirche Maria Königin der Apostel im neoromanischen Stil errichtet."},{"page_url":"https://nl.wikipedia.org/wiki/Daniel_Logan","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/10.17.09DanielLoganByLuigiNovi.jpg","page_title":"Daniel Logan","context_page_description":"Daniel Logan is een Nieuw-Zeelands acteur die met name bekendheid geniet door zijn rol als Boba Fett in de film Star Wars: Episode II: Attack of the Clones."},{"page_url":"https://ro.wikipedia.org/wiki/Rathenow","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Wappen_Rathenow.png","page_title":"Rathenow","context_page_description":"Rathenow este un oraș din landul Brandenburg, Germania."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%9E%D7%9C%D7%9B%D7%94_%D7%94%D7%9E%D7%90%D7%95%D7%97%D7%93%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Manchester_from_the_Sky%2C_2008.jpg","page_title":"הממלכה המאוחדת","context_page_description":"הַמַמְלָכָה הַמְאֻחֶדֶת שֶׁל בְּרִיטַנְיָה הַגְּדוֹלָה וצפון אירלנד, המוכרת לרוב כממלכה המאוחדת או בריטניה, היא מדינה השוכנת באיים הבריטיים, לא הרחק מחופיה המערביים של יבשת אירופה, מול צרפת. הממלכה המאוחדת היא הציר המרכזי של 54 מדינות חבר העמים הבריטי, שבראשן עומדת המלכה אליזבת השנייה, המכהנת מאז 1952. כמו במונרכיות אחרות באירופה בימינו, סמכותה של המלכה מצומצמת ביותר, ותפקידה בעיקרו טקסי, אם כי בממלכה המאוחדת כל מוסדות השלטון עדיין כפופים להלכה למלכה.\\nהממלכה המאוחדת היא המדינה ה-22 בגודלה מבחינת אוכלוסייה, עם אוכלוסייה המוערכת בכ-65 מיליון תושבים. היא מונרכיה חוקתית עם שלטון דמוקרטי פרלמנטרי. בירתה היא לונדון, עיר גלובלית חשובה ומרכז כלכלי עם אוכלוסייה של כ-10,310,000 תושבים, והיא הרביעית בגודלה באירופה. המדינה מורכבת מארבע אומות, שבעבר התקיימו כמדינות נפרדות: אנגליה, ויילס, סקוטלנד וצפון אירלנד. אירלנד הייתה חלק מהממלכה בעבר, אך פרשה מהאיחוד בשנת 1921. עם זאת, חלקה הצפוני נותר בממלכה המאוחדת כישות בפני עצמה, המהווה שישית מהאי האירי.\\nמאז התפרקות האימפריה הבריטית, הממלכה המאוחדת כבר לא נחשבת למעצמת על, אך היא בעלת אחד הצבאות הגדולים בעולם ואחת המעצמות המתועשות והחזקות בתבל."},{"page_url":"https://ja.wikipedia.org/wiki/BNK48","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/BNKLogo.jpg","page_title":"BNK48","context_page_description":"BNK48は、タイ・バンコクを拠点に活動する女性アイドルグループ。AKB48グループのひとつであり、総合プロデュースは秋元康が務める。\\nグループ名の由来はバンコク 。グループカラーは、タイで人気の花「蘭」の色をモチーフとしている。"},{"page_url":"https://hu.wikipedia.org/wiki/A_Prince_of_Wales_%C3%A9s_a_Repulse_els%C3%BCllyeszt%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Japanese_high-level_bombing_attack_on_HMS_Prince_of_Wales_and_HMS_Repulse_on_10_December_1941_%28NH_60566%29.jpg","page_title":"A Prince of Wales és a Repulse elsüllyesztése","context_page_description":"Az HMS Prince of Wales csatahajó és az HMS Repulse csatacirkáló brit nehéz hadihajók voltak, amelyeket a második világháború csendes-óceáni hadszíntéren, Brit Malájföld partjainál japán repülőgépek süllyesztettek el 1941. december 10-én. A brit vereség megrengette a hatalmas csatahajók, mint a tengeri háború legfontosabb fegyverei addigi mindenhatóságába vetett hitet, rövidesen a repülőgép-hordozók vették át a szerepüket."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_2726","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/NGC_2726_SDSS.jpg","page_title":"NGC 2726","context_page_description":"NGC 2726 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B8%D0%B1%D0%B5%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Schleswig-Holstein_HL.svg","page_title":"Либек","context_page_description":"Либек град је у немачкој савезној држави Шлезвиг-Холштајн. Са 213.983. становника други град је по броју становника у Шлезвиг-Холштајну. Неколико векова био је главни град Ханзеатског савеза. Због готичке катедрале налази се на Унесковом списку светске баштине. Највећа је немачка лука на Балтичком мору. Стари део града окружен је реком Трав. Лаба-Либек канал повезује реку Трав са Лабом."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%92%D7%99_%D7%9E%D7%A9%D7%A2%D7%95%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Creative_Arts_in_Israel_in_the_21st_Century_0142.JPG","page_title":"אגי משעול","context_page_description":"אגי משעול היא משוררת ישראלית."},{"page_url":"https://nl.wikipedia.org/wiki/Realschule","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Ravensburg_Realschule.jpg","page_title":"Realschule","context_page_description":"De Realschule is een schooltype voor middelbaar onderwijs in Duitsland, Zwitserland en Liechtenstein. De Realschule heeft ook bestaan in Oostenrijk, Denemarken, Zweden en het Russische Rijk."},{"page_url":"https://cs.wikipedia.org/wiki/Polo%C4%8Das_p%C5%99em%C4%9Bny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Isotopes_and_half-life.svg","page_title":"Poločas přeměny","context_page_description":"Poločas přeměny je doba, za kterou se přemění polovina celkového počtu atomárních jader ve vzorku. Pro konkrétní izotop je konstantní. Má hodnotu od zlomku sekundy až po milióny let. Často se používá i termín poločas rozpadu, ale ten je méně obecný, protože ne každá radioaktivní přeměna představuje rozpad.\\nPro konkrétní jádro nuklidu nelze v principu určit, kdy dojde k přeměně. Kvantová mechanika jako pravděpodobnostní teorie umožňuje stanovit pouze pravděpodobnost, že k přeměně dojde v daném časovém úseku, například v následujících 10 minutách. Tento pravděpodobnostní charakter prakticky znamená, že máme-li vzorek látky běžné velikosti a tedy o velkém počtu atomů, pak můžeme přesně vypočítat dobu, za jakou se přemění právě polovina přítomných jader."},{"page_url":"https://hu.wikipedia.org/wiki/Szigetek_(Hongkong)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Lantau_island_full.jpg","page_title":"Szigetek (Hongkong)","context_page_description":"A Szigetek Hongkong egyik kerülete, mely az Új területek városrészhez tartozik."},{"page_url":"https://en.wikipedia.org/wiki/List_of_inactive_United_States_Navy_aircraft_squadrons_(VF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Attack_Squadron_34_%28US_Navy%29_insignia_c1966.png","page_title":"List of inactive United States Navy aircraft squadrons (VF)","context_page_description":"The VF designation was one of the oldest in use by the U.S. Navy. From 1921 to 1948 it designated \\"Fighting Plane Squadron\\" or \\"Fighting Squadron\\". It designated \\"Fighter Squadron\\" from 1948 until 2006 when the last VF squadron was redesignated to Strike Fighter squadron. The designation has not been used since 2006. During the time the VF designation was in use there were two periods during which a suffix letter was added after the squadron designation number. From 1927 to 1937 the suffix letter denoted to which fleet the squadron belonged; B for Battle Fleet and S for Scouting Fleet. From 15 November 1946 to as late as 1 September 1948 the suffix letter denoted to which type of Carrier Air Group the squadron belonged: A for those assigned to Essex class carriers, B for those assigned to the large Midway class carriers, L for those assigned to \\"light\\" Independence or Siapan class carriers and E for those assigned to remaining small WWII \\"escort carriers\\".\\nBeginning in 1937, VF squadron designation numbers were determined by the hull number of the aircraft carrier from which they operated. VF-3 for example belonged to the Saratoga's Air Group as USS Saratoga was CV 3."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Roch_de_Saint-Sulpice-et-Cameyrac","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Eglise_de_Saint_Sulpice_corbeaux_8.JPG","page_title":"Église Saint-Roch de Saint-Sulpice-et-Cameyrac","context_page_description":"L'église Saint-Roch est une église romane du XIIᵉ siècle située sur la commune de Saint-Sulpice-et-Cameyrac, dans le département de la Gironde, en France."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%BE%D9%84%D8%A7%DB%8C%D8%B3%D8%AA%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Apple_Causeway_Bay_2nd_Floor_After_Renovation.jpg","page_title":"اپلایستور","context_page_description":"اپلایستور یان قۇرولوش و یا تابعه شیرکت. شیرکت Ron Johnson طرفیندن قۇرولموش‌دور."},{"page_url":"https://eu.wikipedia.org/wiki/Scatophagidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/ScatophagusArgus.png","page_title":"Scatophagidae","context_page_description":"Scatophagidae arrain pertziformeen familia bat da, Indiako ozeanoan eta mendebaldeko Ozeano Barean bizi dena. Bere izen zientifikoa dioen moduan arrain koprofagoak dira."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B8%D0%B1%D0%B0%D0%BD_%D0%BD%D0%B0_%D0%97%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%BC_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D1%98%D1%81%D0%BA%D0%B8%D0%BC_%D0%B8%D0%B3%D1%80%D0%B0%D0%BC%D0%B0_2010.","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/2010_Opening_Ceremony_-_Lebanon_entering.jpg","page_title":"Либан на Зимским олимпијским играма 2010.","context_page_description":"Либану је ово петнаесто учествовање на Зимским олимпијским играма. У Ванкуверу на Олимпијским играма 2010., учествовао је са троје такмичара, који су се такмичили у једном спорту.\\nЛибански олимпијски тим остао је у групи екипа које нису освојиле ниједну медаљу.\\nНа свечаном отварању заставу Либана носила је аплска скијашица Chirine Njeim."},{"page_url":"https://es.wikipedia.org/wiki/Frances_Bergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Frances_Bergen.jpg","page_title":"Frances Bergen","context_page_description":"Frances Bergen fue una actriz y modelo estadounidense. Fue la mujer del famoso ventrílocuo Edgar Bergen y madre de la actriz Candice Bergen y del editor cinematográfico y televisivo Kris Bergen."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%98%E1%83%90%E1%83%AE%E1%83%A2%E1%83%94%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%AE%E1%83%98%E1%83%93%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Spb_06-2017_img43_Yakhtenny_Bridge.jpg","page_title":"იახტენის ხიდი","context_page_description":"იახტენის ხიდი — საფეხმავლო და საავტომობილო ხიდი სანქტ-პეტერბურგში, მდინარე დიდ ნევკაზე. ერთმანეთთან აკავშირებს პრიმორსკის რაიონის სამხრეთ სანაპიროსა და კრესტოვსკის კუნძულის ჩრდილოეთ სანაპიროს. ყველაზე გრძელი და ყველაზე მაღალი საფეხმავლო ხიდი სანქტ-პეტერბურგში.\\nხიდი არ იხსნება. მისი სიგრძეა 940 მეტრი, ხოლო სიგანე — 17 მეტრი. აქვს საფეხმავლო ტროტუარი, რომლის სიგანეა 2.25 მეტრი, ველოსიპედის გზა — 3,5 მეტრი სიგანის და ასევე 2 ხაზი საავტომობილო მოძრაობისათვის, განკუთვნილი მხოლოდ სპეციალური ტრანსპორტისათვის. ასევე აქვს ორი დასათვალიერებელი მოედანი ფინეთის ყურის მხარეს, ზომებით 9,2×3,25 მ.\\nხიდი არის სატრანსპორტო ინფრასტრუქტურის მთავარი ელემენტი, რომელიც აუცილებელი იყო 2017 წლის კონფედერაციის თასისა და 2018 წლის ფეხბურთის მსოფლიო ჩემპიონატის გასამართად. ამის გამო ხიდის დაპროექტება დაიწყო 2012 წელს. პირველ ეტაპზე პროექტირებას უნდა გადაეწყვიტა ნაოსნობის საკითხი, რადგან ამ მონაკვეთზე გადიოდნენ დიდი გემები და მცირე სასეირნო იახტები."},{"page_url":"https://de.wikipedia.org/wiki/Funda%C3%A7%C3%A3o_Terra","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Arcoverde_ft.jpg","page_title":"Fundação Terra","context_page_description":"Die Fundação Terra ist eine aus Spenden, die zum größten Teil aus Deutschland kommen, finanzierte Selbsthilfeorganisation im Armutsviertel „Rua do Lixo“ der nordostbrasilianischen Kleinstadt Arcoverde. Der Name bedeutet „Stiftung Erde“."},{"page_url":"https://gl.wikipedia.org/wiki/Bicing","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Estacio_bicing_bcn.jpg","page_title":"Bicing","context_page_description":"O Bicing é un servizo de bicicletas públicas da cidade de Barcelona. A empresa municipal B:SM xestiona o servizo, que foi adxudicado en 2007 á empresa estadounidense Clear Channel por un período de 10 anos e un custo de 22,3 millóns de euros. Clear Channel, pola súa parte, subcontratou o servizo á empresa Delfin Group.\\nO Bicing está financiado con parte dos ingresos da Área verde, as zonas de regulación de aparcamento do centro de Barcelona e os abonos dos usuarios. A área de implantación final do Bicing cubrirá toda a superficie continua da cidade con pendentes inferiores ao 3 %.\\nO servizo inaugurouse o 22 de marzo de 2007 e na primavera de 2008 chegou a ter 6000 bicicletas e 380 estacións repartidas por todos os distritos de Barcelona. En febreiro de 2011 tiña xa 120.000 abonados, aínda que chegou a ter 190.000."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Blomberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Blomberg_-_2017-04-01_-_Am_Martiniturm_6.jpg","page_title":"Liste der Baudenkmäler in Blomberg","context_page_description":"Die Liste der Baudenkmäler in Blomberg enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Blomberg im Kreis Lippe in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Blomberg eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nAus der Denkmalliste ausgetragene/gelöschte Objekte:"},{"page_url":"https://no.wikipedia.org/wiki/Konflikten_mellom_Wergeland_og_Welhaven","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Wergeland.jpg","page_title":"Konflikten mellom Wergeland og Welhaven","context_page_description":"Konflikten mellom Johan Sebastian Welhaven og Henrik Wergeland var en kulturpolitisk konflikt og en personlig konflikt som tok til i 1830 med utgangspunkt i studentmiljøet i hovedstaden."},{"page_url":"https://de.wikipedia.org/wiki/Acetylsalicyls%C3%A4ure","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Witthauer_Heilkunde.jpg","page_title":"Acetylsalicylsäure","context_page_description":"Acetylsalicylsäure ist ein weit verbreiteter schmerzstillender, entzündungshemmender, fiebersenkender und thrombozytenaggregationshemmender Arzneistoff aus der Gruppe der nichtsteroidalen Antirheumatika. ASS wird seit 1977 auf der Liste der unentbehrlichen Arzneimittel der WHO aufgeführt. Der Stoff wird seit Anfang des 20. Jahrhunderts in diversen Produkten von Pharmaherstellern vertrieben.\\nDie Bezeichnung Aspirin, die zunächst im englischsprachigen Raum und später teilweise auch international zum Synonym für ASS wurde, ist ein Markenname der Bayer AG für Medikamente mit diesem Wirkstoff."},{"page_url":"https://en.wikipedia.org/wiki/Daimler_Double-Six_sleeve-valve_V12","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/THE_ROYAL_DAIMLER.jpg","page_title":"Daimler Double-Six sleeve-valve V12","context_page_description":"Daimler Double-Six piston engine was a sleeve-valve V12 engine manufactured by The Daimler Company Limited of Coventry, England between 1926 and 1938 in four different sizes for their flagship cars."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2-54","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/An_MTU_tracked_bridge_layer_with_bridge_element_in_Military-historical_Museum_of_Artillery%2C_Engineer_and_Signal_Corps_in_Saint-Petersburg%2C_Russia.jpg","page_title":"Т-54","context_page_description":"Т-54 — советский средний танк. Принят на вооружение Советской Армии ВС СССР в 1946 году, серийно выпускался с 1947 года, постоянно модернизируясь. С 1958 года выпускалась его модификация под названием Т-55, приспособленная к боевым действиям в условиях применения ядерного оружия. В 1961—1967 годах он в основном был сменён в производстве и ТВ ВС СССР танком Т-62, созданным на его базе, но на ОЗТМ выпуск Т-55 продолжался вплоть до 1979 года. Также в ряде стран выпускался сам Т-54 либо его модернизированные или приспособленные к местным условиям варианты.\\nТ-54 экспортировался и стоит на вооружении в вооружённых силах многих государств мира, использовался в большинстве локальных конфликтов после Второй мировой войны. Танк стал известен своей высочайшей надёжностью и простотой, высоко оценивавшимися многими экспертами. На протяжении всей Афганской войны основными танками в танковых подразделениях ограниченного контингента советских войск в Афганистане были Т-55 и Т-62."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%B7%CE%BC%CE%B1%CE%AF%CE%B1_%CF%84%CE%BF%CF%85_%CE%93%CE%BA%CE%BF%CF%85%CE%AC%CE%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Flag_of_Guam.svg","page_title":"Σημαία του Γκουάμ","context_page_description":"Η σημαία του Γκουάμ καθιερώθηκε στις 9 Φεβρουαρίου του 1948. Η σημαία αυτή έχει χρώμα σκούρο μπλε και κόκκινο περιθώριο. Στο κέντρο της σημαίας υπάρχει μία έλλειψη σε σχήμα αμυγδάλου, με αιχμηρές άκρες και με κόκκινο περίγραμμα. Στην έλλειψη βρίσκεται μια σκηνή ένα παραλιακό τοπίο, με ένα κανό να πλέει στον όρμο της Αγκάνιας και έναν φοίνικα. Η λέξη GUAM αναγράφεται με κόκκινα κεφαλαία γράμματα.\\nΤο σχήμα του εμβλήματος φέρει στη μνήμη τις πέτρες που είχαν στις σφεντόνες τους οι πρόγονοι των σημερινών κατοίκων του νησιού. Στο φόντο του, το τοπίο απεικονίζει το «Σημείο των Δύο Εραστών», μια χαράδρα στο Γκουάμ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_727_%D0%BF%D0%BE%D0%B4_%D0%A6%D0%B8%D0%BD%D1%86%D0%B8%D0%BD%D0%BD%D0%B0%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/3-Pointer_Altimeter.svg","page_title":"Катастрофа Boeing 727 под Цинциннати","context_page_description":"Катастрофа Boeing 727 под Цинциннати — крупная авиационная катастрофа, произошедшая вечером в понедельник 8 ноября 1965 года в районе аэропорта Северный Кентукки города Цинциннати. Авиалайнер Boeing 727-23 авиакомпании American Airlines с 62 людьми на борту завершал рейс из Нью-Йорка, когда при заходе на посадку врезался в деревья, в результате чего разрушился, при этом погибли 58 человек."},{"page_url":"https://de.wikipedia.org/wiki/Provinz_Suruga","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Provinces_of_Japan-Suruga.svg","page_title":"Provinz Suruga","context_page_description":"Suruga oder Sunshū war eine der historischen Provinzen Japans auf dem Gebiet der heutigen östlichen Präfektur Shizuoka. Suruga grenzte an die Provinzen Izu, Kai, Sagami, Shinano und Tōtōmi.\\nDie alte Hauptstadt war Sumpu, eine Kurzform von Suruga Fuchū, die auch in der Feudalzeit die wichtigste Stadt blieb. Die Provinz wurde über den größten Teil der Sengoku-Zeit von der Familie Imagawa beherrscht.\\nNachdem Imagawa Yoshimoto durch Oda Nobunaga besiegt worden war, wurden die Imagawa entmachtet, und die Provinz wurde von Takeda Shingen eingenommen. Später wurde sie von Tokugawa Ieyasu einem seiner Alliierten gegeben.\\n1991 wurde der Asteroid Suruga nach der historischen Provinz benannt."},{"page_url":"https://cy.wikipedia.org/wiki/Pafiliwn_Corwen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Pafiliwn%2C_Corwen_-_geograph.org.uk_-_711021.jpg","page_title":"Pafiliwn Corwen","context_page_description":"Neuadd aml-ddefnydd yng Nghorwen, Sir Ddinbych oedd Pafiliwn Corwen. Dechreuodd y pafiliwn ei bywyd fel neuadd arddangos yn Lerpwl cyn ei hailadeiladu yng Nghorwen."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_Baix_Maestrat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Torre_del_Moros.JPG","page_title":"Llista de monuments del Baix Maestrat","context_page_description":"Llista de monuments del Baix Maestrat inscrits en l'Inventari General del Patrimoni Cultural Valencià per la comarca del Baix Maestrat.\\nS'inclouen els monuments declarats com a Béns d'Interés Cultural, classificats com a béns immobles sota la categoria de monuments, i els monuments declarats com a Béns immobles de rellevància local. Estan inscrits en l'Inventari General del Patrimoni Cultural Valencià, en les seccions 1a i 2a respectivament."},{"page_url":"https://nl.wikipedia.org/wiki/Kolencentrales_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Eemshavencentrale_RWE.jpg","page_title":"Kolencentrales in Nederland","context_page_description":"Dit artikel behandelt kolencentrales in Nederland.\\nDe eerste openbare elektriciteitscentrale van Nederland werd in 1886 in Kinderdijk gebouwd, deze centrale maakte gebruik van steenkool. De recentste kolencentrales werden in 2015 en 2016 in bedrijf genomen. Met de invoering van de Wet verbod op kolen bij elektriciteitsproductie eind 2019 is het vanaf 2030 voor alle elektriciteitscentrales in Nederland verboden om kolen als brandstof te gebruiken.\\nIn 2020 zijn er in Nederland nog vier kolencentrales actief.\\nIn november 2015 leverden tien kolencentrales 28,7% van alle elektriciteit in Nederland. Zij waren gezamenlijk verantwoordelijk voor 8% van de CO₂-uitstoot en vormden daarmee een belangrijk onderdeel van de Nederlandse en internationale milieuproblematiek. In april 2017 leverden de zeven overgebleven centrales circa 35% van alle stroom en veroorzaakten zij een CO₂-uitstoot van 25 megaton oftewel ruim 10% van alle CO₂-uitstoot van Nederland. In 2019 waren er nog vijf kolencentrales operationeel in Nederland, zij leverden in dat jaar 14% van alle elektriciteit en veroorzaakten de uitstoot van 13,9 megaton CO₂."},{"page_url":"https://nn.wikipedia.org/wiki/Tynset_kommune","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Tynset_Stasjon.jpg","page_title":"Tynset kommune","context_page_description":"Tynset er ein kommune i Innlandet fylke. Kommunen grensar mot nord til Rennebu og Midtre Gauldal, i nordaust og aust mot Tolga, i sør mot Rendalen og Alvdal, og i vest mot Folldal og Oppdal.\\nKommunen omfattar nå det aller meste av gamle Kvikne kommune der utvinning av kopar byrja rundt år 1630\\ni Kvikne koparverk. Koparverket var landets største og drive for kongeleg regning. Verket vart offisielt nedlagt\\ni 1812, men spradisk drift foregjekk heilt fram til 1912."},{"page_url":"https://fr.wikipedia.org/wiki/Quartier_des_Ternes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/1849_dyonnet.jpg","page_title":"Quartier des Ternes","context_page_description":"Le quartier des Ternes est le 65ᵉ quartier administratif de Paris situé dans le 17ᵉ arrondissement. Il est également considéré comme l'un des plus huppés, avec son voisin, le quartier de la plaine Monceau.\\nIl est délimité par la place de l’Étoile, l'avenue de la Grande-Armée, la porte Maillot, le boulevard périphérique, la porte de Champerret, la rue Rennequin, le boulevard de Courcelles jusqu'à la place des Ternes et l'avenue de Wagram jusqu'au retour à la place de l'Étoile.\\nLe quartier est longé au sud par le grand axe de l'avenue de la Grande-Armée, qui le sépare du quartier de Chaillot. Il est traversé de part en part par l'avenue des Ternes qui forme depuis des siècles son axe central. Celle-ci se prolonge vers le centre de Paris par la rue du Faubourg-Saint-Honoré et vers l'ouest, en direction du pont de Neuilly et de la Défense, par l'avenue du Roule située entièrement sur la commune de Neuilly-sur-Seine."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%82%B9%E3%83%88%E3%83%8A%E3%83%BC%E3%83%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Custonaci-pan.jpg","page_title":"クストナーチ","context_page_description":"クストナーチは、イタリア共和国シチリア州トラーパニ県にある、人口約5,500人の基礎自治体。"},{"page_url":"https://en.wikipedia.org/wiki/European_hare","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Biegn%C4%85ce_zaj%C4%85ce_szaraki_20140427_2184.jpg","page_title":"European hare","context_page_description":"The European hare, also known as the brown hare, is a species of hare native to Europe and parts of Asia. It is among the largest hare species and is adapted to temperate, open country. Hares are herbivorous and feed mainly on grasses and herbs, supplementing these with twigs, buds, bark and field crops, particularly in winter. Their natural predators include large birds of prey, canids and felids. They rely on high-speed endurance running to escape predation, having long, powerful limbs and large nostrils.\\nGenerally nocturnal and shy in nature, hares change their behaviour in the spring, when they can be seen in broad daylight chasing one another around in fields. During this spring frenzy, they sometimes strike one another with their paws. This is usually not competition between males, but a female hitting a male, either to show she is not yet ready to mate or as a test of his determination. The female nests in a depression on the surface of the ground rather than in a burrow and the young are active as soon as they are born. Litters may consist of three or four young and a female can bear three litters a year, with hares living for up to twelve years."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%80%D0%B5%D0%B1%D1%80%D0%BD%D0%BE_%D1%98%D0%B5%D0%B7%D0%B5%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/%D0%A1%D1%80%D0%B5%D0%B1%D1%80%D0%BD%D0%BE_%D1%98%D0%B5%D0%B7%D0%B5%D1%80%D0%BE_1.jpg","page_title":"Сребрно језеро","context_page_description":"Сребрно језеро је вештачко језеро на десној обали Дунава и представља њен некадашњи речни рукавац који је данас затворен двема бранама. Налази се на подручју Браничевског округа у источној Србији, на два километра од Великог Градишта. Просечне је ширине од 300 m, a просечне дужине од 14 km."},{"page_url":"https://pt.wikipedia.org/wiki/Fieseler_Fi_103R_(Reichenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Reichenberg_Pilot.jpg","page_title":"Fieseler Fi 103R (Reichenberg)","context_page_description":"A Fieseler Fi 103R (Reichenberg) foi uma versão tripulada da Fi Fieseler 103 mais conhecida como V-1 bomba voadora, produzido para as missões que deveriam ser realizadas pelo Esquadrão Leónidas, Staffel 5 da Kampfgeschwader 200 da Luftwaffe, nos finais da Segunda Guerra Mundial."},{"page_url":"https://hr.wikipedia.org/wiki/Vede","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Veda_pathashala_students_doing_sandhya_vandanam.JPG","page_title":"Vede","context_page_description":"Vede su najstarije svete staroindijske knjige, i najstariji hinduistički sveti tekstovi koje su sastavili Arijci prije oko 3.500 godina. One su se stoljećima prenosile usmenom predajom i konačno redigirane koncem 6. stoljeća prije Krista. Osim stihova i tekstova, sadrže i pravila pokreta, himne, molitve i poeziju. Hinduisti ga drže za osnovni izvor znanja i svetih osnova njihove vjere, ali su također i jedan od najstarijih oblika žive kulturne baštine na svijetu. Zbog toga je tradicija vedskog pjevanja upisana na UNESCO-v Popis nematerijalne svjetske baštine u Aziji i Oceaniji 2008. godine."},{"page_url":"https://fr.wikipedia.org/wiki/Swayze_Field","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Ole_miss_panoramic.jpg","page_title":"Swayze Field","context_page_description":"Le Oxford-University Stadium at Swayze Field, dit Swayze Field, est un stade de baseball de 10 715 places situé à Oxford dans l'État du Mississippi. Il est officiellement inauguré le 19 février 1989. C'est le domicile des Rebels d'Ole Miss, club de baseball de l'université du Mississippi.\\nLe stade a été nommé ainsi en l'honneur de Tom Swayze."},{"page_url":"https://id.wikipedia.org/wiki/Hipatia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Icon_of_Saint_Catherine.jpg","page_title":"Hipatia","context_page_description":"Hipatia adalah seorang filsuf, astronom, dan matematikawan Helenistik yang tinggal di kota Aleksandria, Mesir pada zaman Kekaisaran Romawi. Ia merupakan tokoh neoplatonisme di Aleksandria, dan di kota tersebut ia mengajarkan ilmu filsafat dan astronomi. Ia adalah matematikawan wanita pertama dengan keterangan sejarah yang cukup mudah untuk ditemui. Hipatia dikenal pada masanya sebagai seorang guru besar dan penasihat yang bijak. Ia pernah menulis sebuah ulasan untuk Aritmetika karya Diofantos yang terdiri dari tiga belas jilid, dan ulasan ini telah disisipkan ke dalam naskah aslinya. Ia juga pernah membuat ulasan untuk risalah Apolonios dari Perga mengenai irisan kerucut, tetapi ulasan ini sudah hilang ditelan zaman. Banyak ahli modern yang meyakini bahwa Hipatia mungkin pernah menyunting naskah Almagest karya Ptolemaios berdasarkan judul ulasan buatan ayahnya, Theon, untuk Buku III Almagest.\\nHipatia dikenal karena pernah membuat astrolab dan hidrometer, tetapi ia bukanlah penemu kedua alat ini, dan alat-alat ini sendiri sudah digunakan jauh sebelum ia lahir."},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%A9onard_Victor_Charner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Amiral_Charner.jpg","page_title":"Léonard Victor Charner","context_page_description":"Léonard Victor Joseph Charner était un officier de marine français du XIXᵉ siècle qui participa à de nombreuses campagnes sous la Restauration, la Monarchie de Juillet et le Second Empire, et reçut la dignité d'amiral de France. En politique, il fut député en 1849, et sénateur de 1862 à sa mort."},{"page_url":"https://en.wikipedia.org/wiki/Mandelbrot_set","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Mandel_zoom_00_mandelbrot_set_3D.jpg","page_title":"Mandelbrot set","context_page_description":"The Mandelbrot set is the set of complex numbers for which the function does not diverge when iterated from, i.e., for which the sequence, etc., remains bounded in absolute value.\\nIts definition is credited to Adrien Douady who named it in tribute to the mathematician Benoit Mandelbrot. The set is connected to a Julia set, and related Julia sets produce similarly complex fractal shapes.\\nMandelbrot set images may be created by sampling the complex numbers and testing, for each sample point, whether the sequence goes to infinity. Treating the real and imaginary parts of as image coordinates on the complex plane, pixels may then be coloured according to how soon the sequence crosses an arbitrarily chosen threshold, with a special color used for the values of for which the sequence has not crossed the threshold after the predetermined number of iterations. If is held constant and the initial value of —denoted by —is variable instead, one obtains the corresponding Julia set for each point in the parameter space of the simple function."},{"page_url":"https://az.wikipedia.org/wiki/Ani_Lorak","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Ani_Lorak_ESC_Party_2009_8.jpg","page_title":"Ani Lorak","context_page_description":"Ani Lorak – Ukrayna estrada müğənnisi, Ukraynanın xalq artisti."},{"page_url":"https://en.wikipedia.org/wiki/Hot_Lake_Hotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Hot_Lake_Springs%2C_Oregon-1.jpg","page_title":"Hot Lake Hotel","context_page_description":"Hot Lake Hotel is a historic Colonial Revival hotel originally built in 1864 in Hot Lake, Union County, Oregon, United States. The hotel received its namesake from the thermal spring lakes on the property, and operated as a luxury resort and sanitorium during the turn of the century, advertising the medicinal attributes of the mineral water and drawing visitors worldwide. It is also the first known commercial building in the world to utilize geothermal energy as its primary heat source.\\nAfter a fire burned down over half of the hotel in 1934, the remaining building was used for various purposes, including a retirement home, asylum, and a nurse's training school during World War II. After that, operations were intermittent under various owners before the building's abandonment in 1991. The hotel and surrounding structures were added to the National Register of Historic Places in 1979.\\nToday, it is operated as a bed and breakfast, museum, and spa. Prior owners included future governor Walter M. Pierce and former state senator Parish L. Willis."},{"page_url":"https://pl.wikipedia.org/wiki/Bie%C5%82gorod","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B3%D0%B8%D0%BC%D0%BD%D0%B0%D0%B7%D0%B8%D0%B8_%D0%9A%D0%BE%D1%80%D0%BE%D1%82%D0%BA%D0%BE%D0%B2%D0%BE%D0%B9_XIX_%D0%B2%D0%B5%D0%BA.JPG","page_title":"Biełgorod","context_page_description":"Biełgorod – miasto obwodowe w europejskiej części Rosji, położone nad rzeką Doniec, 40 km na północ od granicy z Ukrainą i 695 km na południe od Moskwy, w Centralnym Okręgu Federalnym."},{"page_url":"https://az.wikipedia.org/wiki/Xubilay_xan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/TuluiWithQueenSorgaqtani.jpg","page_title":"Xubilay xan","context_page_description":"Xubilay xan - Monqol İmperiyasının beşinci xaqanı və Yuan sülaləsinin banisi.\\nXubilay Toluy xanın 4-cü oğlu və Çingiz xanın nəvəsi idi. 1260-cı ildə böyük qardaşı Mengü xanın ölümündən sonra taxta çıxdı, ancaq o, kiçik qardaşı Arıq Buğanı 1264-cü ilə qədər davam edəm Monqolustan Vətəndaş Müharibəsində məğlub etməli oldu. Bu hadisə imperatorluğun dağılmasının başlanğıcı hesab edilir. Xubilayın həqiqi qüdrəti Çinə və Monqolustana çatsa da, hələ də Elxanilər dövləti üzərində və az da olsa, Qızıl Ordu üzərində hakimiyyəti var idi. Əgər Monqol imperiyası o dövr üçün vahid hesab edilsə idi, Xubilay xanın gücü Sakit okeandan Qara Dənizə Sibirdən müasir Əfqanıstana - dünyanın məskunlaşılmış torpaq ərazisinin beşdə birinə çatırdı.\\n1271-ci ildə Xubilay Yuan sülaləsinin əsasını qoydu. O, müasir Monqolustan, Çin, Koreya və bəzi qonşu əraziləri idarə edir və Çin imperatoru hesab edilirdi. 1279-cu ilə qədər Yuan qüvvələri Cənubi Sun sülaləsinin axırıncı müqavimətini qırdı və Xubilay imperatorluğu birləşdirən ilk Xan sülaləsinə mənsub olmayan şəxs oldu. Bundan başqa Xubilay 1260-cı ildən sonra yeni ərazilər işğal edən tək Monqol xanı oldu."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Notre-Dame_de_Saint-Bertrand-de-Comminges","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Cath%C3%A9drale_Notre-Dame_de_Saint-Bertrand-de-Comminges_02.jpg","page_title":"Cathédrale Notre-Dame de Saint-Bertrand-de-Comminges","context_page_description":"La cathédrale Notre-Dame de Saint-Bertrand-de-Comminges, également appelée cathédrale Sainte-Marie, est une cathédrale catholique, située au pied des Pyrénées dans la commune de Saint-Bertrand-de-Comminges, dans le département de la Haute-Garonne en région Occitanie.\\nLa cathédrale Notre-Dame de Saint-Bertrand-de-Comminges était la cathédrale du diocèse de Comminges jusqu'au 29 novembre 1801, date à laquelle le pape Pie VII a établi la bulle Qui Christi Domini répartissant le territoire du diocèse de Comminges entre l'archidiocèse de Toulouse et le diocèse de Bayonne.\\nLa cathédrale Saint-Étienne de Toulouse est alors devenu la cathédrale de l'archidiocèse de Toulouse où siège l'archevêque. Depuis 1801, la cathédrale est devenue l'église paroissiale Sainte-Marie.\\nLa cathédrale fait l’objet d’un classement au titre des monuments historiques par la liste de 1840. Elle est également inscrite au patrimoine mondial de l'UNESCO au titre des chemins de Saint-Jacques-de-Compostelle en France depuis 1998."},{"page_url":"https://lt.wikipedia.org/wiki/Ostrogo_pilis","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Z._Vogel._Castle_of_Ostroh.jpg","page_title":"Ostrogo pilis","context_page_description":"Ostrogo pilis – viduramžiais statyta gynybinė pilis dabartiniame Ostroho mieste. Mūrinė pilis, tapusi kunigaikščių Ostrogiškių giminės lizdu, istoriniuose šaltiniuose pirmą kartą paminėta 1386 m. Tuo metu tai buvo svarbus gynybinis įtvirtinimas, galintis atlaikyti ilgalaikę apsiaustį: turintis galingais kontroforsais paremtas storas sienas, nedideles šaudymo angas jose. Pilį supo vandens griovys.\\nIškilusi Kijevo Rusios laikų medinės pilaitės, kurią 1241 m. sugriovė totoriai, vietoje. Vilijos upės slėnyje ant 20 m aukščio piliakalnio kunigaikštis Daniilas Ostrogiškis pastatė donžoną, dar vadinamą Mūro bokštu. Vėliau, iki pat XIX a., jis buvo perstatomas ir šiandieną tai trijų aukštų akmens ir plytų mūro pastatas, tarnaujantis kaip įvažos vartai.\\nKitame trikampės 0,7 ha ploto piliavietės gale dunkso Apvalusis bokštas, pastatytas gerokai vėliau – XVI a. Jo viršutinę dalį renesanso stiliumi įrengė Konstantinas Vosylius Ostrogiškis. Į pilį galima patekti per Mūro bokštą ir per Vartų bokštą. Pastarasis nuo 1905 m. tarnauja kaip varpinė Kristaus Apsireiškimo cerkvei, esančiai pilies kieme. Ostragiškiai buvo stačiatikiai ir pravoslavų šventovę savo rezidencijoje pastatė dar XV–XVI a."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8A%E6%B5%B7%E5%9B%BD%E9%9A%9B%E5%8D%9A%E8%A6%A7%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Food_at_Shanghai_Expo.jpg","page_title":"上海国際博覧会","context_page_description":"上海国際博覧会は2010年5月1日から同年10月31日まで、中華人民共和国上海市浦東新区の上海世博園で開かれた国際博覧会である。\\n約160年の国際博覧会の歴史において発展途上国における初めての開催とされることが多いが、実際には1949年にハイチの首都ポルトープランスで博覧会が開かれたという記録があるほか、国際園芸博覧会兼国際博覧会は、1999年に同じ中国で昆明世界園芸博覧会が、2006年にはタイでチェンマイ国際園芸博覧会が開かれている。\\n過去に万博に参加したことがない北朝鮮が初めて出展、1970年の大阪の日本万国博覧会以来40年ぶりに参加する中華民国が出展したことでも知られる。また、資金難で2000年のハノーヴァー万国博覧会への参加を見送ったアメリカ合衆国も、2005年の愛知万博に引き続き今回も出展するなど、参加国、国際機関は万博史上最多の246を数え、敷地も万博史上最大であり、世界193カ国が参加申請うち189カ国が出展し、中国では皇帝時代の「万国来朝」に喩えられた。しかし、上海協力機構、欧州連合、ASEAN、アラブ連盟、アフリカ連合のような地域連合までもが参加したようにこの裏には過剰な勧誘があったとされ、この件は「問題」の項目を参照されたい。\\n建設、運営費用などの総事業費は万博史上最高額の約286億元、地下鉄や空港などのインフラ建設や都市整備などを含めると4千億元が投入された。"},{"page_url":"https://ru.wikipedia.org/wiki/Kara_no_Kyoukai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Taiji-state.png","page_title":"Kara no Kyoukai","context_page_description":"Kara no Kyoukai — ранобэ авторства Киноко Насу, написанное им до основания компании Type-Moon в 1998 году и опубликованное на персональной странице сайта любительских работ «такэбоки». В 2001 году произведение было выпущено как додзинси, выполненное в двух томах с иллюстрациями Такаси Такэути, уже в рамках продукции Type-Moon. В 2004 году состоялось профессиональное переиздание компанией Kodansha. Роман повествует о расследовании серии мистических событий, происходящих в японском городе Мифунэ, сотрудниками магической фирмы Garan no Dou.\\nВ 2002 году звукозаписывающей компанией Magic Cage был осуществлён выпуск одноимённой радиопостановки. С 2007 по 2009 год студией ufotable выпускалась в прокат серия из семи анимационных фильмов, спродюсированных Хикару Кондо и Ацухиро Иваками. Музыкальное сопровождение фильмов было выполнено Юки Кадзиурой, сформировавшей специально для исполнения закрывающих композиций Kara no Kyoukai группу Kalafina.\\nВ 2008 и 2013 году Киноко Насу в качестве материалов для промоакций экранизации романа были изданы две дополнительные главы, первая из которых получила в 2013 году собственную экранизацию студией ufotable."},{"page_url":"https://lt.wikipedia.org/wiki/Tirgu_%C5%BDiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/ROU_GJ_Targu_Jiu_CoA.png","page_title":"Tirgu Žiu","context_page_description":"Tirgu Žiu – miestas pietvakarių Rumunijoje, prie Žiu upės; apskrities centras. Išvystyta mašinų, medienos, lengvoji pramonė."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%8B%A5%E8%91%89%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Tobu_Tojo_Line_%28TJ%29_symbol.svg","page_title":"若葉站","context_page_description":"若叶站，是一个位于埼玉县坂户市关间四丁目，属于东武铁道东上本线的铁路车站。车站编号是TJ 25。车站所在地是坂户市，但是车站西口与近池袋则位于鹤岛市。"},{"page_url":"https://pt.wikipedia.org/wiki/Pedro_Nic%C3%A1cio","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/MaillotBrasil.PNG","page_title":"Pedro Nicácio","context_page_description":"Pedro Nicácio, é um ciclista profissional brasileiro nascido a 13 de outubro de 1981 em Curitiba. É um destacado contrarrelógista pelo que tem sido 3 vezes campeão brasileiro contrarrelógio e campeão panamericano.\\nComeçou no ciclismo em 1997 mas competindo em ciclismo de montanha onde foi vice-campeão brasileiro júnior em 1999. Em 2001, alentado pela potência que tinha na estrada, começou a competir em provas de dita modalidade, sem deixar o mountain bike, até que em 2002 optou definitivamente pelo ciclismo de estrada.\\nEm 2004 obteve o terceiro lugar no Tour de Santa Catarina e um ano depois a mesma localização na Volta do Estado de São Paulo por trás dos argentinos Jorge Giacinti e Matías Medici, além de conseguir a medalha de prata na contrarrelógio dos campeonatos panamericanos e ser campeão brasileiro na mesma especialidade.\\nEm 2006 obteve os seus maiores lauros quando conseguiu a medalha de ouro nos campeonatos panamericanos e venceu no Tour de Santa Catarina.\\nEm 2007 passou à equipa profissional Scott-Marcondes César-São José dos Campos e coroou-se pela terceira vez campeão brasileiro contrarrelógio."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%82%D8%A7%DB%8C%D9%82%E2%80%8C%D8%B3%D8%A7%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Chelidonium_majus_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-033.jpg","page_title":"شقایق‌سانان","context_page_description":"شقایق‌سانان یکی از راسته‌های گیاهان است.\\nشقایق‌سانان راسته‌ای از دولپه‌ای‌های غالباً علفی است شامل شاهتره‌ایان و شقایقیان که آلکالوئیدهای متنوع دارند و با آلاله‌سانان خویشاوند هستند."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8_%D1%87%D1%83%D1%85%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/African_Scopes-owl_Otus_senegalensis.jpg","page_title":"Африкански чухал","context_page_description":"Африкански чухал е вид птица от семейство Совови."},{"page_url":"https://gl.wikipedia.org/wiki/Habib_Bamogo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Bamogo.jpg","page_title":"Habib Bamogo","context_page_description":"Habib Nomwaya Bamogo nado en París o 8 de maio de 1982, é un futbolista francés de orixe burkinense que ocupa a demarcación de dianteiro."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%971%E6%9D%A1%E5%AE%AE%E3%81%AE%E6%B2%A2%E9%80%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Chuo_Sapporo_N1W4n4272.jpg","page_title":"北1条宮の沢通","context_page_description":"北1条宮の沢通は、札幌市中央区から手稲区に至る都市計画道路。区間により国道230号、北海道道124号宮の沢北一条線、主要市道9902号南19条宮の沢線となる。"},{"page_url":"https://en.wikipedia.org/wiki/Sextil_Pu%C8%99cariu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Casa_Sextil_Pu%C8%99cariu_%28Baritiu_Gh._12%29.jpg","page_title":"Sextil Pușcariu","context_page_description":"Sextil Iosif Pușcariu was an Austro-Hungarian-born Romanian linguist and philologist, also known for his involvement in administrative and party politics. A native of Brașov educated in France and Germany, he was active in Transylvania's cultural life and worked as a Romanian-language professor at Czernowitz in the Duchy of Bukovina. He began his scholarly career in 1906, when he was tasked with compiling a general dictionary of the Romanian language. Interested in a variety of disciplines, Pușcariu published widely and brought new ideas into Romania, as well as overseeing two monumental projects related to the language: advancing his dictionary to the letter \\"L\\", and creating an atlas of the language.\\nAs a soldier for Austria-Hungary during World War I, Pușcariu embraced the creation of Greater Romania at its conclusion, heading the department of foreign affairs in the provisional government representing Bukovina Romanians. He was also the founder of Glasul Bucovinei, a newspaper which helped channel Romanian nationalism in that region, and, with Ion Nistor, oversaw Bukovina's union with Romania in November 1918."},{"page_url":"https://pt.wikipedia.org/wiki/R%C3%A9is","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/300_R%C3%A9is_de_1938_%28verso%29.png","page_title":"Réis","context_page_description":"Réis é o plural do nome das unidades monetárias de Portugal, do Brasil e de outros países lusófonos durante certos períodos da história.\\nEm Portugal e nas então colônias portuguesas que utilizavam do \\"mil-réis\\" quando da Implantação da República Portuguesa, a moeda foi substituída pelo Escudo na razão de um Escudo por mil-réis em 1911.\\nNo Brasil, esta moeda foi substituída pelo cruzeiro em 5 de outubro de 1942, na razão de 1 cruzeiro por mil-réis então circulantes. A moeda era utilizada no país desde os tempos coloniais.\\nConto de réis é uma expressão adotada no Brasil e em Portugal para indicar um milhão de réis. \\"Conto\\" deriva do latim computus, a conta dez vezes cem mil. Um conto de réis correspondia a mil vezes a importância de um mil-réis, sendo assim o real 1/1.000.000 de um conto de réis em representação matemática decimal atual. Em Portugal, por ocasião da proclamação da República, o real foi substituído pelo escudo na razão de 1 escudo por mil-réis. Mesmo após a substituição do real pelo escudo, continuou a utilizar-se a expressão \\"conto\\", agora para indicar mil escudos."},{"page_url":"https://et.wikipedia.org/wiki/Liivimaa_r%C3%BC%C3%BCtelkonna_aadlimatrikkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Jarmerstedti_suguv%C3%B5sa_aadlivapp.jpg","page_title":"Liivimaa rüütelkonna aadlimatrikkel","context_page_description":"Liivimaa rüütelkonna aadlimatrikkel oli Liivimaa seisusliku korporatsiooni Liivimaa rüütelkonna liikmete register."},{"page_url":"https://lt.wikipedia.org/wiki/Mez%C4%97keve%C5%A1das","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Hungary_Mezokovesd_agriculture_museum_1.jpg","page_title":"Mezėkevešdas","context_page_description":"Mezėkevešdas − miestas Vengrijos šiaurės rytuose. Nutolęs 50 km nuo Miškolco ir 15 km nuo Egerio."},{"page_url":"https://en.wikipedia.org/wiki/Peru%E2%80%93Poland_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Polonia_y_Per%C3%BA_conmemoran_noventa_a%C3%B1os_de_relaciones_diplom%C3%A1ticas_y_diez_de_investigaciones_arqueol%C3%B3gicas_en_la_costa_norte_%289690103854%29.jpg","page_title":"Peru–Poland relations","context_page_description":"Peru–Poland relations refers to the historical and bilateral relationship between Peru and Poland."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Castelsardo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Castelsardo01.jpg","page_title":"Burg Castelsardo","context_page_description":"Die Burg Castelsardo liegt als eine in großen Teilen erhaltene Höhenburg auf einem Felsblock direkt im Norden Sardiniens am Golfo dell’Asinara in der Provinz Sassari. Nordöstlich zur Küstenlinie liegt direkt an die Burg anschließend der eigentliche Ort Castelsardo. Beide waren im Mittelalter mit einer gemeinsamen Festungsmauer geschützt. Der erweiterte Ort der Neuzeit befindet sich südlich vor dem Burgberg."},{"page_url":"https://ceb.wikipedia.org/wiki/Metaeuchromius","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Metaeuchromius_lata.JPG","page_title":"Metaeuchromius","context_page_description":"Henero sa mga alibangbang ang Metaeuchromius. Ang Metaeuchromius sakop sa kabanay nga Crambidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%B8%D8%A7%D9%85_%D9%82%D8%B7%D8%B9_%D8%AE%D8%B4%D8%A8_%D8%A7%D9%84%D9%85%D8%A3%D9%88%D9%89.","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Loblolly_pine_shelterwood.jpg","page_title":"نظام قطع خشب المأوى.","context_page_description":"يشير نظام قطع خشب المأوى إلى التطور في قطع الغابات والذي بدوره يؤدي إلى إنشاء جيل جديد من الشتلات من نوع معين أو مجموعة من الأنواع دون زراعة. ينفذ نظام زراعة الغابات عادة ما على الغابات التي تعتبر ناضجة وغالبا ما تكون بعد عدة تخفيفات. عادة ما تكون الأنواع المطلوبة من الشتلات طويلة الأجل وتميل شتلاتها بشكل طبيعي إلى البدء في النمو تحت ظل جزئي. يمنح نظام قطع خشب المأوى ما يكفي من الضوء للأنواع المرغوب بها لإنشائها دون إعطاء الضوء الكافي للأعشاب الضارة التي تتكيف مع أشعة الشمس الكاملة. وبمجرد إنشاء الأنواع المرغوب بها، فإن القطع اللاحقة تعطي الشتلات الجديدة المزيد من الضوء ومساحة للنمو بشكل كامل إلى الجيل الجديد من الشتلات.\\nما يفصل بين قطع خشب المأوى عن أنظمة التجديد الأخرى، مثل قطع الأشجار أو شجرة البذور، هو أن الشتلات الجديدة يتم إنشاؤها قبل إزالة الأشجار الناضجة بالكامل. وهذا يعطي رجل الغابة مزيدًا من التحكم في الأنواع التي يتم تجديدها، وهو أكثر سهولة إذا فشل جهد التجديد الأول. يمكن إزالة جميع الأشجار الناضجة، أو إنشاء غابة بها أشجار يافعة، أو الحفاظ على عدد كبير من المحميات لتوفير بنية ذات عمرين. غالبًا ما يفضل أصحاب الأخشاب الصغيرة هذه الطريقة للتحكم الذي يوفره وأيضًا لأن الدخل من الحصاد ينتشر على مدى عقد أو أكثر."},{"page_url":"https://en.wikipedia.org/wiki/List_of_presidents_of_the_Royal_College_of_Physicians_of_Edinburgh","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Sir_Byrom_Bramwell._Photograph_by_A._Swan_Watson._Wellcome_V0026086.jpg","page_title":"List of presidents of the Royal College of Physicians of Edinburgh","context_page_description":"This is an incomplete list of the Presidents of the Royal College of Physicians of Edinburgh, which\\nwas granted its Royal Charter by Charles II in 1681."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AD%D9%85%DB%8C%D8%AF_%D9%84%D8%A8%D8%AE%D9%86%D8%AF%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Hamid_Labkhandeh_%281%29.jpg","page_title":"حمید لبخنده","context_page_description":"حمید لبخنده ایرانلی سینما، تئاتر و تلویزیون اوْیونجوسودور"},{"page_url":"https://ca.wikipedia.org/wiki/Vilhelm_Wolfhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Football_at_the_1912_Summer_Olympics_-_Denmark_squad.JPG","page_title":"Vilhelm Wolfhagen","context_page_description":"Vilhelm Wolfhagen va ser un futbolista danès que va competir a començaments del segle xx. Jugà com a davanter i en el seu palmarès destaquen dues medalles de plata en la competició de futbol dels Jocs Olímpics de Londres de 1908 i d'Estocolm de 1912; i quatre edicions de la lliga danesa de futbol, el 1912-1913, 1913-1914, 1916-1917 i 1917-1918, sempre amb el KB Copenhaguen.\\nA la selecció nacional jugà un total de 18 partits, en què marcà 18 gols."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%AB%98%E5%BA%A6%E8%AE%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Digital-barometric-pressure-sensor.jpg","page_title":"高度计","context_page_description":"高度計是用來測量物體水平高度，即海拔的工具。高度的測量被稱為測高，與測深，即測量水下深度類似。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%8A%D8%B3%D8%A7%D9%86_%D9%81%D8%A7%D9%86%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nissan_Sunny_Vanette_101.JPG","page_title":"نيسان فانيت","context_page_description":"نيسان فانيت ‏ هي سيارة من تصنيع شركة نيسان موتورز."},{"page_url":"https://sv.wikipedia.org/wiki/Meusslitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Meu%C3%9Flitz.jpg","page_title":"Meusslitz","context_page_description":"Meusslitz är en stadsdel i sydöstra Dresden i Sachsen, Tyskland.\\nByn Meusslitz, som nämndes första gången 1350, grundades av slaver och bykärnan har kvar den runda form som är typisk för slaviska byar från medeltiden. 1950 blev det en del av Dresden."},{"page_url":"https://es.wikipedia.org/wiki/Lysimachia_vulgaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Lysimachia_vulgaris_MHNT.BOT.2004.0.805.jpg","page_title":"Lysimachia vulgaris","context_page_description":"Lysimachia vulgaris o lisimaquia es una especie de planta fanerógama perteneciente a la familia Primulaceae. Es nativa de Europa meridional donde crece en los bordes de los ríos y lugares sombríos encharcados."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B3%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Andrei_and_Aliaksandr_Bahdanovich_2010_Belarusian_stamp.jpg","page_title":"Богданович, Александр Викторович","context_page_description":"Александр Викторович Богданович — белорусский гребец на каноэ. Почетный гражданин города Бобруйска. С 2016 года, депутат Осиповичского района Палаты представителей Беларуси.\\nНачинал спортивную карьеру в Бобруйском государственном училище олимпийского резерва под руководством тренера П. Ф. Яновского. Олимпийский чемпион Олимпиады 2008 года на каноэ-двойке на 1000 метров и 4-й на 500 метров. На Олимпийских играх 2004 — 6-е и 10-е место в двойке на 500 и 1000 м соответственно. Победитель и призёр Чемпионатов мира и Чемпионатов Европы.\\nУчастник Олимпийских игр 2012 года в категории каноэ-двойка дистанция 1000 м, где вместе с Андреем Богдановичем завоевал серебро."},{"page_url":"https://ca.wikipedia.org/wiki/Le_Ch%C3%A2teau-d%27Ol%C3%A9ron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Map_commune_FR_insee_code_17093.png","page_title":"Le Château-d'Oléron","context_page_description":"Le Château-d'Oléron és un municipi francès, situat al departament del Charente Marítim i a la regió de la Nova Aquitània. L'any 2007 tenia 3.949 habitants."},{"page_url":"https://uk.wikipedia.org/wiki/Victoria_amazonica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Victoria_amazonica_Manaus_10_2006_195.jpg","page_title":"Victoria amazonica","context_page_description":"Вікторія амазонська або вікторія регія — один з видів квіткових рослин, найбільший з родини лататтєвих."},{"page_url":"https://en.wikipedia.org/wiki/Counts_and_dukes_of_Anjou","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Philippe_de_France_by_Barri%C3%A8re.jpg","page_title":"Counts and dukes of Anjou","context_page_description":"The Count of Anjou was the ruler of the county of Anjou, first granted by Charles the Bald in the 9th century to Robert the Strong. Ingelger and his son were viscounts of Angers until Ingelger's son Fulk the Red assumed the title of Count of Anjou. The Robertians and their Capetian successors were distracted by wars with the Vikings and other concerns and were unable to recover the county until the reign of Philip II Augustus, more than 270 years later.\\nIngelger's male line ended with Geoffrey II, Count of Anjou. Subsequent counts of Anjou were descended from Geoffrey's sister Ermengarde of Anjou and Geoffrey II, Count of Gâtinais. Their agnatic descendants, who included the Angevin kings of England, continued to hold these titles and property until the French monarchy gained control of the area. Thereafter the titles Count of Anjou and, after 1360, Duke of Anjou were granted several times, usually to members of the French ruling houses of Valois and Bourbon.\\nSimilar to the title of Duke of York in England, none of those who received the title Duke of Anjou, were able to transmit it; they either died without a male heir, returned it to the royal domain, or succeeded to the throne."},{"page_url":"https://id.wikipedia.org/wiki/Kerajaan_Dyfed","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/LDDyfedCantrefi.png","page_title":"Kerajaan Dyfed","context_page_description":"Kerajaan Dyfed adalah salah satu kerajaan kecil di Wales tenggara yang berdiri pada abad ke-5 dari bekas wilayah Demetae setelah bangsa Romawi mundur dari Britania. Dyfed merupakan kerajaan yang merdeka hingga tahun 920, ketika kerajaan ini dicaplok oleh Hywel Dda, penguasa Seisyllwg dan pendiri kerajaan Deheubarth. Setelah bangsa Norman melancarkan invasi pada tahun 1067–1100, kerajaan ini ditaklukkan oleh mereka dan pada tahun 1138 telah menjadi bagian dari Pembrokeshire yang dinamai dari sebuah kastil Norman yang dibangun di Cantref Penfro."},{"page_url":"https://no.wikipedia.org/wiki/Kyros_den_store","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Relief_of_Cyrus%2C_Pasargadae.jpg","page_title":"Kyros den store","context_page_description":"Kyros II den store var konge av Perserriket ved å være grunnlegger av Akamenide-dynastiet som etablerte det første persiske rike. Han ble vanligvis omtalt som «den store», men grekerne omtalte han som «Kyros den eldre». Under hans styre omfavnet Perserriket alle tidligere sivilisasjoner i oldtidens Levanten. Fra Middelhavet og Hellespont i vest til elven Indus i øst skapte Kyros det største riket som verden hittil hadde sett. Under hans etterfølgere strakte riket seg til dets maksimale utstrekning fra deler av Balkan og Øst-Europa i vest til Indus i øst. Hans regale titler var blant annet storkonge, konge av Persia, konge av Anshan, konge av Media, konge av Babylon, konge av Sumer og Akkad og konge av verdens fire hjørner. Nabonidus-krøniken noterte endringen i hans tittel fra kun «konge av Anshan», en by, til «konge av Persia». Assyriologen François Vallat skrev at «Da Astyages marsjerte mot Kyros, er Kyros kalt «konge Anshan», men da Kyros krysset Tigris på vei til Lydia, er han «konge av Persia». Statskuppet skjedde derfor mellom de to hendelsene.»\\nRegjeringstiden til Kyros varte i rundt tredve år."},{"page_url":"https://en.wikipedia.org/wiki/Paleobiota_of_the_Yixian_Formation","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/EuhelopusDB2.jpg","page_title":"Paleobiota of the Yixian Formation","context_page_description":"The Yixian Formation is a geological formation in Jinzhou, Liaoning, People's Republic of China, that spans about 5 million years during the early Cretaceous period. It is known for its fossils, listed below.\\nThe Yixian Formation is divided into the following subunits:\\nJingangshan Bed\\nDawangzhangzi Bed\\nJianshangou Bed\\nLujiatun Bed\\nBasalt base"},{"page_url":"https://de.wikipedia.org/wiki/Bundeskanzlerplatz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Adenauer_Kopf_01_Bonn_20080504.jpg","page_title":"Bundeskanzlerplatz","context_page_description":"Der Bundeskanzlerplatz ist ein Verkehrsplatz im Bonner Ortsteil Gronau, an dem die Reuterstraße auf die Bundesstraße 9 mündet. Am Bundeskanzlerplatz befindet sich der geografische Mittelpunkt der Stadt Bonn."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_stations_du_m%C3%A9tro_de_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/U-Bahn_Berlin_Wuhletal.JPG","page_title":"Liste des stations du métro de Berlin","context_page_description":"La liste des stations du métro de Berlin est une liste alphabétique complète des 173 stations du métro de Berlin. Des 96 quartiers de Berlin, 35 disposent d'au moins une station de métro. La plupart des stations se situent à Mitte, Kreuzberg et Charlottenbourg. L'importance du réseau métropolitain berlinois est indissociable des 166 stations de S-Bahn qui réseautent toute la ville pour un total de 339 stations."},{"page_url":"https://de.wikipedia.org/wiki/Triumphwagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Arch_of_titus_-_imperial_cortege.jpg","page_title":"Triumphwagen","context_page_description":"Der Triumphwagen ist ein vorwiegend mittelalterliches Motiv mit dem historischen Hintergrund der griechisch-römischen Quadriga, einem vom offenen Streit-, Renn- oder Triumphwagen aus gelenktes Viergespann."},{"page_url":"https://de.wikipedia.org/wiki/Dorische_Ordnung","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Doric_order_-_Temple_of_Poseidon_-_Paestum_-_Italy.JPG","page_title":"Dorische Ordnung","context_page_description":"Die dorische Ordnung ist eine der fünf klassischen Säulenordnungen. In der Hierarchie der Ordnungen steht sie zwischen der toskanischen und der ionischen Ordnung."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6ssein","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/K%C3%B6ssein_kurz_vor_der_M%C3%BCndung_in_die_R%C3%B6slau_mit_Markgrafenbr%C3%BCcke.JPG","page_title":"Kössein","context_page_description":"Die Kössein ist ein Bach des bayerischen Fichtelgebirges, der am Berg Kösseine entspringt und nach einem erst östlichen, dann nordöstlichen Lauf von 19 km Länge beim Dorf Seußen der Stadt Arzberg im Landkreis Wunsiedel im Fichtelgebirge von rechts in die Röslau mündet."},{"page_url":"https://en.wikipedia.org/wiki/Kwangjin_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Korean_Park%2C_Ere%C4%9Fli%2C_Konya_Province.jpg","page_title":"Kwangjin Park","context_page_description":"Kwangjin Parkı, or Kwangjin Dostluk Parkı, is an urban recreational area in Ereğli district of Konya Province, Turkey. The park was established jointly by the municipalities of Ereğli and its South Korean sister city Gwangjin on 16 October 2002. In the inscription of the park it reads:\\nThis part has been established within the scope of friendship and cooperation protocol of Kwangjin and Ereğli cities to evoke the historical friendship between the Korean and Turkish nations eternally.\\nBeing one of the excursion areas of the city, it is situated to the west of the train station at 37°30′N 34°03′E. There is also a wedding-ceremony hall in the park. A summer house built in Korean style is situated at the center of the park."},{"page_url":"https://id.wikipedia.org/wiki/Peter_Lamborn_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Pirate_Utopias%2C_autographed.jpg","page_title":"Peter Lamborn Wilson","context_page_description":"Peter Lamborn Wilson adalah pengarang anarkis Amerika Serikat yang dikenal sebagai penggagas konsep zona otonom sementara. Ia sosok yang kontroversial di kalangan anarkis karena mendukung pedofilia."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Frederikshavn%E2%80%93Skagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Skagensbanen_Godstog.jpg","page_title":"Bahnstrecke Frederikshavn–Skagen","context_page_description":"Die Bahnstrecke Frederikshavn–Skagen ist eine normalspurige Bahnstrecke auf der dänische Insel Vendsyssel-Thy zwischen Skagen und Frederikshavn. Die Strecke mit einer Gesamtlänge von 39,7 km wird in Anlehnung an die zweite Betreibergesellschaft Skagensbanen genannt."},{"page_url":"https://vi.wikipedia.org/wiki/Cleistocactus_brookeae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Cleistocactus_vulpis-cauda.jpg","page_title":"Cleistocactus brookeae","context_page_description":"Cleistocactus brookeae là một loài thực vật có hoa trong họ Cactaceae. Loài này được Cárdenas mô tả khoa học đầu tiên năm 1952."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BD%D1%8B%D1%85_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_Impact_Wrestling","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Pacman_Jones.jpg","page_title":"Список командных чемпионов Impact Wrestling","context_page_description":"Первыми командными титулами у TNA были титулы мировых командных чемпионов NWA. Титулы мировых командных чемпионов NWA просуществовали в TNA из 2002 года и до 2007 года. Титулы мировых командных чемпионов NWA перестали быть у TNA после окончания контракта TNA из NWA. После этого у TNA были созданы свои титулы командных чемпионов.\\nТитулы командных чемпионов TNA были созданы 17 мая 2007 года. Которые заменили титулы командных чемпионов NWA.Первыми чемпионами стали команда Team 3D. Дольше всех этим чемпионством владели Роберт Руд и Джеймс Шторм. Также больше всех этим титулами владел Джеймс Шторм шесть раз. В марте 2017 года переименованы в титулы командных чемпионов Impact Wrestling."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB-%D1%81%D0%B5%D1%80%D1%96%D0%BB%D1%96%D0%BA_%D3%A9%D0%BD%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/%D0%A1%D0%B0%D0%BB_%D0%BC%D0%B5%D0%BD_%D1%81%D0%B5%D1%80%D1%96-_2014-03-01_23-25.jpg","page_title":"Сал-серілік өнер","context_page_description":"Сал-серілік— қазақ халқы мәдениеті мен өнерінің жарқын белгісі, биік шыңы.\\nАқындық, сазгерлік, әншілік, орындаушылық, адамгершілік, мәрттік, жомарттық, пәктік, зор абырой, тағы басқа ең ізгі қасеттердың бәрі осы мұрат тұтқандардың бойынан табылған. Сал мен сері деп аталатын екі тұлғаның бір-бірінен аз да болса ерекшеліктері бар. Сал дегеніміз — аса талантты, бір өзі бір театрдың қызметін атқаратын, ерекше әрі қымбат, әсем киінген, жүріс-тұрысы, іс-әрекеті мүлде бөлек, дүниесін, мал-жанын осы жолда аямайтын мәрт, жомарт жан. Оның киімдері кісі таңданарлықтай басқаша үлгіде тігіледі. Сән-салтанатты басқа, ер-тұрманы да сұлу әрі сымбатты, әшекейлі. Сал — халықтың еркесі, қызығы, думаны.\\nСері де — сал сияқты әнші, күйші, ақын, өнерпаз. Оның киім киісі сұлі да сыпайы. Осындай өнердің сыртында ол — сұлу сүйген, жүйрік баптап, құс салатын, әрі аңшы, саятшы, әрі мерген, әрі палуан, әрі шешен, әрі шебер, қысқасы, халық сөзімен айтқанда, \\"сегіз қырлы, бір сырлы\\" аса биік тұлғалы азамат. Мысалы, атақты Сегіз сері осындай жігіт болған.\\nСал-серілік екінің бірінің қолынан келе бермейді. Оған үлкен өнер, қазына, мол байлық керек."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Tureni,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/RO_CJ_M%C4%83rtine%C8%99ti_%2826%29.jpg","page_title":"Comuna Tureni, Cluj","context_page_description":"Tureni, colocvial Tur este o comună în județul Cluj, Transilvania, România, formată din satele Ceanu Mic, Comșești, Mărtinești, Micești și Tureni.\\nPe Harta Iosefină a Transilvaniei din 1769-1773 satul Tureni apare sub numele de Tüür."},{"page_url":"https://en.wikipedia.org/wiki/Beli_Potok_(Leskovac)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/O%C5%A0_Bora_Stanovi%C4%87%2C_istureno_odeljenje_u_Belom_Potoku%2C_Beli_Potok_03.jpg","page_title":"Beli Potok (Leskovac)","context_page_description":"Beli Potok is a village in the municipality of Leskovac, Serbia. According to the 2002 census, the village has a population of 629 people."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%88%D9%85%D8%A7%D8%B3_%D9%87%D8%A7%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Tomas_Haake_2005.jpg","page_title":"توماس هاكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتوماس هاكى عازف مزيكا من السويد."},{"page_url":"https://it.wikipedia.org/wiki/Corvus_frugilegus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Wawa_pomnik_przyr_316_3.JPG","page_title":"Corvus frugilegus","context_page_description":"Il corvo comune, corvo selvatico, corvo nero o corvo propriamente detto è un uccello passeriforme della famiglia dei Corvidi."},{"page_url":"https://gl.wikipedia.org/wiki/Beira_Baixa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Provincia_Beira_Baixa.png","page_title":"Beira Baixa","context_page_description":"A Beira Baixa é unha antiga provincia portuguesa, orixinalmente creada no século XIX, a partir de parte do territorio da anterior Provincia da Beira. Daquela, a Beira Baixa contiña o que é hoxe denominado como Beira Interior Sul, Cova da Beira e parcialmente o Piñal Interior Sul e Norte, englobando gran parte do Castelo Branco.\\nNa reforma administrativa de 1936 foi novamente creada unha división chamada Província da Beira Baixa Esta nova provincia contiña agora só a parte interior sur da antiga Provincia da Beira, é dicir, aproximadamente o actual Distrito de Castelo Branco. As provincias de 1936 practicamente nunca tiveron ningunha atribución práctica, e desapareceron do vocabulario administrativo coa entrada en vigor da Constitución de 1976.\\nFacía fronteira ao norte coa Beira Alta, ao noroeste coa Beira Litoral, ao suroeste co Ribatexo, ao sul co Alto Alentexo e a leste co Estado español á altura da provincia de Cáceres, na actual comunidade de Estremadura.\\nEstaba constituída por 13 concellos, integrando a totalidade o distrito de Castelo Branco e tamén un concello do distrito de Coimbra e outro do de Santarém. Tiña a súa capital na cidade de Castelo Branco."},{"page_url":"https://es.wikipedia.org/wiki/Camille_d%27Hostun_de_la_Baume","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Newdigate_House%2C_Castle_Gate%2C_plaque_-_geograph.org.uk_-_1590803.jpg","page_title":"Camille d'Hostun de la Baume","context_page_description":"Camille d'Hostun de la Baume, Duque de Tallard fue un noble francés, diplomático y militar, que llegó a ser Mariscal de Francia."},{"page_url":"https://la.wikipedia.org/wiki/Beaurevoir","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Blason_fam_fr_de_Mailly.svg","page_title":"Beaurevoir","context_page_description":"Beaurevoir est commune Francicum 1'498 incolarum praefecturae Axonae in regione boreali Picardia."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%80%AB%E5%B7%B4%E5%93%88%E8%A1%97%E7%8C%B6%E5%A4%AA%E6%9C%83%E5%A0%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Rumbach_zsinagoga_P8050091.jpg","page_title":"倫巴哈街猶太會堂","context_page_description":"倫巴哈街猶太會堂是匈牙利首都布達佩斯的一座猶太會堂，位於布達佩斯市中心。這座猶太會堂修建於1872年，設計者是維也納建築家。猶太會堂的外觀是摩爾復興式建築。"},{"page_url":"https://en.wikipedia.org/wiki/USS_Kearsarge_(BB-5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/USS_Kearsarge_in_great_white_fleet_1908.jpg","page_title":"USS Kearsarge (BB-5)","context_page_description":"USS Kearsarge (BB-5), the lead ship of her class of pre-dreadnought battleships, was a United States Navy ship, named after the sloop-of-war Kearsarge. Her keel was laid down by the Newport News Shipbuilding Company of Virginia, on 30 June 1896. She was launched on 24 March 1898, sponsored by Mrs. Elizabeth Winslow, the wife of Rear Admiral Herbert Winslow, and commissioned on 20 February 1900.\\nBetween 1903 and 1907 Kearsarge served in the North Atlantic Fleet, and from 1907 to 1909 she sailed as part of the Great White Fleet. In 1909 she was decommissioned for modernization, which was finished in 1911. In 1915 she served in the Atlantic, and between 1916 and 1919 she served as a training ship. She was converted into a crane ship in 1920, renamed Crane Ship No. 1 in 1941, and sold for scrap in 1955. She was the only United States Navy battleship to not be named after a state."},{"page_url":"https://it.wikipedia.org/wiki/Asia_League_Ice_Hockey","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Asialeagueicehockeytrophy.JPG","page_title":"Asia League Ice Hockey","context_page_description":"L'Asia League Ice Hockey è il massimo campionato di hockey su ghiaccio, in Giappone, Corea del Sud e Cina. È nata nel 2003 dall'allargamento del campionato giapponese a squadre di altri paesi. Nella stagione 2004 fu presente anche una squadra russa, i Golden Amur di Chabarovsk, ritiratasi per problemi finanziari: bisognerà attendere il 2014 per il ritorno di una compagine russa, i Sakhalin Sea Lions."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9rie_62_(SNCB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/S%C3%A9rie_62_Infrabel_de_la_SNCB_%C3%A0_Walcourt3.JPG","page_title":"Série 62 (SNCB)","context_page_description":"La série 62/63 est une série de locomotives Diesel de la SNCB."},{"page_url":"https://de.wikipedia.org/wiki/Garlick_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Poland_%26_Son%27s%2C_elegant_furs%2C_Oxford_Street%2C_1802.jpg","page_title":"Garlick Hill","context_page_description":"Garlick Hill, zu deutsch „Knoblauchhügel“, bezeichnet eine Straße in der City von London sowie das auf dieser Erhebung befindliche Viertel. Die Gegend war mehr als 100 Jahre lang Mittelpunkt einer der bedeutendsten Welthandelsplätze für Pelzfelle, 23 Jahre mit dem Schwerpunkt des Auktionshauses Beaver House. Das geografische Viertel, im Süden von der Themse begrenzt, reicht bis zur Bow Lane im Norden, Basing Lane im Westen und Turn Base Lane im Osten."},{"page_url":"https://de.wikipedia.org/wiki/Caballito_de_Totora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Peru_Huanchaco_Typical_Fisherman_reed_boats.jpg","page_title":"Caballito de Totora","context_page_description":"Als Caballito de Totora, spanisch für „Schilf-Pferdchen“, werden in Peru traditionell gefertigte kleine Fischerboote bezeichnet. Der Name Caballito als Verkleinerungsform des spanischen Wortes für „Pferd“ geht wahrscheinlich zurück auf die einem Reiter ähnelnde Sitzhaltung des Fischers, bei der sich beide Beine im Wasser befinden, der Namenszusatz de Totora leitet sich von der zum Bau verwendeten Pflanze Totora-Schilf ab.\\nEin Caballito de Totora hat die Form einer Schote und wird aus Schilf geflochten. Hinsichtlich der Größe ist es mit einer Länge von vier bis fünf Metern, einer Breite von 0,6 bis einem Meter sowie einer Nutzlast von etwa 200 bis 250 Kilogramm ausreichend für den Transport einer Person, der Fischereiausrüstung und des Fangs. Der Antrieb eines Caballito de Totora erfolgt durch Paddeln. Verbreitet sind sie insbesondere im Norden Perus, wo der Bau und die Nutzung dieser Boote eine wahrscheinlich jahrtausendealte und bis in die Moche-Kultur zurückreichende Tradition hat."},{"page_url":"https://en.wikipedia.org/wiki/John_Cutliffe","image_url":"https://upload.wikimedia.org/wikipedia/en/0/0c/John_Cutliffe.jpg","page_title":"John Cutliffe","context_page_description":"John Cutliffe is an Irish musician from Buncrana, County Donegal. He was born on February 8, 1962. He started his work in 1977 and ended his musical career in 2007. However, in 2012, he returned and started making people aware of the conflict between Israel and Palestine until early 2014. Then in October of the same year, he worked with many people on a song called \\"Shyma Smiled for Me\\". He currently works for an NGO in Myanmar."},{"page_url":"https://sv.wikipedia.org/wiki/Jassa_herdmani","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Jassa_herdmani.jpg","page_title":"Jassa herdmani","context_page_description":"Jassa herdmani är en kräftdjursart som först beskrevs av Walker 1893. Jassa herdmani ingår i släktet Jassa, och familjen Ischyroceridae. Arten har ej påträffats i Sverige."},{"page_url":"https://de.wikipedia.org/wiki/Wiener_Prater","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Wien_02_Prater_Wasserwiese_f.jpg","page_title":"Wiener Prater","context_page_description":"Der Wiener Prater ist ein weitläufiges, etwa 6 km² umfassendes, großteils öffentliches Areal im 2. Wiener Gemeindebezirk, Leopoldstadt, das noch heute zu großen Teilen aus ursprünglich von der Donau geprägten Aulandschaften besteht. Wenn man außerhalb Wiens vom „Prater“ spricht, ist häufig nur der bekannte Vergnügungspark im Prater, der Wurstelprater, gemeint. Dieser befindet sich an der Nordwestspitze des Areals zwischen Donau und Donaukanal und macht flächenmäßig nur einen sehr kleinen Teil des gesamten Pratergebiets aus."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%A0%D0%B5%D0%B7%D0%B8_%D0%90%D0%B1%D0%B1%D0%B0%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Hormizd_IV_Sassanid_silver_coin.JPG","page_title":"Музей Рези Аббасі","context_page_description":"Музей Рези Аббасі — музей в Тегерані, Іран. Розташований в районі Сейєд Хандан. Музей названо на честь Рези Аббасі, відомого художника періоду Сефевідів."},{"page_url":"https://fr.wikipedia.org/wiki/Porte_de_Namur_(m%C3%A9tro_de_Bruxelles)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Metro_Brussel_Naamsepoort_toegang.jpg","page_title":"Porte de Namur (métro de Bruxelles)","context_page_description":"La station de métro Porte de Namur est une station du métro de Bruxelles qui se trouve en dessous de la place sur la petite ceinture dans le centre de Bruxelles. Mais, cependant, la porte de la ville qui se trouvait là a disparu depuis longtemps. La station souterraine est desservie par les lignes et mais qui a fait partie dans les années 1970 d'une ligne de prémétro. À la fin des années 1980, la ligne de prémétro a été transformée en un vrai métro et a été inaugurée le 2 octobre 1988.\\nLa station comporte quatre médaillons géants d'Octave Landuyt « Het uiteindelijke Verkeer », représentant les stades de la vie : naissance, amour, âge adulte et mort."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D0%B3%D0%B0%D1%80%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Statuette_Mehrgarh.jpg","page_title":"Мергарх","context_page_description":"Мерга́рх - помнік археалогіі на раўніне Качы ў штаце Белуджыстан, Пакістан. Агульная плошча 200 га."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%A5%D5%A4%D6%80%D5%B8_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Pedro_III_el_Grande_en_el_collado_de_las_Panizas.jpg","page_title":"Պեդրո III","context_page_description":"Պեդրո III, Արագոնի և Վալենսիայի թագավորը՝ 1276 թվականի հուլիսի 27-ից, 1285 թվականի սեպտեմբերի 4-ից Սիցիլիայի թագավոր: Սերել է Բարսելոնական արքայատոհմից: Արագոնի, Վալենսիայի, Մալյորկայի թագավոր, Բարսելոնայի կոմս Խայմե Առաջին Նվաճողի և նրա երկրորդ կնոջ՝ Յոլանդա Հունգարացու որդին:"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B5%D8%A7%D8%B1_%D8%B1%D9%88%D8%AF%D8%B3_(1480)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Bombard-MortarOfTheKnightsOfSaintJohnOfJerusalemRhodes1480-1500.jpg","page_title":"حصار رودس (1480)","context_page_description":"في عام 1480 صمدت حامية فرسان الإسبتارية الصغيرة في جزيرة رودس ضد هجوم الإمبراطورية العثمانية."},{"page_url":"https://sv.wikipedia.org/wiki/Pr%C3%A4st","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Taoist_priest_-_Taishan.jpg","page_title":"Präst","context_page_description":"En präst är en person med auktoritet att leda religiösa ceremonier samt fungera som förmedlare mellan människa och gud. Prästen kan frambära folkets böner och offer till gud.\\nPräster finns i flera olika religioner, bland annat i kristendom, hinduism och shintoism. De saknas dock inom bahá'í och islam, även om exempelvis imamer och mullor har delvis motsvarande roll. I modern judendom är en rabbi formellt en rättslärd och lärare, men har i praktiken fått en roll som påminner om en prästs. Prästkasten, kohanim, har en symbolisk funktion vid vissa högtider.\\nInom många lågkyrkliga rörelser används inte begreppet präst, utan den religiösa ledaren kallas predikant. Inom många av dessa rörelser är även gränsen mellan präster och lekmän flytande."},{"page_url":"https://sv.wikipedia.org/wiki/Tjuvberget,_Bolln%C3%A4s_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Actaea_spicata_2.jpg","page_title":"Tjuvberget, Bollnäs kommun","context_page_description":"Tjuvberget är ett naturreservat i Bollnäs kommun, Gävleborgs län.\\nOmrådet är 91 hektar stort och skyddat sedan 2009. Det ligger 5 km söder om Bollnäs, vid sjön Övra Herten. Det är fin utsikt från berget som når 210 meter över havet.\\nReservatet är varierat med klippstup, hällar och gamla tallar. Här finns även granskog samt björk, sälg och asp.\\nInom området finns en del ovanliga växter såsom skogstry, trolldruva, springkorn, getrams och myskmåra.\\nPå Tjuvberget finns även fornlämningar."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E6%96%87%E7%BB%B4%E5%9F%BA%E7%99%BE%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Diffusion_BB_as_Second_Mover_Timeline.png","page_title":"中文维基百科","context_page_description":"中文維基百科是網路百科全書－維基百科協同寫作計劃的中文版本，使用白話文及橫式書寫。屬於維基媒體計劃中維基百科的一個語言分支。\\n中文維基百科成立於2002年10月24日。由非營利組織維基媒體基金會維持運作。截至2020年8月26日13:47，總計有1,141,180條條目；總頁面編輯次數為61,047,668次；註冊用戶為2,987,033人；8,501位活躍的編輯。"},{"page_url":"https://hu.wikipedia.org/wiki/Maleczky_Vilmos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/VilmosMaleczky.jpg","page_title":"Maleczky Vilmos","context_page_description":"Maleczky Vilmos lengyel származású magyar opera-énekes volt. Alapítója a máig működő énekesdinasztiának. Felesége Ellinger Jozefa, apósa Ellinger József, gyermekei Maleczky Bianka és Maleczky Oszkár énekesek. Kései leszármazottja Maleczky László tenorista."},{"page_url":"https://de.wikipedia.org/wiki/Hybrid-Katzenminze","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Nepeta_x_faassenii_A.jpg","page_title":"Hybrid-Katzenminze","context_page_description":"Die Hybrid-Katzenminze ist eine Pflanzenhybride innerhalb der Gattung der Katzenminzen in der Familie der Lippenblütler."},{"page_url":"https://vi.wikipedia.org/wiki/Wat_Suthat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Bkksaochingcha0609a.jpg","page_title":"Wat Suthat","context_page_description":"Wat Suthat, tên đầy đủ: Wat Suthat Thepwararam là một trong 6 ngôi chùa nổi tiếng nhất Thái Lan nằm trên đại lộ Bamrung Muang ở thủ đô Bangkok. Cùng với Giant Swing"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%A9%E3%83%BC%E3%82%B9%E3%83%8A%E3%83%A4%E3%83%BB%E3%83%9D%E3%83%AA%E3%83%A3%E3%83%BC%E3%83%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/RosaSki3.jpg","page_title":"クラースナヤ・ポリャーナ","context_page_description":"クラースナヤ・ポリャーナ はロシア連邦クラスノダール地方のソチに存在する町の一つである。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D1%87%D0%B5%D1%80%D0%B8%D0%BD,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Chicherin_1_Nikolay_Alexandrovich.jpg","page_title":"Чичерин, Николай Александрович","context_page_description":"Николай Александрович Чичерин, российский командир эпохи наполеоновских войн, генерал-майор Русской императорской армии."},{"page_url":"https://es.wikipedia.org/wiki/Sierra_del_Fraile","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Garciaescudo.jpg","page_title":"Sierra del Fraile","context_page_description":"La Sierra del Fraile; también llamada “Cerro del Fraile” y “Sierra San Miguel”, es una montaña y un área natural protegida estatal localizada en los municipios de García, Abasolo, Hidalgo, General Escobedo, El Carmen y Mina; en el estado de Nuevo León, México. La montaña forma parte de la Sierra Madre Oriental, su altitud es 2,392 Metros sobre el nivel del mar, con una prominencia de 1,592 metros, es también un pico ultraprominente, su aislamiento topográfico es alrededor de 23.5 km ​. Debe su nombre a qué; según los lugareños, la figura de la montaña vista viniendo desde Santa Catarina se asemeja a la figura de un fraile en postura de oración."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%85%AC%E5%85%B1%E5%B1%8B%E9%82%A8%E4%B8%80%E8%A6%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Lok_Wah_South_Estate_201405.jpg","page_title":"香港公共屋邨一覽","context_page_description":"呢個係香港資助出租公共屋邨嘅一覽表。去到2020年4月為止，香港總共有251個公共屋邨同超過85萬個單位。呢個表以地區劃分，再以首次入伙年份排（「一邨」、「二邨」等等有細分嘅屋邨會當係唔同屋邨同埋由原址分拆而成嘅，個表入面會放埋一齊，方便比較）。\\n公共屋邨，就係指由政府、志願團體或者私營企業興建，再以廉價租畀低收入居民嘅住宅。而家香港提供公共屋邨嘅機構有三間，分別係香港房屋委員會（房委會）、香港房屋協會（房協）同埋香港平民屋宇有限公司（平民屋宇）。另外重有兩間情況唔清楚嘅建屋團體，佢哋而家嘅情況就連房委會同房協都唔清楚：\\n香港模範屋宇會：原本起同管理鰂魚涌模範邨，之後喺1979年11月由房屋委員會接管。\\n香港經濟屋宇會：原本起同管理大角咀葛量洪夫人新村，之後因為起西九龍走廊，1977年1月1號開始部分單位要由政府接管同拆卸。直到1980年代淨低嘅單位都因應房協「市區改善計劃」而拆咗，呢啲單位而家嘅位置係喺房協頌賢花園，喺1988年落成。"},{"page_url":"https://eu.wikipedia.org/wiki/Messier_100","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Messier_100_and_Supernova_SN_2006X.jpg","page_title":"Messier 100","context_page_description":"Messier 100 galaxia espiral bat da, Coma Berenices konstelazioan. Pierre Méchainek aurkitu zuen 1781eko martxoaren 15an."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Sant%27Eulalia_(Palermo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Cr%C3%A8sia_di_Sant%27Eulalia_d%C3%BB_Catalani.jpg","page_title":"Chiesa di Sant'Eulalia (Palermo)","context_page_description":"La chiesa di Sant'Eulalia dei Catalani è un edificio di culto situato nel centro storico di Palermo. È ubicata a ridosso del mercato della Vucciria lungo via Argenteria antistante la Fontana del Garraffo."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B2%D8%B1%D8%A7%D8%B9%D8%A9_%D8%A7%D9%84%D9%82%D9%84%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/The_guest_from_the_future%2C_%2B44_years.JPG","page_title":"زراعة القلب","context_page_description":"عملية زرع القلب ‏ أو ‏، هي إجراء عملية زرع جراحي للمرضى الذين يُعانون من فشل القلب أو من مرض الشريان التاجي الحاد. اعتباراً من عام 2008 أصبح الإجراء الأكثر شيوعاً هو أخذ القلب العامل من المتوفين حديثاً وزرعه في المريض. فترات البقاء على قيد الحياة بعد العملية تأخذ في المتوسط 15 عاماً. لا يعتبر زرع القلب علاجاً لأمراض القلب، ولكنه علاج منقذ للحياة يهدف إلى تحسين نوعية الحياة للمستفيدين."},{"page_url":"https://da.wikipedia.org/wiki/Bordtennis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Table_Tennis_Table.svg","page_title":"Bordtennis","context_page_description":"Bordtennis er et boldspil for to eller fire spillere, hvor spillerne ved hjælp af bat på skift returnerer en let bold over et net, som er spændt ud på tværs af bordet. Formålet er at tvinge modstanderen til at begå fejl.\\nSporten har været Olympisk idrætsgren siden 1988. Der er flere end 30 mio. registrerede spillere i verden, men spillet er derudover også populært som idræt og underholdning i skoler, fritidshjem og lignende verden over.\\nMichael Maze er Danmarks store bordtennisstjerne og har bl.a. vundet OL bronze, VM bronze og EM guld."},{"page_url":"https://en.wikipedia.org/wiki/Ty_McCormick","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/McCormick_Ty_UNCAawards2016.jpg","page_title":"Ty McCormick","context_page_description":"Ty McCormick is an American foreign correspondent and magazine editor. He is deputy web editor of Foreign Affairs, the magazine published by the Council on Foreign Relations. From 2015 to 2018, he was the Africa editor at Foreign Policy magazine. His writing has also appeared in the New York Times, Washington Post, Los Angeles Times, Newsweek, New Republic, and National Geographic."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Friedrich_Christian_Hessel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/JFCHessel.JPG","page_title":"Johann Friedrich Christian Hessel","context_page_description":"Friedrich Hessel war ein deutscher Kristallograph und Hochschullehrer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D1%8C_%D0%A8%D0%B0%D0%B9%D1%82%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/AKUR_SHP1_1.jpg","page_title":"Камень Шайтан","context_page_description":"Камень Шайтан — высокие скалы на правом берегу реки Реж в 4,5 км на юго-восток от села Октябрьского и в 4 км выше по течению нежилой деревни Галанино. Известны наскальными рисунками. Объект имеет статус геоморфологического и ботанического памятника природы. Отвесный береговой утёс высотой до 25 м, сложен из гранита. На вершине скал произрастают сосны."},{"page_url":"https://en.wikipedia.org/wiki/La_Jara_Depot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/La_Jara_Depot.JPG","page_title":"La Jara Depot","context_page_description":"The La Jara Depot, at Broadway and Main Sts. in La Jara, Colorado, was built in 1911. It was listed on the National Register of Historic Places in 1975.\\nIt was a railroad depot of the Denver & Rio Grande Western Railroad.\\nIt is unusual architecturally as a 1911 public building for its early reflection of Prairie School architecture and the influence of Frank Lloyd Wright.\\nIt has also been known as the La Jara Town Hall."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Lackawanna_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Scranton_Lace_Company_Scranton_PA.JPG","page_title":"National Register of Historic Places listings in Lackawanna County, Pennsylvania","context_page_description":"This is a list of the National Register of Historic Places listings in Lackawanna County, Pennsylvania.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Lackawanna County, Pennsylvania, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 35 properties and districts listed on the National Register in the county. One site is further designated as a National Historic Landmark and another is designated as a National Historic Site.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D8%AF%D8%B3%D8%AA%D8%A7%D9%86_%DA%A9%D9%84_%D8%A7%DB%8C%D8%A7%D9%84%D8%A7%D8%AA_%D9%85%D8%AA%D8%AD%D8%AF%D9%87_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Isaac_Toucey_-_Brady-Handy.jpg","page_title":"دادستان کل ایالات متحده آمریکا","context_page_description":"دادستان کل ایالات متحده، رئیس وزارت دادگستری ایالات متحده است و وظیفه او امور قضایی بوده و مأمور ارشد اجرای قانون دولت ایالات متحده است. دادستان کل وکیل ارشد دولت ایالات متحده قلمداد می‌شود. دادستان کل به عنوان عضو کابینهٔ رئیس‌جمهور فعالیت می‌کند و تنها رئیس یک وزارتخانه دولتیست که عنوان وزیر بدو اطلاق نمی‌شود.\\nدادستان کل را رئیس‌جمهور ایالات متحده نامزد می‌کند و او این سمت را پس از تأیید سنای ایالات متحده بر عهده می‌گیرد. او به خواست رئیس‌جمهور فعالیت کرده و رئیس‌جمهور می‌تواند در هر زمان وی را بر کنار کند. دادستان کل می‌تواند مورد استیضاح مجلس نمایندگان و محاکمه در سنا به دلایل «خیانت، ارتشا و دیگر جرایم و سوء رفتارهای شدید» قرار بگیرد."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_stortingsrepresentanter_for_S%C3%B8r-Tr%C3%B8ndelag","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Henrik_Horneman_%281769_-_1838%29_%282742237536%29.jpg","page_title":"Liste over stortingsrepresentanter for Sør-Trøndelag","context_page_description":"Liste over stortingsrepresentanter for Sør-Trøndelag viser alle faste stortingsrepresentanter valgt fra Sør-Trøndelag fylke siden 1814. Listen tar også med og fast møtende vararepresentanter for statsråder, avdøde representanter eller representanter som av annen grunn ble fritatt fra vervet. Valgkretsen omfattet fra 1814 til 1953 bare landdistriktene i Sør-Trøndelag, men fra og med stortingsvalget i 1953 ble Trondheim en del av Sør-Trøndelag stortingsvalgkrets."},{"page_url":"https://pt.wikipedia.org/wiki/Golpe_de_Estado_no_Brasil_em_1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Jo%C3%A3o_Goulart_nos_Estados_Unidos_em_1962.jpg","page_title":"Golpe de Estado no Brasil em 1964","context_page_description":"Golpe de Estado no Brasil em 1964 designa o conjunto de eventos ocorridos em 31 de março de 1964 no Brasil, que culminaram, no dia 1.º de abril de 1964, com um golpe militar que encerrou o governo do presidente democraticamente eleito João Goulart, também conhecido como Jango.\\nOs militares brasileiros favoráveis ao golpe e, em geral, os defensores do regime instaurado em 1964 costumam designá-lo como \\"Revolução de 1964\\", \\"Contragolpe de 1964\\" ou \\"Contrarrevolução de 1964\\".\\nTodos os cinco presidentes militares que se sucederam desde então declararam-se herdeiros e continuadores da Revolução de 1964.\\nJá a historiografia brasileira recente defende a ideia de que o golpe, assim como a ditadura que se seguiu, não deve ser considerado como exclusivamente militar, sendo, em realidade, civil-militar. Segundo vários historiadores, houve apoio ao golpe por parte de segmentos importantes da sociedade: os grandes proprietários rurais, a burguesia industrial paulista, uma grande parte das classes médias urbanas e o setor conservador e anticomunista da Igreja Católica que promoveu a Marcha da Família com Deus pela Liberdade, realizada poucos dias antes do golpe, em 19 de março de 1964."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%86%D8%AA_%DA%A9%D8%A7%D8%A6%D9%88%D9%86%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/2020_Kenneth_Kaunda.jpg","page_title":"کنت کائوندا","context_page_description":"کنت کائوندا یک سیاست‌مدار اهل زامبیا است که از ۲۴ اکتبر ۱۹۶۴ تا ۲ نوامبر ۱۹۹۱ رئیس‌جمهور زامبیا بود. وی همچنین از ۸ سپتامبر ۱۹۷۰ تا ۵ سپتامبر ۱۹۷۳ سومین دبیرکل جنبش عدم تعهد بود."},{"page_url":"https://de.wikipedia.org/wiki/Erolzheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Ero4.jpg","page_title":"Erolzheim","context_page_description":"Erolzheim ist eine Gemeinde im östlichen Landkreis Biberach in Oberschwaben. Die Gemeinde liegt am Rande des Illertals am Autobahnzubringer zur A 7. Erolzheim ist Sitz des Gemeindeverwaltungsverbandes Illertal und bildet mit dem benachbarten Kirchdorf an der Iller ein Unterzentrum."},{"page_url":"https://fr.wikipedia.org/wiki/James_Kimbrough_Jones","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/JamesKiJones.jpg","page_title":"James Kimbrough Jones","context_page_description":"James Kimbrough Jones est un homme politique américain."},{"page_url":"https://en.wikipedia.org/wiki/Hicham_Benkaid","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/RC_Lens_-_US_Orl%C3%A9ans_%2817-05-2019%29_19.jpg","page_title":"Hicham Benkaid","context_page_description":"Hicham Benkaid is a French professional footballer who plays for Ligue 2 club US Orléans as a forward."},{"page_url":"https://en.wikipedia.org/wiki/Elementary_cellular_automaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Rule51rand.png","page_title":"Elementary cellular automaton","context_page_description":"In mathematics and computability theory, an elementary cellular automaton is a one-dimensional cellular automaton where there are two possible states and the rule to determine the state of a cell in the next generation depends only on the current state of the cell and its two immediate neighbors. There is an elementary cellular automaton which is capable of universal computation, and as such it is one of the simplest possible models of computation."},{"page_url":"https://pt.wikipedia.org/wiki/Evolu%C3%A7%C3%A3o_territorial_do_Imp%C3%A9rio_Otomano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Territorial_changes_of_the_Ottoman_Empire_1829.jpg","page_title":"Evolução territorial do Império Otomano","context_page_description":"Este artigo analisa a evolução territorial do Império Otomano desde sua ascensão em 1300 até à sua queda em 1923."},{"page_url":"https://es.wikipedia.org/wiki/Hugues_Cu%C3%A9nod","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Cuenod.jpg","page_title":"Hugues Cuénod","context_page_description":"Hugues Cuénod fue un tenor suizo de notable y larga trayectoria. Se especializó en oratorios, canción francesa, lieder de Schubert, Schumann, papeles de carácter, opereta y música antigua, sacra y contemporánea. Ostenta el récord de ser el cantante más longevo en debutar en el Metropolitan Opera de Nueva York, a los 84 años en 1987 como el emperador Altoum en Turandot de Puccini.​"},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Maga_(m%C3%A9tro_de_Toulouse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Tram_Jean_Maga.jpg","page_title":"Jean-Maga (métro de Toulouse)","context_page_description":"Jean Maga est une future station du métro de Toulouse, située sur la commune de Blagnac. Elle serait située sur la ligne Toulouse Aerospace Express, future troisième ligne du métro toulousain. Il s'agirait de la seule station de la ligne à assurer une correspondance avec le tramway de Toulouse, et notamment la future ligne Aéroport Express, plaçant l'aéroport de Toulouse-Blagnac à 6 minutes de la station. Sa mise en service est prévue pour 2025, après des travaux devant débuter en 2019."},{"page_url":"https://ca.wikipedia.org/wiki/Torrelles_de_la_Salanca","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Localitzaci%C3%B3_de_Torrelles_de_la_Salanca_respecte_del_Rossell%C3%B3.svg","page_title":"Torrelles de la Salanca","context_page_description":"Torrelles de la Salanca, també anomenat Torrelles i Torrelles de les Salenques, és el poble, cap de la comuna del mateix nom, de 3.487 habitants el 2013, de la comarca del Rosselló, a la Catalunya del Nord. És a la vall de la Tet, a l'est de Perpinyà, al nord de Canet de Rosselló i de Santa Maria la Mar, a la zona nord-oriental de la comarca, ran de la Mar Mediterrània i al nord del Tet. És a la subcomarca de la Salanca, antigament zona d'aiguamolls, d'on ve el nom de Salanca, a la plana existent al nord del riu esmentat.\\nActualment, juntament amb el Barcarès, Clairà, Pià, Sant Hipòlit de la Salanca i Sant Llorenç de la Salanca forma part del cantó número 4, de La Costa Salanquesa, que té la capitalitat cantonal a Sant Llorenç de la Salanca. Aquest cantó no agrupa tots els municipis de la Salanca.\\nLa dita sobre els torrellans és Torrelles la canya al cul, A Sant Hipòlit venen l'oli, a Sant Llorenç venen la sal, a Torrelles el vinagre i a Vilallonga l'enciam o A Torrelles i a Bompàs hi ha més carlins que republicans."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%8F_%D0%A2%D0%B0%D0%BD%D0%B6%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Cattan_1.jpg","page_title":"Архиепархия Танжера","context_page_description":"Архиепархия Танжера — архиепархия Римско-Католической церкви с центром в городе Танжер, Марокко. Архиепархия Танжера подчиняется непосредственно Святому Престолу. Кафедральным собором архиепархии Танжера является церковь Пресвятой Девы Марии Лурдской."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%B0%E0%AE%BF%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BE%E0%AE%AA%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BF_%E0%AE%AE%E0%AE%B2%E0%AF%88,_%E0%AE%AE%E0%AE%A4%E0%AF%81%E0%AE%B0%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%E0%AE%AE%E0%AE%95%E0%AE%BE%E0%AE%B5%E0%AF%80%E0%AE%B0%E0%AE%B0%E0%AF%8D.JPG","page_title":"அரிட்டாபட்டி மலை, மதுரை","context_page_description":"அரிட்டாபட்டி மலை இந்தியாவின் தமிழ்நாடு மாநிலத்தில் மதுரை மாவட்டத்தில் அமைந்துள்ளதும் பெரும்பகுதி கல்லால் ஆனதுமான ஒரு மலைக் குன்று ஆகும். மதுரைக்கு வடக்கே 17 கிலோ மீட்டர் தொலைவில் அமைந்துள்ள இந்த மலையை திருப்பிணையன் மலை என்று சமணக் கல்வெட்டுக்கள் குறிக்கின்றன. சமணர் காலக் குகைகள் மற்றும் பாண்டியர் காலக் குடைவரை கோவில்கள் இங்கு அமைந்துள்ளன."},{"page_url":"https://pl.wikipedia.org/wiki/Vytautas_Petrulis","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/PetrulisVyautas.jpg","page_title":"Vytautas Petrulis","context_page_description":"Vytautas Petrulis – litewski polityk chadecki, wieloletni minister finansów, marszałek sejmu i szef rządu Litwy kowieńskiej, określany jako ojciec litewskiej waluty narodowej - lita.\\nPo ukończeniu studiów ekonomicznych pracował jako księgowy. W 1920 roku został dyrektorem Banku Handlowo-Przemysłowego w Kłajpedzie.\\nW 1918 roku został członkiem Taryby, reprezentując w niej chrześcijańskich demokratów. Następnie przez miesiąc sprawował urząd ministra finansów z nadania premiera Dovydaitisa. Resortem finansów, przemysłu i handlu kierował również w gabinecie Ernestasa Galvanauskasa i Tumėnasa od sierpnia 1922 do czerwca 1925 roku.\\nPo tym jak w czerwcu 1922 roku został wprowadzony lit, Petrulis był często określany jako jeden z ojców litewskiej waluty narodowej, mimo że formalne urzędowanie w roli ministra rozpoczął dwa miesiące później.\\nPosłował na Sejm II i III kadencji, reprezentując zbliżoną do chadecji partię chłopską.\\n4 lutego 1925 roku rozpoczął urzędowanie jako premier, zastępując w tej roli Antanasa Tumėnasa. Od września 1925 do marca 1926 stał na czele litewskiego sejmu na miejsce Leonasa Bistrasa, który został szefem rządu."},{"page_url":"https://en.wikipedia.org/wiki/Ghazi_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ghazi_High_School.jpg","page_title":"Ghazi High School","context_page_description":"Ghazi High School is a school in Kabul, which has educated many of the former and current elite in Afghanistan, including Zalmay Khalilzad. It was founded by King Amanullah Khan in 1928.\\nIt is situated in the North of the city in a district known as Carteh Chahar. It suffered severe damage during the civil war of the 1990s between the different mujahideen factions who had ousted the government of Mohammad Najibullah in 1992."},{"page_url":"https://id.wikipedia.org/wiki/A_Symphony_of_Lights","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Victoria_Harbour_around_Chinese_New_Year_Night_with_Fireworks_and_Laser_Show.jpg","page_title":"A Symphony of Lights","context_page_description":"A Symphony of Lights adalah pertunjukan cahaya dan suara yang digelar setiap malam di Hong Kong, dan merupakan pertunjukan cahaya dan suara permanen terbesar di dunia menurut Guinness World Records. Pada tahun 2017, ada 42 gedung yang berpartisipasi dalam pertunjukan ini."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%A8%D9%88%DA%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Porte_de_mons_maubeuge.JPG","page_title":"موبوژ","context_page_description":"شهر موبوژ در شهرستان نور در ناحیه شمال کاله با جمعیت ۳۲٬۶۹۹ نفر در کشور فرانسه واقع شده است"},{"page_url":"https://pt.wikipedia.org/wiki/Montreal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bas%C3%ADlica_de_Notre-Dame%2C_Montreal%2C_Canad%C3%A1%2C_2017-08-11%2C_DD_26-28_HDR.jpg","page_title":"Montreal","context_page_description":"Montreal é a maior cidade da província canadense de Quebec e o segundo município mais populoso do Canadá. Originalmente chamada de Ville-Marie, ou \\"Cidade de Maria\\", a cidade foi renomeada para \\"Montréal\\", uma versão arcaica, escrita de forma simplificada, em homenagem ao Monte Royal, um morro localizado em um parque no centro da cidade. Montreal está localizada em sua maior parte na Ilha de Montreal, que tomou o seu nome da mesma fonte que a cidade, e em algumas ilhas periféricas muito menores. Montreal tem um clima continental distinto de quatro estações com verões quentes e invernos nevados e frios.\\nEm 2016, a cidade tinha uma população de 1.704.694 habitantes, sua área metropolitana tinha uma população de 4 098 927 e a aglomeração urbana 1 942 044, incluindo todos os municípios da Ilha de Montreal. O francês é a língua oficial da cidade, é a língua mais falada em casa por cerca de 49,8% da população da cidade, seguida do inglês em 22,8% e 18,3% por outras línguas. Na região metropolitana de Montreal, 65,8% da população fala francês em casa, em comparação com 15,3% que falam inglês."},{"page_url":"https://fr.wikipedia.org/wiki/Extinction_(rayonnement)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Methode_SN_milieu_homogene_omega%3D1_correction.png","page_title":"Extinction (rayonnement)","context_page_description":"En physique l'extinction désigne la modification du rayonnement par diffusion et, par extension, la modification par absorption et diffusion. Ces deux phénomènes, absorption et diffusion, sont très différents à la fois par leur origine physique, mais également par leurs conséquences sur le transfert de rayonnement. On peut en effet restreindre le problème de l'absorption seule à l'étude de la propagation dans une seule direction, conduisant à la loi de Beer-Lambert. Par nature la diffusion introduit un couplage de toutes les directions de propagation. Il s'agit donc d'un problème dont la résolution est plus complexe et qui n'admet pas de solution analytique sauf cas très particulier."},{"page_url":"https://it.wikipedia.org/wiki/Notre-Dame-de-l%27Osier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Notre-Dame-de-l%27Osier_-_Basilique.jpg","page_title":"Notre-Dame-de-l'Osier","context_page_description":"Notre-Dame-de-l'Osier è un comune francese di 519 abitanti situato nel dipartimento dell'Isère della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://sk.wikipedia.org/wiki/Stefanos_(soch%C3%A1r)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Stephanos_Athlete_garden_MBA_Lyon.jpg","page_title":"Stefanos (sochár)","context_page_description":"Stefanos bol grécky sochár v 1. storočí pred Kr.\\nStefanos, grécky sochár z druhej polovice prvého storočia pred Kr., pôsobil v Ríme. Z tvorby tohto umelca sa zachovala jeho menom signovaná socha mladého atléta z vily Albani pri Ríme. Nápis na podstavci tiež uvádza, že bol žiakom sochárskeho majstra Pasitela:\\n- text v starogréčtine\\nSocha Stefanovho atléta je jedným z najznámejších príkladov typu sochy požadovanej vrchnou rímskou triedou, ktorá si nimi zdobila svoje súkromné ​​vily. Grécki sochári v Aténach aj samotnom Ríme mohli poskytnúť viac či menej presné repliky známych sôch z minulosti, ako aj nové diela, ktoré imitovali alebo kombinovali rôzne staršie grécke štýly. Aj Stefanova socha pôsobí výrazne eklekticky. Jej veľmi široké ramená a postoj pripomínajú grécke mužské sochy z druhej štvrtiny 5. storočia pred Kr., zatiaľčo menšia hlava a dlhé nohy, diela vytvorené v polovici 4. storočia pred Kr. Podobným sochárskym dielom je aj súsošie Oresta a Elektry zhotovené jeho žiakom Menelaom.\\nZo života sochára Stefana nie je nič známe."},{"page_url":"https://ceb.wikipedia.org/wiki/Antigua_Guatemala","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Antigua_Santa_Catalina_2008_06.JPG","page_title":"Antigua Guatemala","context_page_description":"Kapital sa departamento ang Antigua Guatemala sa Watemala. Nahimutang ni sa departamento sa Departamento de Sacatepéquez, sa habagatang bahin sa nasod, 25 km sa kasadpan sa Guatemala City ang ulohan sa nasod. 1,539 metros ibabaw sa dagat kahaboga ang nahimutangan sa Antigua Guatemala, ug adunay 39,368 ka molupyo.\\nAng yuta palibot sa Antigua Guatemala kay kasagaran kabungtoran, apan sa habagatan nga kini mao ang kabukiran. Antigua Guatemala nahimutang sa usa ka walog. Kinahabogang dapit sa palibot ang Volcán de Agua, 3,760 ka metros ni kahaboga ibabaw sa dagat, 10.7 km sa habagatan sa Antigua Guatemala. Dunay mga 1,956 ka tawo kada kilometro kwadrado sa palibot sa Antigua Guatemala may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Mixco, 15.9 km sa amihanan-sidlakan sa Antigua Guatemala. Hapit nalukop sa durowan ug kabugangan ang palibot sa Antigua Guatemala. Sa rehiyon palibot sa Antigua Guatemala, mga bolkan talagsaon komon.\\nAng klima tropikal sa ibabwan. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Abril, sa 22 °C, ug ang kinabugnawan Agosto, sa 14 °C. Ang kasarangang pag-ulan 2,167 milimetro matag tuig."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B6%B4%E5%B2%A1%E5%B8%82%E6%B6%88%E9%98%B2%E6%9C%AC%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Tsuruoka_City_Fire_department_1.jpg","page_title":"鶴岡市消防本部","context_page_description":"鶴岡市消防本部は、山形県鶴岡市の消防部局である。"},{"page_url":"https://pt.wikipedia.org/wiki/Keala_Settle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/The_Greatest_Showman_Japan_Premiere_Red_Carpet-_Keala_Settle_%2839535224644%29_%28Cropped%29.jpg","page_title":"Keala Settle","context_page_description":"Keala Settle é uma atriz e cantora estadunidense. Conhecida pelo trabalho no musical Hands on a Hardbody da Broadway, foi indicada ao Outer Critics Circle Award, Drama Desk Award e Tony Award. Além deste, atuou em Priscilla, Queen of the Desert e Les Misérables, além de já ter conquistado o Globo de Ouro de melhor canção original por \\"This Is Me\\", interpretada para o filme The Greatest Showman."},{"page_url":"https://nl.wikipedia.org/wiki/Katholieke_Kerk_in_Suriname","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Saints_Peter_and_Paul_Cathedral_Paramaribo.jpg","page_title":"Katholieke Kerk in Suriname","context_page_description":"De Katholieke Kerk in Suriname is een onderdeel van de wereldwijde Katholieke Kerk, onder het geestelijk leiderschap van de paus en de curie in Rome.\\nIn 2012 waren er in Suriname ongeveer 117.000 katholieken. Het land bestaat uit een enkel bisdom, het bisdom Paramaribo, dat deel uitmaakt van de kerkprovincie Port of Spain op Trinidad en Tobago. Op 11 november 2015 werd Mgr. Karel Choennie benoemd tot bisschop van Paramaribo. Men is lid van de bisschoppenconferentie van de Antillen; president van de bisschoppenconferentie is Patrick Christopher Pinder, aartsbisschop van Nassau. Verder is men lid van de Consejo Episcopal Latinoamericano.\\nApostolisch nuntius voor Suriname is aartsbisschop Fortunatus Nwachukwu, die tevens apostolisch nuntius is voor Antigua en Barbuda, de Bahama's, Belize, Dominica, Grenada, Guyana, Jamaica, Saint Kitts en Nevis, Saint Lucia, Saint Vincent en de Grenadines en Trinidad en Tobago, en apostolisch gedelegeerde voor de Amerikaanse Maagdeneilanden, Anguilla, Aruba, de Britse Maagdeneilanden, Caribisch Nederland, Curaçao, Guadeloupe, de Kaaimaneilanden, Martinique, Montserrat, Saint-Barthélemy, Sint-Maarten, Sint Maarten en de Turks- en Caicoseilanden."},{"page_url":"https://de.wikipedia.org/wiki/Schwelm_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Lehen_zu_Schwelm.png","page_title":"Schwelm (Adelsgeschlecht)","context_page_description":"Schwelm ist der Name eines ehemaligen westfälischen Rittergeschlechts aus der Grafschaft Mark, das bis 1592 in gleichnamiger Stadt angesessen war. Sie teilten sich 1458 in die Schwelmer und die Kölner Linie."},{"page_url":"https://fr.wikipedia.org/wiki/Pamiat_Merkouria_(croiseur,_1902)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Pamyat%27_Merkuriya_01.jpg","page_title":"Pamiat Merkouria (croiseur, 1902)","context_page_description":"Le Souvenir de Mercure ou Mémoire de Mercure est un croiseur protégé de la classe Bogatyr de la Marine impériale russe, construit en 1901-1902.\\nSes sister-ships sont l’Otchakov et l’Oleg."},{"page_url":"https://nl.wikipedia.org/wiki/Valira_del_Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Pont_de_Sant_Antoni_1.JPG","page_title":"Valira del Nord","context_page_description":"De Valira del Nord is een rivier in Andorra die in Escaldes-Engordany samenvloeit met de Valira d'Orient om zo de Valira te vormen, een zijrivier van de Segre. De Valira del Nord begint bij de bergmeertjes Estanys de Tristaina ten noordwesten van El Serrat als Riu de Tristaina. Vanaf de samenvloeiing met een ander, van het noordoosten komend bergriviertje in El Serrat spreekt men van de Valira del Nord.\\nTussen Ordino en Escaldes-Engordany stroomt de Valira del Nord door de parochie La Massana. Van de bron tot de monding liggen aan de Valira del Nord de plaatsen El Serrat, Les Salines, Llorts, Arans, La Cortinada, Ansalonga, Sornàs, Ordino-centrum, L'Aldosa de la Massana, La Massana-stad, Anyós en Engordany. In La Massana mondt de Riu d'Arinsal uit in de Valira del Nord.\\nIn Escaldes-Engordany bevindt de samenvloeiing zich vlak naast het iconische waterpretcentrum Caldea."},{"page_url":"https://ms.wikipedia.org/wiki/Sejarah_Bumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/DNA_replication_split.svg","page_title":"Sejarah Bumi","context_page_description":"Sejarah Bumi merangkumi pembangunan planet Bumi dari pembentukannya hingga sekarang. Hampir semua cabang sains semula jadi telah menyumbang kepada pemahaman tentang peristiwa utama masa lalu Bumi. Usia Bumi adalah kira-kira satu pertiga daripada usia alam semesta. Perubahan besar geologi telah terjadi pada masa itu, disertai dengan kemunculan kehidupan dan evolusi berikutnya.\\nBumi terbentuk sekitar 4.54 bilion tahun yang lalu oleh tokokan dari nebula suria. Pengungkapan gunung berapi mungkin dicipta atmosfera bumi purba dan kemudian lautan, tetapi atmosfera awal yang terkandung hampir tiada oksigen dan sebagainya tidak akan menyokong bentuk hidupan yang diketahui. Kebanyakan Bumi dicairkan kerana perlanggaran kerap dengan badan-badan lain yang membawa kepada volkisme yang melampau. Satu pertembungan impak gergasi dengan tubuh bersaiz planet bernama Theia manakala Bumi berada di peringkat terawal, yang juga dikenali sebagai Bumi Awal, dianggap bertanggungjawab untuk membentuk Bulan. Dari masa ke masa, Bumi menyejuk, menyebabkan pembentukan kerak padat, dan membenarkan air cair wujud di permukaan."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ch%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Pusteblume.JPG","page_title":"Chí","context_page_description":"Chí / chéng-chí sī si̍t-bu̍t siⁿ-thoàⁿ ê chi̍t-chióng hong-hoat. Sêng-se̍k ê si̍t-bu̍t tī bó-hoe siū-hún liáu-āu oē kiat-chí, ū-ê koh kiat chiok-chē chí, lâi sán-seng sin-ê ē-chi̍t-tāi. Si̍t-bu̍t chit chióng ēng chéng-chí lâi siⁿ-thoàⁿ ê hong-sek sī-ū i-ê iu-tiám, oē-tàng khò tāi-liōng ê chéng-chí lâi khak-pó i-ê chéng-lūi ū khah-choē ê ki-hoē lâi éng-oán seng-chûn lo̍h-khì, m̄-koh kah pa̍t-chióng siⁿ-thoàⁿ hong-sek pí--khí-lâi sī khah phái lâi chiáng-ap hiat-thóng sûn-chiàⁿ kah āu-chi̍t-tāi ê phín-chit.\\nChéng-chí ê hêng-thé:\\nChiū si̍t-bu̍t chéng-lūi lâi kóng ū:\\nChí ê goā-pō͘ ū-pau-leh.\\nChí ê goā-pō͘ bô-pau-leh nn̄g-chióng.\\nChiū si̍t-bu̍t iā-chéng hong-piān-sèng lâi kóng ū:\\nIū khin iū boē-su-á ú-mô͘ hō͘ hong chhe lâi sì-kè-pe ê chí.\\nGoā-kháu pau koé-chí-he̍k lâi hō͘ khîm-siù kā-khì sì-koè chia̍h sì-koè-pàng ê chí.\\nOē kau oē liâm tī khîm-siù seng-khu-téng toè-teh sì-kè-cháu ê chí.\\nKoé-chí-khak oē ka-kī piak-khui hō͘ chéng-chí sì-kè-phùn ê chí.\\nOē phû boē chìm noā-khì oē-tàng toè chúi sì-kè lâu ê chí."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B1%D1%80%D0%B8%D0%B3%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/WaltonWalker%26TahsinYazici.jpg","page_title":"Турецкая бригада","context_page_description":"Турецкая бригада — пехотная бригада турецкой армии, участвовавшая в Корейской войне в составе сил ООН. Была придана 25-й дивизии Армии США и участвовала в ряде боевых операций. Удостоилась благодарностей от правительств США и Южной Кореи."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E5%8E%9F%E5%B7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Wiki_yambara_gawa_tyuryu.jpg","page_title":"山原川","context_page_description":"山原川は、静岡県静岡市清水区を流れる二級河川である。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_%C3%A1san","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Garbhasana.jpg","page_title":"Seznam ásan","context_page_description":"Ásana je obecný pojem pro držení těla při cvičení jógy, odvozený od sanskrtského slova pro \\"sedadlo/sezení\\". Zatímco mnohé z nejstarších ásan jsou posedy a postoje pro meditace, většina ásan se týká postavení pro rovnováhu, postavení paží, břicha pro lehy. Jednotnost v pojmenování pozic je omezená, protože existuje mnoho konkurenčních škol jógy. Různí autoři nebo školy jógy mohou mít různé názvy pro stejné ásany."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AA%E0%B2%BF%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B3%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Steinway_Vienna_011.JPG","page_title":"ಪಿಯಾನೋ","context_page_description":"ಪಿಯಾನೋ ಕೀಲಿಮಣೆಗಳನ್ನು ಹೊಂದಿದ ದೊಡ್ಡ ಸಂಗೀತವಾದ್ಯ. ಪಿಯಾನೋ ಎಂದರೆ, ಪಿಯಾನೋ ಫೋರ್ಟೆ ಎಂಬ ಇಟಾಲಿಯನ್ಪದದ ಮೃದು ಶಬ್ದ ಎಂಬರ್ಥ ಕೊಡುವ ಪದ. ಭಾರತದಲ್ಲಿ ಪ್ರಸಿದ್ಧವಾದ ಹಾರ್ಮೋನಿಯಂನಂತೆ ಇದರ ಕೀಲಿಗಳನ್ನು ಲಯಬದ್ದವಾಗಿ ಒತ್ತುವ ಮೂಲಕ ಸಂಗೀತ ರಚನೆ ಮಾಡಬಹುದು.\\nಪಿಯಾನೋವನ್ನು ಇಟಲಿದೇಶದ ಫ್ಲಾರೆನ್ಸ್ ನಗರದ ಬಾರ್ತಲೋಮ್ಯು ಕ್ರಿಸ್ಟೋಫರಿಯವರು ಕಂಡು ಹಿಡಿದರು. ನಿಖರವಾದ ಸಮಯವು ತಿಳಿದಿಲ್ಲವಾದರೂ ೧೭೦೦ ನೆಯ ಸುಮಾರಿಗೆ ಇದರ ಅವಿಷ್ಕಾರವಾಯಿತೆಂದು ಇತಿಹಾಸಕಾರರು ಹೇಳುತ್ತಾರೆ."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_r%C3%B6misch-katholischen_Bisch%C3%B6fe_f%C3%BCr_Deutschland","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Gerhard_Feige_2.jpg","page_title":"Liste der römisch-katholischen Bischöfe für Deutschland","context_page_description":"In der Liste der römisch-katholischen Bischöfe für Deutschland finden sich alle lebenden Bischöfe der Bundesrepublik Deutschland, einschließlich der deutschen Kurienbischöfe."},{"page_url":"https://en.wikipedia.org/wiki/Church_of_the_Immaculate_Conception,_Farm_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/The_Immaculate_Conception%2C_Farm_Street%2C_London_W1_-_geograph.org.uk_-_1536039.jpg","page_title":"Church of the Immaculate Conception, Farm Street","context_page_description":"The Church of the Immaculate Conception, Farm Street, also known as Farm Street Church, is a Roman Catholic parish church run by the Society of Jesus in Mayfair, central London. Its main entrance is in Farm Street, though it can also be accessed from the adjacent Mount Street Gardens. Sir Simon Jenkins, in his book England's Thousand Best Churches, describes the church as \\"Gothic Revival at its most sumptuous\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Il%E2%80%9318","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/IL-18_MAL%C3%89V_Hungarian_Airlines.jpg","page_title":"Il–18","context_page_description":"Az Il–18 az 1950-es években a Szovjetunióban az Iljusin-tervezőirodában kifejlesztett, négy légcsavaros gázturbinával felszerelt közepes hatótávolságú utasszállító repülőgép. Később szállító repülőgépként és egyéb speciális feladatkörben is alkalmazták, katonai változatai is készültek. 1957-ben repült először, sorozatgyártása 1959-től 1978-ig folyt."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Air_Force_Academy_Cadet_Chapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/AFA_Protestant_Chapel_Organ.jpg","page_title":"United States Air Force Academy Cadet Chapel","context_page_description":"The United States Air Force Academy Cadet Chapel, completed in 1962, is the distinguishing feature of the Cadet Area at the United States Air Force Academy north of Colorado Springs. It was designed by Walter Netsch of Skidmore, Owings and Merrill of Chicago. Construction was accomplished by Robert E. McKee, Inc., of Santa Fe, New Mexico. Originally controversial in its design, the Cadet Chapel has become a classic and highly regarded example of modernist architecture. The Cadet Chapel was awarded the American Institute of Architects' National Twenty-five Year Award in 1996 and, as part of the Cadet Area, was named a U.S. National Historic Landmark in 2004."},{"page_url":"https://ro.wikipedia.org/wiki/Trachylepis_aureopunctata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Gold_Spotted_Mabuya_in_Madagascar.jpg","page_title":"Trachylepis aureopunctata","context_page_description":"Trachylepis aureopunctata este o specie de șopârle din genul Trachylepis, familia Scincidae, descrisă de Grandidier 1867. A fost clasificată de IUCN ca specie cu risc scăzut.\\nEste endemică în Madagascar. Conform Catalogue of Life specia Trachylepis aureopunctata nu are subspecii cunoscute."},{"page_url":"https://en.wikipedia.org/wiki/AB_Aerotransport","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Aerotransport_annons_1937.jpg","page_title":"AB Aerotransport","context_page_description":"AB Aerotransport was a Swedish government-owned airline which operated during the first half of the 20th Century and was merged into what would become the SAS Group. ABA was established on 27 March 1924 under the name Aktiebolaget Aerotransport by Carl and Adrian Florman together with Ernst Linder, John Björk och Johan Nilsson. Its first flight was on 2 June 1924 between Stockholm, Sweden and Helsinki, Finland. Needing more funds, it became government-owned in 1935. ABA was merged with Swedish Intercontinental Airlines in 1948 and airline operations would ultimately be merged into the international SAS Group in 1950."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D8%A8%DB%8C%D9%88%D9%86%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ponteterra_%28Sabbioneta%29_Agosto_1984.jpg","page_title":"سابیونتا","context_page_description":"سابیونتا شهر و کومونهای در استان منتووا در منطقهٔ لمباردی در ناحیهٔ شمالی کشور ایتالیاست. این شهر در ۳۰ کیلومتری پارما و در نزدیکی رود پو واقع شده‌است. این شهر در سال ۲۰۰۸ در فهرست میراث جهانی یونسکو قرار گرفت."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D1%83%D0%BC%D0%BD%D0%B8%D0%B9_%D1%81%D1%82%D0%BE%D0%B2%D0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Ostrau_-_Masarykovo_namesti.JPG","page_title":"Чумний стовп","context_page_description":"Чумний стовп — усталена назва на позначення монумента на подяку католицькому святому за припинення епідемії чуми. Серед інших назв — Маріанська колона і Колона Св. Трійці."},{"page_url":"https://en.wikipedia.org/wiki/Fort_de_Bic%C3%AAtre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Plan_fortifications_place_de_Paris.JPG","page_title":"Fort de Bicêtre","context_page_description":"The Fort de Bicêtre is a military structure built between 1841 and 1845 during the reign of Louis-Philippe during a time of tension between France and England, in the Paris suburb of Kremlin-Bicêtre. The fort is part of the Thiers Wall fortifications of Paris, built under a program of defensive works initiated by Adolphe Thiers. The fort served as a prison for those involved in the French coup of 1851.\\nOccupied by the Prussians in 1871, the fort was briefly occupied by communards during the Paris Commune. After 1874, under the direction of General Raymond Adolphe Séré de Rivières, the ring of Thiers fortifications was reinforced by a second ring of forts, reflecting the increased range of artillery during the intervening years. The Fort de Bicêtre was not modernized at this time, since it was considered too close to Paris to be useful.\\nFrom 1940 to 1944 the fort was occupied by German troops. After World War II the fort remained a military post, successively accommodating an artillery unit, an Marine infantry battalion, and from 1946 a military radio facility."},{"page_url":"https://de.wikipedia.org/wiki/Bracieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bracieux_halle.jpg","page_title":"Bracieux","context_page_description":"Bracieux ist eine französische Gemeinde mit 1.294 Einwohnern im Département Loir-et-Cher in der Region Centre-Val de Loire; sie gehört zum Arrondissement Blois und zum Kanton Chambord."},{"page_url":"https://es.wikipedia.org/wiki/Persona_mon%C3%B3nima","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Nofretete_Neues_Museum.jpg","page_title":"Persona monónima","context_page_description":"Se denomina persona monónima a un individuo que es conocido y designado por un monónimo, ​ o \\"nombre único\\". En algunos casos, dicho nombre ha sido elegido por el individuo, que puede haber tenido originalmente un polínimo. En otros casos, ha sido determinado por las costumbres del país​ o por alguna persona o grupo interesado.\\nNumerosos músicos y actores han adoptado nombres únicos, tales como Sandro, Cher, Adele, Beyoncé, Fey, Bono, Moby, Zendaya, Madonna, Prince, Björk, Rihanna, Sting, Xzibit y Cantinflas, entre muchos otros.\\nEn España, Portugal y Brasil es común que los futbolistas sean conocidos por un nombre único. Así es el caso de Arteaga, Arzu, Nani, Ronaldo, Eusébio, Marta, Michel, Garrincha, Sergi, Raúl, Pelé y Xavi, entre muchos otros."},{"page_url":"https://ca.wikipedia.org/wiki/Corydoras_pantanalensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Corydoras_pantanalensis.jpg","page_title":"Corydoras pantanalensis","context_page_description":"Corydoras pantanalensis és una espècie de peix de la família dels cal·líctids i de l'ordre dels siluriformes."},{"page_url":"https://ro.wikipedia.org/wiki/Elmenhorst_(Nordvorpommern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Elmenhorst%2C_Kirche_-_Ansicht_vom_Kirchhof_%282008-04-20%29.JPG","page_title":"Elmenhorst (Nordvorpommern)","context_page_description":"Elmenhorst (Nordvorpommern) este o comună din landul Mecklenburg-Pomerania Inferioară, Germania."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%A1%D7%9E%D7%99%D7%A7_%D7%97%D7%A8%D7%95%D7%98%D7%99%D7%95%D7%A0%D7%99%D7%90%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Hasmik-harutyunyan.jpg","page_title":"חסמיק חרוטיוניאן","context_page_description":"חסמיק חרוטיוניאן היא זמרת ארמנית. היא מובילה את הרכב הפולקלור אמסמבל שוגהקן העממי, ומנצחת על הרכב חייריק מוראדיאן לשירת וריקוד ילדים מסורתיים.\\nהמוזיקה של אנסמבל שוגהקן מופיעה בפסקול של הסרט \\"אררט\\". האלבום של חרוטיאניאן, \\"שירי ערש ארמניים\\" הוכר על ידיהניו יורק טיימס בתור אלבום מוזיקת עולם יוצא דופן לשנת 2004.\\nלפני שהתחילה להופיע עם אנסמבל שוגהקן, היא הייתה סולנית באנסמבל אגונג של הרדיו הלאומי הארמני, והופיעה בארמניה, אירופה, ובברית המועצות. עם שוגהקן, הופיעה חרוטיניאן ברחבי העולם: בארמניה, צרפת, גרמניה, אסטוניה, רוסיה, איחוד האמירויות הערביות, בקנדה, ובארצות הברית, בין היתר בפרויקט מוזיקת עולם שארגן הצ'לן יו-יו מה. חרוטיניאן גם הקליטה אלבומים עם ההרכב קארוט. באפריל 2009, היא הופיעה בקונצרט מוזיקה ארמנית מסורתית בפסטיבל בוורוצלב, בפולין, שם גם ערכה סדנאות לשירה וריקודים עממיים. בסתיו 2009, תיירה בסבב הופעות בארצות הברית עם אנסמבל הנשים הקולי קיטקה, כשהן מציגות את המוזיקה של המלחין חייריק מוראדיאן, קומיטאס, ושירי ערש ארמנים, ואף השתתפו בפסטיבל מוזיקת העולם בסן פרנסיסקו. ב-2010 היא הופיעה עם שוגהקן והעבירה סדנה למוזיקה וריקוד ארמנים בלובליאנה, סלובניה."},{"page_url":"https://es.wikipedia.org/wiki/Valle_del_Miera","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Localizacion_de_las_f%C3%A1bricas_de_artilleria_de_Lierganes_y_La_Cavada.png","page_title":"Valle del Miera","context_page_description":"El Valle de Miera es un valle natural por el que discurre el río Miera.\\nConstituye parte de la comarca y es el más angosto de los valles cántabros, en España. Sus pendientes son acusadas y las altitudes elevadas. Su montaña más alta es el Castro Valnera, a 1707 msnm.\\nEn su morfología destacan sus rocas areniscas y calizas y el amplio desarrollo de depósitos originados por antiguas morrenas de glaciares en su parte alta. La morfología kárstica y glaciar está ampliamente representada. No obstante, las características de un valle glaciar han sido modificadas en algunos puntos por el carácter torrencial del río Miera en su cabecera.\\nEl valle se encuentra parcial o totalmente en los municipios de Soba, San Roque de Riomiera, Miera, Liérganes, Riotuerto y Ruesga.\\nLa cuenca alta del Miera está conformada por un relieve abrupto y poco apto para el hábitat humano. A pesar de ello se han descubierto en su entorno cuevas con asentamiento prehistórico en las cuevas de Piélagos, Rascaño y Salitre, una de las estaciones con arte paleolítico situada a más altura de Cantabria."},{"page_url":"https://no.wikipedia.org/wiki/Skjema","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Sameie.jpg","page_title":"Skjema","context_page_description":"Et skjema var opprinnelig et forhåndstrykket dokument for registrering av spesifikk informasjon. Med informasjonsteknologi har det også blitt mulig og ofte mer effektivt med elektroniske skjema, gjerne koblet mot databaser. Skjemaet inneholder avmerkede felter som skal fylles inn med etterspurt informasjon.\\nSkjemaet er laget av en innsamler av data for å standardisere svarene, slik at de kan brukes enten i en statistikk eller til å registrere dataene i et register som kan brukes av innsamleren.\\nFordeler ved bruk av skjema:\\nUtfylleren trenger ikke å skrive mere tekst enn de variable dataene.\\nUtfylleren blir minnet om de dataene som trengs for at skjemaet blir riktig utfyllt.\\nInnsamleren av skjemaet kan lett registrere dataene på riktig plass i registeret.\\nVed bruk av elektronisk skjema kan dataene overføres direkte i registeret.\\nELMER er en forvaltningsstandard for skjema på nett. Standarden er obligatorisk for formelle skjema rettet mot næringsdrivende, og anbefalt for innbyggerskjema. I tillegg er det mange som bruker retningslinjene frivillig, som et ledd i sitt brukskvalitetsarbeid. Målet med retningslinjene er å sikre at offentlige skjema er enhetlige og brukervennlige."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_gol_internasional_yang_dicetak_oleh_Clint_Dempsey","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Clint_Dempsey_20110622.jpg","page_title":"Daftar gol internasional yang dicetak oleh Clint Dempsey","context_page_description":"Clint Dempsey adalah seorang pemain sepak bola profesional yang telah mewakili Amerika Serikat dalam kompetisi internasional sejak 2004. Hingga Oktober 10, 2017, Dempsey telah tampil 141 kali untuk tim nasional dan mencetak 57 gol. Ia adalah pencetak skor papan atas putra sepanjang masa bersama untuk Amerika Serikat, berpasangan dengan Landon Donovan dan 57 gol-nya. Hingga November 2017, ia menjadi pencetak gol putra internasional paling aktif ketiga di seluruh dunia, setelah Cristiano Ronaldo dari Portugal dan Lionel Messi dari Argentina.\\nDempsey membuat debut tim nasionalnya pada 17 November 2004, pada kualifikasi Piala Dunia melawan Jamaika di Columbus, Ohio; panggilan datang setelah musim rookie-nya dalam Major League Soccer dengan New England Revolution, dimana ia mencetak tujuh gol dan satu assist sehingga ia diangkat menjadi MLS Rookie of the Year. Dempsey mencetak gol tim nasional pertamanya pada 28 Mei 2005, saat sebuah pertandingan persahabatan melawan Inggris di Chicago. Gol tim nasional kompetitif pertamanya terjadi sebulan kemudian melawan Kuba di Seattle pada Piala Emas CONCACAF 2005, sebuah turnamen dimana Amerika Serikat menjadi pemenangnya."},{"page_url":"https://sv.wikipedia.org/wiki/Sury-aux-Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Map_commune_FR_insee_code_45316.png","page_title":"Sury-aux-Bois","context_page_description":"Sury-aux-Bois är en kommun i departementet Loiret i regionen Centre-Val de Loire strax norr Frankrikes mitt. Kommunen ligger i kantonen Châteauneuf-sur-Loire som tillhör arrondissementet Orléans. År 2009 hade Sury-aux-Bois 757 invånare."},{"page_url":"https://bg.wikipedia.org/wiki/Apristurus_spongiceps","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Apristurus_spongiceps_distmap.png","page_title":"Apristurus spongiceps","context_page_description":"Apristurus spongiceps е вид хрущялна риба от семейство Scyliorhinidae."},{"page_url":"https://en.wikipedia.org/wiki/Tributaries_of_Fishing_Creek_(North_Branch_Susquehanna_River_tributary)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Culley_Run_looking_downstream.JPG","page_title":"Tributaries of Fishing Creek (North Branch Susquehanna River tributary)","context_page_description":"There are 17 named tributaries of the main stem of Fishing Creek, a 30-mile-long stream in Columbia County, Pennsylvania, in the United States and a tributary of the Susquehanna River. The creek also has numerous sub-tributaries. The creek's watershed has an area of 385 square miles. The watersheds of Little Fishing Creek and Huntington Creek, Fishing Creek's two largest tributaries, make up nearly 45 percent of the Fishing Creek watershed.\\nThe tributaries of the main stem of Fishing Creek consist of nine creeks, three runs, one brook, and four hollows."},{"page_url":"https://eu.wikipedia.org/wiki/Deltistes_luxatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Delistes_luxatus_usgs.jpg","page_title":"Deltistes luxatus","context_page_description":"Deltistes luxatus Deltistes generoko animalia da. Arrainen barruko Catostomidae familian sailkatzen da."},{"page_url":"https://nl.wikipedia.org/wiki/William_Edmond_Logan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/William_Logan.jpg","page_title":"William Edmond Logan","context_page_description":"William Edmond Logan was een 19de-eeuws Canadees geoloog.\\nIn 1831 startte hij met het lesgeven in geologie.\\nHij maakte een geologische kaart van de kolenvelden in het zuiden van Wales. Op basis van zijn onderzoek presenteerde hij in 1840 zijn paper On the Character of the Beds of Clay Lying Immediately below the Coal-seams of South Wales, and on the Occurrence of Coal-boulders in the Pennant Grit of that District aan de Geological Society of London. Hierin beweerde hij dat de kleilagen onder het kolenveld resten waren van planten die daar groeiden en die leidden tot de aanmaak van steenkool.\\nIn 1842 werd hem gevraagd om een geologische studie te maken van Canada. Tot in 1869 ging hij hiermee door. Hij beschreef zo de Laurentian Mountains in Canada en de Adirondacks in de staat New York.\\nTijdens zijn carrière ontving hij 22 medailles, waaronder het Franse Legioen van Eer van keizer Napoleon III van Frankrijk in 1855. Hij werd ook geridderd door koningin Victoria van Engeland in 1856.\\nMount Logan, de hoogste berg van Canada, draagt zijn naam als eerbetoon."},{"page_url":"https://fi.wikipedia.org/wiki/Tel_Aviv","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Panorama_of_Tel_Aviv.jpg","page_title":"Tel Aviv","context_page_description":"Tel Aviv-Jaffa on kaupunki Keski-Israelissa Välimeren rannalla. Tel Aviv on perustettu vuonna 1909 ja nykyisin siihen kuuluu myös vanhempi Jaffan kaupunki. Tel Aviv oli Israelin pääkaupunki vuosina 1948–1950, jolloin pääkaupunki siirrettiin Jerusalemiin. Kaikki maat eivät kuitenkaan ole siirrosta tunnustaneet.\\nTel Avivin asukasluku oli vuoden 2018 lopussa 451 523. Suuremmalla metropolialueella asui vuonna 2016 3,9 miljoonaa asukasta, eli noin 45 % Israelin väestöstä. Suurin osa paikallisista on juutalaisia, mutta vanhan Jaffan alueella on myös arabivähemmistö."},{"page_url":"https://pt.wikipedia.org/wiki/Miss%C3%A3o_diplom%C3%A1tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/US_Interests_Section_Havana_Nov_2010.JPG","page_title":"Missão diplomática","context_page_description":"Uma missão diplomática é o conjunto de diplomatas e de outros funcionários de carreira ou não, encarregados de representar um Estado soberano ou uma organização internacional junto a outro estado ou organização. O Estado que envia a missão diplomática é designado \\"Estado acreditante\\" e o que a recebe e acredita é designado \\"Estado acreditador\\" ou \\"Estado acreditado\\". Hoje em dia, praticamente todas as missões diplomáticas têm a categoria de embaixada, o que faz com que os dois termos sejam praticamente equivalentes. Contudo, no passado, a maioria das missões diplomáticas tinham a categoria de legação, com a designação de \\"embaixada\\" sendo reservada às missões diplomáticas junto às grandes potências.\\nAtualmente, os termos \\"missão diplomática\\" e \\"embaixada\\" são usados sobretudo para se referir a uma missão permanente, ou seja, às instalações físicas da representação diplomática de um estado ou organização instalado na cidade capital de outro estado ou sede de uma organização."},{"page_url":"https://lt.wikipedia.org/wiki/Balistin%C4%97_raketa","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Trident_II_missile_image.jpg","page_title":"Balistinė raketa","context_page_description":"Balistinė raketa – raketa, kuri didelę dalį skrydžio trajektorijos skrieja neveikiant varikliui balistine trajektorija. Trumpesnių nuotolių balistinės raketos skrieja Žemės atmosferoje, o didesnių nuotolių raketos dalį trajektorijos skrieja virš atmosferos."},{"page_url":"https://id.wikipedia.org/wiki/Piala_Dunia_FIFA_1938","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/LilleOM-1937.jpg","page_title":"Piala Dunia FIFA 1938","context_page_description":"Piala Dunia FIFA 1938 adalah Piala Dunia FIFA ketiga, yang diselenggarakan di Prancis, dari 4 Juni hingga 19 Juni 1938. Italia menjadi juara untuk kedua kalinya secara berturut, setelah mengalahkan Hongaria pada pertandingan final dengan skor 4–2. Pencetak gol terbanyak adalah pemain Brasil, Leônidas dengan 7 gol."},{"page_url":"https://pl.wikipedia.org/wiki/Ksantos_(miasto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Xanthos01.jpg","page_title":"Ksantos (miasto)","context_page_description":"Ksantos – starożytna stolica Licji, rozbudowana w okresie hellenistyczno-rzymskim, obecnie stanowisko archeologiczne w rejonie miasta Kınık w południowo-zachodniej Turcji, od 1988 roku wraz z pobliskim Letoon wpisane na listę światowego dziedzictwa UNESCO."},{"page_url":"https://pt.wikipedia.org/wiki/Model_sheet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/1D_model-sheet.png","page_title":"Model sheet","context_page_description":"Nas animações, vídeo games e histórias em quadrinhos, Model sheet, estudo de personagem ou simplesmente um estudo, é um documento usado para ajudar a padronizar a aparência, roupas, etc, de modo a enfatizar gestos e atitudes de um personagem animado. Um personagem que não esteja desenhado de acordo com modelo padronizado da produção é conhecido como off-model. No mercado japonês, o termo usado é settei.\\nModel sheets geralmente não são de domínio público, o direitos autorais são de propriedade do estúdio ou do criador. Existem vários model sheets disponíveis na internet, porém, muitos estúdios exigiram que fossem retirado.\\nEmbora model sheets sejam originalmente destinados para artistas que trabalham para os estúdios que possuem os personagens para os quais são desenvolvidos, outros artistas, tais como aqueles que criam fanarts. Além disso, os pais muitas vezes baixam model sheets para serem usados como livros para colorir gratuitos para os seus filhos."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%BE%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D1%82%D0%B0%D0%BC%D0%B1%D1%83%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Reis%C3%BClk%C3%BCttab.jpg","page_title":"Історія османського Стамбула","context_page_description":"Історія османського Стамбула охоплює період від захоплення Константинополя турками 29 травня 1453 року до розпаду Османської імперії в 1922 році і перенесення столиці Туреччини в Анкару 13 жовтня 1923 року.\\nМайже п'ять століть Стамбул був столицею величезної держави, що сформувалася в XIV–XVI століттях в результаті завойовницьких походів турецьких султанів. Османська імперія охоплювала володіння на трьох континентах — в Європі, Азії та Африці. Таким чином, стародавнє місто на берегах Босфору знову перетворилося на політичний і економічний центр світового значення. Поступово Стамбул повернув собі славу великого пункту міжнародної торгівлі. Й хоча найважливіші торгові шляхи перемістилися з Середземномор'я в Атлантику, чорноморські протоки надалі залишалися жвавою торговою артерією пізнього середньовіччя.\\nКрім того, Стамбул став найбільшим релігійним і культурним центром мусульманського світу, увібравши і переробивши багато чого з культури сельджуків, візантійців, арабів і персів. Місто являло собою зменшену модель Османської імперії, з її строкатим в етнічному та релігійному плані населенням."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B9%D1%81%D0%BA%D0%B8_%D0%90%D0%BB%D0%BF%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Aiguille-du-Midi-summer.jpg","page_title":"Грайски Алпи","context_page_description":"Грайски Алпи се нарича най-високата част на планината Алпи, разположена в Италия, Франция и отчасти в Швейцария. Те започват на юг от прохода Мон Сени, който ги свързва с Котските Алпи и достигат до прохода Фере, след който започват Пенинските Алпи. С дължина 197 км и ширина 126 км, те са един от най-големите дялове на Алпите. На изток стръмно се спускат в Паданската низина, но на запад преминават в по-ниски масиви, известни с името Савойски Алпи. Тук е най-високият връх на планината – Монблан."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A4%D7%99%D7%92%D7%95%D7%A2_%D7%91%D7%9E%D7%9C%D7%95%D7%9F_%D7%A1%D7%91%D7%95%D7%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Savoy_hotel_attack.svg","page_title":"הפיגוע במלון סבוי","context_page_description":"הפיגוע במלון סבוי היה פעולת טרור שביצעו שמונה מחבלים מארגון הפת\\"ח בתל אביב בלילה שבין 5 ו-6 במרץ 1975. מטרת הטרוריסטים הייתה תפיסת בני ערובה שישוחררו בתמורה לשיחרור מחבלים. בפעולה נרצחו 8 אזרחים ושלושה חיילים."},{"page_url":"https://ro.wikipedia.org/wiki/Asiato-americani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Asian-census_density_map.png","page_title":"Asiato-americani","context_page_description":"Asiato-americanii sau Americanii asiatici sunt americani de origine asiatică. Definiția dată de US Census Bureau asiaticilor din Statele Unite se referă la persoanele care au origini în oricare dintre popoarele originale din Orientul Îndepărtat, Asia de Sud-Est sau subcontinentul indian. Aceștia includ persoanele care au indicat rasa lor ca „asiatică” sau au raportat naționalitți cum ar fi chineză, filipineză, indiană, vietnameză, coreeană, japoneză și „altă origine asiatică”.\\nConforma estimărilor din 2012 americanii asiatici alcătuiesc peste 5% din populația Statelor Unite."},{"page_url":"https://uk.wikipedia.org/wiki/SLC2A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/PBB_GE_SLC2A9_219991_at_fs.png","page_title":"SLC2A9","context_page_description":"SLC2A9 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 4-ї хромосоми. Довжина поліпептидного ланцюга білка становить 540 амінокислот, а молекулярна маса — 58 702.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах як транспорт, поліморфізм, альтернативний сплайсинг.\\nЛокалізований у клітинній мембрані, мембрані."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B2%E0%B8%A3%E0%B9%8C%E0%B8%8A%E0%B8%94%E0%B8%B1%E0%B8%8A%E0%B9%80%E0%B8%8A%E0%B8%AA%E0%B8%A1%E0%B8%B2%E0%B8%A3%E0%B8%B5%E0%B8%AD%E0%B8%B2_%E0%B8%AD%E0%B8%B1%E0%B8%99%E0%B8%99%E0%B8%B8%E0%B8%99%E0%B8%97%E0%B9%8C%E0%B8%8B%E0%B8%B5%E0%B8%AD%E0%B8%B2%E0%B8%97%E0%B8%B2%E0%B9%81%E0%B8%AB%E0%B9%88%E0%B8%87%E0%B8%AD%E0%B8%AD%E0%B8%AA%E0%B9%80%E0%B8%95%E0%B8%A3%E0%B8%B5%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/AnnuziataAustria.jpg","page_title":"อาร์ชดัชเชสมารีอา อันนุนท์ซีอาทาแห่งออสเตรีย","context_page_description":"อาร์ชดัชเชสมารีอา อันนุนท์ซีอาทาแห่งออสเตรีย 13 กรกฎาคม พ.ศ. 2419 - 8 เมษายน พ.ศ. 2504 ทรงเป็นอาร์ชดัชเชสแห่งออสเตรีย"},{"page_url":"https://sv.wikipedia.org/wiki/Arma_Christi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Passion-instruments.jpg","page_title":"Arma Christi","context_page_description":"Arma Christi, ungefär Kristi vapen, även kallade passionsredskapen, är föremål hämtade ur passionshistorien. Passionshistorien är berättelsen om Jesus fängslande, dom, korsfästelse, begravning och uppståndelse som den återges i de fyra evangelierna i Nya Testamentet i Bibeln. Föremålen är vapen i heraldisk mening och vapen med meningen verktyg, som Jesus behövde för att uppnå sina mål. Samtliga föremål har enskilt vördats bland de kristna, de syns avbildade symboliskt på kristna byggnader och konstverk. De flesta föremålen eller delar av dem har återupptäckts och vördas som reliker i kyrkor. Avbildningar av föremålen innehåller en eller flera av dessa och korset Jesus korsfästes på finns nästan alltid med. Flera ingår också i korsvägsandaktens fjorton stationer.\\nKalken, den heliga graal, som Jesus använde vid sista nattvarden.\\nTrettio silvermynt, eller en pengapåse, betalningen Judas fick för att förråda Jesus.\\nLyktorna eller facklorna som de romerska soldaterna använde när de arresterade Jesus.\\nSvärden och påkarna soldaterna bar på när de arresterade Jesus.\\nSvärdet Petrus använde när han högg örat av översteprästens tjänare under arresteringen, ibland också ett människoöra."},{"page_url":"https://en.wikipedia.org/wiki/1947_VFA_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Port_melbourne_fc_1947.jpg","page_title":"1947 VFA season","context_page_description":"The 1947 Victorian Football Association season was the 66th season of the Australian rules football competition. The premiership was won by the Port Melbourne Football Club, which defeated Sandringham by 31 points in the Grand Final on 4 October. It was the sixth premiership in the club's history."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%80%D0%B8%D0%BD%D0%B2%D0%B8%D0%BB_(%D0%8A%D1%83_%D0%A5%D0%B5%D0%BC%D0%BF%D1%88%D0%B8%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/East_Main_Street%2C_Greenville%2C_NH.jpg","page_title":"Гринвил (Њу Хемпшир)","context_page_description":"Гринвил насељено је место без административног статуса у америчкој савезној држави Њу Хемпшир."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B4%D0%B0%D1%97%D0%BD-%D0%A1%D0%B0%D0%BB%D1%96%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Madain_Saleh_%286730128379%29.jpg","page_title":"Мадаїн-Саліх","context_page_description":"Мадаїн-Саліх або Хегра, Аль-Хіджр — комплекс археологічних об'єктів на північному заході Саудівської Аравії.\\nКомплекс включає 111 скельних поховань, а також систему гідротехнічних споруд, що належать до стародавнього набатейського міста Хегра, яке було центром караванної торгівлі. Також є близько 50 написів у скелях, що належать до донабатейського періоду.\\nУ 2008 році археологічний комплекс Аль-Хіджр був включений до списку об'єктів Світової спадщини ЮНЕСКО, ставши першим таким об'єктом на території Саудівської Аравії."},{"page_url":"https://nl.wikipedia.org/wiki/Cambridge_(Verenigd_Koninkrijk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Clare_and_King%27s_Bridges_from_Trinity_Bridge.jpg","page_title":"Cambridge (Verenigd Koninkrijk)","context_page_description":"Cambridge is een district met de officiële titel van city, in Engeland in het graafschap Cambridgeshire, ongeveer 80 kilometer ten noordoosten van Londen. Cambridge beslaat een oppervlakte van 41 km² en heeft ongeveer 126.000 inwoners, waaronder zo'n 22.500 studenten.\\nDe stad is vooral beroemd vanwege de Universiteit van Cambridge, die met de Universiteit van Oxford behoort tot de twee belangrijkste universiteiten van het Verenigd Koninkrijk en tot de beroemdste ter wereld. De 31 colleges zijn over de hele stad verspreid, maar zijn allemaal onderdeel van dezelfde universiteit. In Cambridge bevindt zich ook een grote campus van de Anglia Ruskin University.\\nCambridge is een stad met veel groen in parken en aan de rivier de Cam, waarnaar Cambridge genoemd is: Cambridge betekent brug over de Cam."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B4%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D0%B8%D0%BB%D0%B8%D1%88%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Kobe_Kawasaki_Shipbuilding_Co02ds3200.jpg","page_title":"Бродоградилиште","context_page_description":"Бродоградилиште је већи или мањи погон за изградњу и ремонт бродова и других пловних објеката и тако даље."},{"page_url":"https://de.wikipedia.org/wiki/Duncan-Klasse_(1901)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/HMS_Cornwallis_%28Duncan-class_battleship%29.jpg","page_title":"Duncan-Klasse (1901)","context_page_description":"Die Duncan-Klasse war eine nach Admiralen benannte Klasse von Pre-Dreadnought-Schlachtschiffen der Royal Navy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D0%BF%D1%83_%D0%9F%D1%96%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Lupu-Pick.jpg","page_title":"Лупу Пік","context_page_description":"Лупу Пік — німецький актор, кінорежисер, сценарист і продюсер."},{"page_url":"https://pt.wikipedia.org/wiki/Ren%C3%A9_Plaissetty","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rene_Plaissetty_NY.jpg","page_title":"René Plaissetty","context_page_description":"René Plaissetty, nasceu René Alexis Plaissetty, foi um ator, roteirista e diretor norte-americano da era do cinema mudo.\\nRené nasceu em Chicago, Illinois, em 1889 e faleceu em Nova Iorque, NI, em 1955."},{"page_url":"https://pl.wikipedia.org/wiki/Thomas_Kretschmann","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Thomas_Kretschmann_%28Berlinale_2012%29.jpg","page_title":"Thomas Kretschmann","context_page_description":"Thomas Kretschmann – niemiecki aktor i model."},{"page_url":"https://sh.wikipedia.org/wiki/Umihana_%C4%8Cuvidina","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Umihana_%C4%8Cuvidina.jpg","page_title":"Umihana Čuvidina","context_page_description":"Umihana Čuvidina, prva poznata bošnjačka pjesnikinja i jedna od prvih pjesnikinja na bosanskom jeziku.\\nRođena je u Sarajevu, na Hridu, oko 1794. godine. Rodna kuća joj je bila na uglu Mujezinova sokaka. Čuvide, njena porodica, bavili su se aščijskim, a kasnije bostandžijskim obrtom.\\nUmihana je bila zaručena s Mujom Čamdži-bajraktarom, Sarajlijom, koji je 1813. godine, za srpskog ustanka, poginuo pod Loznicom u vojsci Alipaše Derendelije. Od velike žalosti Umihana se nije htjela nikada udavati, pak je počela pjevati pjesme o svom junački poginulom zaručniku. Jedina njena, izgleda u izvornom obliku, sačuvana pjesma je epos od 79 stihova u osmercu i desetercu pod naslovom \\"Sarajlije iđu na vojsku protiv Srbije\\", što ju je pjesnikinja spjevala prije nego joj je poginuo zaručnik\\nMnoge Umihanine pjesme se danas smatraju narodnim.\\nUmrla u Sarajevu oko 1870. Grob joj je \\"pod gajem na Hridu\\"."},{"page_url":"https://en.wikipedia.org/wiki/Cola_di_Rienzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Collier%27s_Rienzi_Nicola_Gabrini.png","page_title":"Cola di Rienzo","context_page_description":"Nicola Gabrini, commonly known as Cola di Rienzo or Rienzi, was an Italian medieval politician and popular leader, who styled himself as \\"tribune of the Roman people\\". For his demagogic rhetoric, popular appeal and anti-establishment sentiment, some sources considered him an earlier populist and proto-fascist figure.\\nHaving advocated the abolition of Papal power and the Unification of Italy, Cola re-emerged in the 19th century as a romantic figure among leaders of liberal nationalism and adopted as a precursor of the 19th century Risorgimento."},{"page_url":"https://hu.wikipedia.org/wiki/Vareilles_(Sa%C3%B4ne-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Vareilles_01.jpg","page_title":"Vareilles (Saône-et-Loire)","context_page_description":"Vareilles település Franciaországban, Saône-et-Loire megyében. Lakosainak száma 268 fő. +/- Vareilles Amanzé, Baudemont, Oyé, Saint-Christophe-en-Brionnais, Saint-Laurent-en-Brionnais, Saint-Symphorien-des-Bois és Vauban községekkel határos."},{"page_url":"https://fr.wikipedia.org/wiki/Ovac%C4%B1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Karab%C3%BCk_districts.png","page_title":"Ovacık","context_page_description":"Ovacık est une ville et un district de la province de Karabük dans la région de la mer Noire en Turquie."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%A4%D7%95%D7%AA_%D7%A8%D7%95%D7%9E%D7%90%D7%A0%D7%99%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Map-Romance_Language_World.svg","page_title":"שפות רומאניות","context_page_description":"השפות הרומאניות הן קבוצת שפות מתוך משפחת השפות ההודו-אירופיות שהתפתחו מהשפה הלטינית או בשמה האחר - הרומית, שלא נחשבת כשפה רומאנית, תוך השפעות שפות נוספות. השפות הרומאניות המדוברות ביותר הן איטלקית, ספרדית, פורטוגזית, צרפתית, ורומנית. השפות הרומאניות מדוברות בעולם כולו על ידי יותר מ-800 מיליון בני אדם, בעיקר באירופה ובאמריקה הלטינית.\\nהשפות ה\\"רומאניות\\" התפתחו מהלטינית המדוברת, המכונה \\"לטינית וולגרית\\", שדוברה בפי החיילים הרומאים, נציגי השלטון הרומי ומתיישבים אחרים, שבאמצעותם היא התפשטה בפרובינקיות הרומיות. בכל אזור עברה הלטינית המדוברת מגוון נרחב של שינויים לאורך השנים והושפעה רבות מהשפות המקומיות שדוברו באותם האזורים לפני כן. שפות הסובסטרט השונות אמנם כמעט ולא השאירו את חותמן בלקסיקון השפות הרומאניות המודרניות, אך השפעתן ניכרת בתחומי הדקדוק השונים. חלוקת השפות הרומאניות לתת-קבוצות מתבססת על אזורי שפות סובסטרט אלה, המתלכדים עם התפוצה הלשונית הגאוגרפית.\\nלמרות השפעות אחרות, הפונולוגיה, המורפולוגיה ואוצר המילים של כל השפות הרומאניות מורכבות בעיקר מצורות מפותחות של לטינית וולגרית."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Wilstorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Hamburg-Wilstorf_Zimmermannstr_24.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Wilstorf","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Wilstorf enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Wilstorf der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Wilstorf, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Harburg zu finden."},{"page_url":"https://fr.wikipedia.org/wiki/Physique","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/CollageFisica.jpg","page_title":"Physique","context_page_description":"La physique est la science qui essaie de comprendre, de modéliser et d'expliquer les phénomènes naturels de l'univers. Elle correspond à l'étude du monde qui nous entoure sous toutes ses formes, des lois de sa variation et de son évolution.\\nLa physique développe des représentations du monde expérimentalement vérifiables dans un domaine de définition donné. Elle produit plusieurs lectures du monde, chacune n'étant considérée comme précise que jusqu'à un certain point. La modélisation des systèmes physiques peut inclure ou non les processus chimiques et biologiques.\\nLa physique telle que conceptualisée par Isaac Newton, aujourd’hui dénommée physique classique, butait sur l'explication de phénomènes naturels comme le rayonnement du corps noir ou les anomalies de l’orbite de la planète Mercure, ce qui posait un réel problème aux physiciens. Les tentatives effectuées pour comprendre et modéliser les phénomènes nouveaux auxquels on accédait à la fin du XIXᵉ siècle révisèrent en profondeur le modèle newtonien pour donner naissance à deux nouveaux ensembles de théories physiques."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D9%86%D9%83%D8%AF_%D8%A5%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Linkedin_screenshot.png","page_title":"لينكد إن","context_page_description":"لينكد إن ‏ هو موقع على شبكة الإنترنت يصنف ضمن الشبكات الاجتماعية، تأسس في ديسمبر كانون الأول عام 2002 وبدأ التشغيل الفعلي في 5 مايو 2003. يستخدم الموقع أساسًا كشبكة تواصل مهنية. في يونيو 2012 بلغ عدد المسجلين في الموقع أكثر من 176 مليون عضو من أكثر من 200 دولة.\\nالموقع متوفر بـ 24 لغة عالمية، منها العربية والإنجليزية والفرنسية والألمانية والإسبانية والبرتغالية والروسية والتركية واليابانية.\\nبحسب شركة كوانتكاست في شهر أكتوبر 2012 فإن لينكد إن يزوره شهريًا أكثر من 42.7 مليون زائر فريد من داخل أمريكا، وأكثر من 117.2 مليون زائر فريد من أنحاء العالم. في مايو 2011 بدأت أسهم لينكد بالتداول في بورصة نيويورك.\\nوفي 13 يونيو 2016 قامت شركة مايكروسوفت بالاستحواذ على لينكد إن في صفقة بلغت 26 مليار دولار."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BD%D0%BA%D0%B0%D1%81%D1%82%D0%B5%D0%BB%D1%8C-%D0%9A%D1%8E%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Bernkastel-Kues_jun_2018_%281%29.jpg","page_title":"Бернкастель-Кюс","context_page_description":"Бернкастель-Кюс — місто в Німеччині, розташоване в землі Рейнланд-Пфальц. Входить до складу району Бернкастель-Віттліх. Центр об'єднання громад Бернкастель-Кюс.\\nПлоща — 23,66 км². Населення становить 7065 ос."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Leonardo_da_Vinci_%281452-1519%29_-_The_Last_Supper_%281495-1498%29.jpg","page_title":"Картина","context_page_description":"Картина е произведение на изкуството, обикновено двумерен модел, двумерно изображение на предмет или човек върху хартия, дърво, камък, стъкло или текстил създадено\\nсъс сухи или мокри техники и изобразителни средства. Картината може да бъде живопис, графика или фотография и да е поставена в рамка."},{"page_url":"https://es.wikipedia.org/wiki/Ludovico_Carracci","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Carracci_Ludovico_Madonna_Bargellini.jpg","page_title":"Ludovico Carracci","context_page_description":"Ludovico Caracci fue un pintor y grabador italiano. Fue primo de los hermanos Agostino Carracci y Annibale Carracci, y el mayor del grupo.\\nSe formó junto a Prospero Fontana, viajando por Florencia, Parma, Mantua y Venecia. En sus primeras obras recibió la influencia de Federico Barocci. En 1584 colaboró junto a sus primos en la decoración del Palacio Fava.\\nEl estilo de Ludovico es menos clásico que el de sus primos más jóvenes, Agostino y Annibale. Como ellos, profundizó en el estudio directo de la naturaleza, especialmente a través de sus dibujos. Se inspiró fuertemente en la obra de Correggio y de la Escuela veneciana. Sin embargo, resta en su obra un residuo del estilo manierista que dominó la Escuela Boloñesa durante el siglo XVI. Ludovico mantuvo un equilibrio entre su formación manierista, su innata piedad y el naturalismo del trabajo de sus primos. Su pintura religiosa tiende al estímulo emocional.\\nCon la excepción de algunos viajes durante su aprendizaje y una breve visita a Roma en 1602, la carrera de Ludovico se desarrolló enteramente en Bolonia. Al alborear el siglo XVII, perdió contacto con las novedades que otros pintores boloñeses incorporaron a su estilo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D0%B9_%D1%83%D1%81%D1%82%D1%80%D1%96%D0%B9_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Voznesenskiy_rayon_gerb.png","page_title":"Адміністративний устрій Миколаївської області","context_page_description":"Адміністративний поділ Миколаївської області: 19 адміністративних районів, 9 міст, у тому числі 5 — обласного підпорядкування, 17 селищ міського типу, 821 сільських населених пунктів. Найбільші міста: Миколаїв, Первомайськ, Южноукраїнськ, Вознесенськ. Адміністративний центр — місто Миколаїв.\\nМиколаївська область була утворена 22 вересня 1937 року. Її площа становить 24,5 тис. км². Чисельність населення — 1 млн. 262 тис. осіб, в тому числі міського населення — 835 тис. осіб, сільського — 427,8 тис. осіб. Щільність населення — 51,3 чол. на км²."},{"page_url":"https://it.wikipedia.org/wiki/Richard_Wagner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Richard_Wagner%2CWien%2C1862.jpg","page_title":"Richard Wagner","context_page_description":"Wilhelm Richard Wagner è stato un compositore, poeta, librettista, filosofo, regista teatrale, direttore d'orchestra e saggista tedesco.\\nCitato a volte nei testi in lingua italiana come Riccardo Wagner, è riconosciuto come uno dei più importanti musicisti di ogni epoca, in particolare del romanticismo. Wagner è soprattutto noto per la riforma del teatro musicale. Diversamente dalla maggioranza degli altri compositori di opera lirica, Wagner, autodidatta, scrisse sempre da sé il libretto e la sceneggiatura per i suoi lavori. Le composizioni di Wagner, in particolare quelle del suo ultimo periodo, sono rilevanti per la loro tessitura contrappuntistica, il ricco cromatismo, le armonie, l'orchestrazione e per l'uso della tecnica del Leitmotiv: temi musicali associati a persone, luoghi o sentimenti, ed inoltre fu il principale precursore del linguaggio musicale moderno: l'esasperato cromatismo del Tristano avrà infatti un effetto fondamentale nello sviluppo della musica classica. Egli trasformò il pensiero musicale attraverso la sua idea di Gesamtkunstwerk, sintesi delle arti poetiche, visuali, musicali e drammatiche."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D9%8A%D8%A8%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Saipem12000.jpg","page_title":"سايبم","context_page_description":"سايپم س پ أ، هي شركة مقاولات نفط وغاز ايطالية. وهي فرع من شركة الطاقة الايطالية إني، والتي تملك حوالي 43% من أسهم سايپم. والشركة لها تعاقدات لتصميم وبناء خطوط أنابيب متعددة، ومنها التيار الأزرق، گرينستريم، التيار الشمالي، التيار الجنوبي."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%9F%E0%A5%8B%E0%A4%99%E0%A5%8D%E0%A4%97%E0%A4%BE%E0%A4%B0%E0%A4%BF%E0%A4%B0%E0%A5%8B_%E0%A4%B0%E0%A4%BE%E0%A4%B7%E0%A5%8D%E0%A4%9F%E0%A5%8D%E0%A4%B0%E0%A4%BF%E0%A4%AF_%E0%A4%A8%E0%A4%BF%E0%A4%95%E0%A5%81%E0%A4%9E%E0%A5%8D%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/New_Zealand_relief_map.jpg","page_title":"टोङ्गारिरो राष्ट्रिय निकुञ्ज","context_page_description":"टोङ्गारिरो राष्ट्रिय निकुञ्ज न्युजिल्याण्डमा अवस्थित राष्ट्रिय निकुञ्ज हो । यसको क्षेत्रफल ७९५.९८ वर्ग किलोमिटर रहेको छ । यो राष्ट्रिय निकुञ्ज सन् १९९० मा युनेस्को विश्व सम्पदा क्षेत्रको सूचीमा परेको थियो ।"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CF%80%CF%81%CE%BF%CE%AD%CE%B4%CF%81%CF%89%CE%BD_%CF%84%CE%B7%CF%82_%CE%92%CF%81%CE%B1%CE%B6%CE%B9%CE%BB%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Afonso_Pena.jpg","page_title":"Κατάλογος προέδρων της Βραζιλίας","context_page_description":"Ο Πρόεδρος της Βραζιλίας είναι ο αρχηγός κράτους και κυβέρνησης στη χώρα του.\\nΑκολουθεί κατάλογος προέδρων."},{"page_url":"https://es.wikipedia.org/wiki/Jandun","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Jandun_%28Ardennes%29_mairie.JPG","page_title":"Jandun","context_page_description":"Jandun es una población y comuna francesa, en la región de Champaña-Ardenas, departamento de Ardenas, en el distrito de Charleville-Mézières y cantón de Signy-l'Abbaye."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%88%D9%84_%D9%87%D9%8A%D9%81%D8%B1%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Paul_Heffernan.jpg","page_title":"بول هيفرنان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبول هيفرنان لاعب كورة قدم من جمهورية ايرلاندا."},{"page_url":"https://es.wikipedia.org/wiki/Castillo_de_Canillas_de_Esgueva","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/CanillasDeEsgueva20110907174759P1130164.jpg","page_title":"Castillo de Canillas de Esgueva","context_page_description":"El Castillo de Canillas de Esgueva está situado en el municipio del mismo nombre, en la provincia de Valladolid. En la actualidad sólo quedan dos solitarios cubos de las esquinas de lo que fue la torre del homenaje."},{"page_url":"https://en.wikipedia.org/wiki/Chevrolet_400","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Chevrolet_400_1962.jpg","page_title":"Chevrolet 400","context_page_description":"The Chevrolet 400 was a compact car made by Chevrolet in Argentina from 1962 to 1974. The \\"400\\" was General Motors's reply to Ford and Chrysler after those companies introduced the first compact cars to Argentina, the Ford Falcon and Valiant II respectively.\\nThe \\"400\\" was based on the Chevrolet model known in United States as Chevy II. Only the 4-door sedan version was manufactured in the country, although U.S. versions included a complete line of body styles, including a hardtop coupe, convertible coupe, 2-door sedan, and station wagon."},{"page_url":"https://pt.wikipedia.org/wiki/Gralha-cinzenta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Corvus_cornix_map.jpg","page_title":"Gralha-cinzenta","context_page_description":"A gralha-cinzenta é uma ave da família Corvidae"},{"page_url":"https://es.wikipedia.org/wiki/Chris_Roberts_(videojuegos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Chris_Roberts_GDC_2012.jpg","page_title":"Chris Roberts (videojuegos)","context_page_description":"Chris Roberts es un desarrollador, diseñador y programador de videojuegos. También se ha desempeñado como productor de cine. Es más conocido por haber creado la serie de videojuegos Wing Commander mientras trabajaba para Origin Systems.\\nActualmente se encuentra a la cabeza de Cloud Imperium Games Corporation, con la cual se encuentra desarrollando el ambicioso simulador espacial para Microsoft Windows, Mac y Linux, Star Citizen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A3%E3%83%AA%E3%83%94%E3%83%B3%E3%81%AE%E7%A5%9E%E8%A9%B1%E4%B8%8A%E3%81%AE%E7%94%9F%E3%81%8D%E7%89%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Beach_North_Mindoro_Philippines.jpg","page_title":"フィリピンの神話上の生き物","context_page_description":"フィリピンの神話上の生き物では、フィリピンの神話や伝説で語られる超自然的な存在について解説する。\\nフィリピンの伝承はギリシアやローマの神話と違って、秩序だったパンテオンに組織されることもなければ、一般に長編の叙事詩も持っておらず、そして歴史の領域に属しているものでもない。フィリピンの神話は田舎のフィリピン人たちの生活においていまだ生きた役割りを演じている。フィリピン中の田園地帯に広まっている無数の神話は、様々な種類の神話上の生き物を伝えている。これらの生き物に関する科学的根拠はないが、フィリピンの田舎でその存在を固く信じる人々が不足するということもまたない。この矛盾は時に、純粋で善良な人間だけがこうした生き物を見ることができるのだという説明で合理化される。"},{"page_url":"https://ar.wikipedia.org/wiki/HD_96167_b","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/PlanetQuest-HD96167b.png","page_title":"HD 96167 b","context_page_description":"HD 96167 b ‏ الذي يرمز له بالرمز HD 96167b، هو كوكب خارج المجموعة الشمسية، في كوكبة الباطية، يتبع HD 96167."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D0%BB%D1%96%D0%BF%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Perseus_of_Macedon_BM.jpg","page_title":"Калліппа","context_page_description":"Калліппа — наложниця македонського басилевса Персея, пізніше наложниця або дружина Афінея, сина пергамського басилевса Аттала I. Надала підтримку авантюристу Андріску, завдяки якій останній зміг знайти союзників серед фракійців і на короткий час стати басилевсом Македонії."},{"page_url":"https://az.wikipedia.org/wiki/X%C9%99lil_Rza_Ulut%C3%BCrk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Signature_of_Khalil_Rza_Uluturk.png","page_title":"Xəlil Rza Ulutürk","context_page_description":"Xəlil Rza Ulutürk — azərbaycanlı şair, tənqidçi, ədəbiyyatşünas, tərcüməçi, 1954-cü ildən Azərbaycan Yazıçılar Birliyinin üzvü, filologiya elmləri doktoru, Azərbaycanın əməkdar incəsənət xadimi, M.F.Axundov adına ədəbi mükafat laureatı, Azərbaycan Respublikasının xalq şairi. Ölümündən sonra \\"İstiqlal\\" ordeni ilə təltif olunub."},{"page_url":"https://tl.wikipedia.org/wiki/Silangang_Imperyong_Romano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/LatinEmpire2.png","page_title":"Silangang Imperyong Romano","context_page_description":"Ang Silangang Imperyong Romano, Imperyo ng Roma sa Silangan, o Imperyong Bisantino ay mga pangalang inilalapat sa Imperyo Romano noong Gitnang Panahon na may kabisera sa Constantinopla.\\nTinutukoy ito ng mga naninirahan dito pati ng mga kalapit na bansa bilang Imperyo Romano o Imperyo ng mga Romano o Romania. Ang mga emperador nito ang nagpatuloy ng pamamahala ng mga emperador Romano upang panatiliin ang tradisyon at kulturang Griyego-Romano.\\nSa daigdig Islamika, higit na kilala ito bilang روم‎. Dahil naman sa pananaig ng Griyego sa wika, sa kultura at sa buhay, kilala ito sa Kanluran o Europa noong mga panahong iyon bilang Imperium Graecorum, Imperyo ng mga Griyego. Ang pag-inog ng Imperyo Romano sa Silangan mula sa matandang Imperyo Romano ay isang proseso na nagmula noong ilipat ni Constantino ang kabisera sa Bizancio mula sa Nicomedia, Anatolia. Binansagan ang Bizancio ng bagong pangalan - ang Bagong Roma o Constantinopla - na nasa pasig ng Bosforus. Pagdatal ng siglo 7 sa ilalim ng paghahari ni Emperador Heraclio, ang mga reporma nito ang nagpabago sa lakas militar ng imperyo."},{"page_url":"https://vi.wikipedia.org/wiki/V%C6%B0%E1%BB%9Dn_qu%E1%BB%91c_gia_Pirin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Pirin_-_Gergiyski_ezera_-_IMG_4439.jpg","page_title":"Vườn quốc gia Pirin","context_page_description":"Vườn quốc gia Pirin ban đầu có tên là Vườn quốc gia Vihren là vườn quốc gia trải rộng trên khu vực diện tích 403,56 km², bao gồm phần lớn dãy núi Pirin ở phía tây nam Bulgaria. Nó là một trong số ba vườn quốc gia của Bulgaria, cùng với Vườn quốc gia Rila và Trung Balkan. Pirin được thành lập vào năm 1962 và đã nhiều lần được mở rộng. Nó cũng được UNESCO công nhận là Di sản thế giới vào năm 1983. Địa hình của vườn quốc gia thay đổi từ 950 đến 2.914 m tại Vihren, là đỉnh núi cao thứ hai tại Bulgaria và thứ ba trên bán đảo Balkan.\\nVề mặt hành chính, vườn quốc gia nằm tại tỉnh Blagoevgrad, là tỉnh xa nhất về phía tây nam của đất nước và thuộc các đô thị Bansko, Gotse Delchev, [Kresna, Razlog, Sandanski, Simitli và Strumyani. Tuy nhiên, trong lãnh thổ vườn quốc gia lại không có một khu vực đông dân cư nào. Hai khu bảo tồn thiên nhiên nằm trong ranh giới của Pirin là Bayuvi Dupki–Dzhindzhiritsa và Yulen. Bayuvi Dupki – Dzhindzhiritsa là một trong những khu bảo tồn lâu đời nhất Bulgaria khi nó được thành lập từ năm 1934 và là một Khu dự trữ sinh quyển thế giới được UNESCO công nhận. Toàn bộ vườn quốc gia thuộc hệ thống các khu vực bảo vệ tự nhiên của Liên minh Châu Âu Natura 2000."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D9%85%D8%B3_%D8%A5%D8%AA%D8%B4_%D9%83%D8%A7%D8%B1%D8%AA%D8%B1%D8%A7%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/James_H._Cartwright.jpg","page_title":"جيمس إتش كارترايت","context_page_description":"جيمس إتش كارترايت ‏ هو محامي وقاضي أمريكي، ولد في 1 ديسمبر 1842، وتوفي في 18 مايو 1924."},{"page_url":"https://cs.wikipedia.org/wiki/Ramesse_II.","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/RAMmummy.jpg","page_title":"Ramesse II.","context_page_description":"Ramesse II. Veliký Userma'atre' setepenre byl egyptským faraonem 19. dynastie, vládl v letech 1279–1213 př. n. l. Jeho otcem byl Sethi I., matkou Tuya. Narodil se ještě za vlády Haremheba, při korunovaci jeho děda Ramesse I. mu bylo pět let. Za vlády svého otce získal zkušenosti jak s vnitřní vládou v říši, tak i s obranou egyptského území, které zdědil po svých předcích. Na trůn nastoupil po smrti otce Setiho ve věku ~ 16 let. Vládl 66 roků a 4 měsíce, zemřel 27. června 1213 ve věku ~82 let ve svém městě Pi-Ramesse. Jeho mumie se zachovala a její antropologický výzkum byl v souladu s jeho udávaným věkem. Ve vyšším věku trpěl četnými záněty a bolestivými srůsty na páteři."},{"page_url":"https://es.wikipedia.org/wiki/La_Grange_(Carolina_del_Norte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/NCMap-doton-LaGrange.PNG","page_title":"La Grange (Carolina del Norte)","context_page_description":"La Grange es un pueblo ubicado en el condado de Lenoir en el estado estadounidense de Carolina del Norte. La localidad en el año 2000, tenía una población de 2.844 habitantes en una superficie de 5,9 km², con una densidad poblacional de 485.1 personas por km².​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%89%B9%E9%87%8C%E5%AE%89%E5%A4%AB_(%E6%84%9B%E9%81%94%E8%8D%B7%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tucker%27s_Barn_in_Triumph%2C_Idaho.jpg","page_title":"特里安夫 (愛達荷州)","context_page_description":"特里安夫是位於美國愛達荷州布萊恩郡的一個非建制地區。該地的面積和人口皆未知。"},{"page_url":"https://en.wikipedia.org/wiki/K%C3%BC%C3%A7%C3%BCk_H%C3%BCseyin_Pasha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/K%C3%BC%C3%A7%C3%BCk_H%C3%BCseyin_Pa%C5%9Fa.png","page_title":"Küçük Hüseyin Pasha","context_page_description":"Küçük Hüseyin Pasha, also known as Tayazade Damat Küçük Hüseyin Pasha, was an Ottoman statesman and admiral who was Kapudan Pasha from 11 March 1792 to 7 December 1803. He was a damat to the Ottoman dynasty after he married an Ottoman princess, Esma Sultan.\\nOf Georgian birth, Küçük Hüseyin Pasha commanded the Ottoman navy, first against Mediterranean pirates and again during the French Revolutionary Wars. He was one of the signatories of the Capitulation of Alexandria."},{"page_url":"https://de.wikipedia.org/wiki/Paul_Emile_R%C3%A9veill%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Paul_Emile_Marie_R%C3%A9veillere.jpg","page_title":"Paul Emile Réveillère","context_page_description":"Paul Emile Réveillère, war ein französischer Admiral und späterer Pazifist."},{"page_url":"https://hu.wikipedia.org/wiki/Mim%C3%B3zalevel%C5%B1_zsakaranda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Jacaranda_%28Jacaranda_mimosifolia%29_in_Hyderabad%2C_AP_W_IMG_6736.jpg","page_title":"Mimózalevelű zsakaranda","context_page_description":"A mimózalevelű zsakaranda az ajakosvirágúak rendjébe, ezen belül a szivarfafélék családjába tartozó faj."},{"page_url":"https://en.wikipedia.org/wiki/Ripley,_Derbyshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ripley%2C_Derbyshire.jpg","page_title":"Ripley, Derbyshire","context_page_description":"Ripley is a town in the Amber Valley borough of Derbyshire, England. It is the main administrative centre of the wider Amber Valley. It has been notable for its coal mining and mills."},{"page_url":"https://sw.wikipedia.org/wiki/Baghdad","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Baghdd.jpg","page_title":"Baghdad","context_page_description":"Baghdad ni mji mkuu pia mji mkubwa nchini Iraq. Iko kando la mto Tigris.\\nBaghdad iliundwa na Waarabu badala ya mji mkuu wa kale Ktesiphon katika karne ya 8. Ilikuwa mji mkuu wa dunia ya Uislamu wakati wa ukhalifa wa Abbasiyya. Mwaka 1258 mji uliharibiwa na jeshi la Mongolia.\\nBaadaye ilikuwa makao makuu ya utawala wa Mesopotamia katika Dola la Uturuki. Tangu 1921 ilitawaliwa na Uingereza pamoja na Iraq yote. Tangu 1936 ilikua mji mkuu wa Iraq kama nchi ya kujitegemea.\\nMji uliharibiwa na Vita ya Ghuba na vita ya wenyewe kwa wenywe nchini Iraq."},{"page_url":"https://en.wikipedia.org/wiki/Black_myotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Myotis_nigricans_map.png","page_title":"Black myotis","context_page_description":"The black myotis, is a vesper bat species from South and Central America.\\nIts body is dark brown/black. The head to body length, not including the tail, is about 5 cm. The black myotis is a tiny bat with a small pointed non-noseleaf snout. Its ears are pointy and triangular, and extremely sensitive. Its forearm-like wings have single claws while its hind feet have five, and its torso is covered in a short hair layer."},{"page_url":"https://en.wikipedia.org/wiki/Lajos_Kossuth","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Photo_of_Lajos_Kossuth.jpg","page_title":"Lajos Kossuth","context_page_description":"Lajos Kossuth de Udvard et Kossuthfalva was a Hungarian nobleman, lawyer, journalist, politician, statesman and Governor-President of the Kingdom of Hungary during the revolution of 1848–49.\\nWith the help of his talent in oratory in political debates and public speeches, Kossuth emerged from a poor gentry family into regent-president of Kingdom of Hungary. As the influential contemporary American journalist Horace Greeley said of Kossuth: \\"Among the orators, patriots, statesmen, exiles, he has, living or dead, no superior.\\"\\nKossuth's powerful English and American speeches so impressed and touched the famous contemporary American orator Daniel Webster, that he wrote a book about Kossuth's life. He was widely honoured during his lifetime, including in Great Britain and the United States, as a freedom fighter and bellwether of democracy in Europe. Kossuth's bronze bust can be found in the United States Capitol with the inscription: Father of Hungarian Democracy, Hungarian Statesman, Freedom Fighter, 1848–1849."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%AA%D8%A7%D8%B1%D9%87_%D9%85%DB%8C%D8%B3%D8%AA%D9%88_(%D9%86%D8%A7%D8%AD%DB%8C%D9%87_%D8%B3%D9%88%DB%8C%D8%AA%D8%A7%D9%88%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Star%C3%A9_M%C4%9Bsto_SY_CoA.jpg","page_title":"ستاره میستو (ناحیه سویتاوی)","context_page_description":"ستاره میستو (ناحیه سویتاوی) یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه سویتاوی واقع شده‌است. ستاره میستو ۲۴٫۷۳ کیلومتر مربع مساحت و ۱٬۰۰۶ نفر جمعیت دارد و ۴۱۸ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Lemuroidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Varecia_variegata_foot_with_toilet-claw.jpg","page_title":"Lemuroidea","context_page_description":"Los lémures son unos primates estrepsirrinos endémicos de la isla de Madagascar. Reciben su nombre por los lemures, fantasmas o espíritus de la mitología romana, debido a las estrepitosas vocalizaciones que emiten, sus ojos brillantes y los hábitos nocturnos de algunas de sus especies.\\nAunque a menudo se les confunda con primates ancestrales, los primates antropoides no evolucionaron de los lémures, sino de los omomíidos; aunque si comparten algunos rasgos morfológicos y de comportamiento con primates basales.\\nSu clasificación taxonómica es controvertida y depende de que concepto de especie se utilice. Incluso se discute la taxonomía de nivel más alto, y algunos expertos ubican a la mayor parte de los lémures en el infraorden Lemuriformes, mientras que otros prefieren que Lemuriformes contenga a todos los estrepsirrinos existentes, colocando a todos los lémures en la superfamilia Lemuroidea y a los lorísidos y galágidos en la superfamilia Lorisoidea.\\nLa hipótesis más extendida es que los lémures llegaron a Madagascar hace aproximadamente entre 62 y 65 Ma por rafting en algún momento en que las corrientes oceánicas favorecieron la dispersión hacia la isla."},{"page_url":"https://af.wikipedia.org/wiki/Kevin_Cheng","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/KevinCheng2007.jpg","page_title":"Kevin Cheng","context_page_description":"Kevin Cheng is 'n Amerikaanse akteur. Hy is bekend vir sy rolle in die rolprente Hong Kong Graffiti en Badges of Fury, en in die televisiereekse Scarlet Heart en Ip Man."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BB%E3%82%B0%E3%82%A6%E3%82%A7%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Segway_centaur%28135598182_4acfaaef24_o%29.jpg","page_title":"セグウェイ","context_page_description":"セグウェイ とは、アメリカの発明家ディーン・ケーメンを中心に開発され、Segway Inc.によって販売されている電動立ち乗り二輪車。\\n立ち乗りで、車輪が2つ並んだ「並行二輪車」の一種であるが、アクセルハンドルなどを備えず、操縦は乗り手が体重移動によって行うという特徴がある。バッテリーを搭載し電動で動く。#構造と制御"},{"page_url":"https://pl.wikipedia.org/wiki/Hunan_Awetisjan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Rus_Stamp_GSS-Avetisyan.jpg","page_title":"Hunan Awetisjan","context_page_description":"Hunan Awetisjan – radziecki wojskowy, starszy sierżant, odznaczony pośmiertnie Złotą Gwiazdą Bohatera Związku Radzieckiego."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%B1%E8%A5%BF%E7%9C%81%E6%B0%91%E4%BF%97%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/%E5%B1%B1%E8%A5%BF%E7%9C%81%E6%B0%91%E4%BF%97%E5%8D%9A%E7%89%A9%E9%A6%86.jpg","page_title":"山西省民俗博物馆","context_page_description":"山西省民俗博物馆位于山西省太原市迎泽区文庙巷40号。\\n2003年10月10日，原山西省博物馆更名为山西省民俗博物馆。"},{"page_url":"https://fr.wikipedia.org/wiki/Bisulfite","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Bisulfite-equilibrium-3D-balls.png","page_title":"Bisulfite","context_page_description":"Un bisulfite est un composé chimique contenant l'anion bisulfite, ou hydrogénosulfite selon l'appellation recommandée par l'IUPAC, de formule brute HSO₃⁻. Le bisulfite de sodium NaHSO₃ est un exemple de bisulfite. Il ne doit pas être confondu avec l'ion disulfite de formule S₂O₅²⁻."},{"page_url":"https://no.wikipedia.org/wiki/Ingeborg_Hungnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Toner_fra_Romsdal.jpg","page_title":"Ingeborg Hungnes","context_page_description":"Ingeborg Hungnes er en norsk sangerinne og skuespiller, kjent fra flere opptredener på riksdekkende fjernsyn, samt plateutgivelser.\\nEtter oppvekst i Molde tok hun utdannelse ved Norges musikkhøgskole og Østlandets Musikkonservatorium. På 1980-tallet hadde hun flere roller ved Nationaltheatret. Hun fikk 3.-plass\\ni Melodi Grand Prix 1989 med \\"Et lite lys\\". I Melodi Grand Prix 1990 ble hun uten plassering i gruppen Damer og Herrer som sang \\"Østenfor Sol\\". Utover 90-tallet\\nhadde hun roller ved Teatret Vårt i Molde.\\nI 1998 hadde hun ledende rolle på Kjell Habbestads Noahs Draum.\\nDet var Hungnes som var Beate Bø i Hotel Cæsar.\\nI 2004 var hun sentral i Lars Klevstrands Nomadesangar.\\nIngeborg Hungnes er gift med komikeren Øystein Bache. De har tre barn."},{"page_url":"https://de.wikipedia.org/wiki/Mammillaria_sheldonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Succu_Mammillaria_swinglei_01.jpg","page_title":"Mammillaria sheldonii","context_page_description":"Mammillaria sheldonii ist eine Pflanzenart aus der Gattung Mammillaria in der Familie der Kakteengewächse. Das Epitheton der Art ehrt den US-Amerikaner Charles Alexander Sheldon, Naturliebhaber und Besitzer eines Bergbauunternehmens in Mexiko."},{"page_url":"https://nl.wikipedia.org/wiki/Isidorus_Jonkers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Voorgevel_%282001%29.jpg","page_title":"Isidorus Jonkers","context_page_description":"Isidorus Jonkers was een Nederlandse likeurstoker en distillateur. Hij was tevens oprichter en directeur van het Nationaal Likeurmuseum in Hilvarenbeek."},{"page_url":"https://it.wikipedia.org/wiki/Cantoni_della_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Mapa_de_Costa_Rica_%28cantones_y_distritos%29.svg","page_title":"Cantoni della Costa Rica","context_page_description":"I cantoni della Costa Rica sono il secondo livello di divisione amministrativa di questo paese, che è composto da sette province suddivise a loro volta in 82 cantoni, i quali sono ulteriormente suddivisi in distretti.\\nUna caratteristica politicamente importante dei cantoni consiste nell'essere l'unica divisione amministrativa in Costa Rica che possieda un governo locale sotto la forma del comune: ognuna di esse infatti ha un proprio sindaco e diversi rappresentanti del cantone, tutti scelti attraverso elezioni comunali.\\nDai 14 cantoni originali del 1848, il numero è aumentato gradualmente, suddividendo i cantoni già esistenti. La legge n. 4366 del 19 agosto 1969 sulla divisione amministrativa della Costa Rica, infatti, stabilisce la possibilità di creare un nuovo cantone qualora lo stesso raggiunga almeno l'uno per cento della popolazione totale della repubblica. L'ultimo cantone istituito è quello di Río Cuarto, il 30 di marzo, 2017."},{"page_url":"https://ca.wikipedia.org/wiki/Hist%C3%B2ria_del_ferrocarril_a_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/La_antiga_locomotora_el%C3%A8ctrica_E.1_del_cremallera_de_N%C3%BAria_reposa_a_dalt_de_tot_de_la_Vall.jpg","page_title":"Història del ferrocarril a Catalunya","context_page_description":"La història del ferrocarril a Catalunya cobreix el desenvolupament del transport en tren a Catalunya, des dels primers projectes que, emulant Anglaterra, volien implantar el ferrocarril al país i que van donar lloc al primer viatge en tren a la península Ibèrica entre Barcelona i Mataró el 1848, fins a l'actualitat."},{"page_url":"https://de.wikipedia.org/wiki/Kirche_von_Pargas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Pargas_church_3_AB.jpg","page_title":"Kirche von Pargas","context_page_description":"Die Kirche von Pargas ist eine mittelalterliche Steinkirche in Pargas, einer im Schärenmeer vor der Südwestküste Finnlands gelegenen Stadt. Sie stammt aus der Mitte des 15. Jahrhunderts und wird heute von der schwedisch- und finnischsprachigen evangelisch-lutherischen Kirchengemeinde Pargas genutzt."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%8E%E6%98%8E%E6%96%B0%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%E8%87%BA%E4%B8%AD%E5%B8%82%E8%AD%A6%E5%AF%9F%E5%B1%80%E7%AC%AC%E5%9B%9B%E5%88%86%E5%B1%80%E9%BB%8E%E6%98%8E%E6%B4%BE%E5%87%BA%E6%89%80.jpg","page_title":"黎明新村","context_page_description":"黎明新村是位於臺中市南屯區的官方社區，是臺灣省政府興建的第三個大型省府新市鎮，作為當時省府員工住宅及辦公區。範圍東至黎明路二段、南至公益路二段、西至龍富路五段、北靠近市政南一路，鄰近七期重劃區。學區為黎明國中與黎明國小。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D8%B3%D8%AA%D9%8A%D9%86%D9%8A%D9%86%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Gro%C3%9Fweiher-Kirche-Sankt-Stefan.jpg","page_title":"موستينينغ","context_page_description":"بَلدَة مُوستِينينغٌ هي بَلدَة أَلمانِيَّة في مِنطَقَة دِينغولفينغ-لَانْدآو التَّابِعة لمُحافظة باڤارِيا السُّفلى في وِلاَية باڤارِيا في جُمهُوريَّة أَلمَانيَا الاِتّحاديّة بمِساحة تُقَدَّر بحَوالَي 70 كم²."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%A9pha%C3%AFst%C3%A9ion","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Hephaistos_temple_2006.jpg","page_title":"Héphaïstéion","context_page_description":"Le temple d'Héphaïstos et Athéna Ergané, également connu sous le nom d'Héphaïstéion ou — à tort — de Théséion, est un temple dorique périptère, situé au nord-ouest de l'agora d'Athènes, en haut de la colline appelée Colonos Agoraios. Du VIIᵉ siècle jusqu'en 1834, il a servi d'église orthodoxe grecque sous le nom de Saint-Georges Akamatès."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A9%AC%E5%85%8B%E7%BD%97%E6%AF%94%E4%B9%8C%E6%96%AF%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Macrobius_sattelite_craters_map.jpg","page_title":"马克罗比乌斯环形山","context_page_description":"马克罗比乌斯环形山是位于月球正面东北高地区的一座大撞击坑，约形成于早雨海世，其名称取自古罗马作家、语言学家、新柏拉图主义哲学家暨音乐理论家安布罗·奥勒留·狄奥多西·马克罗比乌斯，1935年被国际天文学联合会批准接受。"},{"page_url":"https://no.wikipedia.org/wiki/Ameland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Ameland_Kapiteinswoning.jpg","page_title":"Ameland","context_page_description":"Ameland er ei av De frisiske øyer i Nederland. Ameland er en egen kommune. Nord for Ameland ligger Nordsjøen, sør ligger Vadehavet og den nederlandske kysten."},{"page_url":"https://de.wikipedia.org/wiki/Reichsapfel_(Reichskleinodien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Heinrich_III..jpg","page_title":"Reichsapfel (Reichskleinodien)","context_page_description":"Der Reichsapfel des Heiligen Römischen Reiches gehört zu den Reichskleinodien. Als Attribut des römischen Gottes Jupiters war der Erdball in der Hand des Kaisers bzw. des römisch-deutschen Königs als künftigen Kaisers Sinnbild der Weltherrschaft.\\nZusammen mit der Krone und dem Zepter wurde er dem König während der Krönungszeremonie überreicht. Mit diesen drei Insignien wurden sehr häufig Könige und Kaiser auf Bildern dargestellt. Als traditioneller Bestandteil der Insignien eines Herrschers hat der Reichsapfel, der sich seit 1800 in der Wiener Schatzkammer befindet, aber nie die konkrete, auf das Einzelstück bezogene Bedeutung erlangt, wie beispielsweise die Reichskrone, die Heilige Lanze oder das Reichsschwert."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D1%8D%D1%80%D1%8B_%D0%93%D1%96%D0%BB%D0%BC%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/StateLibQld_1_100448.jpg","page_title":"Мэры Гілмар","context_page_description":"Мэры Гілмар — аўстралійская паэтэса. Захапіўшыся ідэямі сацыяліста-утапіста У. Лэйна, Гілмар удзельнічала ў заснаванні камуны «Новая Аўстралія» у Парагваі. На працягу 23 гадоў працавала ў прафсаюзнай газеце «Worker». Пісала пра жаночую і мацярынскую любоў, пра радасці і хваляванні сямейнага жыцця. Паэтычныя зборнікі: «Гарачае сэрца», «Крытая павозка», «Дзікі лебедзь», «Пад Уілгамі», «За радзіму Аўстралію» і інш."},{"page_url":"https://en.wikipedia.org/wiki/Jud_Daley","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Jud_Daley.jpg","page_title":"Jud Daley","context_page_description":"Judson Lawrence Daley was a professional baseball outfielder and manager. He played two seasons in Major League Baseball with the Brooklyn Dodgers. Daley was 5 feet, 8 inches tall and weighed 172 pounds."},{"page_url":"https://sv.wikipedia.org/wiki/Kylsk%C3%A5psmagnet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Fridge_Magnet_Halbach.svg","page_title":"Kylskåpsmagnet","context_page_description":"Kylskåpsmagnet är en magnet som används för att fästa saker på ett kylskåp. Då kylskåpet är en plats som de flesta medlemmarna i en familj går till väljer man i många familjer att fästa viktiga meddelanden, scheman, barnteckningar eller liknande på detta och för detta används vanligen magneter. Dessa kan ha olika utformning och likna små prydnadsföremål.\\nUnder slutet av 1990-talet blev det vanligt med små kylskåpsmagneter i form av ord som man kunde använda för att skapa kylskåpspoesi.\\nMånga kylskåpsmagneter är magnetiska bara på ena sidan. Det åstadkommer man med en så kallad \\"Halbach array\\". Alla magnetiska nord- och sydpoler finns på samma sida, ungefär som många hästskomagneter bredvid varandra."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A5%E0%A4%BF%E0%A4%AF%E0%A5%8B%E0%A4%A1%E0%A5%8B%E0%A4%B0_%E0%A4%B0%E0%A5%82%E0%A4%9D%E0%A4%B5%E0%A5%87%E0%A4%B2%E0%A5%8D%E0%A4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/President_Theodore_Roosevelt%2C_1904.jpg","page_title":"थियोडोर रूझवेल्ट","context_page_description":"थियोडोर रूझवेल्ट हे अमेरिकेचे २६ वे राष्ट्राध्यक्ष होते."},{"page_url":"https://et.wikipedia.org/wiki/Lauenbr%C3%BCck","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Lauenbr%C3%BCck_in_ROW.svg","page_title":"Lauenbrück","context_page_description":"Lauenbrück on vald Saksamaal Alam-Saksimaal Rotenburgi kreisis.\\nValla pindala on 21,89 km². 31. detsembril 2017 elas seal 2276 inimest.\\nLauenbrück kuulus 1180. aastal rajatud vürstlikku Verdeni piiskopkonda. 1648. aastal muudeti vürstlik piiskopkond Verdeni vürstkonnaks, mida valitseti esialgu personaalunioonis Rootsi krooniga – mille katkestas Taani okupatsioon – ja 1715. aastast Hannoveri krooniga. 1807. aastal annekteeris üürike Vestfaali kuningriik vürstkonna, 1810. aastal annekteeris selle Prantsusmaa. 1813. aastal anti vürstkond tagasi Hannoveri kuurvürstkonnale, mis – pärast Hannoveri kuningriigiks ülendamist 1814. aastal – liidendas vürstkonna reaaluniooni ning vürstlikust territooriumist, sealhulgas Lauenbrückist, sai uue 1823. aastal loodud Stade regiooni osa."},{"page_url":"https://en.wikipedia.org/wiki/Lun%C3%A9ville","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/TheatreLuneville.jpg","page_title":"Lunéville","context_page_description":"Lunéville is a commune in the Meurthe-et-Moselle department in France.\\nIt is a subprefecture of the department and lies on the Meurthe River at its confluence with the Vezouze."},{"page_url":"https://sv.wikipedia.org/wiki/Campanula_hercegovina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Campanula_hercegovina.jpg","page_title":"Campanula hercegovina","context_page_description":"Campanula hercegovina är en klockväxtart som beskrevs av Árpád von Degen och Franz Fiala. Campanula hercegovina ingår i släktet blåklockor, och familjen klockväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Othman_Jerandi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Othman_Jerandi.jpg","page_title":"Othman Jerandi","context_page_description":"Othman Jerandi, également orthographié Othman Jarandi, né à Hammam Lif, est un diplomate tunisien qui occupe le poste de ministre des Affaires étrangères au sein du gouvernement Ali Larayedh."},{"page_url":"https://fr.wikipedia.org/wiki/Gauche_Wood_Cemetery_Villers_Guislain","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Villers-Guislain_Gauche_Wood_Cemetery_3.jpg","page_title":"Gauche Wood Cemetery Villers Guislain","context_page_description":"Le cimetière « Gauche Wood Cemetery » est l'un des 5 cimetières militaires de la Première Guerre mondiale situé à Villers-Guislain. Les 4 autres cimetières sont Villers-Guislain Communal Cemetery, Meath Cemetery, Targelle Ravine British Cemetery, Villers Hill British Cemetery."},{"page_url":"https://en.wikipedia.org/wiki/Vittore_Trincavelli","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Vettore_Trincavelli.jpg","page_title":"Vittore Trincavelli","context_page_description":"Vittore Trincavelli was an eminent Italian physician, but is most famous as the editor of some of the first editions of the Greek classics."},{"page_url":"https://fi.wikipedia.org/wiki/Concord","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Downtown_Concord%2C_NH.JPG","page_title":"Concord","context_page_description":"Concord on New Hampshiren osavaltion pääkaupunki Yhdysvalloissa. Vuonna 2010 kaupungissa oli 42 695 asukasta. Se sijaitsee ikimuistoisella intiaanien asuinpaikalla Merrimack-joen rannalla. Kaupunki on perustettu vuonna 1727. Siitä tuli osavaltion pääkaupunki 1808 keskeisen sijaintinsa ansiosta.\\nKaupungissa on planetaario ja vuonna 1973 perustettu lakioppilaitos, joka oli aiemmin nimetty 1850-luvun Yhdysvaltain presidentin Franklin Piercen mukaan mutta on vuodesta 2010 toiminut New Hampshiren yliopiston oikeustieteellisenä tiedekuntana nimellä University of New Hampshire School of Law."},{"page_url":"https://en.wikipedia.org/wiki/Carnegie_Free_Library_(McKeesport,_Pennsylvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Carnegie_Library_McKeesport_2018b.jpg","page_title":"Carnegie Free Library (McKeesport, Pennsylvania)","context_page_description":"The Carnegie Free Library in McKeesport, Pennsylvania, is a Public Library built with funds from Pittsburgh steel magnate Andrew Carnegie. McKeesport is located about 15 miles up the Monongahela River from Pittsburgh. The grant for this library was commissioned April 2, 1899. Out of approximately 1,688 libraries funded by Carnegie in America, McKeesport's was the 12th be commissioned. It was listed on the National Register of Historic Places in 1980."},{"page_url":"https://es.wikipedia.org/wiki/Cultura_de_la_Antigua_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Jean-Leon_Gerome_Pollice_Verso.jpg","page_title":"Cultura de la Antigua Roma","context_page_description":"La cultura de la Antigua Roma fue el resultado de un importante intercambio entre civilizaciones diferentes: la cultura griega y las culturas desarrolladas en Oriente, que contribuyeron a formar la cultura y el arte de los romanos. Uno de los factores que más contribuyó a la universalización de la cultura romana, que de pronto fue la de todo el imperio, fue el uso del latín como lengua común de todos los pueblos sometidos a Roma."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%A8%E5%B1%8B%E5%B9%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/R438%2C492_Koyadaira_intersection.jpg","page_title":"木屋平","context_page_description":"木屋平は、徳島県美馬市の大字。2010年10月1日現在の人口は819人、世帯数は399世帯。郵便番号は〒777-0301〜777-0303。"},{"page_url":"https://fr.wikipedia.org/wiki/Carabao_(groupe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Yuenyong_Opakul.jpg","page_title":"Carabao (groupe)","context_page_description":"Carabao est un groupe de rock thaïlandais extrêmement populaire en Thaïlande et dans les autres pays d'Asie du Sud-Est. Il a été formé en 1976 aux Philippines. Le nom Carabao est la transcription de celui du buffle d'eau domestique en tagalog.\\nIls sont connus pour leurs « plaeng peua chiwit », ce que l'on pourrait traduire par \\"chansons de la vie\\" ; d'ailleurs MTV Asia les nomme les \\"vétérans\\".\\nCe style de musique contestataire apparaît dans les années 1970 lors des mouvements de protestations politiques et sociales, surtout grâce au Caravan Band composé de Surachai Janthimathon surnommé Nga Caravan, Wirasak Sunthonsi, Thongkran Tana, Phongthep Kradonchamnan et Mongkhon Utok.\\nIl y a aussi quelques groupes moins connus : Hope, Hammer, Susu, Marihuana.\\nLes Carabao ont réussi à mélanger le style folk/acoustique des chansons \\"peua chiwit\\" avec d'autres styles de musique thaïlandaise et aussi avec le rock occidental, ce qui leur a attribué le surnom de \\"rockers ethniques\\" ou de \\"Rolling Stones de l'Asie\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Carabao_(groupe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Yuenyong_Opakul.jpg","page_title":"Carabao (groupe)","context_page_description":"Carabao est un groupe de rock thaïlandais extrêmement populaire en Thaïlande et dans les autres pays d'Asie du Sud-Est. Il a été formé en 1976 aux Philippines. Le nom Carabao est la transcription de celui du buffle d'eau domestique en tagalog.\\nIls sont connus pour leurs « plaeng peua chiwit », ce que l'on pourrait traduire par \\"chansons de la vie\\" ; d'ailleurs MTV Asia les nomme les \\"vétérans\\".\\nCe style de musique contestataire apparaît dans les années 1970 lors des mouvements de protestations politiques et sociales, surtout grâce au Caravan Band composé de Surachai Janthimathon surnommé Nga Caravan, Wirasak Sunthonsi, Thongkran Tana, Phongthep Kradonchamnan et Mongkhon Utok.\\nIl y a aussi quelques groupes moins connus : Hope, Hammer, Susu, Marihuana.\\nLes Carabao ont réussi à mélanger le style folk/acoustique des chansons \\"peua chiwit\\" avec d'autres styles de musique thaïlandaise et aussi avec le rock occidental, ce qui leur a attribué le surnom de \\"rockers ethniques\\" ou de \\"Rolling Stones de l'Asie\\"."},{"page_url":"https://uk.wikipedia.org/wiki/134","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ponte_St._Angelo.jpg","page_title":"134","context_page_description":"134 рік — невисокосний рік, що починається в п'ятницю за григоріанським календарем. Це 134 рік нашої ери, 134 рік 1 тисячоліття, 34 рік II століття, 4 рік 4-го десятиліття II століття, 5 рік 130-х років."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%80%D1%96%D0%B4%D0%BB%D0%B0%D0%BD%D0%B4_(%D0%91%D1%80%D0%B0%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Wappen_Friedland_%28Lkr._Oder-Spree%29.png","page_title":"Фрідланд (Бранденбург)","context_page_description":"Фрідланд — місто в Німеччині, розташоване в землі Бранденбург. Входить до складу району Одер-Шпре.\\nПлоща — 173,21 км². Населення становить 3017 ос."},{"page_url":"https://en.wikipedia.org/wiki/Port_St._Lucie,_Florida","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/St._Lucie_County_Florida_Incorporated_and_Unincorporated_areas_Port_St._Lucie_Highlighted.svg","page_title":"Port St. Lucie, Florida","context_page_description":"Port St. Lucie is a city in St. Lucie County, Florida, United States. It is the most populous municipality in the county with a population of 164,603 at the 2010 census due to its rapid growth during the 2000s. It is located 125 miles southeast of Orlando. In 2019, the United States Census Bureau estimated the city's population at 201,846. The Port St. Lucie Metropolitan Area includes the counties of St. Lucie and Martin and as of 2016 had an estimated population of 465,208. Port St. Lucie is also contained within the Miami - Fort Lauderdale - Port St. Lucie Combined Statistical Area with an estimated population of 6,832,588."},{"page_url":"https://de.wikipedia.org/wiki/Labeobarbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/The_fishes_of_the_Nile_%28Pl._XXXIV%29_%286961612141%29.jpg","page_title":"Labeobarbus","context_page_description":"Labeobarbus ist eine Gattung mittelgroßer bis großer afrikanischer Karpfenfische. Der Gattungsname setzt sich aus Labeo und Barbus zusammen und nimmt Bezug auf die Ähnlichkeit von Labeobarbus mit den beiden anderen Karpfenfischgattungen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B1%D0%B1%D0%B0%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%B8%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Abbaye_de_Oudkerken.02.JPG","page_title":"Аббатское пиво","context_page_description":"Аббатское пиво — общее название пива в стиле бельгийский крепкий эль, сваренного в траппистском стиле, но произведённого не траппистскими или коммерческими пивоварнями."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_U.S._state_trees","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Acer_saccharum_foliage.jpg","page_title":"List of U.S. state trees","context_page_description":"This is a list of U.S. state trees."},{"page_url":"https://et.wikipedia.org/wiki/Glaucus_atlanticus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Glaucus_atlanticus_1_cropped.jpg","page_title":"Glaucus atlanticus","context_page_description":"Glaucus atlanticus on kõhtjalgsete klassi kuuluv loomaliik.\\nGlaucus atlanticus on veelise eluviisiga üsna väike hermafrodiitne loom, kes on levinud Ida- ja Lõuna-Aafrika vetes, Austraalia rannikul, aga keda leidub ka Euroopa vetes, isegi Florida, Panama ja Hawaii lähistel.\\nGlaucus atlanticus suudab alla neelata kuni 30-meetriste kombitsatega meduusi meripõie. Arvatakse, et Glaucus atlanticus on immuunne meripõie toksiini sisaldavatele osadele ning kogub ja kontsentreerib neid nii, et meripõie eritatud osad tapavad meripõie."},{"page_url":"https://nl.wikipedia.org/wiki/Ni%C5%BEbor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Nizbor_zamek.JPG","page_title":"Nižbor","context_page_description":"Nižbor is een Tsjechische gemeente in de regio Midden-Bohemen, en maakt deel uit van het district Beroun. Nižbor telt 1622 inwoners en ligt op 8 kilometer afstand van de districtshoofdstad Beroun.\\nNižbor is sinds 1903 de vestigingsplaats van een grote fabriek van Boheems kristal."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B1%D8%AA%D8%B6%DB%8C_%D8%A7%D9%85%DB%8C%D8%B1%DB%8C_%D8%A7%D8%B3%D9%81%D9%86%D8%AF%D9%82%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Morteza_Amiri_Esfandaghe_at_the_Meeting_with_Ayatollah_Khamenei_%2821%29.jpg","page_title":"مرتضی امیری اسفندقه","context_page_description":"مرتضی امیری اسفندقه متولد ۱۳۴۵ در شهر تهران، شاعر ایرانی است. او بابت سروده‌های خود، نامزد یا برنده جایزه‌هایی چون کتاب سال، قلم زرین و کتاب فصل شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Mars_Exploration_Rover","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Parachute1.jpg","page_title":"Mars Exploration Rover","context_page_description":"Die Mars Exploration Rover Mission 2003 war eine Raumfahrtmission der NASA, die im Jahr 2003 mit dem Start von zwei Trägerraketen zum Transport zweier Rover – Spirit und Opportunity – begann, um die Oberfläche und Geologie des Mars zu erforschen. Die Mission war Teil des Mars-Exploration-Programms der NASA, welches bereits drei erfolgreiche Raumsonden beinhaltet: Die zwei Viking-Lander von 1976 und Pathfinder von 1997.\\nZiel der Mission war es, zwei automatische Geländewagen unabhängig voneinander auf dem Mars abzusetzen, die geologischen Bedingungen dort zu erforschen und nach Hinweisen von Wasser zu suchen, dessen Vorhandensein als Grundvoraussetzung für Leben auf dem Mars gilt. Jeder Rover selbst war solarbetrieben und mit Instrumenten ausgerüstet, um die Marsoberfläche zu fotografieren und Steine zu analysieren. Aufgrund der Entfernung zur Erde war keine direkte Steuerung der Rover möglich, deshalb war die Software-Steuerung der Fahrzeuge intelligent genug, automatisch Ziele anzufahren und Hindernissen auszuweichen. Obwohl die Mission jeweils nur auf 90 Sols ausgelegt war, funktionierte Opportunity bis zum 12. Juni 2018. Spirits Mission wurde am 25."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D8%AC%D9%88%D9%86%D8%B3%D9%88%D9%86_(%D9%85%D8%B5%D9%88%D8%B1%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Childhood-by-belle-johnson.jpg","page_title":"بيل جونسون (مصورة)","context_page_description":"بيل جونسون ‏ هي مصورة أمريكية، ولدت في 4 أغسطس 1864 في ميندوتا في الولايات المتحدة، وتوفيت في 19 يوليو 1945 في Monroe City في الولايات المتحدة."},{"page_url":"https://de.wikipedia.org/wiki/Brukenthal%E2%80%99sche_Sommerresidenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Brukenthal%27sche_Sommerresidenz_Seitenfl%C3%BCgel.jpg","page_title":"Brukenthal’sche Sommerresidenz","context_page_description":"Die Brukenthal’sche Sommerresidenz ist eine spätbarocke Schlossanlage in Siebenbürgen im heutigen Rumänien. Sie wurde zwischen 1757 und 1770 im Auftrag von Samuel von Brukenthal, dem späteren Gubernator von Siebenbürgen, in Freck errichtet und orientiert sich architektonisch an barocken österreichischen Vorbildern. Das Schloss mit seinen Gärten ist die einzige erhaltene barocke Anlage dieser Art in ganz Rumänien, ist jedoch heute in einem stark renovierungsbedürftigen Zustand."},{"page_url":"https://gl.wikipedia.org/wiki/Bratislava","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/%C5%A0koda-30T.JPG","page_title":"Bratislava","context_page_description":"Bratislava é a capital e maior cidade de Eslovaquia. Ten 432.864 habitantes e está situada á beira do Danubio, preto das fronteiras con Austria e Hungría. Áchase a uns 60 km de Viena, o que converte a estas cidades nas capitais de país máis próximas do mundo.\\nA cidade ten a maior densidade de poboación de Europa central. Os montes Cárpatos comezan no territorio ocupado pola cidade. Bratislava é a sede do parlamento e goberno eslovacos e conta cunha grande oferta artística, cultural e educativa. Nos últimos anos está sufrindo unha gran transformación, tanto a nivel de recuperación de edificios emblemáticos, como é a mellora das deterioradas infraestruturas herdadas do antigo réxime comunista. A zona máis interesante dende o punto de vista monumental e artístico é a cidade vella, colorista e acolledora, onde se pode gozar dunha gran variedade de comercios e servizos, aínda que os prezos son sensiblemente superiores a outras zonas da cidade, e por suposto duplican ou triplican os do interior do país. Mención especial merece tamén o porto fluvial, onde se poden ver barcos mercantes e unha grande actividade."},{"page_url":"https://de.wikipedia.org/wiki/Emil_Becks","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Oberligaaufsteiger_Bayer_04.jpg","page_title":"Emil Becks","context_page_description":"Emil „Bubi“ Becks war ein deutscher Fußballspieler. Als Spieler von Rot-Weiß Oberhausen erzielte er 1948/49 zehn Tore in 19 Einsätzen in der Oberliga West, ehe er in der Saison darauf als Torschützenkönig zu Bayer 04 Leverkusen wechselte. Für die Werkself war er nach seiner Karriere auch als Spielebeobachter tätig."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%82%D0%BB%D1%83%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_(%D0%9A%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Sadovaya_in_Vetluzhsky.jpg","page_title":"Ветлужский (Костромская область)","context_page_description":"Ветлу́жский — посёлок городского типа, входящий в состав городского округа Шарья Костромской области России."},{"page_url":"https://en.wikipedia.org/wiki/Paleolithic","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Homo_heidelbergensis._Museo_de_Prehistoria_de_Valencia.jpg","page_title":"Paleolithic","context_page_description":"The Paleolithic or Palaeolithic or Palæolithic, also called the Old Stone Age, is a period in human prehistory distinguished by the original development of stone tools that covers c. 99% of the time period of human technological prehistory. It extends from the earliest known use of stone tools by hominins c. 3.3 million years ago, to the end of the Pleistocene c. 11,650 cal BP.\\nThe Paleolithic Age in Europe preceded the Mesolithic Age, although the date of the transition varies geographically by several thousand years. During the Paleolithic Age, hominins grouped together in small societies such as bands and subsisted by gathering plants, fishing, and hunting or scavenging wild animals. The Paleolithic Age is characterized by the use of knapped stone tools, although at the time humans also used wood and bone tools. Other organic commodities were adapted for use as tools, including leather and vegetable fibers; however, due to rapid decomposition, these have not survived to any great degree.\\nAbout 50,000 years ago a marked increase in the diversity of artifacts occurred. In Africa, bone artifacts and the first art appear in the archaeological record."},{"page_url":"https://uk.wikipedia.org/wiki/Otocryptis_nigristigma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Otocryptis_nigristimata.jpg","page_title":"Otocryptis nigristigma","context_page_description":"Otocryptis nigristigma — представник роду Otocryptis з родини Агамових. Інші назви «коричневоплямиста кенгурова ящірка» та «рівнинна приховановуха агама»."},{"page_url":"https://en.wikipedia.org/wiki/Louis_the_Springer","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Wartburg-Ludwig.der.Springer.jpg","page_title":"Louis the Springer","context_page_description":"Louis the Springer, sometimes called Louis the Jumper or Louis the Leaper, was a German nobleman and count in Thuringia from 1056 until his death. Little is known about him, although he is mentioned in many legends."},{"page_url":"https://it.wikipedia.org/wiki/Filippo_IV_di_Spagna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Bartolom%C3%A9_Gonz%C3%A1lez_y_Serrano_003.jpg","page_title":"Filippo IV di Spagna","context_page_description":"Filippo IV d'Asburgo, in spagnolo Felipe IV, anche detto Filippo il Grande o Il Re Pianeta, fu re di Spagna dal 1621 fino alla morte, sovrano dei Paesi Bassi spagnoli nonché re del Portogallo e di Algarve come Filippo III fino al 1640.\\nAll'alba della sua morte nel 1665, l'Impero spagnolo aveva raggiunto il suo zenit territoriale raggiungendo la ragguardevole dimensione di 12,2 milioni di chilometri quadrati, ma d'altro canto esso si trovava in declino, processo che l'incostanza di Filippo e le mancate riforme della politica interna e di quella militare contribuirono a far peggiorare."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E7%9F%A5%E7%9C%8C%E7%AB%8B%E7%BE%8E%E8%A1%93%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/The_Museum_of_Art_Kochi01s3872.jpg","page_title":"高知県立美術館","context_page_description":"高知県立美術館は、高知県高知市にある美術館。1993年11月3日に開館した。約1200点にのぼるマルク・シャガールの世界的コレクション、高知ゆかりの世界的写真家・石元泰博の写真コレクション等で知られる。\\nコンサートホールの高知県立美術館ホールを館内に併設している。"},{"page_url":"https://ceb.wikipedia.org/wiki/Kabupaten_Jepara","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Jepara_Regency_Office.JPG","page_title":"Kabupaten Jepara","context_page_description":"Kabupaten ang Kabupaten Jepara sa Indonesya. Nahimutang ni sa lalawigan sa Provinsi Jawa Tengah, sa kasadpang bahin sa nasod, 400 km sa sidlakan sa Jakarta ang ulohan sa nasod. Adunay 1,150,332 ka molupyo. Naglangkob kin og 1,004 ka kilometro kwadrado.\\nAng yuta sa Kabupaten Jepara kay lain-lain.\\nHapit nalukop sa lasang ang palibot sa Kabupaten Jepara. Dunay mga 276 ka tawo kada kilometro kwadrado sa palibot sa Kabupaten Jepara nga hilabihan populasyon. Ang klima habagat. Ang kasarangang giiniton 23 °C. Ang kinainitan nga bulan Oktubre, sa 25 °C, ug ang kinabugnawan Mayo, sa 22 °C. Ang kasarangang pag-ulan 2,845 milimetro matag tuig. Ang kinabasaan nga bulan Enero, sa 527 milimetro nga ulan, ug ang kinaugahan Septiyembre, sa 35 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Enceinte_romaine_de_Venasque","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Venasque_Walls.JPG","page_title":"Enceinte romaine de Venasque","context_page_description":"L'enceinte romaine de Venasque est une construction datée du IVᵉ siècle, situé à Venasque dans le département français de Vaucluse."},{"page_url":"https://it.wikipedia.org/wiki/Passaporto","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Pasaporteargentino.jpg","page_title":"Passaporto","context_page_description":"Un passaporto è un documento di riconoscimento formale o una certificazione emessa da un governo statale che identifica il portatore come un cittadino di quel particolare stato e richiede il permesso, nel nome della sovranità o governo dello stato emittente, di entrare e passare per altri stati.\\nI passaporti sono connessi al diritto di protezione legale all'estero e al diritto di rientrare nello stato della propria cittadinanza. Contengono la fotografia del titolare, i suoi dati anagrafici, la sua firma, la cittadinanza e alle volte altri mezzi di identificazione individuale. Molti stati stanno sviluppando proprietà biometriche per i loro passaporti per poter confermare con maggior certezza che la persona che presenta il passaporto ne sia il legittimo titolare.\\nIl passaporto è il documento d'identità richiesto per viaggiare all'estero, ed è esibito al confine, qualora con la nazione visitata non esistano accordi per cui i cittadini possano utilizzare anche altri documenti di identità. Ad esempio, i cittadini degli Stati membri dell'Unione europea, possono viaggiare verso altri Paesi UE utilizzando, in alternativa al passaporto, la sola carta d'identità in corso di validità."},{"page_url":"https://pl.wikipedia.org/wiki/Jagiellonia_Bia%C5%82ystok","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Micha%C5%82_Probierz%282%29.jpg","page_title":"Jagiellonia Białystok","context_page_description":"Jagiellonia Białystok – polski klub piłkarski z siedzibą w Białymstoku występujący w Ekstraklasie. Zdobywca Pucharu Polski i Superpucharu Polski, srebrny i brązowy medalista mistrzostw Polski, 4-krotny mistrz Polski juniorów starszych oraz mistrz Polski juniorów młodszych. Najbardziej utytułowany klub piłkarski w północno-wschodniej Polsce. Klub zajmuje 18. miejsce w tabeli wszech czasów Ekstraklasy."},{"page_url":"https://ko.wikipedia.org/wiki/BATOO_%EC%8A%A4%ED%83%80%EB%A6%AC%EA%B7%B8_08~09","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/2009_BATOO_OSL_Jaedong_winning.jpg","page_title":"BATOO 스타리그 08~09","context_page_description":"BATOO 스타리그 08~09는 2008년부터 2009년까지 진행된 온게임넷의 스타리그이다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%84%D1%83%D1%86%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Confuciusmansionqufu.jpg","page_title":"Конфуций","context_page_description":"Конфу́ций — древний мыслитель и философ Китая. Его учение оказало глубокое влияние на жизнь Китая и Восточной Азии, став основой философской системы, известной как конфуцианство. Конфуций основал первый университет и систематизировал летописи, составленные в разных княжествах. Учение Конфуция о правилах поведения князей, чиновников, воинов и крестьян распространялось в Китае так же широко, как учение Будды в Индии. Настоящее имя — Кун Цю, но в литературе часто именуется Кун-цзы, Кун Фу-Цзы или просто Цзы — «Учитель». Уже в возрасте немногим более 20 лет он прославился как первый профессиональный педагог Поднебесной.\\nДо победы легизма школа Конфуция была только одним из многих направлений в интеллектуальной жизни Воюющих Царств, в период, известный под названием Сто школ. И только после падения Цинь возрождённое конфуцианство достигло статуса государственной идеологии, который сохранился до начала XX века, лишь временно уступая место буддизму и даосизму. Это привело к возвеличиванию фигуры Конфуция и включению его в религиозный пантеон."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%98%E1%83%9D%E1%83%A1%E1%83%94%E1%83%91_%E1%83%A1%E1%83%A2%E1%83%90%E1%83%9A%E1%83%98%E1%83%9C%E1%83%98_(%E1%83%A2%E1%83%90%E1%83%9C%E1%83%99%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/IS-3-latrun-2.jpg","page_title":"იოსებ სტალინი (ტანკი)","context_page_description":"იოსებ სტალინი — ტანკების სერია, შექმნილი სსრკ-ის მიერ. მან ჩაანაცვლა KV ტიპის მძიმე ტანკი და მისი მოდერნიზაციები.\\nახალი მძიმე ტანკის ჯავშანი სპეციალურად შექმნილი იყო გერმანული 75 – 88 მმ–იანი ჭურვების გასაძლებლად, ხოლო ქვემეხი კი თიგერის და პანტერის გასანადგურებლად. ტანკი ის–2 წარმოებაში 1944 წლიდან არის და ძირითადად ბერლინის ბრძოლისას გამოიყენებოდა, ხოლო ის–3 – 1945 წლის მაისიდან მიიღეს."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%BF%D0%B0%D0%BC%D0%B5%D1%80%D0%BB%D1%8B%D1%85_%D1%83_1942_%D0%B3%D0%BE%D0%B4%D0%B7%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%D0%97%D0%B0%D1%81%D0%BB%D0%BE%D0%BD%D0%BE%D0%B2_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87.jpg","page_title":"Сьпіс памерлых у 1942 годзе","context_page_description":"24 сьнежня: Вінцэнт Гадлеўскі — беларускі каталіцкі сьвятар, грамадзкі дзяяч, адзін з кіраўнікоў беларускага падпольля ў гады нямецкай акупацыі"},{"page_url":"https://pl.wikipedia.org/wiki/Trolejbusy_w_Ufie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%D0%9D%D0%B5%D1%84%D0%90%D0%97-%D0%91%D0%A2%D0%97-52765.jpeg","page_title":"Trolejbusy w Ufie","context_page_description":"Trolejbusy w Ufie – system miejskiej komunikacji trolejbusowej w rosyjskim mieście Ufa w Baszkortostanie. Funkcjonuje obok systemu autobusów oraz tramwajów. Tramwaje i trolejbusy są wspólnie zarządzane przez spółkę MUET.\\nSieć trolejbusowa w Ufie została uruchomiona 27 stycznia 1962. W 2013 roku sieć składała się z 12 funkcjonujących linii, na których jeździło około 250 pojazdów. Łączna długość linii trolejbusowych wynosi 161 km. Szacowane jest, że w 2012 roku trolejbusy przewiozły w Ufie 20,8 mln pasażerów, co stanowi 12,1% udziału w transporcie publicznym miasta.\\nW mieście znajduje się również Baszkirska Fabryka Trolejbusów, który dostarcza większość pojazdów do sieci miasta, a także do innych miast Federacji Rosyjskiej."},{"page_url":"https://cy.wikipedia.org/wiki/Pierre-Auguste_Renoir","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Renoir%2C_Pierre-Auguste%2C_by_Dornac%2C_BNF_Gallica.jpg","page_title":"Pierre-Auguste Renoir","context_page_description":"Arlunydd Ffrengig oedd Pierre-Auguste Renoir. Bu'n un o brif arlunwyr y grŵp Argraffiadol. Datblygodd dechneg o waith brwsh toredig, manwl gyda chyfuniad o liwiau a oedd yn cydweddu er mwyn dal symudiad a golau. Yn dilyn ei ymweliad â'r Eidal ym 1881 newidiodd ei steil i fod yn fwy clasurol.\\nPriododd, ym 1890, â Aline Victorine Charigot, model yn y paentiad Le Déjeuner des canotiers.\\nBu'n dad i'r actor Pierre Renoir, y cyfarwyddwr ffilm Jean Renoir a'r crochenydd Claude Renoir. Yn daid i'r gweithiwr ffilm Claude Renoir, mab Pierre."},{"page_url":"https://sv.wikipedia.org/wiki/Harv","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bronowanie.jpg","page_title":"Harv","context_page_description":"Harv är ett jordbruksredskap som används för olika former av markbearbetning på gräsbeväxt mark och på öppen jord. Vid harvning sönderdelas jordytan och luckras upp, till skillnad från plöjning som bearbetar ett djupare jordlager. Harvar skiljer sig från jordfräsar genom att de bearbetar hela markytan och inte bara smala sängar där grödan planteras.\\nEn speciell typ är broddharvning, som utförs efter broddens uppväxt med en lätt harv för att luckra jorden och förstöra ogräs."},{"page_url":"https://sv.wikipedia.org/wiki/Hari_Rud","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Jam_Qasr_Zarafshan.jpg","page_title":"Hari Rud","context_page_description":"Hari Rud eller Tedzjen är en flod som flyter fram mellan bergen i centrala Afghanistan och Turkmenistan och försvinner i Karakum-öknen. Floden är cirka 1100 km lång. Den har sin källa i Koh-i Baba-bergen, en del av bergskedjan Hindukush och följer inledningsvis en relativt rak linje mot väster och staden Herat. Efter Herat svänger floden åt nordväst, sedan norrut och utgör en del av gränsen mellan Afghanistan och Iran. Längre norrut formar floden den sydöstra delen av gränsen mellan Iran och Turkmenistan. I Turkmenistan är floden känd under namnet Tedzjen och passerar nära staden Tedzjen.\\nDalgången runt Herat var i historien berömd för sin bördighet och sitt täta odlingslandskap. Floden möter Jam Rud vid den historiska platsen för Hari Ruds minaret som med sina 65 meter sägs vara den näst högsta minareten i världen."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9F%93%E4%BB%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Chinese_dish%2C_Yuan_dynasty%2C_14th_century%2C_porcelain_with_glaze%2C_Honolulu_Academy_of_Arts.JPG","page_title":"染付","context_page_description":"染付とは、白色の胎土で成形した素地の上に酸化コバルト(II)を主とした絵の具で模様を絵付し、その上に透明釉をかけて高温焼成した陶磁器。おもに磁器で、模様は藍青色に発色する。\\n中国語で\\"青花\\"、または\\"釉里青\\"と呼ぶ。英語で\\"blue and white\\"。\\n透明釉の下に発色層がある釉下彩技法の一種である。 同じ酸化コバルトの発色であるが、低温釉を使った唐三彩の藍彩などは染付ではない。この絵の具の材料は、日本では呉須と呼んでいる。江戸時代には、茶碗薬とも呼んだ。コバルトを含むこの材料は、中国でも輸入品が多く、元末から明初では西南アジアから輸入されたスマルト、蘇麻離青または蘇勃泥青とよばれる濃い藍のガラスを使用していた。その後も外国から輸入される材料を回青と呼んでいる。また、中国国内で産出する土青、石青などと呼ばれる呉須も使用されるようになった。近代以降はドイツ産などの人造コバルトも多く使用されている。\\n日本では、磁土を一度素焼きしてから、呉須で図柄を描き、その上から透明釉を掛けて再度焼成するのが一般的である。中国では、素焼きをしていない素地に呉須で図柄を描き、その上から透明釉を掛けて焼成する技法が原則である。ただし、極端に薄い磁器は素焼きをするし、生掛けは初期伊万里でもみられる。"},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_arch%C3%A9ologique_de_Thessalonique","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Arch%C3%A4ologisches_Museum_Thessaloniki_%28%CE%91%CF%81%CF%87%CE%B1%CE%B9%CE%BF%CE%BB%CE%BF%CE%B3%CE%B9%CE%BA%CF%8C_%CE%9C%CE%BF%CF%85%CF%83%CE%B5%CE%AF%CE%BF_%CE%98%CE%B5%CF%83%CF%83%CE%B1%CE%BB%CE%BF%CE%BD%CE%AF%CE%BA%CE%B7%CF%82%29_%2833954449428%29.jpg","page_title":"Musée archéologique de Thessalonique","context_page_description":"Le Musée archéologique de Thessalonique, situé à Thessalonique, dans la périphérie de Macédoine centrale, est l'un des plus importants musées archéologiques grecs. Il a été inauguré en 1962, lors des festivités du 50ᵉ anniversaire de la conquête de Thessalonique pendant les guerres balkaniques."},{"page_url":"https://de.wikipedia.org/wiki/Pharmazeutische_Chemie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Constantin_Zwenger_Institut.jpg","page_title":"Pharmazeutische Chemie","context_page_description":"Pharmazeutische Chemie ist ein Teilgebiet der Pharmazie und der Pharmaforschung, der Wissenschaft von den Arzneistoffen und Arzneimitteln. Die pharmazeutische Chemie ist das Spezialgebiet der Pharmazie, das sich mit den chemischen Eigenschaften von Arzneimitteln im weitesten Sinne beschäftigt. Eine besondere Rolle spielt die Analyse von Arzneistoffen und Arzneimitteln sowie die Synthese der Arzneistoffe. Der pharmazeutischen Chemie nahestehende Gebiete sind die medizinische Chemie, die Pharmakologie und die Toxikologie.\\nGrundlage der pharmazeutischen Chemie sind die organische Chemie sowie Teilgebiete der anorganischen Chemie. In Deutschland haben die meisten Professoren des Fachs pharmazeutischen Chemie einen Studienabschluss in Chemie und in Pharmazie. Horst Böhme – ein bedeutender pharmazeutischer Chemiker – und viele seiner akademischen Schüler seien beispielhaft genannt."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A8%AA%E5%B8%A6%E9%B9%A6%E5%98%B4%E9%B1%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Scarus_scaber_m%C3%A2le.jpg","page_title":"横带鹦嘴鱼","context_page_description":"横带鹦嘴鱼为辐鳍鱼纲鲈形目隆头鱼亚目鹦嘴鱼科鹦嘴鱼属的鱼类。分布于印度洋中部岛屿至太平洋萨摩亚群岛、北达日本琉球群岛以及南海诸岛等，属于珊瑚礁鱼类，栖息深度1-20米，体长可达37公分。其常生活于礁盘或礁边缘，可做为食用鱼。\\n它体长可达37公分，在1-20米深之海域生活。"},{"page_url":"https://de.wikipedia.org/wiki/Fossilien_der_Fr%C3%A4nkischen_Alb","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Heterodontus_zitteli_-_Naturkundemuseum_Berlin_-_Solnhofen.jpg","page_title":"Fossilien der Fränkischen Alb","context_page_description":"Die Fossilien der Fränkischen Alb sind versteinerte Zeugnisse des vielfältigen Lebens von Fauna und Flora an Land, im Wasser und in der Luft der Fränkischen Alb. Sie fossilierten vom Ende der Trias bis zum Ende des Jura. In diesen erdgeschichtlichen Zeiträumen herrschte ein vorwiegend warmes Klima vor, das die Entwicklung des Lebens begünstigte.\\nDie große Anzahl der Fossilien ist oft in einem beeindruckendem Detaillierungsgrad erhalten. In der nachstehenden Übersicht sind einige von ihnen exemplarisch aufgeführt."},{"page_url":"https://pl.wikipedia.org/wiki/Gatis_Spr%C5%ABds","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/11.Saeimas_deput%C4%81ts_Gatis_Spr%C5%ABds_%2813756762753%29.jpg","page_title":"Gatis Sprūds","context_page_description":"Gatis Sprūds – łotewski przedsiębiorca, działacz młodzieżowy i polityk, w 2014 poseł na Sejm XI kadencji."},{"page_url":"https://en.wikipedia.org/wiki/Sclerorhynchiformes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sclerorhynchidae_-_Libanopristis_hiram.JPG","page_title":"Sclerorhynchiformes","context_page_description":"Sclerorhynchiformes is an order of extinct batoids with long, serrated rostrums very similar to those of sawsharks and sawfishes. While they are neither, they are more closely related to sawfishes, and are included alongside them in the clade Pristiorajea."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%AA%E3%83%83%E3%83%84%E3%83%BB%E3%83%97%E3%83%AC%E3%83%AB%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Die_Gartenlaube_%281887%29_b_109.jpg","page_title":"フリッツ・プレルス","context_page_description":"フリッツ・プレルスはドイツの画家である。"},{"page_url":"https://da.wikipedia.org/wiki/%C3%89tienne_de_Vignolles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Xaintrailles_and_La_Hire.jpg","page_title":"Étienne de Vignolles","context_page_description":"Étienne de Vignolles, kaldet La Hire, var en fransk hærfører.\\n1418 trådte han i tjeneste hos Dauphinen, den senere Karl 7. af Frankrig, og han blev snart en af dennes mest betroede mænd og dygtigste og pålideligste medhjælpere. I de følgende års kampe tog han ivrig del; da Jeanne d'Arc fremtrådte, var han en af de første, der talte hendes sag, han kæmpede sammen med hende i de flg. to år og stillede sig stadig på hendes side. Også siden deltog han med dygtighed i kampen mod englænderne indtil sin død."},{"page_url":"https://pt.wikipedia.org/wiki/USS_John_F._Kennedy_(CV-67)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/US_Navy_020817-N-9719H-002_USS_Kennedy_Sailors.jpg","page_title":"USS John F. Kennedy (CV-67)","context_page_description":"USS John F. Kennedy (CV-67) é um super-porta-aviões norte-americano."},{"page_url":"https://en.wikipedia.org/wiki/Frank_Gifford","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Frank_Gifford_1949.jpeg","page_title":"Frank Gifford","context_page_description":"Francis Newton Gifford was an American football player, actor, and television sports commentator. After a 12-year playing career as a halfback and flanker for the New York Giants of the National Football League, he was a play-by-play announcer and commentator for 27 years on ABC's Monday Night Football.\\nGifford won the NFL Most Valuable Player Award from United Press International in 1956, the same season his team won the NFL Championship. During his career, he participated in five league championship games and was named to eight Pro Bowls. He was inducted into the Pro Football Hall of Fame in 1977. After retiring as a player, Gifford was an Emmy Award-winning sportscaster, known for his work on ABC's Monday Night Football, Wide World of Sports and the Olympics. He was married to television host Kathie Lee Gifford from 1986 until his death."},{"page_url":"https://fr.wikipedia.org/wiki/Metal_Mulisha","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Motocross_in_Taiwan.jpg","page_title":"Metal Mulisha","context_page_description":"Metal Mulisha est un regroupement de pilotes de freestyle motocross et une marque de vêtement créée en 1998 par l'un des pionniers du genre Brian Deegan et son ami Larry Linkogle. Depuis quelques années Metal Mulisha signe un partenariat de sponsoring avec différents athlètes de Mixed martial arts."},{"page_url":"https://fr.wikipedia.org/wiki/Eureka_Springs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Eureka_Springs_collage.png","page_title":"Eureka Springs","context_page_description":"Eureka Springs est une ville située dans l’État américain d'Arkansas, dans le comté de Carroll, dont elle est l'un des deux sièges. Selon le recensement de 2010, sa population est de 2 073 habitants.\\nEureka Springs se situe dans les monts Ozark dans le nord-ouest de l'Arkansas. Toute la ville est classée au Registre national des lieux historiques des États-Unis et constitue l'une des destinations touristiques les plus recherchées de l'Arkansas."},{"page_url":"https://sh.wikipedia.org/wiki/Julije_Klovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Julije_Klovic_Z_Car_2007.jpg","page_title":"Julije Klović","context_page_description":"Julije Klović, hrvatski slikar minijaturist.\\nSlikar minijaturist zvan i \\"Michelangelo minijature\\". S osamnaest godina odlazi u Veneciju gdje uči slikarstvo od Rafaelovog učenika. Odlazi poslom u Mađarsku, vraća se u Italiju, u Mantovi postaje svećenik i živi u samostanu kraj Padove. Napušta redovništvo i radi diljem Italije: Peruga, Rim, Firenza, Parma, Piacenza...\\nBio je u dodiru s Michelangelom, Vasarijem, Bruegelom, Colonnom kao i s El Grecom koji je izradio i dva Klovićeva portreta.\\nMinijature i iluminacije rukopisa čuvaju se diljem svijeta: Beatissimae Mariae Virginis Officium, Stanze di Eurialo d'Ascoli, Časoslov Farnese ili Officium Virginis... od kojih je ovaj posljednji remek djelo minijature svjetskih razmjera.\\nJuraj Gobić je rođen u zaseoku Gobići između sela Baretići i Groblja Belgrad u Vinodolu, 15.07.1498 MCDXCVIII 15-esti vijek. Talijani su njegovo ime i prezime pisali drugačije Giulio Clovio. Prepoznavši u njemu nadarenog slikara tadašnji svećenik ga odvodi u Padovu, Italija da se tamo unapređuje. Maleni Juraj je na noktu palca nacrtao komadićem ugljena crkvicu ovce i pašnjak, svoj prvi crtež."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_plantes_de_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/PULSATILLA_RUBRA_-_MONTSEC_-_IB-562.JPG","page_title":"Llista de plantes de Catalunya","context_page_description":"Llista de totes les plantes vasculars autòctones o naturalitzades presents en el territori administratiu de Catalunya segons el criteri taxonòmic de l'obra Flora dels Països Catalans ordenades alfabèticament segons el seu nom específic. En total la relació consta de 3.158 espècies agrupades en 147 famílies botàniques. Per a algunes espècies, s'assenyala al costat el nom popular de l'espècie, seguint el criteri de l'obra Noms de plantes del Termcat i, secundàriament, del Banc de dades de biodiversitat de Catalunya. El subratllat indica el nom predominant segons el DIEC. Vegeu la llista de noms de plantes de Catalunya pels noms comuns de les plantes autòctones que tenen nom comú i la llista de les espècies invasores per a les plantes considerades com invasores.\\nLes plantes protegides per la Generalitat de Catalunya, que en prohibeix la recol·lecció, la tallada i el desarrelament tant d’aquestes plantes com d’alguna de les seves parts, incloses les llavors, així com la seva comercialització. Aquestes són el teix, fam. Taxaceae, la flor de neu, “edelweiss”. fam. Compositae; el boix grèvol, fam. Aquifoliaceae; la genciana groga, g. vera, gençana, fam. Gentianaceae; i el margalló, fam."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_Brindeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Louis_Brindeau%2C_maire_du_Havre.jpg","page_title":"Louis Brindeau","context_page_description":"Louis-Eugène-Henri Brindeau est un magistrat et homme politique français, maire du Havre, député et sénateur de la Seine-Inférieure."},{"page_url":"https://fr.wikipedia.org/wiki/Short_Stirling","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Short_Stirling_bomber_N6101.jpg","page_title":"Short Stirling","context_page_description":"Le Short Stirling fut le premier bombardier lourd quadrimoteur britannique de la Seconde Guerre mondiale. Il fut conçu et construit par Short Brothers sur des spécifications du ministère de l'Air en 1936 et entra en service en 1941. Le Stirling connut une carrière opérationnelle avec le Bomber Command jusqu'en décembre 1943, étant remplacé progressivement par l'entrée en service au sein de la RAF d'autres bombardiers quadrimoteurs en particulier le Handley Page Halifax et l'Avro Lancaster.\\nLe Short Stirling ne pouvait pas voler aussi haut que le Halifax et le Lancaster car ses ailes avaient une dimension réduite pour pouvoir rentrer dans les hangars de l'époque. Ce qui le rendait dorénavant vulnérable face à la flak allemande qui pouvait atteindre des altitudes supérieures à la hauteur maximale de vol du Short Stirling. Toutefois les pilotes vantaient sa manœuvrabilité qui était proche d'un avion de chasse.\\nLe Short Stirling continua sa brillante carrière opérationnelle hors du Bomber Command."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%8B%E9%AD%AF%E6%A0%BC%E6%B4%9B%E8%80%B6%E6%B9%96_(%E5%BE%B7%E7%B1%B3%E7%89%B9%E7%BE%85%E5%A4%AB%E5%8D%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/%D0%9A%D1%80%D1%83%D0%B3%D0%BB%D0%BE%D0%B5_%28%D0%BE%D0%B7%D0%B5%D1%80%D0%BE%2C_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%29.jpg","page_title":"克魯格洛耶湖 (德米特羅夫區)","context_page_description":"克鲁格洛耶湖，是俄罗斯的湖泊，位于该国西部，由莫斯科州负责管辖，处于德米特罗夫区，长1.3公里、宽0.91公里，面积0.96平方公里，最大水深4.2米。"},{"page_url":"https://en.wikipedia.org/wiki/Columbia_County,_Florida","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Map_of_Florida_highlighting_Columbia_County.svg","page_title":"Columbia County, Florida","context_page_description":"Columbia County is a county located in the north central portion of the U.S. state of Florida. As of the 2010 census, the population was 67,531. Its county seat is Lake City.\\nColumbia County comprises the Lake City, FL Micropolitan Statistical Area, which is included in the Gainesville-Lake City, FL Combined Statistical Area. Osceola National Forest is partially in Columbia County."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%96%E7%95%8C%E8%B2%BF%E6%98%93%E4%B8%AD%E5%BF%83%E5%9B%9B%E8%99%9F%E5%A4%A7%E6%A8%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/4_WTC_construction_Aug_2011.jpg","page_title":"世界貿易中心四號大樓","context_page_description":"世界贸易中心四号大楼为纽约市世界贸易中心原址重建计划的其中一栋大楼，297.13米、72层楼高，位于曼哈顿下城，于2012年6月24日封顶，并于2013年11月13日对外开放。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BD%D0%B4%D1%88%D0%B0%D1%84%D1%82%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BC%D0%BF%D0%BB%D0%B5%D0%BA%D1%81_%D0%A7%D0%B0%D0%BD%D0%B3%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Tam_Coc_taken_by_Harmony_Hiro.jpg","page_title":"Ландшафтний комплекс Чанган","context_page_description":"Ландшафтний комплекс Чанган — історичний комплекс є об'єктом всесвітньої природно-культурної спадщини. Складається з трьох охоронних територій: культурно-історичний комплекс «Давня столиця Хоали», комплекс Чанган-Тамкок-Бітьдонг і незайманий ліс Хоали. Розташований у провінції Ніньбінь, в 100 км на південь від столиці В'єтнаму міста Ханой. Загальна площа — майже 6200 гектарів."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%83%E3%83%88_(%E3%82%B0%E3%83%A9%E3%83%95%E7%90%86%E8%AB%96)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Min-cut.svg","page_title":"カット (グラフ理論)","context_page_description":"グラフ理論において、グラフ G の頂点 V の 2 分割 をカットとよぶ。このとき、ある辺 E の端点が u S かつ v Tであるとき、この辺を「カットエッジ」と呼ぶ。\\nカットのサイズ は、カットエッジの総数 で表される。フローネットワークでは、カットのサイズは始点側から終点側へ向かう辺重みの総和で定義される。\\n頂点集合のべき集合を定義域としたカットのサイズを返す集合関数は「カット関数」と呼ばれ、\\n劣モジュラ関数、かつ、正モジュラ関数である。"},{"page_url":"https://da.wikipedia.org/wiki/Bugatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/RL_1938_Bugatti_57SC_Atlantic_34_2.jpg","page_title":"Bugatti","context_page_description":"Bugatti er et af de mest eksklusive bilmærker nogensinde og er en beundret veteranbil. Firmaet har været en legende som producent af nogle af de bedste sportsvogne, der kunne købes for penge. Det oprindelige franske Bugatti-firma gik fallit under 2. verdenskrig, men produktionen er blevet genoptaget to gange, først i Italien og herefter af den tyske Volkswagen-koncern."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%80%D0%BE%D0%B7%D1%83%D0%B1%D0%B0%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Poseidon_Penteskouphia_Louvre_CA452.jpg","page_title":"Трозубац","context_page_description":"Трозубац је оружје налик копљу које на врху има три велика метална зуба, познат је из грчке митологије јер га је имао бог Посејдон односно Нептун код старих Римљана, али и др. богови. Трозубац је симбол три највећа острва Атлантиде.\\nНајпре је служио само за риболов. У време Римског царства трозубац је било често оружје гладијатора у арени.\\nТрозубац је отиснут на новцу неких античких градова.\\nЗлатни трозубац, који води порекло од византијске хералдике, данас је мотив грба Украјине. Трозубац је приказан и на застави Барбадоса. Италијански произвођач аутомобила Масерати користи трозубац као свој заштитни знак."},{"page_url":"https://de.wikipedia.org/wiki/Corioliskraft","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Stimmgabelprinzip_Drehratensensor.png","page_title":"Corioliskraft","context_page_description":"Die Corioliskraft ist eine Trägheitskraft. In einem rotierenden Bezugssystem, zum Beispiel auf einer sich drehenden Scheibe, kann festgestellt werden, dass sich ein Körper nicht gleichförmig geradlinig entsprechend dem zweiten Newtonschen Gesetz bewegt, sondern senkrecht zur Bewegungsrichtung abgelenkt wird. Diese Ablenkung wird durch die Coriolisbeschleunigung verursacht und als Wirkung einer seitlich einwirkenden Kraft, der Corioliskraft gedeutet. Ebenso stellt man bei einer im rotierenden Bezugssystem geradlinigen Bewegung fest, dass eine Kraft senkrecht zur Bewegungsrichtung aufgebaut werden muss, die aber zu keiner Geschwindigkeitsänderung führt. Diese Kraft ist der Corioliskraft entgegengesetzt und hat den gleichen Betrag. Im Unterschied zu den beiden anderen Trägheitskräften in rotierenden Bezugssystemen, der Zentrifugalkraft und der Eulerkraft, wirkt die Corioliskraft nur auf Körper, die sich im rotierenden Bezugssystem bewegen.\\nDa die Coriolisbeschleunigung senkrecht zur Bewegungsrichtung steht, bleibt der Betrag der Geschwindigkeit im rotierenden Bezugssystem konstant, es ändert sich nur ihre Richtung."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B5%E0%A4%BF%E0%A4%95%E0%A4%BF%E0%A4%B2%E0%A5%80%E0%A4%95%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Wikileaks_logo.svg","page_title":"विकिलीक्स","context_page_description":"विकिलीक्स ही जगभरातील गोपनीय तसेच गुप्त बातम्या प्रसिद्ध करणारी एक वादग्रस्त विना-नफा संस्था आहे. डिसेंबर २००६ मध्ये स्थापन झालेल्या विकीलीक्सने आपल्या संकेतस्थळाच्या द्वारे आजवर लाखो गुप्त व संवेदनशील सरकारी कागदपत्रे, अहवाल व मेमो प्रकाशित केले आहेत. जुलियन असांज हा विकीलीक्सचा प्रमुख संपादक व प्रवक्ता आहे.\\nविकीलीक्सचा विकिपीडिया किंवा विकिमीडिया फाउंडेशनशी काहीही संबंध नाही."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%AA_%D9%85%D9%88%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Patrick_Joseph_Moran_1908.jpg","page_title":"بات موران","context_page_description":"بات موران ‏ هو لاعب كرة قاعدة أمريكي، ولد في 7 فبراير 1876 في فيتشبورغ في الولايات المتحدة، وتوفي في 7 مارس 1924 في أورلاندو في الولايات المتحدة بسبب التهاب الكلى."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E6%96%AF%E5%BE%B7%E5%B8%83%E9%AD%AF%E5%85%8B%E5%B3%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Aus_-_South_Stradbroke_Island.PNG","page_title":"南斯德布魯克島","context_page_description":"南斯德布鲁克岛是澳大利亚昆士兰州摩顿湾内的一个岛屿。该岛原本是斯德布鲁克岛的一部分。1896年的一场大风暴将斯德布鲁克岛分为南北两个部分。据2011年澳大利亚人口普查，岛上有人口101人，但在假日人口会显著增多。"},{"page_url":"https://en.wikipedia.org/wiki/Jiang_(rank)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/PLANF-0720-GEN.png","page_title":"Jiang (rank)","context_page_description":"Jiang is the rank held by general officers in the militaries of both the People's Republic of China and the Republic of China on Taiwan. The People's Liberation Army and the People's Armed Police use three levels at present while the Republic of China Armed Forces use four.\\nThe same rank names are used for all services, prefixed by haijun or kongjun."},{"page_url":"https://en.wikipedia.org/wiki/Middle_High_German","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Deutsche_Ostsiedlung.jpg","page_title":"Middle High German","context_page_description":"Middle High German is the term for the form of German spoken in the High Middle Ages. It is conventionally dated between 1050 and 1350, developing from Old High German and into Early New High German. High German is defined as those varieties of German which were affected by the Second Sound Shift; the Middle Low German and Middle Dutch languages spoken to the North and North West, which did not participate in this sound change, are not part of MHG.\\nWhile there is no standard MHG, the prestige of the Hohenstaufen court gave rise in the late 12th century to a supra-regional literary language based on Swabian, an Alemannic dialect. This historical interpretation is complicated by the tendency of modern editions of MHG texts to use normalised spellings based on this variety, which make the written language appear more consistent than is actually the case in the manuscripts. Scholars are uncertain as to whether the literary language reflected a supra-regional spoken language of the courts.\\nAn important development in this period was the Ostsiedlung, the eastward expansion of German settlement beyond the Elbe-Saale line which marked the limit of Old High German."},{"page_url":"https://en.wikipedia.org/wiki/Aleida_March","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Che_Guevara_-_Familia.jpg","page_title":"Aleida March","context_page_description":"Aleida March Torres is a Cuban revolutionary who was Ernesto \\"Che\\" Guevara's second wife, and a member of Fidel Castro's Cuban army."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B1%89%E5%A0%A1%E7%8E%AF%E5%9F%8E%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Dammtorwall_%28Hamburg-Neustadt%29.phb.ajb.jpg","page_title":"汉堡环城路","context_page_description":"環城路 是環繞漢堡內城的一組半圓形四車道道路，總長度3.3公里，其外側的大部分是一連串公園。\\n漢堡環城路得名於漢堡舊城牆，與紐約華爾街類似。它開闢於十九世紀上半葉，夷平舊城牆之際。從十七世紀二十年代到十九世紀四十年代，舊城牆構成了城市的邊緣。環城路的各段擁有不同的名稱，大體以倫巴第橋為界，分為東西兩部分。環城路西段面臨公園，而東段集中交通設施與博物館。"},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_mottakere_av_Nobels_fredspris","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Charles_Albert_Gobat2.jpg","page_title":"Liste over mottakere av Nobels fredspris","context_page_description":"Liste over mottakere av Nobels fredspris er en oversikt over mottakere av Nobels fredspris fra etableringen av prisen i 1901 og frem til i dag.\\nNobels fredspris deles ut hvert år av Den norske Nobelkomite «til den person som har arbeidet mest eller best for brorskap mellom nasjoner, for avskaffing eller minsking av armeer samt for arbeid og fremming av fredskongresser». Fredsprisen er én av fem Nobelpriser som ble etablert ut ifra Alfred Nobels testamente av 1895. Ifølge testamentet skal nobelprisene i kjemi, fysikk, litteratur og fysiolgi/medisin utdeles av Nobelstiftelsen i Stockholm, mens fredsprisen deles ut av Den norske Nobelkomite, som består av fem personer valgt av Stortinget.\\nDen første fredsprisen ble utdelt i 1901 til Frédéric Passy og Henri Dunant. Seremonien fant sted i Stortingssalen hvor stortingspresident Carl Berner først holdt en kort tale. Deretter annonserte Jørgen Løvland navnet på de to vinnerne. Ingen av prismottakerne var til stede.\\nMottakeren får en medalje, et diplom og en pengepremie som varierer fra år til år. Den første prisen var på 150 782 svenske kroner, mens i 2008, da Martti Ahtisaari ble tildelt prisen var premien på 10 millioner svenske kroner."},{"page_url":"https://en.wikipedia.org/wiki/Martin_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%E4%BD%94%E9%A0%98%E8%80%85%E7%A8%B1%E5%B0%87%E5%A0%85%E6%8C%81%E4%B8%8D%E5%90%88%E4%BD%9C%E9%81%8B%E5%8B%95%281%29.jpg","page_title":"Martin Lee","context_page_description":"Martin Lee Chu-ming, SC, JP is a Hong Kong politician and barrister. He is the founding chairman of the United Democrats of Hong Kong and its successor, the Democratic Party, Hong Kong's flagship pro-democracy party. He was also a member of the Legislative Council of Hong Kong from 1985 to 1997 and from 1998 to 2008. Nicknamed the \\"Father of Democracy\\" in Hong Kong, he is recognised as one of the most prominent advocates for democracy and human rights in Hong Kong and China.\\nA barrister by profession, Lee served as the chairman of the Hong Kong Bar Association from 1980 to 1983. He became involved in discussions over Hong Kong's handover to China, and in 1985 he joined the Hong Kong Basic Law Drafting Committee to assist in the drafting of Hong Kong's Basic Law, the city's mini-constitution post-handover. He was, however, expelled from the body in 1989 in the wake of the 1989 Tiananmen square crackdown, due to his condemnation of the Beijing government's role in the incident and his vocal support for the student protestors. In 1985 he was elected to the Legislative Council, where he advocated strongly for the protection of human rights and democratic reform."},{"page_url":"https://ast.wikipedia.org/wiki/Grupos_pol%C3%ADticos_del_Parllamentu_Europ%C3%A9u","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/European_Parliament_composition_by_political_groups.svg","page_title":"Grupos políticos del Parllamentu Européu","context_page_description":"Un grupu políticu del Parllamentu Européu ye la organización funcional interna qu'axunta en cada llexislatura a un númberu de diputaos non inferior a 25, procedentes de siquier una cuarta parte de los Estaos de la Unión, que s'asocien por criterios d'afinidá ideolóxica y acepten sometese a les normes organizativas y de disciplina interna que convinieren na so declaración constitutiva. La so utilidá mora en que facilita descomanadamente la converxencia y la sinergia organizativas de los diputaos y venceyar ideológicamente y colos sos partíos políticos, favoreciendo la conformanza de mayoríes y minoríes polítiques articulaes y políticamente representatives."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D8%AA%D9%88%D9%86%D9%8A_%D8%B1%D8%A7%D9%8A%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Anthony_Wright_Bengals.jpg","page_title":"أنتوني رايت","context_page_description":"أنتوني رايت ‏ هو لاعب كرة قدم أمريكية، من الولايات المتحدة، يلعب كوسط."},{"page_url":"https://fr.wikipedia.org/wiki/Championnat_du_monde_de_vitesse_moto_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/%C3%81lex_Rins_leads_the_pack_2019_Assen.jpeg","page_title":"Championnat du monde de vitesse moto 2019","context_page_description":"Le Championnat du monde de vitesse moto 2019 est la 71ᵉ édition du championnat du monde de vitesse moto organisé par la FIM.\\nLa saison voit l'arrivée d'une catégorie, MotoE, disputée avec des motos électriques avec 6 Grands Prix au calendrier."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%83%D8%A7%D8%B4%D8%A9_%D8%A8%D9%86_%D9%85%D8%AD%D8%B5%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%D8%B9%D9%83%D8%A7%D8%B4%D8%A9_%D8%A8%D9%86_%D9%85%D8%AD%D8%B5%D9%86.png","page_title":"عكاشة بن محصن","context_page_description":"عُكاشة بن مِحصَن صحابي بدري من السابقين إلى الإسلام، ومن المهاجرين، قُتل في حروب الردة في معركة بزاخة."},{"page_url":"https://no.wikipedia.org/wiki/Codex_Tchacos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Codex_Tchacos_p33.jpg","page_title":"Codex Tchacos","context_page_description":"Codex Tchacos er et samlehåndkrift. Det har en rekke gnostiske tekster fra 200- og 300-tallet, er skrevet på koptisk og har apokalyptisk tematikk. De er på den sahidiske dialekt, og var høyst sannsynlig oversettelser av tekster som var forfattet på gresk og med de eldste deler fra tidligst slutten av 100-tallet. Men mest sannsynlig er det eldste fra 200-tallet. Navnegivende for papyrus-kodeksen var Dimaratos Tchacos, faren til den siste eierinnen, Frieda Nussberger-Tchacos.\\nAv særlig interesse skulle Judasevangeliet vise seg å ha - det er gjengitt i manuskriptet."},{"page_url":"https://de.wikipedia.org/wiki/Juschno-Sachalinsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Yuzhno-Sakhalink_Airport.jpg","page_title":"Juschno-Sachalinsk","context_page_description":"Juschno-Sachalinsk ist mit 181.728 Einwohnern Verwaltungszentrum und größte Stadt der Oblast Sachalin auf der Insel Sachalin im Fernen Osten von Russland."},{"page_url":"https://hu.wikipedia.org/wiki/Olaszorsz%C3%A1g_megy%C3%A9i","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Province_italiane_dall%27unificazione.png","page_title":"Olaszország megyéi","context_page_description":"Olaszországban a megyék a régióknál kisebb, és azokhoz tartozó közigazgatási egységek, amelyek több községet foglalnak magukba. Jogállásukról az alkotmány V. címe, valamint az ennek megfelelő másodlagos jogforrások rendelkeznek. Az autonóm megyék kivételével valamennyi megye tagja az olasz megyék uniójának."},{"page_url":"https://nl.wikipedia.org/wiki/Heilige_Drie-eenheidskerk_(Brussel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Brussel-Heilige_Drieheidskerk.jpg","page_title":"Heilige Drie-eenheidskerk (Brussel)","context_page_description":"De Heilige Drie-eenheidskerk is een orthodox kerkgebouw in de Belgische stad Brussel in het Brussels Hoofdstedelijk Gewest. De kerk staat aan de Léon Lepagestraat 33-35.\\nDe bakstenen kerk is gewijd aan de Drie-eenheid."},{"page_url":"https://pl.wikipedia.org/wiki/Metropolia_Kisumu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/St-Therese-of-Lisiuex-Cathedral-RC-Archdiocese-of-Kisumu-Kenya.jpg","page_title":"Metropolia Kisumu","context_page_description":"Metropolia Kisumu – jedna z 4 metropolii kościoła rzymskokatolickiego w Kenii. Została ustanowiona 21 maja 1990."},{"page_url":"https://uk.wikipedia.org/wiki/STAB1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/PBB_GE_STAB1_38487_at_fs.png","page_title":"STAB1","context_page_description":"STAB1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 3-ї хромосоми. Довжина поліпептидного ланцюга білка становить 2 570 амінокислот, а молекулярна маса — 275 482.\\nКодований геном білок за функцією належить до рецепторів.\\nЗадіяний у таких біологічних процесах як запальна відповідь, поліморфізм, альтернативний сплайсинг.\\nЛокалізований у мембрані."},{"page_url":"https://lt.wikipedia.org/wiki/A%C5%A1%C5%ABras","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Assur.png","page_title":"Ašūras","context_page_description":"Ašūras – viena iš senovės Asirijos sostinių. Miesto liekanos plyti vakariniame Tigro krante, į šiaurę nuo santakos su Mažuoju Zabu, dab. šiaurės Irako Al-Shirqat rajone Salah ad Dino muchafazoje. Objektas įtrauktas į UNESCO saugomo pasaulio kultūros paveldo sąrašą 2003 m. Tais pačiais metais įrašytas ir į Pavojuje esančio pasaulio paveldo sąrašą dėl regione vykstančio ginkluoto konflikto bei grėsmės užtvindyti istorinę vietovę dėl numatomos čia statyti dambos.\\nAšūras buvo pirmąja Asirijos imperijos sostine nuo XIV a. pr. m. e. iki IX a. pr. m. e. Taip pat Ašūras buvo asirų religine sostine, vieta, kur buvo karūnuojami ir laidojami karaliai. Per Ašūrą driekėsi šiaurės Mesopotamijos prekybiniai keliai, Eufrato slėnyje jungęsi su prekybiniu Karalių keliu."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%B3%D0%BD%D0%B5%D1%81_%D1%84%D0%BE%D0%BD_%D0%91%D0%B0%D0%B4%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Alt_Ebersteinburg.JPG","page_title":"Агнес фон Баден","context_page_description":"Агнес фон Баден е маркграфиня от Маркграфство Баден и чрез женитба графиня на Холщайн-Рендсбург и херцогиня на Шлезвиг.\\nТя е дъщеря на маркграф Бернхард I фон Баден и третата му съпруга Анна фон Йотинген, дъщеря на граф Лудвиг XII (XI) фон Йотинген и първата му съпруга графиня Беатрикс фон Хелфенщайн.\\nАгнес се омъжва на 2 юни 1432 г. за граф Герхард VII фон Холщайн. Тя пада по стълбите през 1433 г. и преждевременно ражда близнаците Хайнрих и Катарина, които умират малки, по неизяснени причини. Адолф VIII, братът на нейния съпруг, не вярва, че тези деца са от брат му и ги присвоява. Той не допуска Агнес в Шлезвиг. Агнес бяга в Баден при брат си маркграф Якоб I фон Баден. Агнес и Якоб I имат конфликти за наследството.\\nАгнес се сгодява през 1434 г. за Ханс фон Хевен, но нейният брат Якоб I има други планове за нейната женитба със син на херцог Конрад V от Олешница от род Пясти. Той я затваря доживотно в замък Еберщайнбург, където умира ослепяла през първите седмици на 1473 г."},{"page_url":"https://ceb.wikipedia.org/wiki/Metachirus_nudicaudatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Vieraugen-Opossum_%28Metachirus_nudicaudatus%29.jpg","page_title":"Metachirus nudicaudatus","context_page_description":"Espesye sa puntil nga mananap nga una nga gihulagway ni É ang Metachirus nudicaudatus. Geoffroy Saint-Hilaire ni adtong 1803. Ang Metachirus nudicaudatus sakop sa kahenera nga Metachirus sa kabanay nga Didelphidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan."},{"page_url":"https://da.wikipedia.org/wiki/Max_Manus_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Location_%C2%ABMax_Manus%C2%BB%2C_Karl_Johan_during_WW2.jpg","page_title":"Max Manus (film)","context_page_description":"Max Manus er en norsk, biografisk krigsfilm fra 2008 baseret på den sande historie om modstandsmanden og saboteuren Max Manus. Filmen er instrueret af duoen Joachim Rønning og Espen Sandberg, og manuskriptet er skrevet af den debuterende tekstforfatter Thomas Nordseth-Tiller."},{"page_url":"https://vi.wikipedia.org/wiki/Pyrrosia_eleagnifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Pyrrosia_eleagnifolia_11.JPG","page_title":"Pyrrosia eleagnifolia","context_page_description":"Pyrrosia eleagnifolia là một loài thực vật có mạch trong họ Polypodiaceae. Loài này được Hovenkamp miêu tả khoa học đầu tiên năm 1984."},{"page_url":"https://pl.wikipedia.org/wiki/Rynarzewo_(Gda%C5%84sk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Gdu%C5%84sk_R%C3%ABnarzew%C3%B2.JPG","page_title":"Rynarzewo (Gdańsk)","context_page_description":"Rynarzewo – obszar w Gdańsku, w dzielnicy Oliwa.\\nRynarzewo jest położone na obszarze Trójmiejskiego Parku Krajobrazowego, otoczone kompleksem Lasów Oliwskich. Znajduje się tu siedziba Leśnictwa Renuszewo.\\nRozciąga się wzdłuż ul. Spacerowej, części drogi wojewódzkiej nr 218. Połączenie z centrum Oliwy umożliwiają autobusy komunikacji miejskiej.\\nW przyszłości ma krzyżować się tu z ul. Spacerową droga łącząca Lasy Oliwskie z Drogą Zieloną."},{"page_url":"https://nl.wikipedia.org/wiki/Awaous_banana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Awaous_banana_%28S1182%29_0081_%2842046747852%29.jpg","page_title":"Awaous banana","context_page_description":"Awaous banana is een straalvinnige vissensoort uit de familie van grondels. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1837 door Valenciennes."},{"page_url":"https://es.wikipedia.org/wiki/Acontecimiento_adverso_severo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Tylenol_rapid_release_pills.jpg","page_title":"Acontecimiento adverso severo","context_page_description":"Una reacción adversa grave o acontecimiento adverso severo puede ocurrir en un ensayo clínico con fármacos realizado en humanos.\\nSe define como cualquier reacción nociva y no intencionada a un medicamento en investigación, independientemente de la dosis administrada.​\\nUn RAG se establecerá cuando:\\nconlleve a la muerte,\\nponga en riesgo la vida,\\nrequiera la internación del hospitalizado o cause una prolongación de la hospitalización actual,\\nresulte en incapacidad duradera o significativa,\\nsea una malformación congénita/anomalía, o\\nrequiera intervención para evitar discapacidad o daño permanente.​\\nLa expresión \\"que pone en riesgo la vida\\" en su definición de \\"severo\\" se refiere a un acontecimiento en el cual el paciente corrió peligro de vida al momento del acontecimiento. No se refiere a un acontecimiento que, hipotéticamente, pudo haber causado la muerte si hubiera sido más grave. Además, acontecimientos adversos se definen como “cualquier ocurrencia médica inapropiada en un paciente o sujeto de investigación clínica a quien se le haya administrado un producto farmacéutico y que no necesariamente tenga que tener una relación causal con este tratamiento”.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D0%BF%D1%81%D0%BA%D0%B0%D1%8F,_%D0%9D%D0%B0%D0%B4%D0%B5%D0%B6%D0%B4%D0%B0_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%D0%9A%D1%80%D1%83%D0%BF%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B0.jpg","page_title":"Крупская, Надежда Константиновна","context_page_description":"Наде́жда Константи́новна Кру́пская, — российская революционерка, советский государственный, партийный, общественный и культурный деятель, организатор и главный идеолог советского образования и коммунистического воспитания молодёжи. Супруга 1-го председателя Совета Народных Комиссаров СССР Владимира Ильича Ленина.\\nДоктор педагогических наук. Почётный член АН СССР. Член Президиума Верховного Совета СССР. Член ЦК ВКП."},{"page_url":"https://vi.wikipedia.org/wiki/Orbessan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Orbessan_-_Place_du_village.jpg","page_title":"Orbessan","context_page_description":"Orbessan là một xã thuộc tỉnh Gers trong vùng Occitanie tây nam nước Pháp. Xã này có độ cao trung bình 168 mét trên mực nước biển."},{"page_url":"https://de.wikipedia.org/wiki/Helgoland-Klasse_(1909)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Ostfriesland_bombed_by_Mitchells_team_p19.jpg","page_title":"Helgoland-Klasse (1909)","context_page_description":"Die Helgoland-Klasse, verbreitet auch Ostfriesland-Klasse genannt, war eine Klasse von vier Großlinienschiffen der deutschen Kaiserlichen Marine. Die Schiffe dieser Klasse nahmen im Ersten Weltkrieg unter anderem an der Skagerrakschlacht teil. Alle überstanden den Krieg und wurden als Reparation an die Siegermächte übergeben."},{"page_url":"https://war.wikipedia.org/wiki/Tritonia_plebeia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Tritonia_plebeia_Johnston%2C_1828_sur_Lophogorgia_ceratophyta_%28Linnaeus%2C_1758%29.jpg","page_title":"Tritonia plebeia","context_page_description":"Tritonia plebeia in uska species han Gastropoda nga ginhulagway ni Johnston hadton 1828. An Tritonia plebeia in nahilalakip ha genus nga Tritonia, ngan familia nga Tritoniidae. Waray hini subspecies nga nakalista."},{"page_url":"https://eo.wikipedia.org/wiki/Neulles","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Neulles_eg2.JPG","page_title":"Neulles","context_page_description":"Neulles estas franca komunumo en la departemento Charente-Maritime, en la regiono Puatuo-Ĉarentoj. Ĝi havis 153 loĝantojn en la jaro 2012."},{"page_url":"https://de.wikipedia.org/wiki/Johann_von_Waldburg-Wolfegg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Meersburg_Steigstra%C3%9Fe_Wappen_Bischof_Johannes_von_Waldburg.jpg","page_title":"Johann von Waldburg-Wolfegg","context_page_description":"Johann von Waldburg-Wolfegg, auch Johann von Waldburg zu Wolfegg oder Johann Constanz Graf Truchseß von Waldburg-Wolfegg war Abt des Klosters Reichenau und von 1628 bis 1644 Fürstbischof von Konstanz."},{"page_url":"https://en.wikipedia.org/wiki/Five_Corners,_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Five_Corners%2C_Lake_County%2C_Oregon%2C_2016.jpg","page_title":"Five Corners, Oregon","context_page_description":"Five Corners is an unincorporated community in Lake County in the U.S. state of Oregon. It lies along Oregon Route 140 about 4 miles west of Lakeview."},{"page_url":"https://en.wikipedia.org/wiki/Metrobus_fleet_(Washington,_D.C.)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/WMATA_5232.jpg","page_title":"Metrobus fleet (Washington, D.C.)","context_page_description":"This is a roster of the bus fleet of Metrobus, the fixed-route bus service run by the Washington Metropolitan Area Transit Authority in Washington, D.C.."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BB%D0%B5%D1%88%D1%82%D0%B8_(%D0%92%D0%B0%D1%81%D0%BB%D1%83%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Solesti_jud_Vaslui.png","page_title":"Солешти (Васлуй)","context_page_description":"Солешти — коммуна в составе жудеца Васлуй."},{"page_url":"https://de.wikipedia.org/wiki/Flagge_Amsterdams","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Februaristakingvlag.svg","page_title":"Flagge Amsterdams","context_page_description":"Die Flagge von Amsterdam ist die offizielle Flagge der niederländischen Hauptstadt Amsterdam. Sie besteht aus drei horizontalen Streifen Rot-Schwarz-Rot und zeigt auf dem schwarzen Streifen drei weiße Andreaskreuze. Eingeführt wurde sie am 5. Februar 1975."},{"page_url":"https://vi.wikipedia.org/wiki/Hvozd,_Plze%C5%88-sever","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Hvozd_-_kapli%C4%8Dka.JPG","page_title":"Hvozd, Plzeň-sever","context_page_description":"Hvozd là một làng thuộc huyện Plzeň-sever, vùng Plzeňský, Cộng hòa Séc."},{"page_url":"https://sv.wikipedia.org/wiki/Alprosen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Alprosen%2C_B%C3%A4llstav%C3%A4gen%2C_april_2019.jpg","page_title":"Alprosen","context_page_description":"Alprosen kallas ett flerbostadshus vid Bällstavägen 28 i stadsdelen Mariehäll i Västerort, Stockholms kommun. Byggnaden färdigställdes 2018 och nominerades till Årets Stockholmsbyggnad 2019."},{"page_url":"https://en.wikipedia.org/wiki/Ak%C4%B1n_Eldes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Ak%C4%B1n_Eldes_Izmir.JPG","page_title":"Akın Eldes","context_page_description":"Akın Eldes is a prominent Turkish guitarist, who is best known for his work with Bulutsuzluk Özlemi between 1986–2000. He was born in Frankfurt, Germany, and played mandolin and flute as a child. Eldes started playing the guitar in high school. He played with the bands E-5, Painted Bird, Asım Can Gündüz, singer-songwriter Bülent Ortaçgil, bassist Gürol Ağırbaş, composer Melih Kibar and Çapkınlar among others prior to joining Bulutsuzluk Özlemi. Nowadays, he is playing with a Turkish rock band Pinhani.\\nEldes is a respected session musician and also has six solo albums which tell his musical aspect; Kafi, Türlü, Cango, Ara Taksim, Başka Türlü and Hane-i Akustik. Akın Eldes's unique technique and the characteristic sound make him different from other guitarists in the world."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BF%D0%BE%D0%BA%D0%B0%D0%BB%D1%96%D0%BF%D1%81%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Saint_John_on_Patmos.jpg","page_title":"Апокаліпсис","context_page_description":"Апока́ліпсис, або Об'я́влення Іва́на Богосло́ва — остання книга Нового Завіту та один з найдавніших творів християнської літератури.\\nАпокаліпсис написано Іоанном Богословом на острові Патмос після видіння на засланні в 90 рр. I ст. Провіщаючи кінець світу, друге пришестя Христа та тисячолітнє Царство Боже після Страшного Суду, Апокаліпсис містить у собі таємниче зображення майбутньої долі Церкви Христової та всього світу і це єдина книга зі всього Нового Заповіту, — яку, разом з пророчими книгами Старого Заповіту, — можна за жанром повністю віднести до так званої «пророчої літератури».\\nПечеру Апокаліпсису та Монастир Іоанна Богослова, що на острові Патмос, нині внесено ЮНЕСКО до переліку об'єктів світової спадщини."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_personnalit%C3%A9s_f%C3%A9minines_historiques_repr%C3%A9sent%C3%A9es_dans_la_statuaire_publique_parisienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Statue_Sarah_Bernhardt_Fran%C3%A7ois_Sicard_Paris.jpg","page_title":"Liste des personnalités féminines historiques représentées dans la statuaire publique parisienne","context_page_description":"Cet article recense les personnalités féminines représentées dans la statuaire publique à Paris, en France."},{"page_url":"https://es.wikipedia.org/wiki/Arthaz-Pont-Notre-Dame","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Blason_ville_fr_Arthaz-Pont-Notre-Dame.svg","page_title":"Arthaz-Pont-Notre-Dame","context_page_description":"Arthaz-Pont-Notre-Dame es una población y comuna francesa, en la región de Auvernia-Ródano-Alpes, departamento de Alta Saboya, en el distrito de Saint-Julien-en-Genevois y cantón de Annemasse-Sud."},{"page_url":"https://nl.wikipedia.org/wiki/Cornelis_Ketel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Company_of_Captain_Rosecrans_Ketel.jpg","page_title":"Cornelis Ketel","context_page_description":"Cornelis Ketel was een Nederlands maniëristisch schilder."},{"page_url":"https://en.wikipedia.org/wiki/Lithuanian_Soviet_Socialist_Republic","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Stamp_of_USSR_2084.jpg","page_title":"Lithuanian Soviet Socialist Republic","context_page_description":"The Lithuanian Soviet Socialist Republic, also known as Soviet Lithuania or Lithuania, was one of the constituent republics of the USSR between 1940–1941 and 1944–1990. After 1946, its territory and borders mirrored those of today's Republic of Lithuania, with the exception of minor adjustments of the border with Belarus.\\nDuring World War II, the previously independent Republic of Lithuania was occupied by the Soviet army on 16 June 1940, in conformity with the terms of the 23 August 1939 Molotov–Ribbentrop Pact, and established as a puppet state on 21 July. Between 1941 and 1944, the German invasion of the Soviet Union caused its de facto dissolution. However, with the retreat of the Germans in 1944–1945, Soviet hegemony was re-established and continued for forty-five years. As a result, many western countries continued to recognize Lithuania as an independent, sovereign de jure state subject to international law, represented by the legations appointed by the pre-1940 Baltic states, which functioned in various places through the Lithuanian Diplomatic Service.\\nOn 18 May 1989, the Lithuanian SSR declared itself to be a sovereign state, though still part of the USSR."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A7%D9%81%D8%BA%D8%A7%D9%86%D8%B3%D8%AA%D8%A7%D9%86_%D8%AF%DB%92_%D8%B3%D8%B1%D8%A8%D8%B1%D8%A7%DB%81%D8%A7%DA%BA_%D8%AF%DB%8C_%D9%84%D8%B3%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Hamid_Karzai_2004-06-14.jpg","page_title":"افغانستان دے سربراہاں دی لسٹ","context_page_description":"ایہ افغانستان دے سربراہان دی فہرست اے۔"},{"page_url":"https://et.wikipedia.org/wiki/Arvutusl%C3%BCkati","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Sliderule.PickettN902T.agr.jpg","page_title":"Arvutuslükati","context_page_description":"Arvutuslükati ehk lükati on mehaaniline analoogarvuti. Seda kasutatakse peamiselt korrutamiseks ja jagamiseks, samuti ka juurimisel, logaritmide ja trigonomeetriliste funktsioonide arvutamisel. Sellega on võimalik ka liita ja lahutada. Tänapäeval on elektronarvutid arvutuslükatid kasutusest välja tõrjunud.\\nArvutuslükati leiutati 1620. aastal inglise matemaatiku ja topograafi Edmund Gunteri poolt. Gunter avastas, et skaalade abil saab korrutada ja jagada. Algne lükati koosnes ühestainsast skaalast, ja sellega arvutamisel võeti abiks mõõtsirkel. Inglise matemaatik William Oughtred täiendas 1622. aastal lükati kontseptsiooni, pakkudes välja kahe võrdse ja teineteise suhtes nihutatava skaala kasutamise. 1654 aastal leiutati lükati \\"keel\\"."},{"page_url":"https://ro.wikipedia.org/wiki/Petre_Iorgulescu-Yor","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Petre_Iorgulescu_Yor_-_Peisaj_industrial.jpg","page_title":"Petre Iorgulescu-Yor","context_page_description":"Petre Iorgulescu-Yor a fost un pictor român.\\nA fost un romantic care nu și-a dus revolta până la capăt, un suflet neliniștit, permanent preocupat de înnoirea mijloacelor de expresie.\\nViața sa cunoaște un traseu agitat, într-un climat de efervescență care nu era numai al epocii, ci și al spiritului său neliniștit.\\nAbsolvent al Facultății de Drept din Iași în anul 1914, Iorgulescu se desparte fără regrete de o carieră politică, impusă de familie și se dedică pe deplin artei. În 1919 pleacă la Paris și studiază la Academia Julian, apoi la Academia modernă la clasa profesorilor Othon Friesz și Maurice Denis.\\nDebutează ca artist la Salonul Oficial francez, unde a organizat prima sa expoziție personală de desene, manifestare elogios primită de presa franceză a vremii.\\nÎn anul 1927, Iorgulescu-Yor a pictat, împreună cu prietenul său, artistul Vasile Popescu, într-un sat de pe malul Siretului, iar în perioada cuprinsă între anii 1928 - 1939, a expus la Salonul Oficial București.\\nYor excelează ca peisagist, fiind atras îndeosebi de farmecul Balcicului, de atmosfera medievală a Sighișoarei, de satele transilvănene sau de așezările din sudul țării."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%82%BD%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Mosaico_de_Mesoam%C3%A9rica.jpg","page_title":"メソアメリカ","context_page_description":"メソアメリカは、メキシコおよび中央アメリカ北西部とほぼ重複する地域において、共通的な特徴をもった農耕民文化ないし様々な高度文明が繁栄した文化領域を指し、パウル・キルヒホフの文化要素の分布研究により定義された。地理的には、北はメキシコのパヌコ川からシナロア川あたりまで、南はホンジュラスのモタグァ河口あたりからコスタリカのニコヤ湾あたりまでであるが、この境界線は歴史的に一定していたわけではない。\\n下記のように壮麗な神殿ピラミッドなどを現在も残すメソアメリカ文明が繁栄した地域であるメソアメリカでは、\\n定住農村村落の成立\\nオルメカ文明\\nテオティワカン文明\\nマヤ文明\\nトルテカ文明\\nサポテカ文明\\nミシュテカ文明\\nタラスカ王国\\nアステカ帝国\\nなどが興亡した。\\nこれらの文化はアジア、ヨーロッパ、アフリカの三大陸の文明との交流を経験せず、地理的に孤立した環境で発展した。そのため、製鉄技術を知らず、宗教においても独自な体系を成立させるなど、他大陸の文明とは際立った特徴を有していた。\\n神殿文化は紀元前二千年紀の末に起こり、それから約2500年の間、外部世界の影響や干渉を受けることなく自力で発展し続けた。ところが15世紀の末、コロンブスに率いられたスペイン人が突然侵入してきた。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Hainewalde","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Hainewalde_Kirche_08.jpg","page_title":"Liste der Kulturdenkmale in Hainewalde","context_page_description":"In der Liste der Kulturdenkmale in Hainewalde sind die Kulturdenkmale der sächsischen Gemeinde Hainewalde verzeichnet, die bis Mai 2018 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://pl.wikipedia.org/wiki/Tania_Evans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Culture_Beat.jpg","page_title":"Tania Evans","context_page_description":"Tania Evans – brytyjska wokalistka muzyki eurodance. Od 1993 do 1997 związana była z grupą Culture Beat. Rodzina Tanii pochodzi z Jamajki."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Blons","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/PfarrkircheBlons.jpg","page_title":"Pfarrkirche Blons","context_page_description":"Die Pfarrkirche Blons steht im Ort Blons in der Gemeinde Blons im Großen Walsertal in Vorarlberg. Die römisch-katholische Pfarrkirche Unserer Lieben Frau der Unbefleckten Empfängnis gehört zum Dekanat Walgau-Walsertal in der Diözese Feldkirch. Die Kirche und der Friedhof stehen unter Denkmalschutz."},{"page_url":"https://en.wikipedia.org/wiki/2004_Osama_bin_Laden_video","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/20041029-18_bush_statement.jpg","page_title":"2004 Osama bin Laden video","context_page_description":"On October 29, 2004, at 21:00 UTC, al Jazeera broadcast excerpts allegedly from a videotape of Osama bin Laden addressing the people of the United States; in this video, he accepts responsibility for the September 11 attacks, condemns the Bush government's response to those attacks, and presents those attacks as part of a campaign of revenge and deterrence motivated by his witnessing of the destruction in the Lebanese Civil War in 1982. News analysts speculated that the release of the video was timed to influence the 2004 U.S. presidential election, which would take place four days later."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BC%D0%B0%D0%BD%D0%B4%D1%8B%D2%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Policeman.jpg","page_title":"Мамандық","context_page_description":"Мамандық– қызметкердің кәсіп шегіндегі қызметінің нақты саласы. Ол лауазымнан өзгеше түрде белгілі бір білімді және арнаулы түрде оқып-үйрену немесе жұмыс тәжірибесін жинақтау барысында алған еңбек машықтарын талап ететін еңбек қызметінің тегін сипаттайды. Лауазымдық міндеттердің шеңберін айқындайды. Мамандық қызметкер еңбегінің бүкіл шеңберін қамтығанда ол кәсіп ұғымына сай келеді.\\nМамандық - адамнан арнаулы білім, еңбек дағдылары мен іскерлікті талап ететін еңбек іс-әрекетінің түрі."},{"page_url":"https://cy.wikipedia.org/wiki/Konkerel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Conquereuil_mairie.jpg","page_title":"Konkerel","context_page_description":"Mae Konkerel yn gymuned yn Departamant Liger-Atlantel, yng ngwlad Llydaw a rhanbarth Ffrengig Pays de la Loire. Mae'n ffinio gyda Derval, Guémené-Penfao, Marsac-sur-Don, Pierric ac mae ganddi boblogaeth o tua 1,116.\\nYn yr erthygl hon, cyfieithir y termau brodorol kumunioù a communes i \\"gymuned\\" yn Gymraeg"},{"page_url":"https://br.wikipedia.org/wiki/January_Suchodolski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/January_Suchodolski.PNG","page_title":"January Suchodolski","context_page_description":"January Suchodolski a oa ul livour polonat. Breur e oa d'ar barzh Rajnold Suchodolski, lesanvet Rajnolda."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%97%D7%A1%D7%99_%D7%94%D7%95%D7%A0%D7%92%D7%A8%D7%99%D7%94%E2%80%93%D7%A1%D7%9C%D7%95%D7%91%D7%A0%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Gyurcs%C3%A1ny_Ferenc_%C3%A9s_Janez_Jan%C5%A1a.JPG","page_title":"יחסי הונגריה–סלובניה","context_page_description":"יחסי הונגריה–סלובניה הם היחסים הדיפלומטיים הרשמיים שבין הונגריה לבין רפובליקת סלובניה."},{"page_url":"https://pt.wikipedia.org/wiki/Campeonato_Mundial_de_F%C3%B3rmula_1_de_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Kevin_Magnussen_%2833931751311%29.jpg","page_title":"Campeonato Mundial de Fórmula 1 de 2017","context_page_description":"A temporada de Fórmula 1 de 2017 foi a 68ª temporada do Campeonato Mundial de Fórmula 1 da FIA. Com a saída do GP da Alemanha, a temporada teve vinte etapas. Iniciou-se em 26 de março de 2017 em Melbourne e terminou em Abu Dhabi no dia 26 de novembro. A equipe Mercedes foi a campeã de equipe de construtores no Grande Prêmio dos Estados Unidos e também campeã de pilotos com o britânico Lewis Hamilton, que conquistou o tetracampeonato mundial no Grande Prêmio do México. O também tetracampeão, o alemão Sebastian Vettel foi vice-campeão."},{"page_url":"https://en.wikipedia.org/wiki/Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Portland%2C_Oregon_skyline_from_the_Ross_Island_Bridge.jpg","page_title":"Oregon","context_page_description":"Oregon is a state in the Pacific Northwest region on the West Coast of the United States. The Columbia River delineates much of Oregon's northern boundary with Washington, while the Snake River delineates much of its eastern boundary with Idaho. The 42° north parallel delineates the southern boundary with California and Nevada.\\nOregon has been home to many Indigenous nations for thousands of years. The first European traders, explorers, and settlers began exploring what is now Oregon's Pacific coast in the early-mid 1500s. As early as 1565, the Spanish began sending vessels northeast from the Philippines, riding the Kuroshio Current in a sweeping circular route across the northern part of the Pacific. In 1592, Juan de Fuca undertook detailed mapping and studies of ocean currents in the Pacific Northwest, including the Oregon coast as well as the strait now bearing his name. Spanish ships – 250 in as many years – would typically not land before reaching Cape Mendocino in California, but some landed or wrecked in what is now Oregon."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%85%D9%88%D9%86%D8%AA%D9%87%D8%A7_%DA%AF%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Entrada_x_yumbel.jpg","page_title":"امونتها گلا","context_page_description":"امونتها گلا، شیلیده یئرلشن بیر شهردیر."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Le_Plessis-H%C3%A9bert","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Map_commune_FR_insee_code_27465.png","page_title":"Le Plessis-Hébert","context_page_description":"Le Plessis-Hébert sī ūi-tī Hoat-kok Haute-Normandie tōa-khu Eure séng ê chi̍t-ê commune."},{"page_url":"https://it.wikipedia.org/wiki/Karl_Friedrich_Schinkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Dennewitz_Denkmal.jpg","page_title":"Karl Friedrich Schinkel","context_page_description":"Karl Friedrich Schinkel è stato un architetto ed un pittore prussiano.\\nFu uno dei maggiori architetti del neoclassicismo tedesco, pur facendo convivere nella propria formazione influssi romantici e idealisti e pur essendo stato fu tra i primi in Germania a rivalorizzazione le forme gotiche in architettura.\\nCome regio architetto capo, con un gusto sobrio e classicheggiante, influenzò profondamente lo stile architettonico ufficiale della Prussia realizzando prestigiosi monumenti che diedero un nuovo assetto architettonico al centro della capitale Berlino."},{"page_url":"https://fi.wikipedia.org/wiki/Matkustajalentokone","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Airbus_A346_F-WWCA.jpg","page_title":"Matkustajalentokone","context_page_description":"Matkustajalentokone tai liikennelentokone on lentokone, jonka liikennöinnin tarkoituksena on kuljettaa matkustajia. Pääosa näistä lentokoneista lentää reittilentoja, mutta lisäksi paljon on turismiin liittyviä charter-lentoja. Yleensä matkustajakoneista on kehitetty myös rahtiversio."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%8C%D1%86%D0%B5%D0%BB%D1%8C,_%D0%9E%D1%81%D0%BA%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/ru/0/04/Oskar_Walzel.jpg","page_title":"Вальцель, Оскар","context_page_description":"Óскар Вáльцель — австрийский и немецкий литературовед, профессор, преподаватель в университетах Берна, Дрездена и Бонна."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%85%D9%84%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Carmelit_2018_Golomb_platforms.jpg","page_title":"كرمليت","context_page_description":"كرمليت هي وسيلة نقل عامة تحت الأرض والوحيدة في إسرائيل. وخلافًا للاعتقاد الشائع هو ليس مترو وإنما قطار جبلي مائل. هناك ما يماثله في العديد من المدن حول العالم مثل تونيل في إسطنبول، ومونتي سانتو في نابولي، وليكابيتوس في أثينا، وغيرها.\\nيربط الكرمليت ثلاث مناطق مركزية في حيفا، وهي. للكرمليت مسار واحد يشمل ست محطات. تشغله شركة «كرمليت حيفا المحدودة». بدأت أعمال إنشائه في مايو 1956 وانتهت في مارس 1959.\\nأُغلق الكرمليت في عام 1986 لحاجته للصيانة وأُعيد فتحه في سبتمبر 1992 بعد تجديدات واسعة. وأُغلق مرة أُخرى في مارس وحتى يوليو 2015 بسبب خطأ تقني في الكابل. وأخيرًا أُغلق في فبراير 2017 لأعمال صيانة بعدما اندلع حريق، وأُعيد فتحه في أكتوبر 2018."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D0%B8%D1%87%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Czerniczyn_cmentarz9.jpg","page_title":"Черничин","context_page_description":"Черничин — село в Польщі, у гміні Грубешів Грубешівського повіту Люблінського воєводства.\\nНаселення — 692 особи.\\nРозташоване на українському Закерзонні."},{"page_url":"https://eu.wikipedia.org/wiki/SC_Natzab","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/SC_Natzab.jpg","page_title":"SC Natzab","context_page_description":"Sc Natzab, euskal transfeminista ekintzailea, pertsona transexualen eskubideen defendatzailea eta bere bizi-esperientziatik abiatuta transexualitatearen despatologizazioaren aldeko borrokan aritua da. 2016tik aurrera Grezian zehar eta Lesbos uhartean errefuxiatuen egoera hurbiletik jarraitu du."},{"page_url":"https://sl.wikipedia.org/wiki/Svrljig","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Svrljig.jpg","page_title":"Svrljig","context_page_description":"Svrljig je naselje v Srbiji, ki je središče istoimenske občine; slednja pa je del Niškega upravnega okraja."},{"page_url":"https://es.wikipedia.org/wiki/Relaciones_Argentina-Santa_Sede","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Argentina_Holy_See_Locator.png","page_title":"Relaciones Argentina-Santa Sede","context_page_description":"Las relaciones Argentina–Santa Sede se refiere a las relaciones bilaterales entre Argentina y la Santa Sede. El actual papa, Francisco, fue anteriormente arzobispo de Buenos Aires."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%9C%E3%83%AC%E3%83%BC%E3%83%BB%E3%82%B9%E3%83%97%E3%83%AA%E3%83%B3%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/%2790-%2791_Chevrolet_Sprint_CL_Convertible.jpg","page_title":"シボレー・スプリント","context_page_description":"スプリントは、シボレーがかつて製造・販売していた小型乗用車である。"},{"page_url":"https://gl.wikipedia.org/wiki/Euroliga_2006-07","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Animadoras.JPG","page_title":"Euroliga 2006-07","context_page_description":"A Euroliga 2006-07 foi a sétima edición da máxima competición de clubs de baloncesto de Europa dende a súa organización pola Unión de Ligas Europeas de Baloncesto. Incluíndo as edición desta competición organizadas por FIBA Europa é a edición número cincuenta. Nesta edición compitiron vinte e catro equipos de trece estados distintos.\\nOs catro mellores equipos, nesta edición o Panathinaikos grego, o Tau Cerámica e Unicaja españois e o CSKA Moscow ruso disputaronse o título na Final Four, nesta edición disputada no Olympic Indoor Hall de Atenas, capital de Grecia. A final disputárona o Panathinaikos de Atenas, que xogaba no seu pavillón habitual, e o CSKA de Moscova. Finalmente proclamouse campión o equipo grego tras vencer por tan só dous puntos de diferenza, 93 a 91, o que supuxo o seu quinto campionato até esta edición."},{"page_url":"https://bs.wikipedia.org/wiki/IC_4086","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/IC4086_-_SDSS_DR14.jpg","page_title":"IC 4086","context_page_description":"IC 4086 je spiralna galaksija i nalazi se u sazviježđu Lovački psi. Prvo otkriće je napravio Charles Joseph Etienne Wolf 21. marta 1903. godine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D1%8C%D1%84_(%D0%BF%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D0%B5%D1%82-%D0%BF%D1%83%D0%BB%D0%B5%D0%BC%D1%91%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Oleksiyenko_Elf-1_gun%2C_07.jpg","page_title":"Эльф (пистолет-пулемёт)","context_page_description":"Эльф — пистолет-пулемёт, созданный киевским Конструкторским бюро специальной техники в первой половине 1990-х годов."},{"page_url":"https://en.wikipedia.org/wiki/Neuroanatomy_of_intimacy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Love-triangle.jpg","page_title":"Neuroanatomy of intimacy","context_page_description":"Even though intimacy has been broadly defined in terms of romantic love and sexual desire, the neuroanatomy of intimacy needs further explanation in order to fully understand their neurological functions in different components within intimate relationships, which are romantic love, lust, attachment, and rejection in love. Also, known functions of the neuroanatomy involved can be applied to observations seen in people who are experiencing any of the stages in intimacy. Research analysis of these systems provide insight on the biological basis of intimacy, but the neurological aspect must be considered as well in areas that require special attention to mitigate issues in intimacy, such as violence against a beloved partner or problems with social bonding."},{"page_url":"https://en.wikipedia.org/wiki/Islet_off_NE_Groote_Eylandt_Important_Bird_Area","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Roseate_Tern_LEI06.JPG","page_title":"Islet off NE Groote Eylandt Important Bird Area","context_page_description":"The Islet off NE Groote Eylandt Important Bird Area comprises a small, unnamed, sand and rock island off the north-eastern coast of Groote Eylandt in the Gulf of Carpentaria, northern Australia. It lies halfway between the north-eastern tip of Groote Eylandt and the North East Islands and is traditionally owned Aboriginal land. It has been identified by BirdLife International as an Important Bird Area because it supports over 1% of the world population of roseate terns, with reported numbers of from 2000 to 5500 individual birds present. Up to 500 bridled terns have been recorded nesting there, as well as up to 20 black-naped terns. Marine turtles also nest on the island."},{"page_url":"https://fr.wikipedia.org/wiki/Planti%C3%A8res_Queuleu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Eglise_Metz_Queuleu.jpg","page_title":"Plantières Queuleu","context_page_description":"Plantières Queuleu est un quartier de Metz constitué de l’ancienne commune de Plantières et de l’urbanisation de la pente du fort de Queuleu, le quartier est rattaché à la commune de Metz depuis 1906.\\nSes habitants sont nommés les Cuculotins."},{"page_url":"https://ast.wikipedia.org/wiki/Falanxe_macedonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Phalange_oblique.gif","page_title":"Falanxe macedonia","context_page_description":"La falanxe macedonia yera una formación d'infantería creyada ya usada por Filipu II y más sero pol so fíu Alexandru Magnu na conquista de Persia. Esta formación predominaba nes batalles demientres la dómina helenística, hasta ser reemplazada poles lexones romanes.\\nFilipu II pasó parte de la so xuventú como rehén en Tebes, au estudió xunto al conocíu xeneral Epaminondes, cuyes reformes foron la base de la falanxe. Epaminondes, al mandu del exércitu de Tebes, baltó a la falanxe clásica d'Esparta, con un exércitu numbéricamente inferior en Leuctra.\\nEpaminondes llogró esi trunfu gracies a la so innovación táutica, que consistía en disponer el gruesu de la falanxe, formáu por hoplites, en ángulu oblicu, de drecha a esquierda, y concentrar na izquierda un cuadru d'hoplites de mediu centenar d'homes de fondu que frayaba la llinia de la falanxe enemiga, muncho menos fonda. Gracies a la formación n'ángulu, la falanxe tebana avanciaba sobrepasando al contrariu per esi puntu arrodiándolu. Esti modelu denomose \\"martiellu\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Ouragan_Nate_(2005)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Hurricane_Nate_Sept_6_05.jpg","page_title":"Ouragan Nate (2005)","context_page_description":"L'ouragan Nate a été le 14ᵉ cyclone tropical et le 7ᵉ ouragan de la saison cyclonique 2005 dans le bassin de l'océan Atlantique. C'est la première utilisation du nom Nate pour un cyclone tropical."},{"page_url":"https://et.wikipedia.org/wiki/Liivimaa_maamarssal","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Gustav_von_Mengden.jpg","page_title":"Liivimaa maamarssal","context_page_description":"Liivimaa maamarssal oli 1643–1920 kohaliku aadli omavalitsuse ehk rüütelkonna kõrgem ametnik Liivimaal, kelle ülesandeks oli juhatada rüütelkonna üldkoosolekut ehk maapäeva. 18. sajandist alates oli maamarssali ülesandeks esindada ka rüütelkonna huve keskvõimu juures.\\nTeatud perioodidel ei olnud poliitiliste ja administratiivsete probleemide või sõjaolukorra tõttu maamarssalit ametis. Esimene periood kestis 20. detsembrist 1694 28. jaanuarini 1710. Selle põhjuseks oli rüütelkonna vastutegevus Rootsi keskvõimule ja 1700 alanud Põhjasõda. Aastatel 1695–1700 täitis maamarssali kohuseid maapäeva direktor, kelle ülesanded olid sisuliselt maamarssali ülesannetega sarnased. Balti erikorra kaotamise tõttu likvideeriti maamarssali ametikoht uuesti 3. juulil 1783 ja taastati alles keiser Paul I poolt 28. novembril 1796. Vahepealsel perioodil korraldas maapäevade tööd niinimetatud aadlimarssal.\\nKui maamarssal ei saanud mingitel põhjustel oma kohustusi täita ja astus enneaegselt tagasi või tagandati, siis võis kuni uute korraliste valimisteni valida tema asemele ajutise kohusetäitja.\\nAlgselt valiti maamarssal ametisse kolmeks aastaks."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Sassari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Stazione_di_sassari%2C_veduta.JPG","page_title":"Stazione di Sassari","context_page_description":"Stazione di Sassari vasútállomás Olaszországban, Szardínia régióban, Sassari településen."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%AC%D5%A5%D6%80%D5%AB_%D4%BF%D5%AB%D6%80%D5%AD%D5%A2%D5%A5%D6%80%D5%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kirchberg_1.jpg","page_title":"Իլերի Կիրխբերգ","context_page_description":"Իլերի Կիրխբերգ, կոմունա Գերմանիայի Բադեն Վյուրտեմբերգ երկրամասում։\\nՄտնում է Բիբերախ շրջանի կազմում։ Բնակչությունը կազմում է 1910 մարդ ։ Տարածքը կազմում է 18,64 կմ²։ Պաշտոնական կոդ՝ 08 4 25 065։"},{"page_url":"https://eu.wikipedia.org/wiki/Cabanes_(Alt_Empord%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Fira_de_la_Canya_a_la_pla%C3%A7a_de_l%27esgl%C3%A9sia_de_Cabanes_%28Alt_Empord%C3%A0%29.jpg","page_title":"Cabanes (Alt Empordà)","context_page_description":"Cabanes Gironako udalerria da, Alt Empordà izeneko eskualdean kokatuta dagoena. 15,06 km²-ko azalera du eta 2009ko urtarrilaren 1eko erroldaren arabera 932 biztanle zituen."},{"page_url":"https://nl.wikipedia.org/wiki/Angwantibo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/ArctocebusCalabarensisWolf.jpg","page_title":"Angwantibo","context_page_description":"De angwantibo, ook wel gewone angwantibo of beermaki is een soort van het geslacht angwantibo's. De soort komt voor in West-Afrika."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%88%D8%B2%D9%88_(%D8%A5%D9%8A%D8%B4%D9%8A%D9%83%D8%A7%D9%88%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Suzu_City_Hall.jpg","page_title":"سوزو (إيشيكاوا)","context_page_description":"مدينة سوزو ‏ هي إحدى المدن التابعة لمحافظة إيشيكاوا. تأسست رسميًا في 15/07/1954. ويقدر عدد سكانها بـ 17111 نسمة حسب تقدير مكتب الإحصاء الياباني لعام 2012. تبلغ مساحة سوزو 247.2 كم². بكثافة سكانية تبلغ 69.2 نسمة/كم²."},{"page_url":"https://en.wikipedia.org/wiki/Pshaveli","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Village_pshaveli.jpg","page_title":"Pshaveli","context_page_description":"Pshaveli is a village in the Telavi district of Georgia."},{"page_url":"https://es.wikipedia.org/wiki/La_voz_(M%C3%A9xico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/080717_show_trevi06.jpg","page_title":"La voz (México)","context_page_description":"La voz, también conocido como La voz... México de 2011 a 2018, es un reality show y concurso de talentos mexicano, basado en el formato de The Voice, originado en Países Bajos y parte de la franquicia internacional The Voice creada por el productor de televisión holandés John de Mol bajo su empresa Talpa Media Holding.​ México ha sido el primer país de habla hispana en adaptar este formato y de los primeros 7 de manera global.\\nLa primera versión de este reality show en México, fue producida por Televisa con Miguel Ángel Fox como productor ejecutivo. La primera edición inició el 11 de septiembre del 2011 con la conducción de Mark Tacher con Cynthia Urias tras bambalinas. Desde su estreno el programa obtuvo grandes registros de audiencia que superaron a la competencia de otros canales.​\\n​\\nTelevisa produjo 7 ediciones y una versión «Kids» entre 2011 y 2018. La segunda edición inició el 9 de septiembre de 2012, la tercera edición inició el día 8 de septiembre de 2013, la cuarta edición comenzó el 7 de septiembre de 2014 y la quinta, el 24 de abril de 2016."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%91%EC%86%8C_(%EB%8C%80%EC%A4%91%EA%B5%90%ED%86%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/AMTSBLG.JPG","page_title":"엑소 (대중교통)","context_page_description":"엑소는 캐나다 퀘벡주 교통부 산하에 있는 정부기관으로, 1995년 12월 15일에 광역교통기구 관련법 에 따라 창설되고 이듬해 1월 1일에 그 활동을 시작하였다. 엑소는 광역 몬트리올 지역에 광역 버스 및 통근 열차를 운행하며, 이 지역에서 몬트리올 교통공사, 롱괴이 교통망, 라발 교통공사 가 운행하지 않는 곳에 시내버스를 별도로 운행한다."},{"page_url":"https://sl.wikipedia.org/wiki/Ipavci","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/%C5%A0entjur_-_rojstna_hi%C5%A1a_skladateljev_Ipavcev_%28ve%C5%BEa%29.jpg","page_title":"Ipavci","context_page_description":"Ipavci [ípawci] so slovenska rodbina, ki izhaja iz Bele krajine, od koder prihaja njen prvi vidnejši predstavnik, Jurij Ipavec. Ipavci so bili po izobrazbi zdravniki, po srcu pa glasbeniki oz. skladatelji. Večina predstavnikov tega rodu se je šolala v Gradcu, nekateri pa tudi na Dunaju, torej v kulturnih mestih Evrope. Rodbina Ipavcev predstavlja pomemben dejavnik v razvoju slovenske kulture v času avstro-ogrske oblasti.\\nNajpomembnejši predstavniki te rodbine so:\\nJurij Ipavec\\nFranc Ipavec\\nKatarina Schweighofer\\nAlojz Ipavec\\nBenjamin Ipavec\\nGustav Ipavec\\nJosip Ipavec\\nIgor Grdina ugotavlja, da še ni povsem znan izvor Ipavcev. Sam je prišel do podatka, da se prvi priimek Ipavcev pojavi v 17. stoletju v belokranjskih matičnih knjigah. Po priimku Vipavec, kasneje Ipavec, so spoznali odsluženega vojaškega ranocelnika Jurija, ki je živel v belokranjskem kraju Gradac. Z njegovima sinovoma Matijo in Francem se začneta dve veji poznanih Ipavcev.\\nŽivljenje Ipavcev si je skozi razstavo in v navidezni resničnosti možno ogledati v muzeju Ipavčeva hiša v Šentjurju."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E5%B7%9E%E5%B8%82%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/%E9%BE%99%E9%AA%A7%E5%A4%A7%E8%A1%9712%E3%80%8114%E5%8F%B7%E6%B0%91%E5%B1%85.jpg","page_title":"广州市历史建筑列表","context_page_description":"本條目是關於在廣州市內的歷史建築的介紹。"},{"page_url":"https://fr.wikipedia.org/wiki/Hyperfocale","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Hyperfocale_avec_DPN_%C3%A0_l%27infini.png","page_title":"Hyperfocale","context_page_description":"En optique et en photographie, la distance hyperfocale – souvent remplacée par le substantif hyperfocale – est une distance liée à la profondeur de champ qui peut être définie de deux manières légèrement différentes.\\nL’hyperfocale est la distance minimum à laquelle il est possible de faire la mise au point tout en gardant les objets situés à l'infini avec une netteté acceptable. La mise au point à cette distance permet d'obtenir la plus grande plage de netteté acceptable qui s'étend alors de la moitié de cette distance à l'infini.\\nPour une mise au point à l'infini, l’hyperfocale est la distance au-delà de laquelle tous les objets ont une netteté acceptable.\\nElle dépend de la focale utilisée, du nombre d'ouverture et de la limite angulaire de netteté ou du diamètre du cercle de confusion."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%86%D8%A7%D8%AE_%D9%85%D8%AA%D9%88%D8%B3%D8%B7%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Map_world_climate_zones_%28simplified_to_10%29-fr.svg","page_title":"مناخ متوسطي","context_page_description":"المناخ المتوسطي أو مناخ الصيف الحار هو المناخ السائد في حوض البحر المتوسط.\\nيتم تعريف المناخ المتوسطي بشتاء ممطر مع صيف دافئ إلى حار. رغم أن تسمية المناخ تأتي من البحر المتوسط، منطقة حيث هذا المناخ جد شائع، فإنه حاضر في مناطق أخرى من الكوكب، مع تغيرات في التوزيع الحراري.\\nفبالإضافة إلى البحر المتوسط، يمكن معاينة هذا المناخ في غالبية كاليفورنيا بالولايات المتحدة الأمريكية، مناطق في غرب وجنوب أستراليا، جنوب غرب جنوب افريقيا وآسيا الوسطى وفي وسط تشيلي.\\nخارج الحوض المتوسطي، يتموقع المناخ المتوسطي جغرافيا غرب الكتل القارية غالباً، بين المناخ المحيطي بين القطبين، والمناخين الشبه قاحل والقاحل قرب خط الإستواء.\\nومن هنا يستنتج أن المناخ المتوسطي هو مزيج بين المناخات الثلاث الآنفة الذكر، مع شتاء معتدل في المناخات المحيطية وصيف يقارب الفصل الجاف في المناطق القاحلة والشبه قاحلة.\\nأيضاً، يتجه هذا المناخ إلى أن يكون رطباً أكثر كلما اقتربنا من القطبين، وقاحلاً كلما ابتعدنا عنهما باتجاه خط الإستواء."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%96%91%EC%8B%AC%EC%A0%81_%EB%B3%91%EC%97%AD_%EA%B1%B0%EB%B6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Number_of_active_troops_world_map%2C_2009.png","page_title":"양심적 병역 거부","context_page_description":"양심적 병역 거부자, 혹은 전투행위만 거부하는 양심적 집총 거부자는 병역의 의무가 부과된 시민이 폭력과 살인에 반대하는 평화주의신념에 따라 병역 또는 그보다 국한된 집총을 거부하는 사람을 말한다. 양심에 따른 병역 거부 혹은 신념에 따른 병역 거부라고도 한다. 양심적 병역 거부 합법화 이후 용어에 대한 국민정서상의 논란이 일자, 대한민국 국방부는 양심적 병역 거부자의 대부분이 여호와의 증인 신자임을 이유로 공식명칭을 종교적 신앙 등에 따른 병역거부로 채택한다고 발표하였다."},{"page_url":"https://sl.wikipedia.org/wiki/Bukovina","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/GUVERNAMANTUL_BUCOVINEI.png","page_title":"Bukovina","context_page_description":"Bukovina je zgodovinska regija srednje Evrope, razdeljena med Romunijo in Ukrajino, na severnih pobočjih osrednjevzhodnih Karpatov in sosednjih planot.\\nObmočje Moldavije je bilo v srednjem veku območje, ki je postalo znano kot Bukovina, od leta 1774 do 1918 upravna dežela habsburške monarhije, avstrijskega cesarstva in Avstro-Ogrske. Po prvi svetovni vojni je Romunija vzpostavila svoj nadzor nad Bukovino. Leta 1940 je severna polovica Bukovine pripadla Sovjetski zvezi in je danes del Ukrajine."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BE%E0%AE%B1%E0%AF%88_%E0%AE%A4%E0%AF%8B%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%AE%E0%AF%8D,_%E0%AE%9F%E0%AE%BE%E0%AE%B0%E0%AF%8D%E0%AE%9C%E0%AE%BF%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Gangamaya_Park_Darjeeling_West_Bengal_India.JPG","page_title":"பாறை தோட்டம், டார்ஜிலிங்","context_page_description":"பாறைத் தோட்டம் என்பது பார்போட்டி பாறை தோட்டம் இந்திய நாட்டில் மேற்கு பெங்கால் மாநிலத்தில் பார் போட்டி பாறை தோட்டம் அமைந்துள்ளது. இந்த பகுதியில் வெடில் மலை அருவி மற்றும் கங்கா மாயா தோட்டம் சுற்றுலா மையப்பகுதியில் நகரத்தில் அமைந்துள்ளது. கங்காமாயா தோட்டம் புதியாதாக அமைக்கப்பட்ட சிறப்பு வாய்ந்த பூங்கா தோட்டம் ஆகும். கிராம மக்கள் விரும்பும் வகையில் டார்ஜிலிங் அமைந்துள்ளது 1980 ஆம் ஆண்டில் பாறைத் தோட்டம் அமைந்துள்ளது. சிரி ஜான் அந்தரசன் பாறைத் தோட்டம் மற்றும் லோயாடி பாறைத்தோட்டம் அமைந்துள்ளது."},{"page_url":"https://ca.wikipedia.org/wiki/Neferneferuaton_Tasherit","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Dibujo_de_tumba.jpg","page_title":"Neferneferuaton Tasherit","context_page_description":"Neferneferuaton Tasherit o Neferneferuaton la més jove va ser una princesa egípcia de la XVIII dinastia. Era la quarta filla del faraó Akhenaton i de la gran esposa reial Nefertiti."},{"page_url":"https://gl.wikipedia.org/wiki/Cono","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Cone_3d.png","page_title":"Cono","context_page_description":"Para o froito das coníferas, ver artigo piña\\nEn xeometría, un cono recto é un sólido de revolución xerado polo xiro dun triángulo rectángulo arredor dun dos seus catetos. O círculo conformado polo outro cateto denomínase base e o punto onde conflúen as xeratrices denomínase vértice.\\nA xeratriz dun cono é cada un dos segmentos cuxos extremos son o vértice e un punto da circunferencia da base.\\nA altura dun cono é a distancia do vértice ao plano da base. Nos conos rectos será a distancia do vértice ao centro da circunferencia da base."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%96%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/M1_Music_Awards_2019_218_%D0%A2%D1%96%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D1%8C.jpg","page_title":"Тіна Кароль","context_page_description":"Т́іна Ќароль — українська співачка та акторка, народна артистка України, солістка Ансамблю пісні і танцю Збройних сил України. Лауреат пісенного конкурсу молодих виконавців «Нова хвиля 2005». З піснею «Show Me Your Love» представляла Україну на пісенному конкурсі «Євробачення-2006», де посіла сьоме місце."},{"page_url":"https://sv.wikipedia.org/wiki/Shing%C5%AB,_Wakayama","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Kamikura-jinja08s1680.jpg","page_title":"Shingū, Wakayama","context_page_description":"Shingū är en stad i Wakayama prefektur i Japan. Staden fick stadsrättigheter 1933."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%B4%CE%B5%CE%BB%CF%86%CE%BF%CE%AF_%CE%9C%CE%B1%CE%BD%CE%AC%CE%BA%CE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Milton-Manaki-Bitolya.jpg","page_title":"Αδελφοί Μανάκη","context_page_description":"Οι Αδελφοί Μανάκη, ο Ιωάννης και ο Μιλτιάδης είναι οι πρωτοπόροι κινηματογραφιστές στα Βαλκάνια. Γεννήθηκαν στην Αβδέλλα Γρεβενών στις 18 Μαΐου 1878 και 9 Σεπτεμβρίου 1882, αντίστοιχα. Βορειομακεδονικές πηγές τους θεωρούν Σλαβομακεδόνες, ενώ ελληνικές πηγές τους θεωρούν Έλληνες Αρμανικής καταγωγής. Στo Μοναστήρι λειτουργεί και σύλλογος Βλάχων \\"Αδερφοί Μανάκη\\"."},{"page_url":"https://bs.wikipedia.org/wiki/Novi_Sad","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Novi_Sad-_collage.jpg","page_title":"Novi Sad","context_page_description":"Novi Sad, grad na lijevoj obali Dunava, glavni grad Autonomne Pokrajine Vojvodina.\\nNovi Sad se prvi put spominje u pisanim dokumentima 1640. godine, kao naselje oko mostobrana na bačkoj strani Dunava, preko puta znamenite Petrovaradinske tvrđave, pod nazivom Racka varoš odnosno Ratzenstadt. Zvanično je uveden u katastar kao naselje 1694. godine. Nastao je kao pomoćno naselje Petrovaradinskom Šancu gdje su bili smješteni vojska, graničari i trgovci. Naseljavali su ga pretežno Srbi, Nijemci, Jevreji, Mađari, Armenci i Grci.\\nGodine 1748. bogati građani Racke varoši odlaze u Beč, gdje za 80.000 rajnskih forinti kupuju od carice Marije Terezije status slobodnog kraljevskog grada. Ona tim povodom, 1. februara 1748 izdaje edikt koji kaže:\\nMi Marija Terezija, Božjom milošću carica rimska a kraljica Ugarske, Češke, Dalmacije, Hrvatske, Slavonije, Rame, Srbije, Galicije, Lodomerije itd. itd. dajemo glasom ovoga pismena na znanje svakome, koga se tiče.\\n[...]"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B3%D9%8A%D8%AD%D9%8A%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Christian_States.svg","page_title":"مسيحيه","context_page_description":"المسيحيه نسبه للمسيح هى دين توحيدى متأسس على حياة و تعاليم يسوع اللى ذكرت فى كتاب العهد الجديد. المسيحيين بيؤمنوا بصفه عامه بأربع اناجيل بس و فيه اناجيل ما بيعترفوش بيها زى انجيل يهوذا و انجيل توماس و انجيل برنابا، و بيؤمنو بان يسوع هو الله المتجسد وانه هو المسيح اللى اتنبئت بيه التوراه لكن اليهود ما بيأمنوش بيه.\\nالمسيحيين بيؤمنوا بإن يسوع المسيح هو الاستاذ و المثل الاعلى فى الحياه اللى بيسودها الخير.يسوع حسب اعتقادهم هو الله ظهر فى شكل انسان وهو الاقنوم الثاني من التلات اقانيم اللى مع بعض يكونوا اله واحد وده بحسب اعتقادهم يخلي يسوع اله كامل وفي نفس الوقت انسان كامل، وكمان بيؤمنوا أن يسوع اتولد من العذراء مريم بطريقة إعجازية. وخلال حياته على الارض عمل معجزات وعجايب كتير و فى نفس الوقت بيعتبروه تجسيد للرب و انه المخلص اللى اتعذب و مات و بعدين قام من تانى فى تالت يوم عشان يخلص البشريه من الخطيئه الأولى.المسيحيين بيعتقدو ان يسوع طلع لملكوت السما متحد مع الله الآب، لكنه بعت الروح القدس عشان يساعد الناس انهم يمشوا فى الطريق الصحيح و انه حا يرجع تانى للارض عشان يحاسب الناس و انه حايحاسب كل واحد على حسب اعماله فى الدنيا.\\nالمسيحيه بتتصنف على انها ديانه ابراهيميه و دلوقتى عدد اتباعها اللى أغلبهم كاتوليك تابعين لبابا الفاتيكان وصل لأكتر من 2 بليون بنى ادم بيمثلو حوالى تلت عدد سكان العالم."},{"page_url":"https://en.wikipedia.org/wiki/Y%C5%ABhei_Takanashi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/170304_Takanashi_Yuhei.jpg","page_title":"Yūhei Takanashi","context_page_description":"Yūhei Takanashi is a professional Japanese baseball player. He plays pitcher for the Yomiuri Giants.\\nOn October 10, 2018, he was selected Japan national baseball team at the 2018 MLB Japan All-Star Series."},{"page_url":"https://it.wikipedia.org/wiki/Associazione_Sportiva_Dilettantistica_Scafatese_Calcio_1922","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Societ%C3%A0_Sportiva_Scafatese_Calcio.jpg","page_title":"Associazione Sportiva Dilettantistica Scafatese Calcio 1922","context_page_description":"La Scafatese Calcio 1922 è una società calcistica italiana con sede nella città di Scafati.\\nFondata nel 1922, conta due partecipazioni in Serie B, nelle stagioni 1946-47 e 1947-48 oltre a diverse apparizioni nel terzo e quarto livello professionistico nazionale.\\nI suoi colori sociali sono il giallo ed il blu, mentre il suo simbolo è il canarino."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D1%97_%D0%9B%D0%B5%D0%B9%D0%B4%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/De_valk_%284%29.JPG","page_title":"Музеї Лейдена","context_page_description":"Музеї Лейдена — музейні, виставкові та науково-дослідницькі установи у нідерландському місті Лейден, який посідає третє місце у країні, після Амстердама і Гааги, за кількістю музеїв і має неофіційне прізвисько «міста музеїв».\\nУ різних джерелах наводиться різна кількість музеїв у місті, що зумовлене різними поглядами на поняття музею. Так, наприклад, до переліку можуть включатися або ні: Лейденський ботанічний сад, архів батьків-пілігримів, Анатомічний музей при медичному факультеті Лейденського університету та музей CORPUS.\\nЗ-поміж лейденських музеїв чотири мають статус державних. Щороку їх відвідує близько півмільйона осіб. Частина музеїв бере участь у світовій акції «Ніч у музеї»."},{"page_url":"https://de.wikipedia.org/wiki/Promenadenlift","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Promenadenlift_Baden_01.jpg","page_title":"Promenadenlift","context_page_description":"Der Promenadenlift ist ein öffentlicher Personenaufzug in Baden im Kanton Aargau. Er führt vom Bahnhofplatz hinunter zur Limmatpromenade und überwindet dabei einen Höhenunterschied von 27 Metern. Zusammen mit einem unmittelbar daran anschliessenden Steg über die Limmat ermöglicht er eine direkte Fussgängerverbindung zwischen dem Bahnhof Baden und dem südlichen Teil von Ennetbaden."},{"page_url":"https://en.wikipedia.org/wiki/Nabemono","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Yud%C5%8Dfu_001.jpg","page_title":"Nabemono","context_page_description":"Nabemono, or simply nabe, is a variety of Japanese hot pot dishes, also known as one pot dishes and \\"things in a pot\\"."},{"page_url":"https://en.wikipedia.org/wiki/Catemaco_(municipality)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Lake_Catemaco27.JPG","page_title":"Catemaco (municipality)","context_page_description":"Catemaco Municipality is one of the 212 municipalities that make up the Mexican state of Veracruz.\\nIt is located in the state's Los Tuxtlas. The municipal seat is the city of Catemaco.\\nIn the 2005 INEGI Census, the municipality reported a total population of 46,702, of whom 22,965 lived in the municipal seat.\\nEthnic composition is primarily of mestizo origins. Indigenous language speakers number less than 500.\\nThe municipality of Catemaco covers a total surface area of 710.67 km² along the Gulf of Mexico between the foothills of Volcano San Martín Tuxtla and the Sierra Santa Marta, and incorporate Laguna Catemaco and Laguna Sontecomapan plus a large part of the Los Tuxtlas Biosphere Reserve.\\nCatemaco borders the municipalities of San Andrés Tuxtla to the west, Hueyapan de Ocampo and Soteapan to the south and Tatahuicapan de Juárez and Mecayapan to the east.\\nEconomically Catemaco depends on a mix of tourism, cattle ranching, fishery and agriculture. Statistically the municipality ranks as one of the poorer ones in Veracruz."},{"page_url":"https://fr.wikipedia.org/wiki/Eckhard_Henscheid","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Henschx.jpg","page_title":"Eckhard Henscheid","context_page_description":"Eckhard Henscheid est un écrivain allemand."},{"page_url":"https://lt.wikipedia.org/wiki/Piet%C5%B3_Lunda","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Angola_Provinces_Lunda_Sul_250px.png","page_title":"Pietų Lunda","context_page_description":"Pietų Lunda – provincija šiaurės rytų Angoloje. Ribojasi su Malanžės, Šiaurės Lundos, Bijė ir Mošiko provincijomis bei Kongo Demokratine Respublika. Administracinis centras – Saurimas."},{"page_url":"https://da.wikipedia.org/wiki/Reerslev_Kirke_(H%C3%B8je-Taastrup_Kommune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Reerslev_Kirke_Roskilde_Denmark_postcard.jpg","page_title":"Reerslev Kirke (Høje-Taastrup Kommune)","context_page_description":"Reerslev Kirke er en kirke i Reerslev Sogn i Høje-Taastrup Kommune."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E9%9B%85%E5%90%84%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/St._James_Street%2C_Montreal.jpg","page_title":"圣雅各街","context_page_description":"聖雅各街是加拿大魁北克省蒙特婁的一條主要街道。\\n這條街道有兩個英語名稱：Saint Jacques Street和St. James Street。前者是最常見的地理名詞，而後者通常用於街道作為金融區的歷史重要性。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_M%C4%9Bln%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/L%C3%ADpa_u_Tau%C5%A1ovny_3653.JPG","page_title":"Seznam památných stromů v okrese Mělník","context_page_description":"Toto je seznam památných stromů v okrese Mělník, v němž jsou uvedeny památné stromy na území okresu Mělník."},{"page_url":"https://en.wikipedia.org/wiki/Spearfishing","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Tomb_of_Usheret_01.jpg","page_title":"Spearfishing","context_page_description":"Spearfishing is a method of fishing that has been used throughout the world for millennia. Early civilizations were familiar with the custom of spearing fish from rivers and streams using sharpened sticks.\\nCurrently spearfishing makes use of elastic powered spearguns and slings, or compressed gas pneumatic powered spearguns, to strike the hunted fish. Specialised techniques and equipment have been developed for various types of aquatic environments and target fish.\\nSpearfishing may be done using free-diving, snorkelling, or scuba diving techniques, but spearfishing while using scuba equipment is illegal in some countries. The use of mechanically powered spearguns is also outlawed in some countries and jurisdictions. Spearfishing is highly selective, normally uses no bait and has no by-catch."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%B2%D0%B8%D0%BB%D0%BE_%D0%BD%D0%B0_%D0%B4%D0%B5%D1%81%D0%BD%D0%B0_%D1%80%D0%B0%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Cartesian_coordinate_system_handedness.svg","page_title":"Правило на десна рака","context_page_description":"Во математиката и физиката, правилото на десната рака е заеднички мнемоник за разбирање на ориентацијата на оските во 3-димензионалниот простор.\\nПовеќето од различните правила на левата и десната рака произлегуваат од фактот што трите оски на тридимензионалниот простор имаат две можни ориентации. Ова може да се види со држење на рацете нанадвор и заедно, дланките се нагоре, со прстите свиткани. Ако виткањето на прстите претставува движење од првата или x-оската до втората или y-оската, тогаш третата или z-оската може да посочат заедно со палецот. Правилата на левата и десната рака се јавуваат кога се работи за координатни оски, ротација, спирали, електромагнетни полиња, огледални слики и енантиомери во математиката и хемијата."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D0%BC%D0%B0%D1%80%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/50_Reichsmark_1924-10-11.jpg","page_title":"Рейхсмарка","context_page_description":"Рейхсмарка — денежная единица Веймарской республики, Третьего рейха и послевоенной Германии с 1924 по 1948 год.\\nРейхсмарка была введена 30 августа 1924 года. Она заменила бумажную марку, которая во время гиперинфляции 1914—1923 годов была обесценена. Курс обмена составил 1 000 000 000 000: 1. Рейхсмарка была основана на золотом стандарте с курсом 4,2 рейхсмарки за доллар; а после девальвации доллара в 1934 году — 2,5 рейхсмарки за доллар.\\nРейхсмарка, рентная марка и марка Союзного военного командования были изъяты из обращения в Западной Германии и заменены немецкой маркой, выпущенной Банком немецких земель, в период с 21 июня до конца августа 1948 года.\\nВ советской зоне оккупации рейхсмарка, рентная марка и марка Союзного военного командования заменены на немецкие марки, выпущенные Немецким эмиссионным банком, в ходе реформы, начатой 23 июня 1948 года."},{"page_url":"https://it.wikipedia.org/wiki/Begosso","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Parrocchia_Di_San_Lorenzo_Martire%2C_Begosso%2C_Terrazzo.jpg","page_title":"Begosso","context_page_description":"Begosso è una frazione appartenente al comune di Terrazzo. È conosciuto come il \\"paese della mela\\" in quanto ricco di coltivazioni di questo tipo."},{"page_url":"https://sv.wikipedia.org/wiki/Baisaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Dessert_on_tray.jpg","page_title":"Baisaki","context_page_description":"Baisaki, även stavat Baisakhi och Vaisakhi, är en högtid som firas den 13 april i den indisk-pakistanska regionen Punjab vid skördesäsongens början. Det punjabiska nyåret infaller samma datum. Det är också den dag som Khalsa grundades, år 1699."},{"page_url":"https://fr.wikipedia.org/wiki/Syst%C3%A8me_anti-blocage_des_roues","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Syst%C3%A8me_ABS.svg","page_title":"Système anti-blocage des roues","context_page_description":"Le système anti-blocage des roues, plus connu sous le sigle ABS, est un système d'assistance au freinage utilisé sur les véhicules roulants, limitant le blocage des roues pendant les périodes de freinage intense. Fonction secondaire dans le système de contrôle de traction, elle est utilisée sur les avions et sur les véhicules automobiles ou motocyclettes, où elle fait de plus en plus partie de l'équipement standard. D'autres termes sont également utilisés ou recommandés comme « antiblocage de sécurité », « système de freinage anti-blocage », « freins anti-blocage », ou « système d'antiblocage de roues »."},{"page_url":"https://en.wikipedia.org/wiki/Enloe_Dam_and_Powerplant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Enloe_Dam.jpg","page_title":"Enloe Dam and Powerplant","context_page_description":"The Enloe Dam, also known as the Similkameen Dam, and its powerplant are located on the Similkameen River about 4 miles west-northwest of Oroville, Washington. Located just above Similkameen Falls, the concrete arch-gravity dam stands about 54 feet high, with a crest length of about 290 feet, built between 1916 and 1923. The dam was named after the president of the Okanogan Valley Power Company, Eugene Enloe. The dam was operated to generate power at its powerplant, located about 850 feet downstream from the dam. Lacking fish ladders, Enloe Dam blocks fish passage and completely extirpated anadromous fish migration into the upper reaches of the Similkameen River and its tributaries in Canada."},{"page_url":"https://it.wikipedia.org/wiki/Anatomia_dei_mammiferi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/DeerAntlersLyd2.png","page_title":"Anatomia dei mammiferi","context_page_description":"I Mammiferi possiedono una scatola cranica molto sviluppata, adatta a contenere un encefalo di notevoli dimensioni, e provvista di una regione occipitale che deriva da un duplice inglobamento di materiale vertebrale e munita di due condili che si articolano con le prime due vertebre cervicali.\\nLa conformazione è di tipo sinapside modificata, cioè con una sola finestra temporale per lato che sfocia nella fossa orbitaria a causa della scomparsa dell'osso postorbitale. Questa condizione primitiva, che si ritrova nei Marsupiali ed in altri ordini, tende a scomparire nei gruppi più evoluti dove si assiste al graduale ripristino della separazione tra la fossa temporale ed orbitaria, tramite due processi che si sviluppano rispettivamente dal frontale e dallo zigomatico e che tendono ad unirsi. La formazione di questo nuovo ponte, accennato nei Carnivori, si riscontra negli erbivori come gli ungulati, dove serve da attacco per i forti muscoli masticatori; all'interno però le due fosse sono ancora in comunicazione. La separazione completa si verifica solo nei Primati superiori grazie ad una lamina che si diparte dal tramezzo."},{"page_url":"https://pt.wikipedia.org/wiki/Sinagoga_de_Castelo_de_Vide","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sinagoga.jpg","page_title":"Sinagoga de Castelo de Vide","context_page_description":"A Sinagoga de Castelo de Vide é uma antiga sinagoga portuguesa localizada na antiga judiaria na freguesia de Santa Maria da Devesa, concelho de Castelo de Vide. Foi construída no séc. XIV, sofrendo alterações no séc. XVIII. Atualmente funciona como museu dedicado à história da comunidade judaica em Castelo de Vide."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B7%81%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B7%93_%E0%B7%80%E0%B7%92%E0%B6%9A%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B6%B8_%E0%B6%BB%E0%B7%8F%E0%B6%A2%E0%B7%83%E0%B7%92%E0%B6%82%E0%B7%84_%E0%B6%BB%E0%B6%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/King_Sri_Vikrama_Rajasinha_%281780-1832%29.JPG","page_title":"ශ්‍රී වික්‍රම රාජසිංහ රජ","context_page_description":"ශ්‍රී වික්‍රම රාජසිංහ රජතුමා හෙළ ශ්‍රී ලංකාවේ රාජධානිය ඉංග්‍රීසීන්ට යටත්වීමට පෙර එහි අවසාන රජතුමා විය. ඔහු ශ්‍රී රාජාධිරාජසිංහ රජුගෙන් පසු 1798 දී සිහසුනට පත් විය. ඛ්‍රිතාන්‍යයන් විසින් මහනුවර යුද්ධය අවසානයේදී ඔහු පරාජය කොට පහ කරන ලදි. ඔහු නායක්කාර වංශයට අයත් දකූණු ඉන්දීය ජාතිකයෙකි. කන්නසාමි නම් වු මොහු 1798 දී සිංහාසනාරූඪ වන විට අභිෂේකය සඳහා ශ්‍රී වික්‍රම රාජසිංහ නම තෝරා ගන්නා ලදි. ඔහු ලංකාවේ නායක්කාර රජ පෙළපතෙහි වසාන රජු විය."},{"page_url":"https://en.wikipedia.org/wiki/Txistu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Txistu2.jpg","page_title":"Txistu","context_page_description":"The txistu is a kind of fipple flute that became a symbol for the Basque folk revival. The name may stem from the general Basque word ziztu \\"to whistle\\" with palatalisation of the z. This three-hole pipe can be played with one hand, leaving the other one free to play a percussion instrument.\\nEvidence of the txistu first mentioned as such goes back to 1864. Yet it is apparent that it was used earlier, although it is not easy to establish when it started out; actually, it is impossible to do so, the txistu being the result of an evolution of the upright flutes widespread as early as the Late Middle Ages, when minstrels scattered all over the Iberian Peninsula brought in instruments that locals, noblemen first and common people later took on and developed. At the beginning, txistu players were named in romance written records after the tabor: tamborer, tamborino, tambolín, tamborín, tamboril, músico tamboril, tamborilero, tamboriltero. However, when named after the flute, they are called in Spanish pífano, silbato, silbo, silbo vizcaíno or chilibistero."},{"page_url":"https://en.wikipedia.org/wiki/Greenville,_Missouri","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Wayne_County_Missouri_Incorporated_and_Unincorporated_areas_Greenville_Highlighted.svg","page_title":"Greenville, Missouri","context_page_description":"Greenville is a city located on U.S. Route 67 near the intersection with Route D and E in Wayne County, Missouri, United States, along the St. Francis River. The population was 511 at the 2010 census. Greenville was incorporated and founded as the county seat of Wayne County in 1819."},{"page_url":"https://pl.wikipedia.org/wiki/Medal_za_D%C5%82ugoletni%C4%85_S%C5%82u%C5%BCb%C4%99_w_Kr%C3%B3lewskich_Si%C5%82ach_Powietrznych_i_Dobre_Zachowanie","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Royal_Air_Force_Long_Service_and_Good_Conduct_Medal_%28George_VI%29.jpg","page_title":"Medal za Długoletnią Służbę w Królewskich Siłach Powietrznych i Dobre Zachowanie","context_page_description":"Medal za Długoletnią Służbę w Królewskich Siłach Powietrznych i Dobre Zachowanie – brytyjskie odznaczenie wojskowe ustanowione dla RAF w 1919 i przyznawane podoficerom za osiemnaście lat nienagannej służby."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BC%D0%B5%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D1%81%D0%BC%D0%B5%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Udlinenie2.jpg","page_title":"Антропометрическая косметология","context_page_description":"Антропометрическая косметология — это исправление врождённых или приобретённых деформаций верхних и нижних конечностей человека, а также их коррекция с чисто эстетическими целями, для устранения как физического, так и психологического дискомфорта.\\nСвод врачебных методик, позволяющих путём хирургического воздействия придавать конечностям пациента длину и форму, которые, насколько это возможно, приближены к лучшим образцам природной красоты.\\nНаука, исследующая пути для приближения пропорций человеческого тела к тем, которые считаются наилучшими с эстетической точки зрения."},{"page_url":"https://en.wikipedia.org/wiki/Jason_Kessler","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Jason_Kessler_%28cropped%29.jpg","page_title":"Jason Kessler","context_page_description":"Jason Eric Kessler is an American neo-Nazi, white supremacist and anti-semitic conspiracy theorist. Kessler organized the Unite the Right rally held in Charlottesville, Virginia on August 11–12, 2017 and the Unite the Right 2 rally held on August 12, 2018.\\nKessler is a supporter of Neo-Nazism, far-right politics, and the alt-right."},{"page_url":"https://id.wikipedia.org/wiki/Kekaisaran_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Belem_1889_02.jpg","page_title":"Kekaisaran Brasil","context_page_description":"Kekaisaran Brasil adalah sebuah negara yang berdiri pada abad ke-19 dan meliputi wilayah yang kini merupakan bagian dari Brasil dan Uruguay. Negara ini merupakan monarki konstitusional parlementer representatif yang dipimpin oleh Kaisar Dom Pedro I dan putranya, Dom Pedro II; keduanya merupakan anggota Wangsa Braganza, salah satu cabang Dinasti Kapetia. Awalnya Brasil merupakan koloni Kerajaan Portugal. Wilayah ini kemudian menjadi pusat kedudukan Imperium Portugal pada tahun 1808 dengan Rio de Janeiro sebagai ibu kotanya setelah Dom João VI melarikan diri dari Portugal akibat invasi Napoleon I. João VI nantinya kembali ke Portugal dan meninggalkan putra sulung dan penerusnya, Pedro, di Brasil sebagai wali raja. Pada 7 September 1822, Pedro menyatakan kemerdekaan Brasil dan ia diangkat menjadi Kaisar Brasil pertama pada tanggal 12 Oktober setelah berhasil memenangkan perang melawan Portugal. Negara baru ini sangat besar, tetapi berpenduduk jarang dan memiliki keanekaragaman etnis."},{"page_url":"https://pl.wikipedia.org/wiki/Ruch_internetowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/WebTrafficGraph.gif","page_title":"Ruch internetowy","context_page_description":"Ruch internetowy to przepływ danych w Internecie. Zawiera się w nim m.in. ruch związany z usługami WWW, pocztą elektroniczną i sieciami P2P."},{"page_url":"https://es.wikipedia.org/wiki/Quebrada_de_las_Conchas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Tour_to_the_Quebrada_de_las_Conchas.jpg","page_title":"Quebrada de las Conchas","context_page_description":"La Quebrada de las Conchas, también conocida como Quebrada de Cafayate, es una reserva natural que se encuentra ubicada dentro de los Valles Calchaquíes, en la provincia de Salta, norte de la República Argentina, muy cercana a la localidad de Cafayate.\\nUbicada a 90 km al sudoeste de la ciudad de Salta comprende parte de los departamentos de La Viña, Guachipas y Cafayate y pertenece a la ecorregión chaco seco y monte de sierras y bolsones.​\\nEsta quebrada es un área de gran belleza paisajítica con formaciones rocosas muy llamativas por sus coloraciones rojizas. En el año 1995 fue declarada por decreto Nº 6806 como reserva natural manejada, con una superficie de 25784 ha, a fin de proteger las curiosas formaciones geológicas y altos paredones de singular valor paisajístico, a la vez que a un importante yacimiento paleontológico perteneciente al período cretácico. La quebrada es un accidente geológicamente moderno, producida por movimientos tectónicos que tuvieron lugar en los últimos dos millones de años.\\nPor la quebrada y dentro de la reserva discurre el río las Conchas donde se encuentra la traza de la Ruta Nacional 68, que une la localidad de Cafayate con la ciudad de Salta."},{"page_url":"https://ru.wikipedia.org/wiki/Borexino","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/SolarSpectraWithExp.jpg","page_title":"Borexino","context_page_description":"Эксперимент Borexino — эксперимент физики элементарных частиц, нацеленный на изучение низкоэнергетических солнечных нейтрино, рождающихся на Солнце в результате одной из реакций протон-протонного цикла:\\nЭксперимент позволяет глубже понять процессы, происходящие в ядре Солнца, а также помогает определить параметры нейтринных осцилляций. Проект также в состоянии обнаруживать нейтрино от сверхновых звезд в нашей Галактике. Сам детектор расположен в Национальной лаборатории Гран-Сассо, находящейся в районе города Л'Аквила, Италия. В эксперименте принимают участие исследователи из Италии, США, Германии, Франции и России. Детектор начал измерения 16 мая 2007 г., а первые данные в рамках данного проекта были опубликованы 16 августа 2007 года. Эксперимент финансируется несколькими национальными учреждениями, в том числе INFN и NSF."},{"page_url":"https://pl.wikipedia.org/wiki/New_London_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Wi_newlondon_oldcityhall.jpg","page_title":"New London (Wisconsin)","context_page_description":"New London – miasto w Stanach Zjednoczonych, w stanie Wisconsin, w hrabstwie Outagamie."},{"page_url":"https://fr.wikipedia.org/wiki/Arivonimamo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Antananarivo_Arivonimamo.png","page_title":"Arivonimamo","context_page_description":"Arivonimamo est une commune urbaine située dans la Province de Tananarive, au centre de Madagascar."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%BC%D5%AB%D6%83%D5%BD%D5%AB%D5%B4%D5%A5_%D5%84%D5%A1%D6%80%D5%A3%D5%A1%D6%80%D5%B5%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/The_Mood%2C_HrtipsimeArt.jpg","page_title":"Հռիփսիմե Մարգարյան","context_page_description":"Հռիփսիմե Վոլոդյայի Մարգարյան, հայ նկարիչ, ձևավորող։\\nՀՀ ժողովրդական նկարիչ Վալմարի դուստրն է։"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D1%8A%D1%80%D0%BF%D0%B8%D0%BB%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/CAT_988F.jpg","page_title":"Катърпилър","context_page_description":"Caterpillar е американска корпорация за производство на строителна, селскостопанска и специализирана техника, световен лидер в този бранш с най-много произведени и продадени машини. Позната е основно с логото, съдържащо началните букви CAT."},{"page_url":"https://fr.wikipedia.org/wiki/Thierry_Le_H%C3%A9naff","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Thierry_Le_Henaff.jpg","page_title":"Thierry Le Hénaff","context_page_description":"Thierry Le Hénaff, né en 1963, est le Président-Directeur général d’Arkema depuis mars 2006."},{"page_url":"https://ca.wikipedia.org/wiki/Riu_Drin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Skadar%2C_soutok_Drinu_a_Buny_v_roce_2004.jpg","page_title":"Riu Drin","context_page_description":"El Drin és un riu d'Albània que desemboca a la mar Adriàtica prop de Lezhë. Es forma a la rodalia de la ciutat albanesa de Kukës per la unió de dos rius anomenats Drin Negre, que neix al llac d'Okhrida a Macedònia, i Drin Blanc, que neix a les muntanyes de Kosovo. Té un curs de 282 km."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BE%E0%AE%AA%E0%AE%BF%E0%AE%B2%E0%AF%8B%E0%AE%A9%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%A4%E0%AF%8A%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AF%81_%E0%AE%A4%E0%AF%8B%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%AE%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Ogrody_semiramidy.jpg","page_title":"பாபிலோனின் தொங்கு தோட்டம்","context_page_description":"பாபிலோனின் தொங்கு தோட்டமும் பாபிலோனின் சுவர்களும் பண்டைய ஏழு உலக அதிசயங்களுள் ஒன்றாகக் கருதப்படுகின்றன. இவ்விரண்டும் நெபுகாத்நேசர் தற்போதைய ஈராக் நாட்டினுள் அடங்கும் பாபிலோனில் கி.மு 600 அளவில் கட்டப்பட்டதாகக் கருதப்படுகிறது. எனினும் இது உண்மையிலேயே இருந்ததா என்பது பற்றிய சந்தேகமும் இன்னும் உள்ளது.\\nஇரண்டாம் நெபுகாத்நேசர் என்ற மன்னனின் முயற்சியால் அவருடைய அரண்மனையில் கி.மு.600 ஆண்டுகளுக்கு முன்\\nகற்களால் வளைவுகளும் மொட்டை மாடிகளும் கட்டப்பட்டன. அவற்றில் செடிகளும் தாவரங்களும் பயிரிடப்பட்டன. யூப்ரேட்ஸ் ஆற்றிலிருந்து கப்பி முறையில் தண்ணீரை இறைத்து குழாய்கள் வழியாகச் செடிகளுக்குப் பாய்ச்சினர்.\\nஇசுட்ராபோ, டையோடோரஸ் சிகுலஸ் போன்ற கிரேக்க வரலாற்று ஆசிரியர்களால் விரிவாகப் பதியப்பட்டுள்ள இத் தொங்கு தோட்டம் இருந்தது பற்றி, பாபிலோனிலிருந்த மாளிகையில் நடத்தப்பட்ட அகழ்வாராய்ச்சியில் கிடைத்த மேலோட்டமான சில சான்றுகள் தவிர, வேறு சான்றுகள் மிகக் குறைவாகவேயுள்ளன. இது பற்றிய வியத்தகு விவரங்களை நியாயப்படுத்தக் கூடிய போதிய சான்றுகள் இன்னும் கிடைக்கவில்லை."},{"page_url":"https://sh.wikipedia.org/wiki/Ftalocijanin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Phthalocyanine-3D-balls.png","page_title":"Ftalocijanin","context_page_description":"Ftalocijanin je organsko jedinjenje, koje sadrži 32 atoma ugljenika i ima molekulsku masu od 514,539 Da."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%A6%E0%B0%BE%E0%B0%A6%E0%B1%8D%E0%B0%B0%E0%B0%BE_%E0%B0%A8%E0%B0%97%E0%B0%B0%E0%B1%81_%E0%B0%B9%E0%B0%B5%E0%B1%87%E0%B0%B2%E0%B1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Dadra-Nagarhaveli_1956.jpg","page_title":"దాద్రా నగరు హవేలీ","context_page_description":"దాద్రా, నగరు హవేలీ పశ్చిమ భారత దేశములోని ఒక కేంద్ర పాలిత ప్రాంతము. దీని మొత్తం వైశాల్యం 491 చ.కి.మీ. నగర్-హవేలీ అనేది మహారాష్ట్ర గుజరాత్ సరిహద్దులో ఒదిగి ఉన్న ఒక చిన్న ప్రాంతము. నగరుహవేలీకి కొన్ని కిలోమీటర్లు ఉత్తరాన గుజరాత్ రాష్ట్రం భూభాగం మధ్యలో దాద్రా అనే ప్రాంతమున్నది.ఈ కేంద్ర పాలిత ప్రాంతము రాజధాని సిల్వాస్సా. 1779 నుండి 1954లో భారత దేశము స్వాధీనము చేసుకునే వరకు ఇది పోర్చుగీస్ కాలనీగా ఉంది. 1961లో ఇది కేంద్ర పాలిత ప్రాంతము అయినది. గుజరాతీ ఈ ప్రాంతము యొక్క ముఖ్య భాష.పారిశ్రామిక ఉత్పత్తులు ఇక్కడ ఆర్థిక వ్యవస్థకు ప్రధానమైన వనరులు. ఎక్సైజు సుంకము లేదు. అన్ని కేంద్ర పాలిత ప్రాంతాలలాగానే లెఫ్టినెంట్ గవర్నరు ఇక్కడ ప్రధాన ప్రభుత్వోద్యోగి."},{"page_url":"https://pt.wikipedia.org/wiki/Natalie_Cole","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Nataliecole2007.jpg","page_title":"Natalie Cole","context_page_description":"Stephanie Natalie Maria Cole, conhecida como Natalie Cole foi uma cantora, compositora, atriz e pianista norte-americana, muito aclamada pela crítica mundial devido a sua harmônica e extensa voz meio-soprano, tendo vendido mais de 100 milhões de discos. Foi ganhadora de nove prêmios GRAMMY Awards.\\nÉ filha do também cantor e compositor Nat King Cole. Em 1991 gravou o single Unforgettable onde a voz de seu pai, remasterizada, foi mixada à sua para simular que os dois, pai e filha, cantavam juntos.\\nFaleceu na noite do dia 31 de dezembro de 2015, devido a insuficiência cardíaca, devido às complicações de uma insuficiência renal, em decorrência da hepatite C."},{"page_url":"https://de.wikipedia.org/wiki/Albertusstra%C3%9Fe_42_(M%C3%B6nchengladbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/M%C3%B6nchengladbach-MG_Mitte_Denkmal-Nr._A_030%2C_Albertusstra%C3%9Fe_42_%285379%29.jpg","page_title":"Albertusstraße 42 (Mönchengladbach)","context_page_description":"Das Wohnhaus Albertusstraße 42 steht in der Stadt Mönchengladbach in Nordrhein-Westfalen. Es wurde um 1880 erbaut. Das Gebäude ist unter Nr. A 030 am 5. Februar 1992 in die Denkmalliste der Stadt Mönchengladbach eingetragen worden."},{"page_url":"https://en.wikipedia.org/wiki/Regional_Park_of_Decima-Malafede","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Mappa_Parco_Decima-_Malafede.png","page_title":"Regional Park of Decima-Malafede","context_page_description":"The Nature Reserve of Decima-Malafede is a protected natural area of Lazio, Italy, entirely included in the territory of the Municipality of Rome. It has an area of approximately 6,145 hectares.\\nThe Reserve was established in 1997.\\nThe park is in the southwest zone of the city of Rome, bounded by the Grande Raccordo Anulare, the Via Pontina, the Via Laurentina and the territory of the Municipality of Pomezia.\\nThe park is notable for its population of wild boars, while sedimentary rocks contain human prehistoric remains."},{"page_url":"https://de.wikipedia.org/wiki/Przecisz%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Przeciszow_KosciolParafialny.JPG","page_title":"Przeciszów","context_page_description":"Przeciszów ist ein Dorf sowie Sitz der gleichnamigen Landgemeinde im Powiat Oświęcimski der Woiwodschaft Kleinpolen in Polen."},{"page_url":"https://en.wikipedia.org/wiki/Torrance,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/LA_County_Incorporated_Areas_Torrance_highlighted.svg","page_title":"Torrance, California","context_page_description":"Torrance is a coastal U.S. city in the South Bay region of Los Angeles County, California, in the Los Angeles metropolitan area. Torrance has 1.5 miles of beaches on the Pacific Ocean. Torrance has a moderate year-round climate with warm temperatures, daily sea breezes, low humidity, and an average rainfall of 12.55 inches per year. It is immediately bordered by Lomita to the east, Gardena and Lawndale to the north, Redondo Beach and the Pacific Ocean to the west, and Rolling Hills and Palos Verdes Estates to the south.\\nSince its incorporation in 1921, Torrance has grown to a population at the 2010 census of 145,438. This residential and light high-tech industries city has 90,000 street trees and 30 city parks. Known for its low crime rates, the city consistently ranks among the safest cities in Los Angeles County. Torrance is the birthplace of the American Youth Soccer Organization. In addition, it has the second-highest percentage of residents of Japanese ancestry in California after Gardena."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%B1%D8%B2%D8%B4%DA%AF%D8%A7%D9%87_%D8%AC%DB%8C%E2%80%8C%D8%A7%D8%B3%E2%80%8C%D9%BE%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/APOEL_-_real_madrid_%287026016567%29.jpg","page_title":"ورزشگاه جی‌اس‌پی","context_page_description":"ورزشگاه جی‌اس‌پی یک ورزشگاه فوتبال در نیکوزیای قبرس است. این ورزشگاه ظرفیت ۲۲٬۸۵۹ تماشاگر را دارد و در ۶ اوت ۱۹۹۹ با مسابقه‌ای میان آپوئل و اومانیا گشایش یافت. همچنین این ورزشگاه میزبان مسابقات باشگاه‌های فوتبال آپوئل و اومانیا و تیم ملی فوتبال قبرس است."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Faro","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Portuguese_Railways_Intercity_train_at_Faro_Train_Station.jpg","page_title":"Estación de Faro","context_page_description":"La Estación Ferroviária de Faro, más conocida como Estación de Faro, es una plataforma ferroviaria de la Línea del Algarve, que sirve a la localidad de Faro, en el Distrito de Faro, en Portugal."},{"page_url":"https://no.wikipedia.org/wiki/Taiwan_(%C3%B8y)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Taiwan_NASA_Terra_MODIS_23791.jpg","page_title":"Taiwan (øy)","context_page_description":"Taiwan er en øy øst for det kinesiske fastland som utgjør størstedelen av Republikken Kina. Det tidligere navnet Formosa ble gitt av portugisiske sjøfarende. En person fra Taiwan kalles taiwaner.\\nDen mandelformede øya er på 36 000 kvadratkilometer. Den vestlige delen er en bred kystslette som gradvis stiger og går over til skogdekte platåer og den fjellkjeden som strekker seg fra nord til sør langs øyas lengderetning. De høyeste fjelltoppene når opp i rundt 4 000 meters høyde. Østenfor går det bratt nedover med kløfter og strie elver og strømmer ned til Stillehavet.\\nBefolkningen er på over 23 millioner, hvorav rundt 600 000 er taiwansk urbefolkning. Om lag halvparten av de sistnevnte folkegruppene har i løpet av 1900-tallet latt seg sinifisere i utstrakt grad; taler kinesisk og har overtatt kinesiske skikker. De øvrige rundt ti stammer holder fast på sine språk og skikker, selv om de også lærer kinesisk på skolen.\\nDe første kinesiske innvandrere kom til Taiwan mellom 900-tallet og 1200-tallet; de var hakkaer. Andre kinesere kom senere, blant dem mange minnan-talende, det vil si kinesere fra den halvdelen av den fastlandskinesiske provinsen Fujian som ligger sør for elven Min."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%87%D8%B1%D8%AC%D8%A7%D9%86_%D9%81%D9%84%D9%88%D8%B1%D9%8A%D8%AF%D8%A7_%D9%84%D9%84%D9%81%D8%B1%D8%A7%D9%88%D9%84%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Fsf_caboose.jpg","page_title":"مهرجان فلوريدا للفراولة","context_page_description":"يُعد مهرجان فلوريدا للفراولة حدث سنوي في مدينة بلانيت سيتي بفلوريدا, حيث بدأ منذ عام 1930 من خلال نادي الأسود المحلي وهو نادٍ محلي خيري مخصص لتحسين المجتمع, بعد محاولات عديدة من السكان المحليين في العشرين عامًا الماضية لترويج محصول الفراولة. ابتداءً من عام 1929, عمل نادي الأسود المحلي على التخطيط لمهرجان لتكريم ملك الفراولة, وهو بطل المنطقة في المنتجات الزراعية. يستمر المهرجان لمدة 11 يومًا, و يحضره حوالي نصف مليون راعٍ ومن بلاد أخرى حول العالم.\\nيقوم ذلك الحدث على سوق متجول و مبيعات وأنشطة مجانية ترفيهية مختلفة بالإضافة إلى عرض موسيقي يقام مرتين يوميًا. يجب الحصول على تذاكر لحضور تلك الحفلات الموسيقية, بالرغم أن الحضور لتلك الحفلات كان بالمجان, فأول من يحضر كان يحصل على مقعد يُحجز له, ومع ذلك بعد 2017 تم تجديد المكان الذي يقام فيه المهرجان إضافة إلى مقاعد استاد التي لم تَعد مجانية. وبالتالي تُعد سنة 2018 السنة الأولى التي لا تتوافر فيها مقاعد مجانية.\\nيشتهر ذلك المهرجان أيضًا بكنيسة القديس كليمنت الكاثوليكية و التي تعرف ب \\"اصنع الكيك الخاص بك\\" وهي كيكة بالفراولة وهي تظهر في \\"مهرجان الأكل\\" على قناة الطبخ © والذي سيعاد عرضه في 2018. عربة قطار المفقودات\\nكل عام يقام عرض على شرف تلك المهرجانات لتقديم جائزة شخصية العام الخاصة بمدينة بلانت سيتي."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_Nagano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Nagano_1000_e1_-_2009.jpg","page_title":"Ligne Nagano","context_page_description":"La ligne Nagano est une ligne ferroviaire exploitée par la compagnie Nagaden, située dans la préfecture de Nagano au Japon. Elle relie la gare de Nagano à Nagano à la gare de Yudanaka à Yamanouchi."},{"page_url":"https://en.wikipedia.org/wiki/Quirizio_di_Giovanni_da_Murano","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Savior_-_Quirizio_da_Murano.jpg","page_title":"Quirizio di Giovanni da Murano","context_page_description":"Quirizio di Giovanni da Murano or Quirizio da Murano or Quiricius, was an Italian Renaissance painter of religious subjects."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E5%A4%A7%E4%B9%85%E4%BF%9D%E9%A7%85%E4%B9%97%E5%AE%A2%E8%BB%A2%E8%90%BD%E4%BA%8B%E6%95%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/JREast-Shin-okubo-station-platform.jpg","page_title":"新大久保駅乗客転落事故","context_page_description":"新大久保駅乗客転落事故は、2001年1月26日の19時14分頃に東日本旅客鉄道山手線新大久保駅で発生した鉄道人身障害事故である。"},{"page_url":"https://en.wikipedia.org/wiki/Texas_School_Book_Depository","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Dallas_County_Admin_Building.jpg","page_title":"Texas School Book Depository","context_page_description":"The Texas School Book Depository, now known as the Dallas County Administration Building, is a seven-floor building facing Dealey Plaza in Dallas, Texas. The building was Lee Harvey Oswald's vantage point in his assassination of United States President John F. Kennedy on November 22, 1963. Oswald, an employee at the depository, shot and killed President Kennedy from a sixth floor window on the building's southeastern corner; 30 minutes after the shooting, Kennedy died at Parkland Memorial Hospital. The structure is a Recorded Texas Historic Landmark, located at 411 Elm Street on the northwest corner of Elm and North Houston Streets, at the western end of downtown Dallas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D0%BC%D0%B0%D1%81%D0%BA%D0%B8,_%D0%A0%D0%B5%D0%BD%D1%86%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Renzo_Caramaschi.jpg","page_title":"Карамаски, Ренцо","context_page_description":"Ре́нцо Карама́ски — итальянский государственный деятель и беспартийный политик. Профессиональный писатель и фотограф. Альпинист. Мэр Больцано с 2016 года. Имеет высшее экономическое образование. Женат."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AB%E3%83%90%E3%82%AA%E3%83%A2%E3%83%80%E3%82%AB%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Caldesia_parnassiifolia3.jpg","page_title":"マルバオモダカ属","context_page_description":"マルバオモダカ属は、オモダカ科の属。現生種が3種と、化石種が知られている。すべて抽水植物で、丸い浮葉をつける。日本にはマルバオモダカの1種が生息している。"},{"page_url":"https://en.wikipedia.org/wiki/Viking_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Mars_Viking_22e169.png","page_title":"Viking 2","context_page_description":"The Viking 2 mission was part of the American Viking program to Mars, and consisted of an orbiter and a lander essentially identical to that of the Viking 1 mission. The Viking 2 lander operated on the surface for 1316 days, or 1281 sols, and was turned off on April 12, 1980 when its batteries failed. The orbiter worked until July 25, 1978, returning almost 16,000 images in 706 orbits around Mars."},{"page_url":"https://en.wikipedia.org/wiki/Jordan_Danks","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Jordan_Danks_%289703757055%29_%28cropped%29.jpg","page_title":"Jordan Danks","context_page_description":"Jordan Cooper Danks is an American former professional baseball outfielder. He played Major League Baseball for the Chicago White Sox and Philadelphia Phillies."},{"page_url":"https://es.wikipedia.org/wiki/De_Tomaso_Pantera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/De_Tomaso_Pantera_Cortina.jpg","page_title":"De Tomaso Pantera","context_page_description":"El De Tomaso Pantera es un automóvil deportivo producido por el fabricante argentino De Tomaso entre 1971 y 1991. Es un dos plazas con motor central-trasero y tracción trasera."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%BE_(%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Campanile_di_Salento.jpg","page_title":"Саленто (Кампания)","context_page_description":"Саленто — коммуна в Италии, располагается в регионе Кампания, в провинции Салерно на юго-западе страны. Граничит с национальным парком Чиленко и Валло ди Диано, а также с Comunità Montana Zona del Gelbison e Cervati, объединением из 10 муниципалитетов.\\nТерритория Montana Zona del Gelbison e Cervati включает в себя сами коммуны, все горы Gelbison и Cervati и имеет площадь 256 км².\\nПокровительницей коммуны почитается святая Варвара, празднование 4 декабря и 29 июля.\\nЦентральная улица городка — виа Валанте Марселло Скарпа. На ней расположены здание муниципалитета, медицинский пункт и закусочная «La Dolce Vita».\\nМэр — Анджело де Марко.\\nВ Саленто проживает 2009 жителей на площади в 23 км². Плотность населения составляет 88 человек на км². Центр расположен на высоте в 420 метров над уровнем моря.\\nСоседними коммунами являются: Казаль-Велино, Кастельнуово-Чиленто, Джой, Лустра, Оминьяно, Оррия, Перито и Валло-делла-Лукания"},{"page_url":"https://pt.wikipedia.org/wiki/Lutas_nos_Jogos_Ol%C3%ADmpicos_de_Ver%C3%A3o_de_2016_-_Greco-romana_at%C3%A9_75_kg_masculino","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Wrestling_at_the_2016_Summer_Olympics_%E2%80%93_Men%27s_Greco-Roman_75_kg.jpg","page_title":"Lutas nos Jogos Olímpicos de Verão de 2016 - Greco-romana até 75 kg masculino","context_page_description":"A competição de luta Greco-romana até 75 kg masculino nos Jogos Olímpicos de 2016 decorreu a 14 de agosto na Arena Carioca 2, no Rio de Janeiro."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%A8%EA%B5%AC%EB%A1%9C%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Q69012_Namguro_A01.JPG","page_title":"남구로역","context_page_description":"남구로역은 서울특별시 구로구 도림로에 위치한 서울 지하철 7호선의 전철역이다."},{"page_url":"https://ro.wikipedia.org/wiki/Think_(IBM)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Think_signs_in_several_languages.em.jpg","page_title":"Think (IBM)","context_page_description":"\\"Think\\" este un motto inventat de Thomas J. Watson, în decembrie 1911, în timp ce gestiona departamentele de vânzări și publicitate la National Cash Register Company. Watson a spus:\\n“Noi nu suntem plătiți pentru a lucra cu picioarele noastre - suntem plătiți pentru a lucra cu capul.”\\nÎn 1914 Watson a adus motto-ul cu el la Computing Tabulating Recording Company, care mai târziu a devenit IBM. International Time Recording una dintre cele mai companii a fuzionat pentru a forma CTR-ul. IBM a produs o expoziție THINK la Lincoln Center din New York în septembrie 2011, și continuă să utilizeze motto-ul.\\nSloganul Apple: \\"Think Different\\" a fost luat pe scară largă ca un răspuns spentru IBM.\\n\\"Think\\" a intrat în cultura populară, de multe ori într-un context plin de umor. Pentru exemple timpurii, consultați Ghidul lui Corey Ford Guide a Thimking. Mad Magazine a folosit, de asemenea, motto-ul \\"THIMK\\" ca parodie."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_the_Niemen_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/BnN_2.png","page_title":"Battle of the Niemen River","context_page_description":"The Battle of the Niemen River was the second-greatest battle of the Polish–Soviet War. It took place near the middle Neman River between the cities of Suwałki, Grodno and Białystok. After having suffered almost complete defeat in the Battle of Warsaw, Mikhail Tukhachevski's Red Army forces tried to establish a defensive line, against Józef Piłsudski's counter-attacking Polish Army, running northward from the Polish-Lithuanian border to Polesie, and centering on Grodno. Between September 15 and September 25, 1920, the Poles outflanked the Soviets, once again defeating them. After the mid-October Battle of the Szczara River, the Polish Army had reached the Tarnopol-Dubno-Minsk-Drissa line.\\nAlthough this part of the conflict is usually referred to as a battle both in Polish and Russian historiography, some historians argue that it was more of a military operation with a series of battles fought often several hundred kilometres apart."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A3%9F%E7%94%A8%E9%B1%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Kashk_e_Badamjan.jpg","page_title":"食用鱼","context_page_description":"食用魚，泛指可用於食用的魚類。自有歷史紀錄以來，魚類一直是人類重要的蛋白質來源之一。另外因為含有大量不飽和脂肪酸，對於保持身體健康亦有相當大之助益。聯合國糧農組織魚類營養專家巧格爾認為，魚產品並不只是魚肉，魚頭、魚骨以及內臟均蘊涵有豐富的鐵、鋅和鈣等營養元素，如果一起食用可以增加了微量營養元素的攝入量，但這些部位卻經常被扔掉。\\n美國漁業協會公布的報告顯示，蝦、三文魚、金槍魚、羅非魚、阿拉斯加鱈魚、蘇氏鲶魚、真鱈魚、蟹、鲶魚類、蛤為2015年度美國10大消費最多的水產品。"},{"page_url":"https://nl.wikipedia.org/wiki/Sem%C4%83n%C4%83toarea_(metrostation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Semanatoarea_metro_station_1.jpg","page_title":"Semănătoarea (metrostation)","context_page_description":"Semănătoarea is een metrostation in Boekarest, dat bediend wordt door metrolijn 1. Het station werd geopend op 16 november 1979 en is genoemd naar een fabriek. De dichtstbijzijnde stations zijn Grozăvești en Crângași."},{"page_url":"https://fr.wikipedia.org/wiki/American_(locomotive)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/PLM_220_C127.jpg","page_title":"American (locomotive)","context_page_description":"American ou Outrance en Europe est un type de locomotive à vapeur dont les essieux ont la configuration suivante :\\n2 essieux sur un bogie porteur\\n2 essieux moteur"},{"page_url":"https://en.wikipedia.org/wiki/Oreola_Williams_Haskell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/BannerBearersTitlePage.png","page_title":"Oreola Williams Haskell","context_page_description":"Oreola Williams Haskell was an American activist for suffrage, author, and poet in the early twentieth century."},{"page_url":"https://eu.wikipedia.org/wiki/Orein_buztanzuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/White-tailed_deer.jpg","page_title":"Orein buztanzuri","context_page_description":"Orein buztanzuria edo virginiar oreina Odocoileus generoko animalia da. Artiodaktiloen barruko Capreolinae azpifamilia eta Cervidae familian sailkatuta dago."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%99%D7%93%D7%95%D7%AA_%D7%99%D7%94%D7%95%D7%93%D7%94_%D7%91%D7%A8%D7%95%D7%9E%D7%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Mattathias_Antigonos.jpg","page_title":"מרידות יהודה ברומא","context_page_description":"מרידות יהודה ברומא היו רצף מלחמות שפרצו בפרובינקיה יודיאה ובמזרח הים התיכון באופן כללי יותר החל משנת 66 לספירה, ועד סיום מרד בר כוכבא בשנת 135 לספירה. המרידות נשאו אופי של מלחמות לאומיות ודתיות והביאו לשיא את המתחים בין יהודים לבין האכלוסיה היוונית-רומית ההלניסטית. המרידות כללו שלושה אירועים עיקריים - המרד הגדול בין השנים 66 לשנת 70 ועיקרו בפרובינקיית יהודה שהסתיים בחורבן בית המקדש השני, מרד הגלויות שמערך בין השנים 115-117 ועיקרו היה בקפריסין, צפון אפריקה ומצרים ורק בסופו הגיע ליהודה, והאחרון מרד בר-כוכבא אשר פרץ בשנת 132 והתרכז בעיקר בפרובינקיית יהודה וסביבתה והסתיים בחורבן מוחלט של אכלוסיה יהודית במרכז ארץ ישראל.\\nהמרידות במאות הראשונה והשנייה לספירה הביאו להדלדלות מהותית של אכלוסיה יהודית באימפריה הרומית בעקבות הרג ולרדיפה דתית והמרת דת בכפייה או מבחירה. נפילת בית המקדש השני, החרבתה של ירושלים ואיבוד אחיזה בארץ יהודה הפכו את היהודים למיעוט ללא סמלים לאומיים, ועל אף נוכחות בגליל שנמשכה מאות שנים לאחר מכן, היהודים איבדו את האוטונומיה השלטונית. הדת היהודית הפכה לדת המרוכזת סביב בתי הכנסת בקהילות מפוזרות והמשיחיות הפכה למושג אבסטרקטי."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%BD%D0%B5%D0%B9_%D0%9A%D0%BE%D1%80%D0%BD%D0%B5%D0%BB%D0%B8%D0%B9_%D0%9B%D0%B5%D0%BD%D1%82%D1%83%D0%BB_%D0%9A%D0%BB%D0%BE%D0%B4%D0%B8%D0%B0%D0%BD_(%D0%BA%D0%BE%D0%BD%D1%81%D1%83%D0%BB_72_%D0%BF%D1%80.%D0%BD.%D0%B5.)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Cornelia50.jpg","page_title":"Гней Корнелий Лентул Клодиан (консул 72 пр.н.е.)","context_page_description":"Гней Корнелий Лентул Клодиан e политик на късната Римска република.\\nПроизлиза чрез осиновяване от клон Лентул на фамилията Корнелии.\\nПо рождение е от плебейска фамилия и Гней Корнелий Лентул го осиновява.\\nПърво е народен трибун. 89 пр.н.е. се бие при консула Гней Помпей Страбон в Съюзническата война. 88 пр.н.е. е магистър на Монетния двор. 82 пр.н.е. е в групата на привържениците на Сула, които след Съюзническата война се връщат в Рим. През 75 пр.н.е. става претор.\\nПрез 72 пр.н.е. е избран за консул заедно с Луций Гелий Публикола.\\nБие се против Гай Вер, пропретор на Сицилия. Има загуба в борбата против въстаналите роби на Спартак.\\nПрез 70 пр.н.е. е избран за цензор заедно с консулския му колега Публикола. Те изключват 64 сенатори от сената. След три години е легат при Помпей във войната против морските грабежници. Следващата година подкрепя издаденият от Манилий Rogatio за даване на Помпей главното командване на римската войска на Изток. Клодиан е патрон на градовете Oropos и Temnos. Той е и добър оратор.\\nНеговият син Гней Корнелий Лентул Клодиан e претор."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8B%E8%AF%BA%E5%A4%AB%E5%93%A5%E7%BD%97%E5%BE%B7%E7%B4%A2%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Pylon_T4_of_Nizhny_Novgorod_aerial_tramway.jpg","page_title":"下诺夫哥罗德索道","context_page_description":"下諾夫哥羅德索道是橫跨伏爾加河、連接下諾夫哥羅德和博爾的索道。\\n索道為兩岸居民提供除了已有的水上計程車渡輪服務、鐵路和公路以外的渡河交通新方法。與公路運輸相比，索道能耗僅為前者五分之一，票價則與鐵路相當。\\n索道於2010年1月20日動工，2012年2月9日投入使用。"},{"page_url":"https://es.wikipedia.org/wiki/Selim_III","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Tughra_of_Selim_III.JPG","page_title":"Selim III","context_page_description":"Selim III fue sultán del Imperio otomano de 1789 a 1807.​ Fue hijo de Mustafa III y sucedió a su tío Abdülhamid I."},{"page_url":"https://es.wikipedia.org/wiki/Mureck","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/AUT_Mureck_COA.jpg","page_title":"Mureck","context_page_description":"Mureck es un municipio austriaco situado al sur de Estiria que hace frontera con Eslovenia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D1%83%D1%80_%D0%B0%D0%B4-%D0%94%D0%B8%D0%BD_%D0%97%D0%B0%D0%BD%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/BattleOfInab.jpg","page_title":"Нур ад-Дин Занги","context_page_description":"Аль-Малик аль-Адиль Нур ад-Дин Абу аль-Касим Махмуд ибн Имад ад-Дин Занги — тюркский атабек Халеба c 1146 года и амир Дамаска с 1154 года из династии Зангидов."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_basiliques_catholiques_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Basilique_Notre_Dame_de_Ceignac.JPG","page_title":"Liste des basiliques catholiques en France","context_page_description":"Il existe 171 basiliques mineures en France."},{"page_url":"https://en.wikipedia.org/wiki/Koizumi_Matajir%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Matajir%C5%8D_Koizumi_1930.jpg","page_title":"Koizumi Matajirō","context_page_description":"Koizumi Matajirō was a Japanese politician and cabinet minister in the Taishō period and early Shōwa period Japan. He was the grandfather of Jun'ichirō Koizumi, who served as the Prime Minister of Japan from 2001 to 2006."},{"page_url":"https://it.wikipedia.org/wiki/Jerry_Rubin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jerry_Rubin_%28edit%29_-_Spectrum_13Mar1970.jpg","page_title":"Jerry Rubin","context_page_description":"Jerry Rubin è stato un politico e attivista statunitense."},{"page_url":"https://eo.wikipedia.org/wiki/Jorge_Eli%C3%A9cer_Gait%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Jorge_Eli%C3%A9cer_Gait%C3%A1n_%281936%29.jpg","page_title":"Jorge Eliécer Gaitán","context_page_description":"Jorge Eliécer GAITÁN estis kolombia politikisto kaj membro de la liberala partio. Li estis ministro pri Edukado kaj Laboro. Li organizis novan kontraŭoligarkian politikan movadon, sed poste estis venkita en la prezidentaj voĉdonadoj de 1946 de la konservativulo Mariano Ospina Pérez. Li estis murdita, fakto kiu ekestigis energian popolan reagon.\\nLi estis rektoro de la Libera Universitato de Kolombio, ekde 1936 ĝis 1939. Li ricevis la katedron de kriminala juro ekde 1931 kaj instruis\\nĝin tie ĝis sia murdo. Li estis urbestro de Bogoto ekde 1936, kaj ankaŭ li estis senatano plurfoje ekde 1929 ĝis 1948.\\nGaitán forĝis sian reputacion kiel oratoro kaj defendema de popularaj kialoj danke al siaj fortagoj dum la debato pri la Amasmurdo de la Bananistoj dum 1928, farita de United Fruit Company, la tiama nomo por Chiquita Brands International.\\nPlej konataj frazoj:\\n\\"Mi ne estas viro, mi estas popolo\\"\\n\\"Ni tre fieras pri ĉi malnova indiĝena raso! Kaj ni malamas la oligarkion, kiu ignoras nin\\"\\n\\"Ĉi homa lavango militas, militos; kaj venkos konservativan oligarkion\\"\\n\\"La popolo superas siajn estrojn\\"\\n\\"Ĉu mi avancas, sekvu min. Ĉu mi haltas, puŝu min. Ĉu mi perfidas vin, mortigu min."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bodendenkm%C3%A4ler_in_Kiefersfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Alte_Pfarrkirche_Kiefersfelden-2.jpg","page_title":"Liste der Bodendenkmäler in Kiefersfelden","context_page_description":"Auf dieser Seite sind die Bodendenkmäler der oberbayerischen Gemeinde Kiefersfelden zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Bodendenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Aristide_Cavaill%C3%A9-Coll","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Aristide_Cavaille_Coll_Organ_at_the_Great_Hall_of_Moscow_Conservatory.jpg","page_title":"Aristide Cavaillé-Coll","context_page_description":"Aristide Cavaillé-Coll was a French organ builder. He has the reputation of being the most distinguished organ builder of the 19th century. He pioneered innovations in the art and science of organ building that permeated throughout the profession and influenced the course of organ building and organ composing through the early 20th century. The organ reform movement sought to return organ building to a more Baroque style; but since the 1980s, Cavaillé-Coll's designs have come back into fashion. After Cavaillé-Coll's death, Charles Mutin maintained the business into the 20th century. Cavaillé-Coll was the author of many scientific journal articles and books on the organ in which he published the results of his researches and experiments. He was the inventor of several organ stops such as the flûte harmonique. His most famous organs in Paris are in Basilique du Sacré-Cœur, Basilique Sainte-Clotilde and Église de la Madeleine."},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Edinburgh/31","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Edinburgh%2C_2-20_Earl_Grey_Street%2C_Methodist_Central_Hall.jpg","page_title":"List of listed buildings in Edinburgh/31","context_page_description":"This is a list of listed buildings in Edinburgh, Scotland."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Montel-de-Gelat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%C3%89glise_du_Montel-de-Gelat_63380%2C_France.jpg","page_title":"Montel-de-Gelat","context_page_description":"Montel-de-Gelat sī ūi-tī Hoat-kok Auvergne toā-khu Puy-de-Dôme koān ê chi̍t ê commune."},{"page_url":"https://br.wikipedia.org/wiki/Jack_Rackham","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Rackham%2C_Jack.jpg","page_title":"Jack Rackham","context_page_description":"Jack Rackham pe John Rackham, pe c’hoazh Calico Jack, a zo ur morlaer eus an XVIIIᵛᵉᵗ kantved. Diazezet eo e anv war e zoare d’en em wiskañ: leun a livioù e oa e zilhad, graet gant lien-kotoñs. Brudet eo ivez peogwir e oa div vaouez vrudet en e skipailh: Anne Bonny ha Mary Read."},{"page_url":"https://es.wikipedia.org/wiki/Bothrops_asper","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Bothrops_asper_Area.PNG","page_title":"Bothrops asper","context_page_description":"La terciopelo ​ es una especie de serpiente crotalina venenosa que se encuentra en América Central y el norte de Sudamérica.​ Se halla en un amplio rango de hábitats de tierras de altitud altas, a menudo cerca de asentamientos humanos. Es una especie grande y nerviosa, y es la principal responsable de incidentes por mordeduras de serpiente dentro de su zona de distribución.​ No se reconocen subespecies actualmente.​l"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%BE%D0%BF%D1%81%D0%BA%D0%B8_%D0%B4%D1%80%D0%B0%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D0%BD_%D1%82%D0%B5%D0%B0%D1%82%D1%8A%D1%80_%E2%80%9E%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%A5%D0%B0%D0%B9%D1%82%D0%BE%D0%B2%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Map_of_Smolyan.png","page_title":"Родопски драматичен театър „Николай Хайтов“","context_page_description":"Родопският драматичен театър „Николай Хайтов“ се намира в град Смолян."},{"page_url":"https://en.wikipedia.org/wiki/Lady_Margaret_Fortescue","image_url":"https://upload.wikimedia.org/wikipedia/en/6/6d/1948_Portrait_of_Lady_Margaret_Fortescue%2C_half-plate_film_negative%2C_taken_in_London%2C_England_in_Bassano_Ltd_photographers_studio.png","page_title":"Lady Margaret Fortescue","context_page_description":"Lady Margaret Fortescue DL was a British huntswoman, and one of the country's largest private landowners, including the Castle Hill estate and 20,000 acres of Exmoor."},{"page_url":"https://fr.wikipedia.org/wiki/Cailloux-sur-Fontaines","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%C3%89glise_Notre-Dame-de-l%27Assomption_de_Cailloux-sur-Fontaines.JPG","page_title":"Cailloux-sur-Fontaines","context_page_description":"Cailloux-sur-Fontaines est une commune française située dans la métropole de Lyon, en région Auvergne-Rhône-Alpes."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BB%BB%E5%A4%A9%E5%A0%82%E9%9B%BB%E5%AD%90%E9%81%8A%E6%88%B2%E6%A9%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/NES-Console-Set.png","page_title":"任天堂電子遊戲機列表","context_page_description":"任天堂是一家總部位於日本京都的遊戲機製造商及遊戲開發商，其業務範圍橫跨全球。任天堂自進入遊戲機市場以來，已推出八部家用遊戲機及許多掌上遊戲機；截至2018年3月，任天堂共售出7億2541萬部遊戲機。\\n進入遊戲機市場初期，任天堂曾推出Color TV-Game及Game & Watch等遊戲機，但直到1983年推出紅白機獲得極大成功之後，任天堂才首次成為了電子遊戲產業龍頭。1989年，任天堂推出Game Boy，成為首部成功的掌上遊戲機，並擊敗SEGA推出的Game Gear。1990年，為對抗SEGA的16位元家用遊戲機Mega Drive，任天堂推出了超級任天堂。任天堂與SEGA的競爭一直持續到1990年代末。1994年，索尼推出了次世代主機PlayStation，擊敗了任天堂於1996年推出的主機任天堂64及SEGA的SEGA土星，任天堂因而首次失去家用遊戲機市場龍頭地位。\\n2001年，任天堂推出任天堂GameCube，但銷量不敵索尼推出的PlayStation 2及微軟推出的Xbox；同時，任天堂仍在掌上遊戲機市場中領先對手，1998年推出的Game Boy Color及2001年推出的Game Boy Advance皆大勝其他掌上遊戲機。2004年，任天堂推出任天堂DS，成為首部商業成功的觸控螢幕掌上遊戲機；2006年，任天堂推出任天堂Wii，是首部大規模運用體感技術的遊戲機，兩者皆獲得成功，使任天堂重奪遊戲機市場龍頭地位。\\n2010年，任天堂推出任天堂3DS，是首部應用裸視3D顯示技術的掌上遊戲機。2012年，任天堂推出Wii的繼任者Wii U，但由於商業決策錯誤及第三方遊戲陣容不足等因素，使得Wii U成為任天堂銷量最少的家用遊戲機，主機也於2017年停產。2017年，任天堂推出混合式遊戲機任天堂Switch。"},{"page_url":"https://sv.wikipedia.org/wiki/Mag%C3%A9,_Rio_de_Janeiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Centro_de_Mag%C3%A9.jpg","page_title":"Magé, Rio de Janeiro","context_page_description":"Magé är en stad och kommun i östra Brasilien och ligger i delstaten Rio de Janeiro. Den är en förortskommun till Rio de Janeiro och folkmängden uppgår till cirka 230 000 invånare, medan centralorten har lite mer än 50 000 invånare. Den största orten i kommunen är Inhomirim, med över 100 000 invånare."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D8%A8%D9%86%D8%AA%D8%8C_%DA%A9%D9%84%D8%B1%D8%A7%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bent_County%2C_CO%2C_rodeo_arena_IMG_5725.JPG","page_title":"شهرستان بنت، کلرادو","context_page_description":"شهرستان بنت، کلرادو یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در کلرادو واقع شده‌است."},{"page_url":"https://pl.wikipedia.org/wiki/Rossell%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Vista_a%C3%A8ria_de_Rossell%C3%B3.JPG","page_title":"Rosselló","context_page_description":"Rosselló – gmina w Hiszpanii, w prowincji Lleida, w Katalonii, o powierzchni 9,9 km². W 2011 roku gmina liczyła 3103 mieszkańców."},{"page_url":"https://et.wikipedia.org/wiki/Trammiliiklus_Liep%C4%81jas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Liepajastramvajs_12.jpg","page_title":"Trammiliiklus Liepājas","context_page_description":"Läti suuruselt kolmandas linnas Liepājas on üksainus trammiliin. See on 15,4 km pikk, kummaski suunas on 17 peatust ja keskmiselt kulub selle ühest otsast teise sõitmiseks 25 minutit. Kitsarööpmelise tee rööpmelaius on 1000 mm.\\n2009. aasta seisuga on trammiliiklust korraldaval ettevõttel SIA Liepājas tramvajs 16 Tatra KT4 tüüpi trammivagunit, millest korraga on liinil seitse. Aastal 2014 kasutas trammi keskmiselt 10 186 inimest päevas."},{"page_url":"https://fr.wikipedia.org/wiki/Gabriel_Jean_du_Pac_de_Bellegarde","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Naufrage_du_navire_l%27Astrolabe_en_1788.jpg","page_title":"Gabriel Jean du Pac de Bellegarde","context_page_description":"Gabriel Jean du Pac de Bellegarde, dit le Chevalier du Pac de Bellegarde, navigateur français, né le 19 août 1765 au château de Bellegarde, à Bellegarde-du-Razès, décédé en 1788, à Vanikoro, membre de l'expédition de Lapérouse."},{"page_url":"https://war.wikipedia.org/wiki/Parahollardia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Jambeau_%28_Parahollardia_lineata_%29.jpg","page_title":"Parahollardia","context_page_description":"An Parahollardia in uska genus han Actinopterygii. An Parahollardia in nahilalakip ha familia nga Triacanthodidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://pl.wikipedia.org/wiki/Lamotte-Brebi%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%C3%89glise_de_Lamotte-Brebi%C3%A8re.JPG","page_title":"Lamotte-Brebière","context_page_description":"Lamotte-Brebière – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Somma.\\nWedług danych na rok 1990 gminę zamieszkiwało 215 osób, a gęstość zaludnienia wynosiła 51 osób/km²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Herborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/3_Eiche_Sch%C3%B6nbach.jpg","page_title":"Liste der Naturdenkmale in Herborn","context_page_description":"Die Liste der Naturdenkmale in Herborn nennt die auf dem Gebiet der Stadt Herborn gelegenen Naturdenkmale. Sie sind bei der unteren Naturschutzbehörde des Lahn-Dill-Kreises eingetragen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%86%E9%99%B6%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/%E6%8D%B7%E6%88%90%E6%B4%8B%E8%A1%8C%E9%9D%92%E5%B2%9B%E5%88%86%E8%A1%8C%E6%97%A7%E5%9D%80_2019-12-27.jpg","page_title":"馆陶路","context_page_description":"馆陶路是中国青岛市市北区的一条南北向道路。道路南起堂邑路、市场一路、莱州路路口，与东阿路、吴淞路、上海路、广东路交汇，西端为恩县路陵县路路口。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%BC%E3%83%91%E3%83%BC%E3%82%B7%E3%83%A3%E3%83%BC%E3%83%9E%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/M4-Sherman-CrabII-latrun-6.jpg","page_title":"スーパーシャーマン","context_page_description":"スーパーシャーマンは、アメリカ合衆国が開発・生産したM4シャーマン戦車に、イスラエル国防軍が独自の改良を加えて1950年代から1980年代にかけて使用したM1/M50/M51戦車の通称である。\\n本項ではこれらの車輌に加えて、同軍のM4およびその派生車の運用についても概説する。"},{"page_url":"https://en.wikipedia.org/wiki/Ffostrasol","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ffostrasol.jpg","page_title":"Ffostrasol","context_page_description":"Ffostrasol is a small village in the south of Ceredigion, Wales. It is located on the A486 between Synod Inn and Llandysul, and it forms part of the parish of Troedyraur. The village lies on a rural crossroad connecting it with the nearby village of Plwmp to the north, Synod Inn to the north east, Newcastle Emlyn to the south west, and Llandysul to the south east.\\nVillage amenities include the Ffostrasol Arms inn and a garage. There is also a local football club and the village has a team which compete in Talwrn y Beirdd, a poetry programme broadcast on Radio Cymru."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Viersen_(G%E2%80%93L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/87_Wohnhaus%2C_Heimerstra%C3%9Fe_123_%28Helenabrunn%29.jpg","page_title":"Liste der Baudenkmäler in Viersen (G–L)","context_page_description":"Die Liste der Baudenkmäler in Viersen (G–L) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Viersen im Kreis Viersen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Viersen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://br.wikipedia.org/wiki/Star_Wars_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/May_the_4th_be_with_you_%28Star_Wars_Day%29.gif","page_title":"Star Wars Day","context_page_description":"Ar Star Wars Day, d'ar 4 a viz Mae, zo un devezh lid evit oberenn George Lucas, Star Wars. Lidet e vez gant an dud sot gant ar frañchiz. An devezh lid a zo bet brudet buan dre ar mediaioù ha dre lidoù gant tud treuzwisket.\\nAn devezh a zo bet choazet a-ziwar ar frazenn brudet \\"May the Force be with you\\" troet da \\"May the Fourth be with you\\". Memes ma ne oa ket bet lakaet ofisiel an devezh-se gant Lucasfilm, an dud sot gant Star Wars dre ar bed a heulie anezhañ. Abaoe ez eo bet adkemeret gant Lucasfilm ha Disney evel devezh lid bed Star Wars."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Europameisterschaften_2014/100_m_der_Frauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/025_reeksen_60m_philip_%2832505897124%29_%28cropped%29.jpg","page_title":"Leichtathletik-Europameisterschaften 2014/100 m der Frauen","context_page_description":"Der 100-Meter-Lauf der Frauen bei den Leichtathletik-Europameisterschaften 2014 wurde am 13. und 14. August 2014 im Letzigrund-Stadion von Zürich ausgetragen.\\nEuropameisterin wurde die Niederländerin Dafne Schippers, die zwei Tage darauf auch den Titel über 200 Meter errang. Sie gewann vor der französischen EM-Dritten von 2010 Myriam Soumaré, die über 200 Meter 2010 Europameisterin und 2012 EM-Dritte war. Hier in Zürich errang sie über 200 Meter erneut Bronze. Die Britin Ashleigh Nelson kam auf den dritten Platz."},{"page_url":"https://fr.wikipedia.org/wiki/Guiorgui_Gakharia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/COVID-19_Outbreak_Cases_in_Georgia_per_regional_unit_%28municipality%29.svg","page_title":"Guiorgui Gakharia","context_page_description":"Giorgi Gakharia, né le 19 mars 1975 à Tbilissi, est un homme d'État géorgien. Membre de Rêve géorgien, il est Premier ministre depuis le 8 septembre 2019.\\nNé dans une famille mingrélienne, Gakharia grandit en Géorgie mais finit ses études à Moscou, où il travaille dans le secteur privé jusqu'à sa transition dans une carrière politique et son retour dans son pays natal. En 2013, après un changement de gouvernement, le nouveau parti au pouvoir, Rêve géorgien, le nomme Défenseur public des droits des entreprises, puis secrétaire du Conseil économique du Premier ministre en 2014.\\nDevenu une « étoile montante » de la politique géorgienne, il rejoint le Parlement éphémèrement suite aux élections parlementaires de 2016, avant de devenir ministre de l'Économie et du Développement durable. En tant que ministre, il devient un champion du marché libre, signe un accord historique de libre-échange avec la Chine et lance des négociations pour un accord similaire avec l'Inde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeinden_im_Gro%C3%9Fherzogtum_Luxemburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Coat_of_arms_steinfort_luxbrg.png","page_title":"Liste der Gemeinden im Großherzogtum Luxemburg","context_page_description":"Das Großherzogtum Luxemburg ist in zwölf Kantone und 102 Gemeinden gegliedert.\\nIn der folgenden Tabelle sind die Gemeinden, der Kanton, in dem sie liegen, die Einwohnerzahl und der Stand der Einwohnerzahl aufgelistet.\\nZwölf Ortschaften tragen den Titel „Stadt“, der in Luxemburg durch Gesetz verliehen wird. Einige Städte tragen ihren Titel seit dem Mittelalter; diese Titel wurden durch das erste Gemeindegesetz vom 24. Februar 1843 lediglich bestätigt. Durch zwei Gesetze aus den Jahren 1906 und 1907 wurde fünf weiteren Gemeinden der Titel einer Stadt verliehen. Das neue Gemeindegesetz vom 13. Dezember 1988 hat lediglich die Titel der zwölf luxemburgischen Städte bestätigt. Die 12 Städte sind: Diekirch, Differdange, Dudelange, Echternach, Esch/Alzette, Ettelbruck, Grevenmacher, Luxemburg, Remich, Rumelange, Vianden und Wiltz. Die mit Abstand größte Stadt und einzige Großstadt des Großherzogtums ist die Hauptstadt Luxemburg."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kikin_palace_SPB_2.jpg","page_title":"Архитектура Санкт-Петербурга","context_page_description":"Архитектура Санкт-Петербурга, в особенности его исторического центра, представляет собой созданный в XVIII—XX веках один из самых выдающихся по выразительности архитектурных столичных комплексов. На территории России Санкт-Петербург стал первым крупным современным городом, на территории Европы — самой молодой столицей.\\nОсобенностями архитектуры Санкт-Петербурга являются продуманная регулярность застройки, соразмерность городских ансамблей, неброской природной среды, гармоничная полифония различных архитектурных стилей, сочетание регионального и столичного склада ума, вовлечение пригородов в единую агломерацию."},{"page_url":"https://ro.wikipedia.org/wiki/Prietr%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Prietrz_02.jpg","page_title":"Prietrž","context_page_description":"Prietrž este o comună slovacă, aflată în districtul Senica din regiunea Trnava. Localitatea se află la altitudinea de 293 m deasupra n.m., se întinde pe o suprafață de 24,69 km² și în 2017 număra 737 de locuitori."},{"page_url":"https://oc.wikipedia.org/wiki/Mequinenza","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Presa_de_Mequinensa.jpg","page_title":"Mequinenza","context_page_description":"Mequinenza es un municipi de la província espanhòla de Saragossa dins la Comunautat Autonòma d'Aragon. La municipalitat aperten dins la comarca del Bas Cinca. Es plaçada en l'extrèm oriental de la província de Saragossa e plaçada en la confluéncia de tres rius, l'Ebre e lo Segre, que pauc abans a recebut las aigas del Cinca. Lo sieu tèrme municipal a 307,45 km². La siá restanca, conegut coma Mar d'Aragon, bastit entre 1957 e 1964, a jonhètz capacitat de 1.530.000.000 m³ e es òm dels mai grans d'Espanha."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E8%89%AF%E5%B7%9D%E3%82%B9%E3%83%9D%E3%83%BC%E3%83%84%E3%83%97%E3%83%A9%E3%82%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Nagaragawa_Sports_Plaza01.JPG","page_title":"長良川スポーツプラザ","context_page_description":"長良川スポーツプラザは、岐阜県岐阜市にある宿泊や研修会議などを行う施設である。\\n岐阜県が所有し、同県のスポーツの発展に寄与することを目的に造られた。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%BF%D0%B0%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Map_of_comune_of_Alpago_%28province_of_Belluno%2C_region_Veneto%2C_Italy%29.svg","page_title":"Алпаго","context_page_description":"Алпа̀го е община в Северна Италия, провинция Белуно, регион Венето. Административен център на общината е село Пиеве д'Алпаго, което е разположено на 690 m надморска височина. Населението на общината е 6807 души.\\nОбщината е създадена в 1 януари 2016 г. Тя се състои от предшествуващите общини Пиеве д'Алпаго, Пуос д'Алпаго и Фара д'Алпаго."},{"page_url":"https://nl.wikipedia.org/wiki/Oorlogskruis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Oorlogskruis_Belgie_met_palm_en_eervolle_vermeldingen_op_3_niveaus.jpg","page_title":"Oorlogskruis","context_page_description":"Er zijn tal van onderscheidingen die, in enige taal, het \\"Oorlogskruis\\" heten.\\nDe inspiratie is meestal het Franse Oorlogskruis dat op 8 april 1915 werd ingesteld om naast het Legioen van Eer en de Médaille militaire ook een Eervolle Vermelding te kunnen belonen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_visits_to_the_United_States:_Africa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ismail_Omar_Guelleh_with_Obamas_2014.jpg","page_title":"List of diplomatic visits to the United States: Africa","context_page_description":"International trips made by the heads of state and heads of government to the United States have become a valuable part of American diplomacy and international relations since such trips were first made in the mid-19th century. They are complicated undertakings that often require months of planning along with a great deal of coordination and communication.\\nThe first international visit to the United States was made by King Kalakaua of Hawaii in 1874, which was the first visit by a foreign chief of state or head of government.\\nThe first African head of state to visit the United States was President Edwin Barclay of Liberia in 1943."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B4%97%E0%B5%8D%E0%B4%97%E0%B5%BC_%E0%B4%AE%E0%B5%81%E0%B4%A4%E0%B4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Front_View_of_a_Crocodile_in_the_banks_of_Vashishti_River.jpg","page_title":"മഗ്ഗർ മുതല","context_page_description":"ദക്ഷിണ ഇറാനിലും പാകിസ്താനിലും ഇന്ത്യൻ ഉപഭൂഖണ്ഡത്തിലും ശ്രീലങ്കയിലും ശുദ്ധജല ആവാസസ്ഥലങ്ങളിൽ കാണപ്പെടുന്ന ഒരു മുതലയാണ് മഗ്ഗർ മുതല. മാർഷ് ക്രൊക്കൊഡൈൽ, ബ്രോഡ്-സ്നൗട്ടെഡ് ക്രൊക്കൊഡൈൽ, മഗ്ഗർ എന്നിവ ഇവയുടെ സാധാരണനാമങ്ങളാണ്. 1982 മുതൽ ഭൂട്ടാൻ, മ്യാൻമർ എന്നീ രാജ്യങ്ങളിൽ ഇത് വംശനാശ ഭീഷണിയിലാണ്."},{"page_url":"https://pt.wikipedia.org/wiki/Dolbeau-Mistassini","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Dol-Mis_CV.jpg","page_title":"Dolbeau-Mistassini","context_page_description":"Dolbeau-Mistassini é uma cidade no norte do Quebec, no Canadá."},{"page_url":"https://en.wikipedia.org/wiki/Kinmel_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Houses_on_The_Promenade%2C_Kinmel_Bay_%28geograph_4175274%29.jpg","page_title":"Kinmel Bay","context_page_description":"Kinmel Bay is a seaside village in Conwy County Borough, north-east Wales. It is also an electoral ward to the county council and town council. The resort town of Rhyl lies just across the River Clwyd in the neighbouring county of Denbighshire.\\nAccording to the 2001 Census, together with neighbouring Towyn, it had a population of 7,864, of which 10.7% could speak Welsh.\\nKinmel Bay is part of a large urban area which includes Abergele, Bodelwyddan, Pensarn, Towyn, Rhyl and Prestatyn, These are also tourist areas for spring/summer self-catering holidaymakers which include various caravan sites.\\nKinmel Bay was originally called Foryd before it grew in size, and that was the name of the former train station. Kinmel Bay beach is popular with tourists and the local population. In addition to various small shops and takeaway outlets, there is also an Asda superstore that opened in 1981, and includes a large petrol filling station.\\nScreenwriter/director Jimmy Sangster, known for his work on various Hammer horror films, was born in Kimmel Bay."},{"page_url":"https://de.wikipedia.org/wiki/L-3_Insight_Technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/L3_Insight_technology_logo.jpg","page_title":"L-3 Insight Technology","context_page_description":"L-3 Insight Technology ist ein im Jahre 1988 gegründetes US-amerikanisches Unternehmen, welches optoelektronische Komponenten – hauptsächlich für den militärischen Bereich – entwickelt und produziert. Zu den Produkten gehören Zielhilfen, Zielbeleuchtungsgeräte, Bildverstärker sowie Wärmebildgeräte."},{"page_url":"https://en.wikipedia.org/wiki/Tibetan_tangka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Tibetan_Tangka_58%2C_reverse.jpg","page_title":"Tibetan tangka","context_page_description":"The tangka was a currency of Tibet until 1941. It was subdivided into 15 skar or 1½ sho and, from 1909, it circulated alongside the srang, worth 10 sho."},{"page_url":"https://nl.wikipedia.org/wiki/Jan_Langedijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Jan_Langedijk.jpg","page_title":"Jan Langedijk","context_page_description":"Jan Langedijk was een Nederlandse schaatser. Hij veroverde de Nederlandse titel op de NK allround toernooien van 1940 en 1947. Langedijk vertegenwoordigde Nederland op de Olympische Winterspelen van 1936 en 1948. In 1948 was hij vlaggendrager en de eerste Nederlandse winterolympiër die voor de tweede keer deelnam."},{"page_url":"https://es.wikipedia.org/wiki/Museo_Catedralicio_de_Ourense","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ourense_Museo_Catedral_01-18.JPG","page_title":"Museo Catedralicio de Ourense","context_page_description":"El Museo Catedralicio de Ourense, situado en el interior de la Catedral, contiene una completa muestra de arte sagrado. Su origen hay que retrasarla hasta 1944 cuando se decidió acometer las obras necesarias que permitieran la exhibición de las piezas que conservaba la Catedral. Las obras fueron llevadas a cabo por los arquitectos Luis Menéndez Pidal y Francisco Pons Sorolla, siendo inaugurado en 1954.\\nEl Museo está situado en el ángulo formado por la nave mayor y el brazo sur del transepto y ocupa las dependencias que se construyeron del inacabado claustro gótico. Se accede desde la nave de la Epístola, a través de una puerta con arco conopial hacia la nave y románica cara el interior; esta segunda muestra en su tímpano un Agnus Di con dos ángeles turiferarios.​ Así, las dos salas del Museo poseen una serie muy interesante de capiteles y ménsulas con escenas de caza, animales mitológicos, figuras humanas y motivos vegetales. En 1992 fue reestructurado y ampliado, y existe el proyecto de una nueva ampliación que ocuparía la anexa capilla de San Xoán, la antigua escuela de la Catedral y un patio para exponer las obras epigráficas."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B1%DB%8C%D9%85%E2%80%8C%DA%AF%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Salvia_officinalis0.jpg","page_title":"مریم‌گلی","context_page_description":"مریم‌گلی معمولی گیاهی است چند ساله و علفی، ریشه راست و دارای انشعابات فراوان ساقه راست و ارتفاع آن بین ۸۰–۵۰ سانتی‌متر می‌باشد این گیاه دارای ساقه‌های به رنگ سبز تیره وپوشیده از کرکهای انبوه و خاکستری رنگ است. با افزایش عمر گیاه، ساقه چوبی ور نگ آن قهوه‌ای می‌شود. برگ‌ها بلند ونیزه‌ای شکل می‌باشند. برگ‌های پایینی دارای دمبرگ بلند هستند در حالی که برگ‌های قسمت فوقانی ساقه، دمبرگ کوتاهی دارند. سطح فوقانی و تحتانی برگ‌ها پوشیده از کرکهای ظریف می‌باشد. گل‌ها به رنگ بنفش متمایل به آبی، صورتی یا سفید و به صورت مجتمع در قسمت فوقانی ساقه‌ها روی چرخه‌های مخصوصی مشاهده می‌شوند. روی هرچرخه ۸–۵ گل وجود دارد میوه فندقه و به رنگ قهوه‌ای روشن یا تیره‌است. قطر تاج گیاه حدود ۵۵ سانتی‌متر است. وزن هزار دانه ۶۱/۵۵ گرم و طول دوره جوانه زنی ۱۲ روز می‌باشد. این گیاه از راسته لب‌گلی‌ها و تیره نعنائیان است.زمان گلدهی این گیاه، بهار و رویشگاه آن در دامنه های صخره ای در منطقه ایرانی – تورانی می باشد. این گیاه،\\nانحصاری ایران است و در ناحیه فارس\\nپراکنش دارد و تحت عنوان مریم گلی اقلیدی شناخته می شود."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BF%D5%B8%D5%A2%D5%AB%D5%A1%D5%B6%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ottobiano_veduta.jpg","page_title":"Օտոբիանո","context_page_description":"Օտոբիանո, կոմունա Իտալիայի Լոմբարդիա մարզի Պավիա գավառում։\\nԲնակչությունը կազմում է 1166 մարդ ։ Խտությունը կազմում է 48 մարդ/կմ²։ Տարածքը 24 կմ² է։ Փոստային ինդեքս՝ 27030։ Հեռախոսային կոդ՝ 0384։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%BE%D1%81%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D1%8F_%D1%85%D1%80%D0%B0%D0%BC%D0%B0_%D0%B2_%D0%9F%D0%B0%D0%BB%D0%BE%D1%81%D0%BA%D0%BE.jpg","page_title":"Палоско","context_page_description":"Палоско — муніципалітет в Італії, у регіоні Ломбардія, провінція Бергамо.\\nПалоско розташоване на відстані близько 470 км на північний захід від Рима, 55 км на схід від Мілана, 18 км на південний схід від Бергамо.\\nНаселення — 5851 особа.\\nЩорічний фестиваль відбувається 10 серпня. Покровитель — Святий Лаврентій."},{"page_url":"https://nl.wikipedia.org/wiki/Objectvoorstelling","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Signatuur_-_Vierkant.png","page_title":"Objectvoorstelling","context_page_description":"Een objectvoorstelling is binnen de digitale beeldverwerking een voorstelling van een gesegmenteerd object, die deze in een compacte en/of essentiële vorm weergeeft. Hierdoor kunnen er op efficiënte wijze analyses en vergelijkingen op de eigenschappen van het object uitgevoerd worden.\\nEr zijn twee aspecten waarop men een voorstelling kan baseren:\\nAan de hand van externe kenmerken;\\nWanneer vooral de vorm van belang is\\nOf interne kenmerken\\nWanneer zaken als kleur of textuur van belang zijn"},{"page_url":"https://fr.wikipedia.org/wiki/Glacier_Taku","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Taku_Icefield.jpg","page_title":"Glacier Taku","context_page_description":"Le glacier Taku est un glacier côtier de l'Alaska du Sud-Est, juste au sud-est de la ville de Juneau.\\nLe glacier fut d'abord nommé glacier Schultze en 1883 puis glacier Foster en 1890, mais Taku, le nom que les amérindiens Tlingit locaux avaient pour le glacier, s'imposa. Il se trouve dans la chaîne Côtière et prend naissance dans le champ de glace Juneau dont il est le plus grand glacier et l'un glaciers côtiers les plus méridionaux de l'hémisphère nord.\\nLe glacier, qui converge vers la Taku River dans la baie Taku, a plusieurs fois progressé, dans son histoire, jusqu'à ce qu'il bloque la rivière, créant un lac, suivi par une dramatique rupture du barrage de glace. La plus récente de ces avancées du glacier date de 1750. Le glacier a avancé de 7,5 kilomètres depuis 1890. C'est le seul glacier qui avance des 20 plus importants glaciers provenant du Juneau Icefield. Si cette avance continue, il bloquera de nouveau la rivière. Depuis 1946, le glacier est observé annuellement par le Juneau Icefield Research Program, qui a noté une avance du glacier depuis 1988 de 17 mètres par an. Cette avance est provoquée par un équilibre positif de la masse du glacier."},{"page_url":"https://nl.wikipedia.org/wiki/Graafschap_Leiningen-Heidesheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Leiningen-map.png","page_title":"Graafschap Leiningen-Heidesheim","context_page_description":"Het graafschap Leiningen-Heidesheim was een tot de Boven-Rijnse Kreits behorend graafschap binnen het Heilige Roomse Rijk.\\nIn Heidesheim lieten de graven Johan Lodewijk en Philip Georg van Leiningen-Dagsburg-Falkenburg tussen 1608 en 1612 een slot bouwen, dat in de Dertigjarige Oorlog werd versterkt.\\nDe residentie wordt dan van Falkenburg naar Heidesheim verlegd. Leiningen-Heidesheim is dus een andere naam voor Leiningen-Falkenburg.\\nAls in 1774 de in 1560 gestichte tak Leiningen-Dagsburg-Falkenburg is uitgestorven, wordt dat graafschap door de keizer op 19 augustus 1774 als rijksleen teruggenomen. Het grootste deel van het graafschap wordt verenigd met het graafschap Leiningen-Dagsburg-Hardenburg."},{"page_url":"https://vi.wikipedia.org/wiki/Bhanurangsi_Savangwongse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Prince_Bhanurangsi_Savangwongse.jpg","page_title":"Bhanurangsi Savangwongse","context_page_description":"Nguyên soái Hoàng tử Bhanurangsi Savangwongse, Hoàng tử Banubandhu Vongsevoradej là con trai của Quốc vương Mongkut của Xiêm La và Nữ hoàng Debsirindra.\\nMặc dù thái tử giữ một số chức vụ trong chính quyền của anh trai mình, vua Chulalongkorn, bao gồm cả các bài viết của Tổng tư lệnh của người Xiêm Quân đội Hoàng gia, ông được nhớ đến nhiều nhất là người sáng lập của dịch vụ bưu chính Thái.\\nCon trai nổi tiếng nhất của ông là vận động viên đua xe công thức một, Hoàng tử Birabongse Bhanudej Bhanubandh, tốt hơn được gọi là Hoàng tử Bira."},{"page_url":"https://ca.wikipedia.org/wiki/Louis_Niedermeyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Louis_Niedermeyer.jpg","page_title":"Louis Niedermeyer","context_page_description":"Louis Niedermeyer fou un compositor i professor de música suís.\\nFill d'un músic alemany, va rebre les primeres lliçons del seu pare, i als quinze anys fou enviat a Viena, on va tenir per mestres en Moscheles per al piano, i en Forster per la composició; després estudià sota la direcció de Zingarelli a Nàpols, i allà, per consell de Rossini, estrenà la seva primera òpera Il reo per amore, que aconseguí una acollida força favorable.\\nEl 1821 s'establí a Ginebra com a professor de piano, i el 1823 es traslladà a París i estrenà una altra òpera La casa nel bosco, que no tingué gens d'èxit."},{"page_url":"https://sv.wikipedia.org/wiki/Brachythecium_populeum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Sciuro-hypnum_populeum_%28d%2C_144646-474722%29_2197.JPG","page_title":"Brachythecium populeum","context_page_description":"Brachythecium populeum är en bladmossart som först beskrevs av Jules Cardot, och fick sitt nu gällande namn av Noriwo Takaki 1955. Brachythecium populeum ingår i släktet gräsmossor, och familjen Brachytheciaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ceb.wikipedia.org/wiki/Pogonia_minor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Pogonia_minor_2.JPG","page_title":"Pogonia minor","context_page_description":"Espesye sa orkidya nga una nga gihulagway ni Tomitaro Makino, ug nga gihatagan sa eksakto nga ngalan ni Tomitaro Makino ang Pogonia minor. Ang Pogonia minor sakop sa kahenera nga Pogonia sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DA%AF%D8%B3%E2%80%8C%DA%AF%DB%8C%D8%B1_%D8%A8%D9%87%D8%B4%D8%AA%DB%8C_%D8%A8%D9%84%D8%A7%DB%8C%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Oriental_Paradise_Flycatcher_-_Lip_Kee_%281%29.jpg","page_title":"مگس‌گیر بهشتی بلایث","context_page_description":"مگس‌گیر بهشتی بلایث نام یک گونه از سرده مگس‌گیر بهشتی است."},{"page_url":"https://ru.wikipedia.org/wiki/Mercedes-Benz_B-%D0%BA%D0%BB%D0%B0%D1%81%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/2007_Mercedes-Benz_B_180_CDI_%28W_245_MY07%29_hatchback_%282010-06-17%29_01.jpg","page_title":"Mercedes-Benz B-класс","context_page_description":"Mercedes-Benz B-класс — серия компактных автомобилей немецкой торговой марки Mercedes-Benz, появившаяся в немецких салонах в марте 2005 года. Впервые была представлена в 2005 году на Женевском автосалоне, а предшествовал серийному автомобилю концепткар Vision B. Производится в Раштатте. Автомобиль несколько больше А-класса, при этом использует его подвеску и двигатели. Также как и А-класс, B-класс имеет передний привод, а начиная со второго поколения и систему постоянного полного привода 4MATIC. Европейский комитет по проведению независимых краш-тестов EuroNCAP относит серию к классу малых многоцелевых автомобилей.\\nПервое поколение серии с заводским индексом W245 было представлено в 2005 году и производилось вплоть до 2011 года, когда ему на смену пришло второе поколение в лице автомобилей с индексом W242/W246. Помимо бензиновых и дизельных силовых агрегатов автомобили оснащаются гибридными, газовыми и электрическими двигателями. В настоящее время серийной высокопроизводительной модификации от подразделения Mercedes-AMG не представлено ни для одного поколения B-класса.\\nПо состоянию на 20 декабря 2013 года продажи автомобилей B-класса достигли отметки в 1 миллион единиц."},{"page_url":"https://en.wikipedia.org/wiki/Ganmodoki","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Ganmodoki_1_by_kina3.jpg","page_title":"Ganmodoki","context_page_description":"Ganmodoki is a fried tofu fritter made with vegetables, such as carrots, lotus roots and burdock. It may also contain egg. Ganmodoki means pseudo-goose. This is because ganmodoki is said to taste like goose; compare mock turtle soup. Ganmodoki is also called ganmo for short.\\nIn the Edo period, ganmodoki was a stir-fried konjac dish. A dish similar to the ganmodoki today was made by wrapping chopped up vegetables in tofu and deep frying it.\\nIn Western Japan, Ganmodoki is called hiryōzu, hiryuzu or hirōsu, from the Portuguese word filhós or Spanish fillos."},{"page_url":"https://en.wikipedia.org/wiki/Korean_sword","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/SillaSwordHilt.jpg","page_title":"Korean sword","context_page_description":"Korean swords have served a central place in the defense of the nation for thousands of years. Although typical Korean land battles have taken place in wide valleys and narrow mountain passes, which favor use of the spear and bow, the sword found use as a secondary, close-quarters weapon, especially useful during sieges and ship-to-ship boarding actions. Higher quality, ceremonial swords were typically reserved for the officer corps as a symbol of authority with which to command the troops. Ceremonial swords are still granted to military officials by the civilian authority to this day.\\nKorean swords typically fall into two broad categories, the Geom, and the Do. The Geom is a double-edged weapon, while the Do is a single-edged weapon; although exceptions exist. In common parlance, all swords may be referred to as Geom.\\nThe history of the sword in Korea begins with imports during the Bronze Age in the mid 1st millennium BCE.\\nNative production of bronze and iron swords appeared in the mid 1st millennium CE. Korea eventually developed a unique sword industry and a native tradition of Korean swordsmanship, which reached its peak during the Joseon Dynasty\\n."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lavoirs_des_Hautes-Pyr%C3%A9n%C3%A9es","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Lavoir_de_Caixon_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Liste des lavoirs des Hautes-Pyrénées","context_page_description":"La liste des lavoirs des Hautes-Pyrénées présente les lavoirs situées dans le département français des Hautes-Pyrénées."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0_%D0%BF%D1%96%D0%BD%D0%B0%D0%BA%D0%BE%D1%82%D0%B5%D0%BA%D0%B0_%D0%91%D0%BE%D0%BB%D0%BE%D0%BD%D1%8C%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Pinacoteca_nazionale_di_bologna_01.JPG","page_title":"Національна пінакотека Болоньї","context_page_description":"Національна пінакотека Болоньї — староданій художній музей в університетському місті Болонья."},{"page_url":"https://fr.wikipedia.org/wiki/Goliath_(Six_Flags_Great_America)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Goliath_at_Six_Flags_Great_America_%2814697043357%29.jpg","page_title":"Goliath (Six Flags Great America)","context_page_description":"Goliath est un parcours de montagnes russes en bois situé à Six Flags Great America à Gurnee, dans l'Illinois. Il a été conçu par Rocky Mountain Construction et a été ouvert au public le 19 juin 2014. Lors de son ouverture, ce parcours établit trois records pour les montagnes russes en bois : la longueur de chute, l'inclinaison de la chute, et la vitesse atteinte."},{"page_url":"https://de.wikipedia.org/wiki/Competence_Center_ISOBUS","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/CCI200Terminal.jpg","page_title":"Competence Center ISOBUS","context_page_description":"Der Competence Center ISOBUS e. V. ist ein eingetragener Verein zur Förderung der technischen Weiterentwicklung, der beschleunigten Praxiseinführung sowie der internationalen Durchsetzung des ISOBUS, eines Datenübertragungssystems für die Landtechnik.\\nDer Sitz des 2009 gegründeten Vereins befindet sich im Innovationscentrum Osnabrück in der niedersächsischen Stadt Osnabrück in Deutschland. Das CCI hat 21 Landtechnikunternehmen aus Deutschland, Frankreich, Italien, Japan, den Niederlanden, Österreich und der Tschechischen Republik als Mitglieder und finanziert sich über seine Einnahmen für Dienstleistungen, Mitgliedsbeiträge und öffentliche Zuschüsse."},{"page_url":"https://ms.wikipedia.org/wiki/Bendera_Namibia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Flag_of_Namibia.svg","page_title":"Bendera Namibia","context_page_description":"Bendera Namibia disetujui pada 21 Mac 1990.\\nWarna utama diambil dari bendera SWAPO, pergerakan kebebasan penting. Bendera diambil tahun 1971 dan terdiri dari garis miring biru-merah-hijau, warna-warna penting Ovambo, penduduk etnik terbesar."},{"page_url":"https://lt.wikipedia.org/wiki/Dauk%C5%A1iai_(%C5%A0ven%C4%8Dionys)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Dauk%C5%A1iai_18102%2C_Lithuania_-_panoramio_%289%29.jpg","page_title":"Daukšiai (Švenčionys)","context_page_description":"Daukšiai – kaimas Švenčionių rajono savivaldybės šiaurinėje dalyje. Stūkso Daukšių piliakalnis."},{"page_url":"https://fi.wikipedia.org/wiki/Jack_Straus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/JackStraus.jpg","page_title":"Jack Straus","context_page_description":"Jack Straus oli yhdysvaltalainen pokeriammattilainen, joka voitti World Series of Pokerin pääturnauksen vuonna 1982.\\nStrausin lempinimi \\"Treetop\\" tuli hänen pituudestaan. Hän opiskeli Texas A&M Universityssa.\\nStraus alkoi pelaamisen WSOP-turnauksissa 1970-luvun alussa. Hän sijoittui neljänneksi vuoden 1972 pääturnauksessa ja voitti ensimmäisen rannekkeensa seuraavana vuonna 3 000 dollarin Deuce to Seven Draw -turnauksessa. Toinen ranneke ja 520 000 dollarin ykköspalkinto tuli vuoden 1982 pääturnaksen voitosta. Straus oli pääturnauksen finaalipöydässä myös vuonna 1973.\\nStrausin comeback vuoden 1982 turnauksessa on luultavasti synnyttänyt pokerisanonnan \\"a chip and a chair\\". Tarina on vaihdellut vuosien varrella, mutta yleisimmän version mukaan Straus pani kaikki pelimerkkinsä pottiin, sai maksun ja hävisi käden. Oltuaan nousemassa pois pöydästä hän löysi yhden 500 dollarin pelimerkin, joka oli vahingossa jäänyt pöydälle nenäliinan alle. Koska hän ei ollut sanonut menneensä \\"all-in\\", turnauksen järjestäjät antoivat hänen jatkaa pelaamista turnauksessa."},{"page_url":"https://fr.wikipedia.org/wiki/Manny_Diaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/20080507_Manny_Diaz.jpg","page_title":"Manny Diaz","context_page_description":"Manuel « Manny » Alberto Diaz, né le 5 novembre 1954 à La Havane, est un homme politique américain, maire indépendant de Miami de 2001 à 2009."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4%D0%B0_%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Official_Portrait_of_President_Reagan_1981.jpg","page_title":"Президентство Рональда Рейгана","context_page_description":"Президентство Рональда Рейгана розпочалося опівдні EST 20 січня 1981 року, коли Рональд Рейган був приведений до присяги в якості 40-го президента Сполучених Штатів, і закінчилося 20 січня 1989 року. Рейган, республіканець з Каліфорнії, вступив в посаду після переконливої перемоги над Демократичним чинним президентом Джиммі Картером на президентських виборах в 1980 році. Рейгана змінив його віце-президент Джордж Герберт Вокер Буш, який переміг на президентських виборах 1988 року за підтримки Рейгана. Вибори Рейгана 1980 року були наслідком різкого консервативного зсуву вправо в американській політиці, включаючи втрату довіри до ліберальних програм, програми Новий курс та Великого суспільства, які домінували в національній програмі з 1930-х років.\\nВнутрішньодержавна адміністрація Рейгана здійснила значне зниження податків, прагнула скоротити невійськові витрати та скасувала федеральні норми. Економічна політика адміністрації, відома як «Рейганоміка», була натхненна економікою пропозиції. Поєднання скорочень податків та збільшення витрат на оборону призвело до дефіциту бюджету, а федеральний борг значно збільшився під час перебування Рейгана."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Boitzenburger_Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Klosterruine_Boitzenburg_2.jpg","page_title":"Liste der Baudenkmale in Boitzenburger Land","context_page_description":"In der Liste der Baudenkmale in Boitzenburger Land sind alle Baudenkmale der brandenburgischen Gemeinde Boitzenburger Land und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019."},{"page_url":"https://hu.wikipedia.org/wiki/Mitol%C3%B3gia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Adonis_Mazarin_Louvre_MR239.jpg","page_title":"Mitológia","context_page_description":"A mitológia szó tulajdonképpen a mítoszok továbbmondását jelenti – olyan történetekét, amelyeket egy bizonyos kultúra igaznak hisz, és amelyekben természetfeletti események, személyek, lények szerepelnek. E történetek célja általában az, hogy magyarázatot adjanak az univerzum és az emberiség természetére, keletkezésére. A mitológia jelen van a legtöbb vallásban, és a legtöbb mitológia kapcsolódik legalább egy valláshoz. A történelem folyamán a különböző kultúrák természetes és erőszakmentes egymásra hatásának következtében különböző mitológiák összeolvadtak.\\nA modern szóhasználatban a „mitológia” jelentheti egy bizonyos kultúra vagy vallás mítoszainak összességét, vagy a mítoszok gyűjtésével, tanulmányozásával és értelmezésével foglalkozó tudományágat."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Sant_Mart%C3%AD_de_Proven%C3%A7als","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Estaci%C3%B3_Sant_Mart%C3%AD_de_Proven%C3%A7als_%28TRAM%29.jpg","page_title":"Estación de Sant Martí de Provençals","context_page_description":"Sant Martí de Provençals es una estación de la línea T5 del Trambesòs de Barcelona situada entre las paradas de Espronceda y Besòs. Está semisoterrada en el lateral de la Gran Vía de las Cortes Catalanas, entre su intersección con las calles Agricultura y Cantabria, en el distrito de San Martín."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9B%E3%83%AF%E3%82%A4%E3%83%88%E9%83%A1_(%E3%83%86%E3%83%8D%E3%82%B7%E3%83%BC%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Sparta-overlook-tn4.jpg","page_title":"ホワイト郡 (テネシー州)","context_page_description":"ホワイト郡は、アメリカ合衆国テネシー州の中央部に位置する郡である。2010年国勢調査での人口は25,841人であり、2000年の23,102人から11.9%増加した。郡庁所在地はスパータ市であり、同郡で人口最大の都市でもある。"},{"page_url":"https://hu.wikipedia.org/wiki/Pete_Sampras","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Pete_Sampras_%282008%29_1%2C_cropped.jpg","page_title":"Pete Sampras","context_page_description":"Peter \\"Pete\\" Sampras amerikai teniszező, korábbi világelső, összesen 286 hétig vezette az ATP hivatalos világranglistáját. Hat egymást követő évet is világelsőként zárt.\\nTizenöt éves karrierje során összesen 14 Grand Slam-címet szerzett, ezzel – Roger Federer, Rafael Nadal és Novak Đoković után – negyedik az örökranglistán a férfiak között. 14 győzelmének a felét Wimbledonban aratta: 2012-ig ő nyerte meg legtöbbször Wimbledont a tenisztörténelem során, de hetedik győzelmével Roger Federer a 2012-es tornán utolérte, míg a 2017-es győzelme után immáron Federer tartja a rekordot. A US Openen ötször nyert – ez open-era rekord, amit Jimmy Connorsszal és szintén Roger Federerrel tart. Maradék két címét az Ausztrál Openen szerezte, Roland Garrost nem sikerült nyernie: a salakos Grand Slamen a legjobb eredménye 1996-ban az elődöntő volt. Grand Slam-tornákon a meccsrekordja 203-38 lett.\\nPete Sampras minden idők egyik legjobb teniszezője, Bud Collins amerikai újságíró és sportközvetítő minden idők öt legjobb teniszezője közé sorolta és a Tennis Magazine az 1965 és 2005 közötti időszak legjobb teniszezőjének nevezte."},{"page_url":"https://la.wikipedia.org/wiki/Ioannes_Bayerus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Uranometria_titlepage.jpg","page_title":"Ioannes Bayerus","context_page_description":"Ioannes Bayerus, vulgo Johann Bayer, fuit astronomus et cartographus caelestis. Philosophiae studuit apud universitatem Ingolstadiensem; postea iurisconsultus Augustae Vindelicorum exsistere meruit. Hodie autem notus est atlante stellari titulo Uranometria, quem anno 1603 divulgavit. Ibi novam astrorum designationem primus excogitavit, nobis nomine \\"littera\\" seu \\"character Bayeri\\" cognitam. In tabulis enim catalogisque huius atlantis, quaeque stella littera Graeca secundum constellationes indicatur. Enumerationem stellarum characteribus Bayeri agnitarum hic habes.\\nCrater lunaris Bayer ex eo appellatus est. In oppido Raina et via et schola nomen de eo traxerunt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Johannstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Gerokstr22_dresden_bsz_technik1.jpg","page_title":"Liste der Kulturdenkmale in der Johannstadt","context_page_description":"Die Liste der Kulturdenkmale in der Johannstadt enthält die Kulturdenkmale des Stadtteils Johannstadt in der Dresdner Gemarkung Altstadt II.\\nDiese Gemarkung gliedert sich in die Stadtteile Johannstadt, Seevorstadt, Südvorstadt, Äußere Wilsdruffer Vorstadt und Großer Garten.\\nDiese Liste enthält die Kulturdenkmale des Stadtteils Johannstadt unterteilt in die statistischen Bereiche Johannstadt-Nord und Johannstadt-Süd. Außerdem werden hier die Kulturdenkmale von „Johannstadt-Südost“ aufgenommen, da dieser Stadtteil zwar dem Stadtbezirk Blasewitz zugeordnet ist, aber zur Gemarkung Altstadt II gehört.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://it.wikipedia.org/wiki/Ferrari_F2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ferrari_F1_car_2011-2012.jpg","page_title":"Ferrari F2012","context_page_description":"La Ferrari F2012 è la cinquantottesima monoposto costruita dalla casa automobilistica Ferrari per partecipare al campionato mondiale di Formula 1 2012.\\nPresentata il 3 febbraio 2012 tramite il sito web ufficiale della scuderia, la F2012 sostituisce la 150º Italia, la quale aveva disputato la stagione 2011. Il progetto non si pone come un'evoluzione del modello precedente ma è stato realizzato partendo da zero, e presenta diversi elementi innovativi che hanno reso particolarmente ardua la fase di progettazione nonché il superamento dei crash test laterali.\\nLa vettura è affidata a Fernando Alonso e Felipe Massa; i collaudatori sono Giancarlo Fisichella, Marc Gené e Davide Rigon, sebbene a quest'ultimo spetti ufficialmente soltanto lo sviluppo del simulatore. Con la F2012, la Scuderia Ferrari si è classificata al secondo posto nel campionato costruttori con 400 punti, alle spalle della vincitrice Red Bull; per quanto riguarda il campionato piloti, Alonso si è anche lui piazzato secondo nella graduatoria con 278 punti, dietro al campione del mondo Sebastian Vettel, mentre l'altro ferrarista Massa ha chiuso la stagione in settima posizione."},{"page_url":"https://es.wikipedia.org/wiki/Being_John_Malkovich","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/JohnMalkovich2005Locarno.jpg","page_title":"Being John Malkovich","context_page_description":"Being John Malkovich es una película estadounidense de cine independiente realizada en 1999 por el director Spike Jonze, en su debut cinematográfico, sobre un guion original escrito por Charlie Kaufman, quien también ofició su debut como libretista. Protagonizada por Cameron Diaz, John Cusack, Catherine Keener y John Malkovich, la película fue destacada por su particular argumento manejado con originalidad, siendo reconocida especialmente por la labor de Kaufman como autor. Being John Malkovich ganó numerosos premios de la crítica, y obtuvo tres nominaciones a los Premios Óscar."},{"page_url":"https://pt.wikipedia.org/wiki/F%C3%A1brica_de_Cer%C3%A2mica_da_Vi%C3%BAva_Lamego","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Vi%C3%BAva_Lamego_%28Largo_do_Intendente%29_7151.jpg","page_title":"Fábrica de Cerâmica da Viúva Lamego","context_page_description":"A Fábrica de Cerâmica da Viúva Lamego cria desde 1849 peças únicas usando métodos artesanais que embelezam o mundo. Inicialmente a Viúva Lamego, cujas instalações fabris se localizavam no edifício onde hoje se situa a sua loja no Largo do Intendente em Lisboa, produzia artigos utilitários em barro vermelho e faiança e azulejos em barro branco.\\nNo início do século XX o azulejo foi ganhando importância e a produção em barro vermelho foi terminando.\\nNos anos trinta a Viúva Lamego iniciou uma colaboração estreita com artistas plásticos, que nas suas instalações, passaram cada vez mais a usar o azulejo para exprimirem as suas criações.\\nOs mestres da Viúva Lamego continuam a fabricar uma vasta gama de azulejos sempre em pintura manual, a elaborar trabalhos especiais a partir de criações de autores e desenvolver novos produtos que perpetuam a integração do azulejo na Arquitetura.\\nO edifício da Fábrica de Cerâmica da Viúva Lamego fica situado no largo do Intendente com a Avenida Almirante Reis, na antiga freguesia dos Anjos, actualmente freguesia de Arroios, em Lisboa.\\nA fábrica foi fundada por António da Costa Lamego em 1849."},{"page_url":"https://fr.wikipedia.org/wiki/Bresson_(Is%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bresson_abc4.jpg","page_title":"Bresson (Isère)","context_page_description":"Bresson est une commune française située dans le département de l'Isère en région Auvergne-Rhône-Alpes.\\nSes habitants sont appelés les Bressonnais."},{"page_url":"https://ca.wikipedia.org/wiki/Benicalap","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/F%C3%A0brica_de_La_Ceramo%2C_Benicalap.JPG","page_title":"Benicalap","context_page_description":"Benicalap és un districte de la ciutat de València, situat a l'extrem nord-oest de la ciutat. Número 16, és conformat per només dos barris: Benicalap i Ciutat Artista Faller. La fita entre els dos es troba a l'avinguda dels Salesians; els límits del districte són, al nord, la Ronda Nord de València i al sud, l'avinguda del Doctor Peset Aleixandre. Benicalap és molt més gran que Ciutat Artista Faller, i ocupa quasi tot el districte, fitant a l'oest amb l'avinguda de les Corts Valencianes i a l'est al camí de Montcada. El barri també fita amb Beniferri a l'avinguda del Camp de Túria.\\nLa seua superfície és de 171,9 hectàrees i té una població de 34.346 habitants segons el cens municipal de 2003. Va ser un municipi amb autonomia pròpia fins a 1872 quan es va annexionar a la ciutat de València i des de llavors forma part d'ella com un barri.\\nA Benicalap es troba un dels principals parcs de la ciutat, el Parc de Benicalap, i el Museu del Gremi d'Artistes Fallers. També és el lloc on s'ubicarà el nou estadi del València Club de Futbol."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%B7%E7%81%A3%E8%8A%B1%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Waterside_Plaza_Shopping_Mall.JPG","page_title":"海灣花園","context_page_description":"海湾花园是一个位于香港荃湾区南部的私人屋苑，毗邻海滨花园及环宇海湾，发展商为信和置业，共建有4幢住宅楼宇，合共提供800多个单位，屋苑大部分单位坐拥蓝巴勒海峡景观，于1991年建成并入伙。"},{"page_url":"https://nl.wikipedia.org/wiki/Harry_Otten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Wiersma_%28l%29_tegen_Otten_-_Nationaal_Archief_-_930-3479.jpg","page_title":"Harry Otten","context_page_description":"Harry Otten is een Nederlandse meteoroloog en weerman. Naast de meteorologie hebben ook zons- en maansverduisteringen al vroeg zijn interesse getrokken. Van huis uit is hij echter kernfysicus."},{"page_url":"https://sw.wikipedia.org/wiki/Benedictus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Benedictus_in_St._John_the_Baptist_in_the_Mountains_IMG_0817.JPG","page_title":"Benedictus","context_page_description":"Benedictus ni neno la Kilatini lenye maana ya \\"Asifiwe\\". Ni maarufu kama jina la wimbo wa Kiinjili unaotumika kila siku katika Masifu ya asubuhi ya madhehebu mbalimbali ya Ukristo.\\nJina hilo linatokana na kwamba ndilo neno la kwanza katika tafsiri ya Kilatini ya wimbo huo ambao, kadiri ya Lk 1:68-79, Zakaria aliutunga siku ya kumtahiri ya mtoto wake, Yohane Mbatizaji. Katika nafasi hiyo alifungua tena kinywa chake na kutoa unabii.\\nKabla ya hapo, kwa zaidi ya miezi tisa Zakaria alikuwa bubu na kiziwi kama adhabu ya kutosadiki mara maneno ya Malaika Gabrieli aliyetumwa na Mungu kumpasha habari ya kwamba sala zake na za mke wake Elisabeti zimekubalika, hivyo watazaa mtoto wa kiume, ingawa wote wawili ni wakongwe na Elisabeti ni tasa."},{"page_url":"https://it.wikipedia.org/wiki/PalaPirastu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/PalaRockefeller_2.jpg","page_title":"PalaPirastu","context_page_description":"Il palazzetto dello sport Fratelli Pirastu è il principale palazzetto dello sport di Cagliari ed è situato nel quartiere Montemixi.\\nHa una capienza ufficiale di 2.266 spettatori ma, non essendo numerati, e avendo solamente una tribuna dotata di seggiolini, può arrivare a contenere fino a 4.000 spettatori circa, come capitato spesso nei grandi eventi. Precedentemente era noto come PalaRockefeller dal nome della via in cui esso è sito. Il 30 giugno 2017 è stato intitolato a Luigi, Antonio, Emilio, Ignazio, Gianfranco, Carlo e Paolo Pirastu, fratelli devoti allo sport cittadino e in particolare alla pallacanestro: Luigi fu tra le altre cose il presidente della Brill Cagliari negli anni della Serie A."},{"page_url":"https://vi.wikipedia.org/wiki/Moon_Chae-won","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/%EC%A0%9C19%ED%9A%8C_%EB%B6%80%EC%B2%9C%EA%B5%AD%EC%A0%9C%ED%8C%90%ED%83%80%EC%8A%A4%ED%8B%B1%EC%98%81%ED%99%94%EC%A0%9C_%EB%A0%88%EB%93%9C%EC%B9%B4%ED%8E%AB_part.3_16.jpg","page_title":"Moon Chae-won","context_page_description":"Moon Chae-won, sinh ngày 13 tháng 11 năm 1986, là một nữ diễn viên người Hàn Quốc. Moon Chae-won lần đầu tiên thu hút sự chú ý vào năm 2008 trong vai phụ là một kĩ nữ trong Họa sĩ gió. Sau đó là Người thừa kế sáng giá, một trong những bộ phim truyền hình được đánh giá cao nhất năm 2009. Năm 2011 đánh dấu bước đột phá trong sự nghiệp của cô, với các vai chính trong truyền hình cổ trang Nam nhân của công chúa và bom tấn hành động Cung thủ siêu phàm, cả hai đều rất thành công. Với vai diễn trong Cung thủ siêu phàm, Moon Chae-won đã giành giải Nữ diễn viên mới xuất sắc nhất tại Grand Bell Awards và Blue Dragon Film Awards. Các bộ phim truyền hình đáng chú ý khác của Moon Chae-won bao gồm Chàng trai tốt bụng và Thiên thần áo trắng"},{"page_url":"https://nl.wikipedia.org/wiki/Storybook_Land_Canal_Boats","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/SBL_Windmill.jpg","page_title":"Storybook Land Canal Boats","context_page_description":"Storybook Land Canal Boats is een tow boat ride in de Disneyparken Disneyland Park in Anaheim en Disneyland Park in Parijs. De attractie is te vinden in het parkgedeelte Fantasyland."},{"page_url":"https://fr.wikipedia.org/wiki/Tourbet_El_Bey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Tourbet_cour_2.JPG","page_title":"Tourbet El Bey","context_page_description":"Le Tourbet El Bey est un mausolée tunisien situé au sud-ouest de la médina de Tunis.\\nDernière demeure des souverains de la dynastie des Husseinites — certains n'y figurent pas comme ses deux derniers représentants, Moncef Bey et Lamine Bey, inhumés respectivement dans le cimetière du Djellaz de Tunis et dans un cimetière de La Marsa —, le bâtiment construit sous le règne d'Ali II Bey constitue le plus vaste monument funéraire de Tunis. Il se trouve au numéro 62 de la rue Tourbet El Bey.\\nLa première tourba de Hussein Iᵉʳ Bey se trouve en face."},{"page_url":"https://de.wikipedia.org/wiki/Feldsteinkirche_Marsow","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Moses_marsow.jpg","page_title":"Feldsteinkirche Marsow","context_page_description":"Die Feldsteinkirche Marsow ist ein denkmalgeschütztes Kirchengebäude im Ortsteil Marsow der Gemeinde Vellahn im Landkreis Ludwigslust-Parchim in Mecklenburg-Vorpommern. Sie wurde im 14. Jahrhundert errichtet und gehört heute zum Kirchenkreis Mecklenburg der Evangelisch-Lutherischen Kirche in Norddeutschland."},{"page_url":"https://fr.wikipedia.org/wiki/UCI_World_Tour_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Crit%C3%A9rium_du_Dauphin%C3%A9_2014_-_Etape_6_-_Alberto_Contador.jpg","page_title":"UCI World Tour 2014","context_page_description":"L'UCI World Tour 2014 est la quatrième édition de l'UCI World Tour, le successeur du calendrier mondial et du ProTour. Les mêmes 29 épreuves des éditions 2012 et 2013 sont incluses dans cette compétition.\\nLes 18 équipes qui ont une licence ProTour ont le droit, mais aussi le devoir de participer à toutes les courses de ce calendrier."},{"page_url":"https://en.wikipedia.org/wiki/Norman_Aviation_J6_Karatoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Norman_Aviation_J6_Karatoo_C-FZTG_01.JPG","page_title":"Norman Aviation J6 Karatoo","context_page_description":"The Norman Aviation J6 Karatoo is a Canadian advanced ultralight aircraft, that was designed by Jessie Anglin and produced by Norman Aviation of Saint-Anselme, Quebec. The aircraft was supplied as a kit for amateur construction or as a complete ready-to-fly-aircraft.\\nProduction is complete and the J6 Karatoo is no longer available from Norman Aviation."},{"page_url":"https://vec.wikipedia.org/wiki/Atton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Eglise_Atton_M%26M.JPG","page_title":"Atton","context_page_description":"Atton el xé on comun de 832 abitanti del departemento de Meurthe-et-Moselle che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://cs.wikipedia.org/wiki/Kovalentn%C3%AD_vazba","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Ethylene_3D.png","page_title":"Kovalentní vazba","context_page_description":"Kovalentní vazba je vnitromolekulární forma chemické vazby, kterou lze charakterizovat sdílením jednoho nebo více párů elektronů mezi dvěma prvky. Atomy, účastnící se vazby, si tímto způsobem zaplňují valenční vrstvu elektronového obalu. Energie kovalentní vazby je větší, než energie intermolekulárních vodíkových vazeb. Tento druh vazby je typický pro atomy organických molekul a pro anorganické látky s krystalovou mřížkou složenou ze stejných atomů."},{"page_url":"https://nl.wikipedia.org/wiki/Hoofdstedelijk_gebouwencomplex_van_Chandigarh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Secretariat_Chandigarh.jpg","page_title":"Hoofdstedelijk gebouwencomplex van Chandigarh","context_page_description":"Het Hoofdstedelijk gebouwencomplex van Chandigarh is een geheel van gebouwen in de Indiase stad Chandigarh bestaande uit een parlementsgebouw voor Punjab en Haryana, een secretariaat en een hoog gerechtshof voor Punjab en Haryana, allen gelegen in een groene zone met een meer en monumenten. Het geheel werd ontworpen door de Frans-Zwitserse architect Le Corbusier."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B4%D0%B0,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Coda_UDI-ATA_1-3.jpg","page_title":"Кода, Андреа","context_page_description":"Андреа Кода — итальянский футболист, защитник клуба «Пескара»."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D1%88%D0%B8%D1%9B%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Ber%C5%A1i%C4%87i%2C_Apoteka%2C_M01.jpg","page_title":"Бершићи","context_page_description":"Бершићи су насеље у Србији у општини Горњи Милановац у Моравичком округу. Према попису из 2011. било је 266 становника.\\nКроз село пролази друм Горњи Милановац-Прањани, од кога се одвајају краци за Горње Бранетиће и Горње Бањане, и око друма и тих раскршћа, развила се варошица.\\nСеоска преслава је на друге Тројице; има више записа, и то су већином липе. До 1945. је одржаван вашар на Ивањдан. Овде се налазе Стари надгробни споменици у Бершићима, Крајпуташ у Бершићима и Крајпуташ на Галичу, село Бершићи."},{"page_url":"https://de.wikipedia.org/wiki/Eleanor-Kreuz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Lincoln_128a.jpg","page_title":"Eleanor-Kreuz","context_page_description":"Eleanor-Kreuz ist die Bezeichnung für eine Reihe von zwölf Gedenkkreuzen, die in England nach 1290 zwischen Lincoln und London aufgestellt wurden. Die Architektur der Kreuze war von erheblichem Einfluss auf die englische Gotik."},{"page_url":"https://hr.wikipedia.org/wiki/Maranello","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Maranello01.jpg","page_title":"Maranello","context_page_description":"Maranello je grad i općina u talijanskoj pokrajini Emilia-Romagna usred provincije Modena. Mjesto je uglavnom poznato kao dom Ferrarija i Scuderia Ferrari momčadi. Ferrari je u čast ovome gradu svojim dvama modelima dao ime Maranello, a to su: Ferrari 550 Maranello i Ferrari 575M Maranello."},{"page_url":"https://sl.wikipedia.org/wiki/Trdnjava_Bassein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Vasai_fort_building2.jpg","page_title":"Trdnjava Bassein","context_page_description":"Trdnjava Bassein ali Trdnjava Vasai je bila obsežna trdnjava v sedanji vasi Vasai, v regiji Palghar, na zahodni obali Indije v zvezni državi Maharaštra. Samo ime \\"Bassein\\" je angleška verzija portugalskega \\"Baçaim\\", kar je pravzaprav verzija domačega imena, ki ima zvezo z lokalnim plemenom Vasa Konkani, ki naseljuje območje med Mumbajem in južnim Gudžaratom. V maratskem jeziku se kraj imenuje Vasai. Vas in ostanki trdnjave ležijo severno od Mumbaja, nedaleč od železniške proge iz Mumbaja proti Barodi.\\nOriginalna oblike portugalskega imena je \\"Fortaleza de São Sebastião de Baçaim\\" ali Trdnjava Sv. Sebastjana v Vasai. Trdnjava Vasai oziroma ostanki so razglašeni za spomenik nacionalnega pomena s področja arheologije Indije."},{"page_url":"https://it.wikipedia.org/wiki/Argiopinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Argiope_bruennichi_%28white_background%29.png","page_title":"Argiopinae","context_page_description":"Argiopinae Simon, 1890 è una sottofamiglia di ragni appartenente alla famiglia Araneidae.\\nIl nome deriva dal greco ἀργός, argòs, cioè di un bianco brillante, lucente, e da ὄψ, òps, cioè vista, aspetto, per la colorazione vivace con cui si presenta e il suffisso -inae proprio di tutte le sottofamiglie."},{"page_url":"https://az.wikipedia.org/wiki/Qartopu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Children_throwing_snow_balls_1785.jpg","page_title":"Qartopu","context_page_description":"Qartopu - oyundur, bir-birinə qartopu ataraq hansında ki, adətən iki komanda iştirak edir. Oyun olur, bir qayda olaraq, qışda, o vaxt, haçan ki, qar yaxşı yapışır. Alovlu döyüşün oxşatmasını təşkil edir. İştirakçıların sayı üzrə dünya rekordu 10 fevral 2006-cı ildə Miçiqan texnologiya universitetində təyin edilmişdi, oyunda 3745 tələbə və uşaq iştirak edirdi."},{"page_url":"https://nl.wikipedia.org/wiki/Gaskachel","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Gasofen_Juno_3_fcm.jpg","page_title":"Gaskachel","context_page_description":"Een gaskachel of gashaard is een voor lokale verwarming gebruikte kachel die werkt op gas.\\nDe eerste gaskachels werkten op lichtgas. De gaskachels kwamen gedurende de laatste twee decennia van de 19e eeuw in zwang. Tal van fabrikanten kwamen rond die tijd met gaskachels op de markt, waaronder Siemens en diverse Britse bedrijven. De firma W.J. Stokvis uit Arnhem importeerde de door Fletcher & Co. geproduceerde kachels. De firma Knoop uit Arnhem was de enige Nederlandse fabrikant van dit krachtig en zindelijk verwarmingsmiddel. Gas werd overigens ook gebruikt om te koken: Vanaf de jaren '20 van de 20e eeuw werd het gasfornuis in toenemende mate populair en verdrong het kolenfornuis.\\nDe gaskachels waren echter veruit in de minderheid ten aanzien van de kolenkachels, welke op hun beurt door de oliekachels werden verdrongen. Wel werd er, vooral na de Tweede Wereldoorlog, veel gebruikgemaakt van kleinere verwarmingstoestellen op flessengas, bestaande uit vloeibaar gemaakt butaan of propaan, dat verkocht werd onder merknamen als Butagaz, Primagaz en dergelijke en dat afkomstig was van aardolieraffinaderijen."},{"page_url":"https://en.wikipedia.org/wiki/2000_National_Society_of_Film_Critics_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Benicio_Del_Toro_-_Guardians_of_the_Galaxy_premiere_-_July_2014_%28cropped%29.jpg","page_title":"2000 National Society of Film Critics Awards","context_page_description":"The 35th National Society of Film Critics Awards, given on 6 January 2001, honored the best in film for 2000."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B8%E0%B8%9B%E0%B8%81%E0%B8%A3%E0%B8%93%E0%B9%8C%E0%B8%81%E0%B8%A3%E0%B8%AD%E0%B8%87%E0%B8%AD%E0%B8%B2%E0%B8%81%E0%B8%B2%E0%B8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Air_filter%2C_opel_astra%281%29.JPG","page_title":"อุปกรณ์กรองอากาศ","context_page_description":"อุปกรณ์กรองอากาศ คืออุปกรณ์ที่ประกอบด้วยสิ่งที่เป็นไยที่แยกสารเช่นฝุ่น, ละอองเกษรดอกไม้, รา และ แบคทีเรีย จาก อากาศ ส่วนอุปกรณ์กรองอากาศเคมีจะประกอบด้วยตัวดูดซึม หรือ ตัวเร่งปฏิกิริยาที่ใช้ในการกำจัดสิ่งสกปรกที่ลอยตัวในอากาศเช่นสารอินทรีย์ไอระเหย หรือ โอโซน อุปกรณ์กรองอากาศใช้ในสถานที่ที่คุณภาพของอากาศเป็นสิ่งสำคัญโดยเฉพาะในระบบการระบายอากาศภาพในอาคารหรือภายในเครื่องยนต์"},{"page_url":"https://de.wikipedia.org/wiki/Johnny_Thomsen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Johnny_Thomsen_20120427.JPG","page_title":"Johnny Thomsen","context_page_description":"Johnny Thomsen ist ein dänischer Fußballspieler."},{"page_url":"https://cs.wikipedia.org/wiki/Josef_%C4%8Cern%C3%BD_(pedagog,_1863)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Josef_%C4%86ern%C3%BD.jpg","page_title":"Josef Černý (pedagog, 1863)","context_page_description":"Josef Černý byl český pedagog a politik, za Rakouska-Uherska na počátku 20. století poslanec Říšské rady."},{"page_url":"https://gl.wikipedia.org/wiki/Lista_de_fara%C3%B3ns","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Sekhemkhet.png","page_title":"Lista de faraóns","context_page_description":"O título faraón úsase para os gobernantes do antigo Exipto que gobernaron despois da unificación do Alto e Baixo Exipto por Narmer durante o Período tinita, aproximadamente no 3100 a.C. Non obstante, o título específico \\"faraón\\" non foi usado para dirixirse aos reis de Exipto polos seus contemporáneos ata o dominio de Merneptah na XIX dinastía, c. 1200 a.C. Xunto ao título de faraón para gobernantes posteriores, houbo un antigo título real exipcio usado polos reis exipcios que permaneceu relativamente constante durante a historia da antiga Exipcia, inicialmente o nome de Horus, o nome Abella e Xunco e o nome Dúas damas, co título adicional de Horus Dourado, nomen e prenomen engadíronse sucesivamente polas dinastías posteriores.\\nExipto estivo continuamente gobernado, polo menos en parte, por faraóns nativos durante aproximadamente 2500 anos, ata que foi conquistado polo Reino de Kush a finais do século VIII a.C, cuxos gobernantes adoptaron para se mesmos a tradicional titulación faraónica. Despois da conquista kushita, Exipto experimentou outro período de dominio autóctono antes de ser conquistado polo Imperio Aqueménida, cuxos gobernantes tamén adoptaron o título de \\"faraón\\"."},{"page_url":"https://io.wikipedia.org/wiki/Historio_di_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eug%C3%A8ne_Delacroix_-_La_libert%C3%A9_guidant_le_peuple.jpg","page_title":"Historio di Francia","context_page_description":"Francia esas un ek la maxim anciena stati di Europa, quankam nur aparis kun ta nomo pos la Mezepoko.\\nLa vorto \\"Francia\\" devenas de Germana tribuo, la Franki, atestita de la 3ma yarcento sur l'advale dextra rivo dil Rheno. Lua rejo Klodovig e pose lua filii konquestis, inter 481 e 535, preske tot anciena Romana provinco di Gaula - to equivalas a la majoritato dil teritorio di nuna Francia. La vorto \\"Francia\\" ne uzeis oficale til 1190, kande la rejulo Philippe Auguste komencis uzar la nomo rex Franciæ vice rex Francorum por designar lia suvereneso. La vorto anke uzesis kustumale por nomar un teritorio klare definita quale en la poemo Chanson de Roland, skribita un yarcento ante. Pos junio 1205 la teritorio nomesis en mapi regnum Franciæ."},{"page_url":"https://ceb.wikipedia.org/wiki/Chengguan_Qu_(gatos_sa_Pangmasang_Republika_sa_T%C5%9Bina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Location_of_Lanzhou_City_Districts_within_Gansu_%28China%29.png","page_title":"Chengguan Qu (gatos sa Pangmasang Republika sa Tśina)","context_page_description":"Gatos ang Chengguan Qu sa Pangmasang Republika sa Tśina. Nahimutang ni sa prepektura sa Lanzhou Shi ug lalawigan sa Gansu Sheng, sa sentro nga bahin sa nasod, 1,200 km sa kasadpan sa Beijing ang ulohan sa nasod. Adunay 1,278,745 ka molupyo. Ang populasyon sa naglangkob sa 630,250 ka babae ug 648,495 ka lalaki. Mga anak ubos sa edad nga 15 mao ang 11.0%, ang mga hamtong nga nag-edad 15-64 79%, ug mga tigulang labaw sa 65 8.0%. Naglangkob kin og 220 ka kilometro kwadrado.\\nAng yuta sa Chengguan Qu kay kabungtoran.\\nChengguan Qu may sa mosunod nga mga subdibisyon:\\n酒泉路街道\\n张掖路街道\\n雁南街道\\n临夏路街道\\n雁北街道\\n五泉街道\\n白银路街道\\n皋兰路街道\\n广武门街道\\n伏龙坪街道\\n靖远路街道\\n草场街街道\\n火车站街道\\n拱星墩街道\\n东岗街道\\n团结新村街道\\n东岗西路街道\\n铁路东村街道\\n铁路西村街道\\n渭源路街道\\n盐场路街道\\n嘉峪关路街道\\n焦家湾街道\\n青白石街道\\n高新区\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Hulyo, sa 27 °C, ug ang kinabugnawan Enero, sa -5 °C. Ang kasarangang pag-ulan 506 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 122 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 2 milimetro."},{"page_url":"https://hu.wikipedia.org/wiki/Lassen_megye","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Seal_of_Lassen_County%2C_California.png","page_title":"Lassen megye","context_page_description":"Lassen megye az Amerikai Egyesült Államokban, azon belül Kalifornia államban található. Lakosainak száma 32 163 fő. +/- Lassen megye Modoc, Plumas, Shasta és Washoe megyékkel határos."},{"page_url":"https://fi.wikipedia.org/wiki/Apinanleip%C3%A4puu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Baobob_tree.jpg","page_title":"Apinanleipäpuu","context_page_description":"Apinanleipäpuu, jota kutsutaan myös nimillä baobab ja baobabpuu, on Australiassa ja alkuperäisenä Afrikassa kasvava puulaji.\\nApinanleipäpuut ovat 5–25 metriä korkeita, mutta hyvin paksuja: rungon läpimitta voi olla jopa 7 metriä. Se haarautuu oksistossa tiheästi. Ohuimmat oksat voivat olla läpimitaltaan vain 1. millimetrin. Apinanleipäpuu varastoi vettä, ja sen tilavuudesta 70–80% täytyy olla vettä, jotta se pysyisi pystyssä. Ne voivat myös kuolla, jos kukinta-aikaan on liian kuivaa. Apinanleipäpuussa ei ole kasvurenkaita, joista ikää voitaisiin määrittää, ja siksi ikää mitataankin radiohiiliajoituksella. Vanhimpien yksilöiden iäksi on tällä menetelmällä arvioitu noin 2 500 vuotta. Puuta viljellään muun muassa Australiassa ja Etelä-Afrikassa. Etelä-Afrikassa kasvaa puu, jonka rungon ympärysmitta on jopa 45 metriä ja jonka iäksi on arvioitu 6 000 vuotta.\\nPuun hedelmät ovat syötäviä. Ne sisältävät monia ravintoaineita. Esimerkiksi C-vitamiinia niissä on kuusi kertaa niin paljon kuin appelsiinissa. Sadassa grammassa apinanleipäpuun hedelmiä on 300 milligrammaa kalsiumia ja 45 grammaa ravintokuituja."},{"page_url":"https://es.wikipedia.org/wiki/Clethra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Clethra_arborea1.jpg","page_title":"Clethra","context_page_description":"Clethra es un género de entre 30 a 70 especies de arbustos o pequeños árboles. Es uno de los dos géneros de la familia de las Clethraceae. Las especies pueden ser siempreverdes o deciduos, y las flores en clústeres o inflorescencias.\\nSe distribuyen en climas templados a tropicales en el sudeste asiático, Malasia, América Central, norte de Sudamérica, sudeste de EE. UU., y la especie en la isla de Madeira."},{"page_url":"https://ms.wikipedia.org/wiki/Miss_International","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Miss_International_Sash.jpg","page_title":"Miss International","context_page_description":"Miss International ialah pertandingan kecantikan antarabangsa yang berpangkalan di Jepun yang dianjurkan oleh Persatuan Kebudayaan Antarabangsa. Pertandingan itu pertama kali diadakan pada tahun 1960. Miss International ialah pertandingan terbesar keempat di dunia dari segi pemenang kebangsaan untuk menyertai pertandingan antarabangsa.\\nBersama-sama dengan Miss World, Miss Universe, dan Miss Earth, pertandingan ini ialah salah satu pertandingan kecantikan antarabangsa Empat Besar. Pertandingan Miss International dan jenama kini dimiliki, bersama Miss International Japan, oleh ICA dan Miss Paris Group. Mahkota pertandingan yang digunakan oleh organisasi ini dibekalkan dan dipatenkan oleh syarikat mutiara Mikimoto.\\nMiss International terkini ialah Sireethorn Leearamwat dari Thailand yang dinobatkan pada 12 November 2019 di Tokyo, Jepun."},{"page_url":"https://pl.wikipedia.org/wiki/Ptaki_stymfalijskie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Herakles_Stymphalian_BM_B163.jpg","page_title":"Ptaki stymfalijskie","context_page_description":"Ptaki stymfalijskie, stymfalidy – w mitologii greckiej poświęcone Aresowi ptaki o dziobach, szponach i skrzydłach z żelaza, które zasiedliły okolice bagien nad jeziorem Stymfalos w peloponeskiej Arkadii. Żywiące się mięsem stwory zabijały ludzi i stada dziobami i wyrzucanymi jak strzały żelaznymi piórami, a ich odchody były trujące. Wskutek tego, ludna i bogata okolica zaczęła zamieniać się w pustkowie.\\nSzósta praca Heraklesa zlecona przez króla Myken Eurysteusza, polegała na wytrzebieniu stada tych morderczych ptaków. W tym celu Atena obdarzyła go wykonanymi przez Hefajstosa kołatkami ze spiżu, których dźwięk wypłoszył ptactwo, tak by heros mógł je powystrzelać z łuku. Według wersji odnotowanej przez Pauzaniasza w ślad za epicznym poetą Pizandrem z Kamiros, przyjęto, że Herakles nie pozabijał ptaków, tylko przepędził je dźwiękiem kołatek krotale. Resztki stymfalidów znalazły schronienie na Wyspie Aresa na Morzu Czarnym, skąd ostatecznie zostały przepędzone przez Argonautów w ich drodze do Kolchidy.\\nŚwiadectwem upamiętnienia tego mitu przez starożytnych są monety z podobiznami Heraklesa i ptaków bite w IV wieku p.n.e. przez peloponeskie miasto Stymfalia."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%84%E0%B8%94%E0%B8%8B%E0%B8%B9%E0%B9%80%E0%B8%81%E0%B8%B0_%E0%B8%8B%E0%B8%B2%E0%B9%82%E0%B8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Philippines_national_football_team_Daisuke_Sato_%28cropped%29.jpg","page_title":"ไดซูเกะ ซาโต","context_page_description":"ไดซูเกะ เคามันเดย์ ซาโต เป็นนักฟุตบอลชาวฟิลิปปินส์เชื้อสายญี่ปุ่น เล่นในตำแหน่งแบ็กซ้าย ปัจจุบันเขาได้ลงเล่นให้กับเมืองทอง ยูไนเต็ด และทีมชาติฟิลิปปินส์"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%B3%E5%92%8C%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Tokuwa_Station_2.jpg","page_title":"徳和駅","context_page_description":"徳和駅は、三重県松阪市下村町にある、東海旅客鉄道紀勢本線の駅である。\\n1942年までは、廃止された関西急行鉄道伊勢線との接続駅であった。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A1%BA%E6%B2%BB%E9%80%9A%E5%AE%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Shunzhi_Tongbao._Chinese._Yi_Li._Yun.jpg","page_title":"顺治通宝","context_page_description":"順治通寶，清政府在清世祖愛新覺羅·福臨在位期間鑄行的貨幣。1643年福臨繼位，1644年清軍入關，改元順治。1644年始在北京設局鑄「順冶通寶」錢，後隨天下統一，在各地分別設鑄錢局開鑄錢幣。順治通寶鑄行之初與明錢同時流通，後不久獨行清錢。該幣為黃銅鑄造，其中銅占七成，鋅占三成。順治通寶鑄行過程中的錢制形式曾發生多次改變，按照背文可分為五種，即所謂的「順治五式」。"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9A%D1%83%D0%BA%D0%BC%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%D0%9A%D1%83%D0%BA%D0%BC%D0%BE%D1%80%2C_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB.jpg","page_title":"Кукмор","context_page_description":"Кукмор — Российн Федерацин гӀала, ГӀезалойчоьнан Кукморан кӀоштан административан центр."},{"page_url":"https://en.wikipedia.org/wiki/Jyothika","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Jyothika_Filmfare_2014.jpg","page_title":"Jyothika","context_page_description":"Jyothika Saravanan is an Indian actress who predominantly appears in Tamil films. She also acted in some Telugu, Malayalam, Kannada and Hindi films. She won three Filmfare Awards, three Tamil Nadu State Film Awards, four Dinakaran Awards, International Tamil Film Awards and other awards and nominations. She is also a recipient of the Kalaimamani Award. She has been ranked among the best actresses of South India by The Times of India.\\nShe debuted in Bollywood in the Hindi film Doli Saja Ke Rakhna, directed by Priyadarshan. She starred in her first Tamil film Vaali and her first Telugu film Tagore, opposite Chiranjeevi. She received her first Filmfare Awards for Vaali as Filmfare Award for Best Female Debut – South. She was awarded the Filmfare Best Tamil Actress Award for Kushi A string of successful films followed and gained prominence for her performances in Kushi, Perazhagan, Chandramukhi and Mozhi.\\nJyothika left the industry at the peak of her career marrying Tamil actor Suriya on 11 September 2006, after being engaged in a relationship for several years, and with whom she was paired in seven films."},{"page_url":"https://es.wikipedia.org/wiki/Systra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Tramway_-_Bordeaux.JPG","page_title":"Systra","context_page_description":"SYSTRA es una empresa internacional de ingeniería y consultoría en el ámbito de la movilidad sostenible, particularmente en el transporte urbano y ferroviario. SYSTRA emplea a unas 5000 personas alrededor del mundo y está presente en 78 países en el mundo.\\nLa empresa es una Sociedad Anónima cuyos máximos accionistas son la RATP, la SNCF y un conjunto de bancos franceses.\\nSYSTRA se sitúa en la posición nº2 de la clasificación anual que emite la revista americana \\"Engineering News-Record\\", la cual registra las 250 empresas de ingeniería más importantes del mundo.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%AD%D9%84%D9%82%D8%A7%D8%AA_%D8%A8%D9%88%D8%B1%D9%88%D8%AA%D9%88:_%D8%A7%D9%84%D8%A3%D8%AC%D9%8A%D8%A7%D9%84_%D8%A7%D9%84%D9%82%D8%A7%D8%AF%D9%85%D8%A9_%D9%85%D9%86_%D9%86%D8%A7%D8%B1%D9%88%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Boruto_logo.png","page_title":"قائمة حلقات بوروتو: الأجيال القادمة من ناروتو","context_page_description":"بوروتو: الأجيال القادمة من ناروتو هو مسلسل أنمي يحكي قصة مانغا بوروتو التي تصدر أسبوعيًا من مجلة شونن جمب الأسبوعية، وألفها ورسمها أوكيو كوداتشي ورسمها ميكيو إيكيموتو تحت إشراف ماساشي كيشيموتو. أخرج المسلسل نوريوكي أبيه وأنتجه ستوديو بييرو وتلفزيون طوكيو.تاريخ أول عرض 5 أبريل 2017"},{"page_url":"https://en.wikipedia.org/wiki/Ebell_Society","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Ebell_Society_of_Santa_Ana_Valley.jpg","page_title":"Ebell Society","context_page_description":"The Ebell Society was a woman's club with its first chapter in Oakland, California. It was founded in 1876 and was originally called the International Academy for the Advancement of Women. The club's purpose was the advancement of women in cultural, industrial and intellectual pursuits.\\nAfter feminist Adrian John Ebell's early death in 1877 at age 37 the International Academy for the Advancement of Women renamed their club to honor him. Other chapters formed in California.\\nFrom 1907 to 1959 the Oakland chapter had a club house built in the Tudor Revival style located at 1440 Harrison Street. That building was destroyed by fire in 1959.\\nThe original Oakland chapter disbanded in 2011."},{"page_url":"https://de.wikipedia.org/wiki/Burkheim_am_Kaiserstuhl","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Luftbild_Burkheim.jpg","page_title":"Burkheim am Kaiserstuhl","context_page_description":"Burkheim am Kaiserstuhl ist eine Teilgemeinde der Stadt Vogtsburg im Kaiserstuhl und liegt am Westrand des Kaiserstuhls. Bekannt ist Burkheim vor allem für seine historische Altstadt und seinen Wein. Bis zur Gemeindereform am 1. Januar 1975 hatte Burkheim ein eigenes Stadtrecht. Dieses wurde an die neue Gemeinde Vogtsburg übertragen."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-%C3%89tienne-de-Lugdar%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Hubacs.JPG","page_title":"Saint-Étienne-de-Lugdarès","context_page_description":"Saint-Étienne-de-Lugdarès är en kommun i departementet Ardèche i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen ligger i kantonen Saint-Étienne-de-Lugdarès som ligger i arrondissementet Largentière. År 2009 hade Saint-Étienne-de-Lugdarès 468 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Jiba_(Tenrikyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Tenrikyo_Kanrodai_sketch.jpg","page_title":"Jiba (Tenrikyo)","context_page_description":"In the Tenrikyo religion, the Jiba is the axis mundi where adherents believe that God created humankind. The spot is located in the center of the main sanctuary at Tenrikyo Church Headquarters, located in Tenri, Nara, Japan. It is marked by a wooden pillar called the Kanrodai."},{"page_url":"https://ast.wikipedia.org/wiki/Binaria_eclipsante","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Eclipsing_binary_star_animation_2.gif","page_title":"Binaria eclipsante","context_page_description":"Entender por Binaria eclipsante un sistema formáu por dos estrelles que'l so planu orbital ta empobináu escontra la Tierra, de tal manera, que dende la nuesa perspeutiva, sufren eclises y tránsitos mutuos. El eclís o tránsitu pue ser total o parcial. A diferencia d'otros conxuntos binarios, les binaries eclipsantes nun dexen estremar les sos estrelles unes d'otres. Sicasí, gracies a los cambeos de lluminosidá periódicu nestos sistemes, puede deducise cuando una estrella oculta a la otra. Polo xeneral, un sistema binariu eclipsante suel tar constituyíu por estrelles de gran tamañu n'órbites bien amenorgaes y a la llarga pueden terminar nuna fusión mutua."},{"page_url":"https://pl.wikipedia.org/wiki/Formacja_czterech_palc%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Four_Finger_Formation.png","page_title":"Formacja czterech palców","context_page_description":"Formacja czterech palców - - formacja lotnicza wykorzystywana przez samoloty myśliwskie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BD%D0%B8%D0%B3%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Skniga_river_under_Road_bridge_near_embouchure.jpg","page_title":"Скнига","context_page_description":"Скни́га — река, правый приток Оки, протекающий по северному макросклону Среднерусской возвышенности на территории Тульской области и Серпуховского района Московской области. Длина — 52 км. Площадь водосборного бассейна — 375 км².\\nРавнинного типа. Питание преимущественно снеговое."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre-%C3%A8s-Liens_de_Cond%C3%A9court","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Cond%C3%A9court_%2895%29%2C_%C3%A9glise_Saint-Pierre-%C3%A8s-Liens%2C_chapelle_de_la_Vierge%2C_corniche.JPG","page_title":"Église Saint-Pierre-ès-Liens de Condécourt","context_page_description":"L'église Saint-Pierre-ès-Liens, ou Saint-Pierre-aux-Liens, est une église catholique paroissiale située à Condécourt, dans le département français du Val-d'Oise. Elle remonte, dans ses parties les plus anciennes, à la fin du XIᵉ siècle : il s'agit de la base du clocher avec ses arcades en plein cintre retombant sur des impostes décorés de dents-de-scie, et sa voûte d'arêtes. Cette travée n'est pas visible depuis l'extérieur, car englobée dans des constructions plus récentes. Le premier étage du clocher octogonal est lui aussi d'un style roman archaïque, et ne devrait pas être antérieur au tout début du XIIᵉ siècle. Le second étage, plus simple, a été ajouté à la période gothique. Globalement, l'église Saint-Pierre-ès-Liens est d'une architecture assez simple, avec un seul niveau d'élévation, et se caractérise par la juxtaposition de quatre espaces carrés issues de quatre campagnes de construction distinctes, à savoir la nef rustique du XVIIIᵉ siècle ; la base du clocher déjà signalée ; le chœur gothique du second quart du XIIIᵉ siècle ; et la travée droite de la chapelle de la Vierge, au nord du clocher."},{"page_url":"https://io.wikipedia.org/wiki/Val%C3%A9ry_Giscard_d%27Estaing","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Val%C3%A9ry_Giscard_d%E2%80%99Estaing_1978.jpg","page_title":"Valéry Giscard d'Estaing","context_page_description":"Valéry Marie René Georges Giscard d'Estaing civila servanto e politikisto, esis prezidanto di Francia de 1974 til 1981."},{"page_url":"https://fr.wikipedia.org/wiki/Vip%C3%A8re_d%27Orsini","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Vipera_ursinii_distribution_%28including_V._u._anatolica%29.png","page_title":"Vipère d'Orsini","context_page_description":"La Vipère d'Orsini, Vipera ursinii, est une espèce de serpents de la famille des Viperidae. D'une taille n'excédant généralement pas 50 cm à l'âge adulte, il s'agit de la plus petite vipère d'Europe.\\nOn la rencontre en Europe, au Moyen-Orient ainsi qu'en Asie centrale, jusqu'à la Chine. Son aire de répartition est néanmoins très fragmentée. Elle peut fréquenter différents milieux allant des prairies sèches de montagne aux zones humides de plaine. Elle se nourrit principalement d'insectes, mais également de petits vertébrés.\\nL'espèce compte cinq à six sous-espèces selon les auteurs. Elle appartient à un complexe taxonomique vieux d'environ 10 millions d'années. La systématique de l'espèce est néanmoins encore sujet à débat, trop peu d'études génétiques ayant été réalisées à ce jour.\\nBien que venimeuse, cette espèce n'est pas dangereuse pour l'Homme, son venin étant essentiellement insectotoxique. En raison de la disparition progressive de son habitat en Europe, l'espèce est en nette régression et est considérée comme vulnérable par l'Union internationale pour la conservation de la nature."},{"page_url":"https://cy.wikipedia.org/wiki/Jersey_Shore,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Jersey_Shore_old_houses.JPG","page_title":"Jersey Shore, Pennsylvania","context_page_description":"Bwrdeisdref yn Lycoming County, yn nhalaith Pennsylvania, Unol Daleithiau America yw Jersey Shore, Pennsylvania. ac fe'i sefydlwyd ym 1800."},{"page_url":"https://de.wikipedia.org/wiki/Caecius_Severus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cabinet_des_M%C3%A9dailes%2C_Paris_-_Military_diploma_of_Sex._Memmius_Clearchi.jpg","page_title":"Caecius Severus","context_page_description":"Caecius Severus war ein im 2. Jahrhundert n. Chr. lebender Angehöriger des römischen Ritterstandes.\\nDurch zwei Militärdiplome, die auf den 13. Februar 139 und den 26. November 140 datiert sind, ist belegt, dass Severus von 139 bis 140 Präfekt der in Misenum stationierten römischen Flotte war."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%BA%D8%B0%D9%8A%D8%A9_%D9%85%D8%A7_%D9%82%D8%A8%D9%84_%D8%A7%D9%84%D9%88%D9%84%D8%A7%D8%AF%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ultrasound_image_of_a_fetus.jpg","page_title":"تغذية ما قبل الولادة","context_page_description":"التغذية وإدارة الوزن قبل وأثناء الحمل له تأثير عميق على تطور الرضع. فهذا وقت حرج يحدد نمو الجنين بشكل سليم، حيث يعتمد الأطفال الرضع بشكل كبير على ما تخزنه الأم وعلى المواد الغذائية لنمو أمثل وصحة أفضل في وقت لاحق في الحياة. وتتناول التغذية قبل الولادة ‏ التوصيات الغذائية قبل وأثناء الحمل. التغذية قبل الولادة لها تأثير قوي على وزن الولادة والتطور المستقبلي للرضيع. وجدت دراسة في معهد الوطني للصحة أن الأطفال الذين يولدون من أم بدينة لديهم احتمال أكبر للفشل في اختبارات المهارات الحركية الدقيقة وهي حركة العضلات الصغيرة مثل اليدين والأصابع.\\nوهناك مقولة شائعة مفادها أن \\"المرأة تأكل لشخصين أثناء الحمل\\" تعني أن الأم يجب أن تستهلك ضعف الكمية أثناء الحمل. ومع ذلك، فإنّ هذا ليس صحيحاً في الواقع. على الرغم من أن استهلاك الأمهات سيؤثر بشكل مباشر على نفسها وعلى الجنين الذي ينمو، إلا أن الإفراط في تناول الطعام سيؤثر سلبًا على صحة الطفل، حيث سيكون على الطفل أن يعمل بجد أكثر ليصبح صحياً في المستقبل. وبالمقارنة مع الرضيع، فإن الأم تمتلك أقل المخاطر البيولوجية. لذلك، غالباً ما يتم تخزين السعرات الحرارية الزائدة كدهون في الأم، بدلاً من أن تذهب إلى الرضيع. من ناحيةٍ أخرى، سيؤدي الاستهلاك غير الكافي إلى انخفاض وزن الولادة."},{"page_url":"https://pt.wikipedia.org/wiki/Classe_Braunschweig","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/F261_Magdeburg.jpg","page_title":"Classe Braunschweig","context_page_description":"A Classe Braunschweig é uma classe de novas corvetas da Marinha da Alemanha construídas em 2004. Substituiu a Classe Gepard, que estava em operação desde 1982."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D1%8C%D0%BA%D0%B8%D0%BD%D0%B4,_%D0%9B%D0%B5%D0%B2_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Lev_Davidovich_Belkind.JPG","page_title":"Белькинд, Лев Давидович","context_page_description":"Лев Давидович Белькинд — советский учёный, инженер и историк, один из основоположников отечественной светотехники, популяризатор науки и техники, автор многочисленных публикаций о истории науки и техники. Профессор, доктор технических наук.\\nАкадемическая деятельность профессора связана с МЭИ, в котором в 1932 году он основал кафедру светотехники в Физико-энергетическиом факультете. В 1937 м, он стал первым деканом Электро-Физического факультета.\\nВпоследствии, Проф. Белькинд возглавлял кафедру истории техники, а также сотрудничал с Институтом Истории Естествознания и Техники АН СССР, с момента его основания в 1953-м году.\\nПолиглот, свободно изъяснявшийся на русском, английском, французском, немецком и других европейских языках, профессор Белькинд занимался исследованиями в области истории науки и техники, как отечественной, так и зарубежной. Признанный авторитет в области истории российской науки, является автором уникальных работ, исследующих жизнь и достижения российских учёных, подчеркивающих их вклад в мировой технологический прогресс.\\nЗа свои многочисленные заслуги, проф. Белькинд был удостоен звания Заслуженного деятеля науки и техники."},{"page_url":"https://fr.wikipedia.org/wiki/Minamoto_no_Mitsunaka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%E6%BA%90%E6%BA%80%E4%BB%B2.jpg","page_title":"Minamoto no Mitsunaka","context_page_description":"Minamoto no Mitsunaka, fils de Minamoto no Tsunemoto, est un samouraï et fonctionnaire de cour de l'époque de Heian de l'histoire du Japon. Mitsunaka appartient à la branche Seiwa-Genji du clan Minamoto qui fait remonter son origine à l'empereur Seiwa. Il sert loyalement plusieurs régents Fujiwara successifs à commencer par Fujiwara no Morotada.\\nMitsunaka s'allie avec ce dernier en 969, impliquant Minamoto no de Takaakira — principal rival politique de Morotada — dans un complot contre le trône. Il n'est pas clair si ces accusations sont vraies mais Takaakira est envoyé en exil, plaçant Mitsunaka fermement dans les bonnes grâces de Morotada. Plus tard, Mitsunaka aide Fujiwara no Kaneie dans son complot visant à contraindre l'empereur Kazan à prendre ses vœux bouddhistes et à abdiquer en faveur du petit-fils de Fujiwara âgé de sept ans.\\nL'association de Mitsunaka avec le clan Fujiwara fait de lui l'un des courtisans les plus riches et les plus puissants de son époque. Il est le gouverneur par intérim de dix provinces du Japon, notamment elle de Settsu, qui devient le pilier de sa puissance militaire et économique."},{"page_url":"https://en.wikipedia.org/wiki/Trams_in_Wroc%C5%82aw","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/205WrAs_Wroclaw_2701.jpg","page_title":"Trams in Wrocław","context_page_description":"The Wrocław tram system is the tram system in Wrocław, Poland. Having first opened for service on 10 July 1877 with horsecars, it is the third oldest tramway in Poland. The system is operated by Miejskie Przedsiębiorstwo Komunikacyjne we Wrocławiu. The system consists of 23 lines with a total line length of 258.2 kilometres. There are six depots and 20 loops. The system uses 1,435 mm standard gauge."},{"page_url":"https://it.wikipedia.org/wiki/Foreste_di_conifere_e_decidue_dell%27Anatolia_meridionale","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Cedars_under_the_snow.jpg","page_title":"Foreste di conifere e decidue dell'Anatolia meridionale","context_page_description":"Le foreste di conifere e decidue dell'Anatolia meridionale sono un'ecoregione dell'ecozona paleartica, definita dal WWF, che si estende attraverso le montagne della Turchia meridionale, della Siria occidentale, del Libano e dell'estremità settentrionale di Israele.\\nLa regione fa parte della ecoregione globale 123 Formazioni forestali mediterranee, inclusa nella lista Global 200."},{"page_url":"https://pl.wikipedia.org/wiki/Simeon_Solomon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Simeon_Solomon_-_Shadrach_Meshach_Abednego.JPG","page_title":"Simeon Solomon","context_page_description":"Simeon Solomon – angielski malarz związany z prerafaelitami."},{"page_url":"https://pt.wikipedia.org/wiki/Afrancesamento_de_Bruxelas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Languages_spoken_at_home_in_the_Brussels_Capital_Region_%282013%29.PNG","page_title":"Afrancesamento de Bruxelas","context_page_description":"O Afrancesamento de Bruxelas refere-se à evolução, ao longo dos últimos dois séculos, desta cidade historicamente de fala neerlandesa em uma cidade maioritariamente francófona. A principal causa dessa transição foi a rápida assimilação da população flamenga, e a imigração procedente da França e da Valônia.\\nA ascensão dos francês na vida pública começou gradualmente depois de independência belga no final do século XVIII, e aumentou à medida que a população de nova capital crescia. O holandês que na Bélgica não era estandarlizado não podiam competir com o francês, que era a linguagem do judiciário, da administração, do exército, da educação, da alta cultura e da mídia.\\nO valor e o prestígio da língua francesa eram tão universalmente reconhecidos que depois de 1880, mais particularmente após a virada de o século, proficiência em francês entre os falantes de holandês aumentou espetacularmente. Embora a maioria da população permanecesse bilíngue até a segunda metade do século XX, o dialeto brabantiano original [26] não era mais transmitido de geração em geração, levando a partir de 1910 a um aumento de falantes monolingues de francês."},{"page_url":"https://en.wikipedia.org/wiki/20_cm/12_short_naval_gun","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Artillery_-_War_in_the_Pacific_National_Historical_Park_%28Ga%27an_Point%29_-_DSC00883.JPG","page_title":"20 cm/12 short naval gun","context_page_description":"The 20 cm/12 short naval gun was a naval gun used by the Imperial Japanese Navy to defend merchant ships and land bases during World War II."},{"page_url":"https://pl.wikipedia.org/wiki/Stary_Dworek","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Stary_Dworek_kolumna.jpg","page_title":"Stary Dworek","context_page_description":"Stary Dworek – wieś w Polsce położona w województwie lubuskim, w powiecie międzyrzeckim, w gminie Bledzew."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%81%93%E5%A4%AE%E8%87%AA%E5%8B%95%E8%BB%8A%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Osarugawa_Brg_2.JPG","page_title":"道央自動車道","context_page_description":"道央自動車道是日本北海道茅部郡森町大沼公園IC經札幌市至士別市士別劍淵IC的高速公路，略稱為道央道。屬於國土開發幹線自動車道以及高速自動車國道下北海道縱貫自動車道的一部分，是北海道內高速公路網中最重要的幹線。\\n英文名稱為HOKKAIDO EXPWY，是日本高速自動車國道中唯一日文名與英文名不同的道路。但是，新設置且附有路線編號的道路標誌板上，改以DO-O EXP作為其英文表記。\\n高速公路編號編為「E5」。"},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_reformat%C4%83_din_Bozie%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/RO_BN_Biserica_reformata_din_Bozies_%2858%29.jpg","page_title":"Biserica reformată din Bozieș","context_page_description":"Biserica reformată din Bozieș este un monument istoric aflat pe teritoriul satului Bozieș; comuna Chiochiș."},{"page_url":"https://en.wikipedia.org/wiki/Hungary_in_the_Eurovision_Song_Contest_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/A_Dal_2018_TOP_30_2017-12-06.jpg","page_title":"Hungary in the Eurovision Song Contest 2018","context_page_description":"Hungary participated in the Eurovision Song Contest 2018. The local Media Services and Support Trust Fund and the Hungarian broadcaster Duna Media Service Provider organised the national final A Dal 2018 in order to select the Hungarian entry for the 2018 contest in Lisbon, Portugal."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_Goa%27ulds_de_Stargate","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Zipacna_%28Stargate%29.svg","page_title":"Liste des Goa'ulds de Stargate","context_page_description":"Ceci est la liste des personnages goa'ulds qui apparaissent ou sont mentionnés dans le film Stargate et les séries Stargate SG-1 et Stargate Atlantis. Dans le monde de Stargate, les Goa'ulds, qui sont les principaux antagonistes de cet univers, sont une race de parasites extraterrestres de fiction qui utilisent des êtres vivants comme hôtes et qui en prennent le contrôle. Râ fut le premier à parasiter un être humain et à garder cette forme il y a des millénaires, car le corps humain, bien que fragile, peut être facilement « réparé » grâce à la technologie goa'uld. Il fut suivi par tous les autres, les Humains devenant ainsi la seule race choisie comme hôte par les Goa'ulds. Beaucoup d'entre eux se font passer pour des dieux, commandant des armées d'esclaves et sont considérés comme des êtres malfaisants à la personnalité égocentrique et mégalomane pour ceux qui ne les vénèrent pas. Les Goa'ulds sont extrêmement intelligents et ont la capacité de comprendre très rapidement une technologie qui leur est inconnue pour ensuite mieux se l'approprier, étant ainsi des parasites dans tous les sens du terme."},{"page_url":"https://tr.wikipedia.org/wiki/Joseph_Kasavubu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Joseph_Kasa-Vubu_in_Israel.png","page_title":"Joseph Kasavubu","context_page_description":"Joseph Kasa-Vubu ya da alternatif olarak Joseph Kasavubu, Kongolu öğretim görevlisi ve siyasetçi. Kasavubu, Afrika kıtasında yer alan Kongo-Leopoldville'de ülkenin ilk devlet başkanı olarak 1960 ile 1965 yılları arasında devlet başkanlığı makamında bulunmuştur.\\nKongo'daki Katolik misyonerlerden eğitim gördü; bir süre öğretmenlik yaptı. 1942'de Belçika sömürge yönetiminde resmi görev aldı ve Kongolulara açık en yüksek mevki olan başkatipliğe kadar yükseldi.\\nKongo bağımsızlık hareketinin ilk önderlerinden olan Kasavubu 1940'ların sonlarında, kültür derneği ya da mezunlar birliği gibi adlar altında siyasi bağımsızlık amacıyla etkinlik gösteren örgütlerde önemli görevler aldı.Ülkedeki en büyük ve en güçlü kabile topluluklarından Bakongoların bir üyesi olarak, 1950'lerde kabilesine belirli ölçüde özerklik sağlayacak federal yapılı bağımsız bir Kongo devleti kurulmasını savunuyordu. 1955'te, güçlü bir kültürel ve siyasi bir dernek olan Abako'nun başkanlığına getirildi. 1957'de Belçika yetkililerin izniyle yapılan ilk belediye seçimlerinde, Abako'nun adayları Leopoldville'de seçimleri kazandılar.Kasavubu, Dendale belediye başkanlığına seçildi."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F_%D0%BD%D0%B0_%D1%85%D0%B8%D1%89%D0%BD%D0%B8%D1%86%D0%B8%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Asian_red_dog.jpg","page_title":"Класификация на хищниците","context_page_description":"Класификацията на хищниците включва всички представители на разред Хищници."},{"page_url":"https://vi.wikipedia.org/wiki/Plusia_nichollae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Plusia_nichollae_CSU_ENT1130095_1-3_1571515676_lg.jpg","page_title":"Plusia nichollae","context_page_description":"Plusia nichollae là một loài bướm đêm trong họ Noctuidae."},{"page_url":"https://tr.wikipedia.org/wiki/John_Ray","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/John_Ray_from_NPG.jpg","page_title":"John Ray","context_page_description":"John Ray, İngiliz doğabilimci ve bitki bilimci. Bitki bilim mahlası Ray'dir.\\n1670 yılına kadar John Wray olarak yazmış, bu tarihten itibaren ise Ray soy adını tercih etmiştir. Botanik, zooloji ve doğal teoloji üzerine eserler kaleme almıştır. Historia Plantarum adlı eserindeki sınıflandırması, bitkilerin modern taksonomik sınıflandırması için önemli bir adım olarak kabul edilir. Biyolojide tür kavramını ilk tanımlayan kişiler arasındadır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Wendelstein_(Mittelfranken)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Gugelhammer_01.jpg","page_title":"Liste der Baudenkmäler in Wendelstein (Mittelfranken)","context_page_description":"Auf dieser Seite sind die Baudenkmäler des mittelfränkischen Marktes Wendelstein zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDie Liste gibt den Fortschreibungsstand vom 3. Juli 2018 wieder und umfasst 144 Baudenkmäler."},{"page_url":"https://et.wikipedia.org/wiki/P%C3%BCstkastik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Calamagrostis_stricta_01.jpg","page_title":"Püstkastik","context_page_description":"Püstkastik on kõrreliste sugukonda kastiku perekonda kuuluv taimeliik."},{"page_url":"https://tr.wikipedia.org/wiki/Brock_Lesnar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Brock_Lesnar_WWE_Champion_2014.jpg","page_title":"Brock Lesnar","context_page_description":"Brock Edward Lesnar ABD'li profesyonel güreşçi ve eski MMA dövüşçüsü. Eski UFC Ağır Siklet Şampiyonlarındandır. 2000 yılında NCAA Heavyweight Şampiyonası'nı kazandı. Dünya Güreş Şampiyonası'nda Freestyle dalında ikinci oldu. WWE'de Undertaker'ın yenilmezlik serisini sonlandırdı. 5 kez WWE Dünya Ağırsiklet Şampiyonluğu ve 3 kez WWE Evrensel Şampiyonluğu'nu kazandı."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D1%81%D0%BC%D1%8B%D0%BA%D0%B0%D1%8E%D1%89%D0%B8%D1%85%D1%81%D1%8F,_%D0%B7%D0%B0%D0%BD%D0%B5%D1%81%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%B2_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%83%D1%8E_%D0%BA%D0%BD%D0%B8%D0%B3%D1%83_%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Eirenis_persicus.jpg","page_title":"Список пресмыкающихся, занесённых в Красную книгу Армении","context_page_description":"Пресмыка́ющиеся, занесённые в Красную книгу Армении, — список из 19 видов и подвидов редких и находящихся под угрозой исчезновения пресмыкающихся, включённых в последнее издание Красной книги Армении. Список пресмыкающихся во втором издании существенно расширился: в первом издании Красной книги животных значилось 11 видов пресмыкающихся.\\nПоследнее издание Красной книги Армении подготовлено специалистами Национальной академии наук, Ереванского государственного университета и других научных учреждений. Во второе издание Красной книги Армении включено 452 вида растений, 40 видов грибов, 308 видов животных."},{"page_url":"https://id.wikipedia.org/wiki/George_Steiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/George_Steiner_2013_%28cropped%29.jpg","page_title":"George Steiner","context_page_description":"Francis George Steiner adalah seorang kritikus sastra, penulis esai, filsuf, novelis, dan pendidik Prancis-Amerika. Ia menulis secara luas tentang hubungan antara bahasa, sastra, dan masyarakat, serta dampak Holokaus. Sebuah artikel di The Guardian menggambarkan Steiner sebagai seorang \\"poliglot dan polimat\\", serta \\"sering dikreditkan sebagai seorang yang menyusun kembali peran kritikus\\".\\nDi antara pengagumnya, Steiner disebut berada \\"di antara para pemikir hebat di dunia sastra saat ini\\". Novelis Inggris, A. S. Byatt menggambarkannya sebagai \\"pria Renaisans yang terlambat hadir ...seorang ahli metafisika Eropa dengan naluri untuk ide-ide penggerak zaman kita\\".\\nSteiner adalah Profesor Bahasa Inggris dan Perbandingan Sastra di Universitas Jenewa, Profesor Perbandingan Sastra dan Fellow di Universitas Oxford dan Profesor Puisi di Universitas Harvard.\\nDia terakhir tinggal di Cambridge, Inggris, di mana dia menjadi Fellow Luar Biasa di Churchill College di Universitas Cambridge sejak 1969. Dia menikah dengan penulis dan sejarawan Zara Shakow Steiner; mereka memiliki seorang putra, David Steiner dan seorang putri, Deborah Steiner."},{"page_url":"https://hu.wikipedia.org/wiki/Olaszorsz%C3%A1g_vas%C3%BAtvonalai","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Stazione_di_Ponzano_Magra_-_Piano_binari_e_FV.jpg","page_title":"Olaszország vasútvonalai","context_page_description":"Ez a lista a Olaszország vasútvonalait sorolja fel.\\nAutomatikusan generált lista vége"},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_Ponui","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Coromandel.arp.375pix.jpg","page_title":"Ilha Ponui","context_page_description":"A ilha Ponui, também conhecida pelo nome ilha de Chamberlin, é uma ilha no golfo de Hauraki, na Nova Zelândia. Tem 18 km² e pertence à família Chamberlin desde 1853. A ilha tem três propriedades rurais, 2 da família Chamberlin e uma de John Spencer. Os únicos habitantes permanentes são agricultores e pecuaristas. A ilha é popular como local de acampamentos para férias ou organizados pelos Escoteiros.\\nNa ilha existe, os únicos exemplares de burro-selvagem da Nova Zelândia, e também a ave nacional, o kiwi."},{"page_url":"https://fi.wikipedia.org/wiki/Ylva_Johansson","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Hearings_Ylva_Johansson_%28Sweden%29_Home_affairs_%2848826433018%29_%28cropped%29.jpg","page_title":"Ylva Johansson","context_page_description":"Ylva Julia Margareta Johansson on ruotsalainen sosiaalidemokraattinen poliitikko. joka aloitti vuonna 2019 Von der Leyenin komission Euroopan sisäasioista vastaavana komissaarina. Hänen toimialaansa kuuluvat muun muassa uuden sisäisen turvallisuuden strateguan kehittäminen sekä maahanmuutto- ja turvapaikkasopimuksen valmistelu.\\nJohansson toimi työmarkkinaministerinä Löfvenin I hallituksessa ja Löfvenin II hallituksessa.\\nVuosina 2004−2006 Johansson toimi sairaanhoito- ja vanhustenhoivaministerinä ja vuosina 1994−1998 kouluministerinä.\\nKoulutukseltaan Johansson on matematiikan ja fysiikan opettaja."},{"page_url":"https://de.wikipedia.org/wiki/Notre-Dame-de-la-Garde_(%C3%89tretat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/EtretatJuin2017_%2871%29.jpg","page_title":"Notre-Dame-de-la-Garde (Étretat)","context_page_description":"Notre-Dame-de-la-Garde ist eine Kapelle in Étretat im französischen Département Seine-Maritime in der Normandie."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%87%91%E5%8B%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Exterior_of_the_Kaneyu_20200607b.jpg","page_title":"金勇","context_page_description":"金勇は、秋田県能代市柳町にあった老舗料亭およびその建物。国の登録有形文化財に登録されている。現在は、観光交流施設能代市旧料亭金勇として開館している。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_de_Neuch%C3%A2tel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Motiers-Hotel-Six-Communes.jpg","page_title":"Liste des biens culturels d'importance nationale dans le canton de Neuchâtel","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton de Neuchâtel. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton de Neuchâtel. Il est trié par commune et inclus : 90 bâtiments séparés, 17 collections et 23 sites archéologiques."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%D0%92%D0%B8%D0%B4_%D0%BD%D0%B0_%D0%9F%D0%B0%D1%80%D1%83%D1%81_%D1%81_%D0%BF%D0%B0%D1%80%D0%BA%D0%B0_%D0%93%D0%BB%D0%BE%D0%B1%D0%B8.jpg","page_title":"List of tallest buildings in Ukraine","context_page_description":"Most of Ukrainian high-rises are situated in its capital city, Kiev. Ukrainian minimal skyscraper height since 2009 is considered to be 100 meters and higher.\\nCurrent tallest building of Ukraine is Klovski Descent 7A apartment building, that is 168 meters high, it was built in 2012 and opened in 2015. Also there is unfinished Sky Towers business centre, that was planned to have 214 m, but the construction was put on hold in 2016 with only half of building done.\\nHere the buildings are ranked according to their height to architectural top. This lists ranks buildings that stand at least 110 m tall, based on standard height measurement."},{"page_url":"https://en.wikipedia.org/wiki/Ormont-Dessous","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Les_ormonts.jpg","page_title":"Ormont-Dessous","context_page_description":"Ormont-Dessous is a municipality of the canton of Vaud in Switzerland, located in the district of Aigle."},{"page_url":"https://eo.wikipedia.org/wiki/Lelystad","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Bataviahaven.JPG","page_title":"Lelystad","context_page_description":"Lelystad\\nla ĉefurbo de la nederlanda provinco Flevolando, fondiĝis en 1967, kaj fariĝis municipo en 1980. La urbo havis, je la 1-a de julio 2006, 71 728 loĝantojn. Lelystad estas nomita laŭ Dr. Ir. C. Lely, eks-ministro de akvoaferoj en Nederlando."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%D8%B3%D9%8A%D8%B3%D9%83%D9%88_%D8%AC%D9%88%D8%B3%D8%AA%D9%88%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Francesco_Gostoli_2010.jpg","page_title":"فرانسيسكو جوستولى","context_page_description":"فرانسيسكو جوستولى مهندس من ايطاليا."},{"page_url":"https://en.wikipedia.org/wiki/Gossops_Green_%26_Ifield_East_(electoral_division)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Gossops_Green_%26_Ifield_East_%28electoral_division%29.png","page_title":"Gossops Green & Ifield East (electoral division)","context_page_description":"Gossops Green & Ifield East is an electoral division of West Sussex in the United Kingdom, and returns one member to sit on West Sussex County Council."},{"page_url":"https://ms.wikipedia.org/wiki/Monte_Carlo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Whole_Monaco.jpg","page_title":"Monte Carlo","context_page_description":"Monte Carlo merupakan sebuah kawasan pentadbiran di Monaco. Monaco-Ville merupakan ibu kota Monte-Carlo.\\nMonte-Carlo terkenal kerana banyaknya kasino dan orang kenamaan yang tinggal di situ. Terdapat lebih daripada 3,000 orang penduduk tetap di Monte-Carlo."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Laas_(S%C3%BCdtirol)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Unterloretz.JPG","page_title":"Liste der Baudenkmäler in Laas (Südtirol)","context_page_description":"Die Liste der Baudenkmäler in Laas enthält die 49 als Baudenkmäler ausgewiesenen Objekte auf dem Gebiet der Gemeinde Laas in Südtirol.\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Baudenkmäler in Südtirol. Dabei kann es sich beispielsweise um Sakralbauten, Wohnhäuser, Bauernhöfe und Adelsansitze handeln. Die Reihenfolge in dieser Liste orientiert sich an der Bezeichnung, alternativ ist sie auch nach der Adresse oder dem Datum der Unterschutzstellung sortierbar."},{"page_url":"https://en.wikipedia.org/wiki/Barquisimeto","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Nueva_Segovia_de_Barquisimeto_Coat_of_Arms.png","page_title":"Barquisimeto","context_page_description":"Barquisimeto is a city in Venezuela. It is the capital of the state of Lara and head of Iribarren Municipality. It is an important urban, industrial, commercial and transportation center of the country, recognized as the fourth-largest city by population and area in Venezuela after Caracas, Maracaibo and Valencia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Russophone_shop_in_Haifa.jpg","page_title":"Население Израиля","context_page_description":"Население Израиля — состав жителей, населяющих территорию Государства Израиль. Регистрируется с момента создания государства Израиль в 1948 году Центральным статистическим бюро Израиля."},{"page_url":"https://de.wikipedia.org/wiki/Azienda_per_i_Trasporti_Autoferrotranviari_del_Comune_di_Roma","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/RomemetroEmanuele.JPG","page_title":"Azienda per i Trasporti Autoferrotranviari del Comune di Roma","context_page_description":"Die Azienda per i Trasporti Autoferrotranviari del Comune di Roma bzw. ATAC S.p.A. ist ein Verkehrsunternehmen für den öffentlichen Personennahverkehr in der italienischen Hauptstadt Rom. Der Nahverkehr wird im Bereich der Metropolitanstadt Rom und in einigen Gemeinden der Provinz Viterbo mit U-Bahnen, Vorortbahnen, Straßenbahnen sowie mit Oberleitungsbussen und Omnibussen durchgeführt. Das Unternehmen gehört der Stadt Rom.\\nATAC hat 1,4 Milliarden Euro Schulden. 40 Prozent der Omnibusse sind defekt. Im Januar 2018 wurde die Anschaffung von 600 neuen Bussen beschlossen."},{"page_url":"https://eu.wikipedia.org/wiki/Dead_Kennedys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Dead_Kennedys_live_in_Chicago_at_Bottom_Lounge_on_west_Lake_June_27%2C_2014_23-32_-01_%2814530182562%29.jpg","page_title":"Dead Kennedys","context_page_description":"Dead Kennedys, San Franciscon 1978an sortutako Hardcore punk taldea da. 1980ko hamarkadan nazioarteko underground arloan talde ospetsu bilakatu zen California Über Alles edo Holiday in Cambodia bezalako abestiei esker."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A9%86%E5%A5%87%E5%A5%A7%C2%B7%E6%96%AF%E7%A6%8F%E7%88%BE%E6%89%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Muzio_Attendolo_Sforza.jpg","page_title":"穆奇奧·斯福爾扎","context_page_description":"穆奇奧·亞特多羅·斯福爾札，是義大利的傭兵團首領，斯福爾扎家族的創始人。\\n他曾在卡薩萊基奧戰役中率領波洛尼亞與佛羅倫斯聯軍。他是在米蘭統治16年的弗朗切斯科一世·斯福爾扎公爵的父親。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B7%9D%E4%BF%A3%E3%83%90%E3%82%A4%E3%83%91%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Route114_Kawamata_By-Pass_Fukushima_Prefecture_Kawamata_Town_1.jpg","page_title":"川俣バイパス","context_page_description":"川俣バイパスは、福島県伊達郡川俣町にある国道114号のバイパス道路である。"},{"page_url":"https://pt.wikipedia.org/wiki/Portland_Timbers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/PORTLAND_TIMBERS_VS._SPORTING_KC_2_-_2_%2817%29.jpg","page_title":"Portland Timbers","context_page_description":"O Portland Timbers é um clube americano de futebol sediado em Portland, no estado do Oregon. Desde 2011 participa da Major League Soccer, a principal liga de futebol dos EUA, vencendo a MLS Cup em 2015. O clube é um clube fênix do Portland Timbers original, que disputou North American Soccer League entre 1972 e 1982."},{"page_url":"https://de.wikipedia.org/wiki/Kuiperg%C3%BCrtel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Kuiperbelt_latituden.png","page_title":"Kuipergürtel","context_page_description":"Der Kuipergürtel ist eine nach Gerard Peter Kuiper benannte, ringförmige, relativ flache Region, die sich im Sonnensystem außerhalb der Neptunbahn in einer Entfernung von ungefähr 30 bis 50 Astronomischen Einheiten nahe der Ekliptik erstreckt und schätzungsweise mehr als 70.000 Objekte mit mehr als 100 km Durchmesser sowie viele kleinere Objekte enthält.\\nDie Objekte in diesem Bereich werden als Kuipergürtelobjekte bezeichnet und gehören zu den transneptunischen Objekten.\\nMan vermutet, dass ein Großteil der Kometen mit mittleren Perioden aus dem Kuipergürtel stammt. Während früher davon ausgegangen wurde, dass die Kometenkerne nahezu unverändert aus ihrer Bahn geworfene KBOs sind, gilt mittlerweile, dass es sich bei ihnen um Fragmente aus Zusammenstößen von KBOs handelt."},{"page_url":"https://fr.wikipedia.org/wiki/Perreuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Perreuse-FR-89-tilleul-03.JPG","page_title":"Perreuse","context_page_description":"Perreuse est un village, ancienne commune de l'Yonne qui fut une Commune associée de Treigny entre 1972 et 2019, année où elle devient une commune déléguée de Treigny-Perreuse-Sainte-Colombe."},{"page_url":"https://en.wikipedia.org/wiki/Kalinin_Nuclear_Power_Plant","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Udomlya_Kalinin_AES.jpg","page_title":"Kalinin Nuclear Power Plant","context_page_description":"The Kalinin Nuclear Power Station is located about 200 kilometres north west of Moscow, in Tver Oblast near the town of Udomlya. Owner and operator of the plant is the state enterprise Rosenergoatom. Kalinin Nuclear Power Station supplies the majority of electricity in the Tver region and additionally serves Moscow, Saint Petersburg, and Vladimir. In 2005 the nuclear power station fed 17.3 TWh into the grid. The station's four 150 metres tall cooling towers are local landmarks. They were manufactured in 96 concrete sections each.\\nBy March 2009 the containment structure of the new Kalinin Unit 4 reactor was nearly complete. The reactor achieved its first criticality on 8 November 2011."},{"page_url":"https://en.wikipedia.org/wiki/Pura_Penataran_Sasih","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Moon_of_Pejeng%2C_Pura_Penataran_Sasih_1462.jpg","page_title":"Pura Penataran Sasih","context_page_description":"Pura Penataran Sasih is a Hindu temple in Pejeng village, Bali.\\nIt was founded, according to a modern chronogram displayed at the entrance, in 1266 AD,\\nand served as the state temple of the Pejeng Kingdom, 1293 - 1343 AD.\\nSignificant features of the temple include:\\nA split-gate entrance.\\nA modern chronogram in front of the entrance.\\nA collection of 10th-12th century Hindu sculptures that were brought here from other parts of the island.\\nA very tall, stone Seat of Ganesh in the middle of the main courtyard.\\nThe celebrated Moon of Pejeng, a very early and revered colossal bronze drum."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%89%D5%A5%D6%80%D5%B6%D5%AB%D5%B7%D6%87%D5%BD%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Chernyshevsk_rail_yard.JPG","page_title":"Չերնիշևսկ","context_page_description":"Չերնիշևսկ, քաղաքատիպ ավան Ռուսաստանի Անդրբայկալյան երկրամասի Չեռնիշևսկի շրջանի կազմում։\\nԲնակչությունը 2010 թվականին գրանցված տվյալներով կազմում էր 12074 մարդ։"},{"page_url":"https://en.wikipedia.org/wiki/Industry_and_Idleness","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/William_Hogarth_-_Industry_and_Idleness%2C_Plate_9%3B_The_Idle_%27Prentice_betrayed_and_taken_in_a_Night-Cellar_with_his_Accomplice.png","page_title":"Industry and Idleness","context_page_description":"Industry and Idleness is the title of a series of 12 plot-linked engravings created by William Hogarth in 1747, intending to illustrate to working children the possible rewards of hard work and diligent application and the sure disasters attending a lack of both. Unlike his earlier works, such as A Harlot's Progress and Marriage à-la-mode, which were painted first and subsequently converted to engravings, Industry and Idleness was created solely as a set of engravings. Each of the prints was sold for 1 shilling each so 12 for the entire set, which is equivalent in purchasing power to approximately 80 GBP as of 2005. It may be assumed that these prints were aimed for a wider and less wealthy market than his earlier works. The originals currently reside at the British Museum."},{"page_url":"https://id.wikipedia.org/wiki/Danau_Athabasca","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/NASA_Lake_Athabasca.jpg","page_title":"Danau Athabasca","context_page_description":"Danau Athabasca adalah sebuah danau yang terletak di utara Kanada dekat perbatasan Alberta dan Saskatchewan.\\nDanau ini mencakup 7.850 km² panjangnya 283 km, memiliki lebar maksimum 50 km, dan kedalaman maksimum 124 m, menjadikannya danau terbesar dan terdalam di Alberta dan Saskatchewan, dan yang kedelapan terbesar di Kanada.Air mengalir ke utara dari danau melalui sistem Sungai Slave dan Sungai Mackenzie, akhirnya mencapai Samudra Arktik."},{"page_url":"https://en.wikipedia.org/wiki/Butterleigh","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/St_Matthews_Church_in_Butterleigh_%28geograph_4549335%29.jpg","page_title":"Butterleigh","context_page_description":"Butterleigh is a village in Mid Devon, England situated about three miles south east of Tiverton. The village includes a public house, village hall, award-winning blacksmith and is famous for its harvest home."},{"page_url":"https://en.wikipedia.org/wiki/HMC_Valiant","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/HMRC_Valiant_at_2_miles.jpg","page_title":"HMC Valiant","context_page_description":"HMC Valiant is a Border Force, formerly UK Border Agency, cutter of the United Kingdom. She was launched by Damen Shipyards in the Netherlands in 2003 and is one of four 42-metre cutters formerly operated by Her Majesty's Revenue and Customs, and since 2008 operated by the UK Border Agency and after its dissolution in 2013 operated by the UK Border Force."},{"page_url":"https://gl.wikipedia.org/wiki/Lady_Gregory","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/AbbeyPosterOpeningNight.jpg","page_title":"Lady Gregory","context_page_description":"Isabella Augusta Gregory, máis coñecida coma Lady Gregory, nada en Roxborough, Galway o 15 de marzo de 1852 e finada o 22 de maio de 1932, foi unha dramaturga, folclorista e directora de teatro irlandesa. Xunto a William Butler Yeats e Edward Martyn co-fundou o Teatro Literario de Irlanda e o Abbey Theatre, escribindo gran cantidade de obras curtas para ámbalas dúas compañías. Lady Gregory produciu unha serie de libros de recontos de historias tomadas da mitoloxía irlandesa. Nada baixo o seo dunha familia burguesa pro-británica, rebelouse contra ela. A súa conversión ó nacionalismo cultural, evidenciada polas súas obras, considérase emblemática de moitas das loitas políticas que tiveron lugar en Irlanda durante o seu período.\\nLady Gregory encadrouse dentro do movemento coñecido coma o renacemento literario irlandés. O seu fogar en Coole Park no condado de Galway serviu de lugar de reunión para algunhas das figuras principais deste renacemento, e o seu traballo inicial coma membro da directiva do Abbey Theatre está considerado tan importante coma as súas obras creativas para o propio desenvolvemento do teatro."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%B1%E6%B5%B7%E9%81%93%E6%9C%AC%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/TokaidoLineTokyoArea201503.svg","page_title":"東海道本線","context_page_description":"東海道本線是一條連結東京都千代田區東京站和兵庫縣神戶市中央區神戶站，屬於JR的鐵路線。除此以外還有品川站起途經西大井站、武藏小杉站、新川崎站、新鶴見信號場至鶴見站的支線、大垣站起至美濃赤坂站的支線，以及多數的貨物支線。\\n東京站起至熱海站為止由東日本旅客鐵道管轄、熱海站起至米原站為止由東海旅客鐵道管轄、米原站起至神戶站為止由西日本旅客鐵道管轄。支線與一部分的貨物支線由日本貨物鐵道管轄，接續本線的支線則由此線該段管轄公司管轄。\\n另外，廣義上東海道本線包括東海道·山陽新幹線東京站起至新神戶站為止的路段，本條目則只記載作為在來線的東海道本線全線的概要和沿革。新幹線參見「東海道新幹線」「山陽新幹線」，而在來線按地域劃分的詳細資料參見以下條目。\\n東海道線\\n東海道線\\n東海道線\\n琵琶湖線\\nJR京都線\\nJR神戶線"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%84%D8%B9%D8%A9_%D9%8A%D9%88%D8%B1%D9%88%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Castell_de_Yoros_-_B%C3%B2sfor_i_mar_Negra.JPG","page_title":"قلعة يوروس","context_page_description":"قلعة يوروس ‏ هي قلعة بيزنطية مدمرة تقع عند مُلتقى مضيق البوسفور والبحر الأسود، شمال تل جوشوا، في إسطنبول، تركيا. ويشار إليها أيضًا باسم قلعة جنوة، نسبةً لجمهورية جنوة في منتصف القرن الخامس عشر."},{"page_url":"https://sv.wikipedia.org/wiki/Mydas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Mydas_sp..JPG","page_title":"Mydas","context_page_description":"Mydas är ett släkte av tvåvingar. Mydas ingår i familjen Mydidae."},{"page_url":"https://nv.wikipedia.org/wiki/Ts%C3%ADdii_y%C3%A1%C5%82ti%CA%BC%C3%AD_y%C3%A1zh%C3%AD_bit%CA%BCayaa_halch%C3%AD%CA%BC%C3%ADg%C3%AD%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Scalybreastedlorikeet.jpg","page_title":"Tsídii yáłtiʼí yázhí bitʼayaa halchíʼígíí","context_page_description":"Tsídii yáłtiʼí yázhí bitʼayaa halchíʼígíí éí tsídii yádaałtiʼí dah yikahjí atah yisdzoh, áádóó éí Nahatʼeʼiitsoh Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Trichoglossus chlorolepidotus\\" deiłníigo dayózhí."},{"page_url":"https://ia.wikipedia.org/wiki/Leon_del_Congo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Murchison_falls_lion.jpg","page_title":"Leon del Congo","context_page_description":"Le leon del congo es un subspecie de Panthera leo.\\nIste articulo pecietta ha essite generate automaticamente a base de Wikidata. Pro render le pagina modificabile, publica in modo fonte un prime version con iste linea: {{subst:Autopagina/articulo/subclasse de biota}} e retorna postea al modification."},{"page_url":"https://ca.wikipedia.org/wiki/Catedral_de_Toledo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Entrada_a_la_capilla_mayor.jpg","page_title":"Catedral de Toledo","context_page_description":"La Catedral de Santa María de Toledo, anomenada també Catedral Primada de Toledo, seu de l'Arxidiòcesi de Toledo, és un edifici considerat com el magnum opus, de l'estil gòtic a Espanya. Se la coneix popularment com la Dives Toletana.\\nLa primera consagració documentada va ser dedicada a santa Maria i va tenir lloc l'any 587 en època del rei visigòtic Recared. Aquest temple primitiu va ser convertit en mesquita i, posteriorment, després de la conquesta de Toledo per Alfons VI, va ser novament utilitzat com a edifici cristià i així va romandre fins a la nova reconstrucció de l'edifici que va començar el 1226 sota el regnat de Ferran III el Sant. La gran obra culmina amb les últimes aportacions gòtiques realitzades durant el segle XV i que es donen per finalitzades el 1493, quan es van tancar les voltes dels peus de la nau central, ja en temps dels Reis Catòlics. Està construïda amb pedra blanca d'Olihuelas, material que es troba al terme d'Olías del Rey."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%B0%B4%E9%9D%92%E5%B2%A1%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Fagus_sylvatica_Purpurea_JPG4a.jpg","page_title":"水青岡屬","context_page_description":"水青岡屬（學名：Fagus），又叫山毛櫸屬，係殼斗目山毛櫸科下一個屬，落葉喬木植物，有13種。"},{"page_url":"https://pl.wikipedia.org/wiki/Nideggen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Nideggen_-_Rathaus_01_ies.jpg","page_title":"Nideggen","context_page_description":"Nideggen – miasto w Niemczech, położone w kraju związkowym Nadrenia Północna-Westfalia, w rejencji Kolonia, w powiecie Düren. W 2010 roku liczyło 10 625 mieszkańców."},{"page_url":"https://la.wikipedia.org/wiki/Lee_(comitatus_Georgiae)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Map_of_Georgia_highlighting_Lee_County.svg","page_title":"Lee (comitatus Georgiae)","context_page_description":"Lee est Georgiae comitatus in Civitatibus Foederatis Americae 24757 incolarum. Comitatus, cuius caput est urbicula Leesburg, die 9 Iunii 1825 creatus est."},{"page_url":"https://ca.wikipedia.org/wiki/Circuit_de_Porto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/A5_HPIM4185_%281187021094%29.jpg","page_title":"Circuit de Porto","context_page_description":"El Circuit de Boavista, també anomenat Circuit de Porto, era un circuit de carreres urbà on es van arribar a disputar curses de Fórmula 1.\\nEl circuit estava ubicat a Porto, Portugal, i s'utilitzà en dues ocasions per celebrar-hi el Gran Premi de Portugal de la Fórmula 1.\\nEl traçat començava a davant del port, a l'Esplanada do Rio de Janeiro, continuava per l'Avenida da Boavista i després travessava petits barris residencials fins a tornar cap a la línia de meta.\\nLa carrera del 1960 va ser l'última a disputar-s'hi, i va ser molt dura, ja que només quatre cotxes van finalitzar a menys de 5 voltes del guanyador, Jack Brabham.\\nActualment està tenint una revifalla, havent-s'hi disputat curses del Campionat del món de Turismes."},{"page_url":"https://pl.wikipedia.org/wiki/General_Motors_P-75A_Eagle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/P75A_Eagle.jpg","page_title":"General Motors P-75A Eagle","context_page_description":"General Motors P-75A Eagle to samolot myśliwski zaprojektowany we wrześniu 1942 w zakładach General Motors Corporation w odpowiedzi na zamówienie USAAF na samolot z \\"niezwykle dużą prędkością wznoszenia\\". GMC zaproponowało samolot zbudowany z części z istniejących już konstrukcji i napędzany najpotężniejszym dostępnym wówczas silnikiem chłodzonym cieczą Allison V-3420.\\nW tym okresie w zakładach General Motors produkowano szereg różnych samolotów, między innymi TBF Avenger i według niektórych źródeł kierownictwo GM miało nadzieję iż dzięki \\"priorytetowemu\\" wówczas projektowi P-75 uda im się uniknąć budowy Boeinga B-29.\\nKontrakt na dwa prototypy które otrzymały oznaczenie XP-75 został podpisany w październiku 1942. Samolot miał się składać między innymi z zewnętrznych części skrzydeł Mustanga, ogona SBD Dauntless i podwozia F4U Corsair, a ogólna konstrukcja bazowała na rozwiązaniu P-39 Airacobra z silnikiem zamontowanym w środkowej części kadłuba i napędzający śmigło przez długi wał napędowy.\\nW połowie 1943 zapotrzebowanie na myśliwce przechwytujące zmalało na tyle, że postanowiono zmienić rolę nowo powstających samolotów na myśliwce eskortowe dalekiego zasięgu."},{"page_url":"https://oc.wikipedia.org/wiki/L%27Esperon_(Gasconha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%C3%89glise_Saint-Hilaire_de_Lesperon%2C_ext%C3%A9rieur.JPG","page_title":"L'Esperon (Gasconha)","context_page_description":"L'Esperon qu'ei ua comuna gascona situada dens lo departament de las Lanas e la region de Navèra Aquitània, ancianament d'Aquitània."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_zavarovanih_%C5%BEivalskih_vrst_v_Sloveniji","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Paukstelis.jpg","page_title":"Seznam zavarovanih živalskih vrst v Sloveniji","context_page_description":"Seznam zavarovanih živalskih vrst v Sloveniji je narejen na podlagi Uredbe o zavarovanih prosto živečih živalskih vrstah, ki vsebuje poleg splošnih določil tudi dve prilogi. Poleg priloge 1, t. j. Seznam živalskih vrst, katerih živali so zavarovane, vsebuje uredba tudi prilogo 2, t. j. Seznam živalskih vrst, katerih habitate se varuje, ki pa ni predmet tega seznama."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_Bronsart_von_Schellendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Fritz_Bronsart_1912_Th.Andersen_Stuttgart.jpg","page_title":"Friedrich Bronsart von Schellendorf","context_page_description":"Friedrich Heinrich Bruno Julius Bronsart von Schellendorf war ein preußischer Generalleutnant und im Ersten Weltkrieg Chef des Generalstabs des osmanischen Feldheeres. Er war an führender Stelle am Völkermord an den Armeniern beteiligt."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%86%D9%81%D8%B0%D9%8A%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Paracentrotus_lividus_profil.JPG","page_title":"قنفذيات الماء","context_page_description":"قنفذيات الماء أو الأخينوسيات، رتبة حيوانات بحرية من قنافذ البحر."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D0%B0%D1%9E%D1%80%D1%8B%D0%B9%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Tavriysk_gerb.png","page_title":"Таўрыйск","context_page_description":"Таўрыйск — горад муніцыпальнага значэння Херсонскай вобласці Украіны, падпарадкаваны Навакахоўскаму гарсавету. За 86 км па аўтадарогах, 116 км па чыгунцы ад Херсона."},{"page_url":"https://hu.wikipedia.org/wiki/MATLAB","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Sinus_function.png","page_title":"MATLAB","context_page_description":"A MATLAB speciális programrendszer, amelyet numerikus számítások elvégzésére fejlesztettek ki és emellett egy programozási nyelv. A The MathWorks által kifejlesztett programrendszer képes mátrix számítások elvégzésére, függvények és adatok ábrázolására, algoritmusok implementációjára és felhasználói interfészek kialakítására. Habár a szoftver kizárólag numerikus, a MuPAD csomag hozzáadásával képes matematikai kifejezéseket grafikusan is megjeleníteni.\\n2004-ben, hivatalos információk alapján, a MATLAB több, mint 1 millió felhasználóval rendelkezett."},{"page_url":"https://en.wikipedia.org/wiki/Pilbara_railways","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/BHPB_Iron_Ore_4308_%2B_4373.JPG","page_title":"Pilbara railways","context_page_description":"The Pilbara railways are a collection of railways in the Pilbara region of North-West Western Australia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B3%D8%AA%D9%88%D9%83%D8%A9_%D8%A5%D9%8A%D8%AF%D8%A7%D9%87%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Festucaidahoensis1.jpg","page_title":"فستوكة إيداهو","context_page_description":"فستوكة إيداهو نوع نباتي يتبع جنس الفستوكة من الفصيلة النجيلية.\\nموطنه غرب الولايات المتحدة."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B2%E0%B5%82_%E0%B4%AA%E0%B5%BC%E0%B4%B5%E0%B5%8D%E0%B4%B5%E0%B4%A4%E0%B4%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/%E8%8A%A6%E6%9E%97%E6%B9%96.JPG","page_title":"ലൂ പർവ്വതം","context_page_description":"തെക്കൻ ചൈനയിലെ ജാങ്ക്ഷി പ്രവിശ്യയുടെ വടക്കുഭാഗത്തായി സ്ഥിതിചെയ്യുന്ന ഒരു പർവ്വതമാണ് ലൂ പർവ്വതം അഥവാ ലൂഷാൻ. കുവാങ്ലു എന്നും ഇത് അറിയപ്പെടുന്നു. ചൈനയിലെ തന്നെ ഒരു വിഖ്യാതമായ പർവ്വതനിരയാണ് ലൂഷാൻ. ദീർഘവൃത്താകൃതിയിലുള്ള ഇതിന് 25കി.മീ നീളവും 10കി.മീ വീതിയുമുണ്ട്. ഇതിന്റെ വടക്കുഭാഗത്തായ് യാങ്ടിസി നദിയും ഒഴുകുന്നു. ലൂഷാൻ പർവ്വതനിരകളിലെ ഏറ്റവും ഉയരമുള്ള കൊടുമുടിയാണ് ദഹാൻയാങ്. സമുദ്രനിരപ്പിൽനിന്നും 1474മീറ്ററാണിതിന്റെ ഉയരം. ഗാംഭീര്യത്തിലും സൗന്ദര്യത്തിലും ഉയരത്തിലും പ്രസിദ്ധിയാർജ്ജിച്ച ഒരു പർവ്വതമാണ് ലൂഷാൻ. 1996ൽ ഈ ദേശീയോദ്യാനത്തിന് ലോക പൈതൃക പദവി ലഭിച്ചു."},{"page_url":"https://fr.wikipedia.org/wiki/Cubry","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/2016-10_-_Cubry_-_02.jpg","page_title":"Cubry","context_page_description":"Cubry est une commune française située dans le département du Doubs, en région Bourgogne-Franche-Comté."},{"page_url":"https://sv.wikipedia.org/wiki/Pareronia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Pareronia_valeria_ad_sec.jpg","page_title":"Pareronia","context_page_description":"Pareronia är ett släkte av fjärilar. Pareronia ingår i familjen vitfjärilar.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Fruit_de_mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Sepia-boqueria.jpg","page_title":"Fruit de mer","context_page_description":"Les fruits de mer sont un nom donné aux animaux invertébrés marins comestibles. Dans l'acception la plus usuelle, il s'agit d'une grande variété d'organismes marins, à l'exception des poissons et des mammifères."},{"page_url":"https://cy.wikipedia.org/wiki/Jill_Tarter","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Jill_Tarter_at_TED_in_2009.jpg","page_title":"Jill Tarter","context_page_description":"Gwyddonydd Americanaidd yw Jill Tarter, a gaiff ei hadnabod yn bennaf fel seryddwr."},{"page_url":"https://no.wikipedia.org/wiki/Patrick_Bevin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/2018_Tour_of_Britain_stage_3_022_Paddy_Bevin_on_the_podium.JPG","page_title":"Patrick Bevin","context_page_description":"Patrick Bevin er en profesjonell newzealandsk landeveissyklist, som sykler for det amerikanske laget BMC Racing Team."},{"page_url":"https://fr.wikipedia.org/wiki/Liaison_(m%C3%A9canique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Plan_H.jpg","page_title":"Liaison (mécanique)","context_page_description":"Un mécanisme, ou transmetteur, est l'association de plusieurs pièces liées entre elles par des contacts physiques qui les rendent totalement ou partiellement solidaires, selon qu'ils autorisent ou non des mouvements relatifs. La liaison mécanique est le modèle utilisé pour décrire cette relation dont la considération est primordiale dans l'étude des mécanismes. Elle emploie des représentations mathématiques qui diffèrent suivant qu'on l'aborde sous l'aspect cinématique ou sous l'aspect des actions mécaniques.\\nLa notion de liaison mécanique se définit plus généralement entre groupes de pièces, appelés « classes d'équivalence », contenant respectivement des pièces entièrement solidaires.\\nÀ partir de l'analyse des surfaces de contact entre deux solides, et en considérant des surfaces usuelles, on établit une nomenclature proposant 12 liaisons normalisées depuis la liaison nulle qui n'a aucun effet jusqu'à la liaison complète qui solidarise les deux pièces.\\nCertains dispositifs mécaniques, s'interposant comme un joint entre deux éléments peuvent être considérés comme liaison directe entre ces éléments."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A8%E0%A6%BE%E0%A6%B0%E0%A6%BE_%E0%A6%A1%E0%A7%8D%E0%A6%B0%E0%A7%80%E0%A6%AE%E0%A6%B2%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A8%E0%A7%8D%E0%A6%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Aska_at_Nara_Dreamland.jpg","page_title":"নারা ড্রীমল্যান্ড","context_page_description":"নারা ড্রীমল্যান্ড জাপানের নারা এলাকার কাছাকাছি অবস্থিত একটি থিম পার্ক। এই পার্কটির ক্যালিফোর্নিয়ায় অবস্থিত ডিজনীল্যান্ডের আদলে ১৯৬১ সালে নির্মিত হয়। ২০০৬ সালের আগস্টে স্বল্প দর্শনার্থীর জন্য এই পার্কটি স্থায়ীভাবে বন্ধ করে দেওয়া হয়।"},{"page_url":"https://en.wikipedia.org/wiki/Imperial_examination","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ming-Beamtenpr%C3%BCfungen1.jpg","page_title":"Imperial examination","context_page_description":"Chinese imperial examinations were a civil service examination system in Imperial China for selecting candidates for the state bureaucracy. The concept of choosing bureaucrats by merit rather than birth started early in Chinese history but using written examinations as a tool of selection started in earnest during the mid-Tang dynasty. The system became dominant during the Song dynasty and lasted until it was abolished in the late Qing dynasty reforms in 1905.\\nThe exams served to ensure a common knowledge of writing, the classics, and literary style among state officials. This common culture helped to unify the empire and the ideal of achievement by merit gave legitimacy to imperial rule. The examination system played a significant role in tempering the power of hereditary aristocracy, military authority, and the rise of a gentry class of scholar-bureaucrats.\\nStarting with the Song dynasty, the system was regularized and developed into a roughly three-tiered ladder from local to provincial to court exams. The content was narrowed and fixed on texts of Neo-Confucian orthodoxy by the Ming dynasty, during which the highest degree, the jinshi, became essential for the highest offices."},{"page_url":"https://fr.wikipedia.org/wiki/Dipangkorn_Rasmijoti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Dipangkorn_Rasmijoti_2019.jpg","page_title":"Dipangkorn Rasmijoti","context_page_description":"Le prince Dipangkorn Rasmijoti, né le 29 avril 2005 à Bangkok, est un membre de la famille royale de Thaïlande, fils du roi Rama X et de sa troisième épouse, Srirasmi Suwadee.\\nDepuis 2016, il occupe la première place dans l'ordre de succession au trône thaïlandais, les autres fils du roi étant nés hors mariage, ils n'ont pas de droit sur le trône. Il est l'actuel héritier présomptif du trône de Thaïlande."},{"page_url":"https://fr.wikipedia.org/wiki/Arbre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Lucas_Cranach_%28I%29_-_Adam_and_Eve-Paradise_-_Kunsthistorisches_Museum_-_Detail_Tree_of_Knowledge.jpg","page_title":"Arbre","context_page_description":"Un arbre est une plante ligneuse terrestre comportant un tronc sur lequel s'insèrent des branches ramifiées portant le feuillage dont l'ensemble forme le houppier, appelé aussi couronne.\\nLes arbres sont des plantes pérennes qui vivent plusieurs années, de plusieurs décennies à plusieurs siècles, et dans de rares cas plusieurs millénaires.\\nSelon les estimations, la planète compte entre 60 000 et 100 000 espèces d'arbres.\\nLes formations végétales dominées par des arbres poussant les uns à côté des autres sont des forêts, mais les arbres peuvent aussi croître de manière plus ou moins isolée hors des forêts.\\nIls jouent un rôle majeur dans le fonctionnement écologique terrestre, en raison de leur capacité à stocker le carbone, à prendre une part active dans le cycle de l'eau et de manière générale à constituer les écosystèmes complexes que sont les forêts, sources et refuges de biodiversité.\\nIls constituent aussi pour les sociétés humaines une ressource considérable de matériaux, de denrées et de multiples services. Ils occupent dans presque toutes les cultures du monde une place pratique et symbolique importante."},{"page_url":"https://fr.wikipedia.org/wiki/Johan_Verminnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Johan-verminnen-1421735197.jpg","page_title":"Johan Verminnen","context_page_description":"Johan Verminnen, né le 22 mai 1951 à Wemmel, est un chanteur flamand néerlandophone."},{"page_url":"https://bg.wikipedia.org/wiki/AR-15","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/ArmaLite_AR-15_SPAR_3240_DEC._17._2004.png","page_title":"AR-15","context_page_description":"AR-15 е американски автомат, произвеждан между 1959 и 1964 г. Проектиран е от ArmaLite през 1956 г. и е базиран на пушката AR-10. Създаден е като лека щурмова пушка, с леки и малки патрони, за да могат войниците да носят повече амуниции.\\nПрез 1959 г. ArmaLite продава правата си над AR-10 и AR-15 на Colt, поради финансови затруднения. След някои модификации, Colt ребрандират автомата като Colt ArmaLite AR-15. Colt рекламират автомата на различни военни служби по света и впоследствие той бива приет от армията на САЩ под наименованието M16, чието производство започва през март 1964 г.\\nColt продължават да използват марката AR-15 за серията си полуавтоматични пушки, продавани на цивилни и правоохранителни клиенти. В САЩ автоматът е най-разпространенията вариант на гражданско оръжие, тоест оръжие, разрешено за продажба на цивилното население. По данни от 2016 г., около 10 милиона екземпляра се намират в ръцете на американското население."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_campe%C3%B5es_da_Major_League_Baseball_em_m%C3%A9dia_de_rebatidas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Nap_Lajoie_1913.jpg","page_title":"Lista de campeões da Major League Baseball em média de rebatidas","context_page_description":"No beisebol, a média de rebatidas é uma medida que calcula o sucesso de um rebatedor em rebater a bola durante sua vez ao bastão. Na Major League Baseball, isto é calculado dividindo o o número de rebatidas pelo número de vezes ao bastão. Na MLB, um jogador de cada liga vence o \\"título de rebatidas\\" em cada temporada por ter a média em rebatidas naquele ano. Sob as regras atuais, um jogador deve ter 3.1 aparições no plate por jogo do time para se qualificar ao título de rebatidas. Entretanto, se a média do jogador líder é suficientemente ampla que as vezes ao bastão sem rebatidas possam ser adicionadas para que seja atingido este requisito e o jogador ainda assim tenha a mais alta média, ele vence o título. Tony Gwynn, por exemplo, tinha 159 rebatidas em 451 vezes ao bastão em 1996 mas apenas 498 aparições no plate. A média de Gwynn teria caído para 34,9% com quatro vezes sem nenhuma rebatida adicionadas para atingir o total de 502 aparições no plate, mas isto ainda seria mais alto do que o próximo jogador elegível; sendo assim ele venceu o título de 1996 da Liga Nacional."},{"page_url":"https://de.wikipedia.org/wiki/Europaschutzgebiet_(%C3%96sterreich)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Logo_with_website.JPG","page_title":"Europaschutzgebiet (Österreich)","context_page_description":"Mit Europaschutzgebiet werden in Österreich mehrere Schutzgebietskategorien bezeichnet, die das Ziel verfolgen, die natürlichen Lebensräume Europas dauerhaft zu sichern. Im Wesentlichen sind das Flächen im Schutzgebietsnetzwerk Natura 2000 der Europäischen Union für den Biotop- und Artenschutz. Die wesentlichen EU-Richtlinien dazu sind die Vogelschutzrichtlinie und die Fauna-Flora-Habitat-Richtlinie sowie auch Wild-Europaschutzgebiete.\\nUnter Europaschutzgebiete fallen außerdem Biogenetische Reservate, Europadiplom-Gebiete und das Schutzgebiet der Alpenkonvention.\\nEnde 2017 waren in Österreich insgesamt 204 Natura-2000-Gebiete ausgewiesen sowie rund 90 Europaschutzgebiete aus anderen Kategorien."},{"page_url":"https://sh.wikipedia.org/wiki/Samir_Bara%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Samir_Bara%C4%8D_2010.jpg","page_title":"Samir Barač","context_page_description":"Samir Barač je hrvatski vaterpolista. Trenutno nastupa za Primorje. Igra na poziciji krila.\\nSa reprezentacijom Hrvatske osvojio bronzane medalje na svetskim prvenstvima 2009. u Rimu i 2011. u Šangaju i zlatnu medalju na Evropskom prvenstvu 2010. u Zagrebu."},{"page_url":"https://pt.wikipedia.org/wiki/Signal_Film_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/J_P_McGowan_03.JPG","page_title":"Signal Film Corporation","context_page_description":"Signal Film Corporation foi uma companhia cinematográfica estadunidense da era do cinema mudo, localizada em Los Angeles, Califórnia. Foi formada por Samuel S. Hutchinson, J. P. McGowan e Helen Holmes, por volta de 1915. Produziu 12 filmes, entre eles quatro seriados, estrelados por Helen Holmes e dirigidos por seu marido, J. P. McGowan."},{"page_url":"https://en.wikipedia.org/wiki/Buell_1125R","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Midnight_Black_2009_Buell_1125R.JPG","page_title":"Buell 1125R","context_page_description":"The Buell 1125R is a sport bike that was made by Buell Motorcycle Company in the United States. It was introduced in July 2007 for the 2008 model year. Production of road-going 1125Rs, and all Buell models, ceased in October 2009. In November 2009, Buell founder Erik Buell launched Erik Buell Racing, which initially produced race-only versions of the 1125R.\\nThe 1125R is powered by a 1,125 cc Helicon V-twin engine made by BRP-Powertrain of Austria. The liquid-cooled engine has a V angle of 72° and produces a claimed 146 hp, with a rpm limit of 10,500. Motorcycle Consumer News tested 127.1 hp and 71.1 lbf⋅ft at the rear wheel, while Cycle World reported 134.0 hp @ 9,800 rpm and 75.9 lbf⋅ft } @ 8,300 rpm. The two magazines reported top speeds of 158 and 161 mph respectively, and 0 to ¹⁄₄ mile times of 10.51 and 10.39 seconds at 134.32 and 134.09 mph.\\nThe Helicon engine's 72° layout differs from Buell's previous V-twins, which were based on 45° air-cooled Harley-Davidson Sportster motors, modified for greater efficiency and output.\\nThe 1125R includes a number of unconventional design attributes. The patented frame design houses the bike's fuel."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%A0%E1%83%90%E1%83%9C%E1%83%A9%E1%83%94%E1%83%A1%E1%83%99%E1%83%9D_I_(%E1%83%9D%E1%83%A0%E1%83%98_%E1%83%A1%E1%83%98%E1%83%AA%E1%83%98%E1%83%9A%E1%83%98%E1%83%90)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Francis1januarius.jpg","page_title":"ფრანჩესკო I (ორი სიცილია)","context_page_description":"ფრანჩესკო I — ბურბონთა დინასტიის წარმომადგენელი. ნეაპოლისა და სიცილიის მეფე ფერდინანდ I-ისა და დედოფალ მარია კაროლინა ავსტრიელის ვაჟი. ორი სიცილიის მეფე 1825-30 წლებში."},{"page_url":"https://cs.wikipedia.org/wiki/Detva","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Centro_de_distrikto_Detva.JPG","page_title":"Detva","context_page_description":"Detva je okresní město, které se nachází na středním Slovensku, v Banskobystrickém kraji."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D8%B1%D8%A9_%D9%88%D9%8A%D9%86_%D9%83%D9%88%D9%84%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Sarah_Wayne_Callies_2.jpg","page_title":"سارة وين كوليز","context_page_description":"سارة وين كوليز ‏ هي ممثلة أمريكية اشتهرت بلعب دور سارا تانكريدي في المسلسل التلفزيوني الأمريكي بريزون بريك، وأيضاً أدّت دور لوري جريمز في مسلسل لـإيه إم سي وهو الموتى السائرون, كما ادت دور كاتي بومن في المستعمرة"},{"page_url":"https://es.wikipedia.org/wiki/AP_(munici%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/ArmorPiercingShell.png","page_title":"AP (munición)","context_page_description":"La munición AP se refiere a un tipo de proyectil de punta dura, habitualmente para artillería y cuyo grado de perforación se basa en su energía cinética. Es decir, a mayor velocidad y calibre del proyectil, mayor grado de perforación en el blindaje del objetivo.\\nAlgunos proyectiles especiales se fabricaban con una punta más dura hecha de una aleación de wolframio o uranio empobrecido entre otros; en ocasiones, también se combinaban con un propelente que les otorgaba mayor velocidad de salida y por lo tanto mayor poder de penetración en un impacto adecuado.\\nEste tipo de proyectil, por definición, no utiliza material explosivo pero se le puede añadir a su ojiva pasando a denominarse APHE, del inglés Armour Piercing High Explosive.​"},{"page_url":"https://fr.wikipedia.org/wiki/WABC-TV","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/WABC-TV_Columbus_Av_jeh.JPG","page_title":"WABC-TV","context_page_description":"WABC-TV ou Channel 7 est l'une des stations phares du réseau ABCdes États-Unis. Elle est située à New York. C'est l'une des chaînes détenue et exploitée par ABC et des plus connues avec le succès de Eyewitness News et de la matinale Live with Regis and Kelly diffusée à l'échelle nationale en syndication par Disney-ABC Domestic Television.\\nDans les quelques régions de l'est des États-Unis où ABC n'est pas disponible en hertzien, WABC-TV est disponible par satellite sur le bouquet DirecTV. Depuis le 4 mars 2009, la chaîne est de nouveau disponible sur le bouquet Dish Network."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/%D0%9C%D0%B0%D1%80%D0%BA%D0%B0%D0%A0%D1%83%D1%85.JPG","page_title":"Знаки поштової оплати України 2009","context_page_description":"Знаки поштової оплати України 2009 — перелік таких знаків, введених Укрпоштою у 2009 році. Відсортовані за датою введення."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%96%D0%BC%D1%84%D0%B5%D0%B9_%D1%83_%D0%93%D0%B5%D1%80%D0%B0%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/GerasaNinfeo-Trabeazione.jpg","page_title":"Німфей у Герасі","context_page_description":"Німфей у Герасі — монументальна споруда античного міста Гераса, яке передувало сучасному Джерашу. Складова частина грандіозного комплексу руїн Гераси.\\nНімфей розташовується на західній стороні герасенської кардо, між Храмом Діоніса та Пропілеями храму Артеміди. Він є одним з найкращих зразків монументальних фонтанів, котрі були поширені у східних та південних провінціях Риму — наразі у гарному чи задовільному стані їх можливо побачити в Сагаласі, Сіде, Лептіс-Магні, Філадельфії. При цьому німфей Гераси за загальною композицією найбільше схожий із лівійською спорудою, якій він колись поступався пишністю, проте наразі перевершує її схоронністю.\\nНавпроти фонтану замість звичайних колон, котрі утворювали портики кардо, встановили чотири значно вищі. Ці чотири колони мали коринфські капітелі та були розставлені парами обабіч більш широкого центрального проходу. Розташований за ними німфей складався з великої центральної апсиди та прилеглих до неї менших бічних секцій, обрамлених чотирма пілястрами. Загальна ширина споруди становить 22 метри, а її тильна сторона виконувала функцію підпірної стінки для розташованого позаду пагорбу."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%A8%D7%99%D7%99%D7%A1%D7%99_%D7%A8%D7%99%D7%99%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bracey_Wright.JPG","page_title":"ברייסי רייט","context_page_description":"קארל ברייסי רייט הוא כדורסלן אמריקאי המשחק בעמדת הקלע והרכז בקבוצת נימבורק בליגה הצ'כית. גובהו הוא 1.91 מ'."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%81%D0%B0%D1%84_%D0%9C%D0%B5%D1%81%D0%B5%D1%80%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/People_Artist_of_the_USSR1.jpg","page_title":"Асаф Месерер","context_page_description":"Асаф Михайлович Месерер е руски и съветски балетист, балетмайстор, преподавател и автор на книги; солист на Болшой театър, представител на династията Плисецки – Месерер. Носител на две Сталински награди, народен артист на СССР."},{"page_url":"https://en.wikipedia.org/wiki/List_of_former_places_of_worship_in_Chichester_District","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Former_Salvation_Army_Hall%2C_Westbourne_Road%2C_Westbourne.JPG","page_title":"List of former places of worship in Chichester District","context_page_description":"In the district of Chichester, a large rural area in the English county of West Sussex, there are more than 50 former churches, chapels and other places of worship that still stand but that are no longer in religious use. Many are in the ancient city of Chichester, the district's largest centre of population: many medieval and Victorian Anglican churches were built there to serve tiny parishes that were later combined with others, and chapels serving various Nonconformist denominations were closed after their congregations declined. Elsewhere, in the villages and scattered farming communities that characterise the rest of the district, churches and chapels were superseded by new buildings, closed due to declining attendance or shifts in population, or rendered unusable because of structural problems. A few former places of worship are now ruinous but still survive in derelict or fragmentary form. Many others are fully usable and have been converted to new uses – residential, commercial, educational, social and others. Some former churches stand empty awaiting a new function."},{"page_url":"https://io.wikipedia.org/wiki/Villarrobledo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Villarrobledo_-_Plaza_de_Ram%C3%B3n_y_Cajal_02.JPG","page_title":"Villarrobledo","context_page_description":"Villarrobledo esas urbo en Hispania, jacante an la regiono Kastilia-La Mancha. Segun statistiki dil yaro 2017, ol havis 25 317 habitanti. Entote ol havas 862,4 km²."},{"page_url":"https://ceb.wikipedia.org/wiki/Aphileta_misera","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Aphileta_misera.JPG","page_title":"Aphileta misera","context_page_description":"Espesye sa kaka nga una nga gihulagway ni O ang Aphileta misera. P.-cambridge ni adtong 1882. Ang Aphileta misera sakop sa kahenera nga Aphileta sa kabanay nga Linyphiidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%8A%9D%E5%8A%A0%E5%93%A5%E8%81%AF%E5%90%88%E8%BB%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Union_Station_old_approaches.svg","page_title":"芝加哥聯合車站","context_page_description":"芝加哥联合车站是位于芝加哥市区的一座大型火车站，启用于1925年，原为宾夕法尼亚铁路公司等数家铁路公司联合设置的车站，故命名为“联合车站”。目前为芝加哥市内唯一一座到始发终到美国国铁城际客运列车的车站，也是芝加哥区域通勤铁路的主要始发站之一。车站位于芝加哥河西岸，亚当斯街和杰克逊街之间，紧邻市中心卢普区，占地约9.5个街区。是“芝加哥都会区”内最大的火车站。"},{"page_url":"https://eu.wikipedia.org/wiki/Spermophilus_saturatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Golden-Mantled_Ground_Squirrel%2C_Mount_Rainier%2C_July_2006.jpg","page_title":"Spermophilus saturatus","context_page_description":"Spermophilus saturatus Spermophilus generoko animalia da. Karraskarien barruko Xerinae azpifamilia eta Sciuridae familian sailkatuta dago."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B3%D9%8A%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Ph_locator_southern_leyte_maasin.png","page_title":"ماسين","context_page_description":"ماسين ‏ هي مدينة في الفلبين، تتبع لايتي الجنوبية، هي عاصمة لايتي الجنوبية، بلغ عدد سكانها 85٬560 نسمة، في 15 أغسطس 2015، تبلغ مساحتها 211٫71 كيلومتر مربع، رمزها البريدي هو 6600."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%83%E3%83%89%E3%83%AA%E3%83%95%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Dead-lifts-2-1.png","page_title":"デッドリフト","context_page_description":"デッドリフトとは、下背部・臀部・脚部を鍛える代表的なウェイトトレーニングの種目。パワーリフティング競技の3種目の1つである。名称の由来はデッドウェイトをリフトアップすることから。\\n主に広背筋、僧帽筋、脊柱起立筋、大臀筋、ハムストリングスが鍛えられる。\\n高重量を扱うプル系の種目なので、かなり熟達した者が筋力強化・筋肥大のトレーニングを行う際にはリストストラップが必要になる。\\n正しいフォームの習得が難しいため、トレーナーなどの監修を受けることが望ましい。"},{"page_url":"https://no.wikipedia.org/wiki/Veld","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Doldersummer_Veld_11-2004.jpg","page_title":"Veld","context_page_description":"Veld er en landskapsform med åpent steppeland i Sør-Afrika og enkelte andre steder i det sørlige Afrika.\\nOrdet kommer fra afrikaans og betyr egentlig slette. Den primære betydningen er flate arealer dekket med gress eller lave busker og kratt. Denne primærbetydningen dekker imidlertid ikke alle konnotasjonene som ligger i ordet. Velden kan sammenlignes med den australske bushen, den argentinske pampasen eller den nordamerikanske prærien, og kan således også oversettes med utmark, eller endog representere en form for mental geografi."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_arborilor_seculari_din_Republica_Moldova","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Strada_Grenoble_110%2C_Chi%C8%99in%C4%83u%2C_Moldova_-_panoramio.jpg","page_title":"Lista arborilor seculari din Republica Moldova","context_page_description":"Ariile protejate din Republica Moldova sunt categorizate în mai multe tipuri, unul din care este monumente naturale. Acestea, la rândul lor, se împart în geologice sau paleontologice, hidrologice și botanice. Lista monumentelor de tip botanic include sectoare reprezentative cu vegetație silvică și amplasamente de arbori seculari.\\nLista dată conține amplasamente cu arbori seculari, conform Legii nr. 1538 din 25.02.1998 privind fondul ariilor naturale protejate de stat. În anexa 3 a acestei legi sunt enumerate 158 de amplasamente, care însumează un total de 433 de arbori seculari.\\nArborii seculari sunt exemplare solitare sau grupuri mici izolate de arbori, impresionanți prin vârstă, dimensiuni, frumusețe, raritate sau prin faptul că au fost martorii unor evenimente istorice."},{"page_url":"https://hu.wikipedia.org/wiki/Weser","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Estuary_mouth_Weser_Bremerhaven.JPG","page_title":"Weser","context_page_description":"A Weser Németország északnyugati részének legnagyobb folyója. Alsó-Szászország, Észak-Rajna-Vesztfália és Bréma tartományokon folyik keresztül. Forrása nincs, Münden közelében a Werra és Fulda folyók az ún. Weserkő mellett egyesülnek és futnak tovább Weser néven. A Werra és a Fulda nélkül a Weser hossza 452 kilométer."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-F%C3%A9licien,_Ard%C3%A8che","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Saint-F%C3%A9licien_07.JPG","page_title":"Saint-Félicien, Ardèche","context_page_description":"Saint-Félicien är en kommun i departementet Ardèche i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen ligger i kantonen Saint-Félicien som ligger i arrondissementet Tournon-sur-Rhône. År 2009 hade Saint-Félicien 1 198 invånare."},{"page_url":"https://id.wikipedia.org/wiki/USS_Colorado_(BB-45)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/USS_Colorado_%28BB-45%29_-_NH_64516.jpg","page_title":"USS Colorado (BB-45)","context_page_description":"USS Colorado (BB-45) adalah sebuah kapal perang milik Angkatan Laut Amerika Serikat. Kapal ini dibuat pada tanggal 29 Mei 1919 oleh New York Shipbuilding Corporation dari Camden, New Jersey. Kapal ini dijalankan pada tanggal 22 Maret 1921 disponsori oleh M. Melville, dan ditugaskan pada tanggal 30 Agustus 1923 dengan kapten R. R. Belknap dalam komando. Kapal ini bermodalkan 4 kubah meriam kaliber 16 inch berlaras ganda.\\nSetelah perang dunia usai, Colorado berpartisipasi dalam operasi untuk membawa pasukan Amerika Serikat kembali ke kampung halaman. Dia dinonaktifkan pada tahun 1947, dan dijual untuk dibesituakan pada tahun 1959."},{"page_url":"https://en.wikipedia.org/wiki/Carrier_Strike_Group_9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/US_Navy_110202-N-2907P-001_Suspected_pirate_skiffs_burn_from_weapons_fire_from_the_guided-missile_destroyer_USS_Momsen_%28DDG_92%29.jpg","page_title":"Carrier Strike Group 9","context_page_description":"Carrier Strike Group 9 is a U.S. Navy carrier strike group. Carrier strike groups gain and maintain sea control as well as project naval airpower ashore.\\nIt is currently assigned to the U.S. Pacific Fleet. The aircraft carrier USS Theodore Roosevelt is the group's current flagship. Other group units include Carrier Air Wing Seventeen, the Ticonderoga-class cruisers USS Bunker Hill and USS Cape St. George, and Destroyer Squadron 23.\\nThe strike group traces its history to Cruiser-Destroyer Group 3, created on 30 June 1973 by the re-designation of Cruiser Destroyer Flotilla 11. From 2004 the strike group has made multiple Middle East deployments providing air forces over Afghanistan and Iraq, as well as conducting Maritime Security Operations. The strike group received the Humanitarian Service Medal in recognition of its disaster relief efforts in Indonesia during Operation Unified Assistance in 2004–05."},{"page_url":"https://fr.wikipedia.org/wiki/Litt%C3%A9rature_n%C3%A9erlandaise_%C3%A0_partir_de_la_seconde_moiti%C3%A9_du_XXe_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Willem_Brakman_%281979%29.jpg","page_title":"Littérature néerlandaise à partir de la seconde moitié du XXe siècle","context_page_description":"Cet article traite de la littérature néerlandaise à partir de la seconde moitié du XXᵉ siècle."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_(%D0%91%D1%80%D0%BD%D0%BE)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Mahenovo_divadlo_2.jpg","page_title":"Национальный театр (Брно)","context_page_description":"Национальный театр в Брно — главное государственное театральное заведение в чешском городе Брно.\\nАдрес: Чехия, Брно, ул. Дворжакова."},{"page_url":"https://fr.wikipedia.org/wiki/Scarborough%E2%80%94Rouge_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Scarborough-Rouge_Park_in_relation_to_the_other_Toronto_ridings_%282015_boundaries%29.png","page_title":"Scarborough—Rouge Park","context_page_description":"Scarborough—Rouge Park est une circonscription électorale fédérale en Ontario."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Rochford_(district)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ashingdon%2C_Essex_-_St.Andrews_Church.jpg","page_title":"Grade II* listed buildings in Rochford (district)","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of Rochford in Essex."},{"page_url":"https://en.wikipedia.org/wiki/August_1989_lunar_eclipse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Lunar_eclipse_from_moon-1971Aug06.png","page_title":"August 1989 lunar eclipse","context_page_description":"A total lunar eclipse took place at 0308 UT on August 17, 1989, the second of two total lunar eclipses in 1989.\\nThe moon passed through the center of the Earth's shadow."},{"page_url":"https://cs.wikipedia.org/wiki/Moravsk%C3%A1_Nov%C3%A1_Ves","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Moravsk%C3%A1_Nov%C3%A1_Ves%2C_k%C5%99i%C5%BEovatka.jpg","page_title":"Moravská Nová Ves","context_page_description":"Moravská Nová Ves je městys v okrese Břeclav v Jihomoravském kraji, 11 km severovýchodně od Břeclavi. Žije zde přibližně 2 600 obyvatel."},{"page_url":"https://ro.wikipedia.org/wiki/Zoicene,_Blagoevgrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/General_view_of_Zoychene.JPG","page_title":"Zoicene, Blagoevgrad","context_page_description":"Zoicene este un sat în comuna Petrici, regiunea Blagoevgrad, Bulgaria."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%8B%E7%AB%8B%E5%93%A1%E6%9E%97%E9%AB%98%E7%B4%9A%E4%B8%AD%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%E5%9C%8B%E7%AB%8B%E5%93%A1%E6%9E%97%E9%AB%98%E4%B8%AD.jpg","page_title":"國立員林高級中學","context_page_description":"國立員林高級中學，簡稱員林高中、員中、員高，舊稱省員中，為一所位於臺灣彰化縣員林市的國立普通型高級中等學校。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E4%BA%91%E5%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/20191007%E5%A8%81%E5%B0%BC%E6%96%AF%E5%95%86%E4%BA%BA%E6%99%9A%E5%A0%B4_%EF%BC%887%EF%BC%89.jpg","page_title":"阿云嘎","context_page_description":"阿云嘎，蒙古族，中国内地男歌手及演员。毕业于北京舞蹈学院音乐剧系。2012年，凭借音乐剧《天桥》成为北京歌舞剧院独唱演员。2013年起，先后参加《快乐男声》、《超级先生》、《中国正在听》等选秀节目，从而被大众所熟知。2016年，首次登上央视春晚舞台，并于同年发行首张个人专辑《希拉草原》。2018年，以演唱成员身份参加湖南卫视《声入人心》第一季，最终获得年度首席。2019年，与鞠红川、郑云龙、蔡程昱组团参加《歌手2019》，获得最终的季军；同年，他还参加东方卫视《我们的歌》，与费玉清共同获得总亚军。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AA%E3%83%BC%E3%83%B3%E3%83%BB%E3%82%A8%E3%83%B3%E3%82%B5%E3%82%A4%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Naval_flags_of_the_World_1783_%28small%29.jpg","page_title":"グリーン・エンサイン","context_page_description":"グリーン・エンサインは17世紀～20世紀初頭まで、アイルランドの商用船で掲げられていた歴史上の旗である。この旗にはアイルランドを象徴する緑地に黄金のハープが描かれており、イングランドの国旗もしくはユニオンジャックを含んだカントンで構成されている。\\nこの旗は、歴史上の旗一覧表によく登場している。以下に例を挙げると:\\n1685年 Downham's Flag Chart\\n1700年 Len's Flag Chart\\n1772年 French Encyclopédie\\n1783年 Bowles's Universal Display of the Naval Flags of all Nations\\n1799年 Flags of all Nations\\n1848年 Flaggen Aller Seefahrenden Nationen\\n1889年 Drawings of Flags of All Nations - British Admiralty\\n1917年 National Geographic Flag Book\\nこの旗は、ブリテン諸島の間で何らかの地方における公式旗としての性格を有していたか、いくつかの商用船のみに用いられていた非公式の旗に留まっているのか、今日でも議論の的となっている。"},{"page_url":"https://de.wikipedia.org/wiki/Luo_Han_Guo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Luohanguo-open.jpg","page_title":"Luo Han Guo","context_page_description":"Luo Han Guo, auch Mönchsfrucht genannt, ist eine Pflanzenart aus der Gattung Siraitia in der Familie der Kürbisgewächse. Sie wird wegen ihrer extrem süßen Frucht in China kultiviert, sie dient als natürlicher Süßstoff sowie als Heilmittel in der Traditionellen chinesischen Medizin, dort wird chinesisch 羅漢果 / 罗汉果, Pinyin luóhàn guǒ, auch Luahanguo, Luo Han Kao oder Lo Han Kao, Lo-Han-Kuo genannt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Warstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ehrenmal_in_Belecke.jpg","page_title":"Liste der Baudenkmäler in Warstein","context_page_description":"Die Liste der Baudenkmäler in Warstein enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Warstein im Kreis Soest in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Warstein eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://es.wikipedia.org/wiki/Ladri_di_biciclette","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Vittorio_De_Sica.png","page_title":"Ladri di biciclette","context_page_description":"Ladri di biciclette ​ es una película italiana dramática de 1948 dirigida por Vittorio de Sica. Se considera como una de las películas emblemáticas del neorrealismo italiano. En 1954, la revista Sight and Sound publicó su primera lista de las \\"diez mejores películas jamás hechas\\", Ladri di biciclette estaba en primer lugar en esa lista.​ En 1962 fue puesta en el séptimo en la misma lista.​ Ocupa uno de los primeros diez puestos en la lista de \\"Las 50 películas que deberías ver a los 14 años\\".\\nLa película está basada en la novela homónima escrita por Luigi Bartolini en 1945 y adaptada a la gran pantalla por Cesare Zavattini.​ El relato narra un accidente de la vida cotidiana de un trabajador. Este accidente consiste en el robo de la bicicleta con la que va a trabajar. Este acto sería banal si no se tuviera en cuenta el contexto de la sociedad italiana de 1948 en que se sitúa la película. La elección de la bicicleta como objeto clave del drama es característico de las costumbres urbanas italianas, y a la vez, de una época en la que los medios de transporte mecánicos son todavía escasos y costosos."},{"page_url":"https://fr.wikipedia.org/wiki/Casselardit","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Casselardit_%28Toulouse%29%2C_le_chemin_de_la_Source_en_%C3%A9tat_de_v%C3%A9tust%C3%A9_%28novembre_1928%29.jpg","page_title":"Casselardit","context_page_description":"Casselardit est un quartier INSEE de Toulouse le long de la rive gauche de la Garonne face aux Amidonniers. Il est délimité à l'ouest par le quartier de Purpan, à l'est par la Patte d'Oie et au sud par La Cépière. Il est desservi par le tram à la station du même nom."},{"page_url":"https://sv.wikipedia.org/wiki/Minnets_envishet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ses_Buquelles_a_Portlligat.jpg","page_title":"Minnets envishet","context_page_description":"Minnets envishet, alternativt Minnets beständighet, är en oljemålning utförd av den katalanska bildkonstnären Salvador Dalí. Målningen färdigställdes 1931 och är ett av Dalis mest berömda konstverk.\\nPå svenska är den främst känd under översättningarna Minnets envishet eller Minnets beständighet, medan den på andra språk ibland är känd som \\"De galna/smältande/mjuka klockorna\\" efter bildens huvudmotiv. Tavlan ägs av Museum of Modern Art i New York."},{"page_url":"https://es.wikipedia.org/wiki/Cucurbita_pepo,_C._maxima,_C._moschata,_C._argyrosperma","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Cucurbita_argyrosperma_%22Cushaw%22_Calabaza_rayada_o_cordobesa_semiller%C3%ADa_Florensa_-_seeds.JPG","page_title":"Cucurbita pepo, C. maxima, C. moschata, C. argyrosperma","context_page_description":"Los zapallos, zapallitos, ayotes, auyamas, pipianes, calabazas, calabacines... son los frutos maduros o inmaduros de variedades domesticadas de cuatro especies afines del género Cucurbita: Cucurbita pepo, Cucurbita moschata, Cucurbita maxima, y Cucurbita argyrosperma en una época​ conocida como Cucurbita mixta; las especies biológicas no hibridan entre sí pero sus frutos poseen usos culinarios indistinguibles​, ​ y si bien sus nichos ecológicos no se solapan completamente, ​ se suelen describir en conjunto debido a que en líneas generales su biología y cultivo son similares. Al mismo género Cucurbita pertenece una quinta especie domesticada​​ que evolutivamente está un poco alejada de estas, ​ Cucurbita ficifolia, de un sabor distintivo y usos culinarios diferentes de las anteriores, ​ cultivada en las grandes alturas montañosas tropicales de clima fresco, ​ que aquí no será tratada.\\nSon plantas de hábito anual en climas estacionales, es decir la planta adulta no forma órganos reservantes y posee la estrategia ecológica de sobrevivir la época desfavorable estacional como semilla, y están adaptadas a ambientes mesofíticos -con niveles medios de temperatura y humedad-.​"},{"page_url":"https://nl.wikipedia.org/wiki/Vesuvio_(trein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Rimessa_ferroviaria_pistoia_64.jpg","page_title":"Vesuvio (trein)","context_page_description":"De Vesuvio was een binnenlandse Italiaanse sneltrein voor de verbinding Milaan - Napels. De Vesuvio is vernoemd naar de bij Napels gelegen vulkaan Vesuvius."},{"page_url":"https://en.wikipedia.org/wiki/Svea_Life_Guards","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/AM.094499_%2802%29.jpg","page_title":"Svea Life Guards","context_page_description":"The Svea Life Guards, also I 1, was a Swedish Army infantry regiment that was active in various forms 1521–2000. The unit was based in the Stockholm Garrison in Stockholm and belonged to the King's Life and Household Troops until 1974."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%83%D0%BC%D0%B5%D0%BD_(%D0%9F%D1%96%D0%B2%D0%B4%D0%B5%D0%BD%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D1%96%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Bowman%2C_SC_Town_Hall.jpg","page_title":"Баумен (Південна Кароліна)","context_page_description":"Баумен — місто в США, в окрузі Оранджберг штату Південна Кароліна. Населення — 968 осіб."},{"page_url":"https://pl.wikipedia.org/wiki/Shoreditch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Shoreditch_town_hall3.jpg","page_title":"Shoreditch","context_page_description":"Shoreditch – rejon w południowej części gminy London Borough of Hackney w Wielkim Londynie położony w centralno-północnej części regionu. Jest położony blisko centrum Londynu, 4 km od Charing Cross. Rejon ten jest popularny wśród firm informatycznych i programistycznych, znajdują się tam siedziby takich firm jak Last.fm, Songkick oraz Moo.\\nZnajduje się tu również stacja Shoreditch High Street, będąca na granicy gmin Hackney i Tower Hamlets."},{"page_url":"https://ro.wikipedia.org/wiki/Chitray","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Chitray_%28Indre%29.JPG","page_title":"Chitray","context_page_description":"Chitray este o comună în departamentul Indre, Franța. În 2009 avea o populație de 163 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/American_Fork,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Harrington_Elementary_School_American_Fork_Utah.jpeg","page_title":"American Fork, Utah","context_page_description":"American Fork is a city in north-central Utah County, Utah, United States, at the foot of Mount Timpanogos in the Wasatch Range, north of Utah Lake. It is part of the Provo–Orem Metropolitan Statistical Area. The population was 33,161 in 2019, representing a nearly 20% growth since the 2000 census. The city has grown rapidly since the 1970s."},{"page_url":"https://es.wikipedia.org/wiki/Cabris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Blason_ville_fr_Cabris_06.svg","page_title":"Cabris","context_page_description":"Cabris es una población y comuna francesa, en la región de Provenza-Alpes-Costa Azul, departamento de Alpes Marítimos, en el distrito de Grasse y cantón de Saint-Vallier-de-Thiey."},{"page_url":"https://pt.wikipedia.org/wiki/Foguete_de_combust%C3%ADvel_s%C3%B3lido","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/SolidRocketMotor.svg","page_title":"Foguete de combustível sólido","context_page_description":"Um foguete ou foguetão de combustível sólido é um foguete com um motor que usa um propulsor sólido. Os primeiros foguetes usavam este combustível, que funciona com pólvora, usado pelos chineses nas guerras do século XIII. Todos os foguetes usaram alguma forma de propelente sólido ou enchimento sólido até o século XX, quando o foguete de combustível líquido e o foguete de combustível híbrido ofereceram mais eficiência e alternativas controláveis. Os foguetes sólidos ainda são usados no modelismo de foguetes e em grandes aplicações por sua simplicidade e confiabilidade.\\nOs foguetes de combustível sólido não são estranhos na exploração espacial moderna, mas como podem permanecer armazenados durante grandes períodos - e logo lançados sem problemas e com pouca preparação - frequentemente tem sido usados em aplicações militares tais como os mísseis. Os foguetes de combustível sólido geralmente não são utilizados como propulsor principal na astronáutica moderna de exploração espacial, pois o combustível líquido possui desempenho superior. No entanto, é muito comum sua utilização como foguetes \\"reforçadores\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Galliwasps","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Diploglossus_lessonae_1.jpg","page_title":"Galliwasps","context_page_description":"Galliwasps zijn een geslacht van hagedissen die behoren tot de familie Diploglossidae."},{"page_url":"https://en.wikipedia.org/wiki/Tony_Hawk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Tony_Hawk_and_Lhotse_Merriam_by_David_Shankbone.jpg","page_title":"Tony Hawk","context_page_description":"Anthony Frank Hawk, nicknamed Birdman, is an American professional skateboarder, entrepreneur, and the owner of the skateboard company Birdhouse. Hawk completed the first documented \\"900\\", licensed a video game series published by Activision, and is a pioneer of modern vertical skateboarding.\\nIn 2002, he created the \\"Boom Boom HuckJam\\", an extreme sports exhibition and tour that was launched in Las Vegas. Hawk has appeared in films, other media, and his own series of video games. He has also been involved in various philanthropic activities, including his own Tony Hawk Foundation that helps to build skate parks in underprivileged areas. In 2014, Hawk was named one of the most influential skateboarders of all time by FoxWeekly."},{"page_url":"https://de.wikipedia.org/wiki/Karl_Rohn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Karl_Friedrich_Wilhelm_Rohn.jpeg","page_title":"Karl Rohn","context_page_description":"Karl Friedrich Wilhelm Rohn war ein deutscher Mathematiker, der sich mit Geometrie beschäftigte."},{"page_url":"https://it.wikipedia.org/wiki/Segretario_di_Stato_per_l%27India","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/George_Douglas_Campbell%2C_8th_Duke_of_Argyll_by_George_Frederic_Watts.jpg","page_title":"Segretario di Stato per l'India","context_page_description":"Il segretario di Stato per l'India, o segretario d'India, fu il ministro del gabinetto del governo britannico responsabile del governo dell'India e della direzione della politica nella colonia. L'incarico venne creato nel 1858 quando terminò il governo della Compagnia delle Indie Orientali in India e iniziò il governo britannico diretto sotto l'amministrazione di Londra.\\nNel 1935, a seguito del Government of India Act 1935, venne creato un nuovo incarico per la Birmania in preparazione a stabilire in Birmania una nuova colonia separata, ma la segreteria di stato venne mantenuta dallo stesso segretario di stato indiano che ottenne quindi l'appellativo di \\"segretario di Stato per l'India e la Birmania\\". Entrambe le competenze vennero abolite nel 1947 quando l'India ottenne la propria indipendenza."},{"page_url":"https://bs.wikipedia.org/wiki/Konji%C5%A1ka_vas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Konji%C5%A1ka_vas_kapela_02.jpg","page_title":"Konjiška vas","context_page_description":"Konjiška vas je naseljeno mjesto u sastavu općine Slovenske Konjice, regija Savinjska, Slovenija."},{"page_url":"https://de.wikipedia.org/wiki/Dorotheergasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Dorotheergasse_09.JPG","page_title":"Dorotheergasse","context_page_description":"Die Dorotheergasse befindet sich im 1. Wiener Gemeindebezirk, der Inneren Stadt. Sie ist nach dem 1414–1786 hier gelegenen Augustiner-Chorherrenstift St. Dorothea benannt."},{"page_url":"https://it.wikipedia.org/wiki/Tvaro%C5%BEn%C3%A1_(Repubblica_Ceca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Tvarozna_kostel.jpg","page_title":"Tvarožná (Repubblica Ceca)","context_page_description":"Tvarožná è un comune della Repubblica Ceca facente parte del distretto di Brno-venkov, in Moravia Meridionale."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_w_Sarnach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Sarny9.JPG","page_title":"Pałac w Sarnach","context_page_description":"Pałac w Sarnach – powstał w 1661 r. w Sarnach z przebudowy renesansowego dworu, dokonanej przez von Götzenów."},{"page_url":"https://pl.wikipedia.org/wiki/Svetozar_Mileti%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Nmilitics1.jpg","page_title":"Svetozar Miletić","context_page_description":"Svetozar Miletić – wieś w Serbii, w Wojwodinie, w okręgu zachodniobackim, w mieście Sombor. W 2011 roku liczyła 2746 mieszkańców."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BC%D1%83%D1%82%D0%B8%D0%BD%D0%BD%D1%96%D0%BA_%D0%92%D1%96%D1%82%D0%B0%D0%BB%D1%96%D0%B9_%D0%AE%D1%80%D1%96%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/%D0%97%D1%83%D1%81%D1%82%D1%80%D1%96%D1%87_%D0%97%D0%B5%D0%BB%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B7_%D0%BA%D0%B5%D1%80%D1%96%D0%B2%D0%BD%D0%B8%D1%86%D1%82%D0%B2%D0%BE%D0%BC_%D0%92%D0%A0%D0%A3%2C_13.jpg","page_title":"Хомутиннік Віталій Юрійович","context_page_description":"Віта́лій Ю́рійович Хомути́ннік — український підприємець, політик, співголова депутатської групи «Відродження». Колишній член Партії Регіонів, був одним з депутатів, що голосував за «Диктаторські закони» у січні 2014 року. Власник радіостанції «Любимое радио», страхової компанії Брокбізнес та опосередковано власник журналу Фокус."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CF%89%CF%82_%CF%84%CE%BF%CF%85_%CE%9A%CE%B9%CE%AD%CE%B2%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Maket_Sofii.JPG","page_title":"Ρως του Κιέβου","context_page_description":"Το μεσαιωνικό Κράτος των Ρως ή Ρως του Κιέβου ή Κιεβινή Ρωσία ή Ρωσία του Κιέβου ή Κράτος του Κιέβου ή Κιεβική Ρωσία ήταν μια χαλαρή ομοσπονδία ανατολικών σλαβικών φυλών στην Ευρώπη από τα τέλη του 9ου μέχρι τα μέσα του 13ου αιώνα, υπό τη βασιλεία των Ρουρικιδών. Οι σύγχρονοι λαοί της Λευκορωσίας, της Ουκρανίας και της Ρωσίας διεκδικούν τους Ρως ως πολιτιστικούς τους προγόνους.\\nΚατά τη μέγιστη επέκτασή του στα μέσα του 11ου αιώνα απλωνόταν από τη Βαλτική Θάλασσα στο βορρά μέχρι τη Μαύρη Θάλασσα στο νότο, και από τις πηγές του Βιστούλα στα δυτικά μέχρι τη χερσόνησο Ταμάν στα ανατολικά, συνενώνοντας την πλειοψηφία των ανατολικών σλαβικών φυλών.\\nΤο Κράτος των Ρως αρχίζει με τη βασιλεία του Πρίγκηπα Ολέγκ, που επεξέτεινε τον έλεγχό του από το Νόβγκοροντ νότια κατά μήκος της κοιλάδας του ποταμού Δνείπερου για να προστατεύσει το εμπόριο από τις εξ ανατολών επιδρομές των Χαζάρων, και μετέφερε την πρωτεύουσα στο στρατηγικότερο Κίεβο. Ο Σβιατοσλάβ A΄ πέτυχε την πρώτη μεγάλη επέκταση του εδαφικού ελέγχου των Ρως, διεξάγοντας έναν πόλεμο άλωσης της Αυτοκρατορίας των Χαζάρων."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%91%82%E8%82%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Luechow_marktplatz_4033.jpg","page_title":"呂肖","context_page_description":"文德蘭地區呂肖，通稱呂肖，是德國的城鎮，位於該國北部，由下薩克森州負責管轄，距離薩爾茨韋德爾13公里，面積89平方公里，海拔高度18米，2011年人口9,325，人口密度每平方公里105人。"},{"page_url":"https://en.wikipedia.org/wiki/Bouchraya_Hammoudi_Bayoun","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Buchraya_Hamudi_Bayun.png","page_title":"Bouchraya Hammoudi Bayoun","context_page_description":"Bouchraya Hammoudi Bayoun is the Polisario Front representative to Algeria, with a base in Algiers. He has been Prime Minister of the Sahrawi Arab Democratic Republic twice."},{"page_url":"https://fr.wikipedia.org/wiki/Star_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e,_2016)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Jude_Demorest_2019_by_Glenn_Francis.jpg","page_title":"Star (série télévisée, 2016)","context_page_description":"Star est une série télévisée américaine en 48 épisodes d'environ 43 minutes créée par Lee Daniels et Tom Donaghy, diffusée entre le 14 décembre 2016 et le 8 mai 2019 sur le réseau Fox.\\nAu Canada et au Québec, elle a été diffusée entre le 6 janvier 2017 et le 9 mai 2019 sur le service Netflix en version originale sous-titrée. En France, elle est diffusée dans les régions d'Outre-mer depuis le 11 mars 2018 sur La Première et en France métropolitaine entre le 1ᵉʳ février 2019 et le 9 juillet 2020 sur le service Fox Play. Elle reste pour le moment inédite en Belgique et en Suisse."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%B7%E5%9B%BD%E9%93%81%E8%B7%AF101%E5%9E%8B%E7%94%B5%E5%8A%9B%E6%9C%BA%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/101_070-1_Adler_Mannheim.jpg","page_title":"德国铁路101型电力机车","context_page_description":"德国铁路101型电力机车是德国铁路使用的一款高效多用途三相交流传动电力机车的型号。它们是在1990年代中期，作为当时运行已超过25年的103型电力机车的替代者，由Adtranz委托共计生产了145台。与此同时，101型机车也取代了103型机车成为德铁长途运输的法定牵引机车，并在日常的运营中得到证明；然而德国高速铁路交通的标志性车型却已由103型转变为ICE列车。\\n此外，来自美国新泽西公共交通公司的ALP-46型电力机车也是基于101型机车的平台制造，但其车体设计却是源自庞巴迪TRAXX。"},{"page_url":"https://pl.wikipedia.org/wiki/Nadanie_prawa_miejskiego_Gryficom_w_1262_r.","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Barnim_I.jpg","page_title":"Nadanie prawa miejskiego Gryficom w 1262 r.","context_page_description":"Nadanie prawa miejskiego Gryficom – akt nadania prawa miejskiego Nowemu miastu nad Regą na prawie lubeckim, wystawiony przez Warcisława III w 1262 r. nad Świną.\\nOryginał dokumentu nie zachował się do dziś. Treść jego znana jest z późniejszych odpisów, m.in. archiwów miasta, kroniki miejskiej oraz Kodeksu Friedricha von Dregera pod nazwą Euanescunt simul cum tempore. Zawiera informację o nadawcy prawa miejskiego, wyznaczonym zasadźcy, ilości nadanych i rozdzielonych ziem, przywilejów i zwolnień podatkowych oraz o osobach, którzy dokument poświadczyli. Akt ten umożliwiał również swobodny rozwój samorządności lokalnej i podejmowania częściowo samodzielnych decyzji w kwestiach gospodarczych, handlowych i usługowych miasta."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A6%96%E9%83%BD%E5%AE%A2%E9%81%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/678-FW_%E9%A6%96%E9%83%BD%E5%AE%A2%E9%81%8B_281%E8%B7%AF_%E7%BE%85%E6%9D%B1%E2%86%92%E4%BB%81%E5%B1%B1%E6%A4%8D%E7%89%A9%E5%9C%92_%E5%82%B3%E8%97%9D%E9%99%BD%E6%98%8E%E8%B7%AF%E5%8F%A3_20180110-1.jpg","page_title":"首都客運","context_page_description":"首都客运股份有限公司，简称：首都客运。创立于1976年7月1日，前身为“三重市公车”，现为台北首都客运集团 旗下之公司，主要经营新北市公车、台北市联营公车、宜兰县市区公车及国道客运路线。"},{"page_url":"https://pl.wikipedia.org/wiki/Nu%C3%9Fbaum_(Nadrenia-Palatynat)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Nu%C3%9Fbaum-Nahe01.jpg","page_title":"Nußbaum (Nadrenia-Palatynat)","context_page_description":"Nußbaum − miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Bad Kreuznach, wchodzi w skład gminy związkowej Bad Sobernheim."},{"page_url":"https://de.wikipedia.org/wiki/Freiseele","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Seele_entweicht.jpg","page_title":"Freiseele","context_page_description":"Als Freiseele bezeichnet die Religionswissenschaft und die Ethnologie die Vorstellung von einer Seele, die auch unabhängig vom biologischen Körper existieren kann. Sie hat je nach Lehre bereits vor der Entstehung des Körpers existiert oder nicht, und überlebt dessen Tod als Totenseele oder Schatten. In der Parapsychologie gibt es das verwandte Konzept der „Exkursionsseele“, die ihren Körper bereits zu Lebzeiten vorübergehend verlassen kann, während dieser in Trance, Ohnmacht oder Schlaf liegt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Greifswald","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Greifswald_Lange_Stra%C3%9Fe_69.jpg","page_title":"Liste der Baudenkmale in Greifswald","context_page_description":"In der Liste der Baudenkmale in Greifswald sind alle denkmalgeschützten Bauten der Hansestadt Greifswald und ihrer Ortsteile aufgeführt.\\nGrundlage dieser Zusammenstellung ist amtliche Denkmalliste der Hansestadt mit Stand vom 20. Juli 1995. Die folgende Tabelle enthält die Baudenkmale der Innenstadt, die Baudenkmale der äußeren Ortsteile siehe Liste der Baudenkmale in Greifswald aufgeführt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8_(%D0%9E%D0%B7%D0%B4%D0%BE%D0%BB%D0%B5%D0%BD%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%94%D0%B5%D0%B1%D0%B0%D1%80%D1%86%D0%B0_196.jpg","page_title":"Свети Георги (Оздолени)","context_page_description":"„Свети Георги“ е православна църква в охридското село Оздолени, Северна Македония. Църквата е под управлението на Дебърско-Кичевската епархия на Македонска православна църква.\\nЦърквата е гробищен храм, разположен западно от селото. В архитектурно отношение представлява еднокорабна сграда с почти квадратна основа, изградена от кършен камък и тухли. Типична е за постройките от XIV век. От оригиналната живопис са останали единствено фрагменти от лика на Йоан Златоуст в олтара. По-късно храмът е изписан наново."},{"page_url":"https://en.wikipedia.org/wiki/KFXL-TV","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/KFXL-TV_Fox_Nebraska_Logo.png","page_title":"KFXL-TV","context_page_description":"KFXL-TV, virtual channel 51, is a Fox-affiliated television station licensed to Lincoln, Nebraska, United States. The station is owned by the Sinclair Broadcast Group, as part of a duopoly with Kearney-licensed KHGI-TV, the ABC affiliate for the western portion of the Lincoln–Hastings–Kearney market. The two stations share studios on Nebraska Highway 44 in Axtell, about 14 miles south of Kearney, with a secondary studio and news bureau at the Conestoga Mall in Grand Island. KFXL-TV's transmitter is located on Yankee Hill Road in southeast Lincoln. Its main signal is simulcast on the digital subchannels of most of the KHGI/NTV network stations, bringing KFXL programming to the western half of the Lincoln–Hastings–Kearney market and parts of the North Platte market."},{"page_url":"https://de.wikipedia.org/wiki/Simca_Aronde","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Simca_Aronde_Oceane.jpg","page_title":"Simca Aronde","context_page_description":"Die Simca Aronde, anfangs als Simca 9 Aronde bezeichnet, war ein Mittelklassefahrzeug, das vom französischen Automobilhersteller Simca von 1951 bis 1964 hergestellt wurde. Der Wagen war das erste eigenständige Modell von Simca, da die Modelle davor Lizenzprodukte des italienischen Herstellers Fiat waren – der Simca 5/6 war ein Nachbau des Fiat 500 Topolino und der Simca 8 des Fiat 1100. Nach dem Zweiten Weltkrieg verzögerte sich die Entwicklung eines Nachfolgers des Fiat 1100, er war für Fiat weniger wichtig als der spätere Fiat 1400 und der Fiat Topolino. Simca entwickelte daher ein eigenes Modell, nur der Motor wurde übernommen. Der Vierzylinder-Reihenmotor mit 1,2 l Hubraum hatte eine dreifach gelagerte Kurbelwelle, seitliche Nockenwelle und hängende Ventile. Er leistete 45 PS bei 4600/min und gab ein maximales Drehmoment von 85 Nm bei einer Drehzahl von 2700/min ab. Über eine Einscheibentrockenkupplung, ein vollsynchronisiertes Vierganggetriebe mit Lenkradschaltung, einteilige Kardanwelle und einen hypoidverzahnten Achsantrieb wurde die Kraft auf die Hinterräder übertragen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%86%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Changshadragon.jpg","page_title":"تنين","context_page_description":"التنين هو كائن أسطوري ذو شكل أسطواني أو شبيه بالزواحف، ورد ذكره في الكثير من القصص والأساطير في ثقافات الشعوب بجميع أنحاء العالم. وله أجنحة وفي بعض الأساطير لا يملك أجنحة، ويقال في بعض الأساطير بأنه ينفث النار من فمه.أكثر التنانين شهرةً هو التنين الأوربي، المستمد قصته من مختلف القصص الشعبية الأوروبية، والتنين الشرقي، مثل التنين الصيني.\\nوتوجد بعض الزواحف التي تسمى بالتنين مثل تنين كومودو وسميَ بذلك لضخامته وطوله ولوجود الشبه بينه وبين التنانين الأسطورية، ويعتبر التنين من الوحوش التي أُلفت عنه القصص والأساطير وصنعت التماثيل له، ويوجد في مناطق الجنوب الصيني من يؤمن بوجود التنانين في معتقداتهم الدينية.\\nلقد قيل في الأساطير القديمة أن التنين كان رمز القوة فهو كان يتمتع بقوة لا حدود لها، وجلده صلب قادر على التحليق بسرعة بينما زمجرته تثير الرعب، وقد كان يلقب أبطال الكونغ فو في الصين بالتنانين"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_von_nationaler_Bedeutung_im_Kanton_Bern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/La_Neuveville_Bernerhaus.jpg","page_title":"Liste der Kulturgüter von nationaler Bedeutung im Kanton Bern","context_page_description":"Diese Liste enthält alle national bedeutenden Kulturgüter im Kanton Bern, die in der Ausgabe 2009 des Schweizerischen Inventars der Kulturgüter von nationaler und regionaler Bedeutung vermerkt sind. Sie ist nach politischen Gemeinden sortiert; enthalten sind 345 Einzelbauten, 43 Sammlungen, 30 archäologische Fundstellen und vier Spezialfälle."},{"page_url":"https://it.wikipedia.org/wiki/Forma_del_corpo_umano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gray242.png","page_title":"Forma del corpo umano","context_page_description":"La forma del corpo umano è il risultato dell'interazione di fenomeni complessi con funzioni particolari e sofisticate. La forma generale di una persona è definita principalmente dalla sua struttura scheletrica, così come dalla distribuzione di muscoli e grasso; la struttura ossea cresce a cambia fino a quando un essere umano non diventa adulto e rimane poi sostanzialmente invariata per il resto della sua vita."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Giuliano_(Vicenza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Vicenza_San_Giuliano_interno_altari_1.jpg","page_title":"Chiesa di San Giuliano (Vicenza)","context_page_description":"La chiesa di San Giuliano è un edificio religioso di Vicenza. Costruita su edifici precedenti negli ultimi anni del Seicento, è situata in corso Padova, 57. Vicino - e in comunicazione con essa - si trova l'Istituto Salvi, che occupa gli edifici del convento un tempo annesso alla chiesa."},{"page_url":"https://de.wikipedia.org/wiki/Augsburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Bears_in_Augsburg_Zoo.jpg","page_title":"Augsburg","context_page_description":"Augsburg ist eine kreisfreie Großstadt im Südwesten Bayerns und eine der drei bayerischen Metropolen. Sie ist Universitätsstadt und Sitz der Regierung des Bezirks Schwaben sowie des Landratsamtes des die Stadt im Westen umgebenden Landkreises Augsburg.\\nDie Stadt wurde 1909 zur Großstadt und ist mit über 300.000 Einwohnern nach München und Nürnberg die drittgrößte Stadt Bayerns. Der Ballungsraum Augsburg steht bezüglich Bevölkerung und Wirtschaftskraft in Bayern ebenfalls an dritter Stelle und ist Teil der Planungsregion Augsburg, in der etwa 885.000 Menschen leben. Augsburg hatte im Jahr 2017 die zweitgeringste Rate aller Straftaten unter den deutschen Großstädten über 200.000 Einwohnern.\\nDer Name der Stadt, die zu den ältesten in Deutschland gehört, geht auf das 15 v. Chr. gegründete römische Heerlager und die spätere römische Provinzhauptstadt Augusta Vindelicum zurück. Im 13. Jahrhundert löste sich die Stadt von der Bischofsherrschaft, wurde spätestens 1316 zur Reichsstadt und häufiger Schauplatz von Reichstagen mit engen Verbindungen zu den Herrschern des Heiligen Römischen Reiches, die unter anderem von den Kaufmannsfamilien Welser und Fugger finanziert wurden."},{"page_url":"https://sv.wikipedia.org/wiki/Colorado_Avalanche","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Gabriel_Landeskog_-_Colorado_Avalanche.jpg","page_title":"Colorado Avalanche","context_page_description":"Colorado Avalanche är en professionell ishockeyklubb baserad i Denver, Colorado, USA. Klubben tillhör Central Division i Western Conference i National Hockey League. Hemmaarenan är Pepsi Center. Deras general manager är Joe Sakic.\\nKlubben bildades 1972 som Quebec Nordiques och spelade då i WHA. Laget gick med i NHL 1979 efter en fusion mellan WHL och NHL. Efter säsongen 1994–95 såldes de till COMSAT Entertainment Group och flyttade till Denver.\\nUnder klubben första säsong i Denver vann Avalanche Pacific Division och lyckades besegra Florida Panthers i finalen 1996 och blev i och med detta det första NHL-laget som vunnit Stanley Cup under sin första säsong i ligan.\\nVid 2001 års Stanley Cup-final så vann Avalanche sitt andra mästerskap mot New Jersey Devils med 4–3 i matcher. Med den bedrift så är Avalanche det enda aktiva NHL-laget som vunnit alla finaler de spelat.\\nAvalanche har nio divisionstitlar och kvalificerade sig till slutspel vid de tio första säsongerna men den tog slut 2007."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AD%99%E6%80%9D%E6%A5%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Sun_Sinan-London_2012.JPG","page_title":"孙思楠","context_page_description":"孙思楠，辽宁营口人，中国女子曲棍球运动员，亦为中国国家女子曲棍球队成员。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B3%D8%AD%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Isaac.png","page_title":"إسحاق","context_page_description":"إسحاق. وهو أب نسب لبني إسرائيل وأحد البطاركة"},{"page_url":"https://de.wikipedia.org/wiki/Sistels","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Sistels_-_%C3%89glise_Saint-Laurent_-2.JPG","page_title":"Sistels","context_page_description":"Sistels ist eine französische Gemeinde im Département Tarn-et-Garonne in der Region Okzitanien. Die 214 Einwohner zählende Gemeinde liegt im Arrondissement Castelsarrasin und ist Teil des Kantons Garonne-Lomagne-Brulhois. Die Einwohner werden Sistellois genannt."},{"page_url":"https://nl.wikipedia.org/wiki/Heilder","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Heilder_Reethaus.jpg","page_title":"Heilder","context_page_description":"Heilder is een plaats in de Duitse gemeente Selfkant in de deelstaat Noordrijn-Westfalen. Het gehucht ligt ten noordoosten van Höngen, ervan gescheiden door de Saeffeler Bach. Ten oosten van Heilder ligt Saeffelen, gescheiden door de voormalige N-274, die van Koningsbosch naar Brunssum loopt. Heilder ligt op een paar 100 meter ten zuiden van de Nederlandse grens. In de omgeving ligt het natuurgebied Höngener und Saeffeler Bruch."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BA%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Early_razor_scooter_folded.jpg","page_title":"Самокат","context_page_description":"Самокат — средство передвижения, приводимое в движение путём отталкивания ногой от земли в положении стоя. Самокат используется не только в качестве персонального транспорта, но и для досуга, занятия спортом и физкультурой. Существуют несколько типов самокатов, отличающихся различными параметрами, но принцип движения остаётся неизменным. Изначально так называли велосипед."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%AF%E1%80%95%E1%80%BA%E1%80%85%E1%80%AF%E1%80%90%E1%80%B0%E1%80%A1%E1%80%86%E1%80%84%E1%80%B7%E1%80%BA%E1%80%90%E1%80%B0%E1%80%A1%E1%80%81%E1%80%BB%E1%80%84%E1%80%BA%E1%80%B8%E1%80%81%E1%80%BB%E1%80%84%E1%80%BA%E1%80%B8%E1%80%99%E1%80%BB%E1%80%AC%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/DHT_en.svg","page_title":"အုပ်စုတူအဆင့်တူအချင်းချင်းများ","context_page_description":"အုပ်စုတူအဆင့်တူအချင်းချင်း တွက်ချက်ခြင်း သို့မဟုတ် ကွန်ယက်ဆက်သွယ်ခြင်း သည် ဖြန့်ဝေထားပြီးဖြစ်သော အသုံးပြုခြင်းတည်ဆောက်ပုံဖြစ်သည်။ ၎င်းသည် အုပ်စုတူအဆင့်တူ များအကြား တာဝန်ဝတ္တရားများ သို့မဟုတ် အလုပ်ပမာဏခွဲဝေပိုင်းခြားခြင်းကို ပြုလုပ်သည်။ အသုံးပြုသူစွမ်းရည်တူညီသော ပါဝင်သူအုပ်စုတူအဆင့်တူများ တူညီစွာအကျိုးခံစားကြသည်။ ၎င်းတို့ကို ဆုံမှတ်များ၏ အုပ်စုတူအဆင့်တူအချင်းချင်း ကွန်ယက်တစ်ခုဖွဲ့စည်းမှုဆုံမှတ်ဟု ဆိုကြသည်။ အုပ်စုတူအဆင့်တူတို့သည် ၎င်းတို့၏ အရင်းအမြစ်များ၏အပိုင်းတစ်ခုကို ပြုလုပ်ကြသည်။\\n၎င်း တို့မှာ စွမ်းအင်အလုပ်လုပ်ခြင်း၊ disk သိမ်းဆည်းခြင်း သို့မဟုတ် ဆက်သွယ်ရေးကွန်ယက်အ ပေါ် အများဆုံးအချက်အလက်လွှဲပြောင်းပေးပို့နိုင်မှု ကွန်ယက် server များ သို့မဟုတ် အခြား ကွန်ပျူတာများအတွက် server တစ်ခုသဖွယ်ဆောင်ရွက်သည့် တည်ငြိမ်သော ကွန်ပျူတာများ အားဖြင့် ဗဟိုပူးပေါင်းဆောင်ရွက်ခြင်းအတွက် လိုအပ်ချက်မရှိပဲ အခြားကွန်ယက်တွင် ပါဝင်သူ များသို့ တိုက်ရိုက်ရရှိနိုင်သည်။အုပ်စုတူအဆင့်တူတို့သည် အရင်းအမြစ်ထောက်ပံ့ပေးသူ များနှင့် သုံးစွဲသူနှစ်မျိုးစလုံး ဖြစ်ကြသည်။ Server များကသာထောက်ပံ့ပြီး Client သုံးစွဲသည့်နေရာများရှိ သမားရိုးကျ Client server များ နှင့် မတူညီပါ။\\nNapster ကဲ့သို့သော ဖိုင်မျှဝေစနစ်အားဖြင့် အုပ်စုတူအဆင့်တူအချင်းချင်း အသုံးချခြင်း ပုံစံသည် လူသိများလာခဲ့သည်။"},{"page_url":"https://de.wikipedia.org/wiki/Franz_Stolze","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Portraitfoto_Franz_Stolze_1900.jpg","page_title":"Franz Stolze","context_page_description":"Franz Stolze war ein deutscher Erfinder, Photograph, Stenograph und Schriftsteller. Bekannt ist er vor allem als Entwickler einer ersten Gasturbine und photographischer Vermessungsmethoden."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D1%85%D0%B0%D0%BB%D0%B8%D1%98%D0%B0_%D0%8F%D0%B5%D0%BA%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Mahalia_Jackson_1962%2C_van_Vechten%2C_LC-USZ62-91314.jpg","page_title":"Махалија Џексон","context_page_description":"Махалија Џексон је била америчка црначка госпел пјевачица. Сматрана је најбољом у историји тог музичког жанра."},{"page_url":"https://fr.wikipedia.org/wiki/Veuve_noire","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Latrodectus_mactans_2.jpg","page_title":"Veuve noire","context_page_description":"Latrodectus mactans, la veuve noire d'Amérique du Nord, est une espèce d'araignées aranéomorphes de la famille des Theridiidae. Le nom veuve noire désigne également collectivement plusieurs autres espèces d'araignées du genre Latrodectus. Ces espèces occupent une place particulière dans l'imaginaire humain, en raison notamment du puissant venin de la femelle veuve noire et de sa pratique supposée du cannibalisme sexuel qui ont inspiré de nombreux auteurs.\\nEn dépit du folklore attaché à son nom, Latrodectus mactans ne fait pas partie des habituées du cannibalisme sexuel. La femelle dévore exceptionnellement le mâle lorsque les ressources nutritives du milieu sont quasi-nulles et le mâle parvient le plus souvent à s'échapper."},{"page_url":"https://es.wikipedia.org/wiki/Software","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Modelo_Cascada_Secuencial.jpg","page_title":"Software","context_page_description":"Se conoce como software​ o logicial al soporte lógico de un sistema informático, que comprende el conjunto de los componentes lógicos necesarios que hacen posible la realización de tareas específicas, en contraposición a los componentes físicos que son llamados hardware. La interacción entre el software y el hardware hace operativo un ordenador, es decir, el software envía instrucciones que el hardware ejecuta, haciendo posible su funcionamiento.\\nLos componentes lógicos incluyen, entre muchos otros, las aplicaciones informáticas, tales como el procesador de texto, que permite al usuario realizar todas las tareas concernientes a la edición de textos; el llamado software de sistema, tal como el sistema operativo, que básicamente permite al resto de los programas funcionar adecuadamente, facilitando también la interacción entre los componentes físicos y el resto de las aplicaciones, y proporcionando una interfaz con el usuario.​\\nEl software en su gran mayoría, está escrito en lenguajes de programación de alto nivel, ya que son más fáciles y eficientes para que los programadores los usen, porque son más cercanos al Lenguaje natural respecto del lenguaje de máquina.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BD%D1%8F%D1%87%D0%BD%D0%B5_%D0%B7%D0%B0%D1%82%D0%B5%D0%BC%D0%BD%D0%B5%D0%BD%D0%BD%D1%8F_4_%D1%81%D1%96%D1%87%D0%BD%D1%8F_1992_%D1%80%D0%BE%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/SE2003May31A.png","page_title":"Сонячне затемнення 4 січня 1992 року","context_page_description":"Сонячне затемнення 4 січня 1992 року — кільцеве сонячне затемнення, що спостерігалося на території тихоокеанських островів та західної частини Каліфорнії."},{"page_url":"https://da.wikipedia.org/wiki/S%C3%B8ren_Frandsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/S%C3%B8ren_Frandsen_3.jpg","page_title":"Søren Frandsen","context_page_description":"Søren Frandsen, som var søn af kunstmaler Frands Thorvald Frandsen og hustru Martha Frandsen Søren Frandsen var teatermaler, scenograf ved Det Kongelige Teater, i København hvor han var ansat fra 1947 til 1988. Fra 1966-85 var han kunstnerisk leder af den scenografiske afdeling. Igennem sin karriere lavede han scenografi til både skuespil, ballet, opera og også til revy. Nogle af hans dekorationer bruges fortsat og hans tegninger og malerier findes primært i privat eje, samt på Teatermuseet på Hofteatret. Blandt hans mest genkendelige arbejder er scenetæppet på Gamle Scene, på Det Kongelige Teater - Akropolistæppet, som han stod bag fornyelsen af, i 1950. og igen 1980.\\nHan flyttede, sammen med sin hustru Ulla Margrethe Frandsen, til Hareskovby i 1950 i det hus som de købte af teatermaleren Svend Andersen. Her voksede parrets 5 sønner op."},{"page_url":"https://ro.wikipedia.org/wiki/Saint-Amand-de-Belv%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Saint-Amand-de-Belv%C3%A8s_-_Eglise_Saint-Amand_-456.jpg","page_title":"Saint-Amand-de-Belvès","context_page_description":"Saint-Amand-de-Belvès este o comună în departamentul Dordogne din sud-vestul Franței. În 2009 avea o populație de 94 de locuitori."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_benda_buatan_manusia_di_Bulan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Moon_map_grid_showing_artificial_objects_on_moon.PNG","page_title":"Daftar benda buatan manusia di Bulan","context_page_description":"Berikut ini adalah tabel yang memperlihatkan daftar seluruh benda buatan manusia yang berada di permukaan Bulan."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3%D8%AA%D9%8A%D8%A7%D9%86_%D9%86%D9%8A%D9%84%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/KLM_Open_2010_009.JPG","page_title":"كريستيان نيلسون","context_page_description":"كريستيان نيلسون ‏ هو لاعب غولف سويدي، ولد في 25 مايو 1979 في كارلستاد في السويد."},{"page_url":"https://id.wikipedia.org/wiki/Subaru_Exiga","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Exiga20GT.jpg","page_title":"Subaru Exiga","context_page_description":"Subaru Exiga adalah mobil MPV berukuran sedang yang diproduksi oleh Subaru dari Fuji Heavy Industries, Japan mulai tahun 2008. Berbasis mobil konsep yang dipamerkan pada 2007 Tokyo Motor Show, Exiga merupakan MPV dengan 7 tempat duduk yang memiliki interior yang luas dan nyaman, serta pengendalian yang stabil.\\nExiga pertama kali diperkenalkan di Jepang, dan kemudian juga dijual di Singapore, Indonesia, dan khusus untuk pasar Australia diberi nama Subaru Liberty Exiga. Di negara-negara Asia, Exiga menggunakan mesin 2000 cc EJ20 normally aspirated dan turbo, sedangkan Liberty Exiga di Australia bermesin 2500 cc EJ25.\\nSeperti mobil Subaru lainnya, Exiga menggunakan mesin dengan konfigurasi Boxer. Exiga model dasar 2.0i tersedia dengan penggerak roda depan, sedangkan gerak 4WD Symmetrical All Wheel Drive merupakan standard untuk model 2.0GT and 2.5i, atau optional untuk model 2.0i.\\nMeskipun berbentuk MPV, Exiga juga berkarakter sporty. Jok depan yang rendah membuatnya nyaman dikendarai seperti mobil sedan sport, dan jok belakang diposisikan lebih tinggi seperti layaknya di bioskop."},{"page_url":"https://fr.wikipedia.org/wiki/Fibrillation_ventriculaire","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Lead_II_rhythm_generated_ventricular_fibrilation_VF.JPG","page_title":"Fibrillation ventriculaire","context_page_description":"La fibrillation ventriculaire est un trouble du rythme cardiaque correspondant à la contraction rapide, désorganisée et inefficace des ventricules cardiaques. Ce qui veut dire que le cœur ne bat plus comme d'habitude, il ne pompe plus, il tremble.\\nLors d'une FV, la perte de conscience est généralement immédiate. C'est une cause, sinon la principale cause d'arrêt cardiaque et de mort subite. Sans intervention médicale spécialisée, la mort survient en quelques minutes si aucun traitement n'est administré."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Eu%C3%9Fenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Eu%C3%9Fenheim%2C_Aschfeld%2C_Kirchenburg%2C_009.jpg","page_title":"Liste der Baudenkmäler in Eußenheim","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Gemeinde Eußenheim zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 111 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/List_of_reefs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Alacran_ESC_large_ISS006_ISS006-E-52094.jpg","page_title":"List of reefs","context_page_description":"This is an incomplete list of notable reefs."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D1%83%D0%B1%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/10000-rubles-Belarus-2000-b.jpg","page_title":"Белорусский рубль","context_page_description":"Белору́сский рубль — официальная денежная единица Белоруссии. Символ — Br. В обращении находятся банкноты номиналом 5, 10, 20, 50, 100, 200 и 500 рублей, а также монеты номиналом 1, 2, 5, 10, 20 и 50 копеек, 1 и 2 рубля."},{"page_url":"https://eo.wikipedia.org/wiki/%C3%89chevannes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Kirko_de_%C3%89chevannes.jpg","page_title":"Échevannes","context_page_description":"Échevannes estas franca komunumo lokita en la departemento de Côte-d'Or en regiono Burgonjo-Franĉkonteo."},{"page_url":"https://sh.wikipedia.org/wiki/Krummendeich","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Krummendeich_in_STD.png","page_title":"Krummendeich","context_page_description":"Krumendajh je opština u njemačkoj saveznoj državi Donja Saksonija. Jedno je od 40 opštinskih središta okruga Štade. Prema procjeni iz 2010. u opštini je živjelo 476 stanovnika. Posjeduje regionalnu šifru 3359030."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1991","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/2017_Boels_Ladies_Tour_6e_etappe_024b.jpg","page_title":"Lijst van personen geboren in 1991","context_page_description":"Dit is een lijst van personen die geboren zijn in 1991.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Dov_Lipman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%D7%93%D7%91_%D7%9C%D7%99%D7%A4%D7%9E%D7%9F.jpg","page_title":"Dov Lipman","context_page_description":"Dov Alan Lipman is an Israeli politician. He served as a member of the Knesset for Yesh Atid between 2013 and 2015."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%81%D1%82%D1%80%D0%BE%D1%80%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%BA%D1%83%D1%80%D0%B7%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%D0%9A%D1%83%D1%80%D0%B7%D0%B0%D0%BB_24.08.1907_%D0%B0%D1%84%D0%B8%D1%88%D0%B0.jpg","page_title":"Сестрорецкий курзал","context_page_description":"Сестрорецкий курзал — здание, находившееся на территории Сестрорецкого курорта. В нём располагались концертный зал, рассчитанный на 1500—1700 человек, огромный ресторан, библиотека, бильярдные и карточные комнаты, гостиные для отдыха и другие помещения. Сгорел в 1942 году при обстреле финской артиллерии."},{"page_url":"https://it.wikipedia.org/wiki/Alvito_(Italia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Topografonomastica_Alvito.jpg","page_title":"Alvito (Italia)","context_page_description":"Alvito è un comune italiano di 2 614 abitanti della provincia di Frosinone nel Lazio al confine con le regioni Abruzzo e Molise.\\nSituato nella valle di Comino, fa parte del parco nazionale d'Abruzzo, Lazio e Molise e della comunità montana Valle di Comino. Ha il titolo di città, in virtù sia del regio dispaccio del 1739 di Carlo VI sia del regio diploma del 1744 di Carlo III, come confermato con decreto del presidente della Repubblica Italiana del 4 giugno 1987."},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_M%C3%BCnchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/M%C3%BCnchen_Flughafen_Lage.png","page_title":"Flughafen München","context_page_description":"Der Flughafen München „Franz Josef Strauß“ ist der internationale Verkehrsflughafen der bayerischen Landeshauptstadt München und zählt mit rund 48 Millionen Passagieren zu den zehn verkehrsreichsten Luftfahrt-Drehkreuzen in Europa. Rund 100 Fluggesellschaften verbinden ihn mit über 200 Flugzielen in etwa 70 Ländern. Gemessen an der Zahl der Reisenden belegte er 2019 nach Frankfurt am Main den zweiten Platz in Deutschland und den neunten Platz in Europa. Als einziger Flughafen Europas hat der Flughafen München die Auszeichnung Skytrax 5-Star-Airport erhalten. Bei einer weltweiten Umfrage unter mehr als zwölf Millionen Passagieren wurde der Flughafen München auch 2020 wieder zum besten europäischen Flughafen gewählt, zum 13. Mal innerhalb der letzten 15 Jahre. Im weltweiten Vergleich belegt der Flughafen München bei den „World Airport Awards 2020“ den fünften Rang. Unter den Flughäfen mit einem jährlichen Passagieraufkommen zwischen 40 und 50 Millionen rangiert München auf Platz 1 der Weltrangliste.\\nBetreiber ist die Flughafen München GmbH mit dem Freistaat Bayern, der Bundesrepublik Deutschland und der Landeshauptstadt München als Gesellschafter."},{"page_url":"https://cs.wikipedia.org/wiki/Alfa_Romeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Alfa-Romeo_1900-Sprint.JPG","page_title":"Alfa Romeo","context_page_description":"Alfa Romeo je italský výrobce automobilů.\\nOd roku 1986 je Alfa Romeo členem Fiat SpA. Společnost se původně nazývala ALFA, což je akronym pro Anonima Lombarda Fabbrica Automobili. V roce 1915 získal podnikatel Nicola Romeo ve firmě většinový podíl a vedoucí pozici. V roce 1918 převzal celou firmu a jeho podniky se přejmenovaly na „Società Anonima Italiana Ing. Nicola Romeo“. A.L.F.A. se v roce 1920 přejmenovala na současný název Alfa Romeo."},{"page_url":"https://hsb.wikipedia.org/wiki/Kir%C5%BEa%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Coat_of_Arms_of_Kirzhach_%28Vladimirskaya_oblast%29.png","page_title":"Kiržač","context_page_description":"Kiržač je město w Ruskej federaciji. Leži w europskim dźělu Ruskeje we Wladimirskej oblasći. Ma něhdźe 27 tysac wobydlerjow.\\nSydlišćo je so w lěće 1332 załožiło a ma wot lěta 1778 měšćanske prawa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D1%80%D1%82_%D0%BD%D0%B0_%D0%BF%D0%B8%D0%BB%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/3_%D1%81%D0%BF%D0%BE%D1%80%D1%82_%D0%BD%D0%B0_%D0%BF%D0%B8%D0%BB%D0%BE%D0%BD%D0%B5_%2C%D0%92%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%B0%D1%8F_%D0%90%D1%82%D0%BB%D0%B5%D1%82%D0%B8%D0%BA%D0%B0_-%D0%A4%D0%92%D0%90%D0%A0.jpg","page_title":"Спорт на пилоне","context_page_description":"подст:проверить\\nСпорт на пилоне — спортивное направление, в котором воздушно-акробатические упражнения, выполняются под музыкальное сопровождение непосредственно на снарядах, либо с помощью снарядов, которые выполнены в виде одной или пары длинных вертикально установленной стальных труб. Этот снаряд может быть как статичным так и иметь функцию вращения вокруг своей оси.\\nПо состоянию ноябрь 2017, спорт на пилоне представлен в международных и национальных федерациях либо как отдельный вид спорта, либо как спортивная дисциплина входящая в вид спорта, например — Спорт на пилоне, является одной из дисциплин Воздушной Атлетики"},{"page_url":"https://ceb.wikipedia.org/wiki/R%C3%ADo_Pastaza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Ecuador_bridgeoverthePastazas2.JPG","page_title":"Río Pastaza","context_page_description":"Suba ang Río Pastaza sa Peru, sa ibabaw sa utlanan sa Igwador. Nahimutang ni sa amihanang bahin sa nasod, 800 km sa amihanan sa Lima ang ulohan sa nasod. Ang Río Pastaza mao ang bahin sa tubig-saluran sa Amazon River."},{"page_url":"https://ro.wikipedia.org/wiki/Siracourt","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Map_commune_FR_insee_code_62797.png","page_title":"Siracourt","context_page_description":"Siracourt este o comună în departamentul Pas-de-Calais, Franța. În 2009 avea o populație de 241 de locuitori."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_Hocke","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Jan_Hocke.jpg","page_title":"Jan Hocke","context_page_description":"Jan Hocke, byl český pedagog a kartograf."},{"page_url":"https://en.wikipedia.org/wiki/Mimic_poison_frog","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/R._imitator_Chazuta.jpg","page_title":"Mimic poison frog","context_page_description":"Ranitomeya imitator, is a species of poison dart frog found in the north-central region of eastern Peru. Its common names include mimic poison frog and poison arrow frog, and it is one of the best known dart frogs. It was discovered in the late 1980s by Rainer Schulte who later split it up into more subspecies; describing each as a specific color morph, and sometimes having a separate behavioral pattern. The acoustics, morphs, and behavior of the species have been extensively researched."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9E%D7%A9%D7%9C%D7%AA_%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Flickr_-_Government_Press_Office_%28GPO%29_-_PM_Benjamin_Netanyahu_giving_a_speech_at_the_Ramat_Gan_Diamond_Exchange.jpg","page_title":"ממשלת ישראל","context_page_description":"ממשלת ישראל היא הרשות המבצעת של מדינת ישראל. בראשה עומד ראש הממשלה, וחברים בה שרים, אשר בידי ראש הממשלה הסמכות למנותם ולפטרם. בידי ממשלת ישראל הסמכות ברוב ההיבטים הממלכתיים והציבוריים, והיא מייצגת את מדינת ישראל כלפי חוץ. מאז שנת 1968, מוסדרות בחירתה וכהונתה של הממשלה באמצעות חוק יסוד: הממשלה. השרים נושאים באחריות כלפי כל החלטות הממשלה ופעולותיה, והם אחראים להן, גם אם הן מנוגדות לדעתם.\\nבמשך שנים אחדות התקיימה בחירה ישירה לראשות הממשלה, מתוך מגמה לשנות את השיטה הפוליטית במדינת ישראל; אך מטעמים שונים היא לא צלחה ובוטלה. במרבית שנות המדינה מוטלת הקמת הממשלה על ידי נשיא המדינה על מי שהומלץ על ידי רוב חברי הכנסת והוא המיועד להיות ראש ממשלה. לצורך הקמת ממשלה נדרש המועמד לראשות הממשלה עליו הוטלה הקמת הממשלה, לקבל את אמון הכנסת, כלומר רוב רגיל בכנסת שמצביע בעד הממשלה. לפיכך, טבעי הדבר להקים קואליציה של מפלגות אחדות ולמנות את ראשי המפלגות לשרים, ובכך לקבל את אמון הכנסת. פעם אחת הוקמה ממשלה, שראשי המפלגות הגדולות בה כיהנו בה כראשי ממשלה ברוטציה. ב-2020, הוקמה ממשלת חילופים הכוללת 2 ראשי ממשלה המכהנים לסירוגין ואמורים להתחלף במועד שנקבע מראש.\\nהחל משנות ה-90 רוב הממשלות היו צרות באופן יחסי, אך כמה פעמים הוקמה ממשלת אחדות לאומית, שכללה חלק ניכר מסיעות הכנסת."},{"page_url":"https://hr.wikipedia.org/wiki/Prokarioti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Prokaryote_cell_diagram_international.svg","page_title":"Prokarioti","context_page_description":"Prokarioti, ranije Monera, su stanična živa bića jednostavne građe koja imaju staničnu stijenku i membranu ali nemaju staničnu jezgru ni organele, osim ribosoma. razvil isu se prije otprilike 2 milijarde i 100 milijuna godina.\\nU ovu skupinu organizama pripadaju bakterije i Archaea, dok su svi ostali, jednostanični ili višestanični organizmi, eukarioti. Takav tip stanice naziva se protocit.\\nU citoplazmi prokariotskih stanica DNK se nalazi slobodno kao jezgrin ekvivalent, nukleoid. U ovim stanicama najčešće se nalazi samo jedan jedini kromosom koji ne sadrži histoproteine kao stanice eukariota. Kromosom bakterija najčešće se sastoji od samo jedne zatvorene DNK molekule. Samo neki prokarioti sadrže linearne kromosome.\\nVeličina prokariota je između 0,2 i 700 µm.\\nSljedeća svojstva obilježavaju prokariote:\\nnemaju stanične organele kao na primjer mitohondrij, nemaju plastide ali prije svega, nemaju staničnu jezgru. Genom, DNK kao i polimeraze su slobodni u citoplazmi. Transkripcija i translacija kod biosinteze proteina odvijaju se u citoplazmi;\\nu usporedbi s eukariotima, imaju manje ribosome;"},{"page_url":"https://sv.wikipedia.org/wiki/Kristianopel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kristianopel_Blekinge.jpg","page_title":"Kristianopel","context_page_description":"Kristianopel är en småort i Kristianopels socken i Karlskrona kommun i Blekinge län. Kristianopel ligger på en sandig kustslätt längs östersjökusten.\\nUnder 1600-talet var Kristianopel stad. Kristianopel hade en stadsplan utformad efter moderna principer och var Nordens första renässansstad. Från denna tid är den 3 km långa stadsmuren med bastioner, uppförd 1603–1606 efter italienska förebilder. Den är bäst bibehållen på södra och västra sidan. Vidare finns det så kallade norra bålverket, på vilket nu står en väderkvarn."},{"page_url":"https://en.wikipedia.org/wiki/Bahia_Mahmud_Awah","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Bahia_Mahmud_Awah.JPG","page_title":"Bahia Mahmud Awah","context_page_description":"Bahia Mahmud Awah is a Sahrawi writer, poet and journalist. He is a founding member of the group of writers known as the \\"Sahrawi Friendship Generation\\"."},{"page_url":"https://de.wikipedia.org/wiki/Steuler","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Steuler_tuerme.jpg","page_title":"Steuler","context_page_description":"Steuler ist ein deutsches Unternehmen. Hauptsitz ist Höhr-Grenzhausen im Westerwald.\\nSteuler ist eine Unternehmensgruppe mit Tochtergesellschaften, die sich mit Industriellem Korrosionsschutz, Anlagenbau/Umwelttechnik und Fliesen spezialisiert hat. Die Gruppe entwickelt, produziert und installiert korrosionsbeständige und feuerfeste Werkstoffe sowie Auskleidungstechnologien für die Chemische Industrie, in Metallgewinnungsanlagen, in Kraftwerken und Sonderabfall-Verbrennungsanlagen sowie der Eisen- und Stahlindustrie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Guntersblum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Guntersblum-_Kellerweg_%28bei_Kellerwegfest%29_18.8.2012.JPG","page_title":"Liste der Kulturdenkmäler in Guntersblum","context_page_description":"In der Liste der Kulturdenkmäler in Guntersblum sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Guntersblum aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://it.wikipedia.org/wiki/Olof_August_Danielsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Olof_August_Danielsson_SPG.jpg","page_title":"Olof August Danielsson","context_page_description":"Olof August Danielsson è stato un filologo classico, linguista ed etruscologo svedese."},{"page_url":"https://ast.wikipedia.org/wiki/Temporada_1968_de_F%C3%B3rmula_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/HillGraham1969Aug.jpg","page_title":"Temporada 1968 de Fórmula 1","context_page_description":"Resume de la temporada 1968 de la Fórmula 1, na cual el británicu Graham Hill llogró'l so segundu títulu de campeonatu."},{"page_url":"https://en.wikipedia.org/wiki/Jazz_Standard","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Alex_Blake_photo_2.jpg","page_title":"Jazz Standard","context_page_description":"Jazz Standard is a jazz club located at 116 East 27th Street in the Rose Hill neighborhood of Manhattan, New York City. It frequently hosts well-known bands and musicians. The club is owned by restaurateur Danny Meyer and is located in the basement of one of his Blue Smoke restaurants.\\nThe Mingus Big Band, the Mingus Orchestra, and Mingus Dynasty rotate every Monday night as the club's de facto house bands. The former won the 2011 Grammy Award for Best Large Jazz Ensemble Album for their album Mingus Big Band Live at Jazz Standard. The Maria Schneider Jazz Orchestra has played a week-long gig at the club every Thanksgiving since 2005.\\nThe magazine New York lists the club as a ″top 5 jazz joint″. The New York City Jazz Record named Jazz Standard the \\"venue of the year\\" 2017."},{"page_url":"https://en.wikipedia.org/wiki/Tzitzimitl","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Tzitzimitl.jpg","page_title":"Tzitzimitl","context_page_description":"In Aztec mythology, a Tzitzimitl is a monstrous deity associated with stars. They were depicted as skeletal female figures wearing skirts often with skull and crossbone designs. In Postconquest descriptions they are often described as \\"demons\\" or \\"devils\\" - but this does not necessarily reflect their function in the prehispanic belief system of the Aztecs.\\nThe Tzitzimimeh were female deities, and as such related to fertility, they were associated with the Cihuateteo and other female deities such as Tlaltecuhtli, Coatlicue, Citlalicue and Cihuacoatl and they were worshipped by midwives and parturient women. The leader of the tzitzimimeh was the goddess Itzpapalotl who was the ruler of Tamoanchan - the paradise where the Tzitzimimeh resided.\\nThe Tzitzimimeh were also associated with the stars and especially the stars that can be seen around the Sun during a solar eclipse. This was interpreted as the Tzitzimimeh attacking the Sun, thus causing the belief that during a solar eclipse, the tzitzimime would descend to the earth and possess men."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%B4%D0%BD%D1%8F_(%D0%9D%D0%BE%D0%B2%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Rudnya_%28Novyna%29_07.JPG","page_title":"Рудня (Новинский сельский совет)","context_page_description":"Рудня — село на Украине, основано в 1930 году, находится в Коростенском районе Житомирской области. До 29.06.1960 — Рудня-Барановская.\\nКод КОАТУУ — 1822384105. Население по переписи 2001 года составляло 45 человек, по состоянию на 2017 год — 3 человека, на конец 2018 года — 1 человек. Почтовый индекс — 11571. Телефонный код — 4142. Занимает площадь 0,462 км²."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D9%8A%D8%B3%D8%AA%D9%88%D9%84_%D8%B3%D8%A7%D9%8A%D8%AF%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Orpheus_turbojet_engine.JPG","page_title":"بريستول سايدلي","context_page_description":"بريستول سايدلي ‏ أو محركات بريستول سايدلي المحدودة هي شركة بريطانية سابقة، مصنعة للمحركات الجوية، ويقع مقرها في بريستول، المملكة المتحدة.. تشكلت الشركة في عام 1959، بعد اندماج شركة بريستول للمحركات الجوية المحدودة وشركة ارمسترونغ سايدلي موتورز المحدودة. وفي عام 1961 تم توسيع الشركة بعد أن تم شراء شركة دي هافيلاند للمحركات وقسم المحركات في شركة بلاكبيرن للطائرات. وفي عام 1968 تم شراء بريستول سايدلي من قبل شركة رولز رويس المحدودة."},{"page_url":"https://cy.wikipedia.org/wiki/Ocsitania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/J%C3%A9r%C3%B4me_Ferrer.jpg","page_title":"Ocsitania","context_page_description":"Gwlad hanesyddol ac endid ieithyddol-ddiwylliannol ydy Ocsitania, sydd heddiw yn y rhan honno o Ffrainc a elwir yn Profens, rhannau o'r Eidal, rhannau o Sbaen a rhan o Fonaco. Yn answyddogol, gelwir yr ardaloedd hyn yn Ocsitania. Yn aml, yn yr Ocsitaneg, gelwir yr ardal yn lo país, h.y. 'y wlad', neu lo País d'Òc h.y. 'gwlad yr Oc'.\\nYstyriwyd hi'n endid ieithyddol-diwylliannol ers yr Oesoedd Canol, ond nid yw wedi bod yn endid statudol, gyfreithiol. Mae'r Ocsitaneg, fodd bynnag, yn iaith swyddogol yng Nghatalwnia. Yn oes y Rhufeiniaid, roedd yn wlad unedig, a gelwid hi gan y Rhufeinwyr yn Septem Provinciæ ac felly hefyd yn yr Oesoedd Canol pan galwyd hi'n Aquitanica gan y Fisigothiaid cyn i'r Ffrancwyr gychwyn ei choncro yn niwedd y 13g."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A0%D7%97%D7%9D_%D7%A9%D7%99%D7%96%D7%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Flickr_-_Government_Press_Office_%28GPO%29_-_P.M_Ariel_Sharon_meeting_with_representatives_of_the_Homosexual_and_Lesbian_community.jpg","page_title":"מנחם שיזף","context_page_description":"מנחם שיזף היה עיתונאי, עורך דין, יועץ תקשורת, לוביסט, סוציאליסט ואקטיביסט ישראלי שכיהן כיושב ראש אגודת הלהט\\"ב בשנים 1997 – 1999. כמו כן היה ליועץ התקשורת של הנשיא עזר ויצמן. על פועלו זכה לאות מפעל חיים מעיריית תל אביב ולאות יקיר אגודת הלהט\\"ב על תרומתו רבת השנים."},{"page_url":"https://gl.wikipedia.org/wiki/Diavolskoto_Geurlo","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/DevilsThroathCave.jpg","page_title":"Diavolskoto Geurlo","context_page_description":"Diavolskoto Geurlo é unha cova que se atopa no oeste das Montañas Ródope, preto da vila de Gyovren, en Bulgaria. Está preto da fronteira con Grecia. É unha popular atracción turística da zona."},{"page_url":"https://es.wikipedia.org/wiki/Bitry_(Ni%C3%A8vre)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Map_commune_FR_insee_code_58033.png","page_title":"Bitry (Nièvre)","context_page_description":"Bitry es una población y comuna francesa, situada en la región de Borgoña, departamento de Nièvre, en el distrito de Cosne-Cours-sur-Loire y cantón de Saint-Amand-en-Puisaye."},{"page_url":"https://it.wikipedia.org/wiki/Ab%C3%A9ch%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/La_grande_place_d%27Ab%C3%A9ch%C3%A9.jpg","page_title":"Abéché","context_page_description":"Abéché è la quarta città più grande del Ciad e il capoluogo della regione di Ouaddaï, oltre che della propria prefettura."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Cultural_Properties_of_Japan_-_paintings_(Gunma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lu_Dongbin_%28Chorakuji_Ota%29.jpg","page_title":"List of Cultural Properties of Japan - paintings (Gunma)","context_page_description":"This list is of the Cultural Properties of Japan designated in the category of paintings for the Prefecture of Gunma."},{"page_url":"https://de.wikipedia.org/wiki/Deutschlandsender_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Deutschlandsender_Fundament15092015_1.JPG","page_title":"Deutschlandsender III","context_page_description":"Der Deutschlandsender III war ein 1939 in Herzberg in Betrieb genommener Langwellenrundfunksender, der auf der Frequenz von 191 kHz das Programm des Deutschlandsenders verbreitete.\\nEr gehörte seinerzeit mit einer Sendeleistung von 500 Kilowatt zu den stärksten Rundfunksendern der Welt, allerdings gab es – entgegen der NS-Propaganda – im Ausland durchaus vergleichbare Anlagen. Als Antennenträger diente ein – ohne Dachkapazität – 325 Meter hoher, gegen die Erde isolierter abgespannter selbststrahlender Sendemast, der auf seiner Spitze eine linsenförmige Dachkapazität mit 25 Metern Durchmesser und vier Metern Höhe trug, die innen begehbar war. Da dieser Mast zudem noch auf einem acht Meter hohen Abstimmhaus stand, besaß die gesamte Konstruktion eine Höhe von 337 Metern und war zum damaligen Zeitpunkt das höchste Bauwerk in Europa und nach dem Empire State Building das zweithöchste Bauwerk weltweit. Zum Bau des Turmes wurden nur 600 Tonnen Stahl verbaut, was durch die besondere Konstruktion möglich wurde. Durch den Gitterbau führte eine Leiter mit 1600 Sprossen nach oben. Bemerkenswert war auch, dass dieser Mast über keine Flugsicherheitsbefeuerung verfügte."},{"page_url":"https://tr.wikipedia.org/wiki/Volvo_Aero","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Arboga_robotmuseum_6.jpg","page_title":"Volvo Aero","context_page_description":"Volvo Aero İsveçli bir uçak, türbin motoru, gaz türbinli motorlar, güdümlü füzeler ve roket motoru üreticisiydi. Şirketin 2012 yılında İngiliz mühendislik şirketi GKN tarafından satın alınmasının ardından GKN Havacılık ve Uzay Motor Sistemleri oldu.\\nAslen 1930 yılında aero motor üretmek için Nohab Flygmotorfabriker AB olarak kuruldu. Firma 1937'de Saab'nin bir parçası oldu. Volvo daha sonra şirketin çoğunu satın aldı, bu nedenle adı Svenska Flygmotor AB ve daha sonra Volvo Flygmotor olarak değiştirildi. Savaş sonrası dönemde İsveç Hava Kuvvetleri'nin en büyük motor tedarikçisi oldu. 1970'lerde Volvo Flygmotor ticari havacılık ve uzay sektörüne dalmış, birçok uluslararası motor üreticisi ve Avrupa uzay sektörü için revizyon ve alt bileşen üretimi sunmuştur."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_presidents_de_S%C3%ADria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Bahij_al-Khatib.jpg","page_title":"Llista de presidents de Síria","context_page_description":"El President de la República Àrab de la Síria és el principal executiu del país. Des de 1970, el President de la República Àrab de la Síria ha estat el líder incontestat del país. Hi ha hagut 19 caps d'Estat a Síria, i 13 persones més que van actuar en aquesta qualitat, des de 1922. Des de 17 de juliol de 2000, Bashar al-Assad actua com a president del país.\\nAquesta és una llista dels presidents i caps d'estat de Síria:"},{"page_url":"https://it.wikipedia.org/wiki/Aurora_(Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Aurora_MN_co_hwy_100_IMG_1498.JPG","page_title":"Aurora (Minnesota)","context_page_description":"Aurora è una città degli Stati Uniti d'America, situata in Minnesota, nella contea di St. Louis."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D0%B2%D0%B0%D0%BD_%D0%9F%D0%B5%D1%80%D0%B8%D1%88%D0%B8%D1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ivan_Peri%C5%A1i%C4%87_%28cropped%29.jpg","page_title":"Иван Перишиќ","context_page_description":"Иван Перишиќ — хрватски фудбалер, играч од средниот ред на Бајерн Минхен и на хрватската репрезентација."},{"page_url":"https://en.wikipedia.org/wiki/Bathybembix_bairdii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bathybembix_bairdii_1.jpg","page_title":"Bathybembix bairdii","context_page_description":"Bathybembix bairdii, common name Baird's top shell, is a species of deep-water sea snail, a marine gastropod mollusc in the family Eucyclidae."},{"page_url":"https://zh.wikipedia.org/zh-sg/2005%E5%B9%B410%E6%9C%8817%E6%97%A5%E6%9C%88%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Lunar_eclipse_from_moon-2005Apr24.png","page_title":"2005年10月17日月食","context_page_description":"2005年10月17日月食发生在2005年10月17日，是一次月偏食，这次是2005年第二次的月食，第一次是发生在同年4月24日的半影月食。\\n在9:51 UTC时，月球开始进入地球半影，11:34 UTC 时开始进入地球本影，12:03 UTC 时月球达到食甚状态，此时月球南部一部分被地球本影遮盖。月亮离开地球本影在12:32 UTC时，离开地球半影时则在14:15 UTC 时。\\n在下一次月食发生在2006年3月14日。"},{"page_url":"https://sv.wikipedia.org/wiki/Eatons_Neck","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Eatons-neck-ny-map.png","page_title":"Eatons Neck","context_page_description":"Eaton's Neck är en udde i östra delen av ön Long Island i delstaten New York, USA. Området var ursprungligen ett större gods.\\nLängst ute på udden finns ett gammalt fyrtorn, Eaton's Neck Lighthouse, ett av de få antika som ännu är i drift. Det togs i drift 1799–01–01, och har sedan renoverats och moderniserats i flera omgångar.\\nVid Eaton's Neck finns en kustbevakningsstation, US Coast Guard.\\nNamnet Long Island brukar förkortas till L. I.."},{"page_url":"https://sv.wikipedia.org/wiki/Skibby","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Skibby_-_gadeparti.jpg","page_title":"Skibby","context_page_description":"Skibby är en ort på Själland i Danmark. Den ligger i Frederikssunds kommun och Region Hovedstaden, 40 km väster om Köpenhamn. Skibby ligger 31 meter över havet och antalet invånare är 3 191. Närmaste större samhälle är Roskilde, 14 km sydost om Skibby."},{"page_url":"https://en.wikipedia.org/wiki/Catholic_Central_High_School_(London,_Ontario)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Front_Of_CCH.jpg","page_title":"Catholic Central High School (London, Ontario)","context_page_description":"Catholic Central High School in London, was Ontario's first Jr. Catholic High School, opened with grades 7 to 13 in September 1950. The new building was a Junior High School with grades 7 to 10. The original building on site was formerly known as Sacred Heart Convent and it housed 11, 12, 13 for a number of years but dropped grades 7, 8 when enrolment in grades 9 & 10 increased. CCH is administered by the London District Catholic School Board.\\nThe school has a wider range of programs than other London region high schools, such as the International Baccalaureate Diploma Programme, Environmental Leadership Program, English as a Second Language program and the Music Extension program, which mostly caters to graduates of St. Mary Choir School. It also has a co-op program called LEAP. CCH attracts students from the downtown area as well as the greater London region."},{"page_url":"https://hu.wikipedia.org/wiki/B%C3%A9csi_%C3%BAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/17-es_%C3%A9s_19-es_villamos%2C_Budapest.JPG","page_title":"Bécsi út","context_page_description":"A Bécsi út Budapest II. és III. kerületében található, a Zsigmond tértől halad a város közigazgatási határáig. Eredete az ókorig nyúlik vissza, és a Nagyszombat utcai kereszteződéstől kezdve a városhatárig máig fontos útvonal, a III. kerület egyik fő ütőere. Számos műemléki védettségű épület, illetve irodaház és egyéb épület található a nyomvonala mentén.\\nFeladatát a Nagyszombat utcai kereszteződés és a Zsigmond tér közötti rövid szakaszon a Lajos utca vette át, mivel a Bécsi út itt csupán 2x1 sávos, szélesítésre alkalmatlan."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D9%88%D8%A8%D9%84%DB%8C%D9%86%D9%82%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/POL_Lubliniec_COA.PNG","page_title":"لوبلینقتس","context_page_description":"لوبلینقتس لهیستان‌دا بیر یاشاییش منطقه‌سی‌دیر 822.13 کیلومتر موربّع ساحه‌سی وار. و سیلسیان اوستانیندا یئرلشیر."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BE-%D0%A1%D0%B8%D0%B9%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Bo%C3%B4-Silhen_%C3%A9glise_Silhen_%281%29.JPG","page_title":"Боо-Сийан","context_page_description":"Боо́-Сийа́н — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Верхние Пиренеи. Входит в состав кантона Аржелес-Газост. Округ коммуны — Аржелес-Газост.\\nКод INSEE коммуны — 65098."},{"page_url":"https://ko.wikipedia.org/wiki/2010%EB%85%84_%ED%94%84%EB%9E%91%EC%8A%A4_%EB%A0%88%EC%A7%80%EC%98%B9_%EC%84%A0%EA%B1%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Jean-Marie_Le_Pen_479834203_5030701e77_o.jpg","page_title":"2010년 프랑스 레지옹 선거","context_page_description":"2010년 프랑스 레지옹 선거는 26개의 레지옹의 주지사를 선출하기위해 1차투표는 2010년 3월 14일에 2차투표는 2010년 3월 21일에 실시되었다.\\n이번 선거는 프랑스 사회당 을 비롯한 좌파진영이 전체 26개 지역 중 23개 지역을 장악하면서 승리했다."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%9C%E1%83%94%E1%83%95%E1%83%90%E1%83%9C%E1%83%A5%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Hnevank_Monastery_2011.jpg","page_title":"ჰნევანქი","context_page_description":"ჰნევანქი — ქართული ეკლესია სომხეთში, მას ქართულად ძელი ჭეშმარიტისა ეწოდება. სახელწოდებას ორნაირი მნიშვნელობა აქვს. ჰუნე ვანქ — ბერძენთა მონასტერი და ჰუნე ვანქ — ძველი მონასტერი, ქალკედონიანთა სავანის მნიშვნელობით. ვახუშტი ამ მონასტრის შესახებ წერს:\\nპროფესორმა კ. ღაფადარიანმა სიტყვა ძელი ძველთან მსგავსების გამო ძველად აღიარა, რაც სომეხმა მეცნიერებმაც არ გაიზიარეს. ეს ცნობა პ. მურადიანმა სათუოდ მიიჩნია და აღნიშნა — ვახუშტი თავის „საქართველოს გეოგრაფიულ აღწერას“, როდესაც რომელიმე ეკლესიას, მონასტერს თუ ციხესიმაგრეს აღწერს, გარდა საისტორიო წყაროებისა, ეყრდნობა ხალხის ისტორიულ მეხსიერებას.\\nგიორგი ჩუბინაშვილს ეს ძეგლი VIII-IX საუკუნეებით აქვს დათარიღებული. ამ ძეგლის დეტალურად განხილვისას ლეონ მელიქსეთ-ბეგი მართებულად დაასკვნის:"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%82%B8%E3%83%AD%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Redhead_Duck_068.jpg","page_title":"ハジロ属","context_page_description":"ハジロ属は、鳥綱カモ目カモ科に属する属。別名スズガモ属。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%B8%D6%82%D5%A3%D5%B8%D5%BE%D5%A1%D5%B5%D5%AB_%D5%AF%D5%AB%D6%80%D5%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Green_Rugova_Gorge.jpg","page_title":"Ռուգովայի կիրճ","context_page_description":"Ռուգովայի կիրճ, գետային կիրճ Պեչ քաղաքի մոտ՝ Կոսովոյի Հանրապետության արևմուտքում, Չեռնոգորիայի սահմանի մոտ: Երկարությունը կազմում է 25 կիլոմետր, իսկ խորությունը՝ մինչև 1000 մետր: Այս կիրճը համարվում է Եվրոպայի ամենաերկար ու խորը կիրճերից մեկը: Այն ունի սառցադաշտային ծագում: Պեչսկա Բիստրիցա գետի ողողամաշման հետևանքով կիրճը զգալիորեն ընդարձակվել է:\\n1985 թվականին Ռուգովայի կիրճը հայտարարվեց որպես բնության հուշարձան և վերցվեց պաշտպանության տակ: Հուշարձան դառնալու կարևոր հատկանիշներից են՝ երկրաբանական, ջրաբանական, քամու ներգործության, կենսաբանական արժեք և գեղատեսիլ բնապատկերներ:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BC%D0%B5%D1%82%D0%BD%D0%B8%D0%BA_%D1%84%D1%96%D0%BE%D0%BB%D0%B5%D1%82%D0%BE%D0%B2%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Satinbowerbirdmale.jpg","page_title":"Наметник фіолетовий","context_page_description":"Альтанник атласний — вид горобцеподібних птахів родини альтанкових. Проживає в дощових тропічних лісах Східної Австралії від південного Квінсленда до Вікторії. В період гніздування самець будує курінь, який прикрашає різними блискучими речами."},{"page_url":"https://en.wikipedia.org/wiki/Union_Township,_Crawford_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Union_Township%2C_Conneaut_Marsh.jpg","page_title":"Union Township, Crawford County, Pennsylvania","context_page_description":"Union Township is a township in Crawford County, Pennsylvania, United States. The population was 1,010 at the 2010 census."},{"page_url":"https://lt.wikipedia.org/wiki/Dubultai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Aspazijas_nams_Dubultos.JPG","page_title":"Dubultai","context_page_description":"Dubultai yra Jūrmalos miesto dalis. Šioje vietoje Lielupė formuoja staigų lanką, priartėdama iki Rygos įlankos maždaug 300 metrų atstumu. Beveik tokiu pačiu atstumu nuo jūros yra ir Dubultų geležinkelio stotis. Atstumas nuo Dubultų stoties iki Rygos centro yra apie 20 kilometrų. Todėl Dubultai yra viena iš mėgiamiausių rygiečių ir užsienio turistų vasaros poilsio vietų.\\nPirmą kartą paminėti XVIII a., čia buvo žvejų gyvenvietė. Po 1812 m. karo Dubultai tapo viena iš pirmųjų poilsio vietų Jūrmaloje. Nuo 1814 m. čia lankėsi poilsiaujantys didikai. Dar 1820 m. ar net anksčiau žvejų nameliuose vasaros metu pradėjo apsistoti kelios rygiečių šeimos. Paprasti nameliai pamažu buvo perstatyti ir augant poilsiautojų skaičių buvo pastatyti nauji vasarnamiai.\\nTarp Dubultų ir Majuorų yra Latvijos prezidento rezidencija, o netoli nuo jos - Aspazijos namas, kur ji praleido paskutinius savo gyvenimo metus. Prieš Dubultų geležinkelio stotį yra 1907–1909 m. jugendstiliaus liuteronų bažnyčia. Šioje Jūrmalos dalyje yra ir Janio Rainio Rašytojų kūrybos ir poilsio namai įkurti 1946 m.\\n1950 m. Dubultuose buvo atidaryta pirmoji Latvijoje elektrifikuota geležinkelio linija Ryga-Dubultai."},{"page_url":"https://lt.wikipedia.org/wiki/Dubultai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Aspazijas_nams_Dubultos.JPG","page_title":"Dubultai","context_page_description":"Dubultai yra Jūrmalos miesto dalis. Šioje vietoje Lielupė formuoja staigų lanką, priartėdama iki Rygos įlankos maždaug 300 metrų atstumu. Beveik tokiu pačiu atstumu nuo jūros yra ir Dubultų geležinkelio stotis. Atstumas nuo Dubultų stoties iki Rygos centro yra apie 20 kilometrų. Todėl Dubultai yra viena iš mėgiamiausių rygiečių ir užsienio turistų vasaros poilsio vietų.\\nPirmą kartą paminėti XVIII a., čia buvo žvejų gyvenvietė. Po 1812 m. karo Dubultai tapo viena iš pirmųjų poilsio vietų Jūrmaloje. Nuo 1814 m. čia lankėsi poilsiaujantys didikai. Dar 1820 m. ar net anksčiau žvejų nameliuose vasaros metu pradėjo apsistoti kelios rygiečių šeimos. Paprasti nameliai pamažu buvo perstatyti ir augant poilsiautojų skaičių buvo pastatyti nauji vasarnamiai.\\nTarp Dubultų ir Majuorų yra Latvijos prezidento rezidencija, o netoli nuo jos - Aspazijos namas, kur ji praleido paskutinius savo gyvenimo metus. Prieš Dubultų geležinkelio stotį yra 1907–1909 m. jugendstiliaus liuteronų bažnyčia. Šioje Jūrmalos dalyje yra ir Janio Rainio Rašytojų kūrybos ir poilsio namai įkurti 1946 m.\\n1950 m. Dubultuose buvo atidaryta pirmoji Latvijoje elektrifikuota geležinkelio linija Ryga-Dubultai."},{"page_url":"https://de.wikipedia.org/wiki/Uttenhofen_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Wappen_der_Ritter_von_Uttenhofen.png","page_title":"Uttenhofen (Adelsgeschlecht)","context_page_description":"Uttenhofen war der Name eines alten fränkischen, dem Ritterkanton Baunach einverleibt gewesenen Adelsgeschlechts, das seine Anfänge im Hofer Raum hatte und im Laufe der Geschichte in mehrere Linien zerfiel."},{"page_url":"https://nl.wikipedia.org/wiki/Middelheimmuseum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Middelheimpark.jpg","page_title":"Middelheimmuseum","context_page_description":"Het Middelheimmuseum is een beeldenpark van 30 hectare in het deelpark Middelheim van het Nachtegalenpark bij Antwerpen.\\nHet deelpark Middelheim is bekend om zijn beeldenpark, dat is ontstaan uit de 'Biënnale Middelheim', die vanaf 1951 iedere twee jaar in het park georganiseerd werd. Na twintig afleveringen van deze beeldententoonstelling besloot men in 1989 een andere manier te kiezen om de beeldenverzameling aan te vullen. De beeldentuin heeft de vorm van vier uitwaaierende stroken, aan beide zijden van de Middelheimlaan die het park middendoor snijdt.\\nDe collectie omvat inmiddels tweehonderd beelden, waarvan enkele tientallen in de stad Antwerpen zijn geïnstalleerd. Bovendien beschikt het openluchtmuseum over honderden beelden die middels wisseltentoonstellingen worden getoond in het Braem-paviljoen. In dit paviljoen staan kwetsbare stukken opgesteld die niet in openlucht kunnen staan. Het Documentatiecentrum Burgemeester Lode Craeybeckx van het beeldenpark is gevestigd in de Orangerie van het Middelheimpark.\\nIn 2012 werd de plantentuin Hortiflora met een oppervlakte van 5 hectare toegevoegd aan het bestaande beeldenpark."},{"page_url":"https://sv.wikipedia.org/wiki/Xenomystax_congroides","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Xenomystax_congroides.jpg","page_title":"Xenomystax congroides","context_page_description":"Xenomystax congroides är en fiskart som beskrevs av Smith och Kanazawa, 1989. Xenomystax congroides ingår i släktet Xenomystax och familjen havsålar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Llyn_Bochlwyd","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/The_Outflow_of_Llyn_Bochlwyd_-_geograph.org.uk_-_239790.jpg","page_title":"Llyn Bochlwyd","context_page_description":"Llyn Bochlwyd – jezioro w Walii, położone w Snowdonii, w hrabstwie Conwy.\\nNazwa jeziora w języku walijskim oznacza \\"Jezioro Szarego Policzka\\". Zgodnie z miejscową legendą, pochodzi od starego, siwego jelenia, który uciekł przed ścigającymi go myśliwymi płynąc przez jezioro i trzymając swoje szare policzki nad powierzchnią wody."},{"page_url":"https://es.wikipedia.org/wiki/Adri%C3%A1n_Recinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/El_Teatro_Lux.jpg","page_title":"Adrián Recinos","context_page_description":"Adrián Recinos fue un político, historiador, ensayista, diplomático y traductor guatemalteco. Fue un gran estudioso de la historia nacional, principalmente de la civilización maya y de los antiguos manuscritos maya Quichés y Cakchiqueles. Fue él quien realizó la primera edición al español del Popol Vuh, a partir del manuscrito que halló en la Biblioteca de Newberry de Chicago, Estados Unidos. Además, tradujo al español el Memorial de Sololá -también conocido como los Anales de los Cakchiqueles-. Fue docente, diputado y embajador de Guatemala en los Estados Unidos, España, Francia e Italia, y candidato a la Presidencia de la República en las elecciones de 1944."},{"page_url":"https://fr.wikipedia.org/wiki/Attractions_touristiques_de_Tampere","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Tampere_City_Library_2.jpg","page_title":"Attractions touristiques de Tampere","context_page_description":"Cet article liste des attractions touristiques de Tampere en Finlande."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Rychnov%C4%9B_nad_Kn%C4%9B%C5%BEnou","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Rodny_dum_F_M_Pelcla.JPG","page_title":"Seznam kulturních památek v Rychnově nad Kněžnou","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Rychnov nad Kněžnou v okrese Rychnov nad Kněžnou vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E5%8C%97%E5%B8%82%E7%A7%81%E7%AB%8B%E5%BE%90%E5%8C%AF%E9%AB%98%E7%B4%9A%E4%B8%AD%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/St._Ignatius_High_School_2015.jpg","page_title":"新北市私立徐匯高級中學","context_page_description":"新北市私立徐匯高級中學是天主教耶穌會於1850年在大清帝國上海市徐家匯耶穌會會院旁創建的教會男子學校，初名徐匯公學，拉丁文校訓：「LABORA SICVT BONVS MILES CHRISTI」，1931年改名「徐匯中學」。中共建政後，1951年上海徐匯中學被中華人民共和國政府接收，今爲上海市徐匯中學。1963年由在台校友發起在中華民國台北縣蘆洲鄉復校。"},{"page_url":"https://cs.wikipedia.org/wiki/Ni%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Murouji_niomon2.jpg","page_title":"Nió","context_page_description":"Nió ztělesňují v buddhismu dva krále, strážce chrámu a buddhistické nauky.\\nU vstupu do větších chrámových okrsků zpravidla stojí zastřešená brána s dvěma výklenky pro sochy Nió, nazývaná niómon. Postavy se liší barvou, postojem, ale i mírou otevření úst.\\nPro svou podobu siláků s nadpřirozenou silou, kterým se zračí na tváři hrozivý výraz mající odradit zlo a zlé lidi od vstupu, se jim v Japonsku přezdívá též Kongó rikiši."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D1%8B%D1%9E%D1%80%D1%8B%D0%B9%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/DivrigiUluCamiportal_%282006%29.jpg","page_title":"Дыўрыйі","context_page_description":"Дыўрыйí, горад у правінцыі Сівас у Турцыі, цэнтр павета Дыўрыйi. Размешчаны на паўднёвым беразе ракі Чалтысую.\\nНалежаў Візантыі, страчаны ёй пасля Манцыкерцкай бітвы каля 1071, мясцовасць разам з горадам адышла да сельджукскага бея Менгюджэка Газі. У 1228-29 у горадзе пабудаваныя Вялікая мячэць і медыцынскі цэнтр, якія ў 1985 уключаны ЮНЕСКА ў спіс Сусветнай спадчыны."},{"page_url":"https://en.wikipedia.org/wiki/Sophia_of_Halshany","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Zofia_Holsza%C5%84ska.jpg","page_title":"Sophia of Halshany","context_page_description":"Sophia of Halshany or Sonka Olshanskaya was a Grand Duchy of Lithuania princess of Halshany. As the fourth and last wife of Jogaila, King of Poland and Supreme Duke of Lithuania, she was Queen consort of Poland. As the mother of Władysław III, King of Poland and Hungary, and Casimir IV, Grand Duke of Lithuania and King of Poland, she was the mother of the Jagiellon dynasty."},{"page_url":"https://hr.wikipedia.org/wiki/Bjelorusija","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Stemp_Efrasinia_Polackaja.jpg","page_title":"Bjelorusija","context_page_description":"Bjelorusija, država je u istočnoj Europi, koja se proteže istočno od poljske granice prema Rusiji. Na jugu graniči s Ukrajinom, a na sjeverozapadu s Latvijom i Litvom.\\nBjelorusija se nalazi na prijelazu s njemačko-poljske u istočno-europsku nizinu. Većinom je nizinska zemlja s umjerenom kontinentalnom klimom što u gospodarskom smislu pogoduje razvoju ratarske odnosno stočarske kulture. Kontinentalna je država, što znači da nema izlaza na more, ali je vrlo dobro povezana riječnim tokovima, posebno s Ukrajinom i Rusijom.\\nBjelorusija ima staru i kulturno bogatu tisućljetnu povijest, ali je njezina državna neovisnost relativno mlada. Kroz svoju povijest Bjelorusija je u državničkom i kulturološkom smislu duže vrijeme bila vezana sa Ukrajinom u sklopu Kijevske Rusi i Poljsko-Litavske Unije. Obje zemlje tada su u specifičnoj federaciji bile poznatije pod imenom Rutenija odnosno Rus' u lokalnom slaveniziranom obliku, a konkretno u slučaju Bjelorusije – Bijela Rus'.\\nNakon raspada SSSR-a 1991. godine prestalo je doseljavanje u dotada industrijski i poljoprivredno najrazvijeniju sovjetsku republiku."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80_%D0%94%D0%BE%D0%BA%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Aleksandar_Obrenovic_with_Lazar_Doki%C4%87_in_Florece%2C_1888.jpg","page_title":"Лазар Докић","context_page_description":"Лазар Ђ. Докић је био српски лекар и политичар, председник владе 1893. године."},{"page_url":"https://es.wikipedia.org/wiki/Pleiacanthus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Pleiacanthus_spinosus_2.jpg","page_title":"Pleiacanthus","context_page_description":"Pleiacanthus es un género monotípico​ de plantas herbáceas perteneciente a la familia Asteraceae. Su única especie: Pleiacanthus spinosus Rydb., es originaria de Norteamérica. El género fue descrito por Per Axel Rydberg y publicado en Flora of the Rocky Mountains 1069, en el año 1917.​"},{"page_url":"https://ro.wikipedia.org/wiki/Canalul_Main-Dun%C4%83re","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Altm%C3%BChl_Kelheim_02.jpg","page_title":"Canalul Main-Dunăre","context_page_description":"Canalul Main-Dunăre cu o lungime de 171 km, leagă începând din anul 1992 râul Main cu Dunărea de la Bamberg prin Nürnberg la Kelheim.\\nCanalul face parte din traseul maritim între Rotterdam și Constanța, care este legătura navigabilă cea mai scurtă între Marea Nordului și Marea Neagră, pe râurile Rin, Main, Canalul Main-Dunăre, Dunărea și Canalul Dunăre-Marea Neagră."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%81%D0%BB%D1%83%D1%80%D0%B0%D0%BD%D1%82%D0%B8-%D0%94%D0%B0%D0%B1%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Mairie_de_Eslourenties-Daban.JPG","page_title":"Эслуранти-Дабан","context_page_description":"Эслуранти́-Даба́н — коммуна во Франции, находится в регионе Аквитания. Департамент — Атлантические Пиренеи. Входит в состав кантона Пе-де-Морлаас и дю Монтанерес. Округ коммуны — По.\\nКод INSEE коммуны — 64211."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%86%D8%B3%D9%8A%D8%B3_%D9%83%D8%A7%D8%A8%D9%88%D8%AA_%D9%84%D9%88%D9%8A%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Francis_Cabot_Lowell.jpg","page_title":"فرنسيس كابوت لويل","context_page_description":"فرنسيس كابوت لويل ‏ هو شخصية أعمال أمريكي، ولد في 7 أبريل 1775 في نيوبوريبورت في الولايات المتحدة، وتوفي في 10 أغسطس 1817 في بوسطن في الولايات المتحدة."},{"page_url":"https://ca.wikipedia.org/wiki/El_maestro_(pel%C2%B7l%C3%ADcula_de_1957)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ilmaestro_2.JPG","page_title":"El maestro (pel·lícula de 1957)","context_page_description":"El maestro és una pel·lícula coproducció italo-espanyola de 1957 dirigida, escrita i interpretada per Aldo Fabrizi, última pel·lícula en la que va participar com a actor. Fou rodada íntegrament a Espanya en doble versió. L'espanyola, substancialment idèntica, fou dirigida per Eduardo Manzanos Brochero."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EA%B3%A0_%EB%A6%AC_%EC%85%B0%ED%84%B8%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Margot_Lee_Shetterly.jpg","page_title":"마고 리 셰털리","context_page_description":"마고 리 셰털리는 미국의 작가이다. 머큐리 계획의 숨은 공신이었던 흑인 여성들의 이야기를 소재로 한 논픽션 《히든 피겨스: 우주 개발 경쟁을 도왔던 아프리카계 미국인 여성들 이야기》를 저술했고, 이는 영화 《히든 피겨스》의 원작이 되었다."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%90%D7%A4%D7%9F_%D7%90%D7%A1_%D7%90%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bundesarchiv_Bild_146-1978-070-04A%2C_Amin_al_Husseini_bei_bosnischen_SS-Freiwilligen.jpg","page_title":"ואפן אס אס","context_page_description":"ואפן אס אס הייתה הזרוע הצבאית של האס אס, שלחמה לצד הוורמאכט במלחמת העולם השנייה והייתה כפופה למפקד האס אס, היינריך הימלר. היחידה הוקמה בשנת 1933 כיחידת אבטחה לראשי המפלגה הנאצית, ובמהלך מלחמת העולם השנייה הפכה לזרוע צבאית נוספת, שכוחה הגיע בשיאו להיקף של 38 דיוויזיות לוחמות ויחידות קומנדו, ומעל 950 אלף חיילים, חלקם מתנדבים ממדינות כבושות ואוהדי הנאצים. בדומה לוורמאכט, גם הוואפן אס אס היה אחראי לביצוע פשעי מלחמה רבים וכחלק מהאס אס הוכרז כארגון פשע במשפטי נירנברג על מנת לאפשר העמדה לדין של חברים בו."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2016/Teilnehmer_(Deutschland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Einkleidung_der_deutschen_Olympiamannschaft_Rio_2016_Medientag_Hannover_0127.jpg","page_title":"Olympische Sommerspiele 2016/Teilnehmer (Deutschland)","context_page_description":"Deutschland nahm an den Olympischen Spielen 2016 in Rio de Janeiro teil. Es war die insgesamt 24. Teilnahme an Olympischen Sommerspielen.\\nDie Nominierung der einzelnen Sportler als Mitglied der deutschen Olympiamannschaft erfolgte durch den Deutschen Olympischen Sportbund auf Vorschlag der Fachverbände in drei Runden. Am 31. Mai 2016 wurden in der ersten Nominierungsrunde 44 Athleten nominiert. In der zweiten Runde am 28. Juni 2016 erfolgte die Nominierung von weiteren 143 Athleten. Die letzte Nominierung erfolgte am 12. Juli 2016. Nachnominierungen und Veränderungen aufgrund von Verletzungen gab es am 19. Juli 2016. Nun wurde von einer Athletenstärke von 450 für Rio ausgegangen, davon 26 als potentielle Nachrücker. Durch eine nachträgliche Starterlaubnis für zwei Athletinnen erhöhte sich die Zahl auf 452.\\nFahnenträger bei der Eröffnungsfeier wurde nach der erstmaligen Umfrage unter Sportfans im Internet Tischtennisspieler Timo Boll, der sich gegen Hockeyspieler Moritz Fürste, Vielseitigkeitsreiterin Ingrid Klimke, Fünfkämpferin Lena Schöneborn und Radsportlerin Kristina Vogel durchsetzen konnte."},{"page_url":"https://fr.wikipedia.org/wiki/Puy-l%27%C3%89v%C3%AAque","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Puy_l%27Ev%C3%AAque%2C_l%27_%C3%A9glise_St_Sauveur.jpg","page_title":"Puy-l'Évêque","context_page_description":"Puy-l'Évêque est une commune française située dans le département du Lot, en région Occitanie.\\nLe vieux village médiéval est un site inscrit au titre de la protection des Monuments Historiques depuis le 26 octobre 1944. Une partie du territoire communal a été placée en zone de protection du patrimoine architectural, urbain et paysager le 14 juin 1995 par le préfet de région."},{"page_url":"https://fr.wikipedia.org/wiki/Steenwerck","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Maison_aux_avions_de_Steenwerck_%283%29.jpg","page_title":"Steenwerck","context_page_description":"Steenwerck est une commune française située dans le département du Nord en région Hauts-de-France."},{"page_url":"https://hu.wikipedia.org/wiki/Az_USA_115._kongresszusa_k%C3%A9pvisel%C5%91h%C3%A1zi_tagjainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Jeb_Hensarling.jpg","page_title":"Az USA 115. kongresszusa képviselőházi tagjainak listája","context_page_description":"Az Amerikai Egyesült Államok Kongresszusának képviselőháza 435 szavazati joggal rendelkező képviselőből, valamint hat szavazati joggal nem rendelkező delegáltból áll. Az egyes államok képviselőinek számát a tíz évenként lebonyolított népszámlálás adatai, valamint az állam kiterjedése alapján határozzák meg. Ennek megfelelően a 115. kongresszusban Kaliforniának van a legtöbb, 53 képviselője, és mindössze egy képviselővel rendelkezik Alaszka, Delaware, Montana, Dél-Dakota, Észak-Dakota, Vermont, valamint Wyoming állam. A képviselőház tagjait minden páros év novemberében választják meg, mandátumukat a megválasztott képviselők január 3-án kezdik meg. A 115. kongresszus tagjait 2016. november 8-án választották meg, a következő kongresszus tagjainak megválasztására 2018. november 6-án került sor.\\n115. kongresszus 2017. január 3-a 12:00-tól 2019. január 3-án 12:00-ig ülésezik. A képviselőház többségét ebben az időszakban a republikánusok adták. A képviselőház elnöke a republikánus Paul Ryan volt.\\nA legidősebb képviselő az 1929-ben született John Conyers volt, aki egyben a legrégebben, 1965 óta tagja a testületnek. A legfiatalabb az 1984-ben született Elise Stefanik."},{"page_url":"https://de.wikipedia.org/wiki/S%C3%BCdpazifische_Zyklonsaison_2014%E2%80%932015","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Ola_2015-02-01_0305Z.jpg","page_title":"Südpazifische Zyklonsaison 2014–2015","context_page_description":"Die Südpazifische Zyklonsaison 2014–2015 ist der Zeitraum der Jahre 2014 und 2015, in dem sich im Südpazifik östlich von 160° östlicher Länge die meisten tropischen Wirbelstürme bilden. Die Saison startete offiziell am 1. November 2014 und wird am 30. April 2015 enden. Zur Saison gehören jedoch alle tropischen Wirbelstürme, die sich im tropischen Zyklonjahr der Südhalbkugel zwischen dem 1. Juli 2014 und dem 30. Juni 2015 bilden.\\nInnerhalb des südpazifischen Beckens werden tropische Zyklone vom Regional Specialized Meteorological Centre überwacht, mit dessen Aufgaben der Fiji Meteorological Service in Nadi, Fidschi und durch ein Tropical Cyclone Warning Center in Wellington, das Meteorological Service of New Zealand betreibt. Das RSMC Nadi vergibt für alle Systeme, die innerhalb des Südpazifiks entstehen oder in dieses Gebiet ziehen, eine Bezeichnung, die aus dem Buchstaben F und einer laufenden zweistelligen Nummer besteht. Das Joint Typhoon Warning Center der Vereinigten Staaten gibt im Südpazifik inoffizielle Sturmwarnungen aus; dabei werden Stürme mit dem Buchstaben P und einer zweistelligen Zahl identifiziert."},{"page_url":"https://nl.wikipedia.org/wiki/Le_Syndicat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Map_commune_FR_insee_code_88462.png","page_title":"Le Syndicat","context_page_description":"Le Syndicat is een gemeente in het Franse departement Vosges in de regio Grand Est. De gemeente maakt deel uit van het arrondissement Épinal en sinds 22 maart 2015 van het op die dag opgerichte kanton La Bresse. Daarvoor was Le Syndicat onderdeel van het kanton Remiremont."},{"page_url":"https://de.wikipedia.org/wiki/L%C3%A9on_Krier","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Dorset_poundbury_01.jpg","page_title":"Léon Krier","context_page_description":"Léon Krier ist ein Architekt, Architekturtheoretiker und Stadtplaner aus Luxemburg. Er ist einer der bedeutendsten Vertreter der neorationalistischen und neoklassizistischen Architektur des späten 20. Jahrhunderts, vor allem durch seine provokanten theoretischen Beiträge zum Thema Städtebau und Stadtplanung. Sein Bruder Rob Krier ist ebenfalls ein bedeutender Architekt der Postmoderne und der neuen klassischen Architektur."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Olomouc","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Zvoni%C4%8Dka_%28Lhota_nad_Moravou%29.JPG","page_title":"Seznam kulturních památek v okrese Olomouc","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Olomouc vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Bouzově včetně částí Blažov, Doly, Hvozdečko, Kovářov, Kozov a Obectov\\nSeznam kulturních památek v Dlouhé Loučce\\nSeznam kulturních památek v Dubu nad Moravou včetně částí Bolelouc a Tučapy\\nSeznam kulturních památek v Litovli včetně částí Chudobín, Nasobůrky, Tři Dvory, Unčovice a Víska\\nSeznam kulturních památek v Moravském Berouně včetně částí Čabová, Nové Valteřice a Sedm Dvorů\\nSeznam kulturních památek v Náměšti na Hané\\nSeznam kulturních památek v Olomouci včetně částí Svatý Kopeček, Nové Sady, Nová Ulice, Droždín, Lošov, Nedvězí a Topolany\\nSeznam kulturních památek v Příkazech"},{"page_url":"https://ceb.wikipedia.org/wiki/Bojac%C3%A1_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bojaca_Parque.JPG","page_title":"Bojacá (lungsod)","context_page_description":"Lungsod ang Bojacá sa Kolombiya. Nahimutang ni sa departamento sa Departamento de Cundinamarca, sa sentro nga bahin sa nasod, 30 km sa kasadpan sa Bogotá ang ulohan sa nasod. 2,583 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bojacá, ug adunay 4,399 ka molupyo.\\nAng yuta palibot sa Bojacá kay lain-lain. Ang kinahabogang dapit sa palibot dunay gihabogon nga 2,835 ka metro ug 2.5 km sa habagatan-kasadpan sa Bojacá. Dunay mga 659 ka tawo kada kilometro kwadrado sa palibot sa Bojacá nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Madrid, 8.5 km sa sidlakan sa Bojacá. Hapit nalukop sa kasagbotan ang palibot sa Bojacá.\\nAng klima mediteranyo. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Pebrero, sa 16 °C, ug ang kinabugnawan Hulyo, sa 10 °C. Ang kasarangang pag-ulan 1,552 milimetro matag tuig. Ang kinabasaan nga bulan Abril, sa 221 milimetro nga ulan, ug ang kinaugahan Septiyembre, sa 80 milimetro."},{"page_url":"https://fi.wikipedia.org/wiki/Kitapurjeen_kohottajalihas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Musculuslevatorvelipalatini.png","page_title":"Kitapurjeen kohottajalihas","context_page_description":"Kitapurjeen kohottajalihas on paksu ja nauhamainen lihas ihmisen päässä, joka kohottaa pehmeää suulakea eli kitapurjetta. Kyseessä on parillinen lihas, joita on kaksi lateraalisesti sisäsieraimiin nähden. Toimiessaan lihas nostaa kitapurjeen takaosaa ja vetää sitä hieman taaksepäin. Yhdessä lähellä olevan tensor veli palatini -lihaksen kanssa kitapurjeen kohottajalihas tekee pehmeästä suulaesta kireän horisontaalisen levyn, joka erottaa nenänielun suunielusta. Näiden lihasten tärkeä tehtävä on nenänielun sulkeminen nielaistaessa.\\nKitapurjeen kohottajalihas lähtee ohimoluun tympaanisen osan alapinnasta läheltä korvatorvea ja kulkee suulaen aponeuroosiin. Lihasta hermottaa vagushermosta lähtevä haara, kuten useimpia muita suulaen ja kurkun lihaksia."},{"page_url":"https://ga.wikipedia.org/wiki/An_Su%C3%AD_Naofa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Emblem_of_the_Papacy_SE.svg","page_title":"An Suí Naofa","context_page_description":"Is na daoine bainte leis an Pápa sa rialtas an Eaglais Chaitliceach Rómhánach ag an an Vatacáin é An Suí Naofa."},{"page_url":"https://fr.wikipedia.org/wiki/Elizabeth_Hand","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Elizabeth_Hand_Finncon2007_cropped.jpg","page_title":"Elizabeth Hand","context_page_description":"Elizabeth Hand, née le 29 mars 1957 à Yonkers dans l'État de New York, est une romancière américaine de science-fiction et de fantasy. En 1995, son roman L'Éveil de la Lune a obtenu le prix James Tiptree, Jr.. Pour ses nouvelles, elle a obtenu deux prix Nebula et quatre prix World Fantasy. En 2018, elle reçoit un prix Inkpot au Comic Con de San Diego, pour l'ensemble de son œuvre."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Nobelin_rauhanpalkinnon_saaneista","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/UN_refugee.jpg","page_title":"Luettelo Nobelin rauhanpalkinnon saaneista","context_page_description":"Tämä on luettelo Nobelin rauhanpalkinnon saaneista. Luettelo on kronologinen."},{"page_url":"https://en.wikipedia.org/wiki/Ixtacamaxtitl%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Ixtacamaxtitlan_en_Puebla.svg","page_title":"Ixtacamaxtitlán","context_page_description":"Ixtacamaxtitlán Municipality is a town and municipality in Puebla in south-eastern Mexico."},{"page_url":"https://en.wikipedia.org/wiki/Chloris_(nymph)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/ChlorisPrimavera.jpg","page_title":"Chloris (nymph)","context_page_description":"In Greek mythology, Chloris was a nymph or goddess who was associated with spring, flowers and new growth, believed to have dwelt in the Elysian Fields."},{"page_url":"https://vi.wikipedia.org/wiki/S%E1%BB%AFa_d%C6%B0%E1%BB%A1ng_th%E1%BB%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Nivea_Lotion.jpg","page_title":"Sữa dưỡng thể","context_page_description":"Sữa dưỡng thể hay sữa dưỡng da là loại mỹ phẩm pha chế có độ nhớt thấp, thoa da không bị bong tróc. Ngược lại, kem và gel có độ nhớt cao hơn.\\nSữa dưỡng thể thoa da bên ngoài bằng tay không, bàn chải, vải sạch, bông hoặc gạc. Mặc dù sữa dưỡng thể có thể dùng như một phương thức phân phối dược phẩm, nhưng nhiều loại sữa dưỡng, đặc biệt sữa dưỡng tay và sữa dưỡng toàn thân mang nghĩa thay cho làm mượt da, giữ ẩm và làm mềm da. Những chất này có thể được sử dụng trong sữa dưỡng chống lão hóa, cũng có thể được phân loại như mỹ phẩm trong nhiều trường hợp và có thể chứa hương thơm. Cục quản lý Thực phẩm và Dược phẩm Hoa Kỳ đã bày tỏ lo ngại về loại sữa dưỡng thể không được phân loại là chất thuốc được quảng cáo thuộc tính chống lão hóa hoặc chống nhăn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB_(%D0%9C%D0%B8%D0%BD%D1%81%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Minsk%2C_Belarus_-_panoramio_%28137%29.jpg","page_title":"Московский автовокзал (Минск)","context_page_description":"Московский автовокзал — бывший автовокзал в Минске, располагался по адресу ул. Филимонова, 63.\\nАвтовокзал обслуживал международные, междугородные и пригородные рейсы оршанского и витебского направлений. Был рассчитан на обслуживание 15 тысяч человек в сутки. На территории автовокзала работали диспетчерская станция и разворотное кольцо автобусов и троллейбусов.\\n10 июля 2014 начались работы по сносу автовокзала и строительству новой развязки пр. Независимости — ул. Филимонова"},{"page_url":"https://it.wikipedia.org/wiki/Arcidiocesi_di_Firenze","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Betori.JPG","page_title":"Arcidiocesi di Firenze","context_page_description":"L'arcidiocesi di Firenze è una sede metropolitana della Chiesa cattolica in Italia appartenente alla regione ecclesiastica Toscana. Nel 2016 contava 824.000 battezzati su 833.624 abitanti. È retta dall'arcivescovo cardinale Giuseppe Betori.\\nLa festa del patrono della città è il 24 giugno, giorno della Natività di san Giovanni Battista, mentre i patroni della diocesi sono san Zanobi e sant'Antonino Pierozzi, vescovi della città."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D1%8F_%D0%9A%D0%B0%D0%B9%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%85_%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Amazona_leucocephala_-Matanzas%2C_Matanzas_Province%2C_Cuba_-two-8.jpg","page_title":"Географія Кайманових Островів","context_page_description":"Кайманові Острови — північноамериканська країна, що відноситься до Карибського регіону і займає однойменний архіпелаг на південь від Куби. Загальна площа країни 264 км², з яких на суходіл припадає 264 км², а на поверхню внутрішніх вод — 0 км². Площа країни у 3 рази менша за площу території міста Києва."},{"page_url":"https://fr.wikipedia.org/wiki/Volvo_S40","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Volvo_V40-silver.back-by.ranger.jpg","page_title":"Volvo S40","context_page_description":"La Volvo S40 est une berline compacte produite par le constructeur automobile suédois Volvo de 1995 à 2012. La première génération est produite de 1995 et 2004 en berline S40 et break V40, la seconde, de 2004 à 2012 en berline S40 et break V50. Elle succède aux 440/460 avant d'être remplacé par la V40 deuxième du nom."},{"page_url":"https://de.wikipedia.org/wiki/St._Nikolaus_(Wenigens%C3%B6mmern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Wenigens%C3%B6mmern-Kirche-3-CTH.JPG","page_title":"St. Nikolaus (Wenigensömmern)","context_page_description":"Die evangelische Dorfkirche St. Nikolaus steht im Ortsteil Wenigensömmern der Stadt Sömmerda im Landkreis Sömmerda in Thüringen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BD%D0%BE%D0%B3%D0%BE%D1%8F%D1%80%D1%83%D1%81%D0%BD%D1%8B%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA%D0%B8%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Optima_parking.jpg","page_title":"Многоярусный автоматический паркинг","context_page_description":"Многоярусный автоматический паркинг — многоуровневый паркинг, выполненный в двух и более уровнях металлической или бетонной конструкции/сооружения, для хранения автомобилей, в котором парковка/выдача производится в автоматическом режиме, с использованием специальных механизированных устройств. Перемещение автомобиля внутри паркинга происходит с выключенным двигателем автомобиля. По сравнению с традиционными паркингами, МАП значительно экономит площадь, отводимую под парковку, за счёт возможности размещения большего количества машиномест на той же площади застройки."},{"page_url":"https://nl.wikipedia.org/wiki/Sankt_Georgen_am_L%C3%A4ngsee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Wappen_at_st-georgen-am-laengsee.png","page_title":"Sankt Georgen am Längsee","context_page_description":"Sankt Georgen am Längsee is een gemeente in de Oostenrijkse deelstaat Karinthië, gelegen in het district Sankt Veit an der Glan. De gemeente heeft ongeveer 3600 inwoners."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1919","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Com_L19-0681-0001-0001_%28cropped%29.jpg","page_title":"Lijst van personen geboren in 1919","context_page_description":"Dit is een lijst van personen die geboren zijn in 1919.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://la.wikipedia.org/wiki/Gentes_Maritimae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Medinet_Habu_Ramses_III._Tempel_14.JPG","page_title":"Gentes Maritimae","context_page_description":"Gentes Maritimae est nomen generale omnium gentium in annalibus Aegypticis temporibus novi imperii conscriptis ibi gentes externae nuncupatarum, quas ex initio 12. saeculi a.C. Aegyptum minatas esse in rebus gestis Ramsis III legimus. Verisimiliter easdem gentes descripsit quae simul urbem Syricam Ugarit aggressae sint. Quas etiam aliarum expugnationum atque vastationum eodem fere tempore ubique in orientali Mari Mediterraneo accidentium causam fuisse opinatur."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%AB%E3%82%B0%E3%82%BF%E3%82%A4%E3%83%BB%E3%82%AD%E3%83%AA%E3%83%AB%E3%83%88%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Targutai.jpg","page_title":"タルグタイ・キリルトク","context_page_description":"タルグタイ・キリルトクとは、12世紀末に活躍したモンゴル部タイチウト氏の首長。モンゴル部第2代カンたるアンバガイ・カンの孫に当たり、キヤト氏族の長ではとこに当たるテムジンとはモンゴル部族の主導権を巡って争った。『モンゴル秘史』では塔児忽台・乞憐禿黒と記され、チンギス・カンにとってはジャムカに次ぐモンゴル部族内のライバルとして描かれている。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A7%81%E0%A6%B6%E0%A6%B0%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/026Bosra.JPG","page_title":"বুশরা","context_page_description":"একটি শহর যা দক্ষিণ সিরিয়ায় অবস্থিত। প্রশাসনিকভাবে দারা প্রদেশের দারা জেলায় এবং ভৌগোলিক ভাবে হাউরান অঞ্চলের অংশ।\\nসিরিয়ার কেন্দ্রীয় পরিসংখ্যান ব্যুরো এর তথ্যানুসারে ২০০৪ সালের আদমশুমারিতে বুশরায় ১৯, ৬৮৩ জন অধিবাসী ছিলো। এর প্রশাসনিক কেন্দ্র নাহিয়াহ যা নয়টি এলাকা নিয়ে গঠিত, ২০০৪ সালে যার যৌথ জনসংখ্যা ছিলো ৩৩৮৩৯ জন। শহরের প্রধান জনগোষ্ঠী সুন্নি মুসলিম হলে অল্প পরিসরে শিয়া মুসলিম সম্প্রদায়ও বাস করে।\\nবুশরার আছে প্রাচীন ইতিহাস এবং রোমান যুগে এটা ছিল একটি সমৃদ্ধ প্রাদেশিক রাজধানী ও মহানগর আর্চবিশপ যা এন্টিওখ ও সমগ্র পূর্বের ইস্টার্ন অর্থোডক্স প্যাট্রিয়কের এখতিয়ারাধীন ছিলো। ইসলামী যুগেও এটা প্রশাসনিকভাবে গুরুত্বপূর্ণ ছিলো। কিন্তু উসমানীয় শাসনামলে এটা গুরুত্বহীন হতে থাকে। আজকের দিনে এটা একটি প্রত্নস্থল এবং ইউনেস্কো স্থানটিকে একটি ওয়ার্ল্ড হেরিটেজ সাইট হিসেবে ঘোষণা করেছে।"},{"page_url":"https://eo.wikipedia.org/wiki/Ra%C5%9Did_Nurgalijev","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/2012-01-12_%D0%A0%D0%B0%D1%88%D0%B8%D0%B4_%D0%9D%D1%83%D1%80%D0%B3%D0%B0%D0%BB%D0%B8%D0%B5%D0%B2.jpeg","page_title":"Raŝid Nurgalijev","context_page_description":"Raŝid Nurgalijev estas ministro pri internaj aferoj de Rusio, armea generalo. Li havas sciencan gradon kandidato pri ekonomiko.\\nNurgalijev naskiĝis en Kazaĥio, al familio de policanoj. En 1974 li finis mezlernejon en Petrozavodsk kaj ekis studon en la Petrozavodska Ŝtata Universitato. Post fino de la studo, ekde 1979 ĝis 1981, li laboris kiel instruisto de fiziko en karelia setlejo Nadvoici.\\nEn la jaro 1981 Nurgalijev komencis servi en sistemo de KGB. Lia pinta posteno en karelia KGB estis ĉefo de kontraŭterorisma departamento. Ekde 1995 li servis en Moskvo.\\nEn 2002 li iĝis la unua vicestro de la ministro pri internaj aferoj. La 9-an de marto 2004 li estis enpostenigita kiel ministro.\\nEdziĝinta, li havas du idojn."},{"page_url":"https://pl.wikipedia.org/wiki/Konstrukcje_wsporcze","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/H%C3%B8gspentmaster_p%C3%A5_Fosen_Karm%C3%B8y.jpg","page_title":"Konstrukcje wsporcze","context_page_description":"Konstrukcje wsporcze – konstrukcje zaprojektowane i przystosowane pod względem wytrzymałości mechanicznej i elektrycznej do prowadzenia przewodów linii napowietrznych.\\nWymiary konstrukcji wsporczych są zależne od napięcia znamionowego projektowanej linii. Projektant konstrukcji wsporczych musi brać pod uwagę naprężenia od przewodów fazowych i odgromowych, parcie wiatru, zmianę naprężeń przy zmianach temperatury, zmianę ciężaru przewodów i zmianę sił działających na przewody w stanie szadzi. Projektant musi również brać pod uwagę wytrzymałość elektryczną powietrza, zapewniając bezpieczną odległość przewodów od siebie oraz od konstrukcji wsporczych w każdej chwili."},{"page_url":"https://en.wikipedia.org/wiki/Berwyn_Heights,_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Berwyn_Heights%2C_Maryland_019.jpg","page_title":"Berwyn Heights, Maryland","context_page_description":"Berwyn Heights is a town in Prince George's County, Maryland, United States. The population was 3,123 at the 2010 United States Census. It is bordered by College Park to the west, Greenbelt to the northeast, and Riverdale Park to the south."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%83%91%E5%B7%9E%E5%85%AC%E4%BA%A4%E7%BA%BF%E8%B7%AF%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/ZZB_S126_20200514.jpg","page_title":"郑州公交线路列表","context_page_description":"郑州公交目前共有300余条公共汽车线路正在运营，其主要运营者为郑州市公共交通总公司，亦有绿城巴士公司等公司。除日间线路外还运营有Y开头的夜班线路，市区夜班线路运营到凌晨24点，港区夜班线路Y636则运营到次日凌晨3点。同时还运营有开往市区外景区的专用旅游线路。"},{"page_url":"https://ro.wikipedia.org/wiki/Departamentul_Rocha","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Wpolonio_2005_040.jpg","page_title":"Departamentul Rocha","context_page_description":"Departamentul Rocha este un departament din Uruguay aflat în regiunea de est a țării. Se învecinează cu departamentul Maldonado la vest, cu departamentul Lavalleja la nord-vest, cu departamentul Treinta y Tres la nord, în timp ce la nord-est Laguna Merín face parte din granița sa cu Brazilia, iar la capătul sudic al lacului se învecinează și cu extremitatea cea mai sudică a Braziliei, cu orașul Chuy „împărțit” între ambele țări, granița trecând prin principalul său bulevard comercial.\\nRocha are frumuseți naturale precum Cabo Polonio, Valizas, Parcul Național Santa Teresa. Este bine cunoscut pentru stațiunile sale de plajă, precum Punta del Diablo sau La Esmeralda, care se pline de vizitatori în timpul vacanțelor de vară."},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Mihiel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Abbatiale_st_michel_St_Mihiel.JPG","page_title":"Saint-Mihiel","context_page_description":"Saint-Mihiel - miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Moza.\\nWedług danych na rok 1990 gminę zamieszkiwało 5367 osób, a gęstość zaludnienia wynosiła 163 osób/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Un%C8%9Beni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Unteni_judetul_Botosani.jpg","page_title":"Unțeni","context_page_description":"Unțeni est une commune du județ de Botoșani en Roumanie."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E7%81%A3%E5%BB%BA%E7%AF%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%E7%B8%BD%E7%9D%A3%E5%BA%9C%E4%BA%A4%E9%80%9A%E5%B1%80%E9%90%B5%E9%81%93%E9%83%A8.jpg","page_title":"臺灣建築","context_page_description":"台湾建筑在每个时代的建筑造型、风格、结构与功能，及其所展现出的社会、文化、宗教、政治、经济、艺术等意义与内涵非常多元丰富。以台湾历史上各种具体建筑案例等层面来观察分析，最早可追溯到史前时代的浮脚楼式建筑，原住民建筑是台湾南岛语系建筑，到了荷西时期基于殖民与传教活动各在台湾南北构筑要塞、教堂，明郑时期视台湾为反清复明基地，闽南式建筑就此引进，而清代时期的建筑主要走向为中西文化融合的特性，清末洋务运动对炮利的向往，炮台建筑更加兴盛，19世纪末，日本殖民台湾，台湾的殖民地建筑，具备日本特殊的殖民统治经验日治时期以闽南、日本、西洋的文化为主要建筑构想；且引进了钢筋混凝土技术。战后，随着国民政府来台，台湾出现中国古典风格的流行，又经由美援引入了国际主流的现代主义风格。在现代，台湾的建筑走向多元化，各种风格的建筑都可普遍的看见。"},{"page_url":"https://de.wikipedia.org/wiki/Matsunoo-dera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Saigokumatuozi01.jpg","page_title":"Matsunoo-dera","context_page_description":"Der Matsunoo-dera ist ein buddhistischer Tempel in der Stadt Maizuru, Präfektur Kyōto in Japan. Der Tempel ist mit der Glaubensrichtung Shingon-shū assoziiert. Hauptbildnis des Tempels ist eine Statue der pferdeköpfigen Batō-Kannon. Der Matsunoo-dera ist der 29. Tempel des Saigoku-Pilgerweges."},{"page_url":"https://de.wikipedia.org/wiki/Makropode","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Macropodus_opercularis_aquarium.jpg","page_title":"Makropode","context_page_description":"Der Makropode, auch Paradiesfisch, Gabelschwanzmakropode, Großflosser oder Kiemenfleck genannt, gehört zur Gattung der Paradiesfische aus der Unterordnung der Labyrinthfische. Die männlichen Tiere werden etwa 8 cm groß und sind vor allem in der Paarungszeit prächtig gefärbt, die Weibchen bleiben etwas kleiner und haben eine eher schlicht-braune Färbung. Zudem besitzen die Männchen lang ausgezogene Flossenspitzen bei Schwanz-, After- und Rückenflosse."},{"page_url":"https://fr.wikipedia.org/wiki/Plaque_d%27immatriculation_saint-marinaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Targa_automobilistica_San_Marino_1993_J0484.jpg","page_title":"Plaque d'immatriculation saint-marinaise","context_page_description":"Les plaques d'immatriculation de Saint-Marin sont composées d'une lettre suivie de quatre chiffres, les inscriptions étant de couleur bleu ciel sur fond blanc aux couleurs du pays.\\nLes armoiries sont présentes sur le côté gauche de la plaque."},{"page_url":"https://tr.wikipedia.org/wiki/Dogger_Bank_Muharebesi_(1915)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Bluecher_sinkend.jpg","page_title":"Dogger Bank Muharebesi (1915)","context_page_description":"Dogger Bank Muharebesi 24 Ocak 1915 tarihinde Kuzey Denizi'nin Dogger Bank adlı yerinde Büyük Britanya Filosu ile Alman İmparatorluk Donanması arasında yaşanan deniz savaşıdır.\\nAlmanların telsiz konuşmalarını deşifre eden Britanyalılar düşmanın Dogger Bank'e yaklaşmakta olduğunu öğrenmiştir. Alman birliklerini tahmin edilen zaman ve yerde yakalamayı başaran Britanya filosu başlattığı uzun menzilli ateşin ardından üstün duruma geçmiştir."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%88%88%E9%BA%A6%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%E8%A5%BF%E7%8F%AD%E7%89%99%E5%A7%93%E6%B0%8F.png","page_title":"戈麦斯","context_page_description":"高梅茲是西班牙語中的姓，可以指：\\n足球運動員：\\n努諾·高梅茲葡萄牙國家足球隊前鋒\\n克里斯蒂亞諾·馬克斯·高梅茲巴西足球運動員，位置後衛。\\n羅納德·高梅茲哥斯大黎加足球運動員，位置前鋒。\\n馬里奧·高梅茲德國足球運動員，位置前鋒。\\n威廉·卡路士·高梅茲巴西足球運動員，位置前鋒。\\n總統：\\n曼努埃爾·高梅茲·佩德拉薩與瓦倫丁·高梅茲·法里亞斯墨西哥總統\\n曼努埃爾·高梅茲·達科斯塔葡萄牙總理\\n比森特·高梅茲薩爾瓦多總統\\n文塞斯勞·布拉斯·佩雷拉·高梅茲巴西總統\\n胡安·比森特·高梅茲委內瑞拉總統\\n政治人物\\n高梅茲，新加坡工人黨政治人物"},{"page_url":"https://az.wikipedia.org/wiki/Jan-Martin_%C5%9Earko","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pr_Charcot_DSC09405.jpg","page_title":"Jan-Martin Şarko","context_page_description":"Jan-Marten Şarko — fransız həkim-psixiatr, Ziqmund Freydin müəllimi, nevroloji xəstəliklər üzrə mütəxəssis, isteriyanın psixogen təbiəti haqda yeni təlimin yaradıcısı. Öz hipotezalarının doğruluğunu sübut etmək üçün psixiatriya sahəsində kliniki tədqiqatlarının çoxusunu hipnoz vasitəsilə etmişdir. Paris universitetində psixiatriya kafedrasının yaradıcısı olmuşdur. Paris Elmlər Akademiyasının, Fransa Coğrafiya cəmiyyətinin üzvü olmuşdur.\\nQütb tədqiqatçısı, okeanoqraf Jan-Batist Şarkonun atası olmuşdur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D0%BA%D0%BE%D0%BC%D0%BE%D1%82%D0%B8%D0%B2%D1%8B_%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/2%D0%A2%D0%AD10%D0%A3-0141.jpg","page_title":"Локомотивы Луганского завода","context_page_description":"Перечень всех локомотивов, выпущенных Луганским тепловозостроительным заводом."},{"page_url":"https://es.wikipedia.org/wiki/Paraguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Tirolesa_desde_llegada.jpg","page_title":"Paraguay","context_page_description":"Paraguay, oficialmente República del Paraguay​, es un país situado en la zona central de América del Sur. Su territorio se divide políticamente en un distrito capital y 17 departamentos, que a su vez se subdividen en 259 municipios. Su capital y ciudad más poblada es Asunción. Políticamente, se constituye en un Estado soberano de derecho, democrático, aconfesional y unitario, cuya forma de gobierno es la república presidencialista. Es miembro fundador del Mercosur junto con Argentina, Brasil y Uruguay.\\nLimita con Argentina al sureste, sur, suroeste y oeste; con Bolivia al norte y noroeste; y con Brasil al este y noreste. Con una superficie de 406 752 km², es el quinto país más pequeño de América del Sur. Su territorio está caracterizado por dos regiones diferentes separadas por el río Paraguay, la Oriental, que es la más poblada, y la Occidental, que forma parte del Chaco Boreal. Si bien es un estado sin litoral marítimo, ​ dispone de costas, ​ playas​ y puertos sobre los ríos Paraná y Paraguay, que le dan salida al océano Atlántico a través de la Hidrovía Paraná-Paraguay.​"},{"page_url":"https://ca.wikipedia.org/wiki/Llat%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/LAZ-Mappa.png","page_title":"Llatí","context_page_description":"El llatí és una llengua indoeuropea de la branca itàlica, parlada antigament pels romans. A partir de l'evolució de la seva versió vulgar sorgiren les llengües romàniques que sobreviuen avui dia.\\nL'Imperi Romà era la garantia del manteniment del llatí en la seva versió clàssica. Amb la caiguda de l'Imperi la llengua del carrer va accelerar l'evolució i va passar a l'estadi que anomenem llatí vulgar, que va anar canviant fins a formar les llengües romàniques actuals. D'altra banda, el llatí clàssic es va mantenir com a llengua de cultura a Europa durant molts segles. La majoria de llengües europees, sobretot les romàniques i l'anglès, han manllevat molt vocabulari directament del llatí clàssic, sobretot per termes d'ús tècnic. Alhora, el llatí també s'utilitza en la classificació taxonòmica dels éssers vius.\\nHi ha hagut diversos intents de reintroduir el llatí clàssic a la vida quotidiana, però no han estat reeixits. El llatí també es va mantenir com a llengua de culte de l'Església catòlica fins al Concili Vaticà Segon."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D0%B4%D0%BE%D0%B2%D0%BE%D0%B5_%D1%82%D0%B5%D0%BB%D0%BE_%D0%B3%D1%80%D0%B8%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Calocera_viscosa_NV.jpg","page_title":"Плодовое тело гриба","context_page_description":"Плодо́вое те́ло — репродуктивная часть организма гриба, образующаяся из переплетённых гиф мицелия. Функцией плодового тела является образование спор, возникающих в результате полового процесса. В обиходе плодовое тело обычно называется просто «гриб». Плодовое тело аскомицетов называют также аскока́рп или аско́ма, а базидиомицетов — базидиока́рп или базидио́ма.\\nПлодовыми телами называют также спороносящие органы слизевиков.\\nЗнать строение и признаки плодовых тел полезно любому грибнику, это поможет грамотно и точно определять грибы при сборе.\\nОсобенно важно уметь уверенно различать ядовитые грибы и похожие на них съедобные."},{"page_url":"https://nl.wikipedia.org/wiki/Walfridusbrug","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/20120819_Walfridusbrug_Van_Starkenborghkanaal_Groningen_NL.jpg","page_title":"Walfridusbrug","context_page_description":"De Walfridusbrug is een spoorbrug ten noorden van Groningen over het Van Starkenborghkanaal en de N361 voor de spoorlijn Groningen - Delfzijl. De huidige brug is gebouwd in 2003 en verving een brug uit 1932."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BC%D0%B0_%D0%9C%D0%BE%D0%BA%D0%BE%D0%BD%D1%8C%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Lama_Mocogno_chiesa_parrocchiale.jpg","page_title":"Лама Моконьо","context_page_description":"Ла̀ма Моко̀ньо е малко градче и община в Северна Италия, провинция Модена, регион Емилия-Романя. Разположено е на 842 m надморска височина. Населението на общината е 2827 души."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_Moncton","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Moncton_Museum.jpg","page_title":"List of historic places in Moncton","context_page_description":null},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_spoorwegstations_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/StationMiddelburg.jpg","page_title":"Lijst van spoorwegstations in Nederland","context_page_description":"Hieronder volgt een lijst van alle huidige 400 spoorwegstations in Nederland en op korte termijn te openen nieuwe stations met verwacht jaartal van ingebruikname. Van deze stations worden er vier alleen bij evenementen in de naastliggende stadions gebruikt, Eemshaven alleen als de veerdienst naar Borkum gaat, en Utrecht Maliebaan alleen als het Spoorwegmuseum open is."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%A3%E0%B8%A1%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%B2%E0%B8%99%E0%B8%B8%E0%B8%AA%E0%B8%B2%E0%B8%A7%E0%B8%A3%E0%B8%B5%E0%B8%A2%E0%B9%8C%E0%B8%9E%E0%B9%88%E0%B8%AD%E0%B8%82%E0%B8%B8%E0%B8%99%E0%B8%A3%E0%B8%B2%E0%B8%A1%E0%B8%84%E0%B8%B3%E0%B9%81%E0%B8%AB%E0%B8%87%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B8%B2%E0%B8%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Ram_Khamhaeng_the_Great_%28I%29.jpg","page_title":"พระบรมราชานุสาวรีย์พ่อขุนรามคำแหงมหาราช","context_page_description":"พระบรมราชานุสาวรีย์พ่อขุนรามคำแหงมหาราช ตั้งอยู่ที่ตำบลเมืองเก่า อำเภอเมืองสุโขทัย จังหวัดสุโขทัย อนุสาวรีย์แห่งนี้สร้างขึ้นเพื่อถวายเป็นราชสักการะแด่พ่อขุนรามคำแหงมหาราช พระมหากษัตริย์ในสมัยสุโขทัยผู้มีพระมหากรุณาธิคุณอันยิ่งใหญ่และทรงมีพระปรีชาสามารถนานัปการ อาทิ การประดิษฐ์อักษรไทย การปกครองแบบพ่อปกครองลูก บ้านเมืองร่มเย็นเป็นสุข และอุดมสมบูรณ์ กรมศิลปกรเป็นหน่วยงานควบคุมการออกแบบ โดยจอมพลถนอม กิตติขจร นายกรัฐมนตรีในขณะนั้น ได้เป็นประธานในพิธิวางศิลาฤกษ์ เมื่อวันที่ 26 พฤศจิกายน พ.ศ. 2512"},{"page_url":"https://cs.wikipedia.org/wiki/Voskovn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Myrica_rubra5.jpg","page_title":"Voskovník","context_page_description":"Voskovník je rod rostlin z čeledi vřesnovité. Jsou to dřeviny s jednoduchými střídavými listy a drobnými, bezobalnými květy uspořádanými v jehnědovitých květenstvích. Rod zahrnuje asi 44 druhů a je rozšířen v Americe, Asii i Africe. V Evropě není zastoupen. Rod Morella byl na základě výsledků molekulárních studií oddělen od rodu Myrica a byla do něj přeřazena převážná většina druhů tohoto rodu. Některé druhy mají jedlé plody, jsou zdrojem vosků nebo poskytují kvalitní palivo. V botanických zahradách v České republice se lze setkat s voskovníkem pensylvánským."},{"page_url":"https://pl.wikipedia.org/wiki/Claudia_Nolte","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/KAS-Nolte%2C_Claudia-Bild-14994-1.jpg","page_title":"Claudia Nolte","context_page_description":"Claudia Nolte, właśc. Claudia Crawford z domu Wiesemüller – niemiecka polityk, działaczka Unii Chrześcijańsko-Demokratycznej, posłanka do Bundestagu, w latach 1994–1998 minister ds. rodziny, osób starszych, kobiet i młodzieży."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9B%BD%E9%99%85%E7%A9%BA%E9%97%B4%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/ISS_and_Endeavour_seen_from_the_Soyuz_TMA-20_spacecraft_14.jpg","page_title":"国际空间站","context_page_description":"国际空间站是一个在近地轨道上运行的科研设施，是人类历史上第九个载人的空间站。空间站的主要功能是作为在微重力环境下的研究实验室，研究领域包括生物学、物理学、天文学、地理学、气象学等，目前由五个国家或地区合作运转，包括美国国家航空航天局、俄罗斯联邦航天局、日本宇宙航空研究开发机构、加拿大航天局、和欧洲空间局。中华人民共和国曾表达参与国际空间站建设的意向，但因美国出于政治原因反对其加入以及中方资金、技术不足等诸多障碍最终未能提交申请。迄今为止，已有来自多国的航天员登上国际空间站执行任务，但均为美国或俄罗斯主导的太空计划，其中还包括七名太空游客。从1998年11月15日国际空间站第一个部分曙光号功能货舱发射升空。到2010年6月，空间站已经在轨道上环绕地球运转了66000圈。国际空间站原计划在2020年后结束使命，后来改为2024年。。负责国际空间站与地面之间运输的航天器有联盟号、进步号、自动运载飞船、H-II运输载具、龙飞船、发现号航天飞机、奋进号航天飞机、天鹅号宇宙飞船等。国际空间站最多可承载六名乘员，大部分实验设施也已经投入使用。由于大气阻力和重新启动等因素的影响，国际空间站的轨道实际高度常发生漂移。"},{"page_url":"https://pl.wikipedia.org/wiki/Muchomornica_delikatna","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Illustrations_of_British_Fungi_%28Hymenomycetes%29%2C_to_serve_as_an_atlas_to_the_%22Handbook_of_British_Fungi%22_%28Pl._45%29_%288163910424%29.jpg","page_title":"Muchomornica delikatna","context_page_description":"Muchomornica delikatna – gatunek grzybów z rodziny muchomorowatych."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_o_Carycyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Mitrophan_Grekov_33_-_Stalin%2C_Voroshilov_and_Shchadenko_in_the_trenches_Tsaritsyn.jpg","page_title":"Bitwa o Carycyn","context_page_description":"Bitwa o Carycyn – seria bitew wojny domowej w Rosji o kontrolę nad Carycynem. Miasto, w 1917 ważny ośrodek poparcia dla rewolucji, pozostające w rękach czerwonych, było trzykrotnie oblegane przez antybolszewickich Kozaków dońskich pod dowództwem Piotra Krasnowa: między lipcem a wrześniem 1918, wrześniem i październikiem 1918 oraz styczniem i lutym 1919. Kolejną próbę zdobycia Carycyna podjęła w maju-czerwcu 1919 Armia Ochotnicza, odnosząc sukces. Z kolei między sierpniem 1919 a styczniem 1920 to biali bronili miasta przed bolszewikami. Carycyn został ostatecznie zdobyty przez czerwonych na początku 1920.\\nObrona Carycyna, nazywanego czerwonym Verdun, była jednym z najszerzej opisywanych i upamiętnianych w radzieckiej historiografii, literaturze, sztuce i propagandzie wydarzeń wojny domowej. Zdecydował o tym fakt, iż w obronie miasta między lipcem a listopadem 1918 brał udział Józef Stalin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BA%D0%B0_%D0%A5%D1%83%D0%BD%D0%B8%D0%BE%D1%80%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Panorama_La_Bombonera_%28Buenos_Aires%2C_Argentina%29_looking_east.jpg","page_title":"Бока Хуниорс","context_page_description":"«Бо́ка Ху́ниорс» — один из сильнейших и самых популярных аргентинских футбольных клубов из города Буэнос-Айрес. «Бока» выиграла 22 международных турниров, является одним из рекордсменов мира по этому показателю, вместе с клубами «Реал Мадрид» и «Аль-Ахли». Сюда входят шесть Кубков Либертадорес и три Межконтинентальных Кубка. Клуб 28 раза становился чемпионом Аргентины, что является вторым показателем в Аргентине после «Ривер Плейта». Противостояние с этим клубом является Суперкласико аргентинского футбола, и одним из важнейших дерби в мировом футболе.\\n«Бока» заняла 12-е место в списке лучших клубов XX века ФИФА. Также клуб входит в число 20 лучших клубов мира по версии Международной федерации футбольной истории и статистики, 6 раз занимал первую строчку в ежемесячной версии этого списка — в основном во время пребывания Карлоса Бьянки на посту тренера. «Бока Хуниорс» является рекордсменом по количеству участий в финале Кубка Либертадорес."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9C%D1%83%D0%B3%D0%BD%D0%B8_%D0%93%D0%B5%D0%B2%D0%BE%D1%80%D0%B3_%D1%81%D0%B8%D1%80%D0%BA%D3%99%D2%AF%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Saint_Gevorg_of_Mughni_Armenian_Church%2C_Old_Tbilisi_5.jpg","page_title":"Мугни Геворг сиркәүе","context_page_description":"Мугни Геворг сиркәүе, шулай уҡ изге Мугни Георгий сиркәүе Грузияның баш ҡалаһы Тбилисиҙа урынлашҡан, 1756 йылда тулыһынса үҙгәртеп ҡоролған 13 быуат сиркәү булып тора. Сиркәү кирбестән яһалған, үҙаллы дүрт бағанаға таянған тура мөйөшлө тәренән тора."},{"page_url":"https://ga.wikipedia.org/wiki/Hamish_Linklater","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Hamish_Linklater_Seminar.jpg","page_title":"Hamish Linklater","context_page_description":"Is aisteoir Meiriceánach é Hamish Linklater."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C_%DB%8C%D8%AA%D8%A7%D8%8C_%D8%A7%DB%8C%D9%84%DB%8C%D9%86%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/OKMap-doton-Marietta.PNG","page_title":"ماری یتا، ایلینوی","context_page_description":"ماری یتا، ایلینوی آمریکا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۲۶۲۶ نفر ایمیش و ۶٫۲ کیلومتر موربّع ساحه‌سی وار دنیز سوُلاری سَویه‌سیندن ۲۵۸ متر یۇکسک‏لیکده یئر آلیب و اوکلاهوما ایالتینده یئرلشیب."},{"page_url":"https://de.wikipedia.org/wiki/Sultanat_von_Delhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Sultanat_von_Delhi_Tughluq-Dynastie.png","page_title":"Sultanat von Delhi","context_page_description":"Sultanat von Delhi ist die Bezeichnung für ein bedeutendes islamisches Reich in Nordindien, das von 1206 bis 1526 existierte und durch das Mogulreich abgelöst wurde. Die Hauptstadt war Delhi, das zu einer Metropole aufstieg. Das Sultanat war innerlich nicht sonderlich stabil, Revolten der Statthalter und unterworfener Fürsten sowie Umsturzversuche bei Hofe füllten seine Geschichte aus."},{"page_url":"https://pl.wikipedia.org/wiki/Sonntag_(Austria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Sonntag_Vorarlberg_1.JPG","page_title":"Sonntag (Austria)","context_page_description":"Sonntag – gmina w Austrii, w kraju związkowym Vorarlberg, w powiecie Bludenz. Liczy 681 mieszkańców."},{"page_url":"https://sk.wikipedia.org/wiki/Elektri%C4%8Dkov%C3%A1_doprava_v_I%C5%BEevsku","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Tram_in_Izhevsk_after_Tramvainoe_koltso.jpg","page_title":"Električková doprava v Iževsku","context_page_description":"Električková doprava v ruskom meste Iževsk funguje od 18. novembra 1935. V súčasnosti je na sieti dlhej 75,5 km prevádzkovaných 11 liniek."},{"page_url":"https://vi.wikipedia.org/wiki/Spermacoce_ocymoides","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Spermacoce_ocymoides_W2_IMG_2963.jpg","page_title":"Spermacoce ocymoides","context_page_description":"Spermacoce ocymoides là một loài thực vật có hoa trong họ Thiến thảo. Loài này được Burm.f. miêu tả khoa học đầu tiên năm 1768."},{"page_url":"https://es.wikipedia.org/wiki/Paulina_Vega","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Paulina_Vega_en_la_XXXVI_versi%C3%B3n_de_la_Caminata_de_la_Solidaridad_por_Colombia.jpg","page_title":"Paulina Vega","context_page_description":"Paulina Vega Dieppa es una modelo, presentadora y reina de belleza colombiana, elegida Señorita Colombia 2013-2014 y ganadora del título Miss Universo 2014.​​\\nVega se desempeña como empresaria e imagen de marcas internacionales como BMW, Adidas, Falabella, Pantene entre otras. También ejerce como embajadora de Stop Hunger Now y ha sido presentadora del reality musical A otro nivel.​"},{"page_url":"https://de.wikipedia.org/wiki/Daihatsu_Hijet","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Daihatsu_Hijet_Jumbo_001.JPG","page_title":"Daihatsu Hijet","context_page_description":"Daihatsu Hijet ist eine Baureihe von Kleintransportern des japanischen Herstellers Daihatsu."},{"page_url":"https://simple.wikipedia.org/wiki/Yashoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Krishna%27s_Foster-Mother%2C_Yashoda%2C_with_the_Infant_Krishna.jpg","page_title":"Yashoda","context_page_description":"Yasoda/Yashoda was the wife of Nanda in the Puranic books of Hinduism."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9D%BC%EC%98%A4%EC%8A%A4%EC%9D%98_%EA%B5%AD%EC%9E%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Emblem_of_Laos.svg","page_title":"라오스의 국장","context_page_description":"라오스의 국장은 1991년에 제정되었다. 현재의 국장은 1975년에 제정된 국장에 그려져 있던 낫과 망치, 별을 파탓루앙으로 바꾼 형태의 디자인이다.\\n국장 가운데에는 파탓루앙이 그려져 있으며 사원 아래쪽에는 아스팔트로 포장된 도로가 그려져 있다. 도로 왼쪽에는 댐이, 오른쪽에는 논이 그려져 있다. 국장 아래쪽에는 톱니바퀴가 그려져 있으며 벼 이삭이 국장의 양쪽을 감싸고 있다.\\n국장 아래쪽에 그려져 있는 빨간색 리본 가운데에는 라오스의 공식 명칭인 \\"라오 인민 민주 공화국\\"이 라오어로 쓰여져 있으며 양쪽에는 라오스의 나라 표어인 \\"평화, 독립, 민주주의\\", \\"통일과 번성\\"이 라오어로 쓰여져 있다."},{"page_url":"https://en.wikipedia.org/wiki/Luxembourg_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Turner_St_Esprit_Luxembourg.jpg","page_title":"Luxembourg art","context_page_description":"Luxembourg art can be traced back to Roman times, especially as depicted in statues found across the country and in the huge mosaic from Vichten. Over the centuries, Luxembourg's churches and castles have housed a number of cultural artefacts but these are nearly all ascribed to foreign artists. The first examples of art with a national flavour are paintings and maps of the City of Luxembourg and its fortifications from the end of the 16th until the beginning of the 19th century, although these too were mostly created by foreign artists. Real interest in art among the country's own citizens began in the 19th century with paintings of Luxembourg and the surroundings after the country became a grand duchy in 1815. This was followed by interest in Impressionism and Expressionism in the early 20th century, the richest period in Luxembourg painting, while Abstraction became the focus of art after the Second World War. Today there are a number of successful contemporary artists, some of whom have gained wide international recognition."},{"page_url":"https://fr.wikipedia.org/wiki/Th%C3%A9%C3%A2tre_occidental_de_la_guerre_de_S%C3%A9cession","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/ACW_Western_Theater_May_-_October_1862.png","page_title":"Théâtre occidental de la guerre de Sécession","context_page_description":"Cet article présente une vue d'ensemble des principales opérations militaires et navales qui se sont déroulées sur le Théâtre occidental de la guerre de Sécession."},{"page_url":"https://cs.wikipedia.org/wiki/V%C5%A1echov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/V%C5%A1echov%2C_k%C5%99%C3%AD%C5%BEek_na_konci_obce.jpg","page_title":"Všechov","context_page_description":"Všechov je jednou z 15 místních částí města Tábor. Nachází se západně od Tábora, podél silnice číslo 19, 2,8 km od mimoúrovňové křižovatky silnic č.19 a 603 na severním okraji Tábora. V roce 2011 zde trvale žilo 28 obyvatel. Všechov těsně sousedí s místní částí Zahrádka. Má PSČ 391 31 a 15 domů.\\n500 m severně od Všechova je často využívané letiště pro sportovní létání a různé akce."},{"page_url":"https://en.wikipedia.org/wiki/John_Cordy_Burrows","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Statue_of_John_Cordy_Burrows%2C_Old_Steine%2C_Brighton_%28IoE_Code_481003%29.jpg","page_title":"John Cordy Burrows","context_page_description":"Sir John Cordy Burrows was a British surgeon and local politician."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8B%A5%E7%BE%8C%E9%95%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Loulan_Museum%2C_Charklik.jpg","page_title":"若羌镇","context_page_description":"若羌镇，是中华人民共和国新疆维吾尔自治区巴音郭楞蒙古自治州若羌县下辖的一个乡镇级行政单位。若羌镇是若羌县县治。\\n镇东五公里为卡克里克遗址，乃鄯善两故都扜泥与伊循之一。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%82%B9V","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ares-V_%28Feb_2008%29.jpg","page_title":"アレスV","context_page_description":"アレスV は、アメリカ航空宇宙局 のコンステレーション計画で使用される予定だった2段式の貨物打ち上げ用使い捨て型ロケットである。2019年の初打ち上げを目指して開発することが計画されていたが、コンステレーション計画の中止に伴い開発が中止された。当初は貨物ロケット と呼ばれていた。ギリシャ神話から名づけられ、英語の発音はエアリーズ-ファイブに近い。\\n2010年4月15日、バラク・オバマ大統領がケネディ宇宙センターで、2015年までに30億ドルをかけてアレスVに変わる新たな大重量打ち上げロケットの設計をする計画があることを発表し、2011年9月にNASAがスペース・ローンチ・システムの開発と2017年の初打ち上げを発表した。"},{"page_url":"https://sv.wikipedia.org/wiki/Smilax_melastomifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Starr_030405-0241_Smilax_melastomifolia.jpg","page_title":"Smilax melastomifolia","context_page_description":"Smilax melastomifolia är en enhjärtbladig växtart som beskrevs av James Edward Smith. Smilax melastomifolia ingår i släktet Smilax och familjen Smilacaceae.\\nArtens utbredningsområde är Hawaii. Inga underarter finns listade."},{"page_url":"https://es.wikipedia.org/wiki/Kullawada","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Danza_Kullawada_2_en_Gran_Poder_La_Paz_2017.jpg","page_title":"Kullawada","context_page_description":"La Kullawada, kullahuada, cullaguada o kullawa es una danza boliviana inspirado en los hilanderos que se dedicaban a las actividades textiles en los obrajes de La Paz, es bailada principalmente en el Carnaval de Oruro y la Fiesta del Gran Poder en La Paz."},{"page_url":"https://fr.wikipedia.org/wiki/Arum_titan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Titanarumcorm.jpg","page_title":"Arum titan","context_page_description":"L’Arum titan, Amorphophallus titanum, également appelé le « phallus de titan », est une espèce de plantes de la famille des Aracées. Son inflorescence est une des plus hautes du monde après celle du tallipot, avec plus de trois mètres."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B5%D0%BD%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%AF%D0%BA%D0%BE%D0%B2_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Galenkovskiy_Yakov_Andreevich.png","page_title":"Галенковский, Яков Андреевич","context_page_description":"Яков Андреевич Галенковский — русский поэт, писатель, критик, переводчик и издатель."},{"page_url":"https://sk.wikipedia.org/wiki/Ferdinand_Christian_Baur","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ferdinand_Ch_Baur_Gedenktafel_Fellbach-Schmiden.jpg","page_title":"Ferdinand Christian Baur","context_page_description":"Ferdinand Christian Baur bol nemecký protestantský teológ a cirkevný historik, zakladateľ tzv. Mladšej tübingenskej teologickej školy. Etabloval historicko-kritickú exegetickú metódu ako obligátnu súčasť teologického výskumu."},{"page_url":"https://af.wikipedia.org/wiki/Bea_Benaderet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Bea_Benadaret_1966.JPG","page_title":"Bea Benaderet","context_page_description":"Bea Benaderet was 'n Amerikaanse aktrise. Sy was bekend vir haar rolle in die rolprent Tender Is the Night en in die televisiereekse The George Burns and Gracie Allen Show, The Flintstones, en Petticoat Junction."},{"page_url":"https://lt.wikipedia.org/wiki/Pirmasis_kry%C5%BEiaus_%C5%BEygis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Counquest_of_Jeusalem_%281099%29.jpg","page_title":"Pirmasis kryžiaus žygis","context_page_description":"Pirmasis kryžiaus žygis buvo pirmasis pagal eilę iš daugelio Kryžiaus žygių, kuriais buvo siekiama užimti Šventąją Žemę. Apie pirmąjį žygį apginti musulmonų persekiojamus krikščionis ir išvaduoti Jeruzalėje esantį Jėzaus Kristaus karstą paskelbė popiežius Urbonas II Klermono bažnytiniame susirinkime 1095 m. Popiežius kvietė suteikti karinę pagalbą Bizantijai, kuri jau buvo praradusi beveik visą Anatoliją turkų seldžiukams.\\nTarp 1096 ir 1101 m. Bizantijos graikai patyrė tris atskiras kryžiuočių žygio bangas. 1096 m. pavasarį į Konstantinopolio apylinkes atvyko pirmoji didelė, nedisciplinuota ir blogai aprūpinta kariuomene. Ši pirmoji grupė dažnai vadinama Valstiečių kryžiaus žygiu arba Liaudies kryžiaus žygiu. Jai vadovavo Petras Eremitas ir Valteris Beturtis. Antrojoje bangoje, nužygiavusioje 1099 m. iki pat Jeruzalės, dalyvavo Prancūzijos, Lotaringijos, Vokietijos ir Italijos riteriai. Kariuomenė neturėjo bendros vadovybės, atskiriems kontingentams vadovavo savi valdovai."},{"page_url":"https://fr.wikipedia.org/wiki/Caledonia_(Nouvelle-%C3%89cosse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Caledonia_-_Queens_County.jpg","page_title":"Caledonia (Nouvelle-Écosse)","context_page_description":"Caledonia est une localité de la Nouvelle-Écosse située à Queens."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-la-Nativit%C3%A9_de_Villaines-sous-Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Villaines-sous-Bois_%2895%29%2C_%C3%A9glise_Notre-Dame_de_la_Visitation%2C_ch%C5%93ur%2C_porte_de_la_sacristie%2C_datant_d%27origine.JPG","page_title":"Église Notre-Dame-de-la-Nativité de Villaines-sous-Bois","context_page_description":"L'église Notre-Dame-de-la-Nativité est une église catholique paroissiale située à Villaines-sous-Bois, dans le Val-d'Oise, en France. La paroisse est attestée dès le milieu du XIIIᵉ siècle, et de cette époque pourrait dater le clocher, sans caractère particulier. Pendant la seconde moitié du XVIᵉ siècle, le chœur est reconstruit dans un style hésitant entre le gothique flamboyant, pour le profil des nervures de la voûte et l'emploi de l'arc brisé, et la Renaissance, pour les clés de voûte pendantes et les chapiteaux. Le chœur ne comporte qu'une unique travée carrée et est très basse, mais il se distingue par son architecture raffinée, insoupçonnée pour une minuscule église rurale. La nef est une simple salle rectangulaire, qui a reçu sa forme actuelle au XVIIIᵉ siècle. L'église de la Nativité a été inscrite aux monuments historiques en 1969. Elle a été restaurée par la suite, et se trouve aujourd'hui dans un parfait état de conservation. Malgré la petite taille du village, elle accueille des messes dominicales anticipées chaque samedi soir à 18 h 30. Elles sont célébrées selon la forme extraordinaire du rite latin."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%95%E0%A5%87%E0%A4%AA%E0%A5%8D%E0%A4%B2%E0%A4%B0_%E0%A4%85%E0%A4%82%E0%A4%A4%E0%A4%B0%E0%A4%BF%E0%A4%95%E0%A5%8D%E0%A4%B7_%E0%A4%AF%E0%A4%BE%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Kepler_space_telescope_shortly_after_the_assembly_to_the_third_stage.jpg","page_title":"केप्लर अंतरिक्ष यान","context_page_description":"कॅप्लर अंतरिक्ष यान अमेरिकी अंतरिक्ष अनुसन्धान संस्थान, नासा, का एक अंतरिक्ष यान है, जिसका काम सूरज से अलग किंतु उसी तरह अन्य तारों के इर्द-गिर्द ऐसे ग़ैर-सौरीय ग्रहों को ढूंढना है जो पृथ्वी से मिलते-जुलते हों। कॅप्लर को ७ मार्च २००९ में रोकेट के ज़रिये अंतरिक्ष में भेजा गया था, जहाँ यह अब पृथ्वी की परिक्रमा कर रहा है और अन्य तारों पर अपनी नज़रें रखे हुए है। अनुमान है कि यह कम-से-कम ३.५ वर्ष तक अपना कार्य करेगा।"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BD%D5%B8%D5%AC%D5%AB%D5%B6%D5%A5%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Lwow-Ossolineum4.jpg","page_title":"Օսոլինեում","context_page_description":"Օսոլինեում կամ Օսոլինսկիների անվան ազգային գրադարան, Լեհաստանի ազգային գրադարան:"},{"page_url":"https://sv.wikipedia.org/wiki/Profet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Prophet-Elias-Grk-ikon.png","page_title":"Profet","context_page_description":"Profet är en person som förutsäger eller förutspår kommande ting eller framträder som religiös förkunnare. En profetia är i regel en gudomlig uppenbarelse eller förutsägelse om vad som skall ske.\\nProfeter är kända från judendom, kristendom, zoroastrism och islam, men även från andra religioner.\\nExempel på personer som kallats profeter är Mose, Zarathustra, Jesus, Muhammed och Buddha."},{"page_url":"https://fr.wikipedia.org/wiki/Charcenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Charcenne%2C_chapelle_Notre-Dame_de_Leffond-2.jpg","page_title":"Charcenne","context_page_description":"Charcenne est une commune du département de la Haute-Saône, dans la région Bourgogne-Franche-Comté, en France. Les habitants sont les Charcennais."},{"page_url":"https://en.wikipedia.org/wiki/Swabian_Circle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Eschach_Ravensburg_Wappen.png","page_title":"Swabian Circle","context_page_description":"The Circle of Swabia or Swabian Circle was an Imperial Circle of the Holy Roman Empire established in 1500 on the territory of the former German stem-duchy of Swabia. However, it did not include the Habsburg home territories of Swabian Austria, the member states of the Swiss Confederacy nor the lands of the Alsace region west of the Rhine, which belonged to the Upper Rhenish Circle. The Swabian League of 1488, a predecessor organization, disbanded in the course of the Protestant Reformation later in the 16th century."},{"page_url":"https://en.wikipedia.org/wiki/Cline_Falls_State_Scenic_Viewpoint","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Cline_Falls_State_Park%2C_Redmond%2C_Oregon.JPG","page_title":"Cline Falls State Scenic Viewpoint","context_page_description":"Cline Falls State Scenic Viewpoint is a state park near Redmond, Oregon, United States. It is located on the Deschutes River. The park covers 9 acres. It is administered by the Oregon Parks and Recreation Department."},{"page_url":"https://es.wikipedia.org/wiki/Conasprella_baileyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Conus_baileyi_1.jpg","page_title":"Conasprella baileyi","context_page_description":"El Conasprella baileyi es una especie de caracol de mar, un molusco gasterópodo marino en la familia Conidae, los caracoles cono y sus aliados.​\\nEstos caracoles son depredadores y venenosos. Son capaces de \\"picar\\" a los seres humanos y seres vivos, por lo que debe ser manipulado con cuidado o no hacerlo en absoluto."},{"page_url":"https://it.wikipedia.org/wiki/Jacopo_Fo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Jacopo_Fo_01.jpg","page_title":"Jacopo Fo","context_page_description":"Jacopo Fo è uno scrittore, attore, regista, fumettista, blogger e attivista italiano."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%89%A2%E4%BC%8F%E5%B1%B1_(%E5%AF%8C%E5%B1%B1%E7%9C%8C%E5%AF%8C%E5%B1%B1%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mount_Hachibuse_%28Toyama%29_-_panoramio.jpg","page_title":"鉢伏山 (富山県富山市)","context_page_description":"鉢伏山は富山県富山市にある山。標高は1782m。山頂は草原や高層湿原で眺めがよく、またコバイケイソウなどが自生する。。\\n富山県登山連盟において富山の百山の一つに指名されている。県立有峰自然公園内にある。"},{"page_url":"https://en.wikipedia.org/wiki/Cathedral_Caverns_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Cathedral_Cavern_Entrance_2019.png","page_title":"Cathedral Caverns State Park","context_page_description":"Cathedral Caverns State Park is a publicly owned recreation area and natural history preserve located in Kennamer Cove, Alabama, approximately 5 miles northeast of Grant and 7 miles southeast of Woodville in Marshall County. The park's main feature, first known as Bats Cave, was developed as a tourist attraction in the 1950s. Cathedral Caverns was declared a National Natural Landmark in 1972 and opened as a state park in 2000."},{"page_url":"https://pt.wikipedia.org/wiki/Edif%C3%ADcio_It%C3%A1lia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/It%C3%A1lia_Building_in_S%C3%A3o_Paulo_%28By_Felipe_Mostarda%29.JPG","page_title":"Edifício Itália","context_page_description":"O Edifício Itália, cujo nome oficial é Circolo Italiano, localizado na Avenida Ipiranga, numero 344, é o segundo maior prédio da cidade de São Paulo e um dos maiores do Brasil, com 165 metros metros de altura a partir do nível da rua, distribuídos em 46 andares e dezenove elevadores. Inaugurado em 1965, é atualmente um dos marcos da cidade, protegido pelo Patrimônio Histórico por ser um dos maiores exemplos da arquitetura verticalizada brasileira.\\nA construção do Itália foi permitida pelas autoridades municipais apenas por se localizar em um dos pontos focais de São Paulo, segundo consta nos documentos guardados pela administração do edifício. Um dos maiores destaques do edifício é o restaurante localizado no seu topo, conhecido como Terraço Itália, que além de ser um dos mais famosos de São Paulo, permite uma vista em 360 graus da cidade, sendo um dos mais importantes pontos turísticos da capital paulista.\\nNo andar térreo do edifício há também um teatro e uma galeria de arte. Em dois pequenos prédios anexos encontra-se um antigo clube. Os demais andares são ocupados por escritórios."},{"page_url":"https://pt.wikipedia.org/wiki/Exposi%C3%A7%C3%A3o_Universal_de_1915","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Palace-of-fine-arts-1919.jpg","page_title":"Exposição Universal de 1915","context_page_description":"A Exposição Universal de 1915 foi uma feira mundial realizada em San Francisco entre 20 de fevereiro e 4 de dezembro de 1915. O seu propósito foi celebrar o final da construção do Canal do Panamá, bem como a recuperação da cidade de San Francisco do terremoto de 1906. A feira localizou-se entre Presidio e Fort Mason, no que hoje é chamado de Marina District."},{"page_url":"https://ceb.wikipedia.org/wiki/Buszkowo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Buszkowo_church.jpg","page_title":"Buszkowo","context_page_description":"Lungsod ang Buszkowo sa Polskowa. Nahimutang ni sa powiat sa Powiat bydgoski ug gingsakopan sa Województwo Kujawsko-Pomorskie, sa sentro nga bahin sa nasod, 240 km sa amihanan-kasadpan sa Warsaw ang ulohan sa nasod. 114 metros ibabaw sa dagat kahaboga ang nahimutangan sa Buszkowo, ug adunay 400 ka molupyo.\\nAng yuta palibot sa Buszkowo kay patag, ug nga tinakpan sa ubos sa sidlakan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 143 ka metro ug 1.8 km sa kasadpan sa Buszkowo. Dunay mga 62 ka tawo kada kilometro kwadrado sa palibot sa Buszkowo medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Koronowo, 6.1 km sa habagatan-sidlakan sa Buszkowo. Hapit nalukop sa kaumahan ang palibot sa Buszkowo. Sa rehiyon palibot sa Buszkowo, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%A8%D7%91%D7%95%D7%A8_%D7%A9%D7%97%D7%95%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Black_Swan_in_Flight_Crop.jpg","page_title":"ברבור שחור","context_page_description":"ברבור שחור הוא מין עוף מים גדול, מהסוג ברבור. מקור שמו של הברבור השחור הוא בנוצותיו השחורות, המקנות לו מראה ייחודי ויוצא דופן בקרב הברבורים, שהם לבנים בדרך כלל.\\nהברבור השחור התגלה באוסטרליה לראשונה כבר במאה ה-17. בשנת 1697 הפליג החוקר ההולנדי ווילם דה ולמינג אל תוך נהר הזורם במערב אוסטרליה וקרא לו בשם נהר סוואן על שם הברבור שנצפה באזור.\\nהברבור השחור תואר לראשונה על ידי חוקר-הטבע האנגלי ג'ון לאת'ם ב-1790. הוא קטלג אותו כמין יחיד בסוג Chenopis atratus, Chenopis. לאחר מכן הועבר כמין לסוג ברבור.\\nהברבור השחור מקנן בדרום מזרח ודרום מערב אוסטרליה, והוא מופיע בסמלה ובדגלה של אוסטרליה המערבית החל מ-1870. ב-1973 אומץ הברבור השחור כעוף הלאומי של המדינה."},{"page_url":"https://de.wikipedia.org/wiki/Freiburger_Rieselfeld","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Freiburger_Rieselfeld_09.jpg","page_title":"Freiburger Rieselfeld","context_page_description":"Das Freiburger Rieselfeld ist ein Naturschutzgebiet und ehemaliges Rieselfeld der Stadt Freiburg im Breisgau in Baden-Württemberg. Es ist zugleich Namensgeber des ab 1993 entstandenen Stadtteils Rieselfeld.\\nIm Schutzgebiet finden sich landschaftlich ansprechende und charakteristische Strukturen des ehemaligen Rieselfeldes als wesentliche Bestandteile einer historischen Kulturlandschaft mit naturnahen Feuchtwäldern im Randbereich. Es ist ein Lebensraum für eine Vielzahl seltener und zum Teil gefährdeter Tier- und Pflanzenarten."},{"page_url":"https://nl.wikipedia.org/wiki/Idalion","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Decree_Stasicypros_CdM.jpg","page_title":"Idalion","context_page_description":"Idalion of Idalium was een oude stad op Cyprus, in de buurt van het huidige Dali in het district Nicosia."},{"page_url":"https://en.wikipedia.org/wiki/Kamenice_nad_Lipou","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Kamenice-nad-Lipou-n%C3%A1m%C4%9Bst%C3%AD2015.jpg","page_title":"Kamenice nad Lipou","context_page_description":"Kamenice nad Lipou is a small town situated in the Bohemian-Moravian Highlands between Pelhřimov and Jindřichův Hradec. Its most important sight is a castle. It took part of its name after an ancient lime tree that still grows in the garden adjacent to the castle. The tree is believed to be 700–900 years old. A famous Jindřichův Hradec to Obrataň narrow gauge railway runs through the town."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%9D%B1%E4%BA%9E%E8%AA%9E%E6%96%87%E6%8E%92%E5%88%97%E6%96%B9%E5%90%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Forbidden_City_Gate_of_Heaven_1.jpg","page_title":"東亞語文排列方向","context_page_description":"東亞嘅漢字圈語文用嘅方塊字可以橫排或者豎排。橫排即係話啲字會左右並排；豎排就指啲字由上至下、打棟咁排。一種語文冇限定書寫方向，重要橫排、豎排、甚至混用都得，係現代語言文字比較少見嘅現象，係方塊字語文嘅一種特色。\\n傳統嘅中文、以及受佢影響嘅日文同朝鮮文都係豎排嘅，亦即先由上至下咁寫，一行寫完再向左邊寫。所以，打棟排嘅書都是開左邊、向右邊揭嘅。漢字同埋日文假名嘅筆劃結構亦都適合呢種書寫原理。\\n喺英文等等嘅歐洲語文所影響之下，漢字圈嘅語文從近代起開始橫排，亦即係由左至右咁寫，一行寫完向下發展。簡體中文同朝鮮文甚至幾乎完全唔用豎排。\\n同樣屬於東亞嘅蒙古，所用嘅拼音文字蒙古文就有兩種書寫方法：喺中國境內嘅內蒙古用嘅蒙古文字母係豎排嘅，即係先由上至下咁寫；但係就同中、日、韓文唔同，寫完一行會向右邊發展。至於蒙古國就會用從俄國輸入嘅西里爾字母，由左至右打橫排。"},{"page_url":"https://en.wikipedia.org/wiki/Heterocyclic_compound","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Oxetan.png","page_title":"Heterocyclic compound","context_page_description":"A heterocyclic compound or ring structure is a cyclic compound that has atoms of at least two different elements as members of its ring. Heterocyclic chemistry is the branch of organic chemistry dealing with the synthesis, properties, and applications of these heterocycles.\\nExamples of heterocyclic compounds include all of the nucleic acids, the majority of drugs, most biomass, and many natural and synthetic dyes. 59% of US FDA-approved drugs contain nitrogen heterocycles."},{"page_url":"https://ro.wikipedia.org/wiki/Maizi%C3%A8res-l%C3%A8s-Brienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Map_commune_FR_insee_code_10221.png","page_title":"Maizières-lès-Brienne","context_page_description":"Maizières-lès-Brienne este o comună în departamentul Aube din nord-estul Franței. În 2009 avea o populație de 178 de locuitori."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D1%91%D0%BD%D0%B8%D0%B3%D1%81%D0%BB%D1%83%D1%82%D1%82%D0%B5%D1%80-%D0%B0%D0%BC-%D0%AD%D0%BB%D1%8C%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/K%C3%B6nigslutter_Merian.png","page_title":"Кёнигслуттер-ам-Эльм","context_page_description":"Кёнигслуттер-ам-Эльм — Германия Федеративтік Республикасының Төменгі Саксония жерінде орналасқан муниципалитет. Хельмштедт ауданының құрамына енеді.\\nМуниципалитеттің тұрақты тұрғындарының саны 15 694 адамды құрайды. Алып жатқан жер аумағы 130,58 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 03 1 54 013. Муниципалитеттің басшысы — Оттомар Липпельт.\\nМуниципалитеттің өзі әкімшілік құрылымы бойынша 18 қалалық ауданға бөлінеді."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_in_Serbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%D0%A1%D1%83%D0%B1%D0%BE%D1%82%D0%B8%D1%86%D0%B0.jpg","page_title":"List of cities in Serbia","context_page_description":"This is the list of cities and towns in Serbia, according to the criteria used by Statistical Office of the Republic of Serbia, which classifies the settlements into urban and rural, depending not only on size, but also on other administrative and legal criteria. Also villages with the municipal rights have been added to the list."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%94%E1%83%A0%E1%83%98_I_(%E1%83%98%E1%83%9C%E1%83%92%E1%83%9A%E1%83%98%E1%83%A1%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Coat_of_Arms_of_England_%281554-1558%29.svg","page_title":"მერი I (ინგლისი)","context_page_description":"მერი I — ტიუდორების დინასტიის წარმომადგენელი. ინგლისისა და ირლანდიის დედოფალი 1553–1558 წლებში, როგორც ჰენრი VIII-ის ასული. მისი მმართველობის პერიოდში ინგლისში პროტესტანტული რეფორმაცია მძვინვარებდა, რა დროსაც დედოფალი ძალიან დიდ სისასტიკეს იჩენდა პროტესტანტების მიმართ, რის გამოც ხალხმა მას სისხლიანი მერი შეარქვა.\\nიგი იყო ინგლისისა და ირლანდიის მეფე ჰენრი VIII-ისა და მისი პირველი ცოლის, დედოფალ კატალინა არაგონელის ერთადერთი საერთო ქალიშვილი. მამის გარდაცვალების შემდეგ, 1547 წელს ტახტზე ავიდა ჰენრის ვაჟი ედუარდ VI, რომელიც 1553 წელს გარდაიცვალა. ვინაიდან ედუარდი ანგლიკანი იყო, ცდილობდა მამის ანდერძი შეეცვალა და ტახტი თავის მამიდაშვილ ჯეინ გრეის დაუტოვა, მერის ნაცვლად, ვინაიდან იცოდა, რომ მერი კვლავ კათოლიკობას აღადგენდა, თუმცა სულ ცხრა დღეში მერიმ ჯეინი ტახტიდან ჩამოაგდო და ინგლისისა და ირლანდიის დედოფალი გახდა. 1554 წელს იგი ცოლად გაჰყვა საღვთო რომის იმპერატორ და ესპანეთის მეფე კარლ V-ის უფროს ვაჟს, ინფანტ ფილიპეს, რომელიც 1556 წელს ესპანეთის მეფე გახდა, მერი კი დედოფალი, თუმცა იგი ესპანეთს არასდროს სწვევია."},{"page_url":"https://vi.wikipedia.org/wiki/Trung_t%C3%A2m_V%C5%A9_tr%E1%BB%A5_Kennedy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Cape_canaveral.jpg","page_title":"Trung tâm Vũ trụ Kennedy","context_page_description":"Trung tâm Vũ trụ John F. Kennedy là nơi phóng các tàu vũ trụ của NASA gần Mũi Canaveral trên đảo Merritt, Florida, Hoa Kỳ. Nơi này nằm giữa Miami và Jacksonville, Florida. Nó dài khoảng 34 dặm và rộng khoảng 6 dặm, bao phủ 219 dặm vuông. Khoảng 17.000 người làm việc tại nơi này. Có một trung tâm cho khách ghé thăm và những tuyến tham quan dành cho dân chúng và trung tâm là một địa điểm du lịch cho du khách ghé thăm Florida. Bởi vì đa số khu vực của trung tâm nằm ngoài các dự án phát triển, nơi này cũng được sử dụng như là một khu bảo tồn đời sống hoang dã quan trọng, với chỉ khoảng 9% đất đã được phát triển.\\nCác chuyến bay hiện tại được điều khiển từ khu vực phóng 39, địa điểm của tòa nhà Lắp ráp Tàu vũ trụ. Bốn dặm về phía đông của tòa nhà lắp ráp là hai bệ phóng; năm dặm về phía nam là Khu Công nghiệp KSC, nơi rất nhiều phương tiện hỗ trợ của trung tâm tọa lạc và là khu nhà quản lý trung tâm.\\nCác cuộc phóng tại Trung tâm vũ trụ Kennedy diễn ra tại Khu phóng 39. Tất cả các cuộc phóng khác tiến hành ở Trạm không quân Mũi Canaveral được điều hành bởi Không quân Hoa Kỳ."},{"page_url":"https://da.wikipedia.org/wiki/Aurlandsfjorden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/View_of_the_Aurlandsfjord%2C_Aurlandsvangen_and_Flam_from_below_the_Prest_Summit.jpg","page_title":"Aurlandsfjorden","context_page_description":"Aurlandsfjorden er en fjordarm på sydsiden af Sognefjorden i Vestland fylke i Norge. Fjorden er omtrent 29 km lang og strækker sig gennem kommunerne Vik, Lærdal og Aurland. Omtrent 11 km fra indløbet deler fjorden sig. Nærøyfjorden går mod sydvest mens Aurlandsfjorden fortsætter mod sydøst.\\nVed Aurlandsfjord ligger også landsbyen Undredal med Undredal Stavkirke."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%AD%E3%83%AB%E3%83%892%E4%B8%96_(%E3%82%A4%E3%83%B3%E3%82%B0%E3%83%A9%E3%83%B3%E3%83%89%E7%8E%8B)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Edith_discovering_the_body_of_Harold.jpg","page_title":"ハロルド2世 (イングランド王)","context_page_description":"ハロルド2世は、ウェセックス朝最後のイングランド王、および最後のアングロ・サクソン系君主。英語および文献ではハロルド・ゴドウィンソンの名で呼ばれることの方が多い。ウェセックス伯ゴドウィンの次男で、トスティ・ゴドウィンソンとエドワード懺悔王の妃エディスの兄。妻はマーシア伯アルフガーの娘で、ウェールズ王グリフィズ・アプ・ルウェリンの未亡人エディス。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%83%E5%A1%94-%E5%B8%83%E6%B3%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Butha-Buthe.jpg","page_title":"布塔-布泰","context_page_description":"布塔-布泰是非洲南部国家莱索托的城镇，也是布塔-布泰区的首府，海拔高度1,707米，建城于1884年，镇内有市场、加油站、银行、医院和全国唯一的清真寺，2010年人口5,869。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%B0%D0%BA%D0%B0,_%D0%9A%D0%B0%D0%BA%D1%83%D1%8D%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Tanaka_and_Nixon_1973_%28copy%29.png","page_title":"Танака, Какуэй","context_page_description":"Какуэй Танака — политический деятель, 64-й и 65-й премьер-министр Японии с 7 июля 1972 года по 9 декабря 1974 года. Один из наиболее противоречивых японских премьер-министров послевоенного времени. Как лидер доминирующей фракции в правящей Либерально-демократической партии Танака господствовал в японской политике на протяжении 1970—80-х годов, за что в прессе его прозвали «Теневым Сёгуном». Всю политическую карьеру Танаку сопровождали громкие коррупционные скандалы, что тем не менее не мешало ему завоёвывать первые места на выборах."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D8%A7%D8%B3%E2%80%8C%D8%B2%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Edouard_Manet_031.jpg","page_title":"لاس‌زنی","context_page_description":"لاسیدن یا لاس زدن گونه‌ای برهم‌کنش اجتماعی میان دو نفر برای ابراز علاقه یا برای سرگرمی و لذت است.\\nاز لاس زدن غالباً به عنوان ابزاری برای ابراز علاقه و نیز سنجیدن علاقه طرف مقابل به هم‌نشینی‌ ای که ممکن است به رابطه‌ ای بلندمدت کشد، استفاده می‌شود. کسانی که لاس می‌زنند، ممکن است به گونه‌ای سخن گویند یا رفتار کنند که مبین صمیمیتی بیشتر از آنچه مناسب رابطه است باشد؛ بی‌آنکه هیچ کاری کرده یا سخنی گفته شود که هنجار جدی اجتماعی‌ای شکسته می‌شود. مخلص کلام لاس زدن به زبان عامیانه در عصر حاضر آن است که مصاحبت دو نفر دارای صمیمیت و طول کشیدن آن شود که اگر آن دونفر نسبت خاصی با هم نداشته باشند، از لحاظ هنجارهای اجتماعی دارای کراهت و ناپسندی می‌باشد."},{"page_url":"https://es.wikipedia.org/wiki/Sucesos_de_Infiesto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Vina%2C_vina%2C_Francisquet%2C_de_Pellicer_Montseny%2C_La_Campana_de_Gr%C3%A0cia%2C_31_de_octubre_de_1903.jpg","page_title":"Sucesos de Infiesto","context_page_description":"Los sucesos de Infiesto fueron unos disturbios que tuvieron lugar en España, en la localidad asturiana de Infiesto, el 30 de abril de 1903, tras las elecciones generales de ese mismo año, durante el periodo conocido como Restauración.​\\nConsistieron en unas protestas populares tras la elección del candidato conservador​ José Ramón Gómez Arroyo​ por el distrito electoral de Infiesto, que contaba con el apoyo del cacique provincial Alejandro Pidal, en detrimento del liberal Manuel Uría, en unos comicios que se habrían desarrollado entre prácticas de pucherazo.​\\nLa protesta se saldó con 11 campesinos muertos a tiros por parte de la Guardia Civil, además de unos 50 heridos de bala. No hubo aviso por parte de los guardias.​ La institución armada alegaría en su defensa haber sido «agredida a la fuerza» mientras rechazaba un asalto al Ayuntamiento.​"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D5%A5%D5%AC%D5%AB%D5%BD%D5%AB%D5%A5%D5%B6_%D5%8C%D5%B8%D5%BA%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Diaboliques.jpg","page_title":"Ֆելիսիեն Ռոպս","context_page_description":"Ֆելիսիեն Ռոպս, բելգիացի նկարիչ-սիմվոլիստ։"},{"page_url":"https://en.wikipedia.org/wiki/Kashgar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Xinjiang_1759_-_16.jpg","page_title":"Kashgar","context_page_description":"Kashgar, also Kashi, is an oasis city in Xinjiang. It is one of the westernmost cities of China, near the border with Afghanistan, Kyrgyzstan, Tajikistan and Pakistan. With a population of over 500,000, Kashgar has served as a trading post and strategically important city on the Silk Road between China, the Middle East and Europe for over 2,000 years.\\nAt the convergence point of widely varying cultures and empires, Kashgar has been under the rule of the Chinese, Turkic, Mongol and Tibetan empires. The city has also been the site of a number of battles between various groups of people on the steppes.\\nNow administered as a county-level unit, Kashgar is the administrative centre of Kashgar Prefecture, which has an area of 162,000 square kilometres and a population of approximately 4 million as of 2010. The city itself has a population of 506,640, and its urban area covers 15 km², though its administrative area extends over 555 km². The city was made into a Special Economic Zone in 2010, the only city in western China with this distinction."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%A8%D7%99%D7%A0%D7%A9%D7%98%D7%99%D7%99%D7%9F_%D7%94%D7%A8-%D7%92%D7%99%D7%9C,_%D7%90%D7%93%D7%A8%D7%99%D7%9B%D7%9C%D7%95%D7%AA_%D7%A0%D7%95%D7%A3_%D7%95%D7%AA%D7%9B%D7%A0%D7%95%D7%9F_%D7%A1%D7%91%D7%99%D7%91%D7%AA%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/%D7%9E%D7%91%D7%98_%D7%9C%D7%98%D7%99%D7%99%D7%9C%D7%AA_%D7%A4%D7%90%D7%A8%D7%A7_%D7%94%D7%9B%D7%98.JPG","page_title":"גרינשטיין הר-גיל, אדריכלות נוף ותכנון סביבתי","context_page_description":"גרינשטיין הר-גיל, אדריכלות נוף ותכנון סביבתי בע\\"מ, היא חברה העוסקת באדריכלות נוף על תחומיה השונים, החברה עוסקת במגוון פרויקטים במגזר הציבורי, ברמה אזורית וברמה ארצית."},{"page_url":"https://is.wikipedia.org/wiki/Skj%C3%A1varpi","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Projection-screen-home2.jpg","page_title":"Skjávarpi","context_page_description":"Skjávarpi er tæki sem tekur á móti stafrænni sendingu frá tölvu, DVD-spilara eða sambærilegu tæki og varpar upp mynd á hvítt tjald. Skjávarpar eru seldir með mismunandi upplausn og birtustig."},{"page_url":"https://fr.wikipedia.org/wiki/Stupas_de_Andher","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Andher_stupa_2.jpg","page_title":"Stupas de Andher","context_page_description":"Les stupas de Andher sont un ensemble de trois stupas situés à 19 km au sud-est de Sanchi, District de Raisen, Madhya Pradesh, Inde. Situés assez en hauteur, ils surplombent les stupas de Bhojpur, au-delà desquels sont visibles les stupas de Sanchi."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B5%B7%E5%BA%953%E4%B8%87%E3%83%9E%E3%82%A4%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Statue_of_Liberty_7.jpg","page_title":"海底3万マイル","context_page_description":"『海底3万マイル』は、1970年7月19日公開の『東映まんがまつり』内で上映された、東映動画製作の劇場用アニメ映画である。ワイド・フジカラー。60分。優秀映画鑑賞会推薦作品。\\nキャッチコピーは「ブク・ブク・ブクーン と あぶくの中から出てきた！出ました！海の怪物、魚の大群、陸の暴れん坊」「誰も知らない海の底で大戦争が始まった！さあ大変！火焔竜、もぐらの潜水艦、シャボン玉の戦車、貝の大物、うなぎの弾丸など、楽しさいっぱい」。"},{"page_url":"https://en.wikipedia.org/wiki/Super_Mac_Race","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Hope_d.jpg","page_title":"Super Mac Race","context_page_description":"The Super Mac is a non-periodic 568 mile sail boat race from Chicago, IL to Port Huron, MI, or vice versa. Recent editions have been jointly sponsored by the Chicago Yacht Club, Bayview Yacht Club and Port Huron Yacht Club. The 2015 race was promoted as \\"The Longest Fresh Water Race on Earth,\\" a debatable claim.\\nThe race was originally known as the \\"Centennial Race\\" in 1975, then the \\"Chicago-Sarnia International Yacht Race\\" for several years, and then the \\"Millennium 600\\" before it was officially called the Super Mac. Although there are \\"Super Mack\\" references in newspapers dating back to 1978, the race wasn't officially known as the Super Mac until the 2009 & 2015 editions. Start & finish locations, courses and lengths, and sponsoring yacht clubs have varied over the 40-year history."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_%D0%91%D0%B5%D0%BD%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Benz_Patent_Motorwagen_Engine.jpg","page_title":"Карл Бенц","context_page_description":"Во 1885, германскиот машински инженер, Карл Бенц го дизајнираше и го изгради првиот практичен автомобил којшто ќе биде движен од мотор со внатрешно согорување. На 29 јануари 1886, Бенц го направи првиот патент DRP No. 37435 за моторно возило на погон на бензин. Тоа било составено од три тркала. Бенц ја направил својата прва кола на четири тркала во 1891 година. Benz&Company, компанијата основана од пронаоѓачот, до 1900 година стана најголемата светска компанија за производство на автомобили."},{"page_url":"https://fr.wikipedia.org/wiki/Inge_King","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Inga_King_2008.jpg","page_title":"Inge King","context_page_description":"Ingeborg Viktoria \\"Inge\\" King le 26 novembre 1915 à Berlin, et morte le 23 avril 2016 à Melbourne, est une sculptrice germano-australienne. Elle a reçu de nombreuses commandes publiques. Son travail se déroule dans des collections publiques et privées. Son œuvre la plus connue est Forward Surge au Arts Centre Melbourne. Elle devient membre de l'ordre d'Australie en janvier 1984."},{"page_url":"https://en.wikipedia.org/wiki/Vernonia,_Oregon","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Columbia_County_Oregon_Incorporated_and_Unincorporated_areas_Vernonia_Highlighted.svg","page_title":"Vernonia, Oregon","context_page_description":"Vernonia is a city in Columbia County, Oregon, United States. It is located on the Nehalem River, in a valley on the eastern side of the Northern Oregon Coast Range that is the heart of one of the most important timber-producing areas of the state. Logging has played a large role in the history of the city. The population was 2,151 at the 2010 census."},{"page_url":"https://en.wikipedia.org/wiki/Agust%C3%ADn_Edwards_Eastman","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/15-01-14-Agust%C3%ADn_Edwards_Eastman.jpg","page_title":"Agustín Edwards Eastman","context_page_description":"Agustín Iván Edmundo Edwards Eastman was a Chilean newspaper publisher, and one of the richest people in Chile. He inherited his family's newspaper company El Mercurio SAP, which publishes Chile's leading national dailies El Mercurio and La Segunda among others, when his father died in 1956. He has been described as a media baron, and is known for his right-wing views. Throughout his time as publisher, he has used El Mercurio SAP's newspapers to influence public opinion in Chile, and he supported the 1973 coup d'état to oust socialist President Salvador Allende."},{"page_url":"https://sv.wikipedia.org/wiki/Achille_Starace","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Mussolini_e_Petacci_a_Piazzale_Loreto%2C_1945.jpg","page_title":"Achille Starace","context_page_description":"Achille Starace, född 18 augusti 1889 i Sannicola i Apulien, död 29 april 1945 i Milano, var en italiensk fascistisk politiker. Han var partisekreterare för Nationella fascistpartiet från 1931 till 1939.\\nStarace deltog i marschen mot Rom 1922.\\nEfter Mussolinis fall 1943 greps Starace av Badoglios regering. Han släpptes och försökte återfå Mussolinis gunst, men förgäves. Han greps ånyo – denna gång av sina forna partikamrater – och internerades i ett koncentrationsläger i Verona. Enligt dem hade han under sin tid som partisekreterare försvagat partiet. Starace frisläpptes dock, men blev den 29 april 1945 i Milano igenkänd och tillfångatagen av antifascistiska partisaner. Han fördes till Piazzale Loreto, där han fick se Mussolinis döda kropp. Därpå sköts Starace ihjäl och hängdes på torget upp i fötterna bredvid Nicola Bombacci, Mussolini, Clara Petacci och Alessandro Pavolini."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%95%D7%9C%D7%99_%D7%91%D7%A8-%D7%A0%D7%91%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/S.bar-navon-2_%D7%90%D7%9E%D7%90_%D7%95%D7%99%D7%9C%D7%93_-_%D7%A9%D7%95%D7%9C%D7%99_%D7%91%D7%A8-%D7%A0%D7%91%D7%95%D7%9F.jpg","page_title":"שולי בר-נבון","context_page_description":"שולי בר-נבון היא אמנית, ציירת ורשמת ישראלית."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Pesch_(Rennfahrer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Porsche_911_L_von_G._Loos_u._F._Pesch_1970-05-31.jpg","page_title":"Franz Pesch (Rennfahrer)","context_page_description":"Franz Pesch ist ein ehemaliger deutscher Autorennfahrer."},{"page_url":"https://en.wikipedia.org/wiki/Five_Ponds_Wilderness_Area","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Five_Ponds_Wilderness_Area_from_Cat_Mountain.jpg","page_title":"Five Ponds Wilderness Area","context_page_description":"The Five Ponds Wilderness Area, an Adirondack Park unit of New York's Forest Preserve, is located in the towns of Fine and Clifton in St. Lawrence County, the town of Webb in Herkimer County and the town of Long Lake in Hamilton County. It includes 1,064 acres of private inholdings, 99 bodies of water covering 1,964 acres, 57.9 miles of trails, and 14 lean-tos."},{"page_url":"https://pt.wikipedia.org/wiki/Grupo_Coral_Laudamus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/IgrejaV%C3%A1lega.jpg","page_title":"Grupo Coral Laudamus","context_page_description":"O Grupo Coral Laudamus é um dos quatro grupos corais da igreja matriz de Santa Maria de Válega."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8CZ_125_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%C4%8CZ_125B.JPG","page_title":"ČZ 125 B","context_page_description":"ČZ 125 B je jednomístný motocykl, vyvinutý Českou zbrojovkou Strakonice, vyráběný v roce 1947. Jeho předchůdcem byl model ČZ 125 A, vyráběný v letech 1946–1947, nástupcem se stal model ČZ 125 T vyráběný v letech 1948–1949, vybavený již místo typické přední vahadlové vidlice vidlicí teleskopickou konstruktéra J. F. Kocha.\\nDvoudobý, vzduchem chlazený jednoválec 123 cm³ s třístupňovou převodovkou, sekundární převod řetězem. Bylo vyrobeno asi 10 tisíc kusů."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_hidangan_roti_lapis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Roujiamo.jpg","page_title":"Daftar hidangan roti lapis","context_page_description":"Berikut ini adalah daftar sandwich atau roti lapis yang terkenal. Roti lapis adalah hidangan yang terdiri dari dua atau lebih irisan roti dengan satu atau lebih bahan isian di antara irisan roti tersebut, atau cukup satu potong roti untuk jenis roti lapis terbuka. Roti lapis adalah jenis makanan untuk makan siang yang biasanya sering dimakan sebagai bagian dari makan siang yang dikemas. Ada banyak jenis roti lapis, terbuat dari beragam bahan. Kata Sandwich yang merupakan nama resmi untuk roti lapis diambil dari nama John Montagu, 4th Earl of Sandwich, seorang aristokrat asal Inggris abad ke-18.\\nPada umumnya, tipe roti lapis yang dikenal adalah sebagai berikut:\\nDua potong roti dengan bahan isian di antaranya\\nDua potongan baguette dengan bahan isian di antaranya\\nRoti kantong, yaitu roti dibelah dari bagian atas hingga menyerupai kantong lalu bahan isian dimasukkan ke dalamnya\\nRoti lapis terbuka, yaitu roti tidak dibelah dan bahan isian ditaruh diatasnya"},{"page_url":"https://ca.wikipedia.org/wiki/Priego","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/CiclistaPA070216.JPG","page_title":"Priego","context_page_description":"Priego és un municipi de la província de Conca a la comunitat autònoma de Castella la Manxa, situat al nord de la província a 58 km de Conca. Té una superfície de 80,91 i en el cens de 2007 tenia 1114 habitants. El codi postal és 16800."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%83%D0%B1%D0%BB%D1%96%D0%BD_(%D0%9D%D1%8C%D1%8E-%D0%93%D0%B5%D0%BC%D0%BF%D1%88%D0%B8%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/DublinNH_DublinLakeWithBeechHill.jpg","page_title":"Дублін (Нью-Гемпшир)","context_page_description":"Дублін — місто в США, в окрузі Чешир штату Нью-Гемпшир. Населення — 1597 осіб."},{"page_url":"https://az.wikipedia.org/wiki/Ba%C4%9F%C3%A7asaray","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%D0%92%D0%B8%D0%B4_%D0%BD%D0%B0_%D1%81%D1%82%D0%B0%D1%80%D1%8B%D0%B9_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_-_panoramio_%2837%29.jpg","page_title":"Bağçasaray","context_page_description":"Bağçasaray — Ukraynada tarixi şəhər. Krım xanlığının paytaxtı. Şərqində Qara dənizə kiçik zolaq şəkilndə sahili olan şəhər. Kırım dağlarını əhatə edən Çürüksü dərəsi vadisində Simferepol-Sevastopol dəmir yolu xəttinin üzərində yerləşir. Şəhər Osmanlı İmperatorluğuna tabe olduğu 1475-ci ildən, Kiçik Qaynarca müqaviləsi ilə muxtar olduğu 1774 ilinə qədər təxmini olara 299 il Osmanlı İmperatorluğunun tərkibə daxil olmuşdur."},{"page_url":"https://ceb.wikipedia.org/wiki/Pastrana_(munisipyo_sa_Espanya,_Castilla-La_Mancha,_Provincia_de_Guadalajara,_lat_40,40,_long_-2,89)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Pastrana-PM_38260.jpg","page_title":"Pastrana (munisipyo sa Espanya, Castilla-La Mancha, Provincia de Guadalajara, lat 40,40, long -2,89)","context_page_description":"Munisipyo ang Pastrana sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Guadalajara ug rehiyon sa Castilla-La Mancha, sa sentro nga bahin sa nasod, 70 km sa sidlakan sa Madrid ang ulohan sa nasod. Adunay 1,070 ka molupyo. Naglangkob kin og 96 ka kilometro kwadrado. Pastrana mopakigbahin sa usa ka utlanan sa Almonacid de Zorita.\\nAng yuta sa Pastrana kay kabungtoran sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang patag.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 30 °C, ug ang kinabugnawan Disyembre, sa 3 °C. Ang kasarangang pag-ulan 666 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 97 milimetro nga ulan, ug ang kinaugahan Agosto, sa 13 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Patience_Mthunzi-Kufa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/2011_portrait_-_Patience_Mthunzi_%286197342763%29_%28cropped%29.jpg","page_title":"Patience Mthunzi-Kufa","context_page_description":"Patience Mthunzi-Kufa is a South African physicist and Head of Biophotonics research at the Council for Scientific and Industrial Research. She received the Order of Mapungubwe in Bronze."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%BB%D0%BE%D0%B1%D0%BE%D1%87%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/L1020976.JPG","page_title":"Глобочица","context_page_description":"Глобочица — село во областа Дримкол, во Општина Струга, на патот помеѓу градовите Струга и Дебар."},{"page_url":"https://es.wikipedia.org/wiki/Joandom%C3%A8nec_Ros","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Presentaci%C3%B3_del_llibre_Molts_granets_de_sorra_-_02.jpg","page_title":"Joandomènec Ros","context_page_description":"Joandomènec Ros i Aragonès es un biólogo, escritor y catedrático universitario español. Desde el 1 de septiembre de 2013 es presidente del Instituto de Estudios Catalanes.​"},{"page_url":"https://de.wikipedia.org/wiki/U-Boot-Pl%C3%A4ne-Untersuchungsausschuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Kiel_HWDW_IMG_3697.JPG","page_title":"U-Boot-Pläne-Untersuchungsausschuss","context_page_description":"Der U-Boot-Pläne-Untersuchungsausschuss des Deutschen Bundestags untersuchte von 1986 bis 1990 die illegale Lieferung von U-Boot-Plänen durch die Howaldtswerke-Deutsche Werft an Südafrika."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A8%E0%A5%8D%E0%A4%AF%E0%A5%82_%E0%A4%9C%E0%A4%B0%E0%A5%8D%E0%A4%B8%E0%A5%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/New_Jersey_State_House.jpg","page_title":"न्यू जर्सी","context_page_description":"न्यू जर्सी हे अमेरिकेतील सर्वाधिक लोकसंख्या घनतेचे राज्य आहे. अमेरिकेच्या पूर्व किनाऱ्यावर वसलेले न्यू जर्सी क्षेत्रफळाच्या दृष्टीने अमेरिकेमधील ४७वे तर लोकसंख्येच्या दृष्टीने अकराव्या क्रमांकाचे राज्य आहे.\\nन्यू जर्सीच्या पूर्वेला व दक्षिणेला अटलांटिक महासागर, पश्चिमेला डेलावेर व पेनसिल्व्हेनिया व उत्तरेला न्यू यॉर्क ही राज्ये आहेत. ट्रेंटन ही न्यू जर्सीची राजधानी तर न्यूअर्क हे सर्वात मोठे शहर आहे. न्यू जर्सीमधील बव्हंशी लोक न्यू यॉर्क शहर व फिलाडेल्फिया ह्या महानगरांच्या क्षेत्रांत राहतात.\\nदरडोई उत्पन्नाच्या दृष्टीने न्यू जर्सी हे अमेरिकेमधील दुसर्‍या क्रमांकाचे राज्य आहे. येथील अर्थव्यवस्था बऱ्याच प्रमाणावर न्यू यॉर्क शहरावर अवलंबून आहे व न्यू यॉर्क शहरामध्ये काम करणारे हजारो लोक न्यू जर्सीमध्ये वास्तव्य करतात. भारतीय वंशाच्या रहिवाशांच्या संख्येमध्ये न्यू जर्सीचा अमेरिकेत तिसरा क्रमांक लागतो."},{"page_url":"https://ast.wikipedia.org/wiki/Marinula_filholi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Marinula_filholi_01.JPG","page_title":"Marinula filholi","context_page_description":"Marinula filholi ye una especie de moluscu gasterópodu de la familia Ellobiidae."},{"page_url":"https://fr.wikipedia.org/wiki/Th%C3%A9%C3%A2tre_Pigalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/1946_La_troupe_de_Huon_de_Bordeaux.jpg","page_title":"Théâtre Pigalle","context_page_description":"Le théâtre Pigalle est une ancienne salle de spectacles parisienne située 10-12, rue Pigalle dans 9ᵉ arrondissement, inaugurée en 1929 et disparue en 1949."},{"page_url":"https://de.wikipedia.org/wiki/Lainzer_Tiergarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lainzer_Tiergarten_%281%29_IMG_1551.jpg","page_title":"Lainzer Tiergarten","context_page_description":"Der Lainzer Tiergarten ist ein öffentlich zugängliches Naturschutzgebiet in Wien und zum Teil auch in Niederösterreich, das von der Magistratsabteilung 49 – Forstamt und Landwirtschaftsbetrieb der Stadt Wien verwaltet und betreut wird. Er ist ein Tiergarten im Sinne eines weitläufigen Waldgebietes mit reichem, innerhalb des Gartens frei lebendem Wildbestand. Als dieses Schutzgebiet ist es auch Bestandteil des Biosphärenparks Wienerwald. Der Lainzer Tiergarten liegt größtenteils im Westen Wiens, ein kleiner Teil liegt in der niederösterreichischen Gemeinde Laab im Walde."},{"page_url":"https://de.wikipedia.org/wiki/Giacomo_Matteotti","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Giacomo_Matteotti.jpg","page_title":"Giacomo Matteotti","context_page_description":"Giacomo Matteotti war ein italienischer Politiker, Generalsekretär des Partito Socialista Unitario und Abgeordneter des Partito Socialista Italiano. Die Ermordung Matteottis durch italienische Faschisten im Jahr 1924 gilt als Beginn der Diktatur Mussolinis."},{"page_url":"https://de.wikipedia.org/wiki/Kreis_Parchim","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ruhner_Berg_FF-Stein.jpg","page_title":"Kreis Parchim","context_page_description":"Der Kreis Parchim war ein Kreis des Bezirks Schwerin in der DDR. Ab dem 17. Mai 1990 bestand er als Landkreis Parchim fort. Sein Gebiet gehört heute zum Landkreis Ludwigslust-Parchim in Mecklenburg-Vorpommern. Der Sitz der Kreisverwaltung befand sich in Parchim."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%A1y_bay_tr%E1%BB%B1c_th%C4%83ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Aircraft.osprey.678pix.jpg","page_title":"Máy bay trực thăng","context_page_description":"Máy bay trực thăng hay máy bay lên thẳng là một loại phương tiện bay có động cơ, hoạt động bay bằng cánh quạt, có thể cất cánh, hạ cánh thẳng đứng, có thể bay đứng trong không khí và thậm chí bay lùi. Trực thăng có rất nhiều công năng cả trong đời sống thường nhật, trong kinh tế quốc dân và trong quân sự.\\nNếu so sánh với máy bay phản lực thì máy bay trực thăng có kết cấu, cấu tạo phức tạp hơn rất nhiều, khó điều khiển, hiệu suất khí động học thấp, tốn nhiều nhiên liệu, tốc độ và tầm bay xa kém hơn rất nhiều. Nhưng bù lại những nhược điểm đó, khả năng cơ động linh hoạt, khả năng cất cánh – hạ cánh thẳng đứng không cần sân bay và tính năng bay đứng của nó làm cho loại máy bay này là không thể thay thế được. Thực tế là máy bay trực thăng có thể đến bất cứ nơi nào chỉ cần bãi đáp có kích thước lớn gấp rưỡi đường kính cánh quạt là nó đều có thể hạ cánh và cất cánh được."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%B4%D0%B1%D0%BE%D1%98%D0%BA%D0%B0_%D0%B7%D0%B0_%D0%BC%D1%83%D1%88%D0%BA%D0%B0%D1%80%D1%86%D0%B5_%D0%BD%D0%B0_%D0%9B%D0%B5%D1%82%D1%9A%D0%B8%D0%BC_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D1%98%D1%81%D0%BA%D0%B8%D0%BC_%D0%B8%D0%B3%D1%80%D0%B0%D0%BC%D0%B0_2004.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Peace_and_Friendship_stadium_2014.JPG","page_title":"Одбојка за мушкарце на Летњим олимпијским играма 2004.","context_page_description":"Такмичење у одбојци за мушкарце је на Олимпијским играма одржано од 15. до 29. августа, у једној хали, капацитета 10.520.\\nРепрезенције 12 земаља су биле подељене у две групе са по шест екипа. Прве четири екипе из обе групе су избориле пласман у четвртфинале. Није било разигравања за пласман од 9. до 12. места, тако да су петопласиране екипе делиле 9, а шестопласиране 11. место."},{"page_url":"https://ceb.wikipedia.org/wiki/Rudolph_(lungsod_sa_Tinipong_Bansa,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Rudolph%2C_Ohio_viewed_from_Main_Street-026868.JPG","page_title":"Rudolph (lungsod sa Tinipong Bansa, Ohio)","context_page_description":"Lungsod ang Rudolph sa Tinipong Bansa. Ang Rudolph nahimutang sa kondado sa Wood County ug estado sa Ohio, sa sidlakang bahin sa nasod, 600 km sa kasadpan sa ulohang dakbayan Washington, D.C. 208 metros ibabaw sa dagat kahaboga ang nahimutangan sa Rudolph, ug adunay 458 ka molupyo.\\nAng yuta palibot sa Rudolph kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 245 ka metro ug 19.7 km sa habagatan sa Rudolph. Dunay mga 14 ka tawo kada kilometro kwadrado sa palibot sa Rudolph may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bowling Green, 8.7 km sa amihanan sa Rudolph. Hapit nalukop sa kaumahan ang palibot sa Rudolph. Sa rehiyon palibot sa Rudolph, kapuloan talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hunyo, sa 22 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 1,084 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 125 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 48 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Villa_Cavrois","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Villa_Cavrois_la_salle_de_bains_des_parents.jpg","page_title":"Villa Cavrois","context_page_description":"Villa Cavrois in Croix is a large modernist mansion built in 1932 by French architect Robert Mallet-Stevens for Paul Cavrois, an industrialist from Roubaix active in the textile industry."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AA%E3%83%BC%E3%83%B3%E3%82%BA%E3%83%90%E3%83%BC%E3%82%B0_(%E3%83%9A%E3%83%B3%E3%82%B7%E3%83%AB%E3%83%99%E3%83%8B%E3%82%A2%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Greensburg-pennsylvania-courthouse.jpg","page_title":"グリーンズバーグ (ペンシルベニア州)","context_page_description":"グリーンズバーグは、アメリカ合衆国ペンシルベニア州南西部ローレル高原のウェストモアランド郡の都市であり、同郡の郡庁所在地である。ピッツバーグ市の南東30マイル にあり、ピッツバーグ大都市圏に属している。エコリージョンとしては西アレゲーニー台地に含まれる。アメリカ独立戦争の大陸軍少将だったナサニエル・グリーンにちなんで名付けられた。\\n2010年国勢調査での人口は14,892 人だった。同じ郵便番号を幾つかの町で共有する15601の中では約6万人が住んでいる。その町はヘンプフィールド・タウンシップ、セイラム・タウンシップ、ユニティ・タウンシップ、マウントプレザント・タウンシップである。\\n西ペンシルベニアでは事業、学術、観光、文化の中心である。日中には人口が倍になっているのが明らかである。日中の増加度という観点では、ピッツバーグ市、フィラデルフィア市、ハリスバーグ市などに次いで州内第7位である。同じ指標で、アメリカ合衆国の中で人口が15,000人から24,999人の町では第16位である。2007年、雑誌「USニューズ&ワールド・レポート」が、グリーンズバーグを「ペンシルバニア州で引退して住む最良の場所」の1つに挙げた。"},{"page_url":"https://en.wikipedia.org/wiki/Gold_Coast_(British_colony)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Gold_Coast_Stamp_Elizabeth_1953_%C2%BD_d.jpg","page_title":"Gold Coast (British colony)","context_page_description":"The Gold Coast was a British Crown Colony on the Gulf of Guinea in West Africa from 1821 to its independence as part of the nation of Ghana in 1957. The term Gold Coast is also often used to describe all of the four separate jurisdictions that were under the administration of the Governor of the Gold Coast. These were the Gold Coast itself, Ashanti, the Northern Territories Protectorate and the British Togoland trust territory.\\nThe first European explorers to arrive at the coast were the Portuguese in 1471. They encountered a variety of African kingdoms, some of which controlled substantial deposits of gold in the soil. In 1483, the Portuguese came to the continent for increased trade. They built the Castle of Elmina, the first European settlement on the Gold Coast. From here they acquired slaves and gold in trade for European goods, such as metal knives, beads, mirrors, rum, and guns. News of the successful trading spread quickly, and British, Dutch, Danish, Prussian and Swedish traders arrived as well. The European traders built several forts along the coastline."},{"page_url":"https://pl.wikipedia.org/wiki/Niez%C5%82omny_(film_2014)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Jack_O%27Connell_2014.jpg","page_title":"Niezłomny (film 2014)","context_page_description":"Niezłomny – amerykański film fabularny z 2014 roku.\\nFilm jest adaptacją bestsellerowej książki Laury Hillenbrand pt. Niezłomny, której bohaterem jest Louis Zamperini."},{"page_url":"https://en.wikipedia.org/wiki/Rise_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Rise_stasjon.jpg","page_title":"Rise Station","context_page_description":"Rise Station is a railway station at Rise in Arendal, Norway. Located on the Arendal Line, it is served by the Go-Ahead Norge. The station opened as the terminus of the Grimstad Line in 1907; the following year it became a transfer station to the Arendal Line. It then received a station building designed by Paul Armin Due. In 1935 and 1936, the lines were converted from narrow gauge to standard gauge, although for a year the station served as a break-of-gauge station. The Grimstad Line closed in 1961 and in 1983 the station was unmanned."},{"page_url":"https://en.wikipedia.org/wiki/Gertrude_More","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Gertrude_more_nun.jpg","page_title":"Gertrude More","context_page_description":"Dame Gertrude More was a nun of the English Benedictine Congregation, a writer and chief founder of Stanbrook Abbey.\\nShe was born in Low Leyton, Essex, England. Her father, Cresacre More, was great-grandson of Thomas More; her mother, Elizabeth Gage, was sister of Sir John Gage, 1st Baronet of Firle, Sussex, Lord Chamberlain to Queen Mary. Her mother died at early age and Helen's father became responsible for her care and education. Dom Benet Jones, a Benedictine monk, encouraged her to join his projected religious foundation, Our Lady of Comfort, in Cambrai. She was the first of nine postulants admitted to the order on 31 December 1623. Helen More came under the influence of Augustine Baker and took the religious name of Gertrude. Catherine Gascoigne, one of her peers, was chosen ahead of her as abbess.\\nHer writing was heavily influenced by the christian mystics such as Julian of Norwich and Teresa of Avila and other spiritual writers and she contributed to the effort to publish their work."},{"page_url":"https://gl.wikipedia.org/wiki/Armada_Espa%C3%B1ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/17arm.png","page_title":"Armada Española","context_page_description":"A Armada Española é a rama marítima das Forzas Armadas Españolas.\\nA Armada Española é considerada a sétima máis poderosa do mundo, superada pola norteamericana, rusa, británica, francesa, xaponesa e pola italiana. As súas bases principais están en Rota, Ferrol e Cartagena.\\nA súa academia xeral de oficiais atópase na provincia de Pontevedra, a Escola Naval Militar de Marín.\\nA patroa da Armada Española é a Virxe do Carme, protectora e gardiá da xente do mar, que é denominada Stella Maris. A Armada celebra a súa festa o 16 de xullo."},{"page_url":"https://et.wikipedia.org/wiki/Giorgio_Vasari","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Giorgio_Vasari_Selbstportr%C3%A4t.jpg","page_title":"Giorgio Vasari","context_page_description":"Giorgio Vasari oli Itaalia maalikunstnik ja arhitekt, peamiselt tuntud Itaalia kunstnike biograafiate kirjutajana.\\nTema sulest pärineb teos \\"Le vite de' più eccellenti pittori, scultori, e architettori\\", mis on üks olulisemaid allikaid itaalia renessansiajastu kunstnike ja kunsti kohta. Tänu sellele peetakse teda kunstiajaloo isaks. Samas oli ta ka viljakas kunstnik ja tegutses Toscana suurhertsogi õuekunstnikuna.\\nVasari alustas õpipoisina karastatud klaasi maalija Guglielmo da Marsiglia töökojas. Kui ta sai 16-aastaseks, saatis kardinal Silvio Passerini ta Firenzesse Andrea del Sarto juurde õppima. Tema kaasõpilaste hulka kuulusid Rosso Fiorentino ja Jacopo Pontormo. Ta sai seal sõbraks Michelangeloga, kelle stiil teda suuresti mõjutas. Aastal 1529 külastas ta Roomat ning uuris seal Raffaeli ja teiste kõrgrenessansi meistrite töid.\\nVasari maneristlikud maalid olid tema eluajal kuulsamad kui hiljem. Medicid palkasid teda korduvalt tööle Firenzes ja Roomas, ta töötas ka Arezzos, Napolis ja mujalgi."},{"page_url":"https://pt.wikipedia.org/wiki/14_de_agosto","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/John_Galsworthy_2.jpg","page_title":"14 de agosto","context_page_description":"14 de agosto é o 226.º dia do ano no calendário gregoriano. Faltam 139 para acabar o ano."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D8%AC%D9%88%D8%B1%D8%AC%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Profile_of_the_SS_Georgia.jpg","page_title":"اس‌اس جورجیا","context_page_description":"اس‌اس جورجیا یک کشتی بود که طول آن ۳۸۶ فوت بود. این کشتی در سال ۱۹۰۸ ساخته شد."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%89%AD%E6%A3%B1%E5%8D%81%E4%BA%8C%E9%9D%A2%E4%BD%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Polyhedron_snub_12-20_left_max.png","page_title":"扭棱十二面体","context_page_description":"在几何学中，扭棱十二面体是一种半正多面体，由正三角形和正五边形组成，由于其具有点可递的性质，因此属于阿基米德立体，也是面数最多的阿基米德立体，其对偶多面体为五角化六十面体。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D1%8C%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Coat_of_Arms_of_Novomoskovsk_1811.svg","page_title":"Новомосковськ","context_page_description":"Новомоскóвськ — місто обласного підпорядкування в Україні, у Дніпропетровській області, адміністративний центр Новомосковського району. Новомосковськ лежить на правому березі Самари, лівої притоки Дніпра, за 25 км на північний схід від міста Дніпра."},{"page_url":"https://en.wikipedia.org/wiki/Lukoil","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Neftochim-vaya-dinev_cropped.jpg","page_title":"Lukoil","context_page_description":"The PJSC Lukoil Oil Company is a Russian multinational energy corporation headquartered in Moscow, specializing in the business of extraction, production, transport, and sale of petroleum, natural gas, and petroleum products. It was formed in 1991 when three state-run, western Siberian companies named after the respective town in Khanty–Mansi Autonomous Okrug that each was based in, Langepasneftegaz, Urayneftegaz, and Kogalymneftegaz, merged. Its name is the combination of the acronym LUK and the English word \\"oil\\".\\nLukoil is the second largest company in Russia after Gazprom, and the largest non-state enterprise in the nation in terms of revenue. Internationally, it is one of the largest global producers of crude oil. In 2012, the company produced 89.856 million tons of oil per day. The company has operations and subsidiaries in more than 40 countries around the world."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_im_Okres_Bratislava_I/%C5%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Aspremont_palace_03.jpg","page_title":"Liste der denkmalgeschützten Objekte im Okres Bratislava I/Š","context_page_description":"Die Liste der denkmalgeschützten Objekte im Okres Bratislava I/Š enthält die nach slowakischen Denkmalschutzvorschriften geschützten Objekte im Stadtbezirk Okres Bratislava I, der den Stadtteil Staré Mesto umfasst, in den Straßen beginnend mit den Buchstaben Š."},{"page_url":"https://ceb.wikipedia.org/wiki/Rund%C4%81les_Novads","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Rund%C4%81les_novads_Flag.png","page_title":"Rundāles Novads","context_page_description":"Munisipyo ang Rundāles Novads sa Latwiya. Nahimutang ni sa habagatan-kasadpang bahin sa nasod, 60 km sa habagatan sa Riga ang ulohan sa nasod. Adunay 4,384 ka molupyo. Naglangkob kin og 231 ka kilometro kwadrado. Rundāles Novads mopakigbahin sa usa ka utlanan sa Jelgavas Rajons, Ozolnieku Novads, ug Bauskas Novads.\\nAng yuta sa Rundāles Novads kay daghan kaayong patag.\\nRundāles Novads may sa mosunod nga mga subdibisyon:\\nRundāles pagasts\\nSvitenes pagasts\\nViesturu pagasts\\nMga lungsod sa Rundāles Novads:\\nRundāle\\nPilsrundāle"},{"page_url":"https://cs.wikipedia.org/wiki/Sibi%C5%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/125_-_Wladiwostok_2015_%2824056935489%29.jpg","page_title":"Sibiř","context_page_description":"Sibiř je území ležící mezi Uralem a Verchojanským pohořím, historicky je součástí Ruska od 17. století. Sibiř zaujímá většinu rozlohy Ruské federace. V širším slova smyslu se však k Sibiři někdy počítá i území mezi Verchojanským pohořím a Tichým oceánem, známé jako ruský Dálný východ. Známá je hlavně silně kontinentálním podnebím a velkým nerostným bohatstvím. Je velice řídce osídlena a mnoho oblastí je dostupno pouze nebo především letecky. Výjimku tvoří oblasti přiléhající k Transsibiřské magistrále, mohutným říčním tokům nebo k Severnímu ledovému oceánu."},{"page_url":"https://cs.wikipedia.org/wiki/M%C3%81V-START","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/V43_3187_02.jpg","page_title":"MÁV-START","context_page_description":"MÁV-START Zrt. je dceřiná společnost skupiny MÁV zabývající se provozováním osobní železniční dopravy v Maďarsku, pronájmem lokomotiv a údržbou kolejových vozidel. Vznikla dne 1. července 2007 rozčleněním společnosti MÁV. Od 1. ledna 2014 byly do firmy začleněny rovněž společnosti MÁV-TRAKCIÓ Zrt. a MÁV-GÉPÉSZET Zrt., které tímto krokem zanikly."},{"page_url":"https://vi.wikipedia.org/wiki/Tassadane_Haddada","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%D8%AA%D9%8A%D8%B2%D9%8A%D9%85%D8%A7%D9%86.jpg","page_title":"Tassadane Haddada","context_page_description":"Tassadane Haddada là một đô thị thuộc tỉnh Mila, Algérie. Dân số thời điểm năm 2002 là 17.623 người."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lieux_patrimoniaux_du_comt%C3%A9_de_Halifax","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/St._George%27s_Anglican_Round_Church_2.jpg","page_title":"Liste des lieux patrimoniaux du comté de Halifax","context_page_description":"Cet article recense les lieux patrimoniaux du comté de Halifax en Nouvelle-Écosse inscrit au répertoire des lieux patrimoniaux du Canada, qu'ils soient de niveau provincial, fédéral ou municipal."},{"page_url":"https://en.wikipedia.org/wiki/Bages,_Aude","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Panorama_bages_sud.jpg","page_title":"Bages, Aude","context_page_description":"Bages is a commune in the Aude department in the Occitanie region of southern France.\\nThe inhabitants of the commune are known as Bageois or Bageoises."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_San_Marcos_(Salt_Lake_City)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Church_001.jpg","page_title":"Catedral de San Marcos (Salt Lake City)","context_page_description":"La catedral de San Marcos localizada en la 231 E. 100 South en Salt Lake City, Utah, es la iglesia catedral de la diócesis de Utah en la Iglesia Episcopal en los Estados Unidos de América. Construida en 1871, es la tercera más antigua de las catedrales episcopales en los Estados Unidos y el más antiguo edificio utilizado continuamente para el culto en Utah.​ Fue diseñado por el arquitecto Richard Upjohn, en el estilo neogótico. El 22 de septiembre de 1970, fue introducido en el Registro Nacional de Lugares Históricos.​"},{"page_url":"https://fr.wikipedia.org/wiki/Isidore_Odorico","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Odorico_Fils_-_10_rue_Dupont_des_Loges.JPG","page_title":"Isidore Odorico","context_page_description":"Isidore Odorico, né le 30 octobre 1893 à Rennes et mort le 27 février 1945 dans cette même ville, est un mosaïste français issu d'une dynastie d'artisans italiens installés à Rennes. Reprenant la succession de son père, il réalise un très grand nombre de décorations en mosaïque, essentiellement dans l'ouest de la France."},{"page_url":"https://it.wikipedia.org/wiki/Christian_Pouga","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Rosso_e_Verde_%28Strisce%29.png","page_title":"Christian Pouga","context_page_description":"Christian Pouga è un calciatore camerunese, attaccante attualmente svincolato."},{"page_url":"https://de.wikipedia.org/wiki/Europ%C3%A4ische_Mobilit%C3%A4tswoche","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Autofreier_Tag_in_Prag.jpg","page_title":"Europäische Mobilitätswoche","context_page_description":"Die Europäische Mobilitätswoche – kurz EMW – ist eine seit 2002 stattfindende jährliche Initiative der Europäischen Kommission für nachhaltige Mobilität in Städten. Dabei werden europäische Städte und Gemeinden aufgerufen, sich eine Woche dem Thema nachhaltige Mobilität zu widmen. Sie beginnt am 16. September und endet mit dem Autofreien Tag am 22. September.\\nDie EMW steht jedes Jahr unter einem bestimmten Motto wie beispielsweise saubere Luft, Multimodalität oder Sharing Economy."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Loggerheads,_Staffordshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Milepost_at_NGR_SJ_7322_3644.jpg","page_title":"Listed buildings in Loggerheads, Staffordshire","context_page_description":"Loggerheads is a civil parish in the district of Newcastle-under-Lyme, Staffordshire, England. It contains 74 buildings that are recorded in the National Heritage List for England. Of these, four are listed at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The parish contains the villages of Loggerheads, Ashley, Hales, Knighton, and Mucklestone, and the surrounding countryside. Most of the listed buildings are houses, cottages, farmhouses, and farm buildings, the earlier of which are timber framed. The Shropshire Union Canal passes through the western part of the parish, and the listed buildings associated with this include bridges, locks, two mileposts, and an aqueduct. The other listed buildings include churches, memorials in churchyards, a well house, two country houses and associated structures, a folly, a bridge, and six road mileposts."},{"page_url":"https://ru.wikipedia.org/wiki/Mistichthys_luzonensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sinarapan%2C_Mistichthys_luzonensis_Smith%2C_1902_by_P._Bravo.jpg","page_title":"Mistichthys luzonensis","context_page_description":"Синарапан или Табиос — вид рыб подсемейства Gobionellinae, единственный представитель монотипного рода Mistichthys. Эндемик Филиппин, где встречается вдоль реки Бикол и в озерах Бухи, Бато, Катугдай и Манапао в Камаринес-Сур и в озере Данао в Поланги, Албай.\\nРыба вырастает до 2,5 сантиметров в длину. Она прозрачная, с несколькими темными пятнами и черными глазами.\\nЭта пресноводная рыба обитает в озерах от береговой линии до глубины 12 метров."},{"page_url":"https://nn.wikipedia.org/wiki/Gobi%C3%B8rkenen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Gobi_Desert.jpg","page_title":"Gobiørkenen","context_page_description":"Gobiørkenen er ein av dei største ørknane i verda. Han dekkjer sørdelen av Mongolia og norddelen av Folkerepublikken Kina i regionen Indre Mongolia. Ørkenen dekkjer om lag 1 295 000 km².\\nGobiørkenen er ein relativt kald ørken, der ein stundom kan sjå rim og snjo på sanddynene. Dette kjem av at han ligg langt nord, og høgt oppe mellom 900 og 1500 moh. Temperaturane kan variera mellom - 40°C om vinteren og + 50°C om sommaren. Det kan også blåsa kraftig i ørkenen.\\nAv planteliv finn ein gras og buskar som toler turke. I den mongolske delen lever det nomadar som gjetarar i utkantane av ørkenen. No er dei for det meste fastbuande."},{"page_url":"https://de.wikipedia.org/wiki/Spornlose_Akelei","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Aquilegia_ecalcarata_-_Palmengarten_Frankfurt_-_DSC01979.JPG","page_title":"Spornlose Akelei","context_page_description":"Die Spornlose Akelei ist eine Pflanzenart aus der Gattung der Akeleien. Sie wird von manchen Autoren auch in die Gattung Semiaquilegia gestellt"},{"page_url":"https://pl.wikipedia.org/wiki/Jorma_Valkama","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jorma_Valkama_%281950%29.jpg","page_title":"Jorma Valkama","context_page_description":"Jorma Valkama – fiński lekkoatleta specjalizujący się w skoku w dal, trzykrotny uczestnik letnich igrzysk olimpijskich, brązowy medalista olimpijski z Melbourne w skoku w dal.\\nZginął tragicznie w wypadku samochodowym."},{"page_url":"https://es.wikipedia.org/wiki/Kingor%C5%8D_Hashimoto","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Kingoro_Hashimoto.jpg","page_title":"Kingorō Hashimoto","context_page_description":"Kingorō Hashimoto fue un militar y político japonés y ferviente promotor del partidismo ultranacionalismo militarista. Fue fundador y líder del Partido de la Juventud del Gran Japón."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%8F%AF%E8%A6%96%E5%AA%92%E9%AB%94%E5%9C%92%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/CTS_UHF_Studio_%26_Administrative_Building_-_front_%26_right.jpg","page_title":"華視媒體園區","context_page_description":"华视媒体园区是中华电视公司的总部所在地，位于台北市大安区光复南路，包括了多栋大楼。2009年4月6日，华视园区正式定名华视媒体园区并举行揭牌典礼，占地3万坪，有15个摄影棚。当时已进驻华视媒体园区者，除了华视关系企业之外，尚有公共电视文化事业基金会、原住民族电视台、客家电视台、台湾宏观电视、民间全民电视公司、凤凰卫视、星空传媒、FOX体育台、国家地理频道、风尚数位科技、张乃仁音乐工作室等。\\n2010年4月30日，华视举行华视媒体园区1周年记者会，华视新闻主播苏逸洪与艺人刘真主持，现场展示华视砸下约新台币2千万元打造的“虚实合一”3D播报系统；华视总经理陈正然表示，华视媒体园区成立1年，第1阶段完成华视资源让20家媒体伙伴互通共享，第2阶段已邀请宏碁电子化资讯管理中心协助建置“云端运算与数位数据库”。\\n2017年，新北市林口区“民视林口数位媒体总部”落成，民视撤租华视媒体园区摄影棚。"},{"page_url":"https://sl.wikipedia.org/wiki/At_Tarif","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Theban_Necropolis_Map.jpeg","page_title":"At Tarif","context_page_description":"At Tarif je nekropola na zahodnem bregu Nila na severozahodnem obrobju Teb in jugovzhodno od Doline kraljev, Egipt. Severovzhodno od nje je sodobna vas At Tarif. Je najstarejša nekropola zahodno od Teb. Na njej je majhen pogrebni tempelj, severno od njega pa grobnice plemstva iz poznega prvega vmesnega obdobja Egipta in Srednjega kraljestva. Mastabe iz Starega kraljestva so morda pripadale lokalnim vladarjem iz Četrte ali Pete dinastije. Grobnice lokalnih vladarjev iz Enajste dinastije so vklesane v skalo in datirajo v obdobje 2061-2010 pr. n. št. Največja med njimi je pripadala faraonom Intefu I., II. in III."},{"page_url":"https://de.wikipedia.org/wiki/Lar_(Iran)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Imam_Khomeini_square_of_lar.JPG","page_title":"Lar (Iran)","context_page_description":"Lar ist eine Stadt mit knapp 70.000 Einwohnern. Sie ist das Verwaltungszentrum des Verwaltungsbezirks Larestan in der iranischen Provinz Fars."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%97%A4%EB%A0%88%EB%9D%BC%EC%82%AC%EC%9A%B0%EB%A3%A8%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Herrerasaurus_SIZE.png","page_title":"헤레라사우루스","context_page_description":"헤레라사우루스는 트라이아스기 후기에 나타난 공룡의 일종이다. 이 육식 공룡의 화석은 모두 아르헨티나 북서부의 트라이아스기 후기, 지금으로부터 약 2억 3천 1백 4십만 년 전 지층에서 발견되었다. 모식종은 헤레라사우루스 이스치구알라스텐시스이며, 1963년 아르헨티나 고생물학자 Osvaldo Reig가 명명했고, 이것이 헤레라사우루스속에 딸린 유일한 종이다."},{"page_url":"https://sh.wikipedia.org/wiki/Herkulaneum","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Herculaneum12.jpg","page_title":"Herkulaneum","context_page_description":"Herkulanej je antički grad u Napuljskom zaljevu koji je stradao kad i Pompeji, Stabiae i Oplontis, od erupcije Vezuva 79. godine.\\nOd kada je otkriven 1981. godine, u Herkulaneju su pronađeni ostaci samo 150 ljudi i vjeruje se da je evakuacija izvršena na vrijeme te da se većina stanovnika spasila. Pronađeno je mnogo umjetnina, ali i knjižica s mnogobrojnim tekstovima grčkih filozofa.\\nOd 1997. godine nalazi se na UNESCOvom popisu zaštićenih spomenika svjetske baštine."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Warendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Stolpersteine_Warendorf_M%C3%BCnsterstra%C3%9Fe_7.jpg","page_title":"Liste der Stolpersteine in Warendorf","context_page_description":"Die Liste der Stolpersteine in Warendorf dokumentiert alle Stolpersteine, die im Rahmen des gleichnamigen Kunst- und Erinnerungsprojekts von Gunter Demnig bislang in der Stadt Warendorf verlegt worden sind. Die Stolpersteine erinnern an Menschen, die in den Jahren 1933–1945 in Warendorf gelebt haben und Opfer des Nationalsozialismus geworden sind. Die Inschriften auf den kleinen quadratischen Messingstafeln enthalten den Namen, die Lebensdaten und das Schicksal der entrechteten und verfolgten, geflüchteten und vertriebenen sowie verschleppten und ermordeten Opfer im Nationalsozialismus. Die Stolpersteine liegen in der Regel im Bürgersteig vor dem Haus, in dem die betreffenden Personen zuletzt freiwillig gewohnt haben.\\nIm März 2011 gründete sich eine Stolperstein-Initiative in Freckenhorst, im Januar 2013 erfolgte die Gründung in Warendorf. Die Initiativen erarbeiten die Personen- und Familiengeschichten der betroffenen Personen und knüpfen Kontakte zu Überlebenden und Nachkommen."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_831","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/NGC_0831_SDSS.jpg","page_title":"NGC 831","context_page_description":"NGC 831 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%82%AB%E3%83%A2%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Okamoto_20110702.jpg","page_title":"オカモト","context_page_description":"オカモト株式会社は日本の化成品メーカー。産業用製品事業と生活用品事業の二本柱を事業に持つ。"},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Bartolom%C4%9Bje_(Boharyn%C4%9B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Church_of_Saint_Bartholomew_%28Boharyn%C4%9B%29_02.JPG","page_title":"Kostel svatého Bartoloměje (Boharyně)","context_page_description":"Kostel svatého Bartoloměje je římskokatolický filiální, dříve farní kostel v Boharyni, patřící do farnosti Nechanice. Je dominantou obce."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%BB%81%E4%BC%AF%E7%88%B5%E7%B6%9C%E5%90%88%E9%86%AB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/CHCSJ.jpg","page_title":"仁伯爵綜合醫院","context_page_description":"仁伯爵综合医院是澳门三家医院之一，也是澳门现时唯一的公立地区综合医院。医院位于松山若宪马路，占地30,300平方米，建筑面积达67,535平方米，由4幢建筑物相连而成，设置直升机停机坪。仁伯爵综合医院始建于1874年1月6日，于1989年11月29日经扩建后启用。"},{"page_url":"https://it.wikipedia.org/wiki/Serie_A1_1987-1988_(pallavolo_maschile)","image_url":"https://upload.wikimedia.org/wikipedia/it/e/ec/Maxicono_Parma_1987-88.jpg","page_title":"Serie A1 1987-1988 (pallavolo maschile)","context_page_description":"La Serie A1 maschile FIPAV 1987-88 fu la 43ª edizione della manifestazione organizzata dalla FIPAV. La regular season si svolse tra il 24 ottobre 1987 e il 5 marzo 1988."},{"page_url":"https://de.wikipedia.org/wiki/Carpaccio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Carpaccio.jpg","page_title":"Carpaccio","context_page_description":"Carpaccio ist eine Vorspeise der italienischen Küche aus rohem Rindfleisch. Entwickelt wurde es im Jahr 1950 in Harry’s Bar in Venedig von deren Inhaber Giuseppe Cipriani für seine Stammkundin Contessa Amalia Nani Mocenigo, weil der Arzt ihr vom Verzehr gegarten Fleisches abgeraten hatte. Cipriani benannte seine Kreation nach dem berühmten venezianischen Maler Vittore Carpaccio, der für seine leuchtenden Rot-/Weißtöne bekannt war und dem gerade eine große Ausstellung in Venedig gewidmet wurde.\\nNach Ciprianis Originalrezept wird zur Zubereitung zuerst gut gekühlte, aber nicht gefrorene Rinderlende roh mit einem sehr scharfen Messer in hauchdünne Scheiben geschnitten, gesalzen, gepfeffert und einige Minuten kalt gestellt. Serviert wird das Fleisch mit einer kalten Mayonnaise-Sauce aus mildem Olivenöl, Eigelb, Weißweinessig, engl. Senfpulver, Worcestershiresauce, Zitronensaft, Salz, Pfeffer und so viel Milch, dass die Sauce noch dickflüssig genug ist, um an einem Löffelrücken zu haften. Diese Sauce wurde nicht für das Gericht Carpaccio erfunden, sondern war in Harry’s Bar schon vorher als „Universalsauce“ gebräuchlich."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%81%E5%8D%B0%E6%9C%A8%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Exhibit_Museum_of_Natural_History%2C_Ann_Arbor_-_IMG_9207.JPG","page_title":"封印木屬","context_page_description":"封印木是一屬已滅絕的石松類，為一類高大的樹狀蕨類，生長在炎熱潮濕的沼澤地帶中。在石炭紀時頗為興盛，和鱗木、蘆木等一同形成了廣大的蕨類雨林。它們的高度可達30公尺。其遺骸在地底下經長久的化學及物理作用後，形成現代人類最重要的燃料資源煤炭及天然氣。"},{"page_url":"https://pt.wikipedia.org/wiki/Convers%C3%A3o_(religi%C3%A3o)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Michelangelo_Merisi_da_Caravaggio_-_The_Conversion_of_St._Paul_-_WGA04135.jpg","page_title":"Conversão (religião)","context_page_description":"A conversão religiosa ou simplesmente conversão é a adoção de uma nova identidade religiosa. A conversão não ocorre apenas de uma religião para outra, mas também entre diferentes setores de uma mesma religião, como dentro das diferentes denominações cristãs, por exemplo."},{"page_url":"https://it.wikipedia.org/wiki/Arte_della_Controriforma","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Lud._Carracci_La_Carraccina.jpg","page_title":"Arte della Controriforma","context_page_description":"Per arte della Controriforma si intende quella parte di arte europea della seconda metà del XVI secolo che è più fortemente influenzata dagli indirizzi teorici sull'arte sviluppati a seguito del Concilio di Trento."},{"page_url":"https://en.wikipedia.org/wiki/Toxic_epidermal_necrolysis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Confluent_epidermal_necrosis_-_very_high_mag.jpg","page_title":"Toxic epidermal necrolysis","context_page_description":"Toxic epidermal necrolysis is a type of severe skin reaction. Together with Stevens–Johnson syndrome it forms a spectrum of disease, with TEN being more severe. Early symptoms include fever and flu-like symptoms. A few days later the skin begins to blister and peel forming painful raw areas. Mucous membranes, such as the mouth, are also typically involved. Complications include dehydration, sepsis, pneumonia, and multiple organ failure.\\nThe most common cause is certain medications such as lamotrigine, carbamazepine, allopurinol, sulfonamide antibiotics, and nevirapine. Other causes can include infections such as Mycoplasma pneumoniae and cytomegalovirus or the cause may remain unknown. Risk factors include HIV/AIDS and systemic lupus erythematosus. Diagnosis is based on a skin biopsy and involvement of more than 30% of the skin. TEN is a type of severe cutaneous adverse reactions, together with SJS, a SJS/TEN, and drug reaction with eosinophilia and systemic symptoms. It is called SJS when less than 10% of the skin is involved and an intermediate form with 10 to 30% involvement. Erythema multiforme is generally considered a separate condition."},{"page_url":"https://en.wikipedia.org/wiki/Mila,_Algeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Mila_ville.jpg","page_title":"Mila, Algeria","context_page_description":"Mila is a city in the northeast of Algeria and the capital of Mila Province. In antiquity, it was known as Milevum or Miraeon, Μιραίον and was situated in the Roman province of Numidia."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A1%8C%E6%98%9F%E7%A7%91%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Magnetosphere_rendition.jpg","page_title":"行星科学","context_page_description":"行星科学是研究行星、卫星，和行星系，以及它们形成过程的科学。它研究对象的尺度从小至微流星体到大至气态巨行星，目的在确定其组成、动力学、形成、相互的关系和历史。它是高度科技整合的学科，最初成长于天文学和地球科学，但现在包含许多学科，包括行星地质学、大气科学、海洋学、水文学、理论行星科学、冰川学、和系外行星 。类似的学科包括关心太阳对太阳系内天体影响的太空物理学和天文生物学。还有相关于行星科学的观测和理论分支与关联性。观测的研究涉及与太空探索的结合，主要是与使用遥测技术的机器人的太空船任务，和在地面实验室所做的工作比较。理论部分涉及大量的电脑模拟和数学建模。虽然全世界有好几个纯粹的行星科学研究所，但行星学家一般都在大学或研究中心的天文学和物理学或地球科学部门。他们每年都有几个重要的会议，和范围广泛的等同综述论的期刊。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%8A%D8%AF%D8%B1%D9%88_%D9%84%D9%88%D9%8A%D8%B3_%DA%86%D8%A7%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Pedro_Jaro.jpg","page_title":"پيدرو لويس چارو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nپيدرو لويس چارو لاعب كورة قدم من اسبانيا."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E5%A8%83%C2%B7%E6%9D%9C%E5%A8%81%E5%86%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/DuVernaySanFranFilmFest.jpg","page_title":"阿娃·杜威内","context_page_description":"阿娃·玛丽·杜威内是一位非洲裔美国女性导演和编剧。2012年以第二部长片Middle of Nowhere赢得圣丹普西电影节最佳导演奖，成为首位获得该荣誉的非裔女性。2014年作品《塞尔玛游行》获提名第72届金球奖最佳导演和奥斯卡最佳影片。"},{"page_url":"https://fr.wikipedia.org/wiki/Colonie_et_protectorat_de_Gambie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Lockheed_Hudson_-_Royal_Air_Force_in_West_Africa%2C_April_1943_TR905.jpg","page_title":"Colonie et protectorat de Gambie","context_page_description":"La colonie et le protectorat de Gambie correspondent à l'administration coloniale britannique de la Gambie de 1821 à 1965, territoire alors sous la tutelle de l'Empire britannique. La colonie se situait dans les environs immédiats de Bathurst et le protectorat aux terres intérieures de Gambie, délimitées en 1894.\\nL'établissement de la colonie se déroule en 1815 et 1816, respectivement à Fort James et à Bathurst. Dans les premières décennies de son existence, elle est subordonnée à la colonie de Sierra Leone. En 1888, elle devient une entité autonome avec un gouveneur nommé à vie. La colonie prend fin en 1965 lorsque le pays devient un État indépendant au sein du Commonwealth, avec Dawda Jawara au poste de Premier ministre."},{"page_url":"https://fr.wikipedia.org/wiki/Natalya","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Divas_Champion_Natalya.jpg","page_title":"Natalya","context_page_description":"Natalie Katherine Neidhart née le 27 mai 1982 à Calgary est une catcheuse canadienne. Elle travaille actuellement à la World Wrestling Entertainment, dans la division Raw, sous le nom de Natalya.\\nPremière femme de l'histoire de la famille Hart à être catcheuse, Natalya représente la troisième génération de catch de sa famille, après son père Jim Neidhart et son grand-père maternel Stu Hart. Elle est aussi la cousine de David Hart Smith, la nièce de Bret Hart et la femme de Tyson Kidd.\\nAprès avoir débuté dans le catch en 2000 et remporté plusieurs titres de moindre importance sur le circuit indépendant, elle rejoint en 2007 la World Wrestling Entertainment qui l'envoie successivement dans ses deux clubs-écoles, l'Ohio Valley Wrestling et la Florida Championship Wrestling.\\nC'est en 2008 qu'elle débute à SmackDown, l'un des trois shows majeurs de la fédération, avant d'être draftée l'année suivante à la ECW où elle forme avec David Hart Smith et Tyson Kidd l'équipe The Hart Dynasty."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%90%D0%B9%D0%B7%D0%B5%D0%BD%D0%B1%D0%B5%D1%80%D0%B3_(%D0%A2%D1%8E%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Eisenberg_Thur_Rathaus.jpg","page_title":"Айзенберг (Тюрингия)","context_page_description":"Айзенберг (Тюрингия) — Германия Федеративтік Республикасының Тюрингия жерінде орналасқан қала. Заале-Хольцланд ауданының құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 11 154 адамды құрайды. Алып жатқан жер аумағы 11154 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 16 0 74 018. Қаланың басшысы — Инго Липперт.\\nҚаланың өзі әкімшілік құрылымы бойынша 4 қалалық ауданға бөлінеді."},{"page_url":"https://en.wikipedia.org/wiki/Smithfield_Foods","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/5_Hour_Energy_DSC_0256_%2819270427184%29.jpg","page_title":"Smithfield Foods","context_page_description":"Smithfield Foods, Inc., is an American pork producer and food processing company based in Smithfield, Virginia, in the United States, .It functions as a Independent subsidiary of WH Group of Hong Kong.\\"Smithfield Foods, Inc., together with its subsidiaries ... is the largest hog producer and pork processor in the world. ... On September 26, 2013 ... the Company merged with Sun Merger Sub, Inc., a Virginia corporation and wholly owned subsidiary of WH Group ... As a result of the Merger, the Company [Smithfield] survived as a wholly owned subsidiary of WH Group.\\"}} Founded in 1936 as the Smithfield Packing Company by Joseph W. Luter and his son, the company is the largest pig and pork producer in the world. In addition to owning over 500 farms in the US, Smithfield contracts with another 2,000 independent farms around the country to grow Smithfield's pigs. Outside the US, the company has facilities in Mexico, Poland, Romania, Germany, and the United Kingdom. Globally the company employed 50,200 in 2016 and reported an annual revenue of $14 billion."},{"page_url":"https://en.wikipedia.org/wiki/Mark_Olive","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Mark_Olive_2008.jpg","page_title":"Mark Olive","context_page_description":"Mark Olive, also known as the Black Olive, is an Indigenous Australian chef.\\nOlive was born in Wollongong in 1962 and is a Bundjalung man. Olive had a cooking segment on the ABC's Message Stick TV series and later got his own TV cooking series, The Outback Cafe. He has released a cookbook, The Outback Cafe, based on the series. In 2006 he won a Deadly Award for Outstanding Achievement in Entertainment. Mark Olive hosts Australian reality competitive cooking show The Chefs' Line with chef Dan Hong and food writer Melissa Leong."},{"page_url":"https://pl.wikipedia.org/wiki/Niemirowiczowie-Szczyttowie_herbu_Jastrz%C4%99biec","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ko%C5%BCangr%C3%B3dek_barokowa_brama_rezydencja_Szczyttow_1929.jpg","page_title":"Niemirowiczowie-Szczyttowie herbu Jastrzębiec","context_page_description":"Niemirowiczowie-Szczyttowie herbu Jastrzębiec – polski ród możnowładczy a później senatorsko-dygnitarski pochodzenia litewsko-ruskiego."},{"page_url":"https://en.wikipedia.org/wiki/Iconography_of_Shiva_temples_in_Tamil_Nadu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Madurai_Meenakshi_temple_shikhara.jpg","page_title":"Iconography of Shiva temples in Tamil Nadu","context_page_description":"Iconography of Shiva temples in Tamil Nadu is governed by the Shaiva Agamas that revere the ultimate reality as the Hindu deity, Shiva. Āgama in the Hindu religious context means a traditional doctrine or system which commands faith. Temple worship according to Āgamic rules can be said to have started during the Pallava dynasty in South India, but they were fully under establishment during the Chola dynasty The temples during the Chola period expanded to Sri Lanka and islands in South East Asia. The temple complex was expanding with niches for various deities on the stipulated sides of the sanctum. Lingam was universalised and prakarams with subsequent deities came up. The temple parivara expanded considerably during the Chola period. The niches of following Āgamic rules for building Shiva temples in Tamil Nadu, a South Indian state continues even in the modern era. Some of the prime images like that of lingam, Vinayagar and Parvati are present in all the Shiva temples. Almost all the temples follow the same custom during festivals and worship methods with minor exceptions. Most of the Shiva temples in Tamil Nadu and Sri Lanka are built in Dravidian architecture."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%96%E0%B8%94%E0%B8%B5%E0%B9%80%E0%B8%8B%E0%B8%A5%E0%B8%A3%E0%B8%B2%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Dublin_1.jpg","page_title":"รถดีเซลราง","context_page_description":"รถดีเซลราง เป็นรถโดยสารที่มีเครื่องยนต์ดีเซลขับเครื่องด้วยตนเอง เดิมทีการรถไฟฯ ได้นำรถชนิดนี้มาใช้งานในประเทศไทยเมื่อ พ.ศ. 2470 ซึ่งเป็นเครื่องกลไอน้ำ สร้างโดย บริษัทบอลด์วิน สหรัฐอเมริกา รถดีเซลรางรุ่นแรก ๆ ที่นำมาใช้บริการรับส่งผู้โดยสารชานเมืองในปี พ.ศ. 2475 นั้น มีหมายเลข 11 ถึง 16 เป็นรถที่ประกอบด้วยรถกำลัง 1 คัน และรถพ่วงสำหรับผู้โดยสารล้วนอีก 1 คัน\\nภายหลังสงครามโลกครั้งที่ 2 ยุติลง รถดีเซลรางรุ่นใหม่ ๆ ได้รับการพัฒนาให้มีสมรรถนะสูง มีความคล่องตัวในการใช้งาน และสามารถพ่วงต่อกันคราวละหลายชุดได้ โดยแต่ละชุดเครื่องยนต์ทำงานพร้อมกับคันที่มีคนควบคุมที่ต้นขบวน\\nรถดีเซลรางมีคุณสมบัติที่เหนือกว่าขบวนรถซึ่งใช้รถลากจูงหลายประการ คือ ขบวนการดีเซลรางเร่งความเร็ว และหยุดได้เร็วกว่า จึงทำให้ใช้เวลาในการเดินทางน้อยกว่า และเมื่อถึงปลายทาง พนักงานขับรถเปลี่ยนไปขับท้ายขบวนก็สามารถออกรถได้ทันที ไม่ต้องเปลี่ยนตั้งหัวขบวนใหม่เช่นการใช้รถจักร นอกจากนั้นยังสามารถพ่วงติดต่อกันได้ไม่จำกัด เพราะรถทุกชุดขับเคลื่อนด้วยตัวเอง รถที่เป็นตัวกำลังจะทำงานสัมพันธ์กันทุกเครื่องยนต์ ทำให้เฉลี่ยกำลังขับเคลื่อนออกไปตลอดขบวนขึ้นทางลาดชันได้ดีกว่า"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%BB%D0%B0%D0%BC%D0%B0%D0%BD%D0%B4%D0%B0_%D1%81%D0%BB%D0%B0%D0%B1%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Allamanda_6590.JPG","page_title":"Алламанда слабительная","context_page_description":"Аллама́нда слаби́тельная — кустарник, нередко вьющийся, вид рода Алламанда семейства Кутровые."},{"page_url":"https://en.wikipedia.org/wiki/Ebenthal,_Lower_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Ebenthal.JPG","page_title":"Ebenthal, Lower Austria","context_page_description":"Ebenthal is a town in the district of Gänserndorf in the Austrian state of Lower Austria."},{"page_url":"https://sv.wikipedia.org/wiki/Gila_nigrescens","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Charalito_Chihuahua_%28Gila_nigrescens%29.jpg","page_title":"Gila nigrescens","context_page_description":"Gila nigrescens är en fiskart som först beskrevs av Girard, 1856. Gila nigrescens ingår i släktet Gila och familjen karpfiskar. IUCN kategoriserar arten globalt som sårbar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Domenico_Grandi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Domenico_Grandi_1914.jpg","page_title":"Domenico Grandi","context_page_description":"Domenico Grandi è stato un generale e politico italiano.\\nFu Ministro della guerra del Regno d'Italia."},{"page_url":"https://es.wikipedia.org/wiki/Coert_Steynberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Coertsteynberg1.jpg","page_title":"Coert Steynberg","context_page_description":"Coert Steynberg fue un escultor sudafricano; trabajó la piedra, mármol, bronce, cobre y madera. Sus obra estás presentes en su país natal y a nivel internacional, entre ellas la estatua de Bartolomé Díaz en la South Africa House de Londres, un monumento a Andries Pretorius en Graaff-Reinet y el Monumento Tratado de Vereeniging en Vereeniging."},{"page_url":"https://fi.wikipedia.org/wiki/Mathew_Leckie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Mathew_Leckie.jpg","page_title":"Mathew Leckie","context_page_description":"Mathew Leckie on australialainen jalkapalloilija, joka edustaa vuodesta 2017 lähtien saksalaista Hertha Berliniä. Aiemmin hän on Saksassa pelannut Borussia Mönchengladbachissa, FSV Frankfurtissa ja FC Ingolstadt 04:ssä. Hän on pelipaikaltaan laitalinkki tai hyökkääjä.\\nNopeudestaan sekä suoraviivaisesta pelityylistään tunnettu Leckie valittiin Australian joukkueeseen vuoden 2014 MM-kisoihin. Hän on pelannut 63 maaottelua ja tehnyt niissä 11 maalia. Hän pelasi täydet minuutit Australian kaikissa kolmessa ottelussa sekä vuoden 2014 että vuoden 2018 MM-kilpailuissa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%9F%D1%80%D0%B5%D0%BE%D0%B1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F_%D0%93%D0%BE%D1%81%D0%BF%D0%BE%D0%B4%D0%BD%D1%8F_%D0%BD%D0%B0_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B5_%D0%9A%D0%B8%D0%B6%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Kizhi_06-2017_img01_Transfiguration_Church.jpg","page_title":"Церковь Преображения Господня на острове Кижи","context_page_description":"Церковь Преображения Господня — православный храм, памятник архитектуры федерального значения, расположенный на территории музея-заповедника «Кижи», входит в состав храмового комплекса Кижского погоста."},{"page_url":"https://es.wikipedia.org/wiki/Kubilay_T%C3%BCrkyilmaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Kubilay_T%C3%BCrky%C4%B1lmaz.jpg","page_title":"Kubilay Türkyilmaz","context_page_description":"Kubilay Türkyilmaz es un exfutbolista suizo. Jugó 62 partidos para la selección de fútbol de Suiza y marcó 34 goles."},{"page_url":"https://en.wikipedia.org/wiki/TASB_(psychedelics)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/3-TASB.png","page_title":"TASB (psychedelics)","context_page_description":"TASB, or thioasymbescaline, is a series of lesser-known psychedelic drugs similar in structure to asymbescaline and to mescaline. They were first synthesized by Alexander Shulgin and written up in his book PiHKAL. Very little is known about their dangers or toxicity."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Waarschoot","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Waarschoot_Renning_Patattenhof_erfgoed_33293_24-03-2019_14-24-13.jpg","page_title":"Lijst van onroerend erfgoed in Waarschoot","context_page_description":"Een overzicht van het onroerend erfgoed in Waarschoot, een deelgemeente van Lievegem. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://pt.wikipedia.org/wiki/Caet%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Caet%C3%A9_-_Bandeira_Municipal.PNG","page_title":"Caeté","context_page_description":"População estimada [2019] 44.718 pessoas\\nCaeté é um município da Região Metropolitana de Belo Horizonte, em Minas Gerais, no Brasil. De acordo com o IBGE em 2019, sua população estimada é de 44 718 habitantes.\\nÉ neste município que se encontra a Serra da Piedade. No alto, há um santuário católico que recebe romeiros. No mesmo lugar, funciona o Observatório Astronômico Frei Rosário, da Universidade Federal de Minas Gerais. Além disso a cidade é o berço da Guerra dos Emboabas"},{"page_url":"https://de.wikipedia.org/wiki/Dreiband-Europameisterschaft_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/2017_Carom_EC-Winners_3-cushion.jpg","page_title":"Dreiband-Europameisterschaft 2017","context_page_description":"Die Dreiband-Europameisterschaft 2017 ist ein Turnier in der Karambolagevariante Dreiband. Sie fand vom 28. bis 30. April 2017 im Rahmen der Multi-Europameisterschaft im Stahlpalast in Brandenburg an der Havel statt. Seit dem ersten Turnier 1932 ist es die 72. Auflage."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%D9%86%D8%B3%D9%84%D9%88_%D9%87%D9%88%D9%85%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Winslow_Homer_-_The_Fog_Warning_-_Google_Art_Project.jpg","page_title":"وینسلو هومر","context_page_description":"وینسلو هومر، نقاش برجسته آمریکایی در ۲۴ فوریه ۱۸۳۶م در بندر بوستون به دنیا آمد. وی از کودکی به هنر علاقه داشت از این روکار خود را با مصوّرسازی و چاپ آغاز کرد. هومر در جریان جنگ داخلی آمریکا معروف به جنگ‌های انفصال، مأمور تهیه عکس از مناظر جنگ شد و با پایان جنگ، به خلق آثار برجسته و معروف خود پرداخت. او در زمینه گرافیک نیز استعداد خوبی داشت وسال‌ها از راه تصویرگری برای نشریات گوناگون، زندگی خود را می‌گذراند. هومر سالیانی به نقاشی موضوعاتی از زندگی روزمره روستایی و چشم‌اندازهای آمریکا پرداخت و کم‌کم به شهرت دست یافت. با این حال پس از سفری به انگلستان، تغییری در دید و شیوه کاری او پدید آمد. هومر از آن پس با بیانی موجز و بدون تفصیل به تجسم صحنه‌های دریایی پرداخت. وی علاوه بر رنگ روغنی از آبرنگ نیز با مهارت استفاده می‌کرد که مضامین آن بیشتر دریا و حالت وحشیِ بیشه‌زاران شمالی بود. گرچه هومر هرگز مضمون طبیعی را رها نکرد، ولی روزبه‌روز بر قابلیت خود برای گزینش و انتزاع کردن عناصر تصویری‌اش افزود. او هم‌چنین از نور برای تشدید صراحت و قاطعیت شکل‌ها بهره می‌گرفت. هومر طی سال‌های فعالیت هنری خود آثار متعددی به وجود آورد که هشت ناقوس، راست و چپ و اسیران جبهه از آن جمله است. وینسلو هومر سرانجام در ۲۹ سپتامبر ۱۹۱۰م در ۷۴ سالگی درگذشت."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Neckar-Odenwald-Kreis","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Wappen_Muckental.png","page_title":"Liste der Wappen im Neckar-Odenwald-Kreis","context_page_description":"Diese Liste beinhaltet alle in der Wikipedia gelisteten Wappen des Neckar-Odenwald-Kreises in Baden-Württemberg, inklusive historischer Wappen. Fast alle Städte, Gemeinden und Kreise in Baden-Württemberg führen ein Wappen. Sie sind über die Navigationsleiste am Ende der Seite erreichbar."},{"page_url":"https://en.wikipedia.org/wiki/Pittsburgh_Subdivision","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/CSX_train_crossing_under_the_Smithfield_Bridge_in_Pittsburgh_%289382313814%29.jpg","page_title":"Pittsburgh Subdivision","context_page_description":"The Pittsburgh Subdivision is a railroad line owned and operated by CSX Transportation in the U.S. state of Pennsylvania. The line runs from McKeesport northwest through Pittsburgh to West Pittsburg along a former Pittsburgh and Lake Erie Railroad line. Its east end is at Sinns, across the Youghiogheny River from McKeesport at Liberty, at the west end of the Keystone Subdivision. It junctions with the Mon Subdivision at McKeesport and the P&W Subdivision in Rankin; at its west end it becomes the New Castle Terminal Subdivision.\\nAmtrak's Capitol Limited uses the line southeast of Rankin."},{"page_url":"https://de.wikipedia.org/wiki/Pr%C3%A4fektur_Ishikawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Higashiyamahigashi_2015_%E2%85%A1.JPG","page_title":"Präfektur Ishikawa","context_page_description":"Die Präfektur Ishikawa ist eine der Präfekturen Japans. Sie liegt in der Region Chūbu auf der Insel Honshū. Sitz der Präfekturverwaltung ist Kanazawa."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B0%E0%A4%BE%E0%A4%B7%E0%A5%8D%E0%A4%9F%E0%A5%8D%E0%A4%B0%E0%A5%80%E0%A4%AF_%E0%A4%B8%E0%A5%8D%E0%A4%B5%E0%A4%AF%E0%A4%82%E0%A4%B8%E0%A5%87%E0%A4%B5%E0%A4%95_%E0%A4%B8%E0%A4%82%E0%A4%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Dr._Keshav_Baliram_Hedgewar_figure_at_the_main_office_in_nagpur.JPG","page_title":"राष्ट्रीय स्वयंसेवक संघ","context_page_description":"राष्ट्रीय स्वयंसेवक संघ ही एक हिंदूत्ववादी सामाजिक आणि कौटुंबिक संघटना आहे. सामाजिक व सांस्कृतिक संस्था या स्वरूपात ही संघटना काम करीत असते. इ. स. १९९० च्या दशकापर्यंत या संस्थेने राष्ट्रभक्ती व संस्कृती च्या प्रसार प्रसार व संवर्धनासाठी अनेक शाळा आणि समाजोपयोगी निस्वार्थ सेवाभावी कार्य स्थापन केलेले आहे. नैसर्गिक आपत्तींच्या काळातील मदतकार्यासाठी आणि पुनर्वसनातील भूमिकेसाठी या राष्ट्रीय स्वयंसेवक संघाचे स्वयंसेवक अत्यंत समर्पित होऊन मदत करत असतात.\\nजागृत, सशक्त संघटीत, समर्थ राष्ट्राच्या निर्माणासाठी संघाचे अथक अविरत प्रयत्न सुरू आहेत. निद्रिस्त भारत पुन्हा जागृत व्हावा यासाठी आपल्या उपसंस्थाद्वारे अनेक माध्यमातून कार्य सुरू असते. सर्वस्पर्शी व सर्वव्यापी व सर्वग्राही होऊन देशाच्या कणकणातून राष्ट्राभिमान जागृत करण्यासाठी संघ सतत प्रयत्नशील असतो."},{"page_url":"https://no.wikipedia.org/wiki/Ciklider","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Heros_notatus01.jpg","page_title":"Ciklider","context_page_description":"Ciklider eller cichlider er en stor og variert familie piggfinnefisker. De minste artene er ikke lengre enn 3 cm, mens de største kommer opp mot meteren.\\nNoen arter er viktige matfisk, og mange andre er verdsatte som akvariefisk. Noen vanlige akvarieciklider er scalare og discus, ildbuk, Jack Dempsey, sneglehuslekere og oscar.\\nAlle ciklider har yngelpleie.\\nNavnet på gruppen kommer fra det greske ordet kichle som er en slags fisk.\\nFor fiskerinæringen er det stort sett ciklider av slekten Cichla som har betydning."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%88%D1%87%D0%B0_%D0%9F%D0%B0%D1%9E%D1%81%D1%82%D0%B0%D0%BD%D0%BD%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%8B%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%86%D1%8F%D1%80%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Metro_SPB_Line1_Vosstaniya.jpg","page_title":"Плошча Паўстання (станцыя метро, Санкт-Пецярбург)","context_page_description":"«Плошча Паўстання» — станцыя Пецярбургскага метрапалітэна. Уваходзіць у склад Кіраўска-Выбаргскай лініі, размешчана паміж станцыямі «Уладзімірская» і «Чарнышэўская».\\nСтанцыя адкрыта 15 лістапада 1955 ў складзе першай чаргі метрапалітэна «Аўтава» — «Плошча Паўстання». Назва звязана з размяшчэннем на Плошчы Паўстання.\\n15 снежня 2011 года Саветам па захаванню культурнай спадчыны станцыя ўнесена ў адзіны дзяржаўны рэестр аб'ектаў культурнай спадчыны рэгіянальнага значэння."},{"page_url":"https://ko.wikipedia.org/wiki/EVGA_%EC%BD%94%ED%8D%BC%EB%A0%88%EC%9D%B4%EC%85%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/EVGA_Logo.svg","page_title":"EVGA 코퍼레이션","context_page_description":"EVGA 코퍼레이션은 소비자 시장을 대상으로 엔비디아 GPU 기반 그래픽 카드와 인텔 칩셋 기반 메인보드를 생산하는 미국의 컴퓨터 하드웨어 기업이다. 2010년부터 이 기업은 다른 컴퓨터 부품을 포트폴리오에 추가하기 시작했는데, 여기에는 게이밍 노트북, 전원공급장치, 컴퓨터 케이스, 게이밍 마우스를 포함한다. 1999년 7월에 설립되었으며 본사는 캘리포니아주 브레아에 위치해 있다."},{"page_url":"https://pl.wikipedia.org/wiki/Langensendelbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Langensendelbach_001.JPG","page_title":"Langensendelbach","context_page_description":"Langensendelbach – miejscowość i gmina w Niemczech, w kraju związkowym Bawaria, w rejencji Górna Frankonia, w regionie Oberfranken-West, w powiecie Forchheim. Leży przy autostradzie A73 i linii kolejowej Norymberga – Bamberg – Lipsk.\\nGmina leży 9 km na południe od Forchheimu, 6 km na północny wschód od Erlangen i 21 km na północ od Norymbergi."},{"page_url":"https://en.wikipedia.org/wiki/Kimpton_Topaz_Hotel","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Topaz_Hotel_-_Washington%2C_D.C..jpg","page_title":"Kimpton Topaz Hotel","context_page_description":"The Kimpton Topaz Hotel is a 99-room boutique hotel at 1733 N Street Northwest, between Dupont Circle and Scott Circle in Washington, D.C. Located around the corner from St. Matthew's Cathedral and the Philippine embassy, Kimpton Topaz Hotel is one of 13 Kimpton hotel properties in the Washington Metropolitan Area. Formerly the Canterbury Hotel, the building which houses Kimpton Topaz Hotel was purchased in March 2001 by LaSalle Hotel Properties of Bethesda, Maryland, and became a joint project of the Kimpton Group and LaSalle. Kimpton Topaz Hotel became the first Kimpton-managed property on the East Coast and opened in October 2001. Known for its New Age and body wellness themes, Kimpton Topaz Hotel was named one of the 11 healthiest hotels in the United States by Health magazine. In 2006, Kimpton Topaz Hotel was named one of the trendiest hotels in Washington, D.C."},{"page_url":"https://sv.wikipedia.org/wiki/VL","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Vlbussar.jpg","page_title":"VL","context_page_description":"Kollektivtrafikförvaltningen VL är en förvaltning inom Region Västmanland verksam sedan 1 januari 2012. Förvaltningen är en regional kollektivtrafikmyndighet och trafikhuvudman för kollektivtrafiken i Västmanlands län, såväl stadsbussarna i Västerås som landsbygdstrafiken inom länet. Förvaltningen bedriver busstrafiken genom Svealandstrafiken AB som ägs gemensamt av Region Västmanland och Region Örebro län. Tidigare har VL även bedrivit länstågtrafik och då med Statens Järnvägar som entreprenör men den verksamheten överfördes 2001 till regionägda Tåg i Bergslagen. Antal resenärer för VL var drygt 8 miljoner 2009. VL står för Västmanlands lokaltrafik som var namnet på det landstingsägda företag som tidigare ansvarade för trafiken. Förvaltningen använder beteckningen VL som ett produktnamn och logotyp, men den utgör därvid ingen förkortning.\\nFram till 2012 var Västmanlands Lokaltrafik AB trafikhuvudman för kollektivtrafiken i Västmanlands län. Det ägdes av landstinget och kommunerna i länet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D1%85%D0%BE%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%D0%A1%D0%B0%D1%80%D0%B0_%D0%B8.png","page_title":"Фонтхонг","context_page_description":"Фонтхонг — надстрочный диакритический знак тайской письменности, похожий на апостроф. В отдельности обозначает ваннаюк май эк. В контакте с пхинтуи обозначает долгий «И» и участвует в образовании трёх разновидностей тайского слога."},{"page_url":"https://vi.wikipedia.org/wiki/Maxillaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Maxillaria_sp._%28404143336%29.jpg","page_title":"Maxillaria","context_page_description":"Maxillaria là một chi thực vật có hoa trong họ Lan."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9B%E1%83%90%E1%83%A2%E1%83%95%E1%83%94%E1%83%98_%E1%83%92%E1%83%90%E1%83%9C%E1%83%90%E1%83%9E%E1%83%9D%E1%83%9A%E1%83%A1%E1%83%99%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Matvey_Ganapolsky3.jpg","page_title":"მატვეი განაპოლსკი","context_page_description":"მატვე განაპოლსკი — ჟურნალისტი, თეატრალური რეჟისორი, ოჯარალუ მოღალე. რადიოსადგჷმ \\"ეხო მასკვი\\"-შ დო ქორთულ ტელეარხიშ \\"კავკაციაშ მაართა ოინფორმაციე\\"-შ გინოჩამეფიშ მაჸვენჯი; რუსეთიშ ურიეფიშ კონგრესიშ მაკათური. რუსულ გაზეთიშ 'მოსკოვსკი კომსომოლეცი'-შ კოლუმნისტი."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A7%D0%B5%D1%98%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/%C4%8Cejov%2C_ulice.jpg","page_title":"Чејов","context_page_description":"Чејов је насељено мјесто са административним статусом сеоске општине у округу Пелхримов, у крају Височина, Чешка Република."},{"page_url":"https://la.wikipedia.org/wiki/Georgius_Wassilko_de_Serecki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Georg_Wassilko_von_Serecki_um_1905.png","page_title":"Georgius Wassilko de Serecki","context_page_description":"Georg contem Wassilko de Serecki ex clarissima nobili familia Wassilko, fuit Ducatus Bucovinae praefectus"},{"page_url":"https://fr.wikipedia.org/wiki/Barclays","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Barclays_HQ.jpg","page_title":"Barclays","context_page_description":"Barclays est une banque britannique basée à Londres au Royaume-Uni fondée en 1896 mais dont les origines remontent à 1690. Le groupe est coté sur l’indice FTSE 100 de la bourse de Londres et fait partie des « big five », les 5 plus grandes banques britanniques.\\nBarclays exerce ses activités dans plus de 60 pays que ce soit en Europe en particulier au Royaume-Uni, en Asie ou encore en Amérique et en Afrique. Le groupe emploie 111 300 personnes dans le monde dont 32 000 en Afrique du Sud à travers sa nouvelle filiale Absa acquise en 2005.\\nEn 2005, Barclays est la quatorzième banque européenne en termes de fonds propres."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%BE%D0%BC%D0%B8%D1%80_%D0%A5%D0%B0%D1%80%D0%B8%D0%B7%D0%B0%D0%BD%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Lyubomir_Harizanov_portrait.jpg","page_title":"Любомир Харизанов","context_page_description":"Любомир Спасов Харизанов е български революционер и публицист."},{"page_url":"https://bs.wikipedia.org/wiki/Bistra_(Vrhnika)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Grad_Bistra3.JPG","page_title":"Bistra (Vrhnika)","context_page_description":"Bistra je naseljeno mjesto u sastavu općine Vrhnika, regija Srednja Slovenija, Slovenija."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%B1%D0%BE%D0%BD%D0%BE%D1%81%D1%8B%D0%B9_%D1%82%D1%83%D1%80%D0%BF%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Melanitta_fusca_var_deglandi_f_Toronto.jpg","page_title":"Горбоносый турпан","context_page_description":"Горбоносый турпан — водоплавающая птица семейства утиных. Латинское название вида дано в честь французского врача и зоолога Ком-Дамьена Деглана."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%A0u_v%C5%A9_tr%E1%BB%A5_TKS","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Polyus_cutaway.png","page_title":"Tàu vũ trụ TKS","context_page_description":"Tàu vũ trụ TKS là tàu vũ trụ của Liên Xô được hình thành vào cuối những năm 1960 để tiếp tế trạm vũ trụ Almaz.\\nTàu vũ trụ được thiết kế cho cả các chuyến bay tiếp tế hàng hóa được điều khiển bằng phi hành đoàn và tự hành, nhưng không bao giờ được sử dụng trong vai trò dự định của nó - chỉ có bốn nhiệm vụ thử nghiệm được bay trong chương trình. Khối hàng hóa chức năng của tàu vũ trụ TKS sau đó đã hình thành nên cơ sở của một số mô-đun trạm vũ trụ, bao gồm mô-đun FGB Zarya trên Trạm Vũ trụ Quốc tế.\\nTàu vũ trụ TKS bao gồm hai tàu vũ trụ được gắn với nhau, cả hai đều có thể hoạt động độc lập:\\nTàu vũ trụ VA, là nơi chứa các phi hành gia trong quá trình phóng và về Trái Đất của tàu vũ trụ TKS, trong khi di chuyển đến và đi từ trạm vũ trụ Almaz.\\nKhối hàng hóa chức năng, để tiếp tế trạm vũ trụ Almaz, mang theo bộ phận kết nối trạm vũ trụ, bình nhiên liệu và một khoang chứa hàng lớn có áp suất. Hơn nữa, FGB mang các động cơ cơ động trên quỹ đạo cho TKS."},{"page_url":"https://de.wikipedia.org/wiki/860","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%D0%A6%D0%B0%D1%80%D1%8C%D0%B3%D1%80%D0%B0%D0%B4.jpg","page_title":"860","context_page_description":"Pfingsten: Königstreffen von Karl dem Kahlen, Lothar II. und Ludwig dem Deutschen in Koblenz zur Beilegung familieninterner Streitigkeiten, Ergebnis ist der Frieden von Koblenz."},{"page_url":"https://en.wikipedia.org/wiki/Kim_Min-ji_(actress)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/160217_%EC%84%9C%EB%AF%BC%EC%A7%80.jpg","page_title":"Kim Min-ji (actress)","context_page_description":"Kim Min-ji is a South Korean actress. She also hosted Music Bank from December 2010 to October 2011.\\nFrom 2013 to 2016, she was known as Seo Min-ji. She later used her birth name again."},{"page_url":"https://pt.wikipedia.org/wiki/.50-70_Government","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/.50-70_Springfield_rifle_button_primed.jpg","page_title":".50-70 Government","context_page_description":"O .50-70 Government, é um cartucho de fogo central de pólvora negra, adotado em 1866 para o rifle Springfield Model 1866 \\"Trapdoor\\"."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Neufch%C3%A2tel-en-Bray","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Map_canton_code_76_38.svg","page_title":"Cantón de Neufchâtel-en-Bray","context_page_description":"El Cantón de Neufchâtel-en-Bray es una división administrativa dentro de la República Francesa situada en el Distrito de Dieppe, del Departamento francés de Sena Marítimo, en la región de Alta Normandia.\\nEn el cantón de Neufchâtel-en-Bray se desarrolla la actividad agrícola, maderera e industria liviana en torno al pueblo de Neufchâtel-en-Bray. La altitud varía entre 53 m en Mesnières-en-Bray, hasta los 244 m en Nesle-Hodeng, con una altitud media de 133 metros sobre el nivel del mar."},{"page_url":"https://bs.wikipedia.org/wiki/Vjetrenja%C4%8Da","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D9%86%D8%B4%D8%AA%DB%8C%D9%81%D8%A7%D9%86.jpg","page_title":"Vjetrenjača","context_page_description":"Vjetrenjača se prvenstveno odnosi na mlin koji pretvara energiju vjetra u rotacionu energiju pomoću krila koja se nazivaju jedra. Vjetrenjače su se prvi put pojavile u Perziji u 9. vijeku nove ere. Vjetrenjače se, pored vodenica koje koriste hidroenergiju, do pronalaska motora, smatraju za prve ili rane motore predindustrijskog doba. Najviše su korištene kao mlin za mljevenje žitarica, pumpa za vodu ili pumpna stanica, potom za obradu - pilana i mlin za ulje."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%A5%BF%E7%87%9F%E7%9B%A4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sai_Ying_Pun_pre_opening_discount.jpg","page_title":"西營盤站","context_page_description":"西营盘站是港铁港岛线铁路站，位于香港岛中西区西营盘第二街与正街交界的一段第三街和高街之间的地底，主要服务西营盘及西半山居民。此站作为港岛线的西延段——西港岛线的组成部分，由金门西松联营负责兴建，于2015年3月29日启用，为该线最后一个启用的铁路站。本站已随2016年3月27日B3出口的启用正式完成建筑工程，而该出入口的升降机亦在同年6月25日启用。\\n西营盘站兴建在地下洞穴内，车站C出入口至大堂的垂直距离深入地底50米，代替金钟站成为全香港第二深的洞穴车站，仅次于香港大学站。"},{"page_url":"https://sl.wikipedia.org/wiki/Spartak_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Spartacus_sheetA.jpg","page_title":"Spartak (film)","context_page_description":"Spartak je ameriški epski zgodovinski dramski film iz leta 1960, ki ga je režiral Stanley Kubrick po scenariju Daltona Trumboja. Temelji na romanu Spartacus Howarda Fasta iz leta 1951, ki opisuje življenjsko zgodbo vodje upora sužnjev Spartaka. V naslovni vlogi nastopa Kirk Douglas, v ostalih glavnih vlogah pa Laurence Olivier kot rimski general in politik Mark Licinij Kras, Peter Ustinov kot trgovec s sužnji Lentul Batiat, John Gavin kot Julij Cezar, Jean Simmons kot Varinia, Charles Laughton kot Sempronius Gracchus in and Tony Curtis kot Antoninus\\nDouglas, katerega družba Bryna Productions je film producirala, je odpustil prvotnega režiserja Anthonyja Manna po enem tednu snemanja, in pripeljal Kubricka, s katerim je bil že delal. To je bil režiserjev edini film, nad katerem ni imel popolnega umetniškega nadzora. Scenarist Dalton Trumbo je bil eden od Hollywoodske deseterice, ki je bila zaradi domnevnega simpatiziranja s komunisti na črnem seznamu. Vseeno ga je Douglas javno oznanil kot scenarista filma in novoizvoljeni ameriški predsednik John F. Kennedy si je film javno ogledal kljub protestom Ameriške legije, s čimer je pomagal končati koncept črnega seznama."},{"page_url":"https://es.wikipedia.org/wiki/Sudario_de_Tur%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Shroudofturin.jpg","page_title":"Sudario de Turín","context_page_description":"El Sudario de Turín —también conocido como la Síndone, la Sábana Santa o el Santo Sudario— es una tela de lino que muestra la imagen de un hombre que presenta marcas y traumas físicos propios de una crucifixión.​ El sudario mide 436 cm × 113 cm. Se custodia en Turín, en la capilla de la Sábana Santa —construida expresamente para ese fin a finales del siglo XVII, durante el reinado de Carlos Manuel I de Saboya, duque de Saboya—, una obra maestra del barroco italiano finalizada por Guarino Guarini que se encuentra dentro de un complejo de edificios que incluye la catedral, el palacio Real y el palazzo Chiablese.\\nLos orígenes del sudario y su figura son objeto de debate entre científicos, teólogos, historiadores e investigadores. Algunos sostienen que el sudario es la tela que se colocó sobre el cuerpo de Jesucristo en el momento de su entierro, y que el rostro que aparece es el suyo. Sin embargo, la tela ha sido datada mediante radiocarbono y sitúa su origen en la Edad Media.​ La Iglesia católica no ha manifestado oficialmente su aceptación o rechazo hacia el sudario, pero en 1958 el papa Pío XII autorizó la imagen en relación con la devoción católica hacia la Santa Faz de Jesús.​"},{"page_url":"https://hu.wikipedia.org/wiki/Sz%C3%A1kszend","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Sz%C3%A1kszend_C%C3%ADmer.png","page_title":"Szákszend","context_page_description":"Szákszend község Komárom-Esztergom megyében, az Oroszlányi járásban."},{"page_url":"https://es.wikipedia.org/wiki/Selva_del_Congo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Dja.JPG","page_title":"Selva del Congo","context_page_description":"La Selva del Congo es un bosque húmedo tropical que se extiende por las llanuras de la cuenca del río Congo y sus afluentes en el África Central.\\nEl bosque de Congo abarca una enorme región de África Central, que incluye a los países de: República Democrática del Congo, República del Congo, Gabón, Guinea Ecuatorial, el sureste de Camerún y la parte sur de la República Centroafricana.\\nAl norte y al sur de esta selva, la transición hacia el bosque seco de sabana de África se compone de bosques secos, sabanas y praderas. Hacia el oeste, también hay transición a los bajos bosques costeros de Guinea Ecuatorial, que se extienden desde el oeste de Gabón y Camerún, al sur de Nigeria y Benín. La selva del Congo y los bosques de la costa de Guinea comparten muchas similitudes entre ellos. Hacia el este, la transición a los bosques de alta montaña de la Falla Albertina, que es una cadena de montañas que forman el Rift de África Oriental, limitan la selva por el este.\\nLa selva del Congo es clasificada como ecorregión de conservación prioritaria, según la lista Global 200 publicado por WWF."},{"page_url":"https://it.wikipedia.org/wiki/Cimitero_militare_polacco_di_Bologna","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/BolognaPolCmWoj7sie2011.JPG","page_title":"Cimitero militare polacco di Bologna","context_page_description":"Il cimitero militare polacco di Bologna è il più grande dei quattro cimiteri militari in cui sono sepolti i soldati polacchi caduti in Italia durante la seconda guerra mondiale."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%BF%E6%B8%85%E5%A4%A7%E5%AD%A6%E7%A7%91%E6%8A%80%E5%9B%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/%E6%B5%8E%E5%8D%97%E5%B8%82%E9%95%BF%E6%B8%85%E5%A4%A7%E5%AD%A6%E5%9F%8E%E5%95%86%E4%B8%9A%E8%A1%97%E4%B8%80%E8%A7%92.JPG","page_title":"长清大学科技园","context_page_description":"长清大学科技园是位于山东省济南市长清区的一处高等学校聚集区，规划总面积43平方公里，可建设用地范围面积为32平方公里，控规规划总人口约32万人，是济南市新规划两翼展开中西部片区的亮点工程，以学历教育为主。长清大学城于2003年开工程建设，园区内各高校于2005年陆续进驻。"},{"page_url":"https://ga.wikipedia.org/wiki/Edvard_Munch","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Edvard_Munch_-_Shore_with_Red_House_-_Google_Art_Project.jpg","page_title":"Edvard Munch","context_page_description":"Péintéir a rugadh i Löten na hIorua ab ea Edvard Munch. Dhírigh sé ar ábhair cosúil leis an mbás is an grá, agus bhain feidhm as stíl shiombalach eispriseanaíoch le dathanna geala is dearadh fíorchuartha a léiríodh sa phictiúr cáiliúil dá chuid, Skrik. Goideadh an pictiúr seo, nó dréacht de, is pictiúr eile le Munch, \\"Madonna\\", ó Mhúsaem Munch in Osló i 2004."},{"page_url":"https://gl.wikipedia.org/wiki/Crocodilomorfos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Sichuanosuchus_BW_flipped.jpg","page_title":"Crocodilomorfos","context_page_description":"Non confundir con Crocodiliformes.\\nO dos crocodilomorfos é un grupo de arcosauros no que están incluídos os crocodilianos e os seus parentes extintos.\\nDurante o Mesozoico e inicios do Cenozoico, os Crocodylomorpha eran moito máis diversos do que hoxe. As formas triásicas eran pequenos animais terrestres activos de constitución lixeira. Foron substituídos durante os inicios do Xurásico por varias formas de augas doces e mariñas. O Xurásico tardío, Cretáceo e Cenozoico viron o florecemento dunha ampla diversidade de liñaxes terrestres e semiacuáticas. Os \\"modernos\\" crocodilianos non apareceron ata o Cretáceo final. Entre os crocodilomorfos máis grandes están: o Crocodylus thorbjarnarsoni de 8,2 m de longo, o Deinosuchus riograndensis de 8,9 m, o Machimosaurus hugii de 9,6 m, e o Sarcosuchus imperator de 9,7 m."},{"page_url":"https://en.wikipedia.org/wiki/Controversies_regarding_the_role_of_the_Emperor_of_Japan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Japanemperorbirthday.jpg","page_title":"Controversies regarding the role of the Emperor of Japan","context_page_description":"There have been several controversies regarding the role and the status of the Emperor of Japan. This is due in part to the variety of roles the Emperor has historically filled, as well as the competition for power with other parts of Japanese society at several points in history."},{"page_url":"https://sv.wikipedia.org/wiki/Gaku_Shibasaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Gaku_Shibasaki_20180612.jpg","page_title":"Gaku Shibasaki","context_page_description":"Gaku Shibasaki, född den 28 maj 1992 i Aomori prefektur, är en japansk fotbollsspelare som sedan juli 2017 spelar för den spanska klubben Getafe CF i ligan La Liga. Den 15 december 2014 tog Japans förbundskapten ut Shibasaki till det asiatiska mästerskapet i fotboll 2015."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Salomonsaarten_kaupungeista","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/SolomonIslandsMap.png","page_title":"Luettelo Salomonsaarten kaupungeista","context_page_description":"Tämä on luettelo Salomonsaarilla sijaitsevista kaupungeista. Suluissa on kaupungin asukasluku vuoden 2009 väestönlaskennassa.\\nAuki\\nBuala\\nGizo\\nHoniara\\nKirakira\\nLata\\nMalango\\nMunda - Rusa Noviana\\nNoro\\nTandai\\nTaro\\nTigoa\\nTulagi"},{"page_url":"https://de.wikipedia.org/wiki/Molteno_(S%C3%BCdafrika)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Molteno-001.JPG","page_title":"Molteno (Südafrika)","context_page_description":"Molteno ist eine Stadt in der südafrikanischen Provinz Ostkap. Sie liegt in der Gemeinde Enoch Mgijima im Distrikt Chris Hani. 2011 hatte sie 11.553 Einwohner. Die Stadt erhielt ihren Namen nach Sir John Charles Molteno, dem ersten Premierminister der Kapkolonie. Bis 2016 war sie Verwaltungssitz der Gemeinde Inkwanca.\\nDas östlich von Molteno liegende Gebiet der Gemeinde Emalahleni erhielt seinen Namen aus einer Bantusprache und bedeutet Kohle."},{"page_url":"https://id.wikipedia.org/wiki/L%C3%A6s%C3%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Map_DK_L%C3%A6s%C3%B8.PNG","page_title":"Læsø","context_page_description":"Pemukiman Læsø adalah sebuah kawasan pemukiman di Region Nordjylland di Denmark tengah. Pemukiman Læsø memiliki luas sebesar 114 km² dan memiliki populasi sebesar 2.003 jiwa."},{"page_url":"https://eu.wikipedia.org/wiki/Montdor%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Montdor%C3%A9%2C_%C3%89glise_Saint-Martin.jpg","page_title":"Montdoré","context_page_description":"Montdoré Frantziako udalerria da, Haute-Saône departamenduan dagoena, Franche-Comté eskualdean. 2013an 70 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/Bruce_Cumings","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/BruceCumings.jpg","page_title":"Bruce Cumings","context_page_description":"Bruce Cumings is an American historian of East Asia, professor, lecturer and author. He is the Gustavus F. and Ann M. Swift Distinguished Service Professor in History, and the former chair of the history department at the University of Chicago. He specializes in modern Korean history and contemporary international relations.\\nIn May 2007, Cumings was the first recipient of the Kim Dae Jung Academic Award for Outstanding Achievements and Scholarly Contributions to Democracy, Human Rights and Peace granted by South Korea. The award is named in honor of 2000 Nobel Peace Prize winner and former President of South Korea Kim Dae Jung. The award recognizes Cumings for his \\"outstanding scholarship, and engaged public activity regarding human rights and democratization during the decades of dictatorship in Korea, and after the dictatorship ended in 1987.\\"\\nCumings' Origins of the Korean War, Vol. 1 won the John K. Fairbank Prize of the American Historical Association, and his Origins of the Korean War, Vol. 2 won the Quincy Wright Book Award of the International Studies Association."},{"page_url":"https://eo.wikipedia.org/wiki/Asakusa","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/AsakusaFestival0747.jpg","page_title":"Asakusa","context_page_description":"Asakusa aŭ Asaksa estas kvartalo en kvartalo Tajto, Tokio, Japanio. Ĝi estas fama pro budhisma templo Senso-ĝi, dediĉita al Kannon. Ekzistas pluraj aliaj temploj en Asakusa, kaj okazas tie diversaj festivaloj."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_Zak%C5%82ad%C3%B3w_Azotowych_w_Tarnowie-Mo%C5%9Bcicach_S.A.","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Tarnow--Biala-i-Dunajec--ujscie.JPG","page_title":"Historia Zakładów Azotowych w Tarnowie-Mościcach S.A.","context_page_description":"Historia zakładów azotowych w Tarnowie-Mościcach sięga 1927 r. Grupa Azoty S.A. to przedsiębiorstwo z branży chemicznej zlokalizowane w Mościcach, dzielnicy Tarnowa. W okresie II Rzeczypospolitej to jedna z najnowocześniejszych fabryk w Europie oraz jedna z największych inwestycji okresu międzywojennego w Polsce."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%94%90%E6%B4%A5%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/ja/9/95/Aeon_Karatsu.jpg","page_title":"唐津市","context_page_description":"唐津市は、佐賀県の北西に位置し玄界灘に面する市。福岡都市圏を形成する都市の一部である。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A8%D8%B1%D9%8A%D9%84_%D8%A7%D9%84%D9%88%D8%B1%D9%8A%D8%A7%D8%AC%D8%A7_%D9%BE%D9%8A%D8%B3%D8%A7%D8%B1%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Gabriel_Elorriaga_in_the_EPP_Convention_On_Climate_Change_in_Madrid_%286-7_February_2008%29.jpg","page_title":"جابريل الورياجا پيساريك","context_page_description":"جابريل الورياجا پيساريك سياسى من اسبانيا."},{"page_url":"https://cy.wikipedia.org/wiki/Tylluan_dorchddu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Otus_scops_ab_cropped.png","page_title":"Tylluan dorchddu","context_page_description":"Aderyn a rhywogaeth o adar yw Tylluan dorchddu a adnabyddir hefyd gyda'i enw gwyddonol Strix huhula; yr enw Saesneg arno yw Black-banded owl. Mae'n perthyn i deulu'r Tylluanod sydd yn urdd y Strigiformes.\\nTalfyrir yr enw Lladin yn aml yn S. huhula, sef enw'r rhywogaeth."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_2017_de_l%27%C3%A9quipe_cycliste_Fortuneo-Oscaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Adinkerke_%28De_Panne%29_-_Driedaagse_van_De_Panne-Koksijde%2C_etappe_1%2C_28_maart_2017%2C_vertrek_%28A11%29.JPG","page_title":"Saison 2017 de l'équipe cycliste Fortuneo-Oscaro","context_page_description":"La saison 2017 de l'équipe cycliste Fortuneo-Oscaro est la treizième de cette équipe."},{"page_url":"https://cs.wikipedia.org/wiki/Manitou_(firma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Manitou_Group_Logo.svg","page_title":"Manitou (firma)","context_page_description":"Manitou je francouzský výrobce manipulační techniky. Důraz je kladen na stroje určené pro manipulaci v terénu, ale v posledních letech byl výrobní program rozšířen také o techniku pro průmyslové haly, sklady a zpevněné povrchy obecně."},{"page_url":"https://sv.wikipedia.org/wiki/1940","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/After_bombing_of_Pajala_1940.jpg","page_title":"1940","context_page_description":"1940 var ett skottår som började en måndag i den gregorianska kalendern."},{"page_url":"https://en.wikipedia.org/wiki/Oldest_dated_rocks","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/4%2C030%2C000%2C000_Years_Acasta_Gneiss.jpg","page_title":"Oldest dated rocks","context_page_description":"The oldest dated rocks formed on Earth, as an aggregate of minerals that have not been subsequently broken down by erosion or melted, are more than 4 billion years old, formed during the Hadean Eon of Earth's geological history. Meteorites that were formed in other solar systems can pre-date the Earth. Particles from the Murchison meteorite were dated in January 2020 to be 7 billion years old.\\nHadean rocks are exposed on the Earth's surface in very few places, such as in the geologic shields of Canada, Australia and Africa. The ages of these felsic rocks are generally between 2.5 and 3.8 billion years. The approximate ages have a margin of error of millions of years. In 1999, the oldest known rock on Earth was dated to 4.031 ±0.003 billion years, and is part of the Acasta Gneiss of the Slave craton in northwestern Canada. Researchers at McGill University found a rock with a very old model age for extraction from the mantle in the Nuvvuagittuq greenstone belt on the coast of Hudson Bay, in northern Quebec; the true age of these samples is still under debate, and they may actually be closer to 3.8 billion years old."},{"page_url":"https://en.wikipedia.org/wiki/Robin_Smeulders","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/EWE_Baskets_vs_Khimik.jpg","page_title":"Robin Smeulders","context_page_description":"Robin Smeulders is a Dutch, Austrian, and German retired professional basketball player who played 9 seasons in the Basketball Bundesliga."},{"page_url":"https://ro.wikipedia.org/wiki/Major_League_Soccer_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Mercedes_Benz_Stadium_time_lapse_capture_2017-08-13.jpg","page_title":"Major League Soccer 2017","context_page_description":"Major League Soccer 2017 a fost cel de-al 22-lea sezon al ligii profesioniste nord-americane de fotbal ce a inclus 22 de cluburi în total. Sezonul regulat a început la 3 martie și s-a încheiat în 23 octombrie. Play-off-ul a început pe 25 octombrie și s-a încheiat pe 9 decembrie.\\nDouă noi cluburi s-au alăturat ligii: Atlanta United FC și Minnesota United FC.\\nCampioana en-titre, deținătoarea Cupei MLS era echipa Seattle Sounders FC, în timp ce FC Dallas era deținătoarea MLS Supporters' Shield. Toronto FC a devenit campioană pentru prima dată, câștigănd Cupei MLS, aceeași echipă câștigând și MLS Supporters' Shield."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D1%82%D1%8C%D1%8F%D0%BA,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Opening_of_XXII_Winter_Olympic_Games_%282338-12%29.jpg","page_title":"Третьяк, Владислав Александрович","context_page_description":"Владисла́в Алекса́ндрович Третья́к — советский хоккеист, тренер, российский государственный и политический деятель. Депутат Государственной думы IV—VII созывов от партии «Единая Россия». С 2006 года — президент Федерации хоккея России. Полковник в отставке.\\nВ период с 1969 по 1984 годы защищал ворота ЦСКА и сборной Советского Союза. В матчах чемпионата СССР сыграл 482 матча, на чемпионатах мира и Олимпийских Играх 117 игр. В турнирах Кубка Канады — 11 матчей. Входит в Символическую сборную столетия ИИХФ."},{"page_url":"https://fr.wikipedia.org/wiki/James_Basire","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Field_of_the_cloth_of_gold.jpg","page_title":"James Basire","context_page_description":"James Basire est un dessinateur et graveur britannique.\\nBasire a gravé plusieurs sujets de William Hogarth et a eu pour élève William Blake."},{"page_url":"https://ca.wikipedia.org/wiki/Benais_(Indre_i_Loira)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Map_commune_FR_insee_code_37024.png","page_title":"Benais (Indre i Loira)","context_page_description":"Benais és un municipi francès, situat al departament de l'Indre i Loira i a la regió de Centre – Vall del Loira. L'any 2007 tenia 873 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Acoustic_microscopy","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Sonoscanart5.jpg","page_title":"Acoustic microscopy","context_page_description":"Acoustic microscopy is microscopy that employs very high or ultra high frequency ultrasound. Acoustic microscopes operate non-destructively and penetrate most solid materials to make visible images of internal features, including defects such as cracks, delaminations and voids."},{"page_url":"https://id.wikipedia.org/wiki/Abba_Hushi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Abba_and_Sisters.JPG","page_title":"Abba Hushi","context_page_description":"Abba Hushi adalah seorang politikus Israel yang menjabat sebagai wali kota Haifa selama delapan belas tahun antara 1951 sampai 1969. Hushi adalah salah satu pendiri dan aktivis gerakan Hashomer Hatzair di Polandia. Pada Juli 1920, ia berimigrasi ke Mandat Palestina bersama dengan sekelompok 130 pionir Yahudi. Disana ia mengambil marga Ibrani \\"Hushi\\" [\\"cepat\\"], sebuah translasi dari nama aslinya, Schneller. Ia membuat jalan-jalan dan mendrainasikan rawa-rawa, dan membantu untuk mendirikan kibbutz Beit Alfa. Ia adalah salah satu anggota pendiri federasi buruh Histadrut. Pada 1927, ia bermukim di Haifa dan bergabung dengan partai Ahdut HaAvoda, yang kemudian digabung dengan Mapai. Ia menjadi sekretaris Dewan Para Pekerja Haifa dari 1931 sampai 1951. Ia terpilih menjadi Knesset pertama di Israel pada 1949 sebagai anggota Mapai. Sebelum pemilihan 1951, ia meninggalkan pemerintahan untuk menjadi wali kota Haifa. Sebagai wali kota, ia membantu mendirikan Universitas Haifa, Teater Haifa, Museum Kesenian Jepang Tikotin, Museum Mane-Katz dan Carmelit.\\nAbba Hushi adalah mertua dari anggota Knesset Amnon Linn."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%B4%D8%AA%D8%B1%D9%87%D8%A7%D9%88%D8%B2%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Wappen_Westerhausen.png","page_title":"وشترهاوزن","context_page_description":"وشترهاوزن یک منطقهٔ مسکونی در آلمان است که در تاله واقع شده‌است. وشترهاوزن ۲٬۰۹۲ نفر جمعیت دارد."},{"page_url":"https://es.wikipedia.org/wiki/Marliens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Blason_de_la_ville_de_Marliens_%2821%29.svg","page_title":"Marliens","context_page_description":"Marliens es una población y comuna francesa, en la región de Borgoña, departamento de Côte-d'Or, en el distrito de Dijon y cantón de Genlis."},{"page_url":"https://sh.wikipedia.org/wiki/Leinatal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Wappen_Leinatal.jpg","page_title":"Leinatal","context_page_description":"Lajnatal je opština u njemačkoj saveznoj državi Tiringija. Jedno je od 57 opštinskih središta okruga Gota. Prema procjeni iz 2010. u opštini je živjelo 3.831 stanovnika. Posjeduje regionalnu šifru 16067083."},{"page_url":"https://es.wikipedia.org/wiki/Oganes%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Tetrahedral-3D-balls.png","page_title":"Oganesón","context_page_description":"El oganesón​​ es el nombre para el elemento sintético de la tabla periódica cuyo símbolo es Og y su número atómico es 118.​ Es el elemento más pesado sintetizado hasta ahora y el último del séptimo período en la tabla periódica. En la tabla periódica es un elemento del bloque p y el último del periodo 7. El 3 es actualmente el único elemento sintético del grupo 18 y posee el número y masa atómica más altos de todos los elementos sintetizados.​\\nEl 30 de diciembre de 2015, la IUPAC anunció en su portal web la verificación del descubrimiento de cuatro elementos del período 7, ​ entre ellos el oganesón. El nuevo elemento fue así llamado en español siguiendo el criterio ortográfico de denominación de los gases nobles.​ Fue nombrado así en honor al físico ruso Yuri Oganesián.​\\nEl átomo de oganesón es radiactivo y altamente inestable, por lo que desde 2002 solo se han detectado tres o posiblemente cuatro átomos del isótopo ²⁹⁴Og.​ Si bien este hecho no posibilita un estudio experimental adecuado que pueda caracterizar sus propiedades y sus posibles compuestos, varios cálculos teóricos han permitido predecir muchas de sus cualidades, incluidas algunas inesperadas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%96%D0%B7%D0%B0%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Alizavos_ba%C5%BEny%C4%8Dia.JPG","page_title":"Алізава","context_page_description":"Алізава — містечко, адміністративний центр однойменного староства в Купішкіському районі, Паневежиський повіт, Литва."},{"page_url":"https://de.wikipedia.org/wiki/Josiah_Johnson_Hawes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Ralph_Waldo_Emerson_ca1857.jpg","page_title":"Josiah Johnson Hawes","context_page_description":"Josiah Johnson Hawes war ein US-amerikanischer Fotopionier. Er und sein Partner Albert Sands Southworth gelten als die bedeutendsten amerikanischen Porträtfotografen des 19. Jahrhunderts."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Koblenz-Oberwerth","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Goetheplatz_2.jpg","page_title":"Liste der Kulturdenkmäler in Koblenz-Oberwerth","context_page_description":"In der Liste der Kulturdenkmäler in Koblenz-Oberwerth sind alle Kulturdenkmäler im Stadtteil Koblenz-Oberwerth der rheinland-pfälzischen Stadt Koblenz aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz.\\nDie Kulturdenkmäler sind Teil des seit 2002 bestehenden UNESCO-Welterbes Oberes Mittelrheintal."},{"page_url":"https://it.wikipedia.org/wiki/Manuel_G%C3%B3mez_Pedraza","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Manuel_G%C3%B3mez_Pedraza.png","page_title":"Manuel Gómez Pedraza","context_page_description":"Manuel Gómez Pedraza è stato un politico messicano.\\nMassone, nel 1818 Manuel Gómez Pedraza tentò di convertire la sconfitta elettorale della Loggia Escoscesa in una vittoria di pressioni, uso indebito del potere, minacce e ricatti, riuscendo ad essere nominato presidente da alcuni organi locali, per tutta risposta la Loggia yorquina promosse l'insurrezione popolare conosciuta come Moti della Acordada che obbligarono Pedraza a rinunciare al ministero della guerra, di cui fu titolare dal 1824, e alle sue aspirazioni presidenziali, così il congresso nominò presidente Vicente Guerrero, suo rivale alle elezioni presidenziali del 1829, al quale Guadalupe Victoria consegnò il potere il 1º aprile 1829, ritirandosi a Veracruz.\\nTornato in Messico nel 1831 dopo un lungo esilio, fu eletto presidente del Messico nel 1832 e conservò la carica fino al 1833."},{"page_url":"https://fi.wikipedia.org/wiki/Tallinn_JazzOn","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Tallinn_JazzON_Festival_1.jpg","page_title":"Tallinn JazzOn","context_page_description":"Tallinn JazzOn on vuosittain Tallinnan vanhassa kaupungissa järjestettävä kolmipäiväinen musiikkifestivaali. Tallinn JazzOn on aatteellinen musiikkitapahtuma, jonka tavoitteena on levittää jazz-musiikkia, kansantajuistaa kulttuuria, edistää muusikoiden kansainvälistä yhteistyötä ja tarjota ilmaisia laadukkaita musiikkiesityksiä jazzin ystäville Tallinnasta ja muista kaupungeista. Vuonna 2013 Tallinn JazzOn -festivaali järjestetään Tallinnassa 28.–30. kesäkuuta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BA%D0%B2%D0%B0%D1%82%D0%B8%D1%87%D0%BD%D0%B0_%D1%82%D0%B5%D0%BE%D1%80%D1%96%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Koenigspinguine.jpg","page_title":"Акватична теорія","context_page_description":"Акватична теорія — альтернативна теорія походження людини, котра на відміну загальноприйнятої теорії, що базується на саванному домінуючому факторі, що примусив людиноподібних мавп перейти до біпедалізму, як домінуючий фактор використовує воду. Вперше була запропонована морським біологом Алістером Гарді в 1929 році та незалежно німецьким біологом Максом Вестенгоффером в 1942 році.\\nПрихильники акватичної теорії вважають, що в сучасній традиційній теорії походження людини виділяються три основні еволюційні стрибки, які недостатньо обґрунтовані в рамках саванної теорії:\\nстрибок від людиноподібних мавп, що живуть на деревах, до людиноподібних антропів, що пересуваються по землі на ногах.\\nстрибок від прямоходячого гомініда до антропа з анатомією близькою до сучасної людини, правда з малим об'ємом мозку.\\nстрибок від гомо-еректус до сучасної людини з великим мозком.\\nВсі ці еволюційні стрибки нібито знаходять природне пояснення в рамках «акватичної теорії». Ось її основні пункти:"},{"page_url":"https://de.wikipedia.org/wiki/Ceratomia_hageni","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ceratomia_hageni_MHNT_CUT_2010_0_406%2C_Bovina%2C_Warren_Co._Miss%2C_male_ventral.jpg","page_title":"Ceratomia hageni","context_page_description":"Ceratomia hageni ist ein Schmetterling aus der Familie der Schwärmer."},{"page_url":"https://de.wikipedia.org/wiki/Dub_Inc","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/2013-08-23_Chiemsee_Reggae_Summer_-_Dub_Incorporation_et_al._3977.JPG","page_title":"Dub Inc","context_page_description":"Dub Inc ist eine Band aus Saint-Étienne in Frankreich. Sie besteht aus Mitgliedern mit unterschiedlicher kultureller Herkunft. Ihre Musik setzt sich aus arabischer Rhythmik, Hip-Hop, afrikanischen Beats, Dub und Reggae zusammen. Die Texte der Band handeln von politischen und sozialen Missständen wie Armut, Bildungsnotstand, Arbeitslosigkeit, Gewalt und Korruption und werden auf englisch, französisch und kabylisch gesungen.\\nDie Band wurde 1998 von drei Mitgliedern gegründet. Das erste Album Diversité erschien 2003 in Frankreich.\\nEs kam 2005 in Deutschland auf den Markt. 2004 erhielt die Band den Preis FAIR von der französischen Organisation Fond d'Action à l'Initiative Rock.\\nIm Februar 2015 veröffentlichte die Reggae-Band New Kingston das Album Kingston City, auf dem Dub Inc beim Stück Today zu hören sind. Zudem produzierte Moritz \\"DaBaron\\" von Korff das Lied Good Luck Charm für dieses Werk."},{"page_url":"https://sh.wikipedia.org/wiki/Republika_Lokot","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Lokot_republic_map.png","page_title":"Republika Lokot","context_page_description":"Republika Lokot je naziv marionetske države stvorene pod patronatom Nemačke na području današnje Rusije, tokom nemačke okupacije delova Sovjetskog Saveza. Postojala je od 1941. do 1943. godine, a upravno sedište republike je bilo naselje Lokot u današnjoj Brjanskoj oblasti. Republika Lokot je obuhvatala delove današnje brjanske, kurske i orjolske oblasti Rusije. Republika je zamišljena kao test za formiranje ruske kolaboracionističke vlade pod patronatom Nemačke, nakon percipirane nemačke pobede nad Sovjetskim Savezom u ratu. Nakon sovjetske ratne pobede nad Nemcima, Republika Lokot prestaje da postoji i ova teritorija ponovo postaje deo Sovjetskog Saveza, odnosno sovjetske Rusije."},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D0%B0%D1%8D%D1%86%D1%8B%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Boethius.jpg","page_title":"Баэцый","context_page_description":"Аніцый Манлій Северын Баэцый — філосаф, пісьменнік і палітык са знатнай рымскай сям’і, аўтар кніг па матэматыцы і музыцы, багаслоўскіх трактатаў. Радца готскага караля-арыяніна Тэадорыха Вялікага. Быў пакараны смерцю на загад Тэадорыха па падазрэнні ў змове на карысць імператара Усходняй Рымскай імперыі. У чаканні смерці напісаў свой найзначнейшы твор, «Суцяшэнне філасофіяй бел.»."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B0_%D0%B4%D1%8C%D0%BE_%D0%9A%D0%B0%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/France_manche_vue_dover.JPG","page_title":"Па дьо Кале","context_page_description":"Па дьо Кале или Доувърски проток се нарича най-тясната част на Ла Манш, отделяща го от Северно море.\\nМинималната ширина е 33,3 km и е мястото, на което остров Великобритания се доближава най-много до континента Европа. От двете му страни са разположени градовете Доувър в Англия и Кале във Франция.\\nОт 1994 г. в резултат на френско-британски проект, е изграден Тунел под тази част на Ла Манш, известен още като Евротунел. Тунелът е важно пътно съоръжение за Западна Европа.\\nОпитите за преплуване на Ла Манш за поставяне на световен рекорд, също се осъществяват в тази най-тясна му част.\\nСветовният рекорд за преплуване на Ла Манш принадлежи на австралиеца Трент Гримзи – 6:55 часа през 2012 г., когато подобрява рекорда на българина Петър Стойчев. Бившият рекорд на българина Петър Стойчев е поставен на 24 август 2007 г. Стойчев тръгва в 12,00 часа българско време от „Шекспир Бийч“ в Доувър в посока към френския бряг Кап Брюне. Той е първият, преплувал пролива за време под 7 часа. Стойчев преплува разстоянието за 6:57.50 часа, като подобрява предишния рекорд – 7:03.50 часа, поставен през 2005 г. от Кристоф Вандрач."},{"page_url":"https://en.wikipedia.org/wiki/Weight_training","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/WeightStack.JPG","page_title":"Weight training","context_page_description":"Weight training is a common type of strength training for developing the strength and size of skeletal muscles. It utilizes the force of gravity in the form of weighted bars, dumbbells or weight stacks in order to oppose the force generated by muscle through concentric or eccentric contraction. Weight training uses a variety of specialized equipment to target specific muscle groups and types of movement.\\nSports for which strength training is central are bodybuilding, weightlifting, powerlifting, strongman, highland games, hammer throw, shot put, discus throw, and javelin throw. Many other sports use strength training as part of their training regimen, notably: American football, baseball, basketball, canoeing, cricket, football, hockey, lacrosse, mixed martial arts, rowing, rugby league, rugby union, track and field, boxing and wrestling."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91-34","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/B-34_%28Soviet_naval_guns%29.JPG","page_title":"Б-34","context_page_description":"100 mm морско оръдие образец 1940 г. е съветско универсално корабно оръдие калибър 100 mm."},{"page_url":"https://nl.wikipedia.org/wiki/Hi%C3%ABronymus_Lauweryn","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/WPWatervlietkerk_10-06-2008_17-06-05.JPG","page_title":"Hiëronymus Lauweryn","context_page_description":"Hiëronymus Lauweryn, ridder, was heer van Watervliet, Waterland, Poortvliet, Leestkens en Philippine en diende de regeringen van drie vorsten over de Nederlanden: Maximiliaan I van Habsburg, en diens zoon Filips de Schone, en dochter Margaretha van Oostenrijk."},{"page_url":"https://hu.wikipedia.org/wiki/Ang_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Flickr_-_nicogenin_-_66%C3%A8me_Festival_de_Venise_%28Mostra%29_%2873%29.jpg","page_title":"Ang Lee","context_page_description":"Ang Lee tajvani származású Oscar-díjas filmrendező."},{"page_url":"https://da.wikipedia.org/wiki/Udd%C3%B8de_fugle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Edwards%27_Dodo.jpg","page_title":"Uddøde fugle","context_page_description":"Uddøde fugle er arter eller underarter af fugle, der ikke længere eksisterer. Fugle kan være uddøde globalt eller regionalt. For eksempel blev urfuglen erklæret som uddød i Danmark i 2001, men er ikke truet internationalt. Gejrfuglen uddøde globalt i 1844, hvor de sidste to individer blev dræbt.\\nIfølge IUCNs rødliste over truede dyrearter er 130 fuglearter med sikkerhed uddøde siden 1500-tallet, de fleste på grund af menneskets indvirkning. Muligvis er det sande antal mere end 200 arter. Der kan ofte være tvivl om en fugl stadig findes og om den skal regnes for en art eller underart. Det er flere gange sket, at en art er blevet erklæret globalt uddød, men alligevel er genfundet senere.\\nUdover de uddøde fuglearter menes, ifølge nogle opgørelser, omkring 60 underarter også at være forsvundet siden 1500-tallet.\\nDe arter, der indtil nu er uddøde, har ofte levet på isolerede øer, hvor en del af dem med tiden har mistet flyvefærdigheden. Dette gjorde dem meget sårbare overfor jagt fra mennesker eller nyligt introducerede rovdyr."},{"page_url":"https://fr.wikipedia.org/wiki/Al-Fatiha","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Folio_from_a_Koran_%28Sura_Al-Fatiha_2%29.jpg","page_title":"Al-Fatiha","context_page_description":"Al-Fatiha est la sourate d'ouverture du Coran, le livre sacré des musulmans. Composée de sept versets, elle met l'accent sur la souveraineté et la miséricorde d'Allah.\\nLa Fatiha est dans le premier hizb et donc dans le premier juz', qui sont des divisions du Coran en parties distinctes. La tradition veut que ce soit la première sourate complète qui lui ait été révélée. Elle est aussi appelée fātiḥat al-kitāb ou fātiḥat al-Qurʾān. Il y a environ 25 autres noms épithètes de cette sourate.\\nLa tradition veut que les musulmans sachent au moins deux sourates par cœur. Comme la Fatiha est courte et indispensable pour la salat, elle est en général apprise dès l'enfance dans les madrasas ou est simplement enseignée par les parents. Elle est récitée au début de chaque unité de prière.\\nFatiha est aussi un prénom arabe féminin."},{"page_url":"https://et.wikipedia.org/wiki/Ristluslaevade_loend","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Narkom_Pakhomov_river_cruise_ship.jpg","page_title":"Ristluslaevade loend","context_page_description":"Selles nimekirjas on loetletud ristluslaevu. Teiste reisilaevade kohta, mis veavad ka kaupu, vaata artikleid \\"Parvlaev\\" ja \\"Reisi-kaubalaev\\".\\nNimekiri pole täielik."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_scriitori_maghiari","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Barabas-arany.jpg","page_title":"Listă de scriitori maghiari","context_page_description":"Lista de scriitori maghiari prezentată în tabele de mai jos cuprind autori de literatură ficțională și nonficțională de expresie maghiară. Lista este prezentată sub forma unor tabele în care autorii sunt prezentați în ordinea alfabetică a numelor lor, urmat de date succinte referitoare la curentele literare și genurile cultivate în timpul carierei literare."},{"page_url":"https://no.wikipedia.org/wiki/Johann_Jacob_L%C3%B6wenthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Morphy_L%C3%B6wenthal_1858.jpg","page_title":"Johann Jacob Löwenthal","context_page_description":"Johann Jacob Löwenthal var en britisk sjakkmester og sjakkteoretiker av ungarsk avstamming.\\nPå 1850-tallet var Löwenthal en av verdens beste sjakkspillere."},{"page_url":"https://ast.wikipedia.org/wiki/Lliga_Nacional_de_F%C3%BAtbol_Femen%C3%ADn_de_Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Coat_of_arms_of_Escuintla.png","page_title":"Lliga Nacional de Fútbol Femenín de Guatemala","context_page_description":"La Lliga Nacional de Fútbol Femenino de Guatemala ye la máxima categoría del fútbol femenín en Guatemala. La lliga xugar por primer vegada na temporada 1997, anque oficialmente dio entamu na temporada 1998/1999.\\n== Formatu de la competencia celebró un tornéu añal de 1997/98 a 2007/08, fecha en que s'adoptó'l formatu Apertura y Clausura.\\nHai un cambéu constante d'equipos na lliga, yá que de 13 clubes que s'entamaron al entamu, la mayoria tendríen insolvencia, yá que ente 2008 y principios de 2011 dellos equipos tuvieron que retirase de la lliga. Anguaño la temporada regular consta d'una fase de grupos pa dempués xugar la fase de play-offs, hasta determinar al campeón."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Teatralna_we_Wroc%C5%82awiu","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Wroc%C5%82aw%2C_Przedsi%C4%99biorstwo_Geologiczne_PROXIMA_-_fotopolska.eu_%2872707%29.jpg","page_title":"Ulica Teatralna we Wrocławiu","context_page_description":"Ulica Teatralna – ulica położona we Wrocławiu na Starym Mieście. Łączy ulicę Piotra Skargi z placem Teatralnym i ulicami Widok oraz Bożego Ciała. Ma 326 m długości. Przy ulicy znajdują się między innymi zabytkowe obiekty: budynek dawnej Łaźni Miejskiej oraz Pałac Ignacego Leipzigera, połączony z kamienicą J. Schottländera, a także tereny zielone: Park Mikołaja Kopernika i Promenada Staromiejska biegnąca wzdłuż fosy miejskiej."},{"page_url":"https://pl.wikipedia.org/wiki/Karol_Kotschy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Carl_Kotschy.jpg","page_title":"Karol Kotschy","context_page_description":"Karol Fryderyk Kotschy, Carl Friedrich Kotschy, – duchowny ewangelicki, teolog protestancki oraz botanik. Zasłużony dla rozwoju oświaty i kultury polskiej na Śląsku Cieszyńskim."},{"page_url":"https://pt.wikipedia.org/wiki/Fernando_Henrique_Cardoso","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Fhcplanoreal.jpg","page_title":"Fernando Henrique Cardoso","context_page_description":"Fernando Henrique Cardoso, também conhecido como FHC, é um sociólogo, cientista político, professor universitário, escritor e político brasileiro. Foi o 34.º presidente da República Federativa do Brasil entre 1995 e 2003. Natural da cidade do Rio de Janeiro, mudou-se com sua família para a cidade de São Paulo, onde se casou em 1953 com a antropóloga e sua colega de faculdade Ruth Vilaça Correia Leite, com quem teve três filhos. FHC graduou-se em Sociologia pela Universidade de São Paulo e mais tarde tornou-se professor emérito daquela universidade. Foi perseguido depois do golpe militar de 1964, exilando-se no Chile e na França, voltando ao Brasil em 1968. Lecionou em universidades estrangeiras e desenvolveu uma importante carreira acadêmica, tendo produzido diversos estudos sociais premiados.\\nFHC coordenou a elaboração da plataforma eleitoral do MDB. Em 1978, iniciou sua carreira política ao concorrer ao Senado Federal, elegendo-se suplente de Franco Montoro. Após a eleição deste para o governo de São Paulo, assumiu sua cadeira no Senado em março de 1983."},{"page_url":"https://fr.wikipedia.org/wiki/Indicatifs_r%C3%A9gionaux_610_et_484","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Area_code_484.png","page_title":"Indicatifs régionaux 610 et 484","context_page_description":"Les indicatifs régionaux 610 et 484 sont deux des multiples indicatifs téléphoniques régionaux de l'État de Pennsylvanie aux États-Unis.\\nSelon des plans établis en 2000, l'indicatif régional 835 devait être ajouté par chevauchement sur les indicatifs 610 et 484. Ces plans ont été abandonnés en 2005. Cependant, l'indicatif est toujours réservé pour un besoin futur dans une des régions de l'État de Pennsylvanie.\\nLes indicatifs régionaux 610 et 484 desservent une partie du sud-est de l'État.\\nLa carte ci-contre indique en rouge le territoire couvert par les indicatifs 610 et 484.\\nLes indicatifs régionaux 610 et 484 font partie du Plan de numérotation nord-américain."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B5%D0%BB_(%D0%94%D0%BE%D1%9A%D0%B0_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BE%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/CastellimHerbst.JPG","page_title":"Кастел (Доња Франконија)","context_page_description":"Кастел општина је у њемачкој савезној држави Баварска. Једно је од 31 општинског средишта округа Кицинген. Према процјени из 2010. у општини је живјело 817 становника. Посједује регионалну шифру 9675116."},{"page_url":"https://fi.wikipedia.org/wiki/Albanian_sosialistinen_kansantasavalta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Albania_bunkers.jpg","page_title":"Albanian sosialistinen kansantasavalta","context_page_description":"Albanian sosialistinen kansantasavalta oli Albanian valtion nimi vuosina 1946–1992, jolloin maata johti kommunistihallitus. Valtion nimi oli Albanian kansantasavalta vuosina 1946–1976, ja sen jälkeen nimeksi tuli Albanian sosialistinen kansantasavalta.\\nAlbania vapautui vuonna 1944 Italian miehityksestä. Vuonna 1946 vallan otti Enver Hoxhan johtama kommunistihallitus ja maasta tuli stalinistinen. Albanialla oli tällöin läheiset suhteet Neuvostoliittoon ja muihin itäblokin maihin, joskin suhteet Jugoslaviaan olivat epäluuloiset. Kun Neuvostoliitto vuonna 1956 tuomitsi stalinismin, Albania riitautui Neuvostoliiton kanssa ja solmi sen sijaan läheiset suhteet Kiinan kanssa, joka pysytteli stalinismissa. Vuonna 1968 Albania erosi Neuvostoliiton johtamasta Varsovan liitosta.\\nVuoteen 1978 asti Albanian talous oli menestynyt kohtuullisesti Kiinan tuella: viljelysten keinokastelu oli järjestetty, maassa oli teollisuutta ja nuorison koulutus oli tasokasta. Kun Kiina loittoni Maon kuoltua 1976 kommunistisesta aatteesta, alkoi Albania eristäytyä muusta maailmasta, mikä rasitti sen taloutta ja maa köyhtyi. Hoxhan kuoltua 1985 sosialismia ja eristäytymistä ryhdyttiin purkamaan."},{"page_url":"https://nl.wikipedia.org/wiki/Opawa_(Neder-Silezi%C3%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Opawa%2C_ko%C5%9Bci%C3%B3%C5%82_pw._%C5%9Aw._Jadwigi_1.jpg","page_title":"Opawa (Neder-Silezië)","context_page_description":"Opawa is een dorp in de Poolse woiwodschap Neder-Silezië. De plaats maakt deel uit van de gemeente Lubawka."},{"page_url":"https://en.wikipedia.org/wiki/Grand_Valley,_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Storm_Clouds_-_panoramio.jpg","page_title":"Grand Valley, Ontario","context_page_description":"The Town of Grand Valley is a township in the Canadian province of Ontario, composed of the former Township of East Luther and the former Village of Grand Valley. The township is located within Dufferin County, and includes part of the Luther Marsh. The marsh covers over 10,000 acres including Luther Lake. The Grand River is one of the major sites in the town."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B3%A8%E9%80%A3%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Chu-ren-ji.jpg","page_title":"注連寺","context_page_description":"注連寺は、山形県鶴岡市大網にある真言宗智山派の寺院。戦後、一時的に新義真言宗湯殿山派の大本山として独立していた時期もある。山号は湯殿山。本尊は大日如来。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_die_Panke","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/FlauschlenbridgeF0074.JPG","page_title":"Liste der Brücken über die Panke","context_page_description":"Die Liste der Brücken über den Fluss Panke zeigt in der folgenden Tabelle alle über den Fluss Panke führenden Brücken von der Quelle bei Bernau bis zur Mündung einerseits in den Berlin-Spandauer Schifffahrtskanal und andererseits entlang der Südpanke in die Spree nahe der Friedrichstraße/Schiffbauerdamm."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B0%E0%A5%89%E0%A4%AF_%E0%A4%A5%E0%A5%89%E0%A4%AE%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/RoyThomas11.14.08ByLuigiNovi.jpg","page_title":"रॉय थॉमस","context_page_description":"रॉय विलियम थॉमस जूनियर एक अमेरिकी कॉमिक बुक लेखक और सम्पादक हैं, जो मार्वल कॉमिक्स के प्रधान संपादक के रूप में स्टेन ली के पहले उत्तराधिकारी थे। उन्हें प्रसिद्ध चरित्र कॉनन द बार्बेरियन को अमेरिकी कॉमिक पुस्तकों में पेश करने के लिए जाना जाता है। इसके अतिरिक्त थॉमस को गोल्डन एज ​​कॉमिक-बुक हीरो - विशेष रूप से १९४० के दशक की सुपरहीरो टीम, द जस्टिस सोसाइटी ऑफ अमेरिका - और मार्वल के एक्स-मेन और अवेंजर्स और डीसी कॉमिक्स की ऑल-स्टार स्क्वाड्रन समेत कई अन्य कॉमिक पुस्तकों पर लंबे समय तक लेखन के लिए जाना जाता है।\\nउनके द्वारा सह-निर्मित कॉमिक चरित्रों में वूल्वरिन, विज़न, कैरल डैनवर्स, ल्यूक केज, आयरन फिस्ट, अल्ट्रॉन, मैन-थिंग, रेड सोंजा, घोस्ट राइडर, रेड गार्जियन, ब्रदर वूडू और वल्करी हैं।\\nथॉमस को २०११ में विल आइजनर कॉमिक बुक हॉल ऑफ फेम में शामिल किया गया था।"},{"page_url":"https://zh.wikipedia.org/wiki/E-8%E6%8C%87%E6%8C%A5%E6%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Pave_Mover_Antenna_Array%2C_view_1%2C_prototype_for_J-STARS_antenna%2C_Norden%2C_1981-1983_-_National_Electronics_Museum_-_DSC00429.JPG","page_title":"E-8指挥机","context_page_description":"诺斯罗普·格鲁曼E-8“联合监视目标攻击雷达系统”，英文缩写为Joint STARS，因而又名E-8“联合星”。E-8是美国空军一种集机载地面监视、战斗管理、指挥及控制功能于一身的飞机。它可以跟踪地面车辆及部分飞机、收集图像、向地面和空中的指挥人员传递战术图像。E-8由美国空军及美国空中国民警卫队使用，同时机上也会搭载经过特殊训练的美国陆军人员作为额外机组成员。"},{"page_url":"https://es.wikipedia.org/wiki/Fiesta_Nacional_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/12_de_octubre_de_2014_en_Madrid%2C_banda_de_m%C3%BAsica_de_la_Armada_Espa%C3%B1ola.JPG","page_title":"Fiesta Nacional de España","context_page_description":"Fiesta Nacional de España es la denominación oficial que recibe el día nacional de España. Se celebra el 12 de octubre y está regulado por la Ley 18/1987, de 7 de octubre, ​ cuyo único artículo indica:\\nSe declara Fiesta Nacional de España, a todos los efectos, el día 12 de octubre.\\nEn la exposición de motivos de la ley se explica:\\nLa fecha elegida, el 12 de octubre, simboliza la efemérides histórica en la que España, a punto de concluir un proceso de construcción del Estado a partir de nuestra pluralidad cultural y política, y la integración de los reinos de España en una misma monarquía, inicia un período de proyección lingüística y cultural más allá de los límites europeos.​\\nLa celebración incluye tradicionalmente un desfile militar al que asiste el rey, junto a la familia real, el presidente del Gobierno y otros altos representantes de todos los poderes del Estado, ​ comprendiendo también los de las autonomías.​​"},{"page_url":"https://eo.wikipedia.org/wiki/Tramtransporto_en_Caen_(TVR)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Tram_Caen.svg","page_title":"Tramtransporto en Caen (TVR)","context_page_description":"Tramtransporto en Caen (TVR) estas praktikata per du-sistema transportilo sur pneŭoj, fabrikita de Bombardier, veturanta sur segregita vojo per unu centra gvid-relo kaj ankaŭ sur normala ŝoseo. La sistemo estas ekspluatata de kompanio Kéolis, ene de reto Twisto organizita de sindikato Viacités. Ĝi ĉefe veturas en Caen kaj kunligas la urbon Hérouville norde, al Ifs sude.\\nEl teĥnika vidpunkto, tiu transportilo konsistas el grandega tri-parta aŭtobuso, veturanta sur segregita vojo, gvidata de ununura centra relo per aldonaj metalaj radetoj. La elektra motoro normale prenas sian kurenton de supertraka kontakta lineo per pantografo. Ĝi ankaŭ povas veturi memstare dank'al dizela generatoro.\\nLa tramo de Caen estas ankaŭ nomata TVR, t.e. transporto sur segregita vojo."},{"page_url":"https://pl.wikipedia.org/wiki/Riwiera_Alba%C5%84ska","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Vlor%C3%AB_shoreline.jpg","page_title":"Riwiera Albańska","context_page_description":"Riwiera Albańska – obszar w południowej Albanii usytuowany wzdłuż wybrzeża Morza Jońskiego, u stóp gór Çika, w obwodzie Wlora. Nie należy mylić tego obszaru z całym wybrzeżem albańskim, które oprócz Riwiery obejmuje także tereny na północy i w centrum kraju. Riwiera rozpościera się na południe od Parku Narodowego Llogara, następnie ciągnie się wzdłuż wybrzeża przez miejscowości Borsh, Himara, Qeparo, Pigeras, kończąc się w Lukovej. W 2012 r. Riwiera Albańska znalazła się wśród najlepszych atrakcji turystycznych według portalu Frommer's.\\nObcokrajowcy zainteresowali się regionem dopiero w 2009 r., kiedy do przebudowano nadmorską trasę SH8. Wówczas to w miejscowości Dhermi odbył się koncert DJ Tiesto, także nakręcono tutaj jeden z odcinków serii Top Gear, w trakcie którego widzowie mogli podziwiać pościg samochodowy nadbrzeżnymi ulicami.\\nRiwiera jest centrum nocnego życia Albanii, a także miejscem wypoczynku. Znajdują się tutaj tradycyjne wioski w stylu śródziemnomorskim, antyczne budowle, prawosławne cerkwie, zaciszne plaże, turkusowe morze, przełęcze górskie, zatoki, rzeki, jaskinie oraz gaje oliwne i sady cytrusowe.\\nW 48 r. p.n.e."},{"page_url":"https://pl.wikipedia.org/wiki/Zb%C3%B3jnickie_Oko","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Zbojnickie_Oko.jpg","page_title":"Zbójnickie Oko","context_page_description":"Zbójnickie Oko – niewielki stawek położony na wysokości ok. 1990 m n.p.m. znajdujący się w Dolinie Staroleśnej w słowackiej części Tatr Wysokich. Zbójnickie Oko leży w górnych partiach Zbójnickiego Koryciska, u południowo-wschodnich podnóży Zbójnickiej Kopki. W Zbójnickim Oku powstaje Staroleśny Potok – największy ciek wodny Doliny Staroleśnej. Nieco na północ od Zbójnickiego Oka przebiega żółto znakowany szlak turystyczny schodzący z Czerwonej Ławki do Schroniska Zbójnickiego w Dolinie Staroleśnej."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Bezirk_Voitsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/ID_1177_Hemmerberg_Gleithorizont1.JPG","page_title":"Liste der Naturdenkmäler im Bezirk Voitsberg","context_page_description":"Die Liste der Naturdenkmäler im Bezirk Voitsberg listet die als Naturdenkmal ausgewiesenen Objekte im Bezirk Voitsberg im Bundesland Steiermark auf. Unter den insgesamt 49 Naturdenkmälern sind 6 Nadelbäume und 39 Laubbäume, eine Blumenwiese, ein Steinbruch und zwei Amazonit-Pegmatitvorkommen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A3%E3%83%B3%E3%83%AB%E3%82%AB%E3%83%BB%E3%83%91%E3%83%AA%E3%83%A5%E3%82%A6%E3%82%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Gianluca_Pagliuca.jpg","page_title":"ジャンルカ・パリュウカ","context_page_description":"ジャンルカ・パリュウカは、イタリア・エミリア＝ロマーニャ州ボローニャ出身の元同国代表サッカー選手。ポジションはゴールキーパー。2020年にハンダノビッチに並ばれるまで、セリエAのPKストップ数、単独最多記録保持者であった。"},{"page_url":"https://nl.wikipedia.org/wiki/Coronie","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Coronie.jpg","page_title":"Coronie","context_page_description":"Coronie is een van de districten van Suriname. Het bevindt zich in het noordwesten van het land. De hoofdplaats is Totness.\\nMet de kolonisatie van het district werd rond 1800 begonnen. Veel van de oorspronkelijke planters waren Schotten - Suriname was toen onder Brits bewind - wat zich weerspiegelt in de vele Engelstalige plaatsnamen in het district. Tijdens het begin van de 19de eeuw maakte het deel uit van het district Nickerie en heette \\"Neder-Nickerie\\". In 1851 werd het daarvan afgesplitst en vernoemd naar de militaire post Corona.\\nDe kokosindustrie was vroeger erg belangrijk in Coronie, maar ging in de loop van de 20ste eeuw achteruit omwille van ziekte en veroudering. Tegenwoordig zijn rijst en de visvangst de belangrijkste inkomensbronnen voor Coronie. Desondanks staat Coronie nog altijd bekend omwille van zijn kokospalmen.\\nCoronie heeft met 3391 inwoners de kleinste bevolking van alle Surinaamse districten. Het overgrote merendeel van de bevolking bestaat uit Creolen en Javanen."},{"page_url":"https://ko.wikipedia.org/wiki/2020%EB%85%84_%EB%B6%81%EC%9D%B8%EB%8F%84%EC%96%91_%EC%82%AC%EC%9D%B4%ED%81%B4%EB%A1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/2020_North_Indian_Ocean_cyclone_season_summary.png","page_title":"2020년 북인도양 사이클론","context_page_description":"다음은 2020년에 발생하는 열대저기압의 목록이다."},{"page_url":"https://sv.wikipedia.org/wiki/Rhyacophila","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rhyacophila.fasciata.jpg","page_title":"Rhyacophila","context_page_description":"Rhyacophila är ett släkte av nattsländor. Rhyacophila ingår i familjen rovnattsländor."},{"page_url":"https://tr.wikipedia.org/wiki/Derya-i_Nur","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Rezashah.jpg","page_title":"Derya-i Nur","context_page_description":"Darya-i-Nur, dünyadaki en büyük kesilmiş elmaslardan biridir, yaklaşık ağırlığı 182 karattır. Rengi uçuk pembedir, elmasların en nadir bulunanlarından biridir."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%B5%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%AB_%D5%80%D5%A1%D5%B6%D6%80%D5%A1%D5%BA%D5%A5%D5%BF%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%BA%D5%A1%D5%B7%D5%BF%D5%BA%D5%A1%D5%B6%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B6%D5%A1%D5%AD%D5%A1%D6%80%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Vazgen_Manukyan.jpg","page_title":"Հայաստանի Հանրապետության պաշտպանության նախարար","context_page_description":"Հայաստանի Հանրապետության պաշտպանության նախարար - Հայաստանի պաշտպանության նախարարության ղեկավար։ Հայաստանի պաշտպանության նախարարը նշանակվում ՀՀ նախագահի կողմից՝ ՀՀ Վարչապետի առաջարկությամբ։"},{"page_url":"https://en.wikipedia.org/wiki/Larrabee_Sound_Studios","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Jaycen_Joshua.png","page_title":"Larrabee Sound Studios","context_page_description":"Larrabee Sound Studios is a collection of recording studios in Hollywood, California, founded by Jackie Mills, who in 1980 co-owned it. By the early 2000s it comprised seven studios in three different locations, and was owned by Kevin Mills. By that time the studio was cited by Billboard as one of the top studios in the US, and was equipped with Solid State Logic and AMS Neve consoles."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%9C%8B%E9%9A%9B%E9%87%91%E8%9E%8D%E4%B8%AD%E5%BF%83%E5%95%86%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ifc_mall_Podium_Garden_Dusk_View_201012.jpg","page_title":"國際金融中心商場","context_page_description":"国际金融中心商场位于香港香港岛中环金融街8号。商场分两期落成，分别于1998年及2003年开业。商场楼高4层，总面积达80万平方呎，毗连国际金融中心一期及二期顶级写字楼、四季酒店及四季汇套房酒店。商场由新鸿基地产及恒基兆业管理。"},{"page_url":"https://fr.wikipedia.org/wiki/Koussa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Flag_of_Kusa_%28Chelyabinsk_oblast%29.png","page_title":"Koussa","context_page_description":"Koussa est une ville de l'oblast de Tcheliabinsk, en Russie, et le centre administratif du raïon de Koussa. Sa population s'élevait à 18 278 habitants en 2013."},{"page_url":"https://en.wikipedia.org/wiki/Kidder,_Peabody_%26_Co.","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Francis_H._Peabody_founder_of_Kidder_Peabody_ca.png","page_title":"Kidder, Peabody & Co.","context_page_description":"Kidder, Peabody & Co. was an American securities firm, established in Massachusetts in 1865. The company's operations included investment banking, brokerage, and trading.\\nThe firm was sold to General Electric in 1986. Following heavy losses, it was subsequently sold to PaineWebber in 1994. After the acquisition by PaineWebber, the Kidder Peabody name was dropped, ending the firm's 130-year presence on Wall Street. In November 2000, PaineWebber itself was merged with UBS AG."},{"page_url":"https://en.wikipedia.org/wiki/Kazungula_Ferry","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/KazungulaFerry.jpg","page_title":"Kazungula Ferry","context_page_description":"The Kazungula Ferry is a pontoon ferry across the 400-metre-wide Zambezi River between Botswana and Zambia. It is one of the largest ferries in south-central Africa, having a capacity of 70 tonnes. The service is provided by two motorised pontoons and operates between border posts at Kazungula, Zambia and Kazungula, Botswana.\\nIt links the Livingstone-Sesheke road to the main north-south highway of Botswana through Francistown and Gaborone to South Africa, and also to the Kasane-Victoria Falls road through Zimbabwe. It serves the international road traffic of three countries directly and of three more indirectly.\\nWhether Botswana and Zambia actually shared a common border, or whether the ferry was illegally crossing into Namibian or Rhodesian territory, was the subject of dispute. In 1970, South Africa informed Botswana that there was no common border between Botswana and Zambia, claiming that a quadripoint existed. As a result, South Africa claimed, the Kazungula Ferry, which links Botswana and Zambia at the quadripoint, was illegal. Botswana firmly rejected both claims."},{"page_url":"https://hy.wikipedia.org/wiki/Fila","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/HK_TST_K11_mall_50_shop_FILA_clothing.JPG","page_title":"Fila","context_page_description":"Ֆիլա, սպորտային հագուստ և պարագաներ արտադրող իտալական ընկերություն։ Սպորտային կոշիկներից բացի ընկերությունն արտադրում է նաև այլ պարագաներ՝ պայուսակներ, վերնաշապիկներ, շալվարներ, գլխարկներ և այլն։"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Merelbeke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Het_Hollebeekgoed_te_Merelbeke.jpg","page_title":"Lijst van onroerend erfgoed in Merelbeke","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Merelbeke. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://es.wikipedia.org/wiki/Karl_D%C3%B6nitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Golden_Party_Badge.png","page_title":"Karl Dönitz","context_page_description":"Karl Dönitz fue un marino alemán que participó en la Primera y en la Segunda Guerra Mundial. Comandó la Kriegsmarine de la Alemania nazi desde el 30 de enero de 1943 hasta el final de la guerra, con el rango de großadmiral. El 30 de abril de 1945 Adolf Hitler lo nombró su sucesor como Reichspräsident, cargo que desempeñó hasta el 23 de mayo de 1945, cuando fue detenido por orden de la Comisión Aliada de Control.\\nKarl Dönitz fue quien ordenó firmar la rendición de Alemania ante los Aliados y la Unión Soviética el 8 de mayo de 1945, terminando con ello la II Guerra Mundial en Europa.\\nFue detenido por las Fuerzas Aliadas y llevado a la ciudad de Núremberg, donde fue juzgado por crímenes de guerra y crímenes contra la paz. Se le acusó de haber instruido a sus tropas para la guerra aún en tiempos de paz y de ser el responsable de la Orden N.º 154, por la cual se desarrolló la ilimitada guerra submarina, violando los principios de la guerra naval. Fue declarado culpable y condenado a diez años y 20 días de prisión, saliendo en libertad el 1 de octubre de 1956, retirándose a vivir en una aldea cercana al puerto de Hamburgo."},{"page_url":"https://tr.wikipedia.org/wiki/Deyverson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Deyverson.JPG","page_title":"Deyverson","context_page_description":"Deyverson, Brezilyalı futbolcudur. Bundesliga ekiplerinden 1. FC Köln'de kiralık oynuyor."},{"page_url":"https://en.wikipedia.org/wiki/War_memorials_(Eastern_Somme)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Nesle_1.JPG","page_title":"War memorials (Eastern Somme)","context_page_description":"The Monuments aux Morts of the Eastern Somme are French war memorials commemorating those who died in World War I on the eastern side of the Somme region."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Geschichte_der_T%C3%BCrkei","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/2010_Opening_Ceremony_-_Turkey_entering_cropped.jpg","page_title":"Olympische Geschichte der Türkei","context_page_description":"Die Türkei, deren NOK, das Türkiye Milli Olimpiyat Komitesi, 1908 gegründet und 1911 vom IOC anerkannt wurde, nimmt bereits seit 1906 an Olympischen Sommerspielen teil. Seit 1936 werden auch Sportler zu Winterspielen entsandt. Jugendliche Sportler nahmen an allen bislang ausgetragenen Jugend-Olympiaspielen, sowohl im Sommer als auch im Winter, teil."},{"page_url":"https://pl.wikipedia.org/wiki/Giampaolo_Cheula","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Giampaolo_Cheula%2C_2009_Milan_%E2%80%93_San_Remo.jpg","page_title":"Giampaolo Cheula","context_page_description":"Giampaolo Cheula - włoski kolarz szosowy. W zawodowym peletonie występuje od 2001 roku. Zwycięzca Wyścigu Pokoju."},{"page_url":"https://hu.wikipedia.org/wiki/Degr%C3%A9_Alajos_(%C3%BCgyv%C3%A9d)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Lippa_Degr%C3%A9AlajosSz%C3%BCl%C5%91h%C3%A1za.png","page_title":"Degré Alajos (ügyvéd)","context_page_description":"Degré Alajos ügyvéd, író, a márciusi ifjak egyike."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%84%D9%88%D9%88%D9%86_%D8%AF%DB%8C%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Slovenian_language_map.png","page_title":"سلوون دیلی","context_page_description":"سلوون دیلی ۲٫۵ میلیون نفر بۇ دیلده دانیشماغی باشاریر. هیند اوروپا دیللرینه باغلی بیر دیل‌دیر."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BD%D1%8C%D0%BA%D0%B0%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/%D0%A1%D1%82%D0%B0%D0%BD%D1%8C%D0%BA%D0%B0%D0%B2%D0%B0._%D0%96%D1%8B%D0%BB%D1%8B_%D0%B4%D0%BE%D0%BC_%2801%29.jpg","page_title":"Станькаў","context_page_description":"Ста́нькаў — вёска ў Беларусі, на рацэ Рапусе. Цэнтар сельсавету Койданаўскага раёну Менскай вобласьці. Насельніцтва на 2010 год — 1692 чалавекі. Знаходзіцца за 10 км на паўднёвы ўсход ад Койданава, за 8 км ад чыгуначнай станцыі Койданава. Аўтамабільныя дарогі на Менск, Койданаў, Узду.\\nСтанькаў — даўняе мястэчка гістарычнай Меншчыны. Да нашага часу тут захаваўся сядзібна-паркавы комплекс Чапскіх."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%81rp%C3%A1d-h%C3%A1zi_Szent_Erzs%C3%A9bet_K%C3%B6z%C3%A9piskola,_%C3%93voda_%C3%A9s_%C3%81ltal%C3%A1nos_Iskola","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Esztergom_-_Szent_Erzs%C3%A9bet_Iskola.JPG","page_title":"Árpád-házi Szent Erzsébet Középiskola, Óvoda és Általános Iskola","context_page_description":"Az esztergom-vízivárosi Árpád-házi Szent Erzsébet Gimnázium, Óvoda és Általános Iskola egyházi fenntartású oktatási intézmény 2001 óta. Az intézmény névadója és patrónája Árpád-házi Szent Erzsébet szellemiségéhez híven törekszik tanulói nevelésére és oktatására. Fenntartója a Szatmári Irgalmas Nővérek szerzetesrend, aminek magyarországi tartományfőnöksége az iskola szomszédságában található. Az iskola épülete helyi védelem alatt áll."},{"page_url":"https://eo.wikipedia.org/wiki/Seon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Seon-Stacidomo_kaj_komunuma_administrejo_533.jpg","page_title":"Seon","context_page_description":"Seon estas komunumo en la distrikto Lencburgo de Kantono Argovio, Svislando. Ĝi havis 4684 loĝantojn je la 31-a de decembro 2008."},{"page_url":"https://fr.wikipedia.org/wiki/Przemys%C5%82aw_Tyto%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Przemyslaw_tyton.jpg","page_title":"Przemysław Tytoń","context_page_description":"Przemysław Tytoń, né le 4 janvier 1987 à Zamość, est un footballeur international polonais qui évolue au poste de gardien de but au Deportivo La Corogne."},{"page_url":"https://no.wikipedia.org/wiki/Masailerke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Eremopterix_leucopareia.jpg","page_title":"Masailerke","context_page_description":"Masailerke er en fugl i slekten Eremopterix i lerkefamilien."},{"page_url":"https://de.wikipedia.org/wiki/Raccordo_autostradale_6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/CortonaRaccordoAutostradaleRA6a.jpg","page_title":"Raccordo autostradale 6","context_page_description":"Der Raccordo autostradale 6 ist ein Autobahnzubringer in der Mitte Italiens, der die Hauptstadt der Region Umbrien Perugia an das italienische Autobahnnetz und die A1 anschließt. Er liegt in den italienischen Region Toskana und Umbrien.\\nDas Decreto Legislativo 29 ottobre 1999, n.461 nahm den RA6 nicht in das Autobahnnetz Italiens auf, sondern stufte ihn als Straße von nationalen Interesse ein. 2001 erhielt er aufgrund des Decreto del Presidente del Consiglio dei Ministri del 21 settembre 2001 die Bezeichnung RA 6."},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois_Coillard","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/La_Maison_des_missions_de_Paris.jpg","page_title":"François Coillard","context_page_description":"François Coillard est un missionnaire protestant envoyé par la Société des missions évangéliques de Paris au Basutoland en renfort d'une première équipe installée depuis 1830. Il est surtout connu comme fondateur de la « mission au Zambèze » au Barotseland, région située aujourd'hui en Zambie."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9sident_de_la_R%C3%A9publique_de_Cor%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Heo_Jeong.png","page_title":"Président de la République de Corée","context_page_description":"Le président de la République de Corée est, selon la constitution sud-coréenne, chef de l'exécutif, commandant en chef des forces armées, et chef de l'État de la Corée du Sud.\\nLa Constitution définit son élection au suffrage uninominal direct, majoritaire et secret à un tour, pour un mandat de cinq ans, sans réélection. En cas de vacance présidentielle, son successeur doit être élu dans un délai de soixante jours, période pendant laquelle les fonctions de président sont assumées par le Premier ministre ou d'autres hauts membres du gouvernement dans l'ordre de priorité fixé par la loi. Pendant son mandat, le président exerce ses fonctions depuis la résidence de la Maison Bleue. Il est notamment exonéré de responsabilité pénale.\\nMoon Jae-in, ancien avocat spécialisé en droits de l'homme et chef de cabinet sous la présidence de Roh Moo-hyun, assume la fonction de Président de la Corée du Sud depuis le 10 mai 2017 après avoir été élu à une forte pluralité de 41,1 %, comparativement aux 24,0 % et 21,4 % de ses principaux adversaires, le conservateur de Hong-Joon-pyo et le centriste Ahn Cheol-soo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%AC%E3%83%93%E3%82%A2%E3%81%AE%E6%88%A6%E3%81%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Battle_trebia-en.png","page_title":"トレビアの戦い","context_page_description":"トレビアの戦いは、第二次ポエニ戦争中の紀元前218年12月18日、イタリア半島のプラケンティア近郊、トレビア川を挟んで行われた戦い。ハンニバル率いるカルタゴ軍と、ティベリウス・センプロニウス・ロングス率いるローマ軍が交戦し、カルタゴ軍が勝利した。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%BC%E3%83%A9%E3%83%BC%E3%82%BA%E3%83%BB%E3%83%A1%E3%83%88%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Shiraz_metro_09.jpg","page_title":"シーラーズ・メトロ","context_page_description":"シーラーズ・メトロは、イランの都市シーラーズにて運行中のメトロ・システムである。"},{"page_url":"https://es.wikipedia.org/wiki/Keams_Canyon_(Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/AZ_264_Keams_Canyon_2006_09_08.jpg","page_title":"Keams Canyon (Arizona)","context_page_description":"Keams Canyon es un lugar designado por el censo ubicado en el condado de Navajo en el estado estadounidense de Arizona. En el Censo de 2010 tenía una población de 304 habitantes y una densidad poblacional de 7,05 personas por km².​"},{"page_url":"https://fr.wikipedia.org/wiki/Meermin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/1773_Bellin_Map_of_the_Cape_of_Good_Hope%2C_Capetown%2C_South_Africa_-_Geographicus_-_GoedeHoop-bellin-1773.jpg","page_title":"Meermin","context_page_description":"Le Meermin est un navire négrier de la Compagnie néerlandaise des Indes orientales construit à Amsterdam sur un chantier naval de la Compagnie et lancé en 1760. Le 18 février 1766 les esclaves qu'il transporte de Madagascar au Cap se révoltent et prennent possession du navire. Les faits sont connus et bien documentés grâce aux minutes du procès qui a lieu par la suite."},{"page_url":"https://vi.wikipedia.org/wiki/Malaysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Malaysia_F1_GP_2011.jpg","page_title":"Malaysia","context_page_description":"Malaysia là một quốc gia quân chủ lập hiến liên bang nằm tại phía nam của khu vực Đông Nam Á. Quốc gia này bao gồm 13 bang và ba lãnh thổ liên bang với tổng diện tích đất liền là 330,803 km². Malaysia bị tách làm hai phần qua biển Đông: Malaysia bán đảo và Borneo thuộc Malaysia. Malaysia có biên giới trên bộ với Thái Lan, Indonesia, và Brunei, trong khi có biên giới trên biển với Singapore, Việt Nam, và Philippines. Thành phố thủ đô là Kuala Lumpur, song nơi đặt trụ sở của chính phủ liên bang là Putrajaya. Năm 2010, dân số Malaysia được ước tính là 28,33 triệu người, trong đó 22,6 triệu sinh sống tại phần Bán đảo. Malaysia có điểm cực nam của đại lục Á-Âu là Tanjung Piai. Malaysia là một quốc gia nhiệt đới và là một trong 17 quốc gia đa dạng sinh học nhất trên thế giới, với nhiều loài đặc hữu.\\nMalaysia có nguồn gốc từ các vương quốc Mã Lai hiện diện trong khu vực và từ thế kỷ XVIII, các vương quốc này bắt đầu lệ thuộc vào Đế quốc Anh. Các lãnh thổ đầu tiên của Anh Quốc được gọi là Các khu định cư Eo biển. Các lãnh thổ tại Malaysia bán đảo được hợp nhất thành Liên hiệp Malaya vào năm 1946."},{"page_url":"https://en.wikipedia.org/wiki/Utica,_Tunisia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Plan_of_Utica_%281862%29.jpg","page_title":"Utica, Tunisia","context_page_description":"Utica was an ancient Phoenician and Carthaginian city located near the outflow of the Medjerda River into the Mediterranean, between Carthage in the south and Hippo Diarrhytus in the north. It is traditionally considered to be the first colony to have been founded by the Phoenicians in North Africa. After Carthage's loss to Rome in the Punic Wars, Utica was an important Roman colony for seven centuries.\\nToday, Utica no longer exists, and its remains are located in Bizerte Governorate in Tunisia – not on the coast where it once lay, but further inland because deforestation and agriculture upriver led to massive erosion and the Medjerda River silted over its original mouth."},{"page_url":"https://nl.wikipedia.org/wiki/Timbellus_crauroptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Timbellus_crauroptera_%28MNHN-IM-2000-132%29.jpeg","page_title":"Timbellus crauroptera","context_page_description":"Timbellus crauroptera is een slakkensoort uit de familie van de Muricidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1991 door Houart."},{"page_url":"https://id.wikipedia.org/wiki/Kim_Yuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/YuNaKimInVancouver.jpg","page_title":"Kim Yuna","context_page_description":"Yuna Kim adalah seorang figure skater Korea Selatan.\\nIa adalah pemenang figure skating pada Olimpiade Musim Dingin Vancouver 2010 dalam Ladies' Singles, World champion 2009, 2009 Four Continents champion, tiga kali kemenangan pada Grand Prix Final champion, 2006 World Junior champion, 2005–2006 Junior Grand Prix Final champion, dan empat kali kemenangan dalam Kejuaraan Figure Skating Korea Selatan.dia adalah perempuan pertama yang mendapatkan skor 200 di acara internasional\\nKim adalah figur skater Korea Selatan pertama yang memenangkan medali di sebuah acara, ISU Junior or Senior Grand Prix, ISU Championship, dan Olimpiade. Dia adalah skater wanita pertama yang memenangkan Olimpiade, Kejuaraan Dunia, Kejuaraan Empat Benua dan Grand Prix Final. Dia adalah salah satu atlet yang paling tinggi diakui dan tokoh media di Korea Selatan."},{"page_url":"https://nl.wikipedia.org/wiki/Oude_Bareel","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Sint-Amandsberg_-_Onze-Lieve-Vrouwekerk_1.jpg","page_title":"Oude Bareel","context_page_description":"Oude Bareel is een wijk in Sint-Amandsberg, een deelgemeente van de Belgische stad Gent. De residentiële wijk ligt in het oosten van Sint-Amandsberg, op de grens met deelgemeente Oostakker in het noorden. Ten westen ligt de wijk Westveld, ten oosten Achtendries."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%AA%E9%98%B3%E7%B3%BB%E5%A4%A9%E4%BD%93%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Terrestrial_planet_size_comparisons.jpg","page_title":"太阳系天体列表","context_page_description":"太陽系天體列表收錄太陽系中唯一的恆星──太陽，及所有的行星和矮行星，還有較具代表性的太陽系小天體和1890年代以前發現的衛星。依據行星定義，環繞太陽的天體可分為行星、矮行星和太陽系小天體，而環繞它們的天體皆稱作衛星。小行星和彗星是由國際小行星中心認定並給予編號的天體，它們幾乎都屬於太陽系小天體，只有少部份的小行星同時是矮行星。流星體是太陽系小天體中，分布最廣、數量最多而質量最小的天體，因為難以觀測，只有在黃道光和對日照，以及成為流星時才容易被發現。"},{"page_url":"https://de.wikipedia.org/wiki/Blasinstrument","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Trumpet_american.jpg","page_title":"Blasinstrument","context_page_description":"Blasinstrumente sind Musikinstrumente, bei denen ein Musiker üblicherweise durch seine Atemluft meistens mit einem Instrumentenmundstück die Luftsäule innerhalb eines Hohlkörpers – meistens einer Röhre – zum Schwingen bringt. Blasinstrumente zählen gemäß der Hornbostel-Sachs-Systematik zu den Aerophonen. Der eingeblasene Luftstrom kann auch mit einem Luftsack oder Blasebalg direkt oder mittels einer Spielmechanik wie bei der Orgel erzeugt werden. Es gibt verschiedene Möglichkeiten, die Vielfalt der vorhandenen Blasinstrumente in Gruppen einzuordnen."},{"page_url":"https://cy.wikipedia.org/wiki/Cranford,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Cranford_twp_nj_039.png","page_title":"Cranford, New Jersey","context_page_description":"Treflan yn Union County, yn nhalaith New Jersey, Unol Daleithiau America yw Cranford, New Jersey. ac fe'i sefydlwyd ym 1871.\\nMae'n ffinio gyda Springfield Township, Kenilworth, New Jersey, Roselle Park, New Jersey, Roselle, New Jersey, Linden, New Jersey, Winfield Township, New Jersey, Clark, New Jersey, Westfield, New Jersey, Garwood, New Jersey.Ceir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: Cylchfa Amser y Dwyrain."},{"page_url":"https://sv.wikipedia.org/wiki/L%C3%A5ngar%C3%B6d","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/L%C3%A5ngar%C3%B6ds_kyrka_juni_2012.jpg","page_title":"Långaröd","context_page_description":"Långaröd är kyrkbyn i Långaröds socken i Hörby kommun i Skåne belägen sydost om Hörby.\\nHär ligger Långaröds kyrka."},{"page_url":"https://ja.wikipedia.org/wiki/F-14_(%E6%88%A6%E9%97%98%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/USS_Kitty_Hawk_%28CV-63%29_night_start.jpg","page_title":"F-14 (戦闘機)","context_page_description":"F-14は、アメリカ合衆国のグラマン社が開発した艦上戦闘機。愛称は「雄猫」を意味するトムキャット。"},{"page_url":"https://it.wikipedia.org/wiki/Scandalo_del_Burning_Sun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Burning_Sun_protest_2.jpg","page_title":"Scandalo del Burning Sun","context_page_description":"Lo scandalo del Burning Sun, anche conosciuto come scandalo del club Burning Sun o Burning Sun gate, è uno scandalo sessuale avvenuto nel 2019 a Seul, in Corea del Sud. Ha coinvolto diverse celebrità, idol e personale di polizia, configurandosi come il maggior scandalo che abbia colpito l'industria K-pop, influenzando l'immagine dei suoi artisti. Le accuse di crimini sessuali commessi nell'ambito dello scandalo si sono aggiunte al fenomeno molto diffuso in Sud Corea delle \\"molka\\", ovverosia la distribuzione online di video che riprendono donne in atti sessuali senza il loro consenso, e hanno alimentato una discussione tra i partiti politici su come gestire la questione.\\nLo scandalo del Burning Sun non si limita agli eventi che si sono verificati all'interno del club stesso, ma riguarda anche lo scandalo delle chat su KakaoTalk utilizzate dagli accusati per la condivisione di sextape illegali e una serie di scandali che hanno colpito l'agenzia di intrattenimento coreana YG Entertainment."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Wijchen_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Wijchen-teersmortelweg-196331.jpg","page_title":"Lijst van gemeentelijke monumenten in Wijchen (plaats)","context_page_description":"De Nederlandse plaats Wijchen kent 82 gemeentelijke monumenten, hieronder een overzicht."},{"page_url":"https://it.wikipedia.org/wiki/Console_per_videogiochi_della_prima_generazione","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Philips_ES_2208_Las_Vegas.jpg","page_title":"Console per videogiochi della prima generazione","context_page_description":"Lista delle console di prima era non esaustiva."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%83%D0%B7%D0%B5%D0%B5%D0%B2_%D0%91%D1%83%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/National_museum_of_bhutan%2C_paro.jpg","page_title":"Список музеев Бутана","context_page_description":"Музеи Бутана демонстрируют богатые традиции, историю, культуру и искусство королевства.\\nБутанский почтовый музей"},{"page_url":"https://vi.wikipedia.org/wiki/C%E1%BA%A3i_c%C3%A1ch_Kh%C3%A1ng_ngh%E1%BB%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Martin_Luther%2C_1529.jpg","page_title":"Cải cách Kháng nghị","context_page_description":"Cải cách Kháng nghị hay Cải cách Tin Lành là cuộc cải cách tôn giáo khởi xướng bởi Martin Luther và được tiếp nối bởi Jean Calvin, Huldrych Zwingli, Jacobus Arminius và những người khác tại châu Âu thế kỷ 16. Với ý định ban đầu là nhằm cải cách Giáo hội Công giáo Rôma, phong trào thường được coi là bắt đầu với 95 luận đề của Martin Luther và kết thúc với Hòa ước Westphalia năm 1648. Khi ấy, nhiều người ở châu Âu bất bình về những điều họ cho là các giáo lý giả mạo và những lạm dụng phổ biến trong giáo hội, nhất là việc mua bán phép ân xá. Một hiện tượng khác gây bất mãn không kém là việc buôn bán chức thánh, cũng như tình trạng thối nát trong giới tăng lữ. Đối với nhiều người, sự băng hoại này là cố tật của cả hệ thống, ngay cả ở vị trí các Giáo hoàng.\\nNgày 31 tháng 10 năm 1517, tại Sachsen, Martin Luther treo Chín mươi lăm Luận đề trên cửa Nhà thờ Lâu đài Wittenberg kêu gọi mở các cuộc tranh luận về các vấn đề của giáo hội. 95 luận đề của Luther trình bày các luận điểm phê phán giáo hội và Giáo hoàng, tập chú vào việc bán phép ân xá, và quan điểm của giáo hội về Luyện ngục. Trước Luther đã có những người lên tiếng đòi cải cách như Pierre Vaudès, John Wycliffe và Jan Hus."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA%D8%B4%D8%A7%D8%B1%D8%AF_%D9%81%D8%A7%D8%B1%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Dick_Farman_1920.jpg","page_title":"ريتشارد فارمان","context_page_description":"ريتشارد فارمان ‏ هو طيار ومهندس فرنسي، ولد في 1872 في باريس في فرنسا، وتوفي بنفس المكان في 31 يناير 1940."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Berliner_S-Bahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Messebahnhof-2.jpg","page_title":"Geschichte der Berliner S-Bahn","context_page_description":"Die Geschichte der Berliner S-Bahn ist ein langer Prozess, in dem ein innerstädtisches, elektrisch betriebenes Nahverkehrssystem in Berlin geschaffen wurde. Die Inbetriebnahme der ersten Strecke erfolgte im Jahr 1924, nachdem die wesentlichen Voraussetzungen mit der Einführung eines Nahverkehrstarifs und die Trennung von Nah- und Fernverkehr auf der Schiene schon 1891, also mehr als 30 Jahre vorher geschaffen worden waren.\\nErste elektrische Versuchsbetriebe fanden ab 1900 statt. 1924 ging die erste mit seitlicher, von unten bestrichener Stromschiene und 750 Volt Gleichspannung elektrifizierte Eisenbahnstrecke vom Stettiner Vorortbahnhof nach Bernau in den Regelbetrieb.\\nNach dem Zweiten Weltkrieg wurde das S-Bahn-Netz schnell von Kriegsschäden befreit. Ende 1947 war bis auf wenige Ausnahmen das gesamte Netz wieder befahrbar. Der Bau der Berliner Mauer im Jahr 1961 führte zum größten Einschnitt in den Betrieb und das Netz der S-Bahn."},{"page_url":"https://de.wikipedia.org/wiki/FDP-Bundesparteitag_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/66._Bundesparteitag_der_FDP.jpg","page_title":"FDP-Bundesparteitag 2015","context_page_description":"Den Bundesparteitag der FDP 2015 hielt die FDP vom 15. bis 17. Mai 2015 in Berlin ab. Es handelte sich um den 66. ordentlichen Bundesparteitag der FDP in der Bundesrepublik Deutschland."},{"page_url":"https://en.wikipedia.org/wiki/Wenley_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wenley_House%2C_Market_Street%2C_Brisbane%2C_2015_%28exterior%29.JPG","page_title":"Wenley House","context_page_description":"Wenley House is a heritage-listed warehouse at 20-30 Market Street, Brisbane City, City of Brisbane, Queensland, Australia. It was designed by Thomas Taylor and built in 1864. It is also known as Jewell's Building. It was added to the Queensland Heritage Register on 21 October 1992."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AD%A3%E5%8D%81%E4%BA%8C%E9%9D%A2%E9%AB%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Dodecahedron_t0_H3.png","page_title":"正十二面體","context_page_description":"正十二面體是由12個正五邊形所組成的正多面體，它共有20個頂點、30條棱、160條對角線，被施萊夫利符號{5,3}所表示，與正二十面體互成對偶。它是一種只具有正四面體對稱性的五角十二面體的特殊形式，五角十二面體的另一種特殊形式是具有正八面體對稱性的卡塔蘭多面體菱形十二面體，它都與正十二面體在拓撲上等價。正十二面體還是截頂五方偏方面體的特例。其四維類比為正一百二十胞體。"},{"page_url":"https://pt.wikipedia.org/wiki/Bacia_do_Alto_Tiet%C3%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Taia%C3%A7upeba.jpg","page_title":"Bacia do Alto Tietê","context_page_description":"A Bacia Hidrográfica do Alto Tietê é uma bacia hidrográfica com 5 868 km² de área de drenagem, dividida em seis sub-bacias que drenam os principais rios da Região Metropolitana de São Paulo: Sub-bacia Cabeceiras, Sub-bacia Cotia-Guarapiranga, Sub-bacia Billings-Tamanduateí, Sub-bacia Juquery-Cantareira, Sub-bacia Jusante Pinheiros-Pirapora e Sub-bacia Penha-Pinheiros."},{"page_url":"https://sk.wikipedia.org/wiki/Fenouillet_(Pyr%C3%A9n%C3%A9es-Orientales)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Fenouillet_et_le_Castel_Sabarda.JPG","page_title":"Fenouillet (Pyrénées-Orientales)","context_page_description":"Fenouillet je francúzska obec, ktorá sa nachádza v departemente Pyrénées-Orientales, v regióne Languedoc-Roussillon."},{"page_url":"https://it.wikipedia.org/wiki/Cesario_di_Terracina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Busto_argenteo_di_San_Cesario_diacono_e_martire.jpg","page_title":"Cesario di Terracina","context_page_description":"Cesario, o Cesareo, è stato un diacono e martire della Chiesa, venerato come santo da tutte le Chiese che ammettono il culto dei santi. Secondo la tradizione sarebbe stato figlio di cittadini romani discendenti dalla rinomata Gens Iulia, stanziata a Cartagine durante la riorganizzazione dei territori africani da parte di Gaio Giulio Cesare. Convertito al cristianesimo e divenuto diacono, si è dedicato all'evangelizzazione. Nel corso di un viaggio verso Roma, Cesario è approdato a Terracina, dove - al tempo dell'imperatore Marco Ulpio Nerva Traiano - ha subito il martirio, chiuso in un sacco e gettato nel mare, per aver protestato contro una macabra usanza pagana.\\nA partire dal IV secolo, a seguito della traslazione delle sue spoglie da Terracina alla Domus Augustana sul colle Palatino, San Cesario è stato uno dei martiri più venerati a Roma; il suo nome è servito per soppiantare il culto pagano di Giulio Cesare, dell'imperatore Cesare Ottaviano Augusto e dei Divi Cesari."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Khuzestan_S%C3%A9ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Choqa_Zanbil_3.jpg","page_title":"Khuzestan Séng","context_page_description":"Khuzestan Séng sī Iran ê chi̍t ê séng."},{"page_url":"https://vi.wikipedia.org/wiki/Nakhchivan_(th%C3%A0nh_ph%E1%BB%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nakhchivan2.png","page_title":"Nakhchivan (thành phố)","context_page_description":"Thành phố Nakhchivan, là thủ đô của Cộng hòa tự trị Nakhchivan của Azerbaijan, 450 km về phía tây Baku. Đô thị Nakhchivan gồm thành phố Nakhchivan và các làng Başbaşı, Qarağalıq, và Daşduz.\\nThành phố này đã là một trung tâm thương mại cổ và các nhà lịch sử cho rằng thời gian thành lập là vào thế kỷ 16 trước Công nguyên."},{"page_url":"https://az.wikipedia.org/wiki/Nax%C3%A7%C4%B1van_xanl%C4%B1%C4%9F%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Nakhchivan_city_femme_centre.JPG","page_title":"Naxçıvan xanlığı","context_page_description":"Naxçıvan xanlığı — 1747-ci ildə Nadir şah Əfşarın ölümündən sonra kəngərli tayfa başçısı Heydərqulu xan tərəfindən əsası qoyulmuş Azərbaycan xanlığıdır. Zəngəzur kəndindən başlamış, Araz çayı vadisinə qədər uzanan geniş ərazidə yerləşən Naxçıvan xanlığı, Qərbi Azərbaycanın böyük bir hissəsini əhatə edirdi. Dağlar xanlığı qala kimi əhatə edirdi. Şimal-qərbdən Dərələyəz dağları, cənub-şərqdən İlanlıdağ, şimal-şərqdən Böyük və Kiçik Ağrı dağları xanlığın sərhədləri boyu uzanırdı. Naxçıvan xanlığı İrəvan, Qarabağ, Xoy və Maku xanlıqları ilə həmsərhəd idi.\\nHeydərqulu xan 1763-cü ilə qədər hakimiyyətdə olmuşdur. Araşdırmalar göstərir ki, Naxçıvan xanlığı Qarabağ, Maku, Qaradağ, Gəncə və İrəvan xanlıqları ilə Heydərqulu xanın vaxtında yaxın dostluq münasibətləri yaratmışdı. Heydərqulu xanın vəfatından sonra onun oğlanları xanlığı idarə edirlər və ən uğurlu dövr Şükurəli xanın dövrünə təsadüf edir. 1768-ci ildən 1780-ci ilədək fasilələrlə Naxçıvan xanlığına rəhbərlik edən Şükurəli xan Kərim xan Zəndin fərmanı ilə müstəqil xan, yəni hakim tituluna layiq görülməklə yanaşı, bütün Kəngərli süvarilərinə sərkərdə təyin olunduğu müddətdən etibarən tümən hakimi kimi şöhrət tapır."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E5%BE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/National_Emblem_of_the_Republic_of_China.svg","page_title":"中華民國徽","context_page_description":"中華民國國徽，又叫青天白日徽，係1928年12月開始代表中華民國嘅徽章，嚟自中華民國旗嘅青天白日圖案。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%96%E3%83%BB%E3%83%AA%E3%82%B0%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Rob_Riggle_SDCC_2014.jpg","page_title":"ロブ・リグル","context_page_description":"ロブ・リグルは、アメリカ合衆国の俳優、コメディアンである。"},{"page_url":"https://fi.wikipedia.org/wiki/J%C3%B3zsef_Balogh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/J%C3%B3szef_Balog_in_Warburg_2016.jpg","page_title":"József Balogh","context_page_description":"József Balogh on unkarilainen klarinetisti ja säveltäjä.\\nBalogh valmistui Budapestin Franz Liszt -musiikkiakatemiasta. Hän on toiminut ensiklarinetistina monissa orkestereissa, kuten Budapestin oopperaorkesterissa ja Unkarin radion sinfoniaorkesterissa. Baloghin ohjelmistoon kuuluu perinteistä ja uudempaa klassista musiikkia, jazzia, klezmeriä ja romanimusiikkia. Omissa sävellyksissään ja improvisaatioissaan hän on yhdistellyt unkarilaisia ja Lähi-idästä peräisin olevia vaikutteita. Klarinetin ohella Balogh on soittanut saksofonia ja unkarilaista tárogatóa.\\nBalogh on tullut palkituksi monissa kansallisissa ja kansainvälisissä kilpailuissa muun muassa Budapestissa, Prahassa ja Grazissa. Hän on pitänyt resitaaleja ja mestarikursseja Suomessa, Saksassa, Itävallassa, Sveitsissä, Sloveniassa, Englannissa, Israelissa, Alankomaissa, Italiassa ja Yhdysvalloissa.\\nBalogh on toiminut InterClarinet-yhtyeen jäsenenä. Hän on tehnyt yhteistyötä monien muiden klarinetistien kanssa, joihin ovat kuuluneet Eddie Daniels, Buddy DeFranco, Larry Combs ja Stanley Drucker."},{"page_url":"https://tl.wikipedia.org/wiki/Ambaguio","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Ph_locator_nueva_vizcaya_ambaguio.png","page_title":"Ambaguio","context_page_description":"Ang Bayan ng Ambaguio ay isang ika-5 klaseng bayan sa lalawigan ng Nueva Vizcaya, Pilipinas. Ayon sa 2015 senso, ito ay may populasyon na 15,250 sa may 3,535 na kabahayan."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BD%E7%9C%89%E9%B8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Eyebrowed_Thrush.jpg","page_title":"白眉鸫","context_page_description":"白眉鸫属于鸫科鸫属，是一种广泛分布于除青藏高原外的东亚和北亚雀鸟。其近缘物种为白腹鸫与灰背鸫。"},{"page_url":"https://en.wikipedia.org/wiki/Otterhead_Lakes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Otterford_Lakes_Nature_Reserve.jpg","page_title":"Otterhead Lakes","context_page_description":"Otterhead Lakes are a pair of reservoirs in the Blackdown Hills Area of Outstanding Natural Beauty south of Otterford in Somerset, England. They are fed by the River Otter and managed by the Otterhead Estate Trust Company Limited, working with the Somerset Wildlife Trust on behalf of Wessex Water. They are a Local Nature Reserve.\\nThe two lakes which remain are all that are left of a series of pools in the landscaped gardens of Otterhead House which was built in 1845 and demolished in 1952, and its surrounding estate developed by William Beadon. The lakes are the centrepiece of the one mile long Otterhead Local Nature Reserve which includes dry woodland which has a ground flora including common bluebell, dogs mercury and twayblade. More moist areas are home to marsh pennywort and royal fern rhododendron and sycamore. There are dormice, badgers and bats in the woods and bird species include kingfisher, dipper and wagtail.\\nThe lakes contain wild brown trout and are used for fly fishing.\\nOtterhead Forest School is based at Otterhead Lakes"},{"page_url":"https://hu.wikipedia.org/wiki/Velencei_K%C3%B6zt%C3%A1rsas%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ludwik_Wegierski.jpg","page_title":"Velencei Köztársaság","context_page_description":"A Velencei Köztársaság Itália északi részén a 8. század és 1797 között fennállott államalakulat volt. Gyakorlatilag városállamként emlékeznek meg róla a krónikák, azonban a Velence város köré alakult kereskedőállam igen tekintélyes területre tett szert. A 12. és 15. században fénykorát élő Velencét gyakran illették az Adria királynője címmel, vagy – amint az a hivatalos megnevezésében is használatos volt – Serenissimaként, azaz a Legfenségesebbként emlegették. A köztársasági államformát magára öltő állam élén a dózse állt."},{"page_url":"https://fr.wikipedia.org/wiki/Championnat_du_monde_des_rallyes_1985","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/WRC-1983.png","page_title":"Championnat du monde des rallyes 1985","context_page_description":"Fédération internationale de l'automobile\\nCompétition automobile\\nRallye\\nListe alphabétique des pilotes de rallye"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B5%CF%81%CE%B9%CF%86%CE%AD%CF%81%CE%B5%CE%B9%CE%B1_%CE%A4%CE%B1%CE%BC%CF%80%CF%8C%CF%81%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bundesarchiv_Bild_105-DOA0732%2C_Deutsch-Ostafrika%2C_Tabora%2C_Polizeistation.jpg","page_title":"Περιφέρεια Ταμπόρα","context_page_description":"Η Περιφέρεια Ταμπόρα είναι μια από τις 30 περιφέρειες της Τανζανίας. Περιφερειακή πρωτεύουσα είναι ο Δήμος Ταμπόρα. Σύμφωνα με την εθνική απογραφή του 2012, η περιοχή είχε πληθυσμό 2.291.623, η οποία ήταν χαμηλότερη από την προ-απογραφής πρόβλεψη των 2.539.715 ατόμων. Για το 2002-2012, ο μέσος ετήσιος ρυθμός αύξησης του πληθυσμού της περιοχής ήταν 2,9%, ο ένατος υψηλότερος στη χώρα. Επίσης, ήταν η 24η πιο πυκνοκατοικημένη περιοχή, με 30 κατοίκους ανά τετραγωνικό χιλιόμετρο. Τα 6,0 άτομα, ήταν το μέσο οικιακό μέγεθος της περιοχής, το τρίτο υψηλότερο στη χώρα.\\nΗ Περιφέρεια βρίσκεται στο κεντρικό-δυτικό τμήμα της χώρας. Με μια επιφάνεια 76.151 τετραγωνικών χιλιομέτρων η Περιφέρεια είναι ελαφρώς μεγαλύτερη από τον Παναμά. Τα προστατευόμενα δάση, καλύπτουν 34.698 τετραγωνικά χιλιόμετρα και τα αποθέματα της άγριας πανίδας, καλύπτουν 17.122 τετραγωνικά χιλιόμετρα. Η περισσότερη οικονομική δραστηριότητα στην Περιφέρεια είναι γεωργική.\\nΟ Επίτροπος για την Περιφέρεια Ταμπόρα, είναι ο Ludovic Mwananzila."},{"page_url":"https://it.wikipedia.org/wiki/Francesco_Croce","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/5310MilanoPalRagione.JPG","page_title":"Francesco Croce","context_page_description":"Francesco Croce è stato un architetto barocco italiano.\\nFu soprattutto attivo nella Veneranda Fabbrica del Duomo."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E8%92%82%E5%9F%BA%E5%B8%95%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/A_fog_oasis_at_the_Atiquipa_Lomas%2C_Peru.jpg","page_title":"阿蒂基帕區","context_page_description":"阿蒂基帕區，是秘魯的一個區，位於該國南部阿雷基帕大區的卡拉韋利省，面積423.55平方公里，海拔高度345米，2007年人口774，人口密度每平方公里1.83人。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A2%E0%B5%8B%E0%B4%B2%E0%B5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Dholak.jpg","page_title":"ഢോലൿ","context_page_description":"ഒരു ചർമവാദ്യമാണ് ഢോലൿ. ഉത്തരേന്ത്യയിലാണ് ഈ വാദ്യം കൂടുതൽ പ്രചാരത്തിലുള്ളത്. ആകൃതിയിൽ മൃദംഗത്തിൽ നിന്നു അല്പം വ്യത്യസ്തമാണ്. കനം കുറഞ്ഞ് നീളം കൂടിയ ആകൃതിയാണ് ഇതിനുള്ളത്. ഇരുവശവും തോൽ കെട്ടി ഉറപ്പിച്ചിരിക്കുന്നു. തബല, മൃദംഗം, ഗഞ്ചിറ എന്നിവക്ക് സമാനമായ വാദനമാണ് ഢോലക്കിന്റേത്."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%8A%D9%88_%D8%AF%D9%89._%D9%87%D9%8A%D8%B1%D9%85%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Leo_D._Hermle.jpg","page_title":"ليو دى. هيرمل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nليو دى. هيرمل كان عسكرى من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/A290_(Russland)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/M25_karte_RF.jpg","page_title":"A290 (Russland)","context_page_description":"Die A290 ist eine Fernstraße föderaler Bedeutung in Russland und Teil der Europastraße 97.\\nSie war als M25 Teil des Fernstraßennetzes der Sowjetunion und führte von Simferopol auf der Krim in östlicher Richtung nach Noworossijsk in Russland. Bis er 2010 die Bezeichnung A290 erhielt, trug der russische Teil noch die Nummer M25."},{"page_url":"https://hr.wikipedia.org/wiki/Isaac_Newton","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Dispersive_Prism_Illustration.jpg","page_title":"Isaac Newton","context_page_description":"Isaac Newton, engleski fizičar, matematičar i astronom. Jedan od najznačajnijih znanstvenika u povijesti. Završio je studij u Cambridgeu. Nakon završetka studija, kada se zbog kuge sveučilište zatvorilo, vratio se kući u Woolsthorpe, gdje je samostalno učinio niz temeljnih otkrića iz mehanike i matematike, premda je većinu objavio tek nakon dvadesetak godina. Godine 1669. postao je profesor na Trinity Collegeu u Cambridgeu. Tih godina bavio se uglavnom optikom. Od 1671. bio je član Kraljevskog društva u Londonu. Godine 1695. postavljen je za nadzornika, a 1701. za upravitelja državne kovnice novca. Tada se preselio u London, gdje je ostao do kraja života. Godine 1699. postao je jedan od osmorice stranih članova Francuske akademije znanosti."},{"page_url":"https://ms.wikipedia.org/wiki/Puncak_Jalil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Mes-e20.png","page_title":"Puncak Jalil","context_page_description":"Puncak Jalil adalah perbandaran 801 ekar di Seri Kembangan, Selangor, Malaysia. Ia terletak berdekatan dengan Taman Teknologi Malaysia di sepanjang Lebuh Raya Puchong-Sungai Besi dan selatan Kompleks Sukan Negara.\\nLebuhraya Maju berjalan melalui sempadan timur projek.\\nPerbandaran bersebelahan termasuk Kinrara di barat laut, Lestari Perdana di tenggara dan Taman Equine di selatan.\\nPembangunan yang dilakukan oleh Maxisegar Sdn Bhd, sebuah anak syarikat milik penuh Talam, merupakan sebuah bandar yang bersepadu dan serba lengkap yang terdiri daripada 11,651 unit hartanah kediaman dan komersial.\\nNilai Pembangunan Kasar Puncak Jalil dianggarkan kira-kira RM2.5 bilion dengan jangkaan tempoh pembangunan lapan tahun.\\nProjek ini dilancarkan pada Jun 2001.\\nPada tahun 2006, IJM Berhad telah bersetuju untuk melangkah ke dalam membantu Talam Berhad yang sakit untuk memulihkan projek ini. Kerja-kerja landskap yang indah sedang berjalan dan bandar ini akan mempunyai potensi pertumbuhan kerana ia terletak betul-betul di antara ibu negara pentadbiran Malaysia yang baru, Putrajaya, dengan ibu negara yang lama, Kuala Lumpur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%8C%D1%8E%D0%B7,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_(%D0%BF%D0%B8%D1%81%D0%B0%D1%82%D0%B5%D0%BB%D1%8C)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/ThomasHughesInLawGazette.jpg","page_title":"Хьюз, Томас (писатель)","context_page_description":"Томас Хьюз — английский писатель, адвокат."},{"page_url":"https://it.wikipedia.org/wiki/Hilla_von_Rebay","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Hilla_von_Rebay_by_L%C3%A1szl%C3%B3_Moholy-Nagy%2C_1924.jpg","page_title":"Hilla von Rebay","context_page_description":"Hilla von Rebay è stata un'artista tedesca."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A0%D7%A8%D7%99_%D7%94%D7%A8%D7%91%D7%99%D7%A2%D7%99,_%D7%9E%D7%9C%D7%9A_%D7%90%D7%A0%D7%92%D7%9C%D7%99%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/King_Henry_IV_from_NPG_%282%29.jpg","page_title":"הנרי הרביעי, מלך אנגליה","context_page_description":"הנרי הרביעי היה מלך אנגליה והלורד של אירלנד משנת 1399 ועד מותו. הוא היה המלך העשירי למניין מלכי בית פלנטג'נט והטוען לתואר מלך צרפת. הנרי נולד בטירת בולינגברוק שבמחוז לינקולנשייר ולפיכך הוא כונה הנרי בולינגברוק. אביו, ג'ון מגונט, דוכס לנקסטר, היה בנו השלישי של אדוארד השלישי, מלך אנגליה והוא זכה לעמדת השפעה מרכזית במהלך רוב תקופת מלכותו של בן דודו של הנרי, ריצ'רד השני, שבסופו של דבר הודח על ידי הנרי הרביעי. אמו של הנרי הייתה בלאנש, שהייתה יורשת של חלק מכובד של אחוזות בית לנקסטר, וכך היה הנרי למלך הראשון מענף בית לנקסטר של בית פלנטג'נט."},{"page_url":"https://eo.wikipedia.org/wiki/Oplotec","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Hor%C5%A1ovsk%C3%BD_T%C3%BDn%2C_Oplotec%2C_common%2C_north_part.jpg","page_title":"Oplotec","context_page_description":"Oplotec estas vilaĝo en Ĉeĥio, parto de urbo Horšovský Týn en distrikto Domažlice. Ĝi troviĝas proksimume 10 km nordokcidente de Horšovský Týn. En la jaro 2009 estis ĉi tie registritaj 33 adresoj. En la jaro 2011 ĉi tie daŭre vivis 54 loĝantoj.\\nOplotec estas ankaŭ nomo de katastra teritorio kun areo 3,92 km²."},{"page_url":"https://hu.wikipedia.org/wiki/Cumberland_megye_(New_Jersey)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Downtown_Bridgeton_NJ.JPG","page_title":"Cumberland megye (New Jersey)","context_page_description":"Cumberland megye az Amerikai Egyesült Államokban, azon belül New Jersey államban található. Megyeszékhelye Bridgeton. Lakosainak száma 157 332 fő. +/- Cumberland megye Cape May, Atlantic, Gloucester és Salem megyékkel határos."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D9%8A%D8%A7%D8%A9_%D8%A7%D9%84%D8%A8%D8%B1%D9%8A%D8%A9_%D9%81%D9%8A_%D8%A7%D9%84%D8%B4%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Hyrax_colony.jpg","page_title":"الحياة البرية في الشام","context_page_description":"يُقصد بالحياة البرية في الشام مجموع أنواع النباتات والحيوانات البرية من ثدييات وطيور وزواحف وبرمائيات وأسماك مياه عذبة ومالحة، بالإضافة للافقاريات، قاطنة المنطقة المعروفة تاريخيًا باسم الشام أو بلاد الشام أو سورية الكبرى، وهي تلك المنطقة التي تضم اليوم الدول التالية: الأردن وفلسطين وسوريا ولبنان وإسرائيل، بالإضافة لقسم من جنوب شرق تركيا، وهو القسم المعروف باسم الأقاليم السورية الشمالية، ويضيف إليها البعض قبرص وقسما من سيناء.\\nتتميز الحياة البرية الشاميّة بتنوعها الكبير، وذلك عائد للتنوع المناخي في المنطقة ولوقوعها في منتصف قارات العالم القديم الثلاث: آسيا وأفريقيا وأوروبا، الأمر الذي جعل منها معبرًا لهجرة أنواع عديدة من الشمال إلى الجنوب والعكس، وأضفى عليها أنماطا مناخية مختلفة ومتناقضة في بعض الأحيان، مما مكّن طائفة عظيمة من الكائنات المتنوعة من استيطانها. اندثر الكثير من أنواع الحيوانات الضخمة في الشام، أو في بعض أجزائها دون الأخرى، بفعل تدمير الموائل الطبيعية لغرض الاستيطان والاستغلال البشري، أو بسبب الصيد الجائر منذ القدم، ومنذ أواخر القرن العشرين أقيمت عدّة محميات طبيعية في كافة أنحاء الشام، بجهود محليّة تارة ودولية تارة أخرى، للحفاظ على ما تبقى من أنواع حيوانية وموائل طبيعية فريدة، وقد أصاب بعض من تلك المحميات نجاحًا باهرًا في الحفاظ على الحياة البرية ومساكنها."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%84%E3%83%BC%E3%83%A1%E3%83%87%E3%82%A3%E3%82%B9%E3%83%B3%E7%B4%AF%E5%B1%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Einiosaurus_BW.jpg","page_title":"ツーメディスン累層","context_page_description":"ツーメディスン累層はモンタナ州北部とアルバータ州南部に分布するカンパニアンの地層。それはロッキー山脈衝上断層帯の東側に位置し、スイートグラスアーチという地域の範囲内に入り込んでいる東部はほとんど変形していない平野であるのに対し、西側部分の地層は折り畳まれたような形になっている。ツーメディスン累層の下には砂浜と潮汐帯の堆積物および砂岩があり、上には海成のベアパウ頁岩がある。ツーメディスン累層はカンパニアン期を通して、白亜紀後期内部陸水路の西側の海岸線とコーディレラン衝上断層帯の東方向に進んでいる海岸線との間に、河川や三角州によって堆積されたものである。主に砂岩で成る。"},{"page_url":"https://es.wikipedia.org/wiki/I_Set_My_Friends_On_Fire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/ISetMyFriendsOnFire.jpg","page_title":"I Set My Friends On Fire","context_page_description":"I Set My Friends on Fire es una banda estadounidense de post-hardcore formada en 2007."},{"page_url":"https://pl.wikipedia.org/wiki/Karol_Mikrut","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Luge_world_cup_Oberhof_2016_by_Stepro_IMG_7279_LR5.jpg","page_title":"Karol Mikrut","context_page_description":"Karol Mikrut – polski saneczkarz w konkurencji dwójek, olimpijczyk z Soczi 2014.\\nKarol Mikrut karierę sportową rozpoczął w 2006 roku. W konkurencji dwójek z Patrykiem Poręba zdobywał srebrny i brązowy medal mistrzostw Polski, a także trzykrotne mistrzostwo Polski w drużynie. Startowali razem również w zawodach Pucharu Świata oraz mistrzostw świata, Mistrzostw Europy i na igrzyskach olimpijskich 2014.\\nPo sezonie 2018/2019 zakończył sportową karierę."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E5%9B%BD%E8%B4%A2%E6%94%BF%E9%83%A8%E5%8F%B8%E5%BA%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Anna_Escobedo_Cabral%2C_official_Treasury_photo.jpg","page_title":"美国财政部司库","context_page_description":"美國財政部司庫，美國財政部官員，最初負責接收和監管政府基金，這些職能多已由財政部的不同機構負責，自1981年起主要負責監管雕刻和印刷局、美國鑄幣局和美國儲蓄債券司。2002年司庫辦公室進行了重大重組，現在司庫負責就硬幣、紙幣及美國製造的其他儀器的產量等事務向鑄幣局局長、雕刻和印刷局局長、財政部長和副部長提供建議。\\n美國財政部司庫的簽名會與美國財政部長的簽名一道出現在美元紙幣「聯邦儲備券」上。\\n1949年，總統哈里·S·杜魯門將喬治婭·尼斯·克拉克任命第一任女性司庫，隨後的歷任司庫均為女性，且多為拉丁裔美國人。"},{"page_url":"https://en.wikipedia.org/wiki/2014_United_States_Senate_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Senator_Dan_Sullivan_official.jpg","page_title":"2014 United States Senate elections","context_page_description":"The 2014 United States Senate elections were held on November 4, 2014. A total of 36 seats in the 100-member U.S. Senate were contested. Thirty-three Class 2 seats were contested for regular six-year terms to be served from January 3, 2015 to January 3, 2021, and three Class 3 seats were contested in special elections due to Senate vacancies. The elections marked 100 years of direct elections of U.S. Senators. Going into the elections, 21 of the contested seats were held by the Democratic Party, while 15 were held by the Republican Party.\\nThe Republicans regained the majority of the Senate in the 114th Congress, which started in January 2015; the Republicans had not controlled the Senate since January 2007. They had needed a net gain of at least six seats to obtain a majority. They held all of their seats and gained nine Democratic-held seats. Republicans defeated five Democratic incumbents: Mark Begich of Alaska lost to Dan Sullivan, Mark Pryor of Arkansas lost to Tom Cotton, Mark Udall of Colorado lost to Cory Gardner, Mary Landrieu of Louisiana lost to Bill Cassidy and Kay Hagan of North Carolina lost to Thom Tillis."},{"page_url":"https://ca.wikipedia.org/wiki/Ossa_(empresa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Joan_Porcar_OSSA_350_Dakar_1982_b.JPG","page_title":"Ossa (empresa)","context_page_description":"OSSA fou una empresa catalana dedicada inicialment a la fabricació de maquinària cinematogràfica i més tard a la de motocicletes que estigué activa entre 1928 i 1982. Fundada per l'industrial barceloní Joan Giró, la fàbrica estava situada d'ençà de la dècada de 1960 a la Zona Franca de Barcelona i el seu nom és l'acrònim d'Orpheo Sincronic Sociedad Anónima. El seu logotip era un trèvol de quatre fulles. Encara avui conserva la popularitat que assolí arreu del món, especialment als EUA, entre els afeccionats a les motocicletes de competició.\\nEl 2010, després de gairebé tres dècades del seu tancament, la marca renasqué temporalment de mans d'uns empresaris gironins, que hi tornaren a fabricar motocicletes des de la nova empresa Ossa Factory S.L."},{"page_url":"https://de.wikipedia.org/wiki/Textilkennzeichnungsgesetz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Textilkennzeichnungab.jpg","page_title":"Textilkennzeichnungsgesetz","context_page_description":"Das Textilkennzeichnungsgesetz schreibt vor, wie die Fasern, aus denen Textilien bestehen, gegenüber dem Verbraucher deklariert werden müssen. Es wurde am 15. Januar 1969 verabschiedet, und am 15. Februar 2016 unter Berücksichtigung der Verordnung Nr. 1007/2011 über die Bezeichnung von Textilfasern neu gefasst."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BB%D0%B0_%D0%9C%D0%B5%D0%B9%D0%BF%D1%8A%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Marla_Maples_LF_crop.jpg","page_title":"Марла Мейпълс","context_page_description":"Марла Ан Мейпълс е американска актриса и телевизионна личност, широко известна с аферата си, и последващия шест-годишен брак с бизнесмена и президент на САЩ Доналд Тръмп."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lalgaye","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Lalgaye.JPG","page_title":"Lalgaye","context_page_description":"Lalgaye sī Burkina Faso ê chi̍t ê tē-hng chū-tī-thé.\\nChe sī chi̍t phiⁿ koan-î Burkina Faso tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://es.wikipedia.org/wiki/Sandra_Escacena","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/IMG_1707_Sandra_Escacena.jpg","page_title":"Sandra Escacena","context_page_description":"Sandra Escacena ​​ es una actriz española, conocida principalmente por su papel protagonista en la película Verónica, de Paco Plaza."},{"page_url":"https://tr.wikipedia.org/wiki/Tao%C3%A7lar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Sanson%2C_Guillaume._Colchis%2C_Iberia%2C_Albania_quae_q.%2C_Caucasiae_gentes%2C_istmum_quod_Pontum_Euxinum_Caspium_q.%2C_mare_interjacet_incolunt.jpg","page_title":"Taoçlar","context_page_description":"Taoçlar Antik Çağda Anadoluda yaşamış, Greko-Romen etnografyası ile bilinen bir halktır. Taoçlar, Karadenizin dağlık bölgelerinde, Gürcistan, Ermenistan ve Türkiye'nin mevcut sınırlarında yaşamıştır. Taoçların ülkesi çelik ve sülünlerin ülkeleri ile çevrelenmiştir.\\nKsenofon, Taoçların topraklarından geçerken düşmanlıkla karşı karşıya kalmıştır. Ksenofon, bu insanların cesur, kederli ve savaşı kaybettikten sonra köle olmamak için eşleri ve çocuklarıyla birlikte topluca intihar edecek kadar fedakar olduklarını belirtmiştir. Ksenofon, Taoçlardaki benzer bir uygulamayı söyle anlatmaktadır: “Sonra korkunç bir tören başladı: kadınlar küçük çocuklarını uçurumdan aşağıya attıktan sonra kendilerini de aşağıya attı ve erkekler de aynısını yaptı. Bu olayların tam ortasında Kaptan Stymphaluslu Aeneas kendini uçurumdan atmak için koşan cübbeli bir adamı engellemek için onu tuttu; ama adam Aeneas'ı peşinden sürükledi, ve birlikte uçurumdan aşağı uçup öldüler.”.\\n1928'de, Rus botanik Woronow bir Iris türünü Iris Taochia olarak tanımlamıştır. Bu tür Türkiye'de bulunmuştur."},{"page_url":"https://de.wikipedia.org/wiki/L-Arginin:Glycin-Amidinotransferase","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/9jdw.jpg","page_title":"L-Arginin:Glycin-Amidinotransferase","context_page_description":"L-Arginin:Glycin-Amidinotransferase ist ein Enzym, welches bei der Synthese von Guanidinoacetat aus den Aminosäuren Arginin und Glycin, vorwiegend in Niere und Speicheldrüse, beteiligt ist."},{"page_url":"https://fr.wikipedia.org/wiki/Bad_M%C3%BCnster_am_Stein-Ebernburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Wappen_Bad_Muenster_am_Stein-Ebernburg.png","page_title":"Bad Münster am Stein-Ebernburg","context_page_description":"Bad Münster am Stein-Ebernburg est une ancienne municipalité allemande située dans le land de Rhénanie-Palatinat et l'Arrondissement de Bad Kreuznach."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BE%D5%A1%D5%AC%D5%A1%D5%B1%D6%87_%D5%A1%D5%B7%D5%AD%D5%A1%D5%BF%D5%A1%D5%BD%D5%A5%D5%B6%D5%B5%D5%A1%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Oval_Office_1981.jpg","page_title":"Օվալաձև աշխատասենյակ","context_page_description":"Օվալաձև աշխատասենյակ, ԱՄՆ նախագահների աշխատասենյակը Սպիտակ տանը:\\nԳտնվում է շենքի արևմտյան թևում: Ունի երեք մեծ պատուհաններ, որոնք նայում են հարավ, և չորս դուռ: Արևելյան դուռը դուրս է գալիս վարդագույն այգի, արևմտյան դուռը\` ոչ մեծ առանձնասենյակ և ճաշասենյակ, իսկ հյուսիսարևելյան դուռը\` նախագահի քարտուղարի սենյակ: Նախագահի աշխատասեղանը հարավային պատուհանների տակ է: Հյուսիսային մասում բուխարի է:\\nԿառուցվել է 1909 թվականին, առաջին տերը եղել է նախագահ Ուիլյամ Տաֆտը:\\nՍենյակի մեծ տրամագիծը 10.9 մ է, փոքր\` 8.8 մ, իսկ առաստաղի բարձրությունը 5.6 մ է:"},{"page_url":"https://sv.wikipedia.org/wiki/Monomorium_destructor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Monomorium_destructor_casent0008623_profile_1.jpg","page_title":"Monomorium destructor","context_page_description":"Monomorium destructor är en myrart som först beskrevs av Jerdon 1851. Monomorium destructor ingår i släktet Monomorium och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D8%A7%D8%B1%D8%B9_%D8%A7%D9%84%D9%88%D8%A7%D8%AC%D9%87%D8%A7%D8%AA_(%D8%A7%D9%84%D8%A8%D8%AA%D8%B1%D8%A7%D8%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Tombs_in_petra3.jpg","page_title":"شارع الواجهات (البتراء)","context_page_description":"شارع الواجهات هو طريق أثري يعود تاريخه إلى فترة حكم مملكة الأنباط. يقع داخل المحمية الأثرية في مدينة البتراء، جنوب الأردن. يمكن الوصول إليه بعد اجتياز الخزنة، حيث يبدأ السيق بالاتساع تدريجياً إلى أن يصل إلى منطقة مفتوحة. يقع على جانبيّ الطريق عدد من واجهات المدافن النبطية المزينة بالمسننات والكورنيشات والأدراج المقلوبة. بعض هذه الواجهات دمرت من خلال العوامل الطبيعية. وربما تعود هذه الواجهات إلى موظفين كبار في الدولة أو بعض الأمراء. كما يُعتقد بأن هذه الصفوف من الاضرحة ذات النقوش المعقدة من أصل آشوري."},{"page_url":"https://en.wikipedia.org/wiki/List_of_covered_bridges_in_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Billie_Creek_Covered_Bridge.jpg","page_title":"List of covered bridges in Indiana","context_page_description":"This is a list of Indiana covered bridges. There are 98 historic wooden covered bridges in the U.S. state of Indiana. Fourteen of these bridges were built before 1870 and represent the most common truss styles in Indiana.\\nParke County bills itself as the covered bridge capital of the world. Combined with six counties that surround it, there are 51 of Indiana’s 98 covered bridges in this small area: Parke County, Putnam County, Fountain County, Vermillion County, Montgomery County, Owen County and Vigo County. The majority, 54, are Burr Arch truss designs, while the next most common truss style is a Howe truss with 23.\\nOne each of the older style King Post and Queen Post are located in the western part of the state; Philips Bridge, west of Rockville in Parke County and Irishman Bridge, south of Terre Haute in Vigo County, respectively. Indiana also has examples of the Long Truss and the Smith Type IV Truss. The remaining span of the Bell Ford Bridge, northwest of Seymour in Jackson County, collapsed in January 2006. It was the last standing example of a Post Truss covered bridge in the world."},{"page_url":"https://it.wikipedia.org/wiki/Focke-Wulf_Ta_183","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ta_183_Modell.jpg","page_title":"Focke-Wulf Ta 183","context_page_description":"Il Focke-Wulf Ta 183 Huckebein era un caccia monomotore a getto ad ala a freccia sviluppato dall'azienda tedesca Focke-Wulf Flugzeugbau AG negli anni quaranta e rimasto allo stadio progettuale.\\nDestinato a sostituire i Messerschmitt Me 262 in servizio nella Luftwaffe, a causa del termine della seconda guerra mondiale il suo sviluppo venne interrotto senza che ne fosse stato costruito nemmeno un prototipo. Le conoscenze acquisite vennero tuttavia riutilizzate dal suo progettista, Kurt Tank, nel periodo postbellico concretizzandosi nella realizzazione dell'argentino FMA I.Ae. 33 Pulqui II."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B4%D9%86%D9%84_(%D8%B4%DB%8C%D8%B1%DA%A9%D8%AA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Chanel_hat_from_Les_Modes_1912.jpg","page_title":"شنل (شیرکت)","context_page_description":"شنل (شیرکت) بیر شیرکت دیر. بۇ شیرکت دَب ساحه‌سینده فعالیّت گؤستریر. شیرکت Coco Chanel طرفیندن قۇرولموش‌دور. چالیشان ایشچی‌لرینین سایی‌سی ۱٬۲۷۰ نفر اوْلوب."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_mines_en_Allemagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/PobershauTieferMolchener.jpg","page_title":"Liste de mines en Allemagne","context_page_description":"Voici une liste de mines situées en Allemagne excluant celles de Rhénanie-du-Nord-Westphalie, listées sur l'article dédié liste de mines en Rhénanie-du-Nord-Westphalie."},{"page_url":"https://sk.wikipedia.org/wiki/Kr%C3%A1sn%C3%A9_(okres_%C5%BD%C4%8F%C3%A1r_nad_S%C3%A1zavou)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Kr%C3%A1sn%C3%A9_ZR_CoA.jpg","page_title":"Krásné (okres Žďár nad Sázavou)","context_page_description":"Krásné je obec v Česku v okrese Žďár nad Sázavou v kraji Vysočina. 1. januára 2012 tu žilo 106 obyvateľov, z toho 54 mužov a 52 žien, pričom priemerný vek v obci bol 39,6 roka."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Amberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Schrannenplatz_6_Amberg_20190702_001.jpg","page_title":"Liste der Baudenkmäler in Amberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer kreisfreien Stadt Amberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%BE%D1%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Turo%C5%A1_%28Croatia%29.jpg","page_title":"Турош","context_page_description":"Ту́рош — сорт сиру, що виробляється з коров'ячого молока. Є традиційною стравою на півночі Хорватії, в окрузі Меджимур'ї.\\nТурош роблять в вигляді шматків конічної форми із зерненого сиру з додаванням солі і паприки. Завдяки чому сир має світло-помаранчевий відтінок. Конуси переважно роблять висотою близько 6 сантиметрів. Після надання сиру необхідної форми його коптять або в'ялять протягом декількох днів.\\nНазва «турош» походить з угорського омофона «túrós», що значить «із зернистого сиру»."},{"page_url":"https://nl.wikipedia.org/wiki/Noord-Macedoni%C3%AB_op_het_Eurovisiesongfestival","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Vlatko_ilievski_eurosong_2011.jpg","page_title":"Noord-Macedonië op het Eurovisiesongfestival","context_page_description":"Noord-Macedonië doet als onafhankelijk land sinds 1998 mee aan het Eurovisiesongfestival. Vanwege een meningsverschil met Griekenland over de naam van het land, werd Macedonië bij het Eurovisiesongfestival tot en met 2018 aangeduid als de Voormalige Joegoslavische Republiek Macedonië."},{"page_url":"https://nl.wikipedia.org/wiki/Cosimo_III_de%27_Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Marguerite_Louise_d%27Orl%C3%A9ans_%28detail%29_from_a_set_of_portraits_called_%22The_three_sisters_of_Mademoiselle_de_Montpensier.jpg","page_title":"Cosimo III de' Medici","context_page_description":"Cosimo III de' Medici was groothertog van Toscane van 1670 tot zijn dood. Hij was de zoon van Ferdinando II de' Medici en Vittoria della Rovere. Hij kwam uit een oud bankiersgeslacht de' Medici en behoorde tot de rijkste mannen in Europa. Hij regeerde 53 jaar, volgens sommige bronnen veel te lang en zou het land geruïneerd hebben. Cosimo is verguisd in de literatuur als iemand die alleen belangstelling had voor bidprentjes, maar hij had aanwijsbare interesse voor de waterhuishouding en reisde daarvoor naar de Republiek en verzamelde allerlei objecten uit landen die hij bezocht had. Hij liet zich alle nieuwe boeken toesturen over Indonesië. Hij kan beschouwd worden als een antropoloog avant la lettre. Hij had grote belangstelling voor botanie en de classificatie van planten en dieren, en richtte zijn villa's in met enkel stillevens, waarop bomen, planten en bloemen waren afgebeeld, die tevens in zijn tuin groeiden."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%A0%B4%E5%A3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Vandalisme_bushalte_Rotterdam.jpg","page_title":"破壞","context_page_description":"破壞、搞搞震係指將一啲物件損毀或者將一啲事情搞亂嘅行為，破壞嘅人叫做破壞者（Vandals）。如果指有關行動，就叫做「搞破壞」。"},{"page_url":"https://it.wikipedia.org/wiki/Villa_Capponi_(Firenze)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Villa_capponi%2C_lato_giardino_03.JPG","page_title":"Villa Capponi (Firenze)","context_page_description":"Villa Capponi si trova in via Pian dei Giullari, 3 nella località di Arcetri a Firenze."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BB%D0%B5_(%D0%B2%D0%B5%D0%BD%D0%B3%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%B6%D0%B4%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Hungary_Jaszbereny_Lehel.jpg","page_title":"Леле (венгерский вождь)","context_page_description":"Леле — венгерский полководец князя Такшоня, до 955 года — предполагаемый правитель Нитранского княжества.\\nСогласно Симону Кезскому, изначально Леле жил в районе Галгоца. Вопреки утверждениям некоторых историков он, судя по всему, не принадлежал к династии Арпадов. В 955 году во время битвы на реке Лех он попал в плен и был казнён.\\nСуществует популярная легенда о том, что у Леле был знаменитый горн. Легенда гласит, что перед казнью, которая должна была состояться перед лицом германского императора, Леле предложили в последний раз сыграть на этом горне. Завершив играть, он, якобы, из последних сил рванулся к императору и успел перед смертью горном разбить ему голову. Однако на самом деле император Оттон Великий умер лишь в 973 году, через 18 лет после казни Леле."},{"page_url":"https://de.wikipedia.org/wiki/Liste_Essener_Bahnh%C3%B6fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Essen_Hbf_02_Empfangsgeb%C3%A4ude.jpg","page_title":"Liste Essener Bahnhöfe","context_page_description":"Die Liste Essener Bahnhöfe umfasst alle aktuellen und ehemaligen Bahnhöfe und Haltepunkte für den Eisenbahnpersonenverkehr in Essen.\\nAuf dem heutigen Gebiet der Stadt Essen entwickelte sich bis Ende des 19. Jahrhunderts das dichteste Eisenbahnnetz des Ruhrgebiets. Die Köln-Mindener Eisenbahn-Gesellschaft eröffnete 1847 mit einem Teil der Bahnstrecke Duisburg–Dortmund die Anbindung an die damals noch abgelegenen nördlichen Bereiche von Essen mit dem Bahnhof Essen-Altenessen, damals Essen CM genannt. Die Bergisch-Märkische Eisenbahn-Gesellschaft errichtete 1862 mit der Bahnstrecke Witten/Dortmund–Oberhausen/Duisburg die große Ost-West-Verbindung durch Essen, an der der Hauptbahnhof, damals Essen BM, liegt. Die Rheinische Bahn konkurrierte ab 1866 mit einer weiteren Ost-West-Verbindung und dem Bahnhof Nord an der Bahnstrecke Osterath–Dortmund Süd, die nördlich am damaligen Essener Zentrum vorbeiführte. Diese drei Eisenbahntrassen bildeten das Grundgerüst für eine Vielzahl von Querverbindungen und Anschlussgleisen zu den Zechenstandorten und Industriebetrieben zur Zeit der Industrialisierung in Essen."},{"page_url":"https://es.wikipedia.org/wiki/Hochburg-Ach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ach_an_der_Salzach_von_Burghausen_aus6.JPG","page_title":"Hochburg-Ach","context_page_description":"Hochburg-Ach es una localidad del distrito de Braunau am Inn, en el estado de Alta Austria, Austria, con una población estimada a principio del año 2018 de 3236 habitantes.\\nSe encuentra ubicada al oeste del estado, cerca de la frontera con Alemania y del río Eno —un afluente derecho del Danubio—.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%AC%E7%94%BA%E9%80%9A_(%E6%96%B0%E6%BD%9F%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Niigata_Honcho-dori6_20131106.JPG","page_title":"本町通 (新潟市)","context_page_description":"本町通は、新潟市中央区の市道、またはその沿道の町名。現行行政地名は本町通1番町から本町通14番町。住居表示未実施区域。郵便番号は951-8067。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E9%97%BB%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Msc_2008-Saturday%2C_09.00_-_11.00_Uhr-Moerk001_Sa.jpg","page_title":"新闻学","context_page_description":"新闻学，或译为报道学或言论学，是一种包含搜集、撰写及报导新闻的学科。在广义上，它亦包含了编辑和演示新闻专题的过程。新闻学在报业、电视、电台以及网络新媒体等各种传播媒介上均起着重要的作用。多数的传媒机构皆希望“先发制人”，争先发布资讯，而处于这种压力下，传媒机构通常会先对新闻进行编辑和校对，以使其内容符合该机构在准确性、素质和式样等方面的标准。有很多传媒机构均声称他们是政府机关和官员的监察者，由此监督政府对人民负责，并为这传统感到自豪。但同时，批评者则对传媒本身能否向大众负责而提出质疑。\\n二十年代初，传统新闻工作者都是受雇的毕业于相关学士学位的专业人士。可是到了九十年代，随着新闻制作数码化及互联网的普及程度日益上升，传统、专业的新闻文化正在受到挑战。民间记者的概念应运而生，网络上的记者可以透过不同渠道来把自己制作的新闻发放，而不只限于透过专业的媒体渠道。\\n前华盛顿邮报编辑菲尔·格雷厄姆形容以消息导向的新闻写作是“历史初稿”，因为每当重大历史事件发生时，新闻工作者都把它们记录下来，接着把该些专题报道在短时间内制成，而这与写作历史的初稿无异。"},{"page_url":"https://sk.wikipedia.org/wiki/Vonkaj%C5%A1%C3%AD_tepelnoizola%C4%8Dn%C3%BD_kontaktn%C3%BD_syst%C3%A9m","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/FEDINOVA.jpg","page_title":"Vonkajší tepelnoizolačný kontaktný systém","context_page_description":"Vonkajší tepelnoizolačný kontaktný systém alebo mimo normy aj kontaktný zatepľovací systém je technologický postup, ktorý slúži na zlepšenie tepelnej izolácie fasád. Zhotovuje sa pomocou tepelnej izolácie na báze polystyrénu alebo minerálnej vlny s konečnou povrchovou úpravou vo forme omietky a bez vetracej vzduchovej medzery.\\nTepelne zaizolované objekty prinášajú oproti tepelne nezaizolovaným niekoľko výhod, z ktorých najdôležitejšie sú zvýšenie tepelného odporu konštrukcie, z čoho vyplýva zníženie nákladov na vykurovanie, čím sa vytvárajú podmienky na zlepšenie tepelnej pohody. Tepelnou izoláciou sa predlžuje celková životnosť stavby, ako aj jej estetické pôsobenie.\\nPrvé zateplenie bolo urobené v roku 1957 v Nemecku, odvtedy sa tento systém čoraz viac používa. Tepelnoizolačné prvky sa najnovšie komponujú priamo do nových projektov, je však možné tepelne izolovať aj dodatočne staršie objekty."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_brochet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Esox_Lucius_-_squelette_mnhn_Paris1.JPG","page_title":"Grand brochet","context_page_description":"Le brochet ou grand brochet est une espèce de poissons prédateurs de l'ordre des Esociformes, commune dans les eaux douces et saumâtres de l'hémisphère nord."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%86.%E0%B4%B5%E0%B4%BF._%E0%B4%B0%E0%B4%BE%E0%B4%AE%E0%B4%A8%E0%B4%BE%E0%B4%A5%E0%B5%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/K_V_Ramanathan.jpg","page_title":"കെ.വി. രാമനാഥൻ","context_page_description":"മലയാളത്തിലെ പ്രമുഖനായ ഒരു ബാല സാഹിത്യകാരനാണ് കെ.വി. രാമനാഥൻ. 1994 ൽ ബാലസാഹിത്യത്തിനുള്ള കേരള സാഹിത്യ അക്കാദമി എൻഡോവ്മെന്റ് പുരസ്കാരവും ബാലസാഹിത്യരംഗത്തെ സമഗ്ര സംഭാവനക്കുള്ള കേന്ദ്ര സാഹിത്യ അക്കാദമി പുരസ്കാരവും ലഭിച്ചിട്ടുണ്ട്."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fenbrunnen_im_Berliner_Bezirk_Friedrichshain-Kreuzberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Str.brunnen_Kreuzberg_Reichenberger_Str_25.jpg","page_title":"Liste der Straßenbrunnen im Berliner Bezirk Friedrichshain-Kreuzberg","context_page_description":"Die Liste der Straßenbrunnen im Berliner Bezirk Friedrichshain-Kreuzberg ist eine Übersicht der aktuell existierenden Brunnen in den Ortsteilen des Bezirks unter dem Aspekt der Bestimmung als Straßenmöbel. Zum anderen finden sich Hinweise auf festgestellte Besonderheiten der Umgebung der Standorte oder der Brunnen."},{"page_url":"https://cs.wikipedia.org/wiki/Alfons_Mucha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Slovane_v_pravlasti_81x61m.jpg","page_title":"Alfons Mucha","context_page_description":"Alfons Maria Mucha byl český malíř, grafik a designér období secese.\\nNarodil se v Ivančicích na Moravě do rodiny soudního zaměstnance jako čtvrté ze šesti dětí. Studoval v Mnichově a Paříži, kde se následně roku 1887 usadil a pracoval jako ilustrátor a grafik. Na přelomu let 1894 a 1895 se mu naskytla možnost vytvořit plakát k divadelní hře Gismonda se Sarah Bernhardtovou v hlavní roli, který mu téměř přes noc vynesl celosvětový věhlas a díky němuž se jeho jméno dostalo do popředí francouzské společnosti. Herečka později s Muchou uzavřela smlouvu o spolupráci na dalších šest let a on pro ni a její divadlo vypravoval hry, navrhoval kostýmy a další plakáty. Koncem století se Mucha stal významným a průkopnickým secesním umělcem. Navrhoval a zveřejňoval reklamní plakáty, bohaté ilustrace a řadu dekorativních panelů, tematicky založených na zobrazování přírody. Vytvořil velké množství kreseb, pastelových či akvarelových studií a designových návrhů pro interiéry, užitkové předměty a šperky. Jeho životním dílem je cyklus velkoformátových pláten Slovanská epopej, na kterém pracoval téměř osmnáct let."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Christie_2016_presidential_campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Chris_Christie_by_Gage_Skidmore_3.jpg","page_title":"Chris Christie 2016 presidential campaign","context_page_description":"The 2016 presidential campaign of Chris Christie, the 55th Governor of New Jersey, began on June 30, 2015, at an event in his hometown of Livingston, New Jersey. Following a poor showing in the New Hampshire primary, the campaign was suspended on February 10, 2016. He endorsed Donald Trump on February 26, 2016."},{"page_url":"https://pt.wikipedia.org/wiki/Zdechovice_(Pardubice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Z%C3%A1mek_v_Zdechovic%C3%ADch.jpg","page_title":"Zdechovice (Pardubice)","context_page_description":"Zdechovice é uma comuna checa localizada na região de Pardubice, distrito de Pardubice."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Truppenteile_der_Artillerietruppe_des_Heeres_der_Bundeswehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/PzArtBtl_305_%28B%29.png","page_title":"Liste der Truppenteile der Artillerietruppe des Heeres der Bundeswehr","context_page_description":"Die Liste der Truppenteile der Artillerietruppe des Heeres der Bundeswehr enthält alle aufgelösten, aktiven und nicht aktiven Verbände und Großverbände der Artillerietruppe der Bundeswehr sowie eine kurze Übersicht über ihren Aufstellungszeitpunkt, Stationierungsorte, Unterstellung und über ihre Auflösung oder Umbenennung.\\nZusätzlich wurden die Verbände aufgenommen deren Kern zu bedeutenden Anteilen aus Artilleristen gebildet wurde."},{"page_url":"https://sv.wikipedia.org/wiki/Getty_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Getty_Center_2008.jpg","page_title":"Getty Center","context_page_description":"Getty Center är ett konstcentrum i Brentwood i Los Angeles, Kalifornien, USA, som bland annat omfattar konstmuseet J. Paul Getty Museum.\\nGetty Center öppnade i december 1997. Förutom konstmuseet inryms ett forskningsinstitut, en konservatorenhet, Gettystiftelsen samt J. Paul Getty Trust, som äger och driver centret.\\nArkitekten Richard Meier har utnyttjat sig av två konvergerande bergskammar. Utefter den ena finns konstgallerierna och utefter den andra ligger byggnader för administration. Byggnaderna, som är gjorda i betong och stål, är klädda med travertinmarmor. Eftersom Getty Center ligger i en region som är utsatt för skogsbränder, har omfattande åtgärder vidtagits för att skydda byggnaderna mot brand och inträngande av brandrök. Travertin, som är mycket motståndskraftigt mot eld, används genomgående för ytterväggar och taken är täckta av krossad sten. Den ursprungliga chaparalvegetationen närmast centret är utbytt mot vattenhållande växter samt hamlade ekar med trädkronor högt över marken. Inget gräs växer i närheten och buskar hålls undan genom regelbunden betning av getter."},{"page_url":"https://ro.wikipedia.org/wiki/Ministerul_Transporturilor_(Rom%C3%A2nia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Anghel_Saligny_-_Foto01.jpg","page_title":"Ministerul Transporturilor (România)","context_page_description":"Ministerul Transporturilor, Infrastructurii si Comunicatiilor este organul de specialitate al administrației publice centrale care stabilește politica în domeniul transporturilor la nivel național, elaborează strategia și reglementările specifice de dezvoltare și armonizare a activităților de transport în cadrul politicii generale a Guvernului și îndeplinește rolul de autoritate de stat în domeniul transporturilor. Înființat la data de 22 ianuarie 1862, sub denumirea \\"Ministerul Lucrărilor Publice\\", a fost condus de Dimitrie Cornea, primul ministru al transporturilor al României moderne\\nMinisterul Transporturilor reprezintă autoritatea de stat în domeniul transporturilor, pe care o exercită direct sau prin organisme tehnice specializate, instituții publice subordonate, unități care funcționează sub autoritatea ori coordonarea sa sau societăți comerciale autorizate.\\nÎn mai 2008, Ministerul Transporturilor a demarat procedura pentru reorganizarea societăților ce vor fi listate la Bursa de Valori București."},{"page_url":"https://en.wikipedia.org/wiki/Arcade_(architecture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/S95NormanArcadeEly.jpg","page_title":"Arcade (architecture)","context_page_description":"An arcade is a succession of contiguous arches, with each arch supported by a colonnade of columns or piers. Exterior arcades are designed to provide a sheltered walkway for pedestrians. The walkway may be lined with retail stores. An arcade may feature arches on both sides of the walkway. Alternatively, a blind arcade superimposes arcading against a solid wall. Blind arcades are a feature of Romanesque architecture that influenced Gothic architecture. In the Gothic architectural tradition, the arcade can be located in the interior, in the lowest part of the wall of the nave, supporting the triforium and the clerestory in a cathedral, or on the exterior, in which they are usually part of the walkways that surround the courtyard and cloisters.\\nMany medieval arcades housed shops or stalls, either in the arcaded space itself, or set into the main wall behind. From this, \\"arcade\\" has become a general word for a group of shops in a single building, regardless of the architectural form.\\nThe word \\"arcade\\" comes from French arcade from Provençal arcada or Italian arcata, based on Latin arcus, ‘bow’."},{"page_url":"https://es.wikipedia.org/wiki/Saltos_del_patinaje_art%C3%ADstico_sobre_hielo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/2011_Figure_Skating_WC_Kevin_van_der_Perren_%283%29.jpg","page_title":"Saltos del patinaje artístico sobre hielo","context_page_description":"Los saltos son los elementos más reconocibles del patinaje artístico y los que más contribuyen a la puntuación técnica en las competiciones de la ISU.​ Aunque en el patinaje sobre hielo se denomina salto a toda maniobra en la que el\\npatinador se eleva en el aire por su propio impulso, el reglamento de\\nla ISU solo asigna una puntuación específica para seis tipos de saltos, en los que el\\npatinador salta sobre un pie, ejecuta al menos una rotación y aterriza sobre un pie patinando hacia\\natrás. Los mejores patinadores ejecutan regularmente saltos de\\ntres y hasta cuatro revoluciones en el aire. Los saltos de menos de una rotación se pueden incluir en las\\nsecuencias de pasos o utilizarse como movimientos de transición o para\\nenlazar diferentes elementos del programa.​"},{"page_url":"https://vi.wikipedia.org/wiki/Ph%C6%B0%E1%BB%9Dng_10,_%C4%90%C3%A0_L%E1%BA%A1t","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Da_Lat_train_station_37.jpg","page_title":"Phường 10, Đà Lạt","context_page_description":"Phường 10 là một phường thuộc thành phố Đà Lạt, tỉnh Lâm Đồng, Việt Nam."},{"page_url":"https://en.wikipedia.org/wiki/The_Gondoliers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Wallace_Brownlow_and_Decima_Moore_%281889%29.jpg","page_title":"The Gondoliers","context_page_description":"The Gondoliers; or, The King of Barataria is a Savoy Opera, with music by Arthur Sullivan and libretto by W. S. Gilbert. It premiered at the Savoy Theatre on 7 December 1889 and ran for a very successful 554 performances, closing on 30 June 1891. This was the twelfth comic opera collaboration of fourteen between Gilbert and Sullivan.\\nThe story of the opera concerns the young bride of the heir to the throne of the fictional kingdom of Barataria who arrives in Venice to join her husband. It turns out, however, that he cannot be identified, since he was entrusted to the care of a drunken gondolier who mixed up the prince with his own son. To complicate matters, the King of Barataria has just been killed. The two young gondoliers must now jointly rule the kingdom until the nurse of the prince can be brought in to determine which of them is the rightful king. Moreover, when the young queen arrives to claim her husband, she finds that the two gondoliers have both recently married local girls. A last complicating factor is that she, herself, is in love with another man.\\nThe Gondoliers was Gilbert and Sullivan's last great success."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Landkreis_Erding","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Wappen_Altenerding.jpg","page_title":"Liste der Wappen im Landkreis Erding","context_page_description":"Die Liste der Wappen im Landkreis Erding zeigt die Wappen der Gemeinden im bayerischen Landkreis Erding."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%92%B0%E5%BD%A2%E7%90%83%E5%84%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Ancient_Beijing_observatory_10.jpg","page_title":"環形球儀","context_page_description":"浑天仪是中国和希腊古代测定天体位置的一种仪器。由相应天球坐标系各基本圈的环规及瞄准器构成，与浑象不同。其主要用作展示围绕地球的天体轨迹。浑仪也是最早期的复杂机械仪器，其发展促进了机器的改良和设计。浑仪在古希腊和古中国被分别独立发明。\\n中国的浑仪西汉落下闳曾制造。《朱子语类》卷二十三录朱熹与弟子黄义刚曾讨论过浑仪的原理，黄义刚曾说：“楼上浑仪可见”，表示朱熹家可能有此种仪器。《宋史·天文志一》亦载：“朱熹家有浑仪，颇考水运制度，卒不可得。”\\n浑仪是由有刻度的金属圈组成，这些圆形的骨架代表天体的赤道、黄道、子午圈等。金属球代表天体，而浑仪的中央通常是地球或太阳。中国古代的浑仪还有代表白道的圆圈和协助观察用的窥管。由于历代浑仪增加的圆圈太多，妨碍观察，元朝郭守敬把圆圈简化，称为简仪。\\n托勒密利用大型的浑仪作为仔细的观测工具。浑仪在中世纪末期时再度兴起。丹麦天文学家第谷建造了作天文观测用的大型浑仪。文艺复兴时间的科学家和公众人物的画像中，通常画有一浑仪，画中人其中一只手放在浑仪上，代表他们拥有高度的智慧和知识。葡萄牙国旗上画有浑仪。自马努埃一世起浑仪成为该国之象征。"},{"page_url":"https://es.wikipedia.org/wiki/Keizer_(Oreg%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Keizer_Station_in_Oregon_3.JPG","page_title":"Keizer (Oregón)","context_page_description":"Keizer es una ciudad ubicada en el condado de Marion en el estado estadounidense de Oregón. En el año 2006 tenía una población de 34,880 habitantes y una densidad poblacional de 1,719.7 personas por km².​"},{"page_url":"https://es.wikipedia.org/wiki/Inositol","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Inositol-3.png","page_title":"Inositol","context_page_description":"El inositol es un compuesto orgánico de la familia de los polioles o polialcoholes presente en las membranas plasmáticas y en otras estructuras de productos naturales. Es relativamente escaso, pero tiene una gran importancia funcional cuando se asocia a otras estructuras."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B4%DB%8C%D8%B1%DB%8C%D9%86_%D8%AF%DB%8C%D9%88%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/David%26Rode.jpg","page_title":"شیرین دیوید","context_page_description":"شیرین دیوید آلمانلی شارکیچی و موسیقیچی - چئشیتلی موسیقی ژانرلاریندا اثرلر یارادیب. شیرین دیوید ۱۱ آوریل ۱۹۹۵ ‏ تاریخینده هامبورق شهرینده حیاتا گؤز آچیب."},{"page_url":"https://ca.wikipedia.org/wiki/Orgue","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Orgue_port%C3%A0til.jpg","page_title":"Orgue","context_page_description":"L'orgue és un aeròfon d'un o més cossos sonors, cadascun dels quals és controlat pel seu propi teclat, sigui manual o pedaler. En l'orgue, el so és generat pel pas del vent per tubs de diferent longitud, forma, construcció i material, classificats en registres o jocs. En l'actualitat, el vent és generat per un ventilador elèctric. Antigament, però, el vent era subministrat per un sistema més o menys complex de manxes que eren accionades, mitjançant unes palanques, per una o més persones que assistien l'organista, anomenades manxaires. Els diferents registres s'accionen per mitjà d'unes palanques situades a l'abast de la mà de qui toca l'instrument.\\nA diferència de la majoria d'instruments musicals, l'orgue, no està estandarditzat. Això vol dir que no tots els orgues tenen el mateix nombre de teclats ni de registres, conseqüentment, el nombre de tubs d'un orgue pot variar molt i, conjuntament amb el nombre de teclats i de registres, és un bon indicador de la mida de l'instrument."},{"page_url":"https://nv.wikipedia.org/wiki/Ch%CA%BCizhaazhii_bit%C3%A9%C3%A9l_nood%C7%AB%CC%81z%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Streaked_ground_babbler.jpg","page_title":"Chʼizhaazhii bitéél noodǫ́zígíí","context_page_description":"Chʼizhaazhii bitéél noodǫ́zígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Kéyah Dańlíinii bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Ptilocichla mindanensis\\" deiłníigo dayózhí."},{"page_url":"https://nl.wikipedia.org/wiki/Terhorst_(Drenthe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Ter_horst_%28Drenthe%29.jpg","page_title":"Terhorst (Drenthe)","context_page_description":"Terhorst of ook wel Ter Horst is een buurtschap in de gemeente Midden-Drenthe, in het Nederlandse provincie Drenthe. Het ligt ten zuiden van Beilen aan de weg tussen Spier en Makkum.\\nDe buurtschap werd in 1844 als Ter-Horst vermeld, daarna volgde zowel de spellingen Ter Horst als Terhorst. Deze twee spellingen worden door elkaar gebruikt. Zo staat de plaats in de Topografische atlas van Drenthe als Ter Horst terwijl de eigen witte borden spreken van Terhorst.\\nDe plaats is waarschijnlijk ontstaan uit een boerderij van ene ' Jacob Ter Horst' nabij Makkum in de 17e eeuw. In de volgende eeuwen breidt het langzaam uit tot de vier boerderijen. In 1840 had het 30 inwoners verdeeld over deze vier boerderijen. In de twintigste eeuw groeit de buurtschap wat. In het begin van de 21ste eeuw is er sprake van 15 huizen in de buurtschap. Er wonen dan circa 40 inwoners.\\nTerhorst behoorde tot 1998 tot de gemeente Beilen. Samen met de naburige buurtschap Smalbroek heeft de buurtschap een eigen buurtvereniging, sinds 2017 Smallhorst geheten."},{"page_url":"https://pl.wikipedia.org/wiki/Popsko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Popsko_PD_2011_005.jpg","page_title":"Popsko","context_page_description":"Popsko – wieś w południowej Bułgarii, w obwodzie Chaskowo, w gminie Iwajłowgrad. Według danych Narodowego Instytutu Statystycznego, 31 grudnia 2011 roku wieś liczyła 44 mieszkańców. Corocznie jest organizowany święty sobór, na który zjeżdżają się mieszkańcy Popska i wszyscy z całej Bułgarii, którzy urodzili się w Popsku a obecnie mieszkają gdzie indziej."},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_Yamagata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Yamagata_Airport_Terminal_and_Tower.jpg","page_title":"Flughafen Yamagata","context_page_description":"Der Flughafen Yamagata ist ein Regionalflughafen der japanischen Stadt Higashine. Er liegt etwa 20 Kilometer nördlich von der Stadt Yamagata. Der Flughafen Yamagata gilt nach der japanischen Gesetzgebung als Flughafen 2. Klasse."},{"page_url":"https://nn.wikipedia.org/wiki/Kristian_Elster_d.y.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Kristian_Elster_d.y..jpg","page_title":"Kristian Elster d.y.","context_page_description":"Kristian Elster d.y. var ein norsk forfattar, jurist og litteraturhistorikar.\\nElster var fødd i Trondheim, men flytta som spedbarn til Førde. I 1888 flytta familien til Oslo.\\nElster vart cand. jur. i 1905 og var sekretær i landbruksdepartementet frå 1910. Den litterære debuten hans heitte Fortællinger og kom ut i 1907, medan romantriologien I lære, Landeveien og Mester vert rekna som gjennombrotet hans. Mange reknar Av skyggenes slegt som den viktigaste romanen hans. Til saman gav Elster ut bortimot 40 romanar, skodespel og forteljingar. Nokre av utgjevingane hans var skrivne under pseudonymet Onkel Hans.\\nArbeidet hans som litteraturhistorikar er særleg knytt til verket Illustreret norsk litteraturhistorie, som kom ut i 2 bind 1923-24, og i ei utvida 6-bindsutgåve 1934-35.\\nKristian Elster d.y. er son til forfattaren Kristian Elster d.e. og far til forfattar og kringkastingssjef Torolf Elster.\\nHan mottok diktargasje frå 1937. I 1941 vart han lønna med Gyldendals legat."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A2%D7%A8_%D7%94%D7%90%D7%9E%D7%96%D7%95%D7%A0%D7%90%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Dendrobates_azureus_%28Dendrobates_tinctorius%29_Edit.jpg","page_title":"יער האמזונאס","context_page_description":"יער האמזונאס הוא יער הגשם הטרופי הגדול בעולם, אשר מצוי באזור הטרופי של אמריקה הדרומית. יער האמזונאס מכסה קרוב ל-7,769,994 קמ\\"ר, ומשתרע על פני תשע מדינות: ברזיל שבה כ-60% משטחו הכולל, קולומביה, פרו, ונצואלה, אקוודור, בוליביה, גיאנה, סורינאם, וגיאנה הצרפתית. היער קרוי על שם נהר האמזונאס הזורם בו ומגוון המינים בו הוא הגדול בעולם. בשנת 2011, לאחר תהליך בחירה שנמשך ארבע שנים, נבחר היער והנהר הזורם בו לאחד משבעת פלאי עולם הטבע.\\nביער מתגוררים שבטי אינדיאנים שונים המתקיימים מציד חיות, דגים וחרקים המשמשים להם כמזון, בונים לעצמם בקתות ומכינים את בגדיהם מצמחים, עורות ונוצות."},{"page_url":"https://cs.wikipedia.org/wiki/Obecn%C3%A1_teorie_relativity","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Light_deflectionCZ.png","page_title":"Obecná teorie relativity","context_page_description":"Obecná teorie relativity je fyzikální teorie gravitace publikovaná Albertem Einsteinem v roce 1915, která je popisem gravitace užívaným v moderní fyzice. Obecná teorie relativity zobecňuje speciální relativitu a Newtonův gravitační zákon do jednotného popisu gravitace jako geometrické vlastnosti prostoru a času neboli prostoročasu. Především postuluje, že zakřivení prostoročasu přímo závisí na energii a hybnosti dané hmoty nebo záření. Závislost je vyjádřena Einsteinovými rovnicemi gravitačního pole, které jsou souborem parciálních diferenciálních rovnic.\\nNěkteré předpovědi obecné teorie relativity se významně liší od předpovědí klasické fyziky, zejména pokud jde o plynutí času, geometrii prostoru, pohyb těles při volném pádu a šíření světla. Mezi příklady těchto rozdílů patří gravitační dilatace času, gravitační čočkování, gravitační rudý posuv světla a gravitační časové zpoždění. Všechny doposud provedené pokusy a pozorování předpovědi obecné teorie relativity potvrdily. Existují i jiné relativistické teorie gravitace, ale obecná teorie relativity je nejjednodušší teorie, která je v souladu s experimentálními daty."},{"page_url":"https://vi.wikipedia.org/wiki/Zaporizhia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/%D0%9A%D0%BE%D0%BD%D1%82%D1%83%D1%80%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D1%82%D0%B0_%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D1%8C%D1%8F_%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8.png","page_title":"Zaporizhia","context_page_description":"Zaporizhia hay Zaporozhye [tên cũ Alexandrovsk ] là thành phố ở đông nam Ukraina, nằm bên hai bờ sông Dnieper. Đây là thủ phủ của tỉnh Zaporizhia, Ukraina. Zaporizhia là thành phố lớn thứ 6 quốc gia này. Dân số theo điều tra năm 2001 là 815.256 người."},{"page_url":"https://az.wikipedia.org/wiki/Sumqay%C4%B1t%C3%A7ay","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Sumqay%C4%B1t%C3%A7ay_2.jpg","page_title":"Sumqayıtçay","context_page_description":"Sumqayıtçay — Şamaxı rayonu və Sumqayıt şəhər inzibati ərazi vahidlərinin ərazisindən axaraq Xəzər dənizinə tökülür."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%9A%E3%82%A4%E3%83%B3%E3%81%AE%E9%A6%96%E7%9B%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/D%C3%A1maso_Berenguer_b.1919_%28cropped%29.jpg","page_title":"スペインの首相","context_page_description":"スペインの首相は、スペイン政府の長である。日本語でスペインの首相と訳される役職名は時代によって異なっている。\\nSecretario de Estado－ボルボン家の初代国王フェリーペ5世の治世から1833年のフェルナンド7世の治世、旧体制崩壊まで。\\nPresidente del Consejo de Ministros de España－旧体制崩壊後のイサベル2世の治世から、フランコ体制終焉後、民主化移行期の制憲議会まで。\\nPresidente del Gobierno de España－1977年の第一回立法議会以降。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9E%97%E5%BE%B7%E4%BF%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Alex_Lam_and_his_parents_in_a_concert.JPG","page_title":"林德信","context_page_description":"林德信，原名林德正，香港男歌手、演員，是著名歌手林子祥的兒子，繼母是歌手葉蒨文，現為獨立歌手，自資製作音樂，經理人為林姍姍。他也是瑜伽導師。"},{"page_url":"https://pt.wikipedia.org/wiki/Machaeropterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Machaeropterus_deliciosus_-NW_Ecuador-6.jpg","page_title":"Machaeropterus","context_page_description":"Machaeropterus é um género de ave da família Pipridae.\\nEste género contém as seguintes espécies:\\nMachaeropterus pyrocephalus\\nMachaeropterus regulus\\nMachaeropterus deliciosus\\nMachaeropterus striolatus"},{"page_url":"https://pt.wikipedia.org/wiki/Montsec_(Meuse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Montsec.jpg","page_title":"Montsec (Meuse)","context_page_description":"Montsec é uma comuna francesa na região administrativa de Grande Leste, no departamento de Meuse. Estende-se por uma área de 5,95 km². Em 2010 a comuna tinha 86 habitantes."},{"page_url":"https://cs.wikipedia.org/wiki/Sv%C4%9Btozor","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Svetozor_1886_Dum_Jeruzalemska.jpg","page_title":"Světozor","context_page_description":"Světozor byl český obrázkový časopis, vycházející s přestávkami od roku 1834.\\nPrvní číslo Světozoru vyšlo 1. března 1834, kdy jej po vzoru britských penny papers založil Pavel Josef Šafařík. Cílem tohoto časopisu byla snaha pobavit čtenáře různými zajímavostmi, nesetkal se však se zájmem odběratelů a po dvou letech zanikl. Vycházel každou sobotu a celkem bylo vydáno 52 čísel.\\nV roce 1867 jej obnovil František Skrejšovský. Jako týdeník začal od 13. července 1867 vycházet každý pátek. Od roku 1899 časopis získalo Nakladatelství J. Otto, ve kterém časopis vycházel přes 30 let. Ve 30. letech 20. století časopis vydával pokrokový novinář Pavel Altschul."},{"page_url":"https://it.wikipedia.org/wiki/Michelbach_(Austria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Michelbach_im_Bezirk_PL.PNG","page_title":"Michelbach (Austria)","context_page_description":"Michelbach è un comune austriaco di 903 abitanti nel distretto di Sankt Pölten-Land, in Bassa Austria; ha lo status di comune mercato."},{"page_url":"https://az.wikipedia.org/wiki/Seqyur_(kommuna)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Map_commune_FR_insee_code_12266.png","page_title":"Seqyur (kommuna)","context_page_description":"Seqyur — Fransada kommuna, Cənub-Pireneylər regionunda yerləşir. Departament — Averon. Vezen-de-Levezu kantonuna daxildir. Kommunanın dairəsi — Miyo.\\nINSEE kodu — 12266.\\nKommuna təxminən Parisdən 510 km cənubda, Tuluza şəhərindən 135 km şimal-şərqdə, Rodezdən isə 22 km qərbdə yerləşir."},{"page_url":"https://hu.wikipedia.org/wiki/Kereszt%C3%A9ny_templom%C3%A9p%C3%ADt%C3%A9szet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Chapelle_de_la_sorbonne_interior.jpg","page_title":"Keresztény templomépítészet","context_page_description":"A keresztény templomépítészet lényegében Nagy Konstantin római császár idejében kezdődött. Az ő idejében született meg egyszerre, – szinte a semmiből – egy új vallási épülettípus. Ha mindenáron az előzményét keressük, az leginkább az ókori római bazilika volt."},{"page_url":"https://no.wikipedia.org/wiki/Henrik_Thott","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Henrik_Thott.jpg","page_title":"Henrik Thott","context_page_description":"Henrik Thott eller Henrich Tott var en dansk adelsmann, lensherre og offiser. Hans foreldre var Christen Thott og Sophie Below. Henrik Thott eide gods knyttet til gårdene Boltinggaard, Kjeldkær, Fårup i Jelling Sogn, samt Gladsaxe og Svineberg i Skåne.\\nHenrik Thott var på den obligatoriske utenlandsreise for unge adelsmenn. Han var i 1621 immatrikulert ved Universitetet i Leiden. Etter hjemkomsten tjente han fra 1628 som sekretær i det danske Kancelli. I 1635 fratrådte han sin stilling ved kanselliet for å overta Stavanger len. Thott var lensherre i Stavanger fram til 1641. Som oberstløytnant ble Thott sjef for de to fænniker i Stavanger len og Agdesiden len som var blitt slått sammen til et regiment i 1640. Regimentet ble under Hannibalfeiden kalt «det Stavangerske regiment», senere det «Vesterlenske regiment». Fra 1641-48 var Thott lensherre på Bergenhus.\\nSelv om Thott var en velstående godseier endte han sine dager i stor fattigdom. I 1655 måtte han selge Fårupgård til sin søster Anne Thott, og de andre måtte han etterhvert oppgi på grunn av gjeld. I 1660 ble Thott utnevnt av Kronen til stiftsamtmann over Århus Stift og amtmann over Århus Amt."},{"page_url":"https://fr.wikipedia.org/wiki/Impasse_Marie-Blanche","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Impasse_Marie-Blanche.JPG","page_title":"Impasse Marie-Blanche","context_page_description":"L'impasse Marie-Blanche est une voie située dans le quartier des Grandes-Carrières du 18ᵉ arrondissement de Paris, en France."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Lauterbach_(Hessen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Lauterbach_%28DerHexer%29_WLMMH_65647_2011-09-17_01.jpg","page_title":"Liste der Kulturdenkmäler in Lauterbach (Hessen)","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Lauterbach, Vogelsbergkreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDie Kulturdenkmäler der einzelnen Ortsteile sind in eigenen Listen enthalten:\\nListe der Kulturdenkmäler in Allmenrod\\nListe der Kulturdenkmäler in Blitzenrod\\nListe der Kulturdenkmäler in Frischborn\\nListe der Kulturdenkmäler in Heblos\\nListe der Kulturdenkmäler in Maar\\nListe der Kulturdenkmäler in Reuters\\nListe der Kulturdenkmäler in Rimlos\\nListe der Kulturdenkmäler in Rudlos\\nListe der Kulturdenkmäler in Sickendorf\\nListe der Kulturdenkmäler in Wallenrod\\nListe der Kulturdenkmäler in Wernges"},{"page_url":"https://en.wikipedia.org/wiki/List_of_heads_of_government_of_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Vladimir_Vladimirovich_Putin.jpg","page_title":"List of heads of government of Russia","context_page_description":"Approximately 99 people have been head of the Russian government since its establishment in 1726. The chairman of government was a member of the Supreme Privy Council, which was created on 8 February 1726 by Empress Catherine, and from 8 September 1802 ministerial duties were allocated by the Committee of Ministers, which was established on in accordance with the proclamation of Emperor Alexander II. Beginning with Count Aleksandr Romanovich Vorontsov, the eldest of the officers was de facto chairman of the committee. Eight years after the inauguration of the manifest, the first de jure office holder was Count Nikolay Rumyantsev. The Council of Ministers was unofficially formed in October 1857, as a result of Emperor Alexander II's reforms; its first session began on 19 December 1857. Before the actual formation of that body on 12 November 1861, the Emperor himself was in charge. The Council of Ministers consisted of chairmen of the State Council and the Committee of Ministers, as well as high-ranking officers appointed by the Emperor. The first session ended on 11 December 1882, after the number of files to the Council greatly decreased."},{"page_url":"https://en.wikipedia.org/wiki/Carla_Harvey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Carla_Harvey_2014.jpg","page_title":"Carla Harvey","context_page_description":"Carla Harvey is an American singer, songwriter, musician, author, artist, actress, and former nude model. She is best known as co-vocalist of the American heavy metal band Butcher Babies. She landed her first job in Hollywood as an Entertainment Reporter for the Playboy Channel, and appeared on many popular network TV shows like Rules of Engagement. Harvey took a break from the entertainment world to earn a degree in Mortuary Science from California's Cypress College, and worked as an embalmer and funeral director before forming the Butcher Babies and pursuing her lifelong dream of being a touring musician.\\nHarvey is passionate about writing. She was named a \\"comic book mastermind\\" by Hustler. Her first published comic book Butcher Babies was released with great success at San Diego Comic-Con 2011. Her first full-length novel, Death and Other Dances, was released in 2014, and a new comic series entitled Soul Sucka was released in 2015."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%95%D7%A4%D7%99%D7%AA_%D7%9C%D7%91%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Sanderling_Dan_Pancamo.jpg","page_title":"חופית לבנה","context_page_description":"חופית לבנה היא מין של עוף מהסוג חופית ממשפחת החרטומניים."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D9%85%D9%84%DB%8C%D8%A7%D8%AA_%D8%A7%D9%86%D8%AA%D8%B1%D9%88%D9%BE%D9%88%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Val%C4%8D%C3%ADk_za_100_000_K%C4%8D.jpg","page_title":"عملیات انتروپوید","context_page_description":"عملیات انتروپوید یک اسم رمزی برای ترور اوبرگروپنفورر راینهارد هایدریش بود. این عملیات در ۲۷ می ۱۹۴۲ بعد از آمادگی مدیر عملیات ویژه بریتانیا و تأیید حکومت تبعیدی چکسلواکی، در پراگ انجام شد. اگرچه طی این ماجرا، هایدریش تنها مجروح شد اما در ۴ ژوئن ۱۹۴۲ دراثر همین جراحات درگذشت. مرگ او موجب شد گروهان نظامی آلمان دست به انتقام‌های بی رحمانه‌ای بزنند. آن‌ها روستاهای متعددی را نابود کردند و شهروندان زیادی را کشتند.\\nهایدریش در پیشرفت آدولف هیتلر، به عنوان فردی مقتدر، نقش مهمی داشت. او مسئول راه حل نهایی و هولوکاست یهودی‌ها در اروپا بود. با وجود خطرات این عملیات، هدف اصلی انتروپوید برای چک، رایزنی قانونی حکومت تبعیدی ادوارد بنش در لندن بود."},{"page_url":"https://en.wikipedia.org/wiki/Arbal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Sekha_d%27Arzew.jpg","page_title":"Arbal","context_page_description":"Arbal also known as Domaine d'Arbal, is a village in Oran Province, Algeria, North Africa.\\nArbal is 167 m above sea level and 26 km south of Oran, on the southern side of the Sebkha d'Oran lakes. Arbal has been tentatively identified as the location of the ancient Roman town of Regiae."},{"page_url":"https://de.wikipedia.org/wiki/Eixen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Wappen_der_Gemeinde_Eixen.jpg","page_title":"Eixen","context_page_description":"Eixen ist eine Gemeinde im Landkreis Vorpommern-Rügen. Die Gemeinde liegt südöstlich von Ribnitz-Damgarten. Seit dem 13. Februar 2004 gehört die Gemeinde zum Amt Recknitz-Trebeltal mit Sitz in der Stadt Tribsees."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%B4%D0%B5%D0%B2%D0%B8%D1%87%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Novodevichy_Convent_model.jpg","page_title":"Новодевичий монастыры","context_page_description":"Новодевичий Богородица-Смоленск монастыры — православие ҡатын-ҡыҙҙар монастыры. Мәскәүҙә, Девичье полела. Мәскәү-йылғаһы бөгөлөндә, Лужники янында, тарихи Пречистенканың иң аҙағында урынлашҡан.\\nНигеҙ Бөйөк кенәз Василий III тарафынан 1524 йылда нигеҙ һалынған — Смоленск ҡалаһының Смоленская икона Божьей Матери «Одигитрия» хөрмәтенә һалынған һәм Смоленскиҙы дошман ҡулынан азат итеүгә бағышланған. Ике быуат буйына батша ҡатын-ҡыҙҙарының тотҡонлоҡта торған урыны булып хеҙмәт иткән.\\nМонастырҙың архитектура ансамбле ХVI—ХVII быуаттарҙа барлыҡҡа килә һәм бер ниндәй ҙә үҙгәрештәр кисермәй. Мәскәү бароккоһы өлгөһө булараҡ ЮНЕСКО һағы аҫтына ҡуйылған һәм Бөтә донъя мираҫы тип иҫәпләнә.\\nЭш алып барыусы монастырь Урыҫ православие сиркәүе һәм Дәүләт тарихи музейы ҡарамағында. 2010 йылдан алып бында Мәскәү епархияһының сиркәү музейы эшләй.\\nМонастырҙа Крутицкий һәм Коломенский митрополиты Ювеналийҙың резиденцияһы, 1977 йылдан алып ул Мәскәү өлкә епархияһы менән идаралыҡ итә."},{"page_url":"https://no.wikipedia.org/wiki/Norges_skoger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Svarttjernsh%C3%B8gda.jpg","page_title":"Norges skoger","context_page_description":"Norges skoger kan grovt deles i to. På Sør-Østlandet, i Agder og på gode lokaliteter et stykke nordover på Vestlandet finner vi den varmekjære lauvskogen, som er den nordligste utløperen av de europeiske tempererte lauvskogene. I resten av landet opp til skoggrensa finner vi barskogen, som er den vestligste utløperen av de store boreale barskogene i nordlige Eurasia. Over barskoggrensa dominerer fjellbjørk.\\nSkogen dekker 37 % av Norges areal, og ca. halvparten av dette regnes som produktiv skog. Urørt urskog finnes knapt i Norge i dag, men flekkvis finnes skog som er lite påvirka av menneskelige inngrep, helst gammelskog, men også noen mindre lommer med urskog. Det er anslått at skogen huser halvparten av de ca. 60 000 artene av planter og dyr i Norge.\\nI den varmekjære lauvskogen dannes normalt brunjordprofil, mens podsolprofil er det vanlige i barskogen.\\nFordelingen mellom de ulike hovedgruppene av skog i Norge er slik:"},{"page_url":"https://nl.wikipedia.org/wiki/Vlag_van_Oekra%C3%AFne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Naval_Ensign_of_Ukraine_1918_July.png","page_title":"Vlag van Oekraïne","context_page_description":"De vlag van Oekraïne bestaat uit twee horizontale banen, een gele en een blauwe. Oekraïne is eeuwenlang een onderdeel van Rusland en in mindere mate Oostenrijk-Hongarije geweest, maar voerde/voert zowel in de korte periode van onafhankelijkheid tussen 1918 en 1919 als sinds de in 1991 verkregen hernieuwde zelfstandigheid een blauw-gele vlag."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_kardinal_yang_diangkat_oleh_Benediktus_XVI","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Cardinal_Th%C3%A9odore_Adrien_Sarr_2.JPG","page_title":"Daftar kardinal yang diangkat oleh Benediktus XVI","context_page_description":"Paus Benediktus XVI mengangkat 90 kardinal dalam lima konsistori."},{"page_url":"https://tr.wikipedia.org/wiki/T1_(Espor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/SK_Telecom_T1_at_LoL_World_Championship_2013.jpg","page_title":"T1 (Espor)","context_page_description":"T1 eski adıyla SK Telecom T1 veya SKT T1 Güney Kore tabanlı e-spor takımıdır. Telekomünikasyon şirketi SK Telecom, takımın %54 hisselerini elinde bulundurmaktadır. 2003 yılının sonunda SK Telecom, Lim Yo-Hwan aracılığıyla Team Orion (daha önceki ismi 4U) ile anlaştı ve SK Telecom ismini alan ilk takım oldu. Lim Yo-Hwan takım kaptanı rolünü üstlendi. T1, SK sports'un bir parçasıdır ve buna Incheon'da bulunan SK Wyverns isimli beyzbol takımı, Seoul'da bulunan basketbol takımı SK Knights ve olimpiyat şampiyonu Park Tae-Hwan dahildir. Spor malzemeleri üreten Nike, fast-food restoranı Kraze ve eczacılık ile uğraşan şirketler Dong-A ve Otsuka'da takımın diğer sponsorlarıdır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Reichraming","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Reichraming_Forstmuseum_Museumsweg_9_%2801%29.JPG","page_title":"Liste der denkmalgeschützten Objekte in Reichraming","context_page_description":"Die Liste der denkmalgeschützten Objekte in Reichraming enthält die 13 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Reichraming im oberösterreichischen Bezirk Steyr-Land."},{"page_url":"https://pl.wikipedia.org/wiki/Ludford_(Shropshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/A_splendid_view_from_Ludford_Churchyard_-_geograph.org.uk_-_1465967.jpg","page_title":"Ludford (Shropshire)","context_page_description":"Ludford – wieś w Anglii, w hrabstwie Shropshire. Leży 39 km na południe od miasta Shrewsbury i 202 km na północny zachód od Londynu."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%88%D8%B1%D9%8A%D8%B3%D8%AA%D9%8A_%D8%A8%D9%8A%D9%86%D8%A7%D8%AA%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Oreste_Benatti.jpg","page_title":"اوريستي بيناتي","context_page_description":"اوريستي بيناتي لاعب كرة قدم إيطالي في مركز خط الوسط المتقدم، وعادة ما كان جناحا ايسر، مع استطاعته أيضا على اللعب كمهاجم. كان معروفا على وجه الخصوص لسرعته، ودقة حركته الهجومية، قدم سريعة، كما تميز بمهارات المراوغة."},{"page_url":"https://ceb.wikipedia.org/wiki/Belhavel_Lough","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Belhavel_Lough.JPG","page_title":"Belhavel Lough","context_page_description":"Lanaw ang Belhavel Lough sa Irland. Nahimutang ni sa kondado sa County Leitrim ug lalawigan sa Connaught, sa amihanang bahin sa nasod, 160 km sa amihanan-kasadpan sa Dublin ang ulohan sa nasod. 75 metros ibabaw sa dagat kahaboga ang nahimutangan sa Belhavel Lough. Ang kinahabogang dapit sa palibot dunay gihabogon nga 391 ka metro ug 4.4 km sa amihanan-sidlakan sa Belhavel Lough. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Belhavel Lough.\\nAng klima kasarangan. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 12 °C, ug ang kinabugnawan Enero, sa -2 °C."},{"page_url":"https://en.wikipedia.org/wiki/Safia_Nolin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Louve%2C_Montreal_2017-06-18_-_264.jpg","page_title":"Safia Nolin","context_page_description":"Safia Nolin is a French Canadian folk-pop singer-songwriter from Quebec City, Quebec.\\nHer debut album Limoilou was released in 2015 via Bonsound. Modestly successful at first, her album sales increased significantly in 2016 after she appeared on Tout le monde en parle, opening up about her teenage struggles with anxiety and bullying. She has toured France as an opening act for Lou Doillon, and Quebec as an opening act for Louis-Jean Cormier.\\nIn June 2016, she won the Prix Félix-Leclerc at the FrancoFolies de Montréal. Her song \\"Igloo\\" was shortlisted for the 2016 SOCAN Songwriting Prize, and Limoilou was named a longlisted nominee for the 2016 Polaris Music Prize.\\nHer second album, Dans le noir, was released in 2018.\\nShe is out as lesbian. She dated the French singer Pomme.\\nIn 2019 she released the EP xX3m0 $0ng$ 2 $​!​nG @L0nG 2Xx. It included a duet with John K. Samson, on a cover of Taking Back Sunday's \\"Cute Without the E\\".\\nIn 2020 she coordinated Saint-Jeanne, an LGBTQ-inclusive Saint-Jean-Baptiste Day livestream scheduled for June 24."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_da_Bahia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Bandeira_de_Jeremoabo.jpg","page_title":"Lista de municípios da Bahia","context_page_description":"Esta lista de municípios da Bahia está organizada alfabeticamente. Ao todo, estão listados os 417 municípios da Bahia, o estado brasileiro com o quarto maior número deles. Os municípios baianos representam quase 7,5% dos 5 570 municípios em todo território nacional. Diversos em muitos termos, os municípios são a unidade político-administrativa do país por estarem mais próximos ao cotidiano das pessoas. Dentre eles, o município de Salvador é capital estadual da Bahia, entretanto, a sede do governo estadual é temporariamente transferida todo 25 de junho para o município de Cachoeira, desde 2007. E para além dos símbolos nacionais e estaduais, todos os municípios podem também ter símbolos próprios, o que inclui as bandeiras e brasões de armas.\\nNo Brasil, desde a constituição de 1988, os municípios são um dos entes autônomos da federação brasileira. A Constituição do Estado da Bahia de 1989 os definiu como \\"unidades político-administrativas autônomas\\" em que o estado está dividido e \\"unidades integrantes da República Federativa do Brasil, dotadas de autonomia política, administrativa e financeira\\"."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BD%D1%83%D0%B4%D0%B0_%D0%B8_%D0%BF%D0%BE%D0%B1%D0%B0%D1%80%D1%83%D0%B2%D0%B0%D1%87%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Supply-and-demand_mk.svg","page_title":"Понуда и побарувачка","context_page_description":"Понуда и побарувачка — економски поими кои ги опишуваат пазарните врски меѓу продавачите и купувачите на добро или услуга. Моделот на понудата и побарувачката ја одредува количината и цената продадена на пазарот. Овој модел е фундаментален микроекономски модел и служи како основа за други економски модели и теории. Моделот предвидува, дека во конкурентен пазар цената ќе работи на изедначување на побаруваната количина од страна на купувачите со понудената од страна на производителите, резултирајќи со пазарна рамнотежа на количината и цената. Моделот покрај цената ги вклучува и другите фактори кои влијаат на воспоставувањето на пазарната рамнотежа, опишувајќи го нивното влијание како поместувања на понудата и побарувачката."},{"page_url":"https://de.wikipedia.org/wiki/Christi_Krybbe_skoler","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Christi_Krybbe_skoler_2019.jpg","page_title":"Christi Krybbe skoler","context_page_description":"Die Christi Krybbe skoler ist eine Schule in der norwegischen Stadt Bergen. Sie ist die älteste noch bestehende Grundschule Nordeuropas."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%81%AC%EB%A6%AC%EC%8A%A4%ED%86%A0%ED%8D%BC_%EC%97%90%ED%81%B4%EC%8A%A4%ED%84%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Christopher_Eccleston_London.jpg","page_title":"크리스토퍼 에클스턴","context_page_description":"크리스토퍼 에클스턴은 잉글랜드의 연극, 영화, 텔레비전 배우이다. 그는 그의 수많은 텔레비전 연기 활동, 그 중에서도 특히 '닥터 후'의 9대 닥터 역으로 잘 알려져 있다. 또한 그는 렛 힘 헤브 잇, 쉘로우 그레이브, 엘리자베스, 28일 후, 식스티 세컨즈, 디 아더스, 지아이조: 더 라이즈 오브 코브라, 토르: 다크 월드 등의 무대와 영화에 출연한 적이 있다."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%A7%91%E6%9E%97%E5%BE%B7%E7%9B%AE%E9%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/NGC_5822.png","page_title":"科林德目錄","context_page_description":"科林德目录是瑞典天文学家佩尔·科林德收录471个疏散星团的目录。这本目录于1931年出版，是科林德论文《疏散星团的结构特性及其在空间的分布》中的附录。目录中的物件用\\"Collinder\\"标示，例如\\"Collinder 399\\"。数值序号的前置码包括Col + 目录序号，或Cr +目录序号，例如\\"Cr 399\\"。"},{"page_url":"https://de.wikipedia.org/wiki/Husen_(Lichtenau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Husen_Kath.Kirche_St.Magdalena.jpg","page_title":"Husen (Lichtenau)","context_page_description":"Husen ist ein Stadtteil von Lichtenau in Nordrhein-Westfalen, Deutschland, und gehört zum Kreis Paderborn. Es ist Teil der Region Bürener Land.\\nDie alte Postleitzahl von Husen ist 4791."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%AD%E5%A4%AE%E9%98%B2%E7%8A%AF%E3%82%B5%E3%83%83%E3%82%AB%E3%83%BC%E9%83%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Fujiedashimin.jpg","page_title":"中央防犯サッカー部","context_page_description":"中央防犯サッカー部は、かつて存在した日本のサッカークラブ。中央防犯のサッカー部として1982年に創部され、静岡県藤枝市に本拠地を置いていた。日本プロサッカーリーグ所属のアビスパ福岡の前身となったクラブである。"},{"page_url":"https://ru.wikipedia.org/wiki/(9671)_%D0%93%D0%B5%D0%BC%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/ru/f/ff/%D0%9E%D1%80%D0%B1%D0%B8%D1%82%D0%B0_%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%BE%D0%B8%D0%B4%D0%B0_9671.png","page_title":"(9671) Гемера","context_page_description":"(9671) Гемера — астероид, относящийся к группе астероидов пересекающих орбиту Марса. Он был открыт 5 октября 1997 года чешским астрономом Ленкой Котковой в обсерватории Ондржеёв и назван в честь древнегреческой богини света Гемеры."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D1%85_%D0%B2_1051_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Amedeo_I_di_Savoia.jpg","page_title":"Список умерших в 1051 году","context_page_description":"В этой статье представлен список известных людей, умерших в 1051 году.\\nСм. также: Категория:Умершие в 1051 году"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AF%D1%88%D0%B8%D0%BC%D0%B0_%D0%93%D0%B0%D0%BA%D1%83%D1%82%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/MET_DP143406.jpg","page_title":"Яшима Гакутей","context_page_description":"Яшима Ґакутей — японський майстер гравюр укійо-е та поет першої половини ХІХ століття."},{"page_url":"https://af.wikipedia.org/wiki/Biblioteek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Zel_prrrr_joo_j%C3%BC%C3%BC_joo_korr_rrg_haaaa.jpg","page_title":"Biblioteek","context_page_description":"'n Biblioteek is 'n georganiseerde versameling van inligtingshulpbronne, wat toeganklik gemaak word aan 'n vasgestelde gemeenskap vir verwysing of uitleen. Dit bied fisiese of digitale toegang tot materiaal, en kan in 'n fisiese gebou of kamer, òf 'n virtuele ruimte, òf albei wees.\\n'n Biblioteek se versameling items kan boeke, tydskrifte, koerante, manuskripte, films, kaarte, afdrukke en dokumente insluit. Mikrofilm, CD's, klankkassette, videobande, DVD's, Blu-ray-skywe, e-boeke, oudioboeke, databasisse en ander formate kan ook hier gestoor word.\\nBiblioteke kan wissel in grootte van 'n paar rakke met boeke, tot 'n paar miljoen items. In Latyn en Grieks, is die begrip van 'n boekrak verteenwoordig deur Bibliotheca en Bibliothēkē. Afgeleides van hierdie woord beteken biblioteek in meeste moderne tale, bv die Franse bibliothèque."},{"page_url":"https://simple.wikipedia.org/wiki/Bad_Hindelang","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/PestkapelleHindelang.jpg","page_title":"Bad Hindelang","context_page_description":"Bad Hindelang is a municipality in the district of Oberallgäu in Bavaria in Germany. From 2008 it has a population of 4,915. It is known for its sulphur springs and pure mountain air. Today the municipality is a health resort. It is 825 metres above sea level."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_femmes_mentionn%C3%A9es_sur_The_Dinner_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Mary_Wollstonecraft_by_John_Opie_%28c._1797%29.jpg","page_title":"Liste des femmes mentionnées sur The Dinner Party","context_page_description":"Cette liste recense les femmes mentionnées sur The Dinner Party, une installation artistique de Judy Chicago.\\nThe Dinner Party, réalisée entre 1974 et 1979, comprend les noms de 1 038 personnalités féminines mythiques ou historiques. Trente-neuf de ces noms sont brodés sur un set de table, installé sur une table triangulaire, divisée en trois ailes. Les 999 autres noms sont inscrits sur le socle de l'œuvre."},{"page_url":"https://ca.wikipedia.org/wiki/Guerra_italiana_del_1521-1526","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Battle_of_Pavia.jpg","page_title":"Guerra italiana del 1521-1526","context_page_description":"La Guerra italiana del 1521–1526, també coneguda com a Guerra dels Quatre Anys, forma part de les Guerres d'Itàlia. El conflicte es desenvolupà entre el 1521 i el 1526 i hi lluitaren Francesc I de França i la República de Venècia contra l'emperador del Sacre Imperi Romanogermànic Carles V, Enric VIII d'Anglaterra i els Estats Pontificis. Entre les causes del conflicte hi ha l'elecció el 1519–1520 de Carles I com a emperador del Sacre Imperi Romanogermànic i la necessitat del papa Lleó X d'aliar-se amb Carles per combatre Martí Luter.\\nLa guerra esclatà a l'Europa occidental el 1521, quan França envaí els Països Baixos i intentà ajudar Enric II de Navarra a recuperar el seu regne. Les forces imperials repel·liren la invasió i atacaren el nord de França, on els francesos aturaren la seva avançada. Aleshores, l'emperador, el papa i Enric VIII signaren una aliança formal contra França i les hostilitats començaren a la península Itàlica. A la batalla de Bicocca, els exèrcits imperial i papal derrotaren l'exèrcit francès i l'expulsaren del Milanesat. Després de la batalla, la lluita tornà al territori francès, mentre que Venècia signava la pau per separat."},{"page_url":"https://es.wikipedia.org/wiki/Cora_(divisi%C3%B3n_territorial)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Coras_del_Emirato_de_C%C3%B3rdoba.svg","page_title":"Cora (división territorial)","context_page_description":"La cora era una de las demarcaciones territoriales en que estaba dividida al-Ándalus, ​ la antigua península ibérica islámica, durante el emirato y el califato de Córdoba. Coexistía con otra demarcación territorial denominada Marca, que se superponía a las coras en las zonas fronterizas con los reinos cristianos. Ambas constituían la organización territorial andalusí.\\nSegún el diccionario de la RAE, la palabra cora proviene del árabe kūrah, y esta del griego χῶρα, con el significado de territorio."},{"page_url":"https://en.wikipedia.org/wiki/Jean-Baptiste_Alexandre_Le_Blond","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Standard_design_of_Saint_Peterburg_buildings.jpg","page_title":"Jean-Baptiste Alexandre Le Blond","context_page_description":"Jean-Baptiste Alexandre Le Blond was a French architect and garden designer who became the chief architect of Saint Petersburg in 1716."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD_(%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D0%B5%D0%B7%D1%8C%D0%BA%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Coat_of_Arms_of_Petropavlovsky_rayon_%28Voronezh_oblast%29.png","page_title":"Петропавловський район (Воронезька область)","context_page_description":"Петропавлівський район — адміністративна одиниця на південному сході Воронезької області Росії.\\nАдміністративний центр — село Петропавловка."},{"page_url":"https://es.wikipedia.org/wiki/Archieparqu%C3%ADa_de_Le%C3%B3polis_de_los_armenios","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/DionizyKajetanowicz.jpg","page_title":"Archieparquía de Leópolis de los armenios","context_page_description":"La archieparquía de Leópolis de los armenios es una sede episcopal de la Iglesia católica perteneciente a la Iglesia católica armenia en Ucrania, inmediatamente sujeta a la Santa Sede. La archieparquía permanece vacante desde 1938 y no ha sido reactivada luego de la independencia de Ucrania en 1991.\\nEn el Anuario Pontificio la Santa Sede usa el nombre Lviv degli Armeni y su nombre formal es en latín, Leopolitan Armenorum. En el sitio web del patriarcado de Cilicia el nombre utilizado es en armenio, Ուկրաինա.\\nEl Anuario Pontificio dice que la eparquía fue creada en el siglo XIV y que tuvo obispos católicos desde 1630."},{"page_url":"https://it.wikipedia.org/wiki/Gabriel_Revel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Girardon_par_Gabriel_Revel_-_1683.JPG","page_title":"Gabriel Revel","context_page_description":"Gabriel Revel è stato un pittore francese."},{"page_url":"https://ms.wikipedia.org/wiki/Pilihan_raya_umum_United_Kingdom_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/2019UKElectionMap.svg","page_title":"Pilihan raya umum United Kingdom 2019","context_page_description":"Pilihan raya umum United Kingdom 2019 telah diadakan pada Khamis, 12 Disember 2019 di bawah peruntukan Akta Pilihan Raya Umum Parlimen Awal 2019, dan mengambil tempat dua tahun selepas pilihan raya umum sebelumnya pada Jun 2017. Pilihan raya telah dicetuskan sebagai respon kepada kebuntuan parlimen terhadap Brexit. Berikutan pelantikan Boris Johnson sebagai pemimpin parti kerajaan Konservatif dan Perdana Menteri, terdapat pertentangan pendapat di Parlimen, bimbang Johnson akan menukar pendapat perjanjian Brexit. Keputusan pilihan raya menunjukkan Konservatif mendapat semula majoriti mereka di Dewan Rakyat selepas tewas pada 2017, manakala Parti Buruh mengalami kekalahan besar, memenangi bilangan kerusi paling sedikit sejak pilihan raya 1935.\\nTujuan Johnson untuk mengadakan pilihan raya awal adalah untuk melindungi majoriti untuk menyambung proses United Kingdom meninggalkan Kesatuan Eropah dengan tarikh tamat Brexit pada 31 Januari 2020. Konservatif memerlukan penambahan sekurang-kurangnya 9 kerusi berbanding keputusan pada 2017 untuk mencapai ini."},{"page_url":"https://de.wikipedia.org/wiki/Kreenholmi_Manufaktuur","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Kreenholmi_Manufaktuuri_asutajad%2C_1857.jpg","page_title":"Kreenholmi Manufaktuur","context_page_description":"Die Kreenholmi Manufaktuur ist eine estnische Textilfabrik in Narva. Sie wurde von einer Gruppe Industrieller um den Bremer Kaufmann Ludwig Knoop 1857 begründet. Die Baumwollspinnerei und die Tuchwebereien waren vor dem Ersten Weltkrieg die bedeutendste russische Textilfabrik und zählten zu den größten der Welt. Einem beinahe vollständigen Rückgang der Geschäftstätigkeit nach 1919 folgte die Verstaatlichung der Firma nach der Besetzung Estlands durch die Sowjetunion 1944 und eine zweite Blüte als volkseigener Betrieb. Nach der Wiedererlangung der Unabhängigkeit wurde die Firma 1994 wieder privatisiert. 2010 ging sie in Konkurs; unter einem neuen Eigner wird in sehr beschränktem Umfang aber weiterhin produziert."},{"page_url":"https://en.wikipedia.org/wiki/Garmon","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Garmon_Khromka.jpg","page_title":"Garmon","context_page_description":"The garmon is a kind of Russian button accordion, a free-reed wind instrument. A garmon has two rows of buttons on the right side, which play the notes of a diatonic scale, and at least two rows of buttons on the left side, which play the primary chords in the key of the instrument as well as its relative harmonic minor key. Many instruments have additional right-hand buttons with useful accidental notes, additional left-hand chords for playing in related keys, and a row of free-bass buttons, to facilitate playing of bass melodies.\\nThe garmons can be of two major classes: unisonoric, meaning that each button plays the same note or chord when the bellows is being expanded as it does when compressed, and bisonoric, in which the note depends on the direction of the bellowswork. Examples of unisonoric type are livenka and Khromka. Bisonoric garmons are, e.g., Tula accordion and talyanka\\nBeside Russian folk music, the garmon is an important musical instrument for Caucasian and Mari folk in Volga and Ural regions. It's also used in popular music.\\nKnown also as the Harmonika it is very popular in Slovenia."},{"page_url":"https://uk.wikipedia.org/wiki/Acharagma_aguirreana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Acharagma_aguirreana_1.jpg","page_title":"Acharagma aguirreana","context_page_description":"Acharagma aguirreana — сукулентна рослина з роду Acharagma родини кактусових."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%82%D0%BE%D1%85%D0%B8%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Flag_of_Kotohira_Kagawa.JPG","page_title":"Котохира","context_page_description":"Котохира — посёлок в Японии, находящийся в уезде Накатадо префектуры Кагава. Площадь посёлка составляет 8,46 км², население — 9384 человека, плотность населения — 1109,22 чел./км²."},{"page_url":"https://pt.wikipedia.org/wiki/C%C4%83p%C3%A2lni%C8%9Ba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Kapolnasfalu.jpg","page_title":"Căpâlnița","context_page_description":"Căpâlnița é uma comuna romena localizada no distrito de Harghita, na região histórica da Transilvânia. A comuna possui uma área de 26.50 km² e sua população era de 2014 habitantes segundo o censo de 2007."},{"page_url":"https://en.wikipedia.org/wiki/Newcastle_upon_Tyne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Haymarket_bus_terminal.jpg","page_title":"Newcastle upon Tyne","context_page_description":"Newcastle upon Tyne, often shortened to simply Newcastle, is a city in Tyne and Wear, England. Located on the northern bank of the River Tyne, it is 8.5 mi from the North Sea. Newcastle is the most populous city in North East England and forms the core of the Tyneside conurbation, the eighth most populous urban area in the United Kingdom. It is a member of the UK Core Cities Group, as well as the Eurocities network of European cities. It was part of the county of Northumberland until 1400, when it became a county of itself, a status it retained until becoming part of Tyne and Wear in 1974.\\nThe regional nickname and dialect for people from Newcastle and the surrounding area is Geordie. Newcastle has two universities: Newcastle University, a member of the Russell Group, and Northumbria University. It is a member of the North of Tyne Combined Authority. The city developed around the Roman settlement Pons Aelius and was named after the castle built in 1080 by William the Conqueror's eldest son Robert Curthose. In the 14th century, the city grew as an important centre for the wool trade and later became a major coal mining area."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D9%88%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D8%B3%D9%84%D8%AD%D8%A9_%D8%A7%D9%84%D8%B9%D8%B1%D8%A7%D9%82%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Mi-171_advisor_pilots_provide_training_-_day_or_night_DVIDS379824.jpg","page_title":"القوات المسلحة العراقية","context_page_description":"القوات المسلحة العراقية هي القوات المسلحة النظامية لجمهورية العراق، وتنقسم إلى خمسة أفرع رئيسية، القوة البرية، والقوة الجوية، والقوة البحرية، وطيران الجيش، والدفاع الجوي،اضافة إلى أفرع اخرى،جهاز مكافحة الارهاب،الحشد الشعبي. تخضع جميع أفرع القوات المسلحة العراقية لسلطة وزارة الدفاع العراقية ويرأسها وزير الدفاع جمعة عناد الجبوري. جهاز مكافحة الارهاب، الحشد الشعبي تتبع، رئاسة الوزراء القائد العام للقوات المسلحة هو رئيس الوزراء العراقي، والذي يشغل المنصب حالياً [مصطفى الكاظمي ]]، ويقوم رئيس الجمهورية بمهمة القيادة العليا للقوات المسلحة للأغراض التشريفية والاحتفالية. أما رئيس أركان الجيش فهو الفريق الأول الركن عثمان الغانمي.\\nتاريخ العسكرية في العراق ضارب في القِدم، حيث ظهر أول جيش نظامي في الأرض التي تشكل العراق المعاصر خلال القرن التاسع قبل الميلاد. وعلى مدى عدة قرون ظهرت في العراق عدة جيوش اختلفت باختلاف الحضارة التي نمت في كنفها، بدءاً من العصر الآشوري ومروراً بالعصر الأكدي والبابلي والإسلامي وحتى العصر الحديث."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%90%D7%9C%D7%A8%D7%99_%D7%96%27%D7%99%D7%A1%D7%A7%D7%A8_%D7%93%27%D7%90%D7%A1%D7%98%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Val%C3%A9ry_Giscard_d%E2%80%99Estaing_1978.jpg","page_title":"ואלרי ז'יסקר ד'אסטן","context_page_description":"ואלרי ז'יסקר ד'אסטן, הוא פוליטיקאי צרפתי מימין-מרכז המפה הפוליטית, הנשיא השלישי של הרפובליקה הצרפתית החמישית בין ה-27 במאי 1974 ועד ל-21 במאי 1981. בשנת 2003 נבחר לכהן כחבר באקדמיה הצרפתית.\\nתקופת נשיאותו התאפיינה בגישה ליבראלית יותר לנושאים חברתיים – כגון גרושין, מניעת הריון והפלות – ובנוגע לניסיונות לערוך מודרניזציה לצרפת ולמוסד הנשיאות, בעיקר בחניכת מפעלי תשתית רחבי היקף כגון רשת רכבות ה-TGV המהירות והמעבר לשימוש באנרגיה גרעינית כמקור האנרגיה העיקרי של צרפת. יחד עם זאת, הפופולריות שלו נפגמה כתוצאה מהשפל הכלכלי שבא בעקבות משבר האנרגיה העולמי בשנת 1973, שסימן את סופן של \\"שלושים שנות התהילה\\" של צרפת לאחר מלחמת העולם השנייה. בנוסף, ז'סקר עמד בפני התנגדות פוליטית משני צידי הספקטרום הפוליטי: פרנסואה מיטראן מהצד השמאלי שאוחד מחדש, וז'אק שיראק, ששיקם את המחנה הגוליסטי וקרנו עלתה באגף הימני. כל אלו, יחד עם יחסי ציבור גרועים, העצימו את חוסר הפופולריות שלו לקראת סוף כהונתו, והוא כשל בניסיונו להיבחר מחדש בשנת 1981.\\nז'יסקר תמך בפדרציה אירופית, ולאחר שהגביל את מעורבותו בפוליטיקה הלאומית עם תבוסתו בבחירות, הפך מעורב באיחוד האירופי."},{"page_url":"https://en.wikipedia.org/wiki/Oonagh_(singer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Oonagh_%28Freiburg%29_jm88110.jpg","page_title":"Oonagh (singer)","context_page_description":"Senta-Sofia Delliponti is a German singer, songwriter and actress. Since January 2014, she uses the stage name Oonagh. Her signature musical style is inspired by the mystical lore of J. R. R. Tolkien's universe and by ethnic sounds throughout the world.\\nShe had her breakthrough in Star Search, a television talent show. She released a Christmas album with TV Allstars in 2003.\\nIn 2015, she was a guest singer on the Celtic Woman album Celtic Woman: Destiny. She sang the theme song to Big Brother in Germany in 2007."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B1%D0%BE%D0%B9%D1%88%D0%B0_%D0%9A%D0%BE%D1%81%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Neboj%C5%A1a_Kosovi%C4%87%2C_Czech_Rp.-Montenegro_EURO_2020_QR_10-06-2019_%283%29.jpg","page_title":"Небойша Косович","context_page_description":"Небойша Косович — чорногорський футболіст, півзахисник клубу «Партизан».\\nВиступав, зокрема, за клуб «Воєводина», а також національну збірну Чорногорії."},{"page_url":"https://de.wikipedia.org/wiki/Uje%C5%9Bcisko-%C5%81ostowice","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Gda%C5%84sk_Stare_Uje%C5%9Bcisko.jpg","page_title":"Ujeścisko-Łostowice","context_page_description":"Ujeścisko-Łostowice ist ein Stadtbezirk von Gdańsk in Polen, dieser umfasst eine Fläche von 7,8 km² und zählt 23849 Einwohner mit einer Bevölkerungsdichte von 3060 Einwohnern/km². Das Gebiet kam 1973 administrativ zur Stadt Danzig. Die Einwohnerzahl ist in den letzten sechs Jahren um über 6000 Personen gestiegen."},{"page_url":"https://tr.wikipedia.org/wiki/Amerika_A%C3%A7%C4%B1k_tek_kad%C4%B1nlar_%C5%9Fampiyonlar%C4%B1_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Steffi_Graf_08.jpg","page_title":"Amerika Açık tek kadınlar şampiyonları listesi","context_page_description":"Amerika Açık Tek Kadınlar Şampiyonları Listesi, Amerika Açık tenis turnuvasının Tek Kadınlar şampiyonlarını ve ikincilerini göstermektedir."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%86%D9%86%D8%A7%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Anna-university.jpg","page_title":"چنای","context_page_description":"چِنای کلان‌شهری در کشور هند است. این شهر در واقع مرکز یا پایتخت ایالت تامیل نادو است. چنای جزو مناطق شهری پرجمعیت هند به‌شمار می‌آید و دارای رتبه چهارم در این کشور است. این منطقه در ساحل کوروماندل در خلیج بنگال واقع شده و کل جمعیت آن در حدود ۴٫۳۴ میلیون نفر ارزیابی شده‌است.\\nاین شهر ۳۶۸ سال قدمت داشته و ۳۴اُمین شهر بزرگ دنیا از لحاظ جمعیتی و مساحتی است.\\nچنای همچنین مرکز صنعتی و بازرگانی بزرگی است و بخاطر میراث فرهنگی‌اش و معماری معابدش شناخته شده‌است. این منطقه همچنین کانون فعّالیت موسیقی کلاسیک هند و اجرای رقص است.\\nچنای همچنین به عنوان مرکز و پایتخت اتومبیل‌سازی هند در نظر گرفته می‌شود. صنایع اتومبیل‌سازی در این شهر پایگاههای زیادی داشته و قسمت اصلی وسایل نقلیه هند در این شهر تولید می‌شود. این امر منجر به این شده که چنای موسوم به دیترویت جنوب آسیا شود. این منطقه همچنین تبدیل به مرکز اصلی کاریابی از غرب شده. ساحل مارنیا به طول ۱۲ کیلومتر، ساحل شرقی شهر را تشکیل داده و در واقع یکی از بزرگترین سواحل دنیا است. این شهر همچنین بخاطر رویدادهای ورزشی و میزبانی رقابت‌های مهم شناخته شده، از جمله مسابقات تنیس آزاد چنای. اتحادیه تنیس حرفه‌ای نیز در این شهر قرار دارد.\\nچنای همچنین یکی از نادرترین شهرها از بابت میزبانی از پارک‌های ملی از جمله پارک ملی گوئیندی در طول محدوده شهر به‌شمار می‌رود."},{"page_url":"https://es.wikipedia.org/wiki/Nacho_Guerreros","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nacho-Guerreros-bn.jpg","page_title":"Nacho Guerreros","context_page_description":"Ignacio Guerreros García, conocido como Nacho Guerreros, es un actor español, conocido principalmente por sus personajes en las series de televisión Aquí no hay quien viva y La que se avecina."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%84%D8%AF_%D8%A7%D9%84%D9%85%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Platypus-plate.jpg","page_title":"خلد الماء","context_page_description":"خُلْدُ المَاءِ أو خُلْدُ المَاءِ بَطِّيِّ المِنقَارِ أو الپلَاتِيپُوسُ أو مِنقَارُ البَطَّة هو ثدييٌّ نصف مائي بيُوض، يستوطن تسمانيا والسَّواحل الشرقيَّة من أُستُراليا على مقربةٍ من الأنهار والبُحيرات. تُعتبرُ مناجذ الماء إحدى الأنواع الخمسة الباقية من رُتبة وحيدة المسلك، أمَّا الأُخرى فهي الأنواعُ الأربعة من النضناض. ووحيداتُ المسلك هي الثديَّيات الوحيدة البُيُوضة، أي التي تضعُ بيضًا يفقسُ منه صغارها عوض أن تلدها حيَّة كسائر الثديَّيات. وخُلدُ الماء هو المُمثل الوحيد الباقي من فصيلة بطيَّة المنقار وجنس خُلدُ الماء، على أنَّ عددًا كبيرًا من الأنواع القريبة منه اكتُشفت بقاياها المُتحجِّرة في سجل المُستحاثات بين طبقات الأرض. أولى العيِّنات من هذه الكائنات، التي وصلت أوروپَّا سنة 1799م، اعتقد العُلماء أنَّها مُزيَّفة، وأنَّ أحدهم جمع بضعة أجزاءٍ من حيواناتٍ مُختلفةٍ وخيَّطها بِبعضها حتَّى ظهرت على هذا الشكل، إلى أن تفحَّصوها عن قُرب فظهر أنها حقيقيَّة.\\nحيَّرت هذه الكائنات العُلماء الأوروپيين فترةً من الوقت بعد اكتشافها، فكانت - في نظرهم - عبارة عن خليطٍ عجيبٍ من الكائنات: فهي من الثديَّيات لكنها تضع البيض كالطُيُور، ولها منقارٌ كمنقار البط، وذيلٌ كذيل القُندُس، وقوائم مُكففة الأصابع كقوائم القضَّاعات، فاعتبرها البعض حلقةً بين الثديَّيات والزواحف."},{"page_url":"https://de.wikipedia.org/wiki/Alexander_Fritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Fritz_Alexander.jpg","page_title":"Alexander Fritz","context_page_description":"Alexander Fritz war ein starker deutscher Schachspieler."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%9B%BD%E5%90%8D%E4%BA%BA%E5%BD%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Shui_Junshao.jpg","page_title":"中国名人录","context_page_description":"《中國名人錄》，《上海密勒氏評論報》於1918－1950年間系列作，九度更新緊貼時局，圖文並荗介紹中華民國政商大老及專業精英，係研究民國史的重量級外文參考書。系列作並非旨在囊括一切名人，而是儘可能令世界認識中國人。"},{"page_url":"https://en.wikipedia.org/wiki/Hammersmith_Fire_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Old_Fire_Station%2C_Hammersmith_06.JPG","page_title":"Hammersmith Fire Station","context_page_description":"Hammersmith Fire Station is a Grade II listed building at 244 Shepherd's Bush Road, Hammersmith, London W6 7NL.\\nIt was built in 1913 by the architect W. E. Riley.\\nAfter being decommissioned as a fire station in the 2000s, it was a pub called \\"The Old Fire Station\\", and is now a branch of the restaurant chain, Wagamama. It became their 100th restaurant.\\nHammersmith's current fire station is located slightly further to the north in the same street, at 190–192."},{"page_url":"https://jv.wikipedia.org/wiki/F-16_Fighting_Falcon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Dutch_F-16.jpg","page_title":"F-16 Fighting Falcon","context_page_description":"F-16 Fighting Falcon inggih punika jet tempur multi-peran ingkang dipunwedalaken déning General Dynamics, ing Amérikah Sarékat. Montor mabur punika wiwitanipun dipundamel minangka pesawat tempur ringan, lajeng evolusi dados montor mabur tempur ingkang misuwur ing donya. Montor mabur F-16 saged dipunangge ing pundi kemawon misi, kaunggulan punika ingkang damel F-16 sukses ing pasar ekspor, lan sampun dipunangge wonten ing 25 nagari sasanesipun Amérikah Sarékat. Montor mabur punika sampun misuwur sanget ing jagad internasional lan dados proyek montor mabur saking Amérika serikat ingkang paling ageng lan signifikan, kanthi sampun watawis 4000 F-16 sampun dipunwedalaken awit tau 1976. Sapunika montor mabur punika boten diprodhuksi kanggé Angkatan Udara Amérikah Sarékat, nanging namung dipunwedalaken kanggé èkspor kemawon. Fighting Falcon punika pesawat tempur kanthi pinten-pinten inovasi. Inovasi kasebat kados: gelembung kanopi boten mawi bingkai, visibilitas kontrol ingkang dipunrancang supados saé nalikanipun manuver, papan kanggé lenggah juru anggegana ingkang dipunrancang kanthi ukran 30 drajat saéngga saged ngirangi èfèk grafitasi, lan sanèsipun."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_sites_prot%C3%A9g%C3%A9s_de_la_Loz%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/FR12_Peyreleau.jpg","page_title":"Liste des sites protégés de la Lozère","context_page_description":"Cet article recense les sites naturels protégés du département de la Lozère, en France."},{"page_url":"https://es.wikipedia.org/wiki/Playa_Mayabeque","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Desembocadura_de_Rio_en_Playa_Mayaque.jpg","page_title":"Playa Mayabeque","context_page_description":"Geolocalización: 22°40′26.6″N 82°8′48.72″O\\nPlaya Mayabeque es una playa ubicada a 13 kilómetros del centro de Melena del Sur, entre la Playita de Batabanó y Playa el Rosario, al sur de la Provincia de Mayabeque, en Cuba. Sus aguas son de tipo fangosas y sus pobladores le atribuyen alguna que otra propiedad de tipo terapéutica. Además de la playa, se encuentra en ella la desembocadura del Río Mayabeque que la convierte en un atractivo turístico para sus visitantes."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Diwan_Mysore","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Seshadri_Iyer.jpg","page_title":"Daftar Diwan Mysore","context_page_description":"Kerajaan Mysore selalu menjadi pusat tempat kunjungan bagi orang-orang Barat semenjak mereka mengetahui India pada abad ke-17. Maharaja Mysore mendirikan kerajaan tersebut pada 1399 dengan interupsi pada dua dekade akhir abad ke-18. Pada masa pemerintahan Tipu Sultan, konsep Diwan dicanangkan di Kerajaan tersebut, dengan Diwan Purnaiah sebagai Perdana Menteri Kerajaan Mysore pertama, yang merupakan seorang diwan untuk Tipu Sultan, dan setelah akhir zaman Sultan-Sultan, sampai masa pemerintah Yang Mulia Maharaja Mysore Krishnaraja Wadiyar III - raja heroik yang merestorasi kerajaan tersebut setelah sebagian besar wilayah kekuasaan Tipu Sultan direbut oleh Nizam dari Hyderabad, kerajaan Maratha, dan Inggris dalam Perang Inggris-Mysore Ketiga. Kata Dewan artinya Perdana Menteri dari sebuah kerajaan; lebih jelasnya lagi, seorang penasehat kerajaan untuk penguasa monarki.\\nBerikut ini adalah daftar Diwan Kerajaan Mysore dari 1799 sampai 1947. Diwan-diwan paling terkenal adalah: Diwan Purnaiah, Diwan Sir C. V. Rungacharlu, Diwan Sir K. Seshadri Iyer, Diwan Sir P. N. Krishnamurti, Diwan V. P. Madhava Rao, Diwan T. Ananda Rao, Diwan Sir M. Visveswarayya, Diwan M."},{"page_url":"https://no.wikipedia.org/wiki/British_Eagle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Vickers_Viking_1B_G-AIVO_Eagle_Aws_Ringway_07.59_edited-2.jpg","page_title":"British Eagle","context_page_description":"British Eagle International Airlines var et stort britisk uavhengige flyselskap som opererte fra 1948 til det gikk\\ni likvidasjon i 1968. Det opererte ruter og charter på en nasjonale, internasjonale og transatlantiske strekninger gjennom årene."},{"page_url":"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_tranh_gi%C3%A0nh_%C4%91%E1%BB%99c_l%E1%BA%ADp_ch%C3%A2u_M%E1%BB%B9_T%C3%A2y_Ban_Nha","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Spanish_american_independence.PNG","page_title":"Chiến tranh giành độc lập châu Mỹ Tây Ban Nha","context_page_description":"Chiến tranh giành độc lập châu Mỹ Tây Ban Nha là cuộc chiến diễn ra vào thế kỷ 19 tại Đế quốc Tây Ban Nha trên lục địa châu Mỹ sau cuộc xâm lược của Tây Ban Nha bởi Pháp trong Chiến tranh Napoléon. Ban đầu, các khu vực ở Hoa Kỳ phản đối chính sách hạn chế thương mại của nhà vua và trao quyền đặc biệt cho các quan chức sinh ra ở Tây Ban Nha thay vì những người sinh ra ở Mỹ. Tuy nhiên, như David Bushnell đã viết, \\"không nhiều người muốn độc lập hoàn toàn, nhiều người thậm chí còn ủng hộ Tập trung Junta Tây Ban Nha được thành lập để lãnh đạo cuộc kháng chiến chống Pháp\\". Xung đột mới bắt đầu vào cuối năm 1808 và đầu năm 1809 với việc thành lậpchính phủ của chính quyền quân sự ở Chuquisaca và Quito, những người chống lại thành phần của Junta miền Trung Sevilla. Khi chính quyền Tập trung Junta sụp đổ do cuộc xâm lược của Pháp, năm 1810, juntas mới xuất hiện trên lãnh thổ Tây Ban Nha ở châu Mỹ. Cuộc xung đột giữa các thuộc địa và Tây Ban Nha cuối cùng đã kích hoạt việc thành lập một số quốc gia độc lập từ Argentina và Chile ở phía nam đến Mexico ở phía bắc. Trong khi đó, Cuba và Puerto Rico vẫn bị Tây Ban Nha xâm chiếm cho đến khi Chiến tranh Tây Ban Nha–Mỹ bùng nổ vào năm 1898."},{"page_url":"https://ru.wikipedia.org/wiki/IC_2118","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Witch_head_nebula.jpg","page_title":"IC 2118","context_page_description":"Голова Ведьмы — отражательная туманность в созвездии Эридана. Эта отражательная туманность весьма своеобразной формы связана с яркой звездой Ригель в созвездии Ориона. Она светит в основном за счёт излучения звезды Ригель, расположенной за верхним правым краем изображения. Свет звезды отражается от туманности, состоящей из мелкой пыли. Оттенки синего цвета объясняются не только тем, что Ригель излучает в основном в синей области спектра, но также и тем, что пылинки рассеивают голубой свет эффективнее, чем красный. Туманность находится на расстоянии около 1000 световых лет от Солнца. Площадь туманности — 1,940 кв. градуса. Имеет тот же спектральный класс, что и Ригель — B8Iae.\\nВ плотной части туманности обнаружены несколько компактных объектов, указывающих на возможные процессы звездообразования."},{"page_url":"https://fr.wikipedia.org/wiki/Cit%C3%A9_internationale_de_la_dentelle_et_de_la_mode_de_Calais","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Cit%C3%A9_internationale_de_la_Dentelle_et_de_la_Mode_de_Calais_-_Oeuvre_de_Maria_Domp%C3%A9.JPG","page_title":"Cité internationale de la dentelle et de la mode de Calais","context_page_description":"La cité internationale de la dentelle et de la mode est un musée de Calais qui a été inauguré le 11 juin 2009. Il est principalement consacré à l'histoire de la dentelle tissée sur métiers mécaniques.\\nLa cité internationale de la dentelle et de la mode est installée dans une ancienne usine dentellière, l'usine Boulart, fondée dans les années 1870 et en activité jusqu'en 2000. Le site a été racheté dès 1988 par la ville de Calais avec le projet d'un faire un lieu de valorisation du savoir-faire de la dentelle."},{"page_url":"https://nn.wikipedia.org/wiki/Avenches","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Avenches-coat_of_arms.png","page_title":"Avenches","context_page_description":"Avenches er ein sveitsisk kommune i kantonen Vaud, som ligg i distriktet Broye-Vully. Kommunen har 3 092 innbyggjarar og eit areal på 17,56 km². Kommunesenteret ligg 480 meter over havet.\\nAvenches ligg på ein ås, isolert i Broyedalen, 12 km nordvest for Fribourg."},{"page_url":"https://pl.wikipedia.org/wiki/Stoczek_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Gmina_Stoczek.png","page_title":"Stoczek (gmina)","context_page_description":"Stoczek – gmina wiejska w województwie mazowieckim, w powiecie węgrowskim. W latach 1975–1998 gmina położona była w województwie siedleckim.\\nSiedziba gminy to Stoczek.\\nWedług danych na 31 grudnia 2011 gminę zamieszkiwały 5248 osoby. Natomiast według danych z 31 grudnia 2017 roku gminę zamieszkiwało 5008 osób."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%8B%E8%B0%B7%E5%8C%BA%E5%BD%B9%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Shibuya_City_Office_2019f.jpg","page_title":"渋谷区役所","context_page_description":"渋谷区役所は、特別地方公共団体である渋谷区の組織が入る施設である。宇田川町1番1号に位置し、渋谷公会堂に隣接する。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A6%BE%E0%A6%B2%E0%A7%8B_%E0%A6%AE%E0%A6%A5%E0%A7%81%E0%A6%B0%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Kalij_Pheasant.jpg","page_title":"কালো মথুরা","context_page_description":"কালো মথুরা, কালা মথুরা, কালো ময়ূর বা শুধুই মথুরা Phasianidae গোত্র বা পরিবারের অন্তর্গত Lophura গণের এক প্রজাতির পাখি। কালো মথুরার বৈজ্ঞানিক নামের অর্থ চূড়াধারী পাকড়া ময়ূর । প্রজাতিটি রূপালি মথুরার সাথে একটি মহাপ্রজাতির সৃষ্টি করেছে। আই. ইউ. সি. এন. এই প্রজাতিটিকে Least Concern বা বিপদমুক্ত বলে ঘোষণা করেছে। বাংলাদেশে এরা বিপন্ন বলে বিবেচিত। বাংলাদেশের ১৯৭৪ ও ২০১২ সালের বন্যপ্রাণী আইনে এ প্রজাতিটি সংরক্ষিত। চাকমা ভাষায় কালো মথুরার নাম সানগ্রু। আবার খাসিয়া, মারমা ও ত্রিপুরা ভাষায় এর নাম যথাক্রমে খ্রুট, রই রাতা ও টকরু।"},{"page_url":"https://es.wikipedia.org/wiki/Shaun_Norris","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/010912_-_Shaun_Norris_-_3b_-_2012_Summer_Paralympics_%2803%29.jpg","page_title":"Shaun Norris","context_page_description":"Shaun D. Norris, OAM, ​ es un jugador de paralímpico baloncesto en silla de ruedas australiano."},{"page_url":"https://de.wikipedia.org/wiki/The_Dubliners","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Dubliners.jpg","page_title":"The Dubliners","context_page_description":"The Dubliners waren eine der berühmtesten und einflussreichsten Bands der Irish Folk Music."},{"page_url":"https://de.wikipedia.org/wiki/St._Alban_(Gersheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Gersheim_Pfarrkirche_St._Alban_Innen_02.JPG","page_title":"St. Alban (Gersheim)","context_page_description":"Die Kirche St. Alban ist eine katholische Pfarrkirche im saarländischen Gersheim, Saarpfalz-Kreis. Kirchenpatron ist der heilige Alban von Mainz. In der Denkmalliste des Saarlandes ist die Kirche als Einzeldenkmal aufgeführt."},{"page_url":"https://vi.wikipedia.org/wiki/Alitalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Alitalia_logo_2017.png","page_title":"Alitalia","context_page_description":"Alitalia là một hãng hàng không của Ý. Hãng này lấy tên gọi, quyền hạ cánh, nhiều máy bay và tài sản từ vụ phá sản của Alitalia-Linee Aeree Italiane và toàn bộ Air One. Trụ sở chính công ty đóng ở Fiumicino, Ý. Căn cứ hoạt động chính nằm ở sân bay Leonardo da Vinci-Fiumicino, Roma.\\nTừ Roma, hãng có 27 tuyến bay nội địa và 53 tuyến bay quốc tế đến 38 quốc gia châu Phi, châu Mỹ, châu Á và châu Âu. Đây là hãng hàng không vận chuyển hàng khách lớn thứ 19 thế giới tính theo quy mô đội tàu bay."},{"page_url":"https://en.wikipedia.org/wiki/Hampstead_(UK_Parliament_constituency)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Hampstead1950.png","page_title":"Hampstead (UK Parliament constituency)","context_page_description":"Hampstead was a borough constituency, centered on the Hampstead area of North London. It returned one Member of Parliament to the House of Commons of the Parliament of the United Kingdom, who was elected using the first-past-the-post voting system.\\nIt was created for the 1885 general election, and abolished for the 1983 general election, when it was partly replaced by the new Hampstead and Highgate constituency."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BA%D0%BA%D0%B0%D1%82%D0%BE%D1%80_(%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/PIA20355-Ceres-DwarfPlanet-OccatorCrater-Center-201602-crop.jpg","page_title":"Оккатор (кратер)","context_page_description":"Окка́тор — ударный кратер на Церере. Назван в честь римского божества боронования, помощника Цереры.\\nМаксимальная разность высот между самыми высокими горами вала и самыми низкими точками дна кратера достигает 6 км: на валу имеется несколько обрывов высотой около 2 км."},{"page_url":"https://vi.wikipedia.org/wiki/Lionel_Messi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Lionel_Messi_Joan_Gamper_Trophy.jpg","page_title":"Lionel Messi","context_page_description":"Lionel Andrés \\"Leo\\" Messi Cuccittini là một cầu thủ bóng đá người Argentina hiện đang chơi cho câu lạc bộ Barcelona và đội tuyển bóng đá quốc gia Argentina. Messi được coi là một trong những cầu thủ xuất sắc nhất mọi thời đại và là một trong những cầu thủ xuất sắc nhất thế giới thời điểm hiện tại. Anh là chủ nhân của 6 Quả bóng vàng vào các năm 2009, 2010, 2011, 2012, 2015, và 2019, cầu thủ xuất sắc nhất năm của FIFA 6 lần, cầu thủ đầu tiên và duy nhất tới nay 6 lần giành Chiếc giày vàng châu Âu. Lối chơi của anh thường được so sánh với Diego Maradona, người tự coi Messi là \\"truyền nhân\\" của mình.\\nMessi rời đội bóng quê nhà Newell's Old Boys năm 2000 và cùng cả gia đình chuyển tới Tây Ban Nha sau khi Barcelona đề nghị hỗ trợ anh chi phí điều trị chứng thiếu hụt hormone tăng trưởng. Trong trận ra mắt vào mùa giải 2004-2005, anh đã phá vỡ kỉ lục cầu thủ trẻ nhất ra sân của La Liga và trở thành cầu thủ trẻ nhất ghi bàn ở giải này khi đó."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%A5%D5%A3%D5%A5%D5%B6%D5%BD%D5%A2%D5%B8%D6%82%D6%80%D5%A3_(%D5%B7%D6%80%D5%BB%D5%A1%D5%B6)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Bayern_landkreis_regensburg_karte.png","page_title":"Ռեգենսբուրգ (շրջան)","context_page_description":"Ռեգենսբուրգ, շրջան Գերմանիայում։ Շրջանի կենտրոնն է Ռեգենսբուրգ քաղաքը։ Զբաղեցնում է 1.395,92 կմ²։ Բնակչությունը 182 400 մարդ է։ Բնակչության խտությունը 129 մարդ/կմ²։\\nՇրջանի պաշտոնական կոդը 09 3 75 է։ Շրջանում 41 համայնք կա։"},{"page_url":"https://es.wikipedia.org/wiki/Mark_Few","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mark-few-USD-vs-Gonzaga-feb-18-08.jpg","page_title":"Mark Few","context_page_description":"Mark Norman Few es un entrenador de baloncesto estadounidense que ejerce en la NCAA.​"}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},F={class:"search-container"},T={class:"card-container"},G={key:0,class:"empty-state"},I